  {album_id: 1, singer_id: nil, team_id: 1, title: "어디에도", genre1: "가요", genre2: "발라드", runtime: "05:31", lyrics: "\n\t\t\t\t\t\t\t<div>어디에도 - 05:31</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">차가워진 눈빛을 바라보며 \r\n이별의 말을 전해 들어요\r\n아무 의미 없던 노래 가사가 \r\n아프게 귓가에 맴돌아요\r\n\r\n다시 겨울이 시작되듯이 \r\n흩어지는 눈 사이로\r\n그대 내 맘에 쌓여만 가네\r\n\r\n떠나지 말라는 \r\n그런 말도 하지 못하고\r\n고개를 떨구던 뒷모습만\r\n\r\n그대 내게 오지 말아요 \r\n두 번 다시 이런 사랑하지 마요\r\n그댈 추억하기보단 \r\n기다리는 게 부서진 \r\n내 맘이 더 아파 와\r\n다시 누군가를 만나서 \r\n결국 우리 사랑 지워내도\r\n행복했던 것만 기억에 남아 \r\n나를 천천히 잊어주기를\r\n\r\n아무것도 마음대로 안 돼요 \r\n아픔은 그저 나를 따라와\r\n밤새도록 커져 버린 그리움 \r\n언제쯤 익숙해져 가나요\r\n\r\n많은 날들이 떠오르네요 \r\n우리가 나눴던 날들\r\n애써 감추고 돌아서네요\r\n\r\n떠나지 말라는 \r\n그런 말도 하지 못하고\r\n고개를 떨구던 뒷모습만\r\n\r\n그대 내게 오지 말아요 \r\n두 번 다시 이런 사랑하지 마요\r\n그댈 추억하기보단 \r\n기다리는 게 부서진 \r\n내 맘이 더 아파 와\r\n다시 누군가를 만나서 \r\n결국 우리 사랑 지워내도\r\n행복했던 것만 기억에 남아 \r\n나를 천천히 잊어주기를\r\n\r\n부를 수도 없이 멀어진 그대가\r\n\r\n지나치는 바람에도 \r\n목이 메어와 어디에도 \r\n그대가 살아서\r\n우린 사랑하면 안 돼요\r\n다가갈수록 미워지니까\r\n행복했던 것만 기억에 남아 \r\n나를 천천히 잊어가기를\r\n사랑했던</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/784/293/80784293_1453884534908_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 46009, song_num: 85887585, lowkey: "D4#", highkey: "D6"},
  {album_id: 2, singer_id: nil, team_id: 2, title: "봄인가 봐 (Spring Love)", genre1: "가요", genre2: "발라드", runtime: "03:19", lyrics: "\n\t\t\t\t\t\t\t<div>봄인가 봐 (Spring Love) - 03:19</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">눈꽃이 내린 버스 정류장에 \r\n날 데려다주다\r\n꼭 내 손을 잡는 너 때문에 \r\n나 놀랐어\r\n아주 오래전부터 숨겼던 \r\n내 맘이 들킨 걸까\r\n부는 바람에 실린 \r\n우리에게 번진 This is love \r\n\r\n내 마음에 내려와 \r\n사뿐히 내려와\r\n네 어깨 위에도 \r\n벌써 내린 그 이름 \r\n봄인가 봐\r\n우리 잡은 손 틈 사이 \r\n얇아진 외투 사이\r\n어느새 스며들어 \r\n우릴 변화시킨 \r\n봄이 왔나 봐\r\n\r\n첨엔 그랬어 편한 친구 \r\n혹 동생 같았어\r\n치마를 입고 꾸민 모습에도 \r\n놀라지 않았어\r\n뭐가 우릴 지금 이렇게 \r\n바꿔 놓은 걸까\r\nMaybe it’s crazy \r\nCan I call you my baby Yeah\r\n\r\n내 마음에 내려와 \r\n사뿐히 내려와\r\n네 어깨 위에도 \r\n벌써 내린 그 이름 \r\n봄인가 봐\r\n우리 잡은 손 틈 사이 \r\n얇아진 외투 사이\r\n어느새 스며들어 \r\n우릴 변화시켜 Oh\r\n\r\n우리 서로에 \r\n기대어 잠든 벤치\r\n투명한 하늘에 물든 \r\nSweet cherry blossom\r\n늘 이러면 좋겠다 Yeah\r\n우릴 바꾼 그 이름 \r\n봄봄봄 봄 Ooh\r\n널 사랑해 너를 사랑해 \r\n사랑해 널 Yeah\r\n\r\n넌 봄이 돼줘 \r\n항상 나는 꽃이 될게 \r\n서로를 녹여주고 \r\n열리게 해주면 좋겠다\r\n안 보이던 마음과 마음 \r\n마주한 시선 사이 \r\n겨우내 숨어있던 \r\n꽃이 피었나 봐 \r\n봄이 왔나 봐</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/797/320/80797320_1456999961311_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 46142, song_num: 86027188, lowkey: "F3#", highkey: "G4#"},
  {album_id: 3, singer_id: 6, team_id: nil, title: "걱정말아요 그대", genre1: "OST", genre2: "드라마", runtime: "03:52", lyrics: "\n\t\t\t\t\t\t\t<div>걱정말아요 그대 - 03:52</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">그대여 아무 걱정 하지 말아요\r\n우리 함께 노래 합시다\r\n그대 아픈 기억들 모두 그대여\r\n그대 가슴에 깊이 묻어 버리고 \r\n\r\n지나간 것은 지나간 대로\r\n그런 의미가 있죠\r\n떠난 이에게 노래 하세요\r\n후회없이 사랑했노라 말해요\r\n\r\n그대는 너무 힘든 일이 많았죠\r\n새로움을 잃어 버렸죠\r\n그대 슬픈 얘기들 모두 그대여\r\n그대 탓으로 훌훌 털어 버리고\r\n\r\n지나간 것은 지나간 대로\r\n그런 의미가 있죠\r\n우리 다 함께 노래 합시다\r\n후회없이 꿈을 꾸었다 말해요\r\n\r\n지나간 것은 지나간 대로\r\n그런 의미가 있죠\r\n우리 다 함께 노래 합시다\r\n후회없이 꿈을 꾸었다 말해요\r\n\r\n지나간 것은 지나간 대로\r\n그런 의미가 있죠\r\n우리 다 함께 노래 합시다\r\n후회없이 꿈을 꾸었다 말해요\r\n새로운 꿈을 꾸겠다 말해요</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/736/024/80736024_1446818236525_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 45592, song_num: 85398843, lowkey: "A2", highkey: "A4"},
  {album_id: 4, singer_id: nil, team_id: 3, title: "벚꽃 엔딩", genre1: "가요", genre2: "락", runtime: "04:20", lyrics: "\n\t\t\t\t\t\t\t<div>벚꽃 엔딩 - 04:20</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">그대여 그대여 그대여 그대여 그대여\r\n\r\n오늘은 우리 같이 걸어요 이 거리를\r\n밤에 들려오는 자장노래 어떤가요 오예\r\n\r\n몰랐던 그대와 단 둘이 손 잡고\r\n알 수 없는 이 떨림과 둘이 걸어요\r\n\r\n봄바람 휘날리며 흩날리는 벚꽃 잎이 \r\n울려 퍼질 이 거리를 우우 둘이 걸어요\r\n봄바람 휘날리며 흩날리는 벚꽃 잎이\r\n울려 퍼질 이 거리를 우우 둘이 걸어요 오예\r\n\r\n그대여 우리 이제 손 잡아요 이 거리에\r\n마침 들려오는 사랑 노래 어떤가요 오예\r\n\r\n사랑하는 그대와 단 둘이 손잡고\r\n알 수 없는 이 거리를 둘이 걸어요\r\n\r\n봄바람 휘날리며 흩날리는 벚꽃 잎이 \r\n울려 퍼질 이 거리를 우우 둘이 걸어요\r\n봄바람 휘날리며 흩날리는 벚꽃 잎이\r\n울려 퍼질 이 거리를 우우 둘이 걸어요 \r\n\r\n바람 불면 울렁이는 기분 탓에 나도 모르게 \r\n바람 불면 저편에서 \r\n그대여 니 모습이 자꾸 겹쳐\r\n오 또 울렁이는 기분 탓에 나도 모르게\r\n바람 불면 저편에서 \r\n그대여 니 모습이 자꾸 겹쳐\r\n\r\n사랑하는 연인들이 많군요 \r\n알 수 없는 친구들이 많아요\r\n흩날리는 벚꽃 잎이 많군요 좋아요\r\n\r\n봄바람 휘날리며 흩날리는 벚꽃 잎이 \r\n울려 퍼질 이 거리를 우우 둘이 걸어요\r\n봄바람 휘날리며 흩날리는 벚꽃 잎이\r\n울려 퍼질 이 거리를 우우 둘이 걸어요\r\n\r\n그대여 그대여 그대여 그대여 그대여</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/287/115/80287115_1332318513743_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 35184, song_num: 81302362, lowkey: "C4#", highkey: "A5"},
  {album_id: 5, singer_id: nil, team_id: 4, title: "응급실", genre1: "OST", genre2: "드라마", runtime: "03:45", lyrics: "\n\t\t\t\t\t\t\t<div>응급실 - 03:45</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">후회 하고 있어요 \r\n우리 다투던 그 날 \r\n괜한 자존심 때문에 \r\n끝내자고 말을 해버린거야 \r\n금방 볼 줄 알았어 \r\n날 찾길 바래왔어 \r\n허나 며칠이 지나도 \r\n아무 소식조차 없어 \r\n항상 내게 너무 잘해줘서\r\n쉽게 생각했나봐 \r\n이젠 알아 내 고집때문에 \r\n힘들었던 너를 \r\n이 바보야 진짜 아니야 \r\n아직도 나를 그렇게 몰라 \r\n너를 가진 사랑 나밖엔 없는데 \r\n제발 나를 떠나가지마 \r\n언제라도 내 편이 돼준 너 \r\n고마운 줄 모르고 \r\n철없이 나 멋대로한거 \r\n용서할수 없니 \r\n이 바보야 진짜 아니야 \r\n아직도 나를 그렇게 몰라 \r\n너를 가진 사랑 나 밖엔 없는데 \r\n제발 떠나가지마 \r\n너 하나만 사랑하는데 \r\n이대로 나를 두고 가지마 \r\n나를 버리지마 그냥 날 안아줘 \r\n다시 사랑하게 돌아와</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/029/371/15029371_1342400749964_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 14515, song_num: 16186028, lowkey: "G3", highkey: "G5#"},
  {album_id: 6, singer_id: 10, team_id: nil, title: "친구라도 될 걸 그랬어", genre1: "가요", genre2: "R&amp;B/소울", runtime: "04:41", lyrics: "\n\t\t\t\t\t\t\t<div>친구라도 될 걸 그랬어 - 04:41</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">벌써 넌 내가 편하니\r\n웃으며 인사할 만큼\r\n까맣게 나를 잊었니\r\n니 곁에 있는 사람 소개할 만큼\r\n견디긴 너무 힘든데\r\n자꾸만 울고 싶은데\r\n내 옆이 아닌 자리에\r\n너를 보고 있는 게\r\n왜 그게 행복한걸까\r\n\r\n친구라도 될 걸 그랬어\r\n모두 다 잊고서\r\n다른 사람 만나는\r\n널 보아도 슬프지 않게\r\n그저 바라보고 있었어\r\n한참 동안 니 옆에\r\n그 사람까지도\r\n잠시라도 더 보려고\r\n다시 혹시라도 널 보게 되면\r\n그 땐 모르는 척 해볼게\r\n웃어도 볼게\r\n지금의 너처럼 우-\r\n\r\n눈감지 말고 보낼 걸\r\n가는 널 꼭 지켜볼걸\r\n차가운 너의 걸음에\r\n마지막 내 눈물도\r\n묻혀서 보내버릴걸\r\n\r\n너무 모진 너의 모습이\r\n미워져 버려서\r\n다른 사람 만나는\r\n널 보아도 슬프지 않게\r\n그저 바라보고 있었어\r\n한참 동안 니 옆에\r\n그 사람까지도\r\n잠시라도 더 보려고\r\n다시 혹시라도 널 보게 되면\r\n그땐 모르는 척 해볼게\r\n웃어도 볼게 지금의 너처럼\r\n\r\n차라리 잘된 것 같아\r\n다시 널 또 한번\r\n미워할 수 있을 테니\r\n\r\n혹시 아직 너도 나처럼\r\n편해지지 못하고\r\n아파만 하는 거니\r\n애써 너도 참는 거니\r\n혹시 니가 다시 돌아올까 봐\r\n나의 곁엔 아직 그대로\r\n비워져 있어 너의 자리라서</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/027/641/15027641_1383204820697_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 11238, song_num: 16158949, lowkey: "D4", highkey: "D6"},
  {album_id: 7, singer_id: 11, team_id: nil, title: "또 다시 사랑", genre1: "가요", genre2: "발라드", runtime: "04:36", lyrics: "\n\t\t\t\t\t\t\t<div>또 다시 사랑 - 04:36</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">아픔이 좀 더 작아질까\r\n의미 없는 만남을 하다가\r\n어느 날 그대가 흘린 눈물\r\n왠지 나와 같다 느껴서\r\n\r\n이렇게 그대를\r\n지키는가 봐요\r\n행복하고 싶었던 그대를\r\n몰랐던 누군갈\r\n또 알아가면서\r\n분명 행복할 걸 알겠지만\r\n\r\n내가 그대를 만났다는 건\r\n어쩌면 흘러가는\r\n흔한 인연이란\r\n것일지 모르지만\r\n오늘도 다시\r\n또 다시 사랑해요\r\n사랑 언제나\r\n이번이 마지막이라며\r\n처음인 듯 찾아오니까\r\n\r\n어느 날 그대가 숨긴 눈물\r\n왠지 나와 같다 느껴서\r\n이렇게 그대를\r\n지키는 가 봐요\r\n행복하고 싶었던 그대를\r\n몰랐던 누군갈\r\n또 알아가는 게\r\n혹시 두렵기도 하겠지만\r\n\r\n내가 그대를 만났다는 건\r\n어쩌면 흘러가는\r\n흔한 인연이란\r\n것일지 모르지만\r\n오늘도 다시\r\n또 다시 사랑해요\r\n사랑 언제나\r\n이번이 마지막이라며\r\n처음인 듯 찾아오니까\r\n\r\n절대 우리 작은\r\n다툼조차 하지 마요\r\n이별 후엔 서운함만\r\n가슴속에 남으니\r\n사소한 그 표현이 그 말들이\r\n언제나 나에겐\r\n참 고마울 거예요\r\n\r\n내가 그대를 만났다는 건\r\n어쩌면 흘러가는\r\n흔한 인연이란\r\n것일지 모르지만\r\n\r\n오늘도 다시\r\n또 다시 사랑해요\r\n사랑 언제나\r\n이번이 마지막이라며\r\n처음인 듯 찾아오니까\r\n사랑 언제나\r\n이번이 마지막이라며</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/684/047/80684047_1442847061816_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 45372, song_num: 85059847, lowkey: "C4", highkey: "A5#"},
  {album_id: 8, singer_id: 11, team_id: nil, title: "소주 한잔", genre1: "가요", genre2: "발라드", runtime: "04:51", lyrics: "\n\t\t\t\t\t\t\t<div>소주 한잔 - 04:51</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">술이 한 잔 생각 나는 밤 \r\n같이 있는 것 같아요\r\n그 좋았던 시절들 \r\n이젠 모두 한숨만 되네요\r\n\r\n떠나는 그대 얼굴이 \r\n혹시 울지나 않을까\r\n난 먼저 돌아섰죠 \r\n그때부터 그리워요\r\n\r\n사람이 변하는 걸요 \r\n다시 전보다 그댈 원해요\r\n이렇게 취할때면 \r\n꺼져버린 전화를 붙잡고\r\n\r\n여보세요 나야 거기 잘 지내니 \r\n여보세요 왜 말 안하니\r\n울고 있니 내가 오랜만이라서\r\n사랑하는 사람이라서\r\n\r\n그대 소중한 마음 밀쳐낸 \r\n이기적인 그때의 나에게\r\n그대를 다시 불러오라고 \r\n미친듯이 외쳤어\r\n\r\n떠나는 그대 얼굴이 \r\n마치 처음과 같아서\r\n나 눈물이 났어요 \r\n그때부터 그리워요\r\n\r\n사람이 변하는 걸요 \r\n다시 전보다 그댈 원해요\r\n이렇게 취할때면 \r\n바뀌어버린 전화번호를 누르고\r\n\r\n여보세요 나야 거기 잘 지내니 \r\n오랜만이야 내 사랑아\r\n그대를 다시 불러오라고 \r\n미친듯이 울었어\r\n\r\n여보세요 나야 정말 미안해 \r\n이기적인 그때의 나에게\r\n그대를 다시 불러 오라고 \r\n미친듯이 외쳤어</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/027/208/15027208_1378461687374_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 11491, song_num: 16149465, lowkey: "F3#", highkey: "B5"},
  {album_id: 9, singer_id: nil, team_id: 5, title: "이 사랑", genre1: "OST", genre2: "드라마", runtime: "03:45", lyrics: "\n\t\t\t\t\t\t\t<div>이 사랑 - 03:45</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">시간을 되돌리면 \r\n기억도 지워질까\r\n해볼 수도 없는 말들을 \r\n내뱉는 걸 알아\r\n\r\n널 힘들게 했고 \r\n눈물로 살게 했던\r\n미안한 마음에 그런 거야\r\n\r\n하지만 난 말야\r\n너의 밖에선 살 수 없어\r\n\r\n내겐 너 하나로 물든 시간만이 \r\n흘러갈 뿐이야\r\n\r\n사랑해요. 고마워요 \r\n따뜻하게 나를 안아줘\r\n이 사랑 땜에 나는 살 수 있어\r\n\r\n사랑은 그런가봐 \r\n무슨 말을 해봐도\r\n채워지지 않은 것 같은 \r\n마음이 드나봐\r\n\r\n내 욕심이라고 \r\n다시 생각을 해봐도\r\n그 마음 쉽게 사라지지 않아\r\n\r\n알잖아 난 말야\r\n너의 밖에선 살 수 없어\r\n\r\n내겐 너 하나로 물든 시간만이 \r\n흘러갈 뿐이야\r\n\r\n사랑해요 고마워요 \r\n따뜻하게 나를 안아줘\r\n이 사랑 땜에 나는 살 수 있어\r\n\r\n돌아가도 다시 견딜 수 있을까\r\n너무 힘들던 시간들\r\n\r\n흔들리지 않은 너를 볼 때면\r\n떨리는 내 입술이\r\n\r\n두루루..두루루..\r\n\r\n알잖아 난 말야\r\n너의 밖에선 살 수 없어\r\n\r\n내겐 너 하나로 물든 시간만이 \r\n흘러갈 뿐이야\r\n\r\n사랑해요 고마워요 \r\n따뜻하게 나를 안아줘\r\n이 사랑 땜에 나는 살 수 있어\r\n사랑 땜에 나는 살 수 있어</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/796/234/80796234_1456909197595_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 46136, song_num: 86163654, lowkey: "F3#", highkey: "E5"},
  {album_id: 10, singer_id: nil, team_id: 6, title: "시간을 달려서 (Rough)", genre1: "가요", genre2: "댄스", runtime: "03:29", lyrics: "\n\t\t\t\t\t\t\t<div>시간을 달려서 (Rough) - 03:29</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">다가서지 못하고 \r\n헤매이고 있어\r\n좋아하지만 \r\n다른 곳을 보고 있어\r\n가까워 지려고 \r\n하면 할수록\r\n멀어져 가는 \r\n우리 둘의 마음처럼\r\n\r\n만나지 못해 맴돌고 있어\r\n우린 마치 평행선처럼\r\n말도 안돼 우린 \r\n반드시 만날 거야\r\n기다릴게 언제까지나\r\n\r\n미처 말하지 못했어 \r\n다만 너를 좋아했어\r\n어린 날의 꿈처럼 \r\n마치 기적처럼\r\n시간을 달려서 \r\n어른이 될 수만 있다면\r\n거친 세상 속에서 \r\n손을 잡아줄게\r\n\r\n다가서려 해봐도 \r\n엇갈리고 있어\r\n좋아한단 말도 \r\n아직 못하고 있어\r\n머뭇거리는 \r\n널 보고 있으면\r\n우린 아직도 많이 \r\n어리긴 한가 봐\r\n\r\n좁혀지지 않아 한 끗 차이\r\n우린 마치 평행선처럼\r\n언젠가는 못다한 \r\n말을 전할 거야\r\n다가갈게 언제까지나\r\n\r\n미처 말하지 못했어 \r\n다만 너를 좋아했어\r\n어린 날의 꿈처럼 \r\n마치 기적처럼\r\n시간을 달려서 \r\n어른이 될 수만 있다면\r\n거친 세상 속에서 \r\n손을 잡아줄게\r\n\r\n시간 속에 갇혀 \r\n길을 헤매여도\r\n그렇지만 우린 \r\n결국 만날 거야\r\n진심인 것만 \r\n알아줘 정말\r\n서툴기만 한대도\r\n\r\n미처 말하지 못했어 \r\n다만 너를 좋아했어\r\n어린 날의 꿈처럼 \r\n마치 기적처럼\r\n시간을 달려서 \r\n어른이 될 수만 있다면\r\n거친 세상 속에서 \r\n너를 안아줄게\r\n\r\n이거 하나만 약속해 \r\n변치 않기를 바랄게\r\n그때도 지금처럼 \r\n날 향해 웃어줘\r\n시간이 흘러서\r\n어른이 될 수만 있다면\r\n엇갈림 그 속에서 \r\n손을 잡아줄게</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/782/846/80782846_1453641841573_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 45993, song_num: 85871514, lowkey: "C4", highkey: "D5#"},
  {album_id: 9, singer_id: 10, team_id: nil, title: "You Are My Everything", genre1: "OST", genre2: "드라마", runtime: "04:01", lyrics: "\n\t\t\t\t\t\t\t<div>You Are My Everything - 04:01</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">처음부터 그대였죠.\r\n나에게 다가올 한 사람.\r\n단 한 번의 스침에도 \r\n내 눈빛이 말을 하죠.\r\n\r\n바람처럼 스쳐가는\r\n인연이 아니길 바래요.\r\n바보처럼 먼저 말하지 못했죠.\r\n할 수가 없었죠.\r\n\r\nYou are my everything\r\n별처럼 쏟아지는 운명에\r\n그대라는 사람을 만나고\r\n멈춰버린 내 가슴속에\r\n단 하나의 사랑\r\nYou are my everything\r\n\r\n안갯속에 피어나는\r\n하얗게 물들은 그대 모습\r\n한순간에 내게 심장이 \r\n멈출 듯 다가와 버렸죠.\r\n\r\nYou are my everything\r\n별처럼 쏟아지는 운명에\r\n그대라는 사람을 만나고\r\n멈춰버린 내 가슴속에\r\n단 하나의 사랑\r\nYou are my everything\r\n\r\n시작도 못 했던 나의 사랑을 \r\n이제는 말할 수 있죠\r\n누구도 가질 수 없는 기적인데\r\n\r\nYou are my everything\r\n뜨거운 내 사랑은 그댄 걸\r\n계절이 변해도 난 이곳에\r\n멈춰버린 내 가슴속에\r\n단 하나의 사랑\r\nYou are my everything</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/798/466/80798466_1457517031377_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 46169, song_num: 86163655, lowkey: "A3#", highkey: "D5#"},
  {album_id: 11, singer_id: 20, team_id: nil, title: "야생화", genre1: "가요", genre2: "발라드", runtime: "05:12", lyrics: "\n\t\t\t\t\t\t\t<div>야생화 - 05:12</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">하얗게 피어난 얼음 꽃 하나가\r\n달가운 바람에 얼굴을 내밀어\r\n아무 말 못했던 이름도 몰랐던\r\n지나간 날들에 눈물이 흘러\r\n\r\n차가운 바람에 숨어 있다\r\n한줄기 햇살에 몸 녹이다\r\n그렇게 너는 또 한번 내게 온다\r\n\r\n좋았던 기억만\r\n그리운 마음만\r\n니가 떠나간 그 길 위에\r\n이렇게 남아 서있다\r\n잊혀질 만큼만\r\n괜찮을 만큼만\r\n눈물 머금고 기다린 떨림 끝에 \r\n다시 나를 피우리라\r\n\r\n사랑은 피고 또 지는\r\n타버리는 불꽃\r\n빗물에 젖을까 두 눈을 감는다\r\n\r\n어리고 작았던 나의 맘에\r\n눈부시게 빛나던 추억 속에\r\n그렇게 너를 또 한번 불러본다\r\n\r\n좋았던 기억만\r\n그리운 마음만\r\n니가 떠나간 그 길 위에\r\n이렇게 남아 서있다\r\n잊혀질 만큼만\r\n괜찮을 만큼만\r\n눈물 머금고 기다린 떨림 끝에 \r\n다시 나는 \r\n\r\n메말라가는 땅 위에 \r\n온몸이 타 들어가고\r\n내 손끝에 남은\r\n너의 향기 흩어져 날아가\r\n\r\n멀어져 가는 너의 손을\r\n붙잡지 못해 아프다\r\n살아갈 만큼만\r\n미워했던 만큼만\r\n먼 훗날 너를 데려다 줄 \r\n그 봄이 오면 그날에 나 피우리라</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/414/439/80414439_1395973335427_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 38263, song_num: 82402846, lowkey: "D3#", highkey: "C5"},
  {album_id: 12, singer_id: nil, team_id: 7, title: "체념", genre1: "가요", genre2: "발라드", runtime: "05:00", lyrics: "\n\t\t\t\t\t\t\t<div>체념 - 05:00</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">행복했어 너와의 시간들 \r\n아마도 너는 힘들었겠지 \r\n너의 마음을 몰랐던 건 아니야 \r\n나도 느꼈었지만 \r\n\r\n널 보내는 게 널 떠나 보내는 게 \r\n아직은 익숙하지가 않아 \r\n그렇게 밖에 할 수 없던 니가 원망스러워 \r\n\r\n왜 말 안 했니 아님 못한거니 \r\n조금도 날 생각하지 않았니 \r\n좋아한다며 사랑한다며 \r\n이렇게 끝낼 거면서 왜 그런 말을 했니 \r\n\r\n널 미워해야만 하는 거니 \r\n아니면 내 탓을 해야만 하는 거니 \r\n시간을 돌릴 수만 있다면 다시 예전으로 \r\n돌아가고 싶은 마음 뿐이야 \r\n\r\n왜 말 안 했니 아님 못한 거니 \r\n조금도 날 생각하지 않았니 \r\n좋아한다며 사랑한다며 \r\n이렇게 끝낼 거면서 왜 그런 말을 했니 \r\n\r\n널 미워해야만 하는 거니 \r\n아니면 내 탓을 해야만 하는 거니 \r\n시간을 돌릴 수만 있다면 다시 예전으로 \r\n돌아가고 싶은 마음 뿐이야 \r\n\r\n그래 더 이상 묻지 않을게 \r\n내 곁을 떠나고 싶다면 \r\n돌아보지 말고 떠나가 \r\n\r\n눈물은 흘리지 않을 게\r\n괜히 마음만 약해지니까 \r\n\r\n내게서 멀어진 니 모습이\r\n흐릿하게 보여 눈물이 나나봐 \r\n\r\n널 많이 그리워 할 것 같아 \r\n참아야만 하겠지 잊혀 질 수있도록 \r\n\r\n다시 사랑 같은 거 하지 않을래 \r\n\r\n내 마지막 사랑은 \r\n돌아선 너에게 주고 싶어서 \r\n\r\n행복하길 바래 \r\n나보다 좋은 여자 만나기를</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/027/640/15027640_1399965645543_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 11019, song_num: 16158939, lowkey: "F3", highkey: "F5"},
  {album_id: 9, singer_id: 23, team_id: nil, title: "ALWAYS", genre1: "OST", genre2: "드라마", runtime: "03:25", lyrics: "\n\t\t\t\t\t\t\t<div>ALWAYS - 03:25</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">그대를 바라볼 때면 \r\n모든 게 멈추죠\r\n언제부턴지 나도 모르게였죠\r\n\r\n어느 날 꿈처럼 그대 다가와 \r\n내 맘을 흔들죠\r\n운명이란 걸 나는 느꼈죠\r\n\r\nI love you \r\n듣고 있나요 \r\nOnly you\r\n눈을 감아 봐요. \r\n\r\n바람에 흔들려 온 그대 사랑\r\nWhenever, wherever you are\r\nWhenever, wherever you are\r\nOh oh\r\nOh love, love, love\r\n\r\n어쩌다 내가 널 사랑했을까 \r\n밀어내려 해도 \r\n내 가슴이 널 알아봤을까\r\n\r\nI love you \r\n듣고 있나요 \r\nOnly you\r\n눈을 감아 봐요. \r\n모든 게 변해도 변하지 않아\r\n넌 나의, 난 너의 사랑\r\n\r\n그대 조금 돌아온대도\r\n다시 나를 스쳐 지나더라도\r\n괜찮아요 그댈 위해 \r\n내가 여기 있을게\r\n\r\nI love you \r\n잊지 말아요. \r\nOnly you\r\n내 눈물의 고백\r\n바람에 흩날려 온 그대 사랑\r\n\r\nWhenever, wherever you are\r\nWhenever, wherever you are</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/791/890/80791890_1455701338470_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 46088, song_num: 86163652, lowkey: "A3", highkey: "D5"},
  {album_id: 13, singer_id: nil, team_id: 8, title: "가시", genre1: "가요", genre2: "락", runtime: "04:02", lyrics: "\n\t\t\t\t\t\t\t<div>가시 - 04:02</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">너 없는 지금도\r\n눈부신 하늘과 \r\n눈부시게 웃는 사람들 \r\n나의 헤어짐은\r\n모르는 세상은 \r\n슬프도록 그대로인데 \r\n\r\n시간마저 데려가지 못하게 \r\n나만은 널 보내지 못했나봐 \r\n가시처럼 깊게 박힌 기억은 \r\n아파도 아픈줄 모르고 \r\n\r\n그대 기억이 지난 사랑이 \r\n내 안을 파고 드는\r\n가시가 되어 \r\n제발 가라고 아주 가라고 \r\n애써도 나를 괴롭히는데 \r\n\r\n아픈만큼 너를 잊게 된다면 \r\n차라리 앓고 나면 그만인데 \r\n가시처럼 깊게 박힌 기억은 \r\n아파도 아픈줄 모르고 \r\n그대 기억이 지난 사랑이 \r\n내 안을 파고 드는\r\n가시가 되어 \r\n제발 가라고 아주 가라고 \r\n애써도 나를 괴롭히는데 \r\n\r\n너무 사랑했던 나를 \r\n그게 두려웠던 나를 \r\n미치도록 너를 그리워했던 \r\n날 이제는 놓아줘 \r\n\r\n보이지 않아 내 안에 숨어 \r\n잊으려 하면 할수록\r\n더 아파와 \r\n제발 가라고 아주 가라고 \r\n애써도 나를 괴롭히는데</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/017/465/580/17465580_1445915794128_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 14684, song_num: 17465599, lowkey: "F4#", highkey: "A5"},
  {album_id: 14, singer_id: nil, team_id: 9, title: "Don't Cry", genre1: "가요", genre2: "락", runtime: "05:01", lyrics: "\n\t\t\t\t\t\t\t<div>Don't Cry - 05:01</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">그대의 눈물이 마를 때까지\r\n우리의 사랑을 볼 수 없을테니\r\n울지말아요 이제야\r\n나는 알겠으니\r\n날 사랑하던 그대는\r\n이미 없다는 걸\r\n\r\nSo you don't cry for me\r\n세월 지나도 난 변하지 않아\r\nAnd then I cry for you\r\n이 밤 지나면 이젠 안녕\r\n영원히\r\n\r\n그대의 아픔도 눈물도\r\n슬픈 상처도\r\n내가 갖겠다던 약속들\r\n잊지 않았기에\r\n울지말아요 이토록 사랑하기에\r\n이젠 안녕 천천히 그리고 영원히\r\n\r\nSo you don't cry for me\r\nSo you don't\r\nSo you don't\r\nSo you never dream my heart\r\nAnd then I cry for you\r\n이 밤 지나면 이젠 안녕\r\n\r\n영원히 널 사랑해 널 사랑해 \r\n영원히\r\n\r\n널 사랑해 널 사랑해 널 사랑해\r\nSo you don't cry for me</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/018/358/901/18358901_1442368609068_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 46180, song_num: 18358941, lowkey: "C4", highkey: "F6"},
  {album_id: 15, singer_id: nil, team_id: 1, title: "행복하지 말아요", genre1: "가요", genre2: "락", runtime: "05:59", lyrics: "\n\t\t\t\t\t\t\t<div>행복하지 말아요 - 05:59</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">왜 이리도 \r\n이 세상은 이별이 많은지 \r\n왜 사랑은 힘든건지 \r\n난 궁금했었죠 \r\n난 이제또다시 묻고있죠 \r\n어떻게 견디는지 \r\n이 많은 슬픔 끝나긴 하는지 \r\n\r\n괜찮아요 다 그렇듯 \r\n이러다 말겠죠 \r\n이 가슴도 이 눈물도 \r\n다 가라앉겠죠 \r\n더 안을수록 부서져버릴\r\n우리를 알고 있죠 \r\n보내는일이 사랑이라는걸 \r\n\r\n사랑해 사랑해 말해줄 시간이\r\n아직도 많을줄 알았죠 \r\n언젠가 누군가 그대를 가져갈 \r\n그 사람 벌써부터 \r\n난 부러워지네요 \r\n\r\n행복하지마요 행복하려면 \r\n사랑한 날 잊어야 하잖아 \r\n가시가 박힌듯 숨쉴 때 마다 \r\n눈물이 흘러와 \r\n사는게 사는것이 아니죠 \r\n사랑하지 마요 내가 아니면 \r\n누구와도 영원할 수 없어 \r\n그대를 그 곳에 두고온곳 \r\n그곳만 기억하면 \r\n찾을 수 있죠 잠시 멈춰있는 \r\n사랑인거죠 괜찮아요 \r\n웃어요 \r\n\r\n하루에도 나 몇번씩 \r\n마음이 바뀌죠 \r\n또 버리고 주워담고 \r\n오늘도 그래요 \r\n꼭 좋은사람 만날거라고 \r\n말하는 나였지만 \r\n나의 가슴은 그댈 잡고 있죠 \r\n\r\n사랑해, 사랑해, \r\n나에게 말해 줄 \r\n그대의 목소릴 \r\n이제 들을 수 없겠죠 \r\n조금만 잠시만 \r\n머물다 올것을 \r\n그대의 곁에있는 \r\n그 사람도 아나요 \r\n\r\n행복하지 마요 행복하려면 \r\n사랑한 날 잊어야 하잖아\r\n가시가 박힌듯 숨쉴 때 마다 \r\n눈물이 흘러와 사는게\r\n사는것이 아니죠 \r\n사랑하지 마요 \r\n내가 아니면, 누구와도\r\n영원할 수 없어 \r\n그대를 그 곳에 두고 온곳\r\n그곳만 기억하면 \r\n찾을 수 있죠 \r\n잠시 멈춰있는 사랑인거죠 \r\n괜찮아요 웃어요 \r\n\r\n사랑하지 마요, \r\n내가 아니면\r\n누구와도 영원할 수 없어 \r\n그대를 그곳에 두고 온곳\r\n그곳만 기억하면 \r\n찾을 수 있죠 \r\n잠시 멈춰있는 사랑인거죠\r\n괜찮아요 웃어요 \r\n이 눈물도, 이 아픔도, \r\n괜찮죠</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/029/144/15029144_1404716465049_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 14260, song_num: 16182421, lowkey: "A4", highkey: "C6"},
  {album_id: 16, singer_id: nil, team_id: 10, title: "봄이 좋냐??", genre1: "가요", genre2: "전체", runtime: "03:26", lyrics: "\n\t\t\t\t\t\t\t<div>봄이 좋냐?? - 03:26</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">꽃이 언제 피는지 \r\n그딴 게 뭐가 중요한데\r\n날씨가 언제 풀리는지 \r\n그딴 거 알면 뭐 할 건데\r\n\r\n추울 땐 춥다고 붙어있고\r\n더우면 덥다고 \r\n니네 진짜 이상해\r\n\r\n너의 달콤한 남친은 \r\n사실 피시방을 더\r\n가고 싶어하지 겁나 피곤하대\r\n\r\n봄이 그렇게도 좋냐 \r\n멍청이들아\r\n벚꽃이 그렇게도 예쁘디 \r\n바보들아\r\n결국 꽃잎은 떨어지지 \r\n니네도 떨어져라\r\n몽땅 망해라\r\n\r\n아무 문제 없는데 왜 \r\n나는 안 생기는 건데\r\n날씨도 완전 풀렸는데 \r\n감기는 왜 또 걸리는데\r\n\r\n추울 땐 추워서 안생기고\r\n더우면 더워서 \r\n인생은 불공평해\r\n\r\n너의 완벽한 연애는 \r\n아직 웃고 있지만\r\n너도 차일거야 겁나 지독하게\r\n\r\n봄이 그렇게도 좋냐 \r\n멍청이들아\r\n벚꽃이 그렇게도 예쁘디 \r\n바보들아\r\n결국 꽃잎은 떨어지지 \r\n니네도 떨어져라\r\n몽땅\r\n\r\n손 잡지 마 팔짱 끼지 마 \r\n끌어 안지 마\r\n제발 아무것도 하지 좀 마\r\n설레지 마 심쿵하지 마 \r\n행복하지 마\r\n내 눈에 띄지 마\r\n\r\n봄이 그렇게도 좋냐 \r\n멍청이들아\r\n벚꽃이 그렇게도 예쁘디 \r\n바보들아\r\n결국 꽃잎은 떨어지지 \r\n니네도 떨어져라\r\n몽땅 망해라</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/806/366/80806366_1459470656439_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 46262, song_num: 86115470, lowkey: "A4#", highkey: "A5#"},
  {album_id: 17, singer_id: 29, team_id: nil, title: "소녀", genre1: "가요", genre2: "댄스", runtime: "03:23", lyrics: "\n\t\t\t\t\t\t\t<div>소녀 - 03:23</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">나는 소녀예요\r\n사랑을 잘 몰라요\r\n하지만 나는 느껴요\r\n사랑에 빠진걸 알아요\r\n\r\n오빠를 처음 보고\r\n첫 눈에 반한걸 아시나요\r\n인자한 미소 너무 좋아서\r\n내 가슴 두근 두근 뛰었죠\r\n\r\n나이차가 난다고 해도\r\n내 마음 멈출 수 없어요\r\n미성년자 벗어날 때까지\r\n날 기다릴 수 없나요\r\n\r\n나는 소녀예요\r\n어여쁜 소녀예요\r\n점점 더 이뻐질 것 같아요\r\n몇 년만 날 기다리면\r\n오빠는 행복할거야\r\n나는 소녀예요\r\n어여쁜 소녀예요\r\n아직은 사랑에 서툴지만\r\n오빠에게 다 줄거야\r\n내 마음 전부 가져가세요\r\n\r\n자꾸만 보고 싶어\r\n남몰래 찍은 사진을 봐요\r\n멋진 체격에 듬직한 모습\r\n그 품에 안기고만 싶어요\r\n\r\n다른 여자 만나도 돼요\r\n내가 성년이 될때까진\r\n그 다음엔 그 여자 버리고\r\n날 만나 사랑하세요\r\n\r\n나는 소녀예요\r\n어여쁜 소녀예요\r\n점점 더 이뻐질 것 같아요\r\n몇 년만 날 기다리면\r\n오빠는 행복할거야\r\n나는 소녀예요\r\n어여쁜 소녀예요\r\n아직은 사랑에 서툴지만\r\n오빠에게 다 줄거야\r\n내 마음 전부 가져가세요\r\n\r\n나는 소녀예요\r\n어여쁜 소녀예요\r\n점점 더 이뻐질 것 같아요\r\n몇 년만 날 기다리면\r\n오빠는 행복할거야\r\n나는 소녀예요\r\n어여쁜 소녀예요\r\n아직은 사랑에 서툴지만\r\n오빠에게 다 줄거야\r\n내 마음 전부 가져가세요</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/440/793/80440793_1401780358443_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 45676, song_num: 82616170, lowkey: "D4#", highkey: "F5"},
  {album_id: 18, singer_id: 30, team_id: nil, title: "Tears", genre1: "가요", genre2: "전체", runtime: "03:57", lyrics: "\n\t\t\t\t\t\t\t<div>Tears - 03:57</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">아무일도 내겐 없는거야 \r\n처음부터 우린 모른거야 \r\n워어우 넌 그렇게 \r\n날 보내줄수는 없겠니 \r\n이제라도 나를 잊어야해 \r\n그런 모습 쉽지는않겠지만\r\n아직 날기다리는 \r\n나 너를 알아 마음이 아파 \r\n\r\n차라리 나를 미워해 \r\n이젠 그만 \r\n내게 미련 보이지마 \r\n두번다시 넌 나를 찾지마 \r\n나로 인해 아파 할테니까\r\n\r\n잔인한 여자라 \r\n나를 욕하지는마 \r\n잠시 너를 위해 \r\n이별을 택한거야 \r\n잊지마 내사랑을 \r\n너는 내안에 있어\r\n길진 않을 꺼야 \r\n슬픔이 가기까지 영원히 \r\n\r\n차라리 나를 미워해 \r\n이젠 그만 \r\n내게 미련 보이지마\r\n두번다시 넌 나를 찾지마 \r\n나로 인해 아파 할테니까\r\n가져가 내게서 \r\n눈먼 너의 사랑을 \r\n모든게 집착인걸 \r\n너도 알고 있잖아 \r\n지독했던 사랑 따윈 \r\n모두 지워 버려줘\r\n길진 않을 꺼야 \r\n마지막 순간까지 사랑해</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/023/963/15023963_1406189629874_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 8797, song_num: 16091433, lowkey: "C5", highkey: "G6"},
  {album_id: 19, singer_id: 31, team_id: nil, title: "하늘바라기 (Feat. 하림)", genre1: "가요", genre2: "발라드", runtime: "03:41", lyrics: "\n\t\t\t\t\t\t\t<div>하늘바라기 (Feat. 하림) - 03:41</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">꽃 잎이 내 맘을 흔들고 \r\n꽃 잎이 내 눈을 적시고 \r\n아름다운 기억 \r\n푸른 하늘만 \r\n바라본다\r\n\r\n꼬마야 약해지지마 \r\n슬픔을 혼자 안고 살지는 마 \r\n아빠야 어디를 가야 \r\n당신의 마음처럼 살 수 있을까 \r\n\r\n가장 큰 별이 보이는 우리 동네 \r\n따뜻한 햇살 꽃이 피는 봄에\r\n\r\n그댈 위로해요 그댈 사랑해요 \r\n그대만의 노래로 \r\n\r\n뚜루뚜뚜두 두두두\r\n뚜루뚜뚜두 두두두\r\n뚜루뚜뚜두 두두두\r\n하늘바라기 하늘만 멍하니 \r\n\r\n가장 큰 하늘이 있잖아\r\n그대가 내 하늘이잖아\r\n후회 없는 삶들\r\n가난했던 추억\r\n난 행복했다\r\n\r\n아빠야 약해지지마 \r\n빗속을 걸어도 난 감사하니깐 \r\n아빠야 어디를 가야 \r\n당신의 마음처럼 살 수 있을까 \r\n\r\n가장 큰 별이 보이는 우리 동네 \r\n따뜻한 햇살 꽃이 피는 봄에\r\n\r\n그댈 위로해요 그댈 사랑해요 \r\n그대만의 노래로 \r\n\r\n따뜻한 바람이 부는 봄 내음\r\n그대와 이 길을 함께 걷네 \r\n아련한 내 맘이 겨우 닿는 곳에\r\n\r\n익숙한 골목 뒤에 숨어있다가\r\n그대 오기만 오기만\r\n기다린 그때가 자꾸만 떠올라\r\n\r\n가장 큰 별이 보이는 우리 동네 \r\n따뜻한 햇살 꽃이 피는 봄에\r\n\r\n그댈 위로해요 그댈 사랑해요 \r\n그대만의 노래로 \r\n\r\n뚜루뚜뚜두 두두두\r\n뚜루뚜뚜두 두두두\r\n뚜루뚜뚜두 두두두\r\n하늘바라기 하늘만 멍하니</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/810/919/80810919_1461028312733_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 46307, song_num: 86160555, lowkey: "A3#", highkey: "D5#"},
  {album_id: 20, singer_id: 32, team_id: nil, title: "Rain", genre1: "가요", genre2: "발라드", runtime: "03:42", lyrics: "\n\t\t\t\t\t\t\t<div>Rain - 03:42</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">텅 빈 회색 빛 거린 참 허전해\r\n쓸쓸한 기분에 유리창을 열어\r\n내민 두 손위로 떨어진 빗방울\r\n가득 고이는 그리움\r\n나의 맘에 흘러\r\n \r\n왠지 네가 보고픈 밤 \r\n차오르는 눈물 \r\n떠오르는 나의 맘 속 \r\n \r\n비가 오면 내리는 기억에\r\n번지는 아픔에 \r\n흠뻑 쏟아지는 너를 보다\r\n선명했던 그 시간에 멈춘 채\r\n추억에 젖은 채 \r\n아름다웠던 너를 그려\r\nin the Rain \r\n\r\n길었던 참 눈이 부셨던 계절도\r\n사진첩 속에 얼룩져\r\n색이 바래질까\r\n\r\n점점 깊어가는 이 밤 \r\n잊지 못한 약속 \r\n따뜻했던 품도 안녕 \r\n\r\n비가 오면 내리는 기억에\r\n번지는 아픔에 \r\n흠뻑 쏟아지는 너를 보다\r\n선명했던 그 시간에 멈춘 채\r\n추억에 젖은 채 \r\n아름다웠던 너를 그려\r\nin the Rain\r\n\r\n흑백뿐인 세상 속\r\n한줄기의 빛이 돼준 너\r\n(Rain) 비가 되어 다가와\r\n내 영혼을 환히 밝혀줘 \r\n\r\nDoo-doo-doo-\r\n\r\n우산 아래\r\n나직했던 속삭임 Woo- \r\n가슴 한 켠에 퍼져 네가 들려\r\n오늘 하루 내 안부를 묻듯이\r\n편안한 빗소리\r\n아련히 물든 기억 너란 빗속에\r\nWoo rain, Woo..\r\nDreaming in the Rain</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/784/431/80784431_1454420887920_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 46049, song_num: 85888427, lowkey: "G3#", highkey: "D5#"},
  {album_id: 21, singer_id: 33, team_id: nil, title: "MY STAR", genre1: "가요", genre2: "R&amp;B/소울", runtime: "03:42", lyrics: "\n\t\t\t\t\t\t\t<div>MY STAR - 03:42</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">넌 나의 STAR\r\n넌 나의 SUN\r\n넌 나의 MOON\r\n세상을 다 가진 느낌 \r\nI FEEL I FEEL GOOD \r\nI FEEL GOOD \r\nWHEN I'M WITH YOU\r\n\r\n넌 나의 ROCK\r\n넌 나의 GUN\r\n넌 나의 ROSE\r\n감당이 안 돼 이 느낌 \r\nFEEL ALRIGHT\r\n이제 안 외로워 나 안 외로워\r\n\r\n첫사랑 같은\r\n내 맘은 너를 향한 춤을 추고 \r\nOH OH OH \r\n미친 것 같은\r\n내 눈엔 한 사람만 보여 오직 \r\nYOU \r\n\r\n시작한 사랑을 멈추지마 \r\n(DON'T STOP)\r\n기나긴 밤은 너와 내거니까 \r\n(YOU'RE MINE)\r\n지금 내 두 손을 잡고 \r\nNEVER LET ME GO\r\nTELL ME 너도 나와 같은 \r\n사랑한다고\r\n\r\n넌 나의 STAR\r\n넌 나의 SUN\r\n넌 나의 MOON\r\n세상을 다 가진 느낌 \r\nI FEEL I FEEL GOOD \r\nI FEEL GOOD \r\nWHEN I'M WITH YOU\r\n\r\n넌 나의 POISON\r\n넌 나의 TROUBLE\r\n넌 나의 FATE\r\n못 참겠어 OH 네 손길\r\nFEEL ALRIGHT\r\n네가 너무 좋아 나 너무 좋아\r\n\r\n(LISTEN)\r\n\r\nSOMETHING ABOUT YOU\r\n멈췄던 내 가슴을 뛰게 하고 \r\nOH OH OH \r\n미친 것 같은\r\n내 눈엔 한 사람만 보여 오직 \r\nYOU \r\n\r\n시작한 사랑을 멈추지마 \r\n(DON'T STOP)\r\n기나긴 밤은 너와 내거니까 \r\n(YOU'RE MINE)\r\n지금 내 두 손을 잡고 \r\nNEVER LET ME GO\r\nTELL ME 너도 나와 같은 \r\n사랑한다고\r\n\r\n어느새 난 영원을 꿈꾸곤 해\r\nBUT NOTHING IS FOREVER I KNOW\r\n너 없는 날 상상할 수조차 없어\r\n\r\n넌 나의 STAR\r\n넌 나의 SUN\r\n넌 나의 MOON\r\n세상을 다 가진 느낌 \r\nI FEEL I FEEL GOOD\r\nI FEEL GOOD \r\nWHEN I'M WITH YOU\r\n\r\n넌 나의 ROCK\r\n넌 나의 GUN\r\n넌 나의 ROSE\r\n감당이 안돼 이 느낌 \r\nFEEL ALRIGHT\r\n이제 안 외로워 나 안 외로워</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/811/443/80811443_1461059473924_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 46319, song_num: 86164255, lowkey: "C4", highkey: "F5"},
  {album_id: 22, singer_id: 33, team_id: nil, title: "손잡아 줘요", genre1: "가요", genre2: "R&amp;B/소울", runtime: "03:39", lyrics: "\n\t\t\t\t\t\t\t<div>손잡아 줘요 - 03:39</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">Let me hold your hand again\r\nand again and again\r\nI want you to come back\r\nI want you to love me again\r\n\r\n나의 손을 잡던\r\n그대의 손길이\r\n얼마나 따뜻했는지\r\n다시 알 수 있게\r\n\r\n한 번만 더 손잡아 줘요\r\n온기를 느끼게 해 줘요\r\n바람이 불어서\r\n차갑단 말이에요\r\n\r\nLet me hold your hand again\r\nand again and again\r\nI want you to come back\r\nI want you to love me again\r\n\r\n나를 안아주던\r\n그대의 품속이\r\n얼마나 따뜻했는지\r\n다시 알고 싶죠\r\n\r\n마지막 그날 밤\r\n작별 인사하고\r\n돌아서서 서 있는데\r\n차가운 눈물만\r\n\r\n한 번만 더 날 안아줘요\r\n사랑을 느끼게 해 줘요\r\n마음이 비어서\r\n차갑단 말이에요\r\n\r\nLet me hold your hand again\r\nand again and again\r\nI want you to come back\r\nI want you to love me again\r\nagain\r\n\r\nI said 1, 2, 3 you\r\n오늘도 한 발자국\r\n돌아와 달라고\r\n\r\n1, 2, 3 you\r\n오늘도 한 발자국\r\n4, 5, 6\r\n\r\nLet me hold your hand again\r\nand again and again\r\nI want you to come back\r\nI want you to love me again\r\n\r\n그대 없인 너무\r\n춥단 말이에요\r\n그댄 참 따뜻했었단 말이에요\r\n이대로 끝나면\r\n난 안된단 말이에요\r\n\r\nLet me hold your hand again\r\nand again and again\r\nI want you to come back\r\nI want you to love me again</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/796/229/80796229_1457442236845_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 46164, song_num: 86014526, lowkey: "G3", highkey: "A4#"},
  {album_id: 4, singer_id: nil, team_id: 3, title: "여수 밤바다", genre1: "가요", genre2: "락", runtime: "04:40", lyrics: "\n\t\t\t\t\t\t\t<div>여수 밤바다 - 04:40</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">여수 밤바다 \r\n이 조명에 담긴 아름다운 얘기가 있어 \r\n네게 들려주고파 전활 걸어 뭐하고 있냐고 \r\n나는 지금 여수 밤바다 여수 밤바다\r\n\r\n아 아 아 아 아 아 아\r\n\r\n너와 함께 걷고 싶다\r\n이 바다를 너와 함께 걷고 싶어\r\n이 거리를 너와 함께 걷고 싶다\r\n이 바다를 너와 함께 걷고 싶어\r\n\r\n여수 밤바다\r\n\r\n여수 밤바다 \r\n이 바람에 걸린 알 수 없는 향기가 있어\r\n네게 전해주고파 전활 걸어 뭐하고 있냐고\r\n나는 지금 여수 밤바다 여수 밤바다\r\n\r\n아 아 아 아 아 아 아 아\r\n\r\n너와 함께 걷고 싶다\r\n이 바다를 너와 함께 걷고 싶어\r\n이 거리를 너와 함께 걷고 싶다\r\n이 바다를 너와 함께 너와 함께 오\r\n\r\n바다 이 조명에 담긴 아름다운 얘기가 있어 \r\n네게 들려주고파 전활 걸어 뭐하고 있냐고 \r\n나는 지금 여수 밤바다 여수 밤바다\r\n아 바다 아아아 하아아아 하아오오 \r\n하 아아아 허오 아아아아\r\n\r\n뭐하고 있냐고 나는 지금 여수 밤바다</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/287/115/80287115_1332318513743_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 35192, song_num: 81302361, lowkey: "B3", highkey: "F5#"},
  {album_id: 23, singer_id: 34, team_id: nil, title: "보고싶다", genre1: "가요", genre2: "발라드", runtime: "04:04", lyrics: "\n\t\t\t\t\t\t\t<div>보고싶다 - 04:04</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">아무리 기다려도 난 못가 \r\n\r\n바보처럼 울고 있는 너에 곁에\r\n\r\n상처만 주는 나를 왜 모르고 \r\n\r\n기다리니 떠나가란 말야\r\n\r\n보고싶다~~보고 싶다~~\r\n\r\n이런 내가 미워질만큼~~\r\n\r\n울고 싶다~~ 네게 무릎 꿇고 \r\n\r\n모두 없던일이 될수 있다면\r\n\r\n미칠듯 사랑했던 기억이 \r\n\r\n추억들이 너를 찾고 있지만\r\n\r\n더 이상 사랑이란 변명에\r\n\r\n너를 가둘수 없어\r\n\r\n이러면 안되지만..\r\n\r\n죽을만큼 보고 싶다.\r\n\r\n\r\n보고싶다~~ 보고 싶다~~\r\n\r\n이런 내가 미워질만큼~~\r\n\r\n믿고 싶다 옳은 길이라고\r\n\r\n너를 위해 떠나야만 한다고\r\n\r\n미칠듯 사랑했던 기억이\r\n\r\n추억들이 너를 찾고 있지만\r\n\r\n더 이상 사랑이란 변명에 \r\n\r\n너를 가둘수 없어\r\n\r\n이러면 안되지만\r\n\r\n죽을만큼 보고 싶다.\r\n\r\n\r\n죽을 만큼 잊고 싶다~~~~</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/222/15026222_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 11095, song_num: 16129631, lowkey: "C4", highkey: "C6"},
  {album_id: 23, singer_id: 34, team_id: nil, title: "바보같은 내게", genre1: "가요", genre2: "발라드", runtime: "05:13", lyrics: "\n\t\t\t\t\t\t\t<div>바보같은 내게 - 05:13</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">여전히 우린 이렇게 \r\n마주 앉아 있지만 \r\n너는 이미 떠난것 같아\r\n어~ 어~\r\n요즘 더욱 더 어색한 \r\n너의 모습앞에서 \r\n내 가슴은 텅빈것 같아\r\n\r\n사실 나는 알아 \r\n우리의 헤어짐이 곁에 왔음을\r\n하지만 모르는척 할수밖에\r\n난 너 없어\r\n지금 이 순간에 \r\n난 세상 가장 나약한\r\n또 가장 큰 슬픔속에 \r\n빠져버린 남자일뿐이야\r\n어떤 말이라도 \r\n내게 먼저 말해줘\r\n나는 이미 니 맘을 \r\n알고있어 괜찮아\r\n\r\n넌 떠나가지만 \r\n그런 너의 모습마저 사랑한\r\n나는 그대로 일 테니까\r\n\r\n아직도 너는 나에게 \r\n말하지 않았지만\r\n니가 이미 떠난걸 알아\r\n요즘 더욱 더 어색한 \r\n너의 모습 앞에서\r\n내가슴은 텅빈것 같아\r\n\r\n사실 나는 알아 우리의\r\n헤어짐이 곁에 왔음을 \r\n하지만 모른척 할수밖에\r\n난 너없어\r\n지금 이 순간에 \r\n난 세상 가장 나약한\r\n또 가장 큰 슬픔속에 \r\n빠져버린 남자일뿐이야 어\r\n\r\n어떤말이라도 \r\n내게 먼저 말해줘\r\n난 이미 니 맘을 \r\n알고있어 괜찮아\r\n넌 떠나가지만 \r\n그런 너의 모습마저 사랑한 \r\n나는 그대로 일 테니까\r\n\r\n그동안 너에게 숨겨왔던 \r\n수많은 거짓들\r\n그렇지만 나는 너를 \r\n원망할 수가 없었어\r\n내가 할수 있는것이란 \r\n한가지 뿐이야\r\n이런것까지 사랑한\r\n이런 바보같은 \r\n내게 먼저 말해줘\r\n나는 이미 니 맘을 \r\n알고 있어 괜찮아\r\n\r\n넌 떠나가지만 \r\n그런 너의 모습마저 사랑한 \r\n나는 그대로일 테니까\r\n내게 제발 이런 \r\n내게 먼저 말해줘\r\n알고있어 괜찮아\r\n\r\n떠나가지만 \r\n그런 너의 모습마저 사랑한\r\n나는 그대로일 테니까\r\n나만 슬퍼하면 되니까</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/222/15026222_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: nil, song_num: 16129632, lowkey: nil, highkey: nil},
  {album_id: 23, singer_id: 34, team_id: nil, title: "이젠", genre1: "가요", genre2: "발라드", runtime: "04:29", lyrics: "\n\t\t\t\t\t\t\t<div>이젠 - 04:29</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">워~ 워~\r\n이젠 이별을 알아 다신 돌아오지 않겠지\r\n애써 넌 태연한척 하지만\r\n아픈 너의 맘이 내게 느껴져\r\n언제나 그랬지 날 위한 거겠지\r\n그렇게 나보다 더 많이 아프려 했지\r\n그 어떤 슬픔도 이별보다 나을텐데\r\n사랑앞에 뭐가 두려운거야\r\n\r\n잊지마~~ 가지마~~ 고갤들어 나를 봐\r\n내눈에~~ 내안에~~ 네가 머물수 있게\r\n머물수 있게~~\r\n그래 잊혀지겠지 하지만 제발 이건 알아줘\r\n세상 모든것을 바쳐도\r\n내가 아니라면 소용없는것\r\n\r\n바보같이 널 날위해 그렇게 나보다 더 많이 아프려 했지\r\n그 어떤 슬픔도 이별보다 나을텐데\r\n사랑앞에 뭐가 두려운거야~~\r\n\r\n잊지마~~ 가지마~~ 눈을 들어 나를 봐\r\n내눈에~~ 내안에~~ 네가 머물수 있게\r\n아파도~~ 슬퍼도~~ 제발 떠나가지마\r\n내눈에~~ 내안에~~ 네가 머물수 있게\r\n머물수 있게~~\r\n\r\n제발 다시 생각해 이렇게 그냥 끝날순 없어\r\n너를 가로막는 아품도\r\n이별보다 나을수는 없잖아</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/222/15026222_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: nil, song_num: 16129633, lowkey: nil, highkey: nil},
  {album_id: 23, singer_id: 34, team_id: nil, title: "사랑해요", genre1: "가요", genre2: "발라드", runtime: "04:34", lyrics: "\n\t\t\t\t\t\t\t<div>사랑해요 - 04:34</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">한잔만 더 할께요 조금더 기다려줘 \n아무리 마셔봐도 취하지 않아 \n술잔에 떨어지는 눈물을 마시면서 \n이별에 쓴 아픔을 계속삼켜 \n시간아 멈춰다오 제발 이순간을 제발 \n\n난 저사람을 보내기 싫어 \n그대의 슬픈 표정이 내가준 사랑이라면 \n그대여 잘한거에요 \n헤어질께요 \n나먼저 일어설께요 조금더 앉아있어요 \n그대 뒷모습 볼자신 없어요 \n사랑해요 ~ 워 ~~ \n\n사랑이 영원토록 계속 더 커질텐데 \n이대로 그대 다시 볼수 없겠지 \n벌써 그대얼굴 \n보고싶어 지지만 괜찮아요 \n잘 참아 낼수 있어 \n\n시간아 돌아가줘 제발 이별없던때로 \n저사람 다시 만날수 있게 \n그대의 아픈 기억이 내가준 추억이라면 \n그대여 제발 잊어요 너무 미안해 \n아직도 거기 있나요 혹시 날 기다린다면 \n그러지 마요 그대도 떠나요 \n\n제발 이제는 ~ 잊어요 ~ \n너무 미안해요 사랑이 이런거라면 \n그렇게 우는거라면 \n이제부터는 나 혼자 할께요 \n미안해요 ~ 용서해요 ~ 사랑해요 ~ \n영원히 사랑해요... </p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/222/15026222_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: nil, song_num: 16129634, lowkey: nil, highkey: nil},
  {album_id: 23, singer_id: 34, team_id: nil, title: "지겨워", genre1: "가요", genre2: "발라드", runtime: "03:33", lyrics: "\n\t\t\t\t\t\t\t<div>지겨워 - 03:33</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">나의 인생은 이대로 어디로 흘러갈까 알고 싶지 조차 않아\n덧없는 인생이란 그 말이 이젠 더 이상 우스겟소리가 아냐\n\n사랑마저도 이젠 내겐 이별에 또 다른 이름일 뿐\n행복은 바로 곁에 있다고 남들은 쉽게 말하지만\n\n지겨워 이대로 틀에 박혀진 이세상이 너무 지겨워 괴로워\n다른 생각을 해봐도 이젠 그것조차 괴로워\n원인을 알 수 없는 이젠 습관이 되버린 나의 힘빠지는 아침\n엎드려 금붕어와 난 하루종일 말하지 그것이 나의 일요일\n\n허무조차도 이제 내겐 당연한 하루 속에 일과일 뿐\n행복은 바로 곁에 있다고 남들은 쉽게 말하지만\n\n도무지 깊게 잠들 수 없는 항상 또렷한 나의 새벽\n도대체 쉽게 눈뜰 수 없는 괴로운 아침\n\n지겨워 힘들어 괴로워 외로워 지겨워 지겨워 힘들어\n나는 너무나도 외로워   \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/222/15026222_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: nil, song_num: 16129635, lowkey: nil, highkey: nil},
  {album_id: 23, singer_id: 34, team_id: nil, title: "My Delight", genre1: "가요", genre2: "발라드", runtime: "04:12", lyrics: "\n\t\t\t\t\t\t\t<div>My Delight - 04:12</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">나 아무말도 필요없어 \r\n난 눈빛으로 니 맘 모두 알아\r\n피하진 않을거야 이 느낌을\r\n난 너하나로 충분해\r\n\r\n난 이순간을 언제나 꿈꿔왔어\r\n\r\n내 모든 것을 오직 네게 주고 싶어\r\n\r\n이젠 그런 눈물 다시 보이지마\r\n제발 지난 날들은 잊어\r\n이대로 떠나지는 않아\r\n니 곁에 항상 함께야\r\n\r\n난 이순간을 언제나 꿈궈왔어\r\n\r\n늘 지금처럼 사랑해\r\n나역시 쉽진 않았지만 이젠 니가 나의 전부야\r\n때로는 세상이 힘겨워도 기꺼이 너만을 사랑해\r\n\r\n난 이순간을 언제나 꿈꿔왔어\r\n내 모든 것을 오직 내게 주고 싶어\r\n\r\n난 이순간을 언제나 꿈꿔왔어\r\n내 모든 것을 오직 네게 주고 싶어</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/222/15026222_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: nil, song_num: 16129636, lowkey: nil, highkey: nil},
  {album_id: 23, singer_id: 34, team_id: nil, title: "이별 뒤에서", genre1: "가요", genre2: "발라드", runtime: "04:56", lyrics: "\n\t\t\t\t\t\t\t<div>이별 뒤에서 - 04:56</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">그대가 떠나가도 나는 괜찮을 줄 알았죠\r\n이제 헤어지자고 말을 할 때도 담담하게 받을꺼죠\r\n예정됐던 이별인데 날이 갈수록 더 이러죠\r\n혼자 그대없이 나 혼자라는게 익숙하질 않아요 오워~\r\n(날 떠나가나요) 못다한 말들이\r\n(떠나려하나요) 너무 많은걸요\r\n그대가 내게 준 반지 차마 난 버릴 수 없었죠\r\n이대로 가나요 정말 날 두고 가는지 믿을 수가 없는거죠 \r\n그대의 사랑 난 잊지 못해요\r\n\r\n그대와의 사랑 이제 돌이킬 수 없는 건가요\r\n혹시 서로를 위한 이별이라도 생각하진 말아요 오워~\r\n(날 떠나가나요) 못다한 말들이\r\n(떠나려하나요) 오~ 너무 많은걸요\r\n그대가 내게 준 반지 차마 난 버릴 수 없었죠\r\n이대로 가나요 정말 날 두고 가는지 믿을 수가 없는거죠 \r\n그대의 사랑 나는 잊지 못해요 오오~\r\n날 떠나가네요~\r\n오워~\r\n이제야 알았나봐요 떠난후에야\r\n날 떠나가나요 정말 날 정말 떠나가나요\r\n오~ 눈물로 그댈 보내야 해요\r\n그대의 사랑 나는 잊지 못해요\r\n사랑에 울죠 \r\n난 그래요...</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/222/15026222_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: nil, song_num: 16129637, lowkey: nil, highkey: nil},
  {album_id: 23, singer_id: 34, team_id: nil, title: "혼자", genre1: "가요", genre2: "발라드", runtime: "04:06", lyrics: "\n\t\t\t\t\t\t\t<div>혼자 - 04:06</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">나의 맘을 알까~ 내 맘을\r\n지워버린 걸까~ 내 기억을\r\n불러봐도 될까~ 니 이름을\r\n이젠 볼 수 없는... 오~ 너를\r\n지워버리기엔 너무 커져버린 너의 흔적들\r\n이젠 돌이킬 수 없는 아픈 상처란 걸 알고 있지만\r\n돌아서서 멀어지는 너의 모습 바라보며\r\n아무말도 하지 못한 내 자신이 너무 싫어\r\n희미해져가는 너의 뒷 모습을 바라보며 \r\n이렇게 혼자서 울고 있네\r\n\r\n나의 맘을 알까~ 내 맘을\r\n지워버린 걸까~ 내 기억을\r\n불러봐도 될까~ 니 이름을\r\n이젠 볼 수 없는... 오~ 너를\r\n지워버리기엔 너무 커져버린 너의 흔적들\r\n이젠 돌이킬 수 없는 아픈 상처란 걸 알고 있지만\r\n돌아서서 멀어지는 너의 모습 바라보며\r\n아무말도 하지 못한 내 자신이 너무 싫어\r\n희미해져가는 너의 뒷 모습을 바라보며\r\n이렇게 혼자서 울고 있네\r\n\r\n돌아서서 멀어지는 너의 모습 바라보며\r\n아무말도 하지 못한 내 자신이 너무 싫어\r\n희미해져가는 너의 뒷 모습을 바라보며\r\n이렇게 혼자서 울고 있네\r\n\r\n사랑했던 너에게로 달려가는 나의 모습\r\n그렇지만 예전처럼 너를 잡을 수가 없어\r\n불이 켜진 창문너머 너의 모습 바라보며</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/222/15026222_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: nil, song_num: 16129638, lowkey: nil, highkey: nil},
  {album_id: 23, singer_id: 34, team_id: nil, title: "날 떠나가", genre1: "가요", genre2: "발라드", runtime: "04:45", lyrics: "\n\t\t\t\t\t\t\t<div>날 떠나가 - 04:45</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">이렇게 끝나는거 없이 변한 사랑을 안녕\r\n세월에 탓인걸 영원한것은 없는거야\r\n허무한 인연속 무너진 믿음\r\n깨진 사랑을 잡지마 날 위해\r\n사랑때문에 울지마...\r\n\r\n날 떠나가~ 미친듯하던 사랑이\r\n날 떠나가~ 늘 따뜻했던 사랑이\r\n날 떠나가~ 오늘만 너를 안을께\r\n사랑은 이제 끝났으니까 \r\n워 ~ \r\n\r\n잊을수 있어 맨처음 처럼 \r\n미움마저도 끝나면 잊을수 있어\r\n세월에 나를 맡겼어\r\n날 떠나가~ 미친듯 하던 사랑이\r\n날 떠나가~ 늘 따뜻했던 사랑이\r\n날 떠나가~ 오늘만 너를 안을께\r\n\r\n이밤이 우리의 마지막인데\r\n하지만 날 잊지마\r\n너무 쉽게 나를 잊지마\r\n우리 지난날이 너무 가엾잖아\r\n너무 슬프잖아 부탁해 부탁해\r\n\r\n널 사랑했어 어떻게 어떻게 널\r\n가지마 오늘만 너를 안을께\r\n사랑은 이제 끝났으니까\r\n\r\n우리는 정말로 끝났으니까</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/222/15026222_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: nil, song_num: 16129639, lowkey: nil, highkey: nil},
  {album_id: 23, singer_id: 34, team_id: nil, title: "The One", genre1: "가요", genre2: "발라드", runtime: "04:30", lyrics: "\n\t\t\t\t\t\t\t<div>The One - 04:30</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">밤이 새도록 너의 생각에 잠못드는 날이 있어\r\n가끔씩 찾아드는 그날..오늘일 뿐야\r\n내일이 오면 내 기억속에 한동안 사라질 널 알기에\r\n깊었던 한숨도 끝없던 눈물도 예전만큼 나오지 않아\r\n\r\n절망하고 슬퍼했던 모든일이 지나버린 이야기로 멀어져가\r\n나도 모르게 이대로 널 잊을까 두려워\r\n\r\n내 사랑의 이름이던 단 한사람\r\n넌 언제나 나의 가슴에 남아\r\n영원히 간직할수 있기를 난 기도할께\r\n니가 없다는 이유만으로 무엇도 못할줄 알았지만\r\n혼자서 걷는일 혼자서 웃는일 \r\n생각만큼 어렵진 않아\r\n\r\n절망하고 슬퍼했던 모든일이 지나버린 이야기로 멀어져가\r\n나도 모르게 이대로 널 잊을까 두려워\r\n\r\n내 사랑의 이름이던 단 한사람\r\n언제나 나의 가슴에 남아\r\n영원히 간직할 수 있기를 난 기도할께\r\n시간이 지나 또 다른 사랑을 해 \r\n누군가가 니 자릴 대신해도 \r\n니 추억까진 닿을 수 없게 \r\n널 잠시동안 접어둘거야\r\n\r\n모든일이 멀어져가..\r\n이대로 널 잊을까 두려워\r\n\r\n넌 언제나 나의 가슴에 남아\r\n간직할수 있기를 난 기도해..</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/222/15026222_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: nil, song_num: 16129640, lowkey: nil, highkey: nil},
  {album_id: 23, singer_id: 34, team_id: nil, title: "잘못된 이별", genre1: "가요", genre2: "발라드", runtime: "03:28", lyrics: "\n\t\t\t\t\t\t\t<div>잘못된 이별 - 03:28</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">끊어진 전화가 혹시 너 아닐까 하는 \r\n그 서글픈 바램에\r\n몇 일 또 멍하니 살게 되었어\r\n너 떠날 때처럼 \r\n너 하나쯤이야 하며 \r\n널 그렇게 쉽게 보내 버린 잘못에 \r\n무너져 버렸어 완전하게 \r\n더 망가질 수 없을 만큼\r\n\r\n나답지 않아 이별한 게 어디 한 두 번이었나\r\n이해가 안돼 도대체 어쩌려고 이러는지\r\n\r\n(괜히 보냈어) 이젠 안되겠어\r\n거의 미쳐가고 있으니 (괜히 보냈어)\r\n절대 잊지 못해 다시 한번\r\n내게 기회를 줘\r\n\r\n이러다 말겠지 해도 왜 자꾸 \r\n난 너만 생각하고 있는지 갈수록 더하는 너의 그리움 \r\n나 어쩔 수 없어 \r\n끊어진 전화길 들고 나 한참동안을 소리내 울었어\r\n나 땜에 아팠던 너의 모습\r\n왜 그런 기억뿐 인 건지\r\n\r\n어떻게 해야 너에게서 벗어날 수 있는건지\r\n애를 써 봐도 도저히 너 없이는 못 살겠어\r\n\r\n\r\n(괜히 보냈어) 이미 끝났지만 다시 생각 할 순 없겠니\r\n(괜히 보냈어)딱 한번 만 내게 기회를 줘\r\n너없이는 못살겠어</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/222/15026222_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: nil, song_num: 16129641, lowkey: nil, highkey: nil},
  {album_id: 23, singer_id: 34, team_id: nil, title: "나없이 행복할 널 위해", genre1: "가요", genre2: "발라드", runtime: "04:27", lyrics: "\n\t\t\t\t\t\t\t<div>나없이 행복할 널 위해 - 04:27</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">잘봐.. 나의 모습을..\r\n세상은 날 그리 반기지 않아 \r\n아직 순수한 니가 세상을 몰라서 그러는거야.. \r\n무엇하나 나눠줄 것 없는 사랑을 \r\n너는 전부라 믿지만.. \r\n\r\n가르쳐줄게 \r\n네게 어울리는 사람은 \r\n너를 웃게 만드는 좋은 사람일거야 \r\n함께 있어도 살아가는게 힘겨울 때\r\n아무것도 못해준 나같은 사람은 아니야 \r\n\r\n잘가.. \r\n이제 다시는 눈물 흘리는 일 없기를 바래 \r\n너무 많은 나의 욕심때문에 너를 울리곤 했잖아 \r\n\r\n가르쳐줄께 \r\n네게 어울리는 사람은 \r\n너를 웃게 만드는 좋은 사람일거야 \r\n함께 있어도 살아가는게 힘겨울때 \r\n아무것도 못해준 나같은 사람은 아니야 \r\n이번만큼은 부족한 나를 믿어주길 \r\n너에게 줄 선물은 이별하나 뿐인데 \r\n함께 있기를 누구보다 더 바라지만 \r\n이젠 돌아서야 해 \r\n나없이 행복할 널 위해...</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/222/15026222_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: nil, song_num: 16129642, lowkey: nil, highkey: nil},
  {album_id: 23, singer_id: 34, team_id: nil, title: "일기", genre1: "가요", genre2: "발라드", runtime: "04:39", lyrics: "\n\t\t\t\t\t\t\t<div>일기 - 04:39</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">처음 내게 온날부터\n셀수도 없는 날들을\n하루도 거르지 않고서\n매일 기쁨이네요\n오늘도 난 다시 읽고 있죠\n온 종일 웃어댔던 일\n괜시리 토라졌던 일\n사소한 일들 하나까지\n소중히 담았네요\n어느새 난 미소짓고 있죠\n한없이 부족한 나인데\n하늘에 감사하면서 \n우리 사랑이 영원하기를 \n매일밤 기도했군요\n그대의 일기를 전해주던날\n떠나는 그대가 밉기만 했죠\n이제서야 그 맘을 느껴요\n그대가 떠나간 후에도 \n내가 이렇게 웃을 수 있길 바랬죠\n고마워요 네게 선물을 주었듯\n\n잘못했던 날들도 자신을 원망했군요\n나를 떠나기까지 얼마나 아팠나요\n용서해요 무심했던 나를\n수없이 지우고 다시 쓴\n마지막 날의 일기를\n그대 눈물로 얼룩져 알아볼수도 없지만\n그대의 일기를 읽어내리며\n한동안 눈물만 흘러내렸죠\n이제서야 그 맘을 느껴요\n그대가 떠나간 후에도\n내가 이렇게 웃을 수 있기를 바랬죠\n고마워요 네게 선물을 주었듯\n내 가슴이 영원히 멈춘 시간들..</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/222/15026222_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: nil, song_num: 16129643, lowkey: nil, highkey: nil},
  {album_id: 23, singer_id: 34, team_id: nil, title: "눈속의 너", genre1: "가요", genre2: "발라드", runtime: "03:36", lyrics: "\n\t\t\t\t\t\t\t<div>눈속의 너 - 03:36</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">음~~~\r\n크리스마스 다가오면\r\n거리에 가득 넘치는 징글벨\r\n케롤속으로 멀어져간 그대여\r\n그대 전해준 마지막 카드속에는\r\n아무 의미도 없이 짧게 씌여진 \r\n메리 크리스 마스\r\n안녕이란 말도 없이 사라져 가네\r\n하얀 겨울 속으로\r\n하염 없이 창밖엔 눈이 내리네\r\n그댈 볼 수 없도록\r\n\r\n안녕이란 말도 없이\r\n사라져 갔네~~~~\r\n저 하얀 겨울 속으로\r\n하염없이 창밖에는 눈이 내리네\r\n그댈 볼 수 없도록\r\n그댈 볼 수 없도록</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/222/15026222_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: nil, song_num: 16129644, lowkey: nil, highkey: nil},
  {album_id: 23, singer_id: 34, team_id: nil, title: "Hello Good-Bye Hello", genre1: "가요", genre2: "발라드", runtime: "04:38", lyrics: "\n\t\t\t\t\t\t\t<div>Hello Good-Bye Hello - 04:38</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">my memories \r\nare feding in the rain \r\nmy broken heart \r\ncannot be used again \r\n\r\nit seems that once again \r\nmy love is leavin \r\nbreaking up my dreams \r\nso hear me now my love \r\nhello goodbye hello \r\n\r\nverse 1 \r\nbut i know i’ll see you \r\ndown the road \r\nto wave a hand \r\nto weave the shadows \r\n\r\nshould i ever even mention \r\nthat i long to hold \r\nyou again \r\noh i hope \r\nyou're not too cold \r\n\r\nkinda' simple \r\nwhen you think it out \r\nwithout a doubt \r\nit's plain as it can be \r\n\r\ni know the wind has found \r\na new direction \r\nso it let me know \r\nthat i have to live \r\nmy day alone \r\n\r\nso hear me now \r\nhello goodbye hello \r\ndon't get me wrong \r\ni know you have to go \r\n\r\nhey look it's sad enough \r\ncan you imagine \r\nif you felt that low \r\nso hear me now my love \r\nhello goodbye hello \r\n\r\nif you feel some music \r\ncalling you \r\nslow dance along \r\nbut think about our joy \r\n\r\ni'll do the same thing \r\nevery time i want you \r\nsad enough i know \r\nbut somehow i know \r\nthat i'll survive \r\n\r\nso hear me now \r\nhello goodbye hello \r\ndont't get me wrong \r\ni know you have to go \r\n\r\nhey look it's sad enough \r\ncan you imagine \r\nif you felt that low \r\nso hear me now my love \r\nhello goodbye hello \r\n\r\nso hear me now my love \r\nhello goodbye hello</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/222/15026222_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: nil, song_num: 16129645, lowkey: nil, highkey: nil},
  {album_id: 24, singer_id: 35, team_id: nil, title: "1103", genre1: "가요", genre2: "발라드", runtime: "01:37", lyrics: "\n\t\t\t\t\t\t\t<div>1103 - 01:37</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">*내게와 꿈꾸길 원해 \n내안에 잠들길 바래 \n예전에 해준말 처럼 \n슬픔은 잊기를 바래 \n\n(나지막한 목소리로 넌 내게로 와 슬픔은 없을 테니까) \n(소중하게 숨겨왔던 노랠 불러봐 눈감고 기다리잖아) \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/223/15026223_1407139464635_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: nil, song_num: 16129646, lowkey: nil, highkey: nil},
  {album_id: 24, singer_id: 35, team_id: nil, title: "키친", genre1: "가요", genre2: "발라드", runtime: "04:36", lyrics: "\n\t\t\t\t\t\t\t<div>키친 - 04:36</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">귀여운 에이프런 두르고서 니 앞에 \n수줍게 말하지 오늘 널 위해 요리한다고 \n재료를 준비하는 내 손길은 바쁘고 \n마음만 급하고 너는 이런 날 귀엽다 하고 \n\n*내 손으로 만든 저녁식탁을 선물하고 싶은걸 \n서투른 내 요리 솜씨에 실망하지마 \n\n**그래 나도 처음이야 누구도 아냐 바로 너야 \n혹시라도 우리 사이 멀어진다면 난 어떡해 \n그래 너를 갖고 싶어 누구도 줄 수 없단 말야 \n바로 너란 이유로 변했어 사랑하고 싶어 \n\n저녁엔 산책 삼아 오른쪽엔 바구니 \n왼쪽엔 너의 팔 양쪽에 끼고 수퍼에 들러 \n시장을 보는 거야 간식거릴 고르고 \n야채도 살피고 니가 좋아할 우유도 사고 \n\n우리 언젠가 매일 아침 단 둘이서만 나눌 기쁨 \n\n그렇게 우리는 달콤해 난 이대로 좋아</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/223/15026223_1407139464635_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: nil, song_num: 16129647, lowkey: nil, highkey: nil},
  {album_id: 24, singer_id: 35, team_id: nil, title: "오래오래", genre1: "가요", genre2: "발라드", runtime: "03:28", lyrics: "\n\t\t\t\t\t\t\t<div>오래오래 - 03:28</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">나 기다릴께요 오래오래 \n\n*우연히 마주치면 아는 체는 하지않기로 해요 \n어색한 목소리로 인사하긴 너무 싫어요 \n어떻게 지내냐고 좀 말랐다고 위해주지 말아요 \n그렇게 약하지도 외롭지도 않으니까요 \n\n나 없이 그대 어떨런지 \n조금은 행복하겠지 \n아직도 너란 남잘 생각해 걱정해 \n\n**비오는 저녁 시간 술에 취해 전화하지 말아요 \n그렇게 어설프게 시작하긴 너무 싫어요 \n시간이 지났다고 변했다고 주저하지 말아요 \n언제나 그댈 향한 내 사랑은 씩씩하니깐 \n\n나 없이 그대 괜찮을지 \n그래도 힘이 들겠지 \n조금은 서둘어서 돌아와 주겠니 \n\n널 기다리면서 나 살아가는게 \n나쁘진 않을꺼야 오래오래 \n\n망설이지 말아요 난 기다려요 \n주더하지 말아요 \n언제나 그댈 향한 내 사랑은 씩씩하니까 \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/223/15026223_1407139464635_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: nil, song_num: 16129648, lowkey: nil, highkey: nil},
  {album_id: 24, singer_id: 35, team_id: nil, title: "그대이길 바래요", genre1: "가요", genre2: "발라드", runtime: "03:53", lyrics: "\n\t\t\t\t\t\t\t<div>그대이길 바래요 - 03:53</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">매일 아침 꿈에서 그댈 만나곤 해요 \r\n설명할 순 없겠죠 사랑이 아니라면 \r\n그대 등을 볼 때면 왠지 눈물이 나요 \r\n이런 기분인가요 나도 알 것 같아요 \r\n\r\n나 이제 다가가요 운명을 느낀거죠 \r\n이런 내가 우습나요 혹시 바보같나요 \r\n단 한번 뿐이라면 그대이길 바래요 \r\n웃어줘요 나를 봐요 오늘만을 기다려온 나를 \r\n\r\n나의 욕심인가요 모든 걸 원하는게 \r\n사랑 때문이라면 이해할 수 있겠죠 \r\n그대를 갖고 싶은 내가 싫진 않겠죠 \r\n이런 또 저런 생각 나를 맴도는걸요 \r\n\r\n나 이제 다가가요 받아줄 순 없나요 \r\n이런 내가 우습나요 혹시 바보같나요 \r\n단 한번 뿐이라면 그대이길 바라는 \r\n나를 봐요 웃어줘요 오늘만을 기다려온 내게로 \r\n\r\n그대의 품에 안겨 숨쉬고 있는 나를 \r\n그려봤죠 행복했죠 포기하지 않아요 \r\n단 한번 뿐이라면 그대이길 바래요 \r\n기쁜걸요 고마워요 그대만을 허락하는 내게로\r\n\t\t\t\t\t</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/223/15026223_1407139464635_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: nil, song_num: 16129649, lowkey: nil, highkey: nil},
  {album_id: 24, singer_id: 35, team_id: nil, title: "Charm", genre1: "가요", genre2: "발라드", runtime: "03:46", lyrics: "\n\t\t\t\t\t\t\t<div>Charm - 03:46</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">왜 아무말도 못하고 \n그렇게 날 바라만 보시나요 (왜 그러나요) \n왜 마주친 눈빛마저 피해가며 외면 하시나요 \n왜 아직까지 그 아픈 상처속에 \n파묻혀 사시나요 (안되요) \n왜 모르시나요 이미 우린 사랑인걸 \n\n*나를 원하잖아요 (알아요) \n내가 필요한 것도 (나도 그래요) \n솔직할 순 없나요 \n(나와 단 둘이만 보고 싶다는 말을 해봐요) \n내가 먼저 갈께요 (아니죠?) \n내게 다가오세요 (어서요) \n고백할 건 없어요 \n(그냥 내 곁에 앉아 나를 느껴봐요 참사랑) \n\n왜 아름다운 그대의 미소 뒤엔 \n허전한 쓸쓸함이 (왜 보이나요) \n왜 나를 보는 그대의 눈가에는 아직 맺힌 눈물 \n왜 걸어가는 그대의 걸음마다 \n지독한 외로움이 (안되요) \n왜 모르시나요 내가 없인 안되는걸 \n\n사랑해 그대를 \n사랑해 두려워하지 마요 \n영원할테니 \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/223/15026223_1407139464635_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: nil, song_num: 16129650, lowkey: nil, highkey: nil},
  {album_id: 24, singer_id: 35, team_id: nil, title: "Summer Memory", genre1: "가요", genre2: "발라드", runtime: "03:34", lyrics: "\n\t\t\t\t\t\t\t<div>Summer Memory - 03:34</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">그대 떠나지 말아요 그대 가면 난 어떡하나요 \n곁에 이대로 있어요 그대 가면 나 슬플 거예요 \n따스한 마음 느껴져요 그대 미소 떠올리면 \n아련한 우리 추억을 찾아 그대의 사랑 느껴봐요 \n\n*It's a summer memory,baby you and me \n위의 사라이 영원하기를 \nIt's a summer memory,baby you and me \n그 순간이 영원하기를 \n\n그땐 말하지 못했죠 사라해요 말하지 못했죠 \n돌아온다고 말해요 그대 오면 난 기쁠거예요 \n달콤한 그대의 목소리 다시 내게 속삭여주면 \n이 세상 모든 사랑을 줌에 가장 행복한 나일텐데 \n\n힘겨웠었던 지 난 날들은 \n우리 예쁜 사랑이 감싸줄거예요 \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/223/15026223_1407139464635_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: nil, song_num: 16129651, lowkey: nil, highkey: nil},
  {album_id: 24, singer_id: 35, team_id: nil, title: "All Of Your Love", genre1: "가요", genre2: "발라드", runtime: "03:10", lyrics: "\n\t\t\t\t\t\t\t<div>All Of Your Love - 03:10</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">눈을 감아요 아무 말도 하지 말아요 \n그댄 아나요 얼마나 기다린 순간인지 \nThe light 커지 말아줘요 따스하게 어둠이 우릴 감싸게 \n그대 앞에 내가 함께 있어요 더 이상 망설이지 말아줘요 \n\n*Baby all of your love 기다렸던 만큼 즐겁게 이 밤을 \nBaby all of your love 소중한 그대 숨결을 느끼며 \n처음부터 바래왔던 그대로 \n\n묻지 말아요 아무 말도 하지 말아요 \n그냥 있어요 아무 생각하지 말아요 \nTonight 내 맘을 받아줘요 그냥 서로 느끼기만 하면 되요 \n그대 안에 내가 함께 있어요 이미 우린 하나가 되있어요 \n\nBaby all of your love 기다렸던 만큼 즐겁게 이 밤을 \nBaby all of your love 소중한 그대 숨결을 느끼며 \n처음부터 바래왔던 그대로 I want you \n처음부터 바래왔던 그대로 \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/223/15026223_1407139464635_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: nil, song_num: 16129652, lowkey: nil, highkey: nil},
  {album_id: 24, singer_id: 35, team_id: nil, title: "끝", genre1: "가요", genre2: "발라드", runtime: "03:47", lyrics: "\n\t\t\t\t\t\t\t<div>끝 - 03:47</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">Boy I want you and I need you \n널 보내야 되 그래야만 해 더 늦기 전에 \nBoy I want you and I need you \n오늘 밤이 마지막이라 다짐하지만 \nBoy I want you and I need you \n널 잊어야 해 그야야 되 더 늦기 전에 \nBoy I want you and I need you내일까지 더 그대와 함께 할 수만 있다면 \n\n후회한단 말은 말아줘 다신 사랑이란 말도 하지마 \n자유롭게 가벼웁게 우리 놀 수만 있다면 \n그렇게 우리 될 수만 있다면 \n\n나만을 생각하는 살ㅇ 있어 그에게 상처 줄 수 없어 \n너를 포기해야 겠지만 Oh how I need you \n자꾸 참을수록 힘이 들어 네게 깊이 빠져들어가 \n나 도와줘 날 잊어줘 \n\nBoy I want you and I need you \n난 모르겠어 뭐가 뭔지 난 알 수가 없어 \nBoy I want you and I need you \n널 잊어야 해 그래야 해 더늦기 전에 \n\n**나만을 바라보는 사람 있어 그를 속일 수는 없어 \n너를 포기해야 겠지만 Oh how I need you \n참을수록 뿌리칠 수 없어 네게 깊이 빠져들어가 \n나 놓아줘 날 보내줘</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/223/15026223_1407139464635_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: nil, song_num: 16129653, lowkey: nil, highkey: nil},
  {album_id: 24, singer_id: 35, team_id: nil, title: "부탁", genre1: "가요", genre2: "발라드", runtime: "04:31", lyrics: "\n\t\t\t\t\t\t\t<div>부탁 - 04:31</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">연습해 봅니다 담담한 척 웃는 얼굴 \r\n그대 앞에 짐이 되지 않기를 \r\n스쳐 지나 갈 수 있게 \r\n\r\n되내어 봅니다 맘에도 없는 얘기를 \r\n마지막 자리 어색하지 않도록 \r\n눈물 짓지 않도록 \r\n\r\n행복하길 내 걱정말아요 \r\n그대 부탁 어긴 적 있나요 \r\n가끔 그녀와 힘겨워 질때면 \r\n친구처럼 편하게 내게 전화해요 \r\n\r\n믿었나 봅니다 그댈 잊을 수 있다고 \r\n우연히라도 마주치지 않을까 \r\n설레이곤 하는데 \r\n\r\n행복하길 내 걱정말아요 \r\n그대 원망 해본 적 없어요 \r\n가끔 그녀와 힘겨워 질때면 \r\n친구처럼 편하게 내게 전화해요 \r\n\r\n보고 싶어요 잘 살고 있나요 \r\n난 그대 생각 잊은 적 없나요 \r\n그렇게도 행복한 건가요 \r\n그대 목소리라도 듣고 싶은데 \r\n\r\n </p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/223/15026223_1407139464635_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: nil, song_num: 16129654, lowkey: nil, highkey: nil},
  {album_id: 24, singer_id: 35, team_id: nil, title: "진달래", genre1: "가요", genre2: "발라드", runtime: "03:59", lyrics: "\n\t\t\t\t\t\t\t<div>진달래 - 03:59</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">붉어진 두 볼이 너무나 예뻐서 작은 진달래 같다 했죠 \n그대의 음성이 귓가에 닿으면 숨이 멎을 듯 했죠 \n햇살이 되주셨죠 내 안에 눈물이 마를 수 있게 \n\n그대가 없으면 그대 떠나신다면 나 어떻게 살아가나요 \n그대 품이라면 나는 아파도 괜찮아요 너무 아파도 \n나를 데리고 떠나세요 \n\n그대의 사랑이 마음에 닿으면 꿈을 꾸는 듯 했죠 \n아침이 되주셨죠 지나간 아픔을 잊을 수 있게 \n\n그대가 없으면 그대 떠나신다면 나 어떻게 살아가나요 \n그대 품이라면 나는 아파도 괜찮아요 너무 아파도 \n그대가 없으면 그대가 떠나면 나 어떻게 살아가나요 \n그대 품이라면 나는 아파도 괜찮아요 너무 아파도 \n나를 데리고 떠나세요 \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/223/15026223_1407139464635_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: nil, song_num: 16129655, lowkey: nil, highkey: nil},
  {album_id: 24, singer_id: 35, team_id: nil, title: "가을愛", genre1: "가요", genre2: "발라드", runtime: "04:59", lyrics: "\n\t\t\t\t\t\t\t<div>가을愛 - 04:59</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">바람이 불어도 외���워해서는 안되요 \n이젠 나를 위로해줄 그 누구도 없으니까요 \n떠나간 그대를 그리워해서도 안되요 \n그댈 떠난건 버린건 어리석은 나였으니까 \n\n*그 땐 내가 너무나도 어렸었나봐요 \n바보처럼 믿었었죠 \n시간이 지나고 계절이 바뀌면 잊혀질 거라고 \n\n**나 아직도 떠나지 못해요 \n그 계절 기억속에 있죠 \n바람이 차가웠던 그 가을 \n떠난건 버린건 나였는데 \n후회도 눈물도 나에겐만 남아 \n\n잊으려 노력했던 긴 시간들은 \n그대를 기다렸던 날들이란걸 \n이제야 알았어요 \n내게 돌아와요 이젠 용서해요 날 \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/223/15026223_1407139464635_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: nil, song_num: 16129656, lowkey: nil, highkey: nil},
  {album_id: 24, singer_id: 35, team_id: nil, title: "You Are The One", genre1: "가요", genre2: "발라드", runtime: "04:44", lyrics: "\n\t\t\t\t\t\t\t<div>You Are The One - 04:44</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">아직도 망설이고 있는 건지 확신이 필요한 건지 \n내 얼굴을 ���라보기만 하다 눈 마주치면 웃어주곤 해 \n\n아주 천천히 집에 바래다 주면서 주저하는 너의 그 마음을 \n난 이미 알고 있는 걸 왜 모를까 한번만 용기 내어 말해줘 \n\n나를 좋아한다고 나를 기다렸다고 수줍게 떨리는 목소리로 \n내게 같은 마음이지만 엄저 고백하기엔 \n너무 부끄러운 날 알잖아 \n\n흔한 말일지라도 너무 듣고 싶어 \n진실 어린 너만의 말투로 \n망설이다 첨으로 내 손을 잡으며 고백한 네게 말 할꺼야 \n\n너를 좋아한다고 너를 기다렸다고 \n서투르지만 분명히 들을 수 있게 \n같은 마음이란 걸 이젠 알 수 있겠지 \n너무 고마운 날 믿어줘 \n\n많은 사람 중에 서로를 발견한 축복을 \n우리는 영원히 감사해야해 \n기다려온 만큼 소중한 느낌들을 너와 만들어갈 수 있도록 \n\n서로 좋아하는 것 함께 지내는 시간 \n나누는 얘기가 너무 고마운걸 \n우리 이젠 약속해 처음 설레임처럼 아름답게 지켜가기를 \n\n*Oh, you are the one I need \nOh, you are the light in me \nI'm never alone, no, no \nI will always turn to you \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/223/15026223_1407139464635_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: nil, song_num: 16129657, lowkey: nil, highkey: nil},
  {album_id: 24, singer_id: 35, team_id: nil, title: "그댈 보았죠", genre1: "가요", genre2: "발라드", runtime: "03:19", lyrics: "\n\t\t\t\t\t\t\t<div>그댈 보았죠 - 03:19</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">*오랜 시간 후에 그댈 보았죠 \n아직 미련이 남아 있었나봐 \n잊은 줄만 알았는데 (왜 난) \n아직 내 안에 웃고 있니 \n\n**창백한 너의 그 입술 미소 잃은 얼굴이 \n날 떠날 만큼 원한 니 모습이니 \n\n***익숙해버린 입맞춤에 잠시 지루해졌을 뿐야 \n그대 이제는 돌아와요 그대곁엔 내가 어울리잖아 \n\n나 없는 생활 행복하니 난 조금 힘들지만 \n멋진 모습 준비하며 너를 향해 조금씩 다가서려해 \n\n너무 멀리 떠나가지마 돌아오기 힘들어지잖아 \n괜찮아 나는 그대 잠시 떠나있는 걸 아니까 \n\n내 앞에 서있는 그댈 보았죠 \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/223/15026223_1407139464635_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: nil, song_num: 16129658, lowkey: nil, highkey: nil},
  {album_id: 24, singer_id: 35, team_id: nil, title: "Free", genre1: "가요", genre2: "발라드", runtime: "04:17", lyrics: "\n\t\t\t\t\t\t\t<div>Free - 04:17</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">**Oooh boy, you look so good to me \nYou might get lucky, 'Cause I feel free tonight \nAre you available, did you come here alone \nWon't you come out with me \nI'll freak you on the dance floor \n\n더 이상은 그런 표정 짓지마 \n자꾸 그럴수록 너무나 혼란스러워 \n너는 무엇하나 포기할 용기도 없잖아 \n조금씩 내 가슴도 식어가 \n너를 멀리하게 될까 두려워져 난 \n\n*솔직히 말해봐 가슴 속 깊은 곳 \n원하는게 무엇인지 I wonder now \n주위의 시선이 두려운 거라면 \n두 눈을 감은 채 날 생각해 \n\n그래 잘못된 판단이 될지도 모르지 \n머지 않아서 후회하게 될지도 모르지 \n하지만 이런 느낌이란 그리 쉽진 않잖아 \n네 눈빛이 네 가슴이 나를 원해 \n\n넌 가끔씩 무슨 말 할 것처럼 \n날 바라만 보다 한숨짓지 \n네 품에 안긴 그녀는 \n날 보는 네 눈빛 읽을 순 없겠지 \n오히려 다행이라 생각해 \n마주볼 수 있는게 (이제는 너) \n\n이런 힘겨운 시작 나도 원한 적 없어 \n이미 빼앗긴 맘을 이젠 돌이킬 순 없잖아 \n내 이름을 불러줘 \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/223/15026223_1407139464635_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: nil, song_num: 16129659, lowkey: nil, highkey: nil},
  {album_id: 24, singer_id: 35, team_id: nil, title: "All Of Your Love(House Version)", genre1: "가요", genre2: "발라드", runtime: "03:12", lyrics: "\n\t\t\t\t\t\t\t<div>All Of Your Love(House Version) - 03:12</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">\n눈을 감아요 아무 마도 하지 말아요 \n그댄 아나요 얼마나 기다린 순간인지 \nThe light 커지 말아줘요 따스하게 어둠이 우릴 감싸게 \n그대 앞에 내가 함께 있어요 더 이상 망설이지 말아줘요 \n\n*Baby all of your love 기다렸던 만큼 즐겁게 이 밤을 \nBaby all of your love 소중한 그대 숨결을 느끼며 \n처음부터 바래왔던 그대로 \n\n묻지 말아요 아무 말도 하지 말아요 \n그냥 있어요 아무 생각하지 말아요 \nTonight 내 맘을 받아줘요 그냥 서로 느끼기만 하면 되요 \n그대 안에 내가 함께 있어요 이미 우린 하나가 되있어요 \n\nBaby all of your love 기다렸던 만큼 즐겁게 이 밤을 \nBaby all of your love 소중한 그대 숨결을 느끼며 \n처음부터 바래왔던 그대로 I want you \n처음부터 바래왔던 그대로 \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/223/15026223_1407139464635_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: nil, song_num: 16129660, lowkey: nil, highkey: nil},
  {album_id: 25, singer_id: 30, team_id: nil, title: "다시 너를 떠나버려", genre1: "가요", genre2: "전체", runtime: "03:36", lyrics: "\n\t\t\t\t\t\t\t<div>다시 너를 떠나버려 - 03:36</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">아무일도 없는듯이 사라져 이젠 너란 남자 지워버릴래\r\n너를 믿어왔던 내자신 한심해져 화가나\r\n그녈 만나서도 그랬던거니 내게 했던 거짖말로\r\n그녈 유혹했니 너의 흔한 사랑에 눈물이나\r\n\r\n너만을 다를꺼라 그렇게 믿고 살았는데\r\n어떻게 가증스런 그 미소로 날 갖고 놀아 \r\n차라리 몰랐더라면 너의 또 다른 사랑에\r\n이렇게 비참히 무너지는 내가 너무 불쌍해\r\n\r\n이젠 나를 떠나버려 눈물 필요없어 가버려\r\n아직 나를 사랑한다는 그 말 필요없는데\r\n다시 나를 떠나버려 돌려 받을테니 두고봐\r\n니가 흘린 눈물 지켜봐줄께 \r\n\r\n먼저 날 버리고 간건 너였어 다시 시작해 보자는\r\n너의 한마디에 흔들리는 내맘이 한심해져\r\n\r\n정말 난 니가 미워 화가나 미칠것만 같아\r\n아무런 내색없이 날 속여온 너의 사랑이\r\n너만을 믿어왔는데 너만을 사랑했는데\r\n다시는 똑같은 상처받기 싫어 이젠 지겨워 \r\n\r\n다시 나를 떠나버려 아직 나를 사랑한대도\r\n지금 나를 사랑한다는 니말 믿을수 없어\r\n이젠 나를 떠나버려 다른 상처 받을수 없어\r\n너만 사랑했던 나를 떠나줘</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/224/15026224_1406189454017_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: nil, song_num: 16129661, lowkey: nil, highkey: nil},
  {album_id: 25, singer_id: 30, team_id: nil, title: "Friends", genre1: "가요", genre2: "전체", runtime: "03:41", lyrics: "\n\t\t\t\t\t\t\t<div>Friends - 03:41</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">내가 그댈 사랑했던 수많은 날들이\r\n언제까지 변함없이 같길 바랬죠\r\n외로운일 힘겨운일 다 절망치 않게\r\n그대여 지켜주세요\r\n\r\n내가 가는 길이 좁아 난 눈물난대도\r\n오직 그대 가슴으로 나 감싸 주세요\r\n변함없이 기쁨만이 내게 머물수 있도록\r\n그대여 지켜주세요\r\n\r\n때로는 내가 그댈 아프게 해도\r\n슬퍼 않길 바래요 \r\n사랑에 난 지쳐 갈때도\r\n이것이 나만의 길이라 믿겠죠\r\n\r\n기분 좋을때에도 난 우울할때도 나는\r\n그대 햇살같은 미소 볼수 있다면 \r\n세상 어느 차가운 일 모두 만날때도 나는\r\n그대여 지켜주세요\r\n\r\n때로는 그대 나를 아프게 해도\r\n슬퍼 하지 않아요\r\n언제나 나 기억 할께요\r\n그대와 함께 행복을 믿게\r\n\r\n기분 좋을때에도 난 우울할 때도 나는\r\n오직 그대 사랑 있어 준다면\r\n세상 어느 차가운 일 모두 만날때에도 나는\r\n그대여 지켜주세요 \r\n\r\n세상 어디차가운 일 모든 맘에 걸려도 나는\r\n그대여 지켜주세요\r\n\r\n그대여 지켜주세요</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/224/15026224_1406189454017_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: nil, song_num: 16129662, lowkey: nil, highkey: nil},
  {album_id: 25, singer_id: 30, team_id: nil, title: "Tatoo (문신)", genre1: "가요", genre2: "전체", runtime: "03:44", lyrics: "\n\t\t\t\t\t\t\t<div>Tatoo (문신) - 03:44</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">사랑밖엔 몰랐었어 \r\n잔인한 이순간까지 \r\n지금 너의 곁에 있는 그녀처럼 \r\n한땐 내가 전부였지 oh baby \r\n사랑하지않는다는 \r\n너의 짧은 한마디는 \r\n어떤 말조차 되묻지 못할만큼 \r\n너무 솔직한 이윤거야 \r\n아무런 말없이 이대로 돌아서길 \r\n다짐했지만 \r\n이미 내손은 너의 뺨에 \r\n할말을 대신했지 \r\n너 떠나고 문신처럼 \r\n내 안에 새겨진 그 추억들을 \r\n쓰리도록 눈물로 지울거야 \r\n흔적조차 남지않게 \r\n너 더 이상 위선처럼 \r\n나에게 행복따윈 바라지 말아줘 \r\n날 떠나 택한 사랑에 \r\n아픈 네모습 바랄테니 \r\n알아 \r\n아프지 않은 듯 니 앞에 \r\n태연한 척 웃어보지만 \r\n이미 눈물은 나의뺨에 \r\n내 맘을 대신했지 \r\n너 떠나고 문신처럼 \r\n내 안에 새겨진 그 추억들을 \r\n쓰리도록 눈물로 지울거야 \r\n흔적조차 남지않게 \r\n너 더 이상 위선처럼 \r\n나에게 행복따윈 바라지 말아줘 \r\n날 떠나 택한 사랑에 \r\n아픈 네모습 바랄테니 \r\n나 죽어도 친구따윈 이제는 \r\n기대할수 없게 됐어 \r\n너를 잃고 지독한 원망들로 \r\n하늘마저 욕하는 날 \r\n단 한번만 잡고싶어 그렇게 \r\n원망으로 애원해봤지만 \r\n이런 내맘을 알면서 애써 \r\n모른채 떠나간 널 \r\n알아</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/224/15026224_1406189454017_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: nil, song_num: 16129663, lowkey: nil, highkey: nil},
