  {album_id: 25, singer_id: 30, team_id: nil, title: "Feel My Love", genre1: "가요", genre2: "전체", runtime: "04:18", lyrics: "\n\t\t\t\t\t\t\t<div>Feel My Love - 04:18</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">너는 언제나 소설속의 주인공들처럼\n아름답기만 한 사랑을 꿈꿨지만 그건 소설일뿐\n사랑하면 사랑할수록 외로운게 사랑인걸\n넌 왜 모르는 걸까\n\n힘겨운 말 하지마 you don't tell me 난 가슴아파\n아픈사랑 나도 원치않아 늘 숨죽이며 널 바라봤어\n\n슬픔 생각하지마 you don't tell me 난 두려워져\n가슴아픈 사랑 원치않아 널 사랑할뿐야\n\n이런 사랑 내겐 처음인걸 조금씩 널 느끼게해줘\n아껴뒀던 사랑 전할꺼야 너를 위해 feel my love\n\nyou'ur mind 영원토록 너뿐야 사랑인걸 더이상 울지마\n의심하려 하지마 날 사랑한거야\n\n여기까지 왔잖아 아름다운 사랑을 주려해\n조금더 내안에서 기다려줘봐 이모습 지금처럼\n\nyou'ur mind 영원토록 너뿐야 사랑인걸 더이상 울지마\n의심하려 하지마 날 사랑한거야\n\n여기까지 왔잖아 아름다운 사랑을 주려해\n조금더 내안에서 기다려줘봐 이모습 지금처럼\n\n이제 우리에겐 세상 어느 누구보다\n아름답게 사랑하게 될 시간만이 남았을뿐\n만약 훗날 니가 내게서 멀어진다고해도\n너와의 모든것을 소중하게 소중하게 사랑할꺼야\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/224/15026224_1406189454017_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: nil, song_num: 16129665, lowkey: nil, highkey: nil},
  {album_id: 25, singer_id: 30, team_id: nil, title: "My Love", genre1: "가요", genre2: "전체", runtime: "03:35", lyrics: "\n\t\t\t\t\t\t\t<div>My Love - 03:35</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">모두 내말 들어봐요 나와 함께 가봐요\n이세상이 얼마만큼 아름다운지 \n믿어봐요 다시 느껴봐요 사랑의 입맞춤을 \n\n날 비춰주는 태양과 꿈결같은 노래와\n한없이 푸르른 바다야 널 사랑해 \n둘러봐요 우리 모둘 위해 준비된 선물이죠 \n\nMy heart 이젠 원하는대로 아주 작은기쁨도\n가슴 벅차옴을 느끼죠 \nMy love 이젠 난 알고 있죠\n살아가는것이 행복이라고 \n\n세심한 너의 배려와 장난스런 투정과\n나의 전부가 되어준 너를 사랑해 \n고마워요 우리 만난것도 하늘의 축복이죠 \n\nMy heart 지나간 내 상처로 가슴 아파할때도\n나의 곁에 있어준 그대\nMy love 언제나 기억할께\n그대가 나에겐 기쁨이라고\n\n삶의 무게에 지칠때면 혼자라고 생각말아요\n날 따라와요 또 꿈꿔봐요 모두 이겨낼 수 있게\n\nMy love, my life 터질거같이 들뜬 이기분\nMy love 그 누가 뭐라해도 살아간다는게 행복이라고 \nMy love, my life 언제나 곁에 있어준 그대\nMy love 이것만 기억해요 그대만이 내겐 기쁨이라고\n\nMy love, my life, My love, my life\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/224/15026224_1406189454017_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: nil, song_num: 16129666, lowkey: nil, highkey: nil},
  {album_id: 25, singer_id: 30, team_id: nil, title: "Single", genre1: "가요", genre2: "전체", runtime: "04:07", lyrics: "\n\t\t\t\t\t\t\t<div>Single - 04:07</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">어디로 갈까 내멋대로 이젠 어디든\n가고싶은 대로 자유롭게 갈 수 있어\n눈물이 날까 혼자 걷다보면\n한번쯤은 뒤를 돌아보며 눈물도 흘리겠지만\n그래도 난 다시 돌아가지 않겠어\n그리운 건 그리운채로 두어야 할테니깐\n\nIt's alright 슬픔따윈 모두 사라져 갈꺼야\n꽃이 피고 또 지고 계절이 바뀌고 세상이 돌고 돌듯이 \n내일이면 난 전혀 다른 나를 찾게 될지도 몰라\n어제까진 나에게 이렇게 이별이 찾아올줄 몰랐듯이 \nalways change 늘 그렇게 \n\n하늘엔 반짝 별이 유난히도 많은 밤에\n아직 집은 멀고 여전히 난 혼자지만\n그래도 난 그리 외롭지는 않은 걸\n하늘에 수많은 별들도 나를 비춰주니깐 \n\nIt's alright 슬픔따윈 모두 사라져 갈꺼야\n꽃이 피고 또 지고 계절이 바뀌고 세상이 돌고 돌듯이 \n내일이면 난 전혀 다른 나를 찾게 될지도 몰라\n어제까진 나에게 이렇게 이별이 찾아올줄 몰랐듯이 \nalways change 늘 그렇게 \n\n처음부터 어차피 난 혼자였잖아 (혼자였잖아)\n그 자리로 (그 자리로) 다시 돌아온 것뿐야 \n후횐없어 사랑했던 (사랑했던) 그 순간만큼\n난 괜찬아 어차피 혼자였어\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/224/15026224_1406189454017_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: nil, song_num: 16129667, lowkey: nil, highkey: nil},
  {album_id: 25, singer_id: 30, team_id: nil, title: "망연", genre1: "가요", genre2: "전체", runtime: "04:19", lyrics: "\n\t\t\t\t\t\t\t<div>망연 - 04:19</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">거울에 비친 낯익은 얼굴 날 봐라보는 내 모습 같은데\n누군가를 떠나보낸 듯 힘없는 눈빛을 난 보는데\n여린 손끝에 닿은 담배만 남아\n하얗게 날 향기속에 그리움만 \n\n사랑할 수 있어 내 몫을 추억속에 남겨져\n한동안 이렇게 눈물로 견뎌낼 수 있다면\n후회하지 않아 날 기대하는 시간마져도\n기다림속에서 조금은 지워낼 수 있다면\n\n언젠가는 잊어질 수가 있게 워~\n\n애써 웃음을 지으며 달래보지만\n나는 우울한 어제처럼 눈물만\n기다리고 싶어 넌 다시 올 수 없다 한대도\n그렇게 무엇도 아직은 할 수 없는 나인데\n\n두눈을 감고 함께한 기억들을 되돌아 보진마\n다시 나 눈뜨면 어느샌가 또 혼자뿐인 나인걸\n아파했던 날들 그 오랜 기다림도 끝나\n언제쯤 떠난 널 그려도 웃음질 수 있을까\n\n사는동안 기억할 수 없게 우~\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/224/15026224_1406189454017_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: nil, song_num: 16129668, lowkey: nil, highkey: nil},
  {album_id: 25, singer_id: 30, team_id: nil, title: "Bye Bye Love", genre1: "가요", genre2: "전체", runtime: "04:04", lyrics: "\n\t\t\t\t\t\t\t<div>Bye Bye Love - 04:04</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">그래 널 잊을수 있어 좀 힘들겠지만\n니가 없이도 난 견딜수 있어 내가 널 버린거야\n흐른 내 눈물에 착각하지마\n모든게 날 위한 연극일뿐야 날 미워하지 않게\n\n아우! 네뜻대로 do it 변해버린 love\n니까짓거 주저없이 보낼꺼야 all right\n니가 줬던 굴렐 벗어버렸어 예전에 날 기대하지마 \n\n(oh bye bye love) 부담스럽지않게 (bye love) 미련따윈 더 없어 \n(oh bye bye love) 슬퍼 보이지않게 (bye love) 너는 내안에 없어 \n\n한심해 네 모습 그리워 눈물보이는\n정말 너 나없이 괜찮은거니 어쩜 그럴수 있어\n지독히 너만을 사랑했는데\n왜 이런 슬픔이 되버린거야 널 사랑한 내게 \n\n아우! 증오만이 남아 커져가는 fire!\n가증스레 웃고있지 넌 all right\n얼어붙은 my heart! 그대로 다 돌려줄께\n내가 흘린 눈물까지 모두다\n\n(oh bye bye love) 부담스럽지않게 (bye love) 미련따윈 더 없어 \n(oh bye bye love) 슬퍼 보이지않게 (bye love) 너는 내안에 없어 \n\n그래 널 잊을수 있어 좀 힘들겠지만 니가 없이도\n난 견딜수 없어 내가 널 버린거야\n흐른 내 눈물에 착각하지마\n모든게 날 위한 연극일뿐야 날 미워하지 않게 \n\n널 보내야하겠지 맘이 아프지만\n너를 위한 이별인걸 그래 bye bye 오 나의 사랑 \n이제는 슬픔도 가질수 없어\n이미 널 깨끗이 지웠으니깐 널 잊을 수 있어\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/224/15026224_1406189454017_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: nil, song_num: 16129669, lowkey: nil, highkey: nil},
  {album_id: 25, singer_id: 30, team_id: nil, title: "덫", genre1: "가요", genre2: "전체", runtime: "03:21", lyrics: "\n\t\t\t\t\t\t\t<div>덫 - 03:21</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">이별을 먼저 말한 나지만 이러면 안돼잖아 \n사실이 아닌걸 알면서도 넌 기회라 생각했니\n\n나의 연락은 피하면서도 나를 지켜보던 너\n난 무엇도 할 수가 없잖아\n내 벌이라고해도 난 견딜텐데 혼자 두지는 마\n\n니가 이세상에 없다면 좋겠어 내 가슴에 묻으면 좋겠어\n다시는 내게 올 수 없다면 차라리 사라져\n마지막 잔인한 니모습 보여줘 너를 미워할 수있게\n널 용서하고 싶지만 내가 너보다 더 두려워\n\n다시 그렇게 너를 원하고 너의 품에 안기고\n또 바보처럼 너를 믿었어\n빈 껍질만 남은 너의 사랑을 확인하면서도 \n\n니가 이세상에 없다면 좋겠어 내 가슴에 묻으면 좋겠어\n다시는 내게 올 수 없다면 차라리 사라져\n마지막 잔인한 니모습 보여줘 너를 미워할 수있게\n널 용서하고 싶지만 내가 너보다 더 두려워\n\n날 괴롭히지마 제발 날 버려줘 얼마든지 여자는 많잖아\n너땜에 다시 만날 사랑도 너무나 두려워\n서로를 세상에 없다고 생각해 다시 시작할 수 있게\n나 누군가의 품에서 너의 추억을 태울거야\n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/224/15026224_1406189454017_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: nil, song_num: 16129670, lowkey: nil, highkey: nil},
