  {album_id: 25, singer_id: 30, team_id: nil, title: "다시 나를 떠나버려 (Remix)", genre1: "가요", genre2: "전체", runtime: "03:53", lyrics: "\n\t\t\t\t\t\t\t<div>다시 나를 떠나버려 (Remix) - 03:53</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">아무일도 없는듯이 사라져 이젠 너란 남자 지워버릴래\n너를 믿어왔던 내자신 한심해져 화가나\n그녈 만나서도 그랬던거니 내게 했던 거짖말로\n그녈 유혹했니 너의 흔한 사랑에 눈물이나\n\n너만을 다를꺼라 그렇게 믿고 살았는데\n어떻게 가증스런 그 미소로 날 갖고 놀아 \n차라리 몰랐더라면 너의 또 다른 사랑에\n이렇게 비참히 무너지는 내가 너무 불쌍해\n\n이젠 나를 떠나버려 눈물 필요없어 가버려\n아직 나를 사랑한다는 그 말 필요없는데\n다시 나를 떠나버려 돌려 받을테니 두고봐\n니가 흘린 눈물 지켜봐줄께 \n\n먼저 날 버리고 간건 너였어 다시 시작해 보자는\n너의 한마디에 흔들리는 내맘이 한심해져\n\n정말 난 니가 미워 화가나 미칠것만 같아\n아무런 내색없이 날 속여온 너의 사랑이\n너만을 믿어왔는데 너만을 사랑했는데\n다시는 똑같은 상처받기 싫어 이젠 지겨워 \n\n다시 나를 떠나버려 아직 나를 사랑한대도\n지금 나를 사랑한다는 니말 믿을수 없어\n이젠 나를 떠나버려 다른 상처 받을수 없어\n너만 사랑했던 나를 떠나줘\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/224/15026224_1406189454017_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: nil, song_num: 16129672, lowkey: nil, highkey: nil},
