  {album_id: 30, singer_id: 36, team_id: nil, title: "Love Song", genre1: "OST", genre2: "한국영화", runtime: "04:46", lyrics: "\n\t\t\t\t\t\t\t<div>Love Song - 04:46</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">yo몰라도돼 물어볼 필욘 없잖아\n어자피 우린 지금 같은 길을 걷잖아\n내가 너에게 중요한 일부분이 된걸 알아\n그건 너도 마찬가지 나에 하나뿐인 사랑\n저 파란 하늘 위를 구름을 타고 날아가다가\n\n\n만나 나에 마음을 사로잡아\n그 후론 나의 삶은 예전과는 너무 달라\n하지만 나쁜점이라곤 휴대폰 요금 하나\n아침에 눈을 뜨면 생각나는 사람\n잠들기전 마지막 생각나는 사람\n그 사람은 내겐 오직 하나뿐이라 나\n사랑에 눈이 멀어 바보된 너와나\n마지막까지 함께하고픈 내 맘과\n이런 나의 맘을 받아준 너의 그 맘다\n하나로 뭉쳐 우리 몸과 맘은 이제 하나\n내가 처음 느낀 새로운 감정 그건 사랑\n\n어두운 외로움에서 나를 꺼내줘\n바뀌려 이젠 나는 새롭게 태어나\n예전과 달라 신비로운 능력에 놀라\n너와 같이 하고 있는 꿈만같은 순간\n지구의 모든 걸 잠재운 너의 입맞춤\n너를보며 눈을 뜨고 보는 나의 꿈\n오늘 같은 날에 감추고 싶은 날개\n자는 너를 보면서 부르는 나의 노래\n세상과 떨어진 여긴 무인도\n나를 찾지는마 그 누구도 그 무엇도\n계산할수없는 지금 이 시간\n오늘밤 둘만 있는 그녀와 난\n너의 상상에 맡겨 너를 나에게 맡겨\n깊숙히 품속에 안어 느껴지는 시작\n따뜻한 몸위로 밀려온 이건 사랑\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16129752, lowkey: nil, highkey: nil},
