  {album_id: 31, singer_id: nil, team_id: 11, title: "I Have A Dream", genre1: "가요", genre2: "락", runtime: "02:16", lyrics: "\n\t\t\t\t\t\t\t<div>I Have A Dream - 02:16</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">chorus) \r\n워i have dream 워i have dream \r\ni have dream i will cross the stream i have dream \r\n\r\n하루하루 한시간이 나에겐 모험이고 나 처음 빛을 본순간 모험은 시작됐지 \r\n똑같은 출발선 위에 나란히있던 많은 이는 나와 함께 꿈을 향해 달려가고있지 \r\n\r\n내가 원하는 꿈 내가 원하는 꿈 내가 원하는 꿈을 향해 \r\n\r\n* chorus repeat \r\n\r\n날 비웃던 선생님 날 비웃던 친구 이젠 너희들의 우상이 될테니 \r\n\r\n* chorus repeat \r\n\r\n수많은 사람들이 날 비웃고 있어도 나에겐 세상을 뒤엎을 꿈이있지 \r\n나의 꿈 나를 햔해 바라보고 웃고있어 언제나 너를 향해 달리고있어</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/230/15026230_1339988674057_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16129761, lowkey: nil, highkey: nil},
