  {album_id: 31, singer_id: nil, team_id: 11, title: "그녀의 비행기 (非行記)", genre1: "가요", genre2: "락", runtime: "03:37", lyrics: "\n\t\t\t\t\t\t\t<div>그녀의 비행기 (非行記) - 03:37</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">chorus) \r\n그녀는 여행을갔어 아무도 모르는 곳으로 웃으며 그녈 보내며 빨리 다녀오라했지 \r\n그녀의 눈물을 봤어 나도 모르는 눈물이였어 나는 기다리고 있어 그녀가 오기만을 \r\n\r\n하지만 몰랐었어 그녀가 날 버린걸 이젠 난 어떡하나 이제 난 어딜가나 \r\n\r\n그녈 찾아줘요 새까만 긴머리에 낡은 찢어진 청바질 입고있죠 \r\n나를 믿는다면 언젠가 오겠지만 나난 지금 그대가 필요하죠 워my love \r\n\r\n* chorus repeat \r\n\r\n하지만 몰랐었어 그녀가 날 버린걸 이젠 난 어떡하나 이제 난 어딜가나 \r\n\r\n정말 이럴꺼니 왜 자꾸 달아나니 내가 바보같지만 알건알아 \r\n그래 넌 멋있어 그점에 빠졌나봐 너를 위한 비행기를 만들꺼야 워my love \r\n\r\n정말 왜 그러는거야 날 정말 무시하는거야 내가 뭘 어쨋길래 이러는거야 \r\n지금 나 무지 화났어 그장난 또 하자는거니 행복한 여행이 되길 난 바랄께 \r\n\r\n워goodbye love \r\n\r\n나나나나나나 나나나 나나나나</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/230/15026230_1339988674057_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16129763, lowkey: nil, highkey: nil},
  {album_id: 31, singer_id: nil, team_id: 11, title: "떳다!! 그녀!!", genre1: "가요", genre2: "락", runtime: "03:23", lyrics: "\n\t\t\t\t\t\t\t<div>떳다!! 그녀!! - 03:23</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">어느날 내곁을 떠나버린 그녀가 나에게 와서 용서를 구하며 비네 \r\n여기저기 난데없이 헤메이다 나에게 와서 눈물을 흘리고 있네 \r\n워어 워어 망설일 필요없지 그녀를 받아 줘야지 \r\n애타게 너무나 애타게 기다려 왔던 그녀가 내게로왔네 \r\n\r\n좋아 좋아 니가와서 좋아 너무나도 기다렸던 니가와서 좋아 \r\n왔어 왔어 그녀 내게 왔어 너무나도 기다렸던 그녀 내게 왔어 \r\n보고싶어서 안고싶어서 그녀 나를 그리워서 다시왔나 \r\n좋아 좋아 니가와서 좋아 너무나도 기다렸던 그녀 \r\n\r\n어느날 내곁을 떠나버린 그녀가 나에게 와서 용서를 구하며 비네 \r\n여기저기 난데없이 헤메이다 나에게 와서 눈물을 흘리고 있네 \r\n워어 워어 망설일 필요없지 그녀를 받아 줘야지 \r\n애타게 너무나 애타게 기다려 왔던 그녀가 내게로왔네 \r\n\r\n좋아 좋아 니가와서 좋아 너무나도 기다렸던 니가와서 좋아 \r\n왔어 왔어 그녀 내게 왔어 너무나도 기다렸던 그녀 내게 왔어 \r\n보고싶어서 안고싶어서 그녀 나를 그리워서 다시왔나 \r\n좋아 좋아 니가와서 좋아 너무나도 기다렸던 그녀 \r\n\r\n당신 정말 좋아난 몰라</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/230/15026230_1339988674057_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16129764, lowkey: nil, highkey: nil},
  {album_id: 31, singer_id: nil, team_id: 11, title: "Papa", genre1: "가요", genre2: "락", runtime: "02:42", lyrics: "\n\t\t\t\t\t\t\t<div>Papa - 02:42</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">왜 이제서야 당신이 보고싶은지 몰랐는데 지금껏익숙한데 지금껏 워 잊었는데 \r\n두번다시 두번다시 이제다시 못보겠죠 사랑한다 말할께요 나의사랑 파파 \r\n왜 이제서야 당신이 그리운지 몰랐는데 지금껏 익숙한데 지금껏 워잊었는데 \r\n술취한 당신이 즐거운가요 그랬으면 해요 \r\n왜 이제서야 당신이 그리운지 몰랐는데 지금껏 익숙한데 지금껏 워잊었는데</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/230/15026230_1339988674057_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16129765, lowkey: nil, highkey: nil},
  {album_id: 31, singer_id: nil, team_id: 11, title: "Do Not Cry", genre1: "가요", genre2: "락", runtime: "04:13", lyrics: "\n\t\t\t\t\t\t\t<div>Do Not Cry - 04:13</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">내가 자주찾는 그곳은 언젠가 부터가 한여자가 왔죠 \r\n그 여자가 처음 봤을때 왠지 슬퍼보였죠 , 얘기 해봐요 왜 울고 있는지 \r\n누군가가 당신을 힘들게 했나요 가만히서서 바라만 보는 내 모습은.. \r\n\r\n이해하세요 알고있나요 그녀만 보면 \r\n가슴이 떨려 다가 갈수 없는 나는 우워워워 \r\n\r\n이름도 모르는 그녀를 사랑하고 있었죠 \r\n그녀 앞에 다가 서려 해도 항상울기만 하내 얘기 해봐요 왜 울고 있는지. \r\n누군가가 당신을 힘들게 했나요 가만히서서 바라만 보는 내 모습을 \r\n\r\n이해하세요 알고 있나요 그녀만 보면 \r\n가슴이 떨려 다가갈수 없는 나를 워 허허허허워 \r\n\r\n이해하세요 알고 있나요 그녀만 보면 \r\n바보 같은 나를 (반복) \r\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/230/15026230_1339988674057_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16129766, lowkey: nil, highkey: nil},
  {album_id: 31, singer_id: nil, team_id: 11, title: "나와 함께", genre1: "가요", genre2: "락", runtime: "02:36", lyrics: "\n\t\t\t\t\t\t\t<div>나와 함께 - 02:36</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">파랑게 물든 하늘 아래 넌 슬퍼하네 \r\n눈물 흘리네 난 하늘을 날고 싶다 했지 \r\n새들아 나와함께 그 곳으로가자  하며 \r\n눈물을 흘리네 하지만 하늘은 널 위해 울어 주지않아 \r\n\r\n내손을 잡아 나와 함께 가 그 곳을 니가 원하는 세상일꺼야 \r\n\r\n넌 하늘을 날고 싶다 했지 \r\n새들아 나와함께 그 곳으로 가자하며 하며 눈물을 \r\n흘리네 하지만 하늘은 널위해 울어 주지 않아 \r\n\r\n내손을 잡아 나와 함께가 그 곳을 니가원하는 세상일꺼야 \r\n\r\n파랑게 물든 하늘 아래 넌 슬퍼하네 눈물 흘리네</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/230/15026230_1339988674057_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16129767, lowkey: nil, highkey: nil},
  {album_id: 31, singer_id: nil, team_id: 11, title: "사랑해봤니?", genre1: "가요", genre2: "락", runtime: "02:31", lyrics: "\n\t\t\t\t\t\t\t<div>사랑해봤니? - 02:31</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">넌 나를 쳐다보지도 않고서 쉽게 헤어짐을 얘기하지 \r\n아픔의 눈물도 없지 사랑의 쓰디쓴 상처도 없지 \r\n\r\n나의 눈을 바라봐 나의 눈을 바라봐 지나온 사랑의 눈물이 흐르고 있잖아 \r\n내가 옆에 있잖아 내가 곁에 있잖아 뭐가 부족해 너 사랑을 몰라 \r\n\r\n사랑해봤니? 아파해봤니? \r\n사랑해봤니? 아파해봤니? \r\n사랑해봤어? 아파해봤어? \r\n너로인해 많은걸 느꼈어 이젠 알겠어 \r\n날 사랑하지 않았다는것을 \r\n\r\n사랑해봤니? 아파해봤니? \r\n사랑해봤니? 아파해봤니? \r\n사랑해봤니? 아파해봤니? \r\n사랑해봤니? 아파해봤니? \r\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/230/15026230_1339988674057_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16129768, lowkey: nil, highkey: nil},
  {album_id: 31, singer_id: nil, team_id: 11, title: "I Want You", genre1: "가요", genre2: "락", runtime: "04:03", lyrics: "\n\t\t\t\t\t\t\t<div>I Want You - 04:03</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">나를 떠났어요 그대 나 떠났어요 돌아와요 그리워요 \r\n하늘엔 비가 와요 눈물이 나요 그대 내가 보고 싶지 않나요 \r\n그대 나 왜 떠나나요 나 그대 보고싶어 눈물만 나요 \r\n\r\n이젠 힘들어요 너무나 힘들어요 돌아와요 그리워요 \r\n그리워요 너무나 힘들어요 돌아와요 나의 곁에 \r\n그대 내모습이불쌍하지 않나요 \r\n그대 위해 나 뭐든지 다할께요 \r\n\r\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/230/15026230_1339988674057_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 10951, song_num: 16129769, lowkey: nil, highkey: nil},
