  {album_id: 32, singer_id: 37, team_id: nil, title: "날개", genre1: "가요", genre2: "랩/힙합", runtime: "04:29", lyrics: "\n\t\t\t\t\t\t\t<div>날개 - 04:29</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">꿈이 많은 너였지 우리 멋진 모습을 작은 종이에 그려 보여 \n주기도 했었지 작고 약한 나에게 늘 크고 멋져 보였던 \n오랜만에 너를 만났지 \n세 상이 변하게 했지 왜 대답 못하니 왜 자꾸만 피하니 \n내게 눈물 보이진 말아 세상을 등진 듯한 너, 내겐 무척 힘겨워 \n보여 오랜만에 우린 만났지\n\n푸른 바다(2절; 밝은 태양)와 같은 니 모습으로 다시 내게 웃어 줘\n\n두려운 줄 알아 두근 거린다 해도 두 팔을 펼쳐 \n크게 숨을 쉬고 날아봐 세상 속으로 날개를 펼치고, 날아 올라 \n하늘위로 날지 못해서 접혀 있었던 너의 두 손(2절: 날개)을 펴고\n\n날아 올라 더 높이 하늘위로 더 높이 두 팔을 펼쳐\n다신 접지 말아 너의 꿈 너의 웃음을 이제 눈을 떠봐 네가 세상 \n위를 날아 이제 거침 없이 너의 길을 가라 너의 두 날개 짓으로\n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16129774, lowkey: nil, highkey: nil},
  {album_id: 32, singer_id: 37, team_id: nil, title: "여자는 항상 남자에게...(Feat. MR-Woo)", genre1: "가요", genre2: "랩/힙합", runtime: "03:23", lyrics: "\n\t\t\t\t\t\t\t<div>여자는 항상 남자에게...(Feat. MR-Woo) - 03:23</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">oh man~ oh man~ \neverybody funky party \nI'got a wait a minute I'got a wait a minute \nI'got a wait a minute go go go go \nI'got a wait a minute I'got a wait a minute \nI'got a wait a minute go go go go \n\n(Verse 1)- MR-Woo \n나 네게 지금 사랑한다 말해봤자 다 소용없는 일이잖아 \n과거의 나의 연인들이 뭐가 그리 중요할까 huh! \n지금 네가 사랑하는 그대로의 날 받아줄 순 없나 \n아마 지금 가장 중요한 건 그대 오직 단하나 바로 너와 나 \n\n나를 갖고 싶다면 나의 전부를 받아줘야해 \n지나온 사랑도 너에게 만큼 난 진실했어 \n누구보다 날 이해해줘야만 해 \n네가 나와 함께 하겠다면 \n보이는 그대로 날 사랑해주길바래 \n\n♬ 아~~~~ 아~~~~~ 아~~~~~~ 아~~~~~~ 'o' \n\n(Verse 1)- MR-Woo \n나 네게 지금 사랑한다 말해봤자 다 소용없는 일이잖아 \n과거의 나의 연인들이 뭐가 그리 중요할까 huh! \n지금 네가 사랑하는 그대로의 날 받아줄 순 없나 \n아마 지금 가장 중요한 건 그대 오직 단하나 바로 너와 나 \n\n누굴 사랑했던게 뭐 잘못된건 아니잖아 \n왜그걸 숨겨야 당연하다고 생각할까 \n정직할수 없는게 더 이상하잖아 \n지금 내가 널 사랑하는 걸 \n숨겨야 할이유가 하나없는 것처럼 \n\n나는 자랑스러워 누굴 사랑한다는걸 \n그중에 바로 너 다른 사람이 아닌 바로너 \n모든걸 다 주겠어 오직 너에게 \n네가 내게 주는 그만큼 나도 \n분명히 보답해줄껄 나는 맹세할께 \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16129775, lowkey: nil, highkey: nil},
  {album_id: 32, singer_id: 37, team_id: nil, title: "Mad Dog (Feat. Hooney Hoon, 준비)", genre1: "가요", genre2: "랩/힙합", runtime: "03:19", lyrics: "\n\t\t\t\t\t\t\t<div>Mad Dog (Feat. Hooney Hoon, 준비) - 03:19</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">길가던 미친개 날보고 월! 월! 월! × 3\r\n\r\nVerse 1\r\nyo! 뭘봐! m.i c.h.i.n g.a.e 미친개\r\n원해, 날 원해! 그 때는 지나갔네 오래전에\r\n내 생각엔 그대 떠나가\r\n내 주위엔 이젠 그만 짖어대 그러다가\r\n널 또 내가 걷어차 참 가슴아파 오\r\n내가 그리 고파 널 따윌 내가 왜 만나\r\n돌았나 내 삶이 그렇게도 한가해 보이는가?\r\n비록, 한때 널 갖고 놀았어도 너와난 엄염히 다르니\r\n서로 멀리하도록 나의 환상따윈 버리도록 OK!\r\n이젠 답이 나오네 너의 몸에 돈을 실어 날아갈듯한 \r\n기분을 느껴 그게 니인생의 최고이네! \r\n\r\nVerse 2\r\nT.I.M.E OVER! 지금 이 순간부터 그대는 아웃사이더\r\n오빠인 나보다 뭐가 바빠 비싸\r\n넌 괴짜보다 심한 왕따\r\none time just promise's first\r\n오늘 만큼은 빨리 왔어야 해 you must\r\n얼마만큼의 시간이 흘렀을까?\r\n궁금하기도한데 몇신지 좀 물어볼까?\r\n미끈쌔근 싸한 애들 널리고 또 널려\r\n이리치고 저리깍고 만들어진 얼굴이여\r\n\r\nVerse 3\r\n이 얘기까진 안할려고 했다 \r\n통금시간 그 시간 벌써 대여섯 시간지나\r\n넌 지각 어디 그 뿐인가\r\n남자들도 피한다는 소주 맥주 폭단주가 네겐 맞던가\r\n이게 왠 말인가\r\n잔돌리고 주고받고 안받으면 쳐들어간다 외치는\r\n너는 선수 고수 내겐 무리수 no! 풀지못한 함수\r\n술깨자고 모모하자고 \r\n날 데려간 곳은 바로 거기 다름아닌 \r\n호텔! 모텔! 빈오피스텔!\r\n적수가 없구나 견딜 수가 없구나 \r\n밉다! 싫다! 너!</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16129776, lowkey: nil, highkey: nil},
  {album_id: 32, singer_id: 37, team_id: nil, title: "So Nice (Feat. MR-Woo)", genre1: "가요", genre2: "랩/힙합", runtime: "05:06", lyrics: "\n\t\t\t\t\t\t\t<div>So Nice (Feat. MR-Woo) - 05:06</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">조금 더 가까이 사랑할 수 있게 \r\n깨어나지 않는 꿈을 꿀 수가 있게 \r\n넌 언제나 내게 좋은 친구로만 남고 싶다 했지 \r\n꿈속에서 내게 달콤하게 속삭이던 네가 \r\n왜 현실에선 한번도 웃어주질 않는 거니 \r\n좀더 가까이 다가와 꿈처럼(이젠 내게 있어줘 허~) \r\n조금 더 가까이 사랑할 수 있게 \r\n깨어나지 않는 꿈을 꿀 수가 있게 \r\n내 호주머니 속엔 너의 낡은 사진 한 장이 들어있어 \r\n나 잠들 때면 너의 웃는 얼굴 보곤 해 \r\n좀 더 가까이 널 느끼고싶어 \r\n내 이름을 불러줘, Just like in  my dream\r\n\r\nso nice ~~~ your beautiful eyes \r\nso nice ~~~ your beautiful eyes \r\n\r\n조금 더 가까이 내가 사랑할 수가 있게 널 \r\n깨어나지 않는 꿈을 꿀 수 있게 \r\n넌 언제나 내게 좋은 친구로만 남고 싶다고 말했지 \r\n꿈속에서라도 널 사랑할 수 있게 \r\n\r\n왜 네가 나를 떠나가야 하는지 \r\n왜 나의 내가 될 수 없는지 \r\n왜 이렇게 나를 힘들게 하는지 \r\n도무지 너를 이해할 수 없지만 \r\n너를 아직도 너무 사랑하는 난 \r\n떠나간 너만을 하루하루 생각하고 있지 \r\nBaby come back to me. It ain't easy \r\n그대 떠나 보내기가 내겐 너무 힘들지 \r\n너를 아직도 사랑하고 있는 나는 heart broken \r\n너무나 큰, 큰 상처를 주고 가는 너는 알고 있을까 \r\n미치도록 아픈 마음 그대 왜 내게 \r\n이렇게 아픈 상처를 주고가나 \r\n이제 옛 추억에 그대 묻혀지나 \r\n내리는 비가 내맘에서 그대 지우려나 \r\n\r\n조금 더 가까이 사랑할 수 있게 내말 전해 이말 전해 \r\n내가 사랑한다 말을 해 \r\n훗날 우리 끝에 우리 후회 않기로 해 \r\n마지막 선택일 너와나 \r\n그게 나 바로 나 너 나 너의 나 그게 나 \r\n나의 곁에 너 너에게 있을 나 나 나 그래 나 \r\nso nice ~~~</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16129777, lowkey: nil, highkey: nil},
  {album_id: 32, singer_id: 37, team_id: nil, title: "Madrappers (Feat. MR-Woo, 준비)", genre1: "가요", genre2: "랩/힙합", runtime: "03:50", lyrics: "\n\t\t\t\t\t\t\t<div>Madrappers (Feat. MR-Woo, 준비) - 03:50</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">랄라랄라 랄랄라 매드랩퍼 매드랩퍼\r\n랄라랄라 랄랄라 MR-J와 그리고 내가 \r\n랄라랄라 랄랄라 매드랩퍼 매드랩퍼\r\n랄라랄라 랄랄라 MR-J와 그리고 우리가 최고 \r\n\r\nyou know my name? 싹다 까먹었지 어떻게 어쩌다가\r\n어따가 이런 찐따 아리까리 remember me, madrapper와 함께\r\n내 이름 block busta 공격 가해 어떻게?\r\n수천만 핵토파스칼에서도 빛을 발할 \r\n나의 rap flow just don't stop \r\n항상 나의 24시 힙합하리 낯이 익지 않았다고\r\n아나따노 문제될건 no 절대없고 oh~~\r\n너와 나 우리는 하나라고 모 아니면 도 우리들은 절대로\r\n다함께 부라보 외칠 순간까지 get on the flow\r\n알아들어 너 누굴따져 follow the leader what`s our name?\r\nmadrapper yo!!\r\n\r\nwhat`s up now? buckle up, you buckle kids it`s rough ride\r\n난 MR-J 내가 제일 (휴) 난 참피온 리얼 알카폰\r\n지나칠뻔 했던 내가 what!(you`re what?)(madrapper yo!!)\r\n왜 날 건드려 니들 멋대로 되지 않는 나일줄 알면서 돌았나 \r\n날 몰랐나 몰랐나 MR-J를(자꾸만 보고 싶네) \r\n모를 나를 모를, 지까짓게 뭔데 지가 내게 지가 언성 높게 \r\n하려다가 지가 내 본성보면 넌 곧 반성 니 근성따윈\r\n내 완성에 주위를 서성일뿐 내 본성에 완성 내근성에 완성들인 \r\n시간의 완성 내 시간이 왔어(왔어! what`s up!!)\r\nyou know what`s up now? 난 madrapper yo!!\r\n\r\na yo에서 신나게 놀았고 say ho ho 내 차례고\r\nrock`n representing frisco microphone 이어주어 넘겨 받았고\r\n내가 여기까지 살아온 겪어온 버텨온 온통 눈물속의 코메디\r\ncurse free 항해중인 인생 도착지 내 자신을 위한 기회 노력과\r\n이 순간 투자하는 땀방울 눈망울 가물가물 그 속에서 담겨있는 \r\n나의 미래 나 이제 한발짝 다가설게 내 인생 마지막 한 장에 \r\n사진을 위해 we out</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16129778, lowkey: nil, highkey: nil},
