  {album_id: 32, singer_id: 37, team_id: nil, title: "U ＆ I", genre1: "가요", genre2: "랩/힙합", runtime: "04:44", lyrics: "\n\t\t\t\t\t\t\t<div>U ＆ I - 04:44</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">oh~~~~~~~~~~~~ \n\n한번쯤 두번쯤 아니면 더 몇 번씩 이라도 \n널 못 알아본 채로 스쳐 지났는지 모르지 \n한번 더 한번 더 몇 번씩 기도를 드릴지 \n널 만나고싶은데 바보처럼 말은 못하지 \n우연히 널 만난 곳 그 자릴 찾아 맴돌고 \n널 다시 만난다면 내 운명이라고 \n그렇게 내 맘을 네게 또 전하고 싶어 \n\n세상 어느 곳에서 어떻게 지냈니 \n너도 날 기억하는지 \n내게 운명이란 건 널 만난 것 그리고 \n너를 알게 된 거란 걸 \n\n\n한번쯤 또 다시 내게 또 부딪힌다면 \n보내지 않아 용기 내어서 네게 말해볼 꺼야 \n항상 기다렸다고 널 사랑한다고\n\n세상 어느 곳에서 어떻게 지내는지 \n너도 날 기억하는지 \n내게 운명이란 건 널 만난 것 그리고\n다시 만나게 된다~~ \n\nMy sweet love babe~ \noh sweet oh babe~~\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16129783, lowkey: nil, highkey: nil},
