  {album_id: 35, singer_id: 51, team_id: nil, title: "Sueno", genre1: "가요", genre2: "일렉트로니카", runtime: "05:30", lyrics: "\n\t\t\t\t\t\t\t<div>Sueno - 05:30</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">더이상 이대로 난 안되요\r\n이제 제발 나를 놓아줘요~\r\n당신의 아픔을 당신의 현실도\r\n나에게 지우려 하지말아요~\r\n또 다르게도 너의 뒷모습이\r\n낯선곳에 버려진것 처럼~\r\n또 나의 모든걸 쉽게 묻힐순없지\r\n이 세상 무엇보다도 소중한 걸~\r\n또 나의 모든걸 제발 내 곁에 있어\r\n헤어날수 없게 나를 붙잡아 줘~ (나의 모든것~)\r\n\r\n                   \r\n\r\n다른 사람이 되면 안되요~\r\n이젠 깨달라며 놓아줘요~\r\n이 내 아픔을 당신의 현실뿐\r\n나에게 지우려 하지말아요~\r\n또 다르게 보여~\r\n너의 뒷모습이~\r\n낯선 곳에 버려진것처럼~\r\n나의 모든것~ 깨어질수없지~\r\n이 세상 무엇보다 소중한 것~\r\n또 나의 모든것\r\n제발 내곁에 있어~\r\n헤어날수 없게 나를 붙잡아줘~ (또 나의모든것~)  (또 나의모든것~)\r\n\r\n또 나의 눈물~달라진 모습을 \r\n세상을 버린 것처럼~\r\n\r\n나의 모든것~~</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/234/15026234_1314785753355_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16129830, lowkey: nil, highkey: nil},
