  {album_id: 35, singer_id: nil, team_id: 15, title: "Silly Love Song", genre1: "가요", genre2: "일렉트로니카", runtime: "04:14", lyrics: "\n\t\t\t\t\t\t\t<div>Silly Love Song - 04:14</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">내가 눈을 떴을때\r\n내가 머릴 감을때\r\nI love you, I need you\r\n내가 티빌 켰을때\r\n내가 냉장골 열때\r\nI love you, I need you\r\n배가 고파 동네 식당에다\r\n밥을 시킬때도\r\nI love you, I need you\r\n한밤중에 스쿠터를 타고\r\n편의점 갈때도\r\nI love you, I need you\r\nI love you, I need you\r\nI love you, I need you\r\nI love you, I need you\r\nI love you, I need you\r\n지루한 하품할 때\r\n맛있는 반찬 살때\r\nI love you, I need you\r\n약속 취소됐을때\r\n돈이 들어왔을때\r\nI love you, I need you\r\n새로산 잡지 속 특별부록\r\n여행질 볼때도\r\nI love you, I need you\r\n고양이가 아파 깜짝 놀라\r\n병원에 갈때도\r\nI love you, I need you\r\nI love you, I need you\r\nI love you, I need you\r\nI love you, I need you\r\nI love you, I need you\r\nI love you, I need you\r\nI love you, I need you\r\nI love you, I need you\r\nI love you, I need you</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/234/15026234_1314785753355_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 10307, song_num: 16129832, lowkey: nil, highkey: nil},
  {album_id: 35, singer_id: 53, team_id: nil, title: "몽유도원", genre1: "가요", genre2: "일렉트로니카", runtime: "08:05", lyrics: "\n\t\t\t\t\t\t\t<div>몽유도원 - 08:05</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가사 정보가 없습니다.</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/234/15026234_1314785753355_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16129833, lowkey: nil, highkey: nil},
  {album_id: 36, singer_id: 54, team_id: nil, title: "It s Alright", genre1: "가요", genre2: "발라드", runtime: "05:15", lyrics: "\n\t\t\t\t\t\t\t<div>It s Alright - 05:15</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">as you know i love when it's raining \r\nwalking with you even more when it's raining \r\nand most of all i love kissing you in the rain \r\nyes, we did...all we had was each other \r\nthe realty was to far away from our love \r\nmaybe the problem was the sweet thing called\"love\" \r\nit was too deep and sweet and pure to be true \r\ngod! you knows...how much we loved each other \r\nit's alright...please baby never cry... \r\neven though you're not here by my side \r\nit's alright...even thought god took you away from me \r\nhe gave me a lot of you in a way... \r\ni was always attracted by your charm \r\nthat i couldn't feel it from no one else \r\njust thinking about your name \r\ngave me the strength to live through this world \r\nthat is reality...</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/235/15026235_1405322407420_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16129834, lowkey: nil, highkey: nil},
  {album_id: 36, singer_id: 54, team_id: nil, title: "어떤가요", genre1: "가요", genre2: "발라드", runtime: "04:34", lyrics: "\n\t\t\t\t\t\t\t<div>어떤가요 - 04:34</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">어떤가요 내곁을 떠난이후로 \n그대 아름다운 모습 그대로 있나요 \n\n아직까지 당신을 잊는다는게 \n기억저편으로 보낸다는게 너무 힘이 드는데 \n\n하루 종일 비내리는 좁은 골목길에 \n우리 아끼던 음악이 흐르면 \n\n잠시라도 행복하죠 그럴때면\n너무 행복한 눈물이 흐르죠 \n\n가끔씩은 당신도 힘이드나요 \n사람들에게서 나의 소식도 듣나요 \n\n당신곁을 지키고 있는 사람이 \n그댈 아프게 하지는 않나요 그럴리 없겠지만 \n\n이젠 모두 끝인가요 정말 그런가요 \n우리 약속했던 많은 날들은 \n\n나를 사랑했었나요 아닌가요 \n이제 당신에겐 상관없겠죠 \n\n알고 있어요 어쩔수 없었다는걸 \n나만큼이나 당신도 아파했다는걸 \n\n이젠 모두 끝인가요 정말 그런가요 \n우리 약속했던 많은 날들은 \n\n나를 사랑했었나요 아닌가요 \n이젠 당신에게 상관없겠죠 \n\n듣고 있나요 우습게 들리겠지만 \n난 변함없이 아직도 그대를\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/235/15026235_1405322407420_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 10170, song_num: 16129835, lowkey: nil, highkey: nil},
  {album_id: 36, singer_id: 54, team_id: nil, title: "On And On", genre1: "가요", genre2: "발라드", runtime: "03:54", lyrics: "\n\t\t\t\t\t\t\t<div>On And On - 03:54</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">On and On On and On\nSo, we'll be together in this night\n이제 아무 생각 말고 지금 이 순간을 느껴 \nNobody belong to me, all the night\nOn and On On and On\nso, we'll be togehter in this nigt\n내일 일은 생각 말고 오늘 이 밤만을 느껴 \nNobody belong to me, all the night\n\n세상에 혼자가 아닌게 가끔씩 답답하기도 해\n울고도 싶고 떠나고 싶은 우울한 이런 날엔\n예전엔 다가올 내일이 너무 두려워 \n아무런 계획 없이 떠날 용기 없었지 \n지금은 아니야 참을 수 없어\nOh, tonight! 내겐 Rule 이란건 없어 \n\nOn and On On and On\nSo, we'll be together in this night\n이제 아무 생각 말고 지금 이 순간을 느껴 \nNobody belong to me, all the night\nOn and On On and On\nso, we'll be togehter in this nigt\n내일 일은 생각 말고 오늘 이 밤만을 느껴 \nNobody belong to me, all the night\n\nFind myself, by myself 날아갈 것 같은 이 기분\nSee your smile, set you free! Feel it! Da da da\nYou can try everything! 다시 내일이 돌아와도\n마치 꿈을 꾼 것 같이 우린 아무 걱정 없이 \nI believe that I can find myself again\n\nOn and On On and On\nSo, we'll be together in this night\n이제 아무 생각 말고 지금 이 순간을 느껴 \nNobody belong to me, all the night\nOn and On On and On\nso, we'll be togehter in this nigt\n내일 일은 생각 말고 오늘 이 밤만을 느껴 \nNobody belong to me, all the night\n\nSet it free, oh we can do anything I believe\nFind myself, see your smile so set you free feel it!\nOn and On On and On\nI'm not belong to anybody\n\nOn and On On and On\nSo, we'll be together in this night\n이제 아무 생각 말고 지금 이 순간을 느껴 \nNobody belong to me, all the night\nOn and On On and On\nso, we'll be togehter in this nigt\n내일 일은 생각 말고 오늘 이 밤만을 느껴 \nNobody belong to me, all the night\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/235/15026235_1405322407420_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16129836, lowkey: nil, highkey: nil},
  {album_id: 36, singer_id: 54, team_id: nil, title: "도움", genre1: "가요", genre2: "발라드", runtime: "04:01", lyrics: "\n\t\t\t\t\t\t\t<div>도움 - 04:01</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">뜨거운 커피보다는 찬것을 즐기죠\n오른편에서 걷는걸 편하게 느끼죠 \n거짓말 하나 못하는 착한 사람이죠 \n그래서 당신 얘기도 내가 알게 됐죠 \n\n이런말 하는 내 모습 참 우습겠지만 \n도움이 되고 싶은 맘 이해해 주겠죠 \n\n정말 사랑하지만 이젠 보내줄께요 \n내겐 없는걸 가진 당신이니까\n행복하게 해줘요 이런부탁을 해도 될까요 \n그리고 당신은 아프지 말아요 나처럼\n\n미안하단 얘기는 자주 하지 마요 \n그 사람 눈물 흘릴땐 못 본 척 해줘요 \n지난 사랑의 상처가 깊은 사람이죠 \n헤어지자는 얘기는 쉽게 하지 마요 \n\n이런 말 하는 내 모습 안쓰럽겠지만 \n그 사람 위해 해줄게 이것 뿐인걸요 \n\n정말 사랑하지만 이젠 보내줄께요 \n내겐 없는걸 가진 당신이니까 \n행복하게 해줘요 이런 부탁을 해도 될까요 \n그리고 당신은 아프지 말아요 \n\n정말 사랑하지만 내가 물러날께요 \n그의 마음을 가진 당신이니까 \n전해 줄 수 있나요 무례한 부탁이 되겠지만 \n그동안 정말 많이 고마웠다고\n그렇게 하지만 하지만 오 제발\n(얘기 들어줘서 정말 고마워 나 먼저 일어날께요) \n내가 아파 하는걸 모르게 해줘요\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/235/15026235_1405322407420_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16129837, lowkey: nil, highkey: nil},
  {album_id: 36, singer_id: 54, team_id: nil, title: "이런밤", genre1: "가요", genre2: "발라드", runtime: "04:37", lyrics: "\n\t\t\t\t\t\t\t<div>이런밤 - 04:37</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">잠들수없는 이런밤 혼자가 너무싫어서 \n바람이라도 들어오도록 작은창을 모두 열어놓았어 \n낡은 피어노 앞에서 즐겨부르던 노래도 \n웬지 오늘은 잘되질않아 새벽은 더 멀기만한데\n\n하지만 이대로 그냥 지샐 수 밖에 \n꼭 이런날이면 내꿈속으로 찾아오는한 사람이 있을테니\n어쩌면 꿈에도 그댈 붙잡지못한나\n눈물로 또하룰 보낼테니까\n\n읽다만 책을 펴봐도 빈방을 정리해봐도 \n내그리움이 가라앉기엔 이밤도 다 모자라나봐\n내안에 그대가 없는 날이 없어서 \n내맘은 하루도 잠들지못해\n자꾸 외로움에 지쳐가고있어 \n차라리 그대를 잊는건 내가잊어야\n슬픔도 날떠나가줄지몰라 \n\n내가 그대곁에 있었다는것만 기억해 난 그거면돼 \n이밤 어디선가 그대 때문에 잠못드는 나를위해서\n\n하지만 이대로 그냥 지샐수밖에\n꼭 이런날이면 내꿈속으로 그댄 다시 찾아와 줄테니\n어쩌면 꿈에도 그댈 붙잡지못한 날\n눈물로 또 하룰 보낼테니까\n\n눈물로 또 하룰 보낼테니까\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/235/15026235_1405322407420_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 10257, song_num: 16129838, lowkey: nil, highkey: nil},
  {album_id: 36, singer_id: 54, team_id: nil, title: "사랑은", genre1: "가요", genre2: "발라드", runtime: "03:57", lyrics: "\n\t\t\t\t\t\t\t<div>사랑은 - 03:57</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">참많이 생각해봤어 헤어지잔 얘기를 \n어떻게 말해야 하는지 \n아직 아무것도 모른채 \n환히 웃는 그대를 어떡해야 좋을지 \n생각만으로도 가슴이 아파서 \n며칠밤을 울었어 \n오늘 그대를 떠나기까지 \n\n사랑은 잡고싶어도 보내는것 \n가끔 거짓을 말하는것 \n눈물이 나도 웃어 보이는것 \n그대 행복을 위해 한걸음 물러난뒤에 \n힘이들어도 붙잡지않는것 \n\n사실 많이 노력해봤어 \n세상이 나쁘다고 변명하고 싶었어 \n사랑만으로는 안된다는말은 인정할수 없었어 \n오늘 이별을 말하기까지\n\n사랑은 잡고싶어도 보내는것 \n가끔 거짓을 말하는것 \n눈물이 나도 웃어 보이는것 \n그대 행복을 위해 한걸음 물러난뒤에 \n힘이들어도 붙잡지않는것\n\n그대에겐 너무 가혹했던 세상도\n내가없으면 달라질꺼라 그렇게 믿을께\n사랑은 떠나야 할 때를 아는것\n추억이 다치지 않도록\n눈물이 나도 웃어 보이는것\n이렇게 생각해줘 사랑을 이룬다는 건\n서로 영원히 그리워하는거라고\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/235/15026235_1405322407420_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16129839, lowkey: nil, highkey: nil},
  {album_id: 36, singer_id: 54, team_id: nil, title: "Give Me You Mind", genre1: "가요", genre2: "발라드", runtime: "03:45", lyrics: "\n\t\t\t\t\t\t\t<div>Give Me You Mind - 03:45</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">That is the same as the emotion\n느껴봐요 내 품안에서 Baby\nGive me you mind make it real\n매일 그댄 내 곁에서 잠들죠 \n\nCan I get down can i turn it around\nI can get down I can turn it around\nCan I get down can I turn it around\nI can get down\n\n가끔 난 이런 상상을 하죠 하늘 아래 그대와 나만 \n오늘 한번만이라도 그런 일은 없는 걸 알면서도 \n\n아직 그대는 내가 어떤지 알지 못하지만 \n나는 이 밤도 꿈을 꾸죠 \n그댈 위한 시간 기다렸던 이 순간 \n이렇게 난 그대 곁에 \n\nThat is the same as the emotion\n느껴봐요 내 품안에서 Baby\nGive me you mind make it real\n매일 그댄 내 곁에서 잠들죠\n\nTrying to keep on eyes on you\nI can't hide my love inside\nit's another day for you\nYou &amp; me in paradise\n\n이젠 매일 밤 그댈 만나죠 그 시간이 기다려지죠 \n오늘밤 그댈 만나면 꿈에라도 이젠 고백 해야죠 \n\n아직 그대는 내가 어떤지 알지 못하지만 \n나는 이 밤도 꿈을 꾸죠 \n그댈 위한 시간 기다렸던 이 순간 \n이렇게 난 그대 곁에\n\nThat is the same as the emotion\n느껴봐요 내 품안에서 Baby\nGive me you mind make it real\n매일 그댄 내 곁에서 잠들죠\n\n이제 그대도 내 맘을 아나봐요 \n미소 띈 그대 얼굴이 말해주잖아요 내 맘을 \n이렇게 난 그대 곁에\n\nThat is the same as the emotion\n느껴봐요 내 품안에서 Baby\nGive me you mind make it real\n이젠 그댄 내 곁에서 잠들죠\n\nTrying to keep on eyes on you\nI can't hide my love inside\nit's another day for you\nYou &amp; me in paradise\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/235/15026235_1405322407420_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16129840, lowkey: nil, highkey: nil},
  {album_id: 36, singer_id: 54, team_id: nil, title: "끝이 보일때즘", genre1: "가요", genre2: "발라드", runtime: "04:34", lyrics: "\n\t\t\t\t\t\t\t<div>끝이 보일때즘 - 04:34</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">누구나 한번쯤은 세상을 다준대도 \n바꿀수없는 사랑해봤겠죠 \n그러다보면 시간이 흘러가듯 이별도 찾아와요\n사랑이 깊어지면 멈출 줄을 모르죠\n눈뜨면 서로밖에 못보니까\n운명의 선이 어긋날 때 쯤되면 \n그땐 자신밖에 몰라요\n\n끝이보이면 서두르지 마요\n벌써 무너진 가슴이겠지만\n생각도없이 아픔에 지쳐서\n소중한사람 버리려 하진 마요\n안아주세요 그의 미움까지\n그리고 이렇게 생각해봐요 \n그 사람 없이도 나 살수있는지\n살아갈 이유 없어도 되는건지\n그렇게\n\n참았던 투정들이 한껏 밀려왔을 땐 \n좋았던 기억으로 덮어줘요\n만약 헤어지면 영화속이별처럼\n우연히라도 볼수있게 \n\n끝이보이면 서두르지마요\n벌써 무너진 가슴이겠지만 \n생각도없이 아픔에 지쳐서\n소중한사람 버리려 하지마요 \n안아주세요 그의 미움까지\n그리고 이렇게 생각해봐요 \n그 사람 없이도 나 살수있는지\n살아갈 이유 없어도 되는건지\n그렇게\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/235/15026235_1405322407420_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16129841, lowkey: nil, highkey: nil},
  {album_id: 36, singer_id: 54, team_id: nil, title: "If", genre1: "가요", genre2: "발라드", runtime: "04:36", lyrics: "\n\t\t\t\t\t\t\t<div>If - 04:36</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">그런 얘기 안꺼냈더라면 웃으면서 넘겼다면 \n우린 여전히 아무일 없이 예전모습 그대로 일텐데 \n\n한번만 더 붙잡았더라면 좀 더 솔직했더라면 \n너를 잃고서 아픈 후회속에서 눈물 흘리진 않았을텐데 \n\n단 한번만 꼭 한번만 너를 보냈던 그 하루를 되돌려 줄수만 있다면 \n두번 다시는 너를 그런 모습으로 보내지 않아 \n내 전부였던 너를 \n\n어리석은 생각이라는 걸 소용 없는 일이란걸 \n잘알면서도 못난 기대만으로 지금까지도 난 기도해 \n\n단한번만 꼭 한번만 너를 보냈던 그 하루를 되돌려 줄 수만 있다면 \n두번 다시는 너를 그런 모습으로 보내지 않아 \n내 전부였던 너를 워\n\n얼마나 많이 니가 보고 싶은지 내가 얼마나 울었는지 \n혹시 우연이라도 너 듣게 된다면 그렇게라도 나의 맘을 안다면 \n\n한번만더 (한번만더) 조금만더 내게 하고싶던 얘기를 듣게 된다면\n나의 모질었던 떠나버릴만큼 아팠던 그맘 용서 받을 수 있게\n널 잡을수 있게\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/235/15026235_1405322407420_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16129842, lowkey: nil, highkey: nil},
  {album_id: 36, singer_id: 54, team_id: nil, title: "사랑은 하잖아", genre1: "가요", genre2: "발라드", runtime: "04:30", lyrics: "\n\t\t\t\t\t\t\t<div>사랑은 하잖아 - 04:30</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">점점 멀어져서 니가 힘든만큼 \n지쳐있던 니 눈빛은 나를 봐줄 여유 없어 \n아무 희망없이 아직 기다리는 \n숨막히는 니 가슴을 나도 아니까\n\n나를 사랑하는 것까지 짐이겠지 \n그래서 더 조급할꺼야\n허나 내가 힘든것은 현실이 아냐 \n나를 위해서 도망치는 너야\n밀어내지마 사랑했었던 나지만 \n견더내 니 아픔속에 나도 넣어주길바래 \n서툰 위로따위는 결코 않할께 \n소리없이 그림자로 그저 너를 지켜볼테니 \n\n나를 사랑하는 것 까지 짐이겠지 \n그래서 더 조급할꺼야 \n허나 내가 힘든것은 현실이 아냐 \n나를 위해서 도망치는 너야 \n밀어내지마 사랑했었던 나지만 \n견뎌낼 니 아픔속에 나도 넣어주길바래 \n괜한 투정같은건 절대 않할께 \n아무것도 모르는척 곁에 있을께 \n\n서툰 위로따위는 결코 않할께 \n소리없이 그림자로 그저 너를 지켜볼테니 \n니가 편안해 지면 후회 될꺼야 \n사랑까지 버린니가 대체 뭘로 버틸수있어\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/235/15026235_1405322407420_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16129843, lowkey: nil, highkey: nil},
  {album_id: 36, singer_id: 54, team_id: nil, title: "Change", genre1: "가요", genre2: "발라드", runtime: "03:43", lyrics: "\n\t\t\t\t\t\t\t<div>Change - 03:43</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">Make me cry again\n그 달콤했던 거짓말들로 모둘 속여왔었겠지\n다신 그런 일 없도록 거짓뿐인 사랑은 절대 못하도록\n\n처음엔 니 눈빛을 솔직하다 느꼈어\n그 느낌에 항상 난 끌려 왔고 모든걸 준 듯 했지\n나밖에 없다는 유치한 그 말이 난 늘 좋았고\n어쩌면 순진하기까지 한 그 약속들로 막연한 기댈 해왔지\n\nYou gonna make me cry again\n그 달콤했던 거짓말들로 모둘 속여왔겠지 \nYou gonna make me crazy again\n나처럼 바보 같았던 여자들 많잖아 \n다신 그런 일 없도록 거짓 뿐인 사랑은 절대 못하도록 \nBaby, I can show I can try 너를 바꿔놓고 말겠어 \n\n그런 일 없었다고 내게 변명하지마\n마음에도 없는 말 꺼내 놓는 어지러운 그 눈빛\n아무 문제없어 걱정마 내 안에 너를 지웠어 깨끗이 \n날 너무 잔인하게 보진 말아줘 그럼 내가 슬퍼져\n\nYou gonna make me cry again\n그 달콤했던 거짓말들로 모둘 속여왔겠지 \nYou gonna make me crazy again\n나처럼 바보 같았던 여자들 많잖아 \n다신 그런 일 없도록 거짓 뿐인 사랑은 절대 못하도록 \nBaby, I can show I can try 너를 바꿔놓고 말겠어 \n\n사람들이 모두 너의 안부를 물었지 \n사실 얼마나 내가 너를 사랑했는진 나도 알지만 \n눈감아 주기엔 내 사랑이 너무 안타까워 \n지금껏 아파한 만큼만 미워하겠어\n\nYou gonna make me cry again\n그 달콤했던 거짓말들로 모둘 속여왔겠지 \nYou gonna make me crazy again\n나처럼 바보 같았던 여자들 많잖아 \n다신 그런 일 없도록 거짓 뿐인 사랑은 절대 못하도록 \nBaby, I can show I can try 너를 바꿔놓고 말겠어 \n\nYou gonna meke me cry agin\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/235/15026235_1405322407420_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16129844, lowkey: nil, highkey: nil},
