  {album_id: 37, singer_id: 55, team_id: nil, title: "실락원", genre1: "가요", genre2: "트로트", runtime: "04:31", lyrics: "\n\t\t\t\t\t\t\t<div>실락원 - 04:31</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">이제 그 눈물 거두어 마지막 세상을 봐\r\n다시 깨어난 시린 아침 \r\n\r\n그래 함께 가는 거야 서로의 가슴 안고\r\n끝내 돌아오지 못 할 길고 긴 잠 속으로\r\n\r\n거역할 수 없는 건 시작된 사랑일뿐\r\n결코 이별은 아닌데 \r\n가혹한 운명의 얼굴\r\n이 끝없는 형벌에 두 마음 쉴 곳 없어\r\n\r\n이대로 떠나가려해\r\n늘 쫓겨온 사랑 비로소 자유로워\r\n영원한 꿈을 꾸면돼 편한 여행처럼 \r\n이제 곧 닿을 세상에서\r\n\r\n지친 가슴 안았지 아픔에 몸을 떨며\r\n이미 미쳐버린 사랑 비웃으며 돌아서는 \r\n이 잔인한 세상엔 \r\n아무런 미련 없어\r\n\r\n이대로 떠나가려해 \r\n늘 쫓겨온 사랑 비로소 자유로워\r\n영원한 꿈을 꾸면돼 편한 여행처럼 \r\n이제 곧 닿을 세상에서\r\n\t\t\t\t\t</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/245/15026245_1406181499534_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16129969, lowkey: nil, highkey: nil},
