  {album_id: 42, singer_id: 59, team_id: nil, title: "鼻笑(비소)", genre1: "가요", genre2: "전체", runtime: "04:04", lyrics: "\n\t\t\t\t\t\t\t<div>鼻笑(비소) - 04:04</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">yo mr Pal-e play that funky sound \r\nsay hey-ho! Movin grooving up? \r\nDown hey mr Pal-e play it one \r\nMore time say hey-ho! \r\nYa'll ready for this \r\n\r\n나나나나~~나나나나~say hey~hey 오~나나 \r\n나나나나~~나나나나~say hey~hey 오~나나 \r\n\r\n니가 누군지 난 몰라 날 떠난 그 날 다 잊었으니까 \r\n니가 버린 그 남자- 난 죽고 없으니까 oh~ \r\n너 그래도 좋다면 그래도 돌아올 마음이 있다면 \r\n널 밀어낼 생각은 없어 그것도 니 맘이지 \r\n니가 어디라고 또 와 어떻게 버린 난데- 또 와 \r\n난 미움밖에 남은 게 없어 \r\n\r\n니가 원하면 사랑해주지 내겐 더 이상 손해는 없지 \r\n아주 조금씩 천천히 네게- 내가 받은 고통을 다 돌려주지 \r\n다시 시작할 척 하긴 쉽지 너에게 배웠던 다- 그대로 \r\n가장 사랑할 때 니가했듯 널 배신해 줄 테니 \r\n\r\nyo Baby tell me why so \r\nyou stress to this don't waste my \r\ntime don't heed to diss come \r\nfeel me right and I'll hold you \r\ntight gotla shake that body \r\nthrough the night here I com \r\nhere I come from the left to \r\nthe Right yo Rapper boy c.k \r\nclickin with the mix. Mr K.P \r\nVocal showin them kicks it's \r\nThe N.G.Y brother family \r\n\r\n꿇었던 무릎이 아직도- 흘렸던 눈물이 아직도 \r\n내 심장속에 살아있으니 oh~ \r\n\r\n\r\n\r\n니가 원하면 널 가져주지 내게 그랬듯 널 부숴주지 \r\n감정 없이도 사랑은 하지 세상가장 감미로운 목소리로- \r\n두 번 떠나게 할 수는 없지 나 가진 모든 걸 다- 나눠줘- \r\n가장 행복한 그 끝에서 널 버리고 말겠어- oh~</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/251/15026251_1458717021920_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130059, lowkey: nil, highkey: nil},
  {album_id: 42, singer_id: 59, team_id: nil, title: "그때까지", genre1: "가요", genre2: "전체", runtime: "03:40", lyrics: "\n\t\t\t\t\t\t\t<div>그때까지 - 03:40</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">살다가 어느 먼 훗날\n오늘을 웃으며 말해요\n힘들던 눈물이 흘러 말 못한 이유\n나를 떠나야한 그 이유\n아무리 노력해봐도 턱없이 부족한 나였죠\n아나요 그댈 잡을 자신 없어서\n떠나는 그댈 보내요\n\n천번을 더 떠나도 보내진 않겠죠\n내마음이 그대를 놓진 않겠죠\n지켜주지 못해도 나 없이 행복해요\n우리가 다시 만날때 까지\n\n가까이 올수 없다고\n사랑이 끝난건 아니죠\n잊어요 그 사랑 내가 지켜둘께요\n돌아올 그 순간 까지\n\n천번을 더 떠나도 보내진 않겠죠\n내 마음이 그대를 놓진 않겠죠\n지켜 주지 못해도 나 없이 행복해요\n우리가 다시 만날때 까지\n\n누군가의 가슴에 안겨서 쉬다와요\n언젠가 다시 만날때까지\n그대를 다시 안을때까지\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/251/15026251_1458717021920_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 10455, song_num: 16130060, lowkey: nil, highkey: nil},
  {album_id: 42, singer_id: 59, team_id: nil, title: "無言(무언)", genre1: "가요", genre2: "전체", runtime: "04:36", lyrics: "\n\t\t\t\t\t\t\t<div>無言(무언) - 04:36</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">한때는 널 위해 늘 가고 있다고\r\n내가 없으면 힘들거라고 \r\n그렇게 어리석은 생각과 마음으로 지내왔었는데.\r\n바보처럼 나만 몰랐던거니.\r\n내가 얼마나 못났었는지.\r\n아쉽게 남겨진 햇살앞에\r\n난 말었이 그냥 서있을뿐\r\n처음부터 너는 없었던 거라고. \r\n내 가슴 깊은 시린 이곳 세상에. \r\n잠시 예쁜 꿈을 꾼거라고 생각하면 되는거지. \r\n그렇게 잊는 거지. \r\n\r\n어쩌면 나에게 너를 미워할 자격조차도 없는지몰라.\r\n하지만 너는 잊을수 있니?\r\n우리 함께 했던 그날들을. \r\n처음부터 너는 없었던 거라고. \r\n내 가슴 시린 이곳 세상에\r\n잠시 예쁜 꿈을 꾼거라고 생각하면 되는거지. \r\n그렇게 잊는 거지. \r\n하지만 어떻게 지울수 있겠니?\r\n아무리 긴 시간이 흘러도. \r\n너에게 잘못한 많은 나의 미안한 마음이\r\n이렇게 이렇게 남았는데.\r\n너에게 잘못한 일만 많은 \r\n나의 미안한 마음이 이렇게 남았는데.</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/251/15026251_1458717021920_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130061, lowkey: nil, highkey: nil},
  {album_id: 42, singer_id: 59, team_id: nil, title: "Remember today", genre1: "가요", genre2: "전체", runtime: "03:58", lyrics: "\n\t\t\t\t\t\t\t<div>Remember today - 03:58</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">나 가진 마음을 다 네게 줄께 너만 느끼게\r\n\r\n  날 택한 오늘을 후회 안하도록\r\n\r\n  외롭지 않게 너를 지켜줄께 내가 약속해\r\n\r\n  니눈에 슬픔은 다시는 없을꺼야\r\n\r\n  혹시 힘든일 마주칠지 몰라 \r\n\r\n  넌 모르고 살아줘 나 너를 위해 어떤일도 이겨낼께\r\n\r\n  난 너를 사랑해 이 세상이 다 듣게 큰소리로 말할께\r\n\r\n  니가 가진 나라고 이것만 기억해 나 숨쉬는 이유는 너야\r\n\r\n  네가 있어 내가 사는 오늘이라고-☆\r\n\r\n \r\n  아침을 맞는 행복 내가 될께 \r\n\r\n  너는 언제나 사랑만 느끼며 긴 하루를 살면돼\r\n\r\n  우린 미워져 헤어지면 안돼 늘 오늘을 기억해\r\n\r\n  나 부족해도 너를 위해 달라질께\r\n\r\n  난 너를 사랑해 이 세상이 다 듣게 큰소리로 말할께\r\n\r\n  니가 가진 나라고 이것만 기억해 나 숨쉬는 이유는 너야\r\n\r\n  네가 있어 내가 사는 오늘이라고\r\n  사랑이 시작되 천천히 날 다 보여줄께\r\n\r\n  두눈감는 순간까지 넌 날보면 돼</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/251/15026251_1458717021920_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130062, lowkey: nil, highkey: nil},
  {album_id: 42, singer_id: 59, team_id: nil, title: "떨림", genre1: "가요", genre2: "전체", runtime: "03:26", lyrics: "\n\t\t\t\t\t\t\t<div>떨림 - 03:26</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">verse\n표정을 감추려고 아무리 애써도 잘 안돼\n너의 미소가 내 맘을 뺏어버린거야\n\n내마음 속에 두려움 아픔도 너에게 맡길게 \n나를 안아줘 너 언제까지 내곁에서\n\nbridge\n첨이야 이렇게 두근거린 이 느낌\n너하나만 바라봐줄게\n\nchorus\nbaby show me show me show me love for me\noh baby 다시 올 수 없는 이 떨림\n닫혔던 내 사랑의 문을 열어준 너 감사해(고마워)\nbaby tell me tell me 내게 말해줘\n니 맘도 나를 향해 열려있다고\n반복된 이별 연습 속에 우린 절대 없을꺼라고\n\nverse2\n아직도 모르겠니 너 하나만 내게 오면 돼 \n이별은 없어 날 믿어도 돼 언제라도\n그 동안의 헤어짐 다 너를 만나기 위한걸\n이제 알았어 영원히 너만 사랑할게\n\nbridge\n첨이야 이렇게 두근거린 이 느낌 너하나만 바라봐줄게\n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/251/15026251_1458717021920_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130063, lowkey: nil, highkey: nil},
  {album_id: 42, singer_id: 59, team_id: nil, title: "後愛(후애)", genre1: "가요", genre2: "전체", runtime: "04:08", lyrics: "\n\t\t\t\t\t\t\t<div>後愛(후애) - 04:08</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">너를 처음 만난 그 날을 생각하면\r\n아직도 내 맘은 포근하기만 한데\r\n\r\n\r\n사랑했어 널 이 세상 누구보다\r\n하지만 이제는(모두다) 지나간 애기일뿐\r\n\r\n오랜 시간지나 만날 수 도 있겠지\r\n그땐 다른 사람을 위해서 살고 있겠지\r\n그래 그렇게 지나가면 될 일인데\r\n왠지 니가 너무 보고 싶어져~~~~\r\n\r\n헤어진 후에야 다시 난 알게됐어\r\n니가 얼마만큼 소중한지(부탁이야)\r\n나를 잊지 말아줘 잊지 말고 기억해줘\r\n언젠가 우리 다시 만나 아름답게 웃을 수 있게\r\n\r\n\r\n\r\n생각나니 우리 행복했던 시간들\r\n이젠 추억이지만 그때가 너무 그리워\r\n너도 나를 나만큼 사랑했었다고\r\n그 말 한마디만 내게 말해줘~~~~~</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/251/15026251_1458717021920_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130064, lowkey: nil, highkey: nil},
  {album_id: 42, singer_id: 59, team_id: nil, title: "설레임", genre1: "가요", genre2: "전체", runtime: "04:08", lyrics: "\n\t\t\t\t\t\t\t<div>설레임 - 04:08</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">해저문 노을빛 같은 나 너를 처음 만났지. \n이젠 다시 없을 듯한 그 수줍던 설레임. \n\n네게만 들려주려고 나 연습했던 노래. \n문득 생각날 때 마다 늘 마음이 아팠어. \n\n왜 우연은 널 짖굳게도 오늘 내게로 데려와 \n다른사람 내곁에 있는 날 보이게 하는지 \n\n널 사랑했어 난 늘 그랬어 말로는 못했지만 그랬어. \n나 사랑을 잘 잘 몰라서 너를 보냈어 늘 후회했어. \n\n널 못 잊어서 늘 그리워서 나 한참을 너 때문에 울었어. \n참 오래 준비했던 말 난 하나도 못하고 웃었어... \n\n왜 우연을 널 기다릴 때 내게 올 수 없었는지 \n내곁에서 행복해하는 그녈 보여 주는지 \n\noh~ 넌 넌 아닌건지 한번은 다시 묻고 싶었어. \n난 너에게도 늘 특별한 추억인건지 넌 다른건지. \n\n나 못했던말 미안하단말 행복하란 그 말 하고 싶었어. \n남 보다 더 어색하게 널 스치게 될 줄은 몰랐어...</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/251/15026251_1458717021920_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130065, lowkey: nil, highkey: nil},
  {album_id: 42, singer_id: 59, team_id: nil, title: "그땐 널", genre1: "가요", genre2: "전체", runtime: "04:21", lyrics: "\n\t\t\t\t\t\t\t<div>그땐 널 - 04:21</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">잘 있을께 니가 바라면 잡지도 않고 기다리지 않고\n\n  너란 사람을 몰랐던 것처럼 기억의 끈을 버리고\n\n  웃어볼께 니가 그러듯 다른 사람을 사랑해도 볼께\n\n  남겨두었던 메일도 지우고 사진 한장도 모두 버리고\n\n  그래서 된다면 그래서 잊으면 \n\n  아마 널 벌써 어제 잊어줬겠지\n\n  버리고 버려도 잊지못할 사람 너라서 그게 어려웠어-☆\n\n\n  떠나볼께 보고 싶어도 다신 곁에서 너를 볼 수 없게\n\n  마지막 내게 모진 말 해줄래 미워서라도 너를 지울수 있게\n\n  그래도 안되면 해봐도 안되면\n\n  그땐 널 그냥 사랑해도 되겠니\n\n  버리고 버려도 잊을수 없다면 슬퍼도 그게 쉬울꺼야\n\n  만약에 나 다시 살아 첨으로 돌아갈수 있다면\n\n  널 놓치는 그런실순 안할텐데 이별은 없을텐데-☆\n\n\n  버리고 버려도 잊을수 없으면 그땐 널 그냥 사랑할께..\n\n  슬퍼도 그게 쉬울꺼야..</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/251/15026251_1458717021920_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130066, lowkey: nil, highkey: nil},
  {album_id: 42, singer_id: 59, team_id: nil, title: "winter story", genre1: "가요", genre2: "전체", runtime: "03:30", lyrics: "\n\t\t\t\t\t\t\t<div>winter story - 03:30</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">널 사랑할 것 같아- 난 세상을 가진 것만 같아-\r\n널 사랑하나봐..\r\n\r\n처음엔 그냥 관심도 없었어..\r\n영화나 보고.. 차나 한 잔 할까..\r\n\r\n문득 너를 보았어.. 많이 수줍었나봐..\r\n어린애처럼 실수만 하잖아..\r\n그런 니 모습에 웃다가-\r\n헤어지고 왔을때..\r\n자꾸니가 눈에 보였어..\r\n\r\n난 사랑을 찾았어.. 난 사랑에 빠진 것 같아..\r\n\r\n모른 나를 꺼내 줘.. 2.(다신너를 놓치지 않아..)\r\n난 사랑을 알겠어.. 널 내품에 안아주고 싶어..\r\n널 지키고 싶어..\r\n\r\n친구소개로 이끌려 나갔어..\r\n다른 사랑에 맘이 아팠던 난..\r\n\r\n너와 얘길나눠도.. 맘은 다른데 있어-\r\n그런 내 맘이 네게 들켰나봐..\r\n눈물 글썽이며 돌아선-\r\n니 모습을 봤을 때..\r\n나도 몰래 맘이 아팠어..</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/251/15026251_1458717021920_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130067, lowkey: nil, highkey: nil},
  {album_id: 42, singer_id: 59, team_id: nil, title: "그래요", genre1: "가요", genre2: "전체", runtime: "03:50", lyrics: "\n\t\t\t\t\t\t\t<div>그래요 - 03:50</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">그대가 또 우네요 내가 또 울리네요 \n그대의 눈물은 싫다고 해 놓고 \n그댈 울리는 건 언제나 나예요 \n\n떠나고 싶을때는 간다고 하면 돼요 \n그대를 위해선 못 할게 없는 내가 \n그대 가신다면 보내야죠 \n\n그댄 이제 가요 나는 걱정마요 \n다신 울고 그러지 마요 \n내게 올 땐 그 사람 못 잊고 왔듯 \n다시 돌아갈 땐 나를 가슴에 품고 가진 마요 \n\n옷을 고를 때에도 그댄 항상 그랬죠 \n두고 온 그 옷이 자꾸 나아보여서 \n한참동안이나 망설이죠 \n\n이젠 오지마요 돌아보지 마요 \n한번만에 나를 잊어요 \n지금처럼 내 마음 아프게 하듯 \n그 사람에게는 절대 그러지마요 \n\n제발 그 사람 못 잊고 왔듯 \n다시 돌아갈 땐 나를 가슴에 품고 가진 마요 </p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/251/15026251_1458717021920_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 10757, song_num: 16130068, lowkey: nil, highkey: nil},
  {album_id: 42, singer_id: 59, team_id: nil, title: "제발가", genre1: "가요", genre2: "전체", runtime: "04:00", lyrics: "\n\t\t\t\t\t\t\t<div>제발가 - 04:00</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">언젠간 변하지.. 아직은 아니라해도..\n상처만 주는 날 어차피 넌 떠날텐데..\n\n시간이 가면 더 어려워.. 사랑이 깊으면 더 해 오~~~\n떠나고 싶다는 말 하기가 넌 쉽지 않을거야..\n\n차라리 멀리 내게서 달아나~\n불안한 나의 눈빛을 벗어나~\n\n눈물로 다가와도 너를 다시 외면하게 될거야..\n\n날 사랑하게 만든 건 나였어..(나지만..)\n널 떠나 가게 만들 수도 있어.\n\n그 눈물에 아파할 나라는 건 내가 더 잘 알면서..\n\n\n\n아니라 말하지.. 지금은 아니라해도..\n기댈 수 없다고 어차피 넌 떠날텐데..\n\n누군가 내게 빠져오면 끝없이 밀어내려 해 오~~~\n정말 난 사랑하고 싶지만 항상 다 똑같았어\n\n차라리 멀리 내게서 달아나~\n불안한 나의 눈빛을 벗어나~\n\n눈물로 다가와도 너를 다시 외면하게 될거야..\n\n날 사랑 하게 만든 건 나였어..\n또 떠나 가게 만들 수도 있어..\n\n그 눈물에 아파할 나라는 건 내가 더 잘 알면서..\n\n미안해.. 두번 다시는 내게 오지마..\n워-워-워-워- 널 떠나는 나 후회하지 않도록..</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/251/15026251_1458717021920_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130069, lowkey: nil, highkey: nil},
  {album_id: 42, singer_id: 59, team_id: nil, title: "鼻笑(비소)Remix 버전", genre1: "가요", genre2: "전체", runtime: "04:05", lyrics: "\n\t\t\t\t\t\t\t<div>鼻笑(비소)Remix 버전 - 04:05</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">yo mr Pal-e play that funky sound \r\nsay hey-ho! Movin grooving up? \r\nDown hey mr Pal-e play it one \r\nMore time say hey-ho! \r\nYa'll ready for this \r\n\r\n니가 누군지 난 몰라 날 떠난 그 날 다 잊었으니까 \r\n니가 버린 그 남자- 난 죽고 없으니까 oh~ \r\n너 그래도 좋다면 그래도 돌아올 마음이 있다면 \r\n널 밀어낼 생각은 없어 그것도 니 맘이지 \r\n니가 어디라고 또 와 어떻게 버린 난데- 또 와 \r\n난 미움밖에 남은 게 없어 \r\n\r\n니가 원하면 사랑해주지 내겐 더 이상 손해는 없지 \r\n아주 조금씩 천천히 네게- 내가 받은 고통을 다 돌려주지 \r\n다시 시작할 척 하긴 쉽지 너에게 배웠던 다- 그대로 \r\n가장 사랑할 때 니가했듯 널 배신해 줄 테니 \r\n\r\nyo Baby tell me why so \r\nyou stress to this don't waste my \r\ntime don't heed to diss come \r\nfeel me right and I'll hold you \r\ntight gotla shake that body \r\nthrough the night here I com \r\nhere I come from the left to \r\nthe Right yo Rapper boy c.k \r\nclickin with the mix. Mr K.P \r\nVocal showin them kicks it's \r\nThe N.G.Y brother family \r\n\r\n꿇었던 무릎이 아직도- 흘렸던 눈물이 아직도 \r\n내 심장속에 살아있으니 oh~ \r\n\r\n꿇었던 무릎이 아직도- 흘렸던 눈물이 아직도 \r\n내 심장속에 살아있으니 oh~ \r\n\r\n니가 원하면 사랑해주지 내겐 더 이상 손해는 없지 \r\n아주 조금씩 천천히 네게- 내가 받은 고통을 다 돌려주지 \r\n\r\n다시 시작할 척 하긴 쉽지 너에게 배웠던 다- 그대로 \r\n가장 사랑할 때 니가했듯 널 배신해 줄 테니 \r\n\r\n니가 원하면 널 가져주지 내게 그랬듯 널 부숴주지 \r\n감정 없이도 사랑은 하지 세상가장 감미로운 목소리로- \r\n두 번 떠나게 할 수는 없지 나 가진 모든 걸 다- 다 바쳐- \r\n가장 행복한 그 끝에서 널 널 버리고 말겠어- oh~</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/251/15026251_1458717021920_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130070, lowkey: nil, highkey: nil},
