  {album_id: 43, singer_id: 36, team_id: nil, title: "Platonic-SIDE B", genre1: "가요", genre2: "랩/힙합", runtime: "05:18", lyrics: "\n\t\t\t\t\t\t\t<div>Platonic-SIDE B - 05:18</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가사 정보가 없습니다.</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/253/15026253_1435654309536_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130100, lowkey: nil, highkey: nil},
  {album_id: 43, singer_id: 36, team_id: nil, title: "보릿고개 - 45rpm", genre1: "가요", genre2: "랩/힙합", runtime: "04:45", lyrics: "\n\t\t\t\t\t\t\t<div>보릿고개 - 45rpm - 04:45</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">(chorus)\r\n이제 머리속을 비워 내 실력을 키워나가야하는데\r\n지금 너무나도 추워 너무나 힘겨워 돈에 겨워 \r\n눈물 겨워 흥에 겨워 랩을 할 때가 그리워\r\n이제 머리속을 비워 내실력을 키워나가야하는데\r\n지금 너무나도 추워 너무나 힘겨워 돈에 겨워\r\n눈물 겨워 흥에 겨워 랩을 할때가 그리워\r\n(versr 1: zolla)\r\n점점 무너져가는 나의 순수함\r\n1,2, 멀어져가는 주위 친구들 깊이 깊이\r\n빠져들면 빠져들수록 하루하루 \r\n계속 힘든 나날의 연속 피와 땀이 서려있는\r\n한곳 한곳 우리들의 이야기를 차곡 차곡 쌓아가는게\r\n바로 나의 삶의 의미\r\n이미 내삷의 전부가 되버린 나의 취미\r\n(versr 2 : G.R)\r\n언제까지 살아갈지 모르겠어\r\n내게 찾아온 여러 갈래길 위에서\r\n지금 내가 가고 있는 길 여기에서\r\n난 그만 멈춰서고야말았어(원점)\r\n내 생각에는 더이상 끝도없지\r\n또 가도 가도 어차피 다시 여기\r\n자학 할 것도 없고 힘들을 것도 없어\r\n잠시 객기였다고 생각할 뿐\r\n\r\n(versr 3 : BOLTRIX)\r\n벼랑끝에까지 몰렸다 더 물러설순 없다\r\n가슴에 악을 품고 입으로\r\n독을 뿜어라 아둥 바둥 살아남기 위해 발버둥\r\n듣기 좋은 라임도 우리들의 굶주린 위장을\r\n위로할순 없다 고생끝에 낙 오늘도\r\n우린 동고동락 함께해온 희노애락 뒤로한 체\r\n이젠 발악 하늘향해 팔을 뻗어\r\n목푤향해 쭉쭉 뻗어 나가는\r\n나를 누가 막어 모두 비켜 머더퍼커\r\n\r\n(chorus)\r\n이제 머리속을 비워 내 실력을 키워나가야하는데\r\n지금 너무나도 추워 너무나 힘겨워 돈에 겨워 \r\n눈물 겨워 흥에 겨워 랩을 할 때가 그리워\r\n이제 머리속을 비워 내실력을 키워나가야하는데\r\n지금 너무나도 추워 너무나 힘겨워 돈에 겨워\r\n눈물 겨워 흥에 겨워 랩을 할때가 그리워\r\n\r\n(versr 4 : Zolla)\r\n봄 to the 여름 to the 가을보다\r\n더 길게 느껴져 아폴로의 winter\r\n히터 하나 없이 이 겨울을 버텨낸\r\n마이크로폰 체커 그어떤 누구보다 더 높이 날겠어\r\n멀리 보겠어 충청도 촌구석에 랩하는 알피엠\r\nIt`s game fair game 자신과의 game\r\n영원히 끝나지 않을 내 자신과의 game\r\n\r\n(versr 5 : 재진)\r\n어느 땐가부터 새빨갛게 충열된\r\n내 두눈 향기에 무뎌진 내 코\r\n욕뿐이 들리지 않는 귀 쌍`ㅅ`\r\n이 언제부터 입에 밴 내 입 무뎌진\r\n내 신경 적만 보여 색안경 이럴때마다\r\n날 도와주는 우리 우정 보답하고는 싶지만\r\n텅텅 빈 내 사정 옛날로 갈순없다 이젠 영영\r\n\r\n(chorus repeat)\r\n이제 머리속을 비워 내 실력을 키워나가야하는데\r\n지금 너무나도 추워 너무나 힘겨워 돈에 겨워 \r\n눈물 겨워 흥에 겨워 랩을 할 때가 그리워\r\n이제 머리속을 비워 내실력을 키워나가야하는데\r\n지금 너무나도 추워 너무나 힘겨워 돈에 겨워\r\n눈물 겨워 흥에 겨워 랩을 할때가 그리워\r\n\r\n(versr 6 : 45rpm)\r\nAPO double L O 배고픔에 벗어나려해도\r\n항상 같은 자리\r\nghetto 여름에는 난방 겨울에는 냉방 안으로는\r\n매상에도 꿋꿋이 지키고 있는 작은 간판 앞으로\r\n식당 손님이 없어야 아폴로지 손님이 많으면\r\n아폴로 같지가 않지 가시방석 위에 오른 기분\r\n멀리에서 공연하러 와준 고마운분들 덕분\r\n아무도 우릴 알아주지않아\r\n아무도 아폴로를 찾아주지 않아도\r\n알피엠과 볼트릭스, 5th Season 그의 동생들과\r\n떡볶이 한그릇에 피어나는 웃음꽃과 어쩌다\r\n손님오면 왠지 모를 어색함 무한함\r\n모두 다가 나에게는 너무나도 소중한\r\n우리들의 꿈을 이루기 위해\r\n꼭 필요한 배경 작은 무대\r\n\r\n(chorus)\r\n이제 머리속을 비워 내 실력을 키워나가야하는데\r\n지금 너무나도 추워 너무나 힘겨워 돈에 겨워 \r\n눈물 겨워 흥에 겨워 랩을 할 때가 그리워\r\n이제 머리속을 비워 내실력을 키워나가야하는데\r\n지금 너무나도 추워 너무나 힘겨워 돈에 겨워\r\n눈물 겨워 흥에 겨워 랩을 할때가 그리워\r\n\t\t\t\t\t</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/253/15026253_1435654309536_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130101, lowkey: nil, highkey: nil},
