  {album_id: 43, singer_id: 36, team_id: nil, title: "W.A.B-JOOSUC", genre1: "가요", genre2: "랩/힙합", runtime: "04:46", lyrics: "\n\t\t\t\t\t\t\t<div>W.A.B-JOOSUC - 04:46</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가사 정보가 없습니다.</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/253/15026253_1435654309536_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130112, lowkey: nil, highkey: nil},
  {album_id: 43, singer_id: 36, team_id: nil, title: "Still-A-LIVE- MP ALLSTARZ 2002", genre1: "가요", genre2: "랩/힙합", runtime: "05:20", lyrics: "\n\t\t\t\t\t\t\t<div>Still-A-LIVE- MP ALLSTARZ 2002 - 05:20</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가사 정보가 없습니다.</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/253/15026253_1435654309536_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130113, lowkey: nil, highkey: nil},
  {album_id: 44, singer_id: 60, team_id: nil, title: "Do U Want Tension? (Feat. Miniman)", genre1: "가요", genre2: "랩/힙합", runtime: "01:34", lyrics: "\n\t\t\t\t\t\t\t<div>Do U Want Tension? (Feat. Miniman) - 01:34</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">2soo] 그 누구도 모르지 마르지 않는 맘이 또다시 나를 가르지 모두 하나같이 내게서.. \r\nMiniman] Yo! 강한자만 살아남을수 있다는 세상이치 \r\n\r\n2soo] 하지만 나는 아직까지 살아남아 있지 \r\nMiniman] 마치 난 Phenamenon, 약하지만 난 살아남아 약육강식? 먹고싶지도 먹히고 싶지도 않아 \r\n\r\n2soo] Uh! 내게서 겨누어진 총구를 들이밀고서 대적하지 않는자를 조롱하듯이 흐르는 바람에 가려진 날 \r\nMiniman] 모두가 저마다 바라봐 다 너를 바라보고 있는 저 하늘의 눈동자가 \r\n\r\n\r\n2soo] 가끔은 터무니 없이 작아보이지 않나, 그건 자각을 종용하는 조각 \r\nMiniman] 지금은 모두가저마다 누구나 흐르는 바람을 가르듯 많음을 버리고 등뒤로시간을 \r\n보내는 나만의 소중한무엇을 잃었던가 \r\n\r\n2soo] 이제는 지나간 모두를 나만의 그리고 나만의 모두를 버리고 잊혀간 너만의 \r\n나만의 강물은 너저분하게만 흘러 \r\nMiniman] Yo! 도태되지 않아오던 힘의중심속으로부터 파생되어버린 시간도 \r\n\r\n2soo] 돌이킬수없다 해도 서툰 발걸음으로 헌시적인 이상의 분리대속으로- \r\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/254/15026254_1391672692565_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130114, lowkey: nil, highkey: nil},
  {album_id: 44, singer_id: 60, team_id: nil, title: "Trip (Feat. 예솔 of Daggaz)", genre1: "가요", genre2: "랩/힙합", runtime: "04:25", lyrics: "\n\t\t\t\t\t\t\t<div>Trip (Feat. 예솔 of Daggaz) - 04:25</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">Chorus] 따스한 햇살이 달콤한 사탕같이 날 어루만지네 너와 내가 떠날 여행 \r\n잿빛속에 어둔 구름속에 가두어진다해도 나만의 gun 모두를 건 질주  x2 \r\n\r\n아주가끔은 돌아보게 되는 내가 지내온 자신과의 끝이없는 싸움을 위해 Play on \r\n쓰디쓴 익모초를 곱씹으며 때론 세상이 정해놓은 틀을 내가 정해놓은 틀에 맞추려고도 했던것이 \r\n바로 내가 시도하기도 했던 자구책 모른채 외면하던 나를 둘러싸고 있던 수많은 모순 \r\n깨닫지 못했다면 간과할수도 있던것들 또한번 내게 다시주워지는 많디많던기회 무엇을 위해 \r\n군림하려 하는지도 모르고 지낸 그건마치 지네와도 같은 \r\n보잘것도없는 논쟁 거리네 케케묵은 옛날 얘기를 하려하였다면 그건 논점에서 어긋난 발언이란 것을 \r\n모른단 말야? 이제 나의 말을 들어 니가 생각하고 있는 그런것과는 틀려 \r\n\r\nChorus] 따스한 햇살이 달콤한 사탕같이 날 어루만지네 너와 내가 떠날 여행 \r\n잿빛속에 어둔 구름속에 가두어진다해도 나만의 gun 모두를 건 질주  x2 \r\n\r\n예솔] 하나지만 둘, 둘이지만 하나 데거즈 음악은 언제나 그렇듯 귀속 깊이 닿아 \r\n만개(滿開)할 준비가 되어있는 꽃봉오리처럼 이런저런 흔들림없는 유연한 몸짓처럼 \r\n수년간 버려진 탁어(濯語)의 먼지 네게로 부친 영혼이 담긴 예솔의 편지 이제는 혀의놀림 하나로 \r\n세상 모든미추(美醜)를 그릴수 있는 자와 같이 인생의 멋을 알고 내가가진 것들과 대화하는 법을 알았네 \r\n이제야 걷혀지는 안개속으로 사라지는 내안의 번뇌 \r\n고통의 옷을 벗네 인생은 수많은 지룃대중에 하나를 고르는 선택 \r\n절대로 책만으론 얻지 못할지혜 내발밑에 자라고 있는 희망을 놓아둔채 생장의 나이테가 말하는 \r\n노력의 증가를 찾는 여행길 언제나 이어폰은.. 내귓속에 \r\n\r\nChorus] 따스한 햇살이 달콤한 사탕같이 날 어루만지네 너와 내가 떠날 여행 \r\n잿빛속에 어둔 구름속에 가두어진다해도 나만의 gun 모두를 건 질주  x2 \r\n\r\n바라봐, 느껴봐라 라고 말해봐 \"이거봐\" 라는듯이 응시하고 있는 눈이 마치 두가지의 관점을 강요하고 \r\n있는 것이였다면 자물쇠를 해석하는 **** 무언의 움직임속에 \r\n잔류의 흐름에 흐름속에 마모되어버린 흔적들이네 \r\n(잊지않음에) 아직은 동향을 허락하지 않은 성지임에 유한 무적의 길을 떠나려하네 이제 다시금 \r\n시작되어버린 나만의 호신기공 그러함과 그렇지 않음에 \r\n의식의 잣대를 용해시켜버리고 싶은것이 나의 생각이네 \r\n행마의 시작점에 놀란자네 (그래바로너) 이제그만 돌을 던지게 \r\n\r\nChorus] 따스한 햇살이 달콤한 사탕같이 날 어루만지네 너와 내가 떠날 여행 \r\n잿빛속에 어둔 구름속에 가두어진다해도 나만의 gun 모두를 건 질주  x2</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/254/15026254_1391672692565_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130115, lowkey: nil, highkey: nil},
  {album_id: 44, singer_id: 60, team_id: nil, title: "녹음하다가 #", genre1: "가요", genre2: "랩/힙합", runtime: "00:45", lyrics: "\n\t\t\t\t\t\t\t<div>녹음하다가 # - 00:45</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가사 정보가 없습니다.</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/254/15026254_1391672692565_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130116, lowkey: nil, highkey: nil},
  {album_id: 44, singer_id: 60, team_id: nil, title: "Take It Easy (Feat. Soul Food)", genre1: "가요", genre2: "랩/힙합", runtime: "04:05", lyrics: "\n\t\t\t\t\t\t\t<div>Take It Easy (Feat. Soul Food) - 04:05</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">Chorus(이민수)] Happy dayz are here So leave your cares behind \r\nJust relax your mind It's so eazy to do it \r\n\r\n수정 aka Sue] B O To The U N C Wit Me! 유려하게 흘러가는 Bass \r\n지쳐있던 일상 찌푸려진 인상 더이상은 두고 볼수 없지 더이상 자이제 눈을 감아봐 Like This \r\n향기로 가득찬 Rhythm이 너의 귀에 Smog처럼 퍼져 바람에 실려 (도달했을때) 느껴지는 Fantasy \r\n(보지않음에) 이해할순없겠지 그래도 이해할수없다면 2soo.co.kr로 접속을 해보라는것 \r\n그게 바로 내가주는 해답! \r\n\r\nChorus] Happy dayz are here So leave your cares behind \r\nJust relax your mind It's so eazy to do it \r\n\r\n바로여기들어와 이거들어봐 여기지금 우릴바라봐 It's the time 4 da 2soo의 Rhyme 바로여기 \r\n식지않는 열기 만약에 그무엇도 느낄수가 없다면 이 난국을 타계할수있는 그한수 내게 한수 훈수해줘 \r\nIf got power like 2soo 일상에서 느껴오던 짜증들은 Rat-tat-tat-tat 너에게 손가락질 하는시선 \r\n퉤-퉤-퉤-퉤 침을 xx버려 니가 최선이라 느껴오던 그걸고집해 최고로 만드는 것이 \r\n중요하다는 것 이것 또한 역시 내가 주는 해답 \r\n\r\nChorus] Happy dayz are here So leave your cares behind \r\nJust relax your mind It's so eazy to do it \r\n\r\n자이제 천천히 숨을 고르고 하나둘씩 너의 주윌 둘러보아봐 \r\n끈적거리며 고막을 넘나들며 사방으로 퍼져가는 B-E-A-T의 Drama \r\n아주 잠깐 딴생각을 하는사이 시작되어 버린 나의예기 여기 저기 \r\n널려있던 최고급의 주파수들을 모아 재창조 되고있는 2soo의 Muzik 어느누가 나를 막겠어 \r\n여기서 저기서 정신없이 쏟아지는 Rhyme의 난타 다시금 시작 되버린 2 S Double O \r\n이곳에서 멈출수는 없지 그무엇도 \r\n\r\nChorus] Happy dayz are here So leave your cares behind \r\nJust relax your mind It's so eazy to do it x2 \r\n\r\nS-N 2 da A-R-E 2 da Kick 너의 가슴을 때리는 지금울리는 쿵쿵대는 심장 박동같은 소리를 \r\n느낄수가 있다면 그렇다면 그건바로 HipHop의 Rhythm 믿음 속에 변치 않을 그모든 흐름 \r\n머리속에 내제된 시작된 그 모든 감정들을 담아 모두 그렇게 하나가 된듯이 빨려들어만 가고 \r\n있어 이속에서 흐르는 Beat속에서 느낄수 있어 계속해서 \r\n더 이상으로 잃을것도 뭣도 없는 그런 상황에 처해도 \r\n마치 밀려오는 파도와같이 험난하기만한 시련닥친다해도 이곳에서 멈출수는 없지 그무엇도</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/254/15026254_1391672692565_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130117, lowkey: nil, highkey: nil},
  {album_id: 44, singer_id: 60, team_id: nil, title: "Get Some Relaxin' Part 1 (Feat. 수정 of 허니패밀리 &amp; 이민수)", genre1: "가요", genre2: "랩/힙합", runtime: "03:25", lyrics: "\n\t\t\t\t\t\t\t<div>Get Some Relaxin' Part 1 (Feat. 수정 of 허니패밀리 &amp; 이민수) - 03:25</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">2soo] 하늘로 날아갈 것 같은 좋은 이기분 계속해 영원할것 같은 좋은 내이기분 \r\n오로지 하나로만 만들어져 내말들어줘 그저 내게있는 시간만이요 내겐 기쁨이라는걸 \r\n알고 있다면 내 플로우로 멜로디로 Only the sunshine of my life 행복을 느껴 \r\n살아숨쉬고 있다는걸 느껴 내옆에서 항상 지켜 보고 있다는걸 따스하게 지켜 주고 있다는 걸 \r\n(가끔씩 그려보기도 하는 내 가슴속에 담아놓은 꿈들) \r\n나에게 어떤 시련이 온다고 해도 나를 시험하는 힘든과제들 \r\n속에도 앞으로도 따뜻한 맘으로도 오직 내 앞엔 좋은일만 함께할거야 \r\n\r\nMAx] 이미 내게서 엎질러져버린물과 같이 다시 손을 내밀어봤자 주워담을수없어 \r\n그대로 믿을수 밖에 그럴수록 홀로나 이 세상밖에 지친몸을 다시 이끌고서 내가 서있는 \r\n이곳에서 홀로남아 자신을 담아 모든것을 뒤로한채 앞으로 더이상 지체 할수없어 내가 바래왔던것도 \r\n내가 바라봤던것도 더이상 날더 기다리지 않아 바로 지금밖에는 더 이곳으로 새로운시작의 \r\n종을울려 저끝으로 내작은 두발로 앞을 향해 나가 생각보다 쉬운 나의 길로 이미 시작이 전부인걸 \r\n\r\nPrhyme] 바쁘게 앞만 보며 뛰어가다가 잠시 멈춰 둘러보다가 커피한잔의 여유로 인해 다시금 거슬러가보는 \r\n지난시절 흔적에 대해 생각해 사람들에게 떠밀려 이리저리 치어 지금 이자리에 서있는 건 아닌지 \r\n내 의지와 상관없이 받아왔던 재지속에 항상 마음속에 그려왔던 미래 이미지 모두 일이지 \r\n일이라 생각하기엔 앞에 펼쳐진 highway so manyway anyway 헤져가기위해 필요한건 나하나 \r\nmy way 탄탄한 아스팔트보단 비포장 도로위를 걷길원했었던 자신감을 갖고 자신과의 \r\n싸움에서 이기는것과 쉬지않고 반복해 되새기는 일과 내가 숨쉬며 느낀 작은 나의 손길 \r\n살면서 살아가면서 삶을위해서 나서서 이자리에 서서-</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/254/15026254_1391672692565_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130118, lowkey: nil, highkey: nil},
  {album_id: 44, singer_id: 60, team_id: nil, title: "아직은", genre1: "가요", genre2: "랩/힙합", runtime: "03:34", lyrics: "\n\t\t\t\t\t\t\t<div>아직은 - 03:34</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">Chorus] 나직은 목소리로 내게 했던 다짐은 아직은 모르겠어 여긴 어딘가 지금 \n너무나 변한 그런 내모습들 가끔은 낯설게 느껴지곤 하는데 아직은.. x2 \n\n그래 언제부터인지 모르겠어 가끔은 거울에 비추어진 내모습을 보고는 \n내가 아닌 또 다른 내가 나를 바라보고 있다는 느낌에 이상해질때가 있어 \n(이런 기분 너도 느낄때가 있어?) \n사람들을 만날때도 내가 뱉어내는 말들 혹은 내가 행동하는 모습들이 왠지 (그런 모습들이 왠지..) \n이게 아닌데라고 느낄때가 많은것도 같애 (이건 어쩌면) \n내가 어른이 된건지도 어른이 행동해야 하는  그런 모습들인지도 모르겠는데 그래 그런건지도 모르지 \n하지만 가끔은 이렇게 내 자신에게 물어보곤 할땐 어떻게 얘기해야 할지 망설이게돼 (지금 행복해?) \n\nChorus] 나직은 목소리로 내게 했던 다짐은 아직은 모르겠어 여긴 어딘가 지금 \n너무나 변한 그런 내모습들 가끔은 낯설게 느껴지곤 하는데 아직은.. x2 \n\n어느새 내눈앞에 현실이란 이름으로 다가온 반갑지만은 않은 실존의 잔재 그런 싸늘함속에서도 \n지침이란 이름으로 내옆에서 안주하던 꿈은 도대체 어디에 나에겐 자각의 기가 되어주는 때론 \n원대한 포부를 위한 점화의 가시가 되어주는 하나의 지주일런지도 모른다는 \n신념으로 걸어온 발자취 마치 보이지도 않는 무색무취의 성취를 위해 다녀온 여정이 \n가끔은 왜이리 부끄럽게 느껴지곤 하는지 (그런지..) \n아직은 모든것이 미숙하기만한 내 자의식의 그림자 언젠가서부턴가 낯설게만 느껴지곤 하던 현실속의 굴레 \n\nChorus] 나직은 목소리로 내게 했던 다짐은 아직은 모르겠어 여긴 어딘가 지금 \n너무나 변한 그런 내모습들 가끔은 낯설게 느껴지곤 하는데 아직은.. \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/254/15026254_1391672692565_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130119, lowkey: nil, highkey: nil},
  {album_id: 44, singer_id: 60, team_id: nil, title: "Interlude", genre1: "가요", genre2: "랩/힙합", runtime: "00:48", lyrics: "\n\t\t\t\t\t\t\t<div>Interlude - 00:48</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가사 정보가 없습니다.</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/254/15026254_1391672692565_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130120, lowkey: nil, highkey: nil},
  {album_id: 44, singer_id: 60, team_id: nil, title: "21살때 이야기", genre1: "가요", genre2: "랩/힙합", runtime: "03:51", lyrics: "\n\t\t\t\t\t\t\t<div>21살때 이야기 - 03:51</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">Chorus] Baby, Tell me what U want 2 do I just wanna make love 2 U \nEveryday everytime I pray 4 U This iz all I have 2 do  x2 \n\n만약에 신이 있다면 이것은 분명 그의 장난일거라 생각했어 이렇게 단하루만이라도 너의목소릴 듣지못하면 \n견딜수 없게 되버린 나를 절대사랑해선 안된다 다짐했던 너를  사랑하게 된 나를 보게될 줄은 \n이런 3류드라마나 혹은 영화에서 나올법한 유치하기 짝이없는 얘기가 내게 생기다니 \n그날이후로 내 머리속엔 오직 너만이 떠나질 않아 내친구와 헤어진후 예쁜꽃을 만지려다 가시에 손이 찔린듯 \n아파하던 니모습 눈물 흘리던 니모습이 잊혀지질 않아 그래 너의 상처를 내가 짊어지고 싶었던거였는지도 몰라 \n\nChorus] Baby, Tell me what U want 2 do I just wanna make love 2 U \nEveryday everytime I pray 4 U This iz all I have 2 do  x2 \n\n네가 그와 헤어지고 난후 다친니맘 달래주고싶은 마음에 너에게 들려준 \n\"혹시그대 알고있나요 당신의 지금모습 너무 힘들어 보인다는걸\"로 시작하던 그노래 가끔은 \n빛바랜 단편영화처럼 생각나곤 하는데 너도 아직 기억하고 있는지 아니면 기억속에서 벌써 모두 지웠는지 \n아니면 너도 나만큼 울었는지 나역시 다시는 널 기억하지 않겠다 절대두번다시 널 추억하지 않겠다 \n수없이 다짐하고 다짐하고 또 다짐해보고 그렇게 하루가 가고 이틀이가도 \n지울수가 없어 너의얼굴 나의 말투 그리고..너의웃음 \n\nChorus] Baby, Tell me what U want 2 do I just wanna make love 2 U \nEveryday everytime I pray 4 U This iz all I have 2 do \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/254/15026254_1391672692565_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130121, lowkey: nil, highkey: nil},
  {album_id: 44, singer_id: 60, team_id: nil, title: "Pain (Feat. Kush)", genre1: "가요", genre2: "랩/힙합", runtime: "03:36", lyrics: "\n\t\t\t\t\t\t\t<div>Pain (Feat. Kush) - 03:36</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">Chorus] 내가 지켜온, 여기 지켜본 조용히 옆에서서 늘 힘이 되어 \r\n언제나 지켜오며 내옆에 있던 절대 잃고 싶지 않은 거였다는 걸   x2 \r\n\r\n수없이 반복되던 삶이라는 기나긴 여로안에서 교차되던 많다하면 많다고도 할수 있고 \r\n적다하면 적을수도 있는 만남과 헤어짐의 교차점은 마치 관념의 장식에 착수되는 \r\n흑과 백의 공존같이 더이상의 의미도 부여하지 않지 \r\n아직은 이미 멀어져버린 인연에 자꾸만 뒤를 돌아보는 어리숙하기만한 나인데 \r\n그래 너저분하게 안주하던 가시적인 명제 허무함속에 수많은 유희의 고찰에 산재되어 지켜보던 \r\n이미 한쪽이 녹슬어져버린 것임에 원점으로 돌아가 \r\n이제는 지워져 버린, 관념조차 흔들어 버리고 있던 이젠 우스워져 버린 이야기 \r\n\r\nChorus] 내가 지켜온, 여기 지켜본 조용히 옆에서서 늘 힘이 되어 \r\n언제나 지켜오며 내옆에 있던 절대 잃고 싶지 않은 거였다는 걸   x2 \r\n\r\nShader] 머리속은 혼란스럽고 내맘을 몰라서 그랬고 그날 어두운 밤사이 내맘이 답답해 \r\n알콜이 막걸리한사발이 내정신을 흔들고 알길이 없지 앞길이 어두워 답이 없어 \r\n다들 입을 다물었어 난 마음을 닫고 열기 힘들었고 믿을만한 사람이 별로 없어 음악이 내맘을 흔드네 \r\n매마른 내맘에 일깨워주네 난 몰랐지 남의눈에 티끌을 들췄지 \r\n하지만 내눈에 대들보는 보지도 못했지 가끔눈을 감고서는 다시 그때로 음악만을 사랑했던 그때로 \r\n아직도 작대기 몇개로 소리를 가둬 내 소리를 가둬.. \r\n\r\nChorus] 내가 지켜온, 여기 지켜본 조용히 옆에서서 늘 힘이 되어 \r\n언제나 지켜오며 내옆에 있던 절대 잃고 싶지 않은 거였다는 걸</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/254/15026254_1391672692565_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130122, lowkey: nil, highkey: nil},
  {album_id: 44, singer_id: 60, team_id: nil, title: "Take It Easy (Inst.)", genre1: "가요", genre2: "랩/힙합", runtime: "04:03", lyrics: "\n\t\t\t\t\t\t\t<div>Take It Easy (Inst.) - 04:03</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가사 정보가 없습니다.</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/254/15026254_1391672692565_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130123, lowkey: nil, highkey: nil},
  {album_id: 45, singer_id: nil, team_id: 16, title: "바보", genre1: "가요", genre2: "인디", runtime: "03:20", lyrics: "\n\t\t\t\t\t\t\t<div>바보 - 03:20</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">아무리 너잘났다 나잘났다 그래도\r\n도대체가 누구하나도 멋져보이지는 않아\r\n상자속엔 언제나 웃음만 가득\r\n슬픔은 코메디 속에서나 나올 어려움이야 \r\n산위 에서 내려다본 이 세상 \r\n안개만 자욱한 잿빛속 삭막한 세상\r\n나는 그저 바보처럼 살아가리다 \r\n사랑의 쓰라림의 눈물을 안고\r\n\r\nlike a fool just laugh at this world\r\nsing a song just like a fool\r\n\r\n아무리 너잘났다 나잘났다 그래도 \r\n내 자신을 잃는다면 의미없지\r\n내가 걸어가는 길은 나의길\r\n누군가 예쁘게 만든 길보다는 눈부신 길이지\r\n땅밑에서 올려다본 이세상\r\n걸어선 올라갈 수 없는 높은 빌딩의 세상\r\n나는거저 바보처럼 살아가리다 \r\n외로운 한줄기 연기가 되어</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/255/15026255_1409029811203_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130124, lowkey: nil, highkey: nil},
  {album_id: 45, singer_id: nil, team_id: 16, title: "Sunshine Bay", genre1: "가요", genre2: "인디", runtime: "02:41", lyrics: "\n\t\t\t\t\t\t\t<div>Sunshine Bay - 02:41</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">Here we come to the sunshine bay \r\n다시 한번 기억속 푸른 그 해변으로 떠나가 \r\nHere we come to fullmoon beach \r\n아스라히 다가오는 여름밤 아련한 추억 \r\nHere we come to the sunshine bay \r\n다시 한번 내리쬐는 에메랄드 축복을 \r\nHere we come to fullmoon beach \r\n눈을 감아... \r\n눈부신 여름 햇살 sunshine sunshine \r\n아름다운 그 미소 sunshine sunshine \r\n눈부신 여름 햇살 sunshine sunshine \r\n아름다운 그 미소 sunshine sunshine</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/255/15026255_1409029811203_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130125, lowkey: nil, highkey: nil},
  {album_id: 45, singer_id: nil, team_id: 16, title: "Lazy Style", genre1: "가요", genre2: "인디", runtime: "00:42", lyrics: "\n\t\t\t\t\t\t\t<div>Lazy Style - 00:42</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">rock the reggae music in this lazy bone's new style! \r\nrock the reggae music in this lazy bone's new style! \r\nrock the reggae music in this lazy bone's new style! \r\nrock the reggae music in this lazy bone's new style! \r\nrock the reggae music in this lazy bone's new style! \r\nrock the reggae music in this lazy bone's new style! \r\nrock the reggae music in this lazy bone's new style! \r\nrock the reggae music in this lazy bone's new style! \r\nrock the reggae music in this lazy bone's new style!</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/255/15026255_1409029811203_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130126, lowkey: nil, highkey: nil},
  {album_id: 45, singer_id: nil, team_id: 16, title: "큰푸른물", genre1: "가요", genre2: "인디", runtime: "03:55", lyrics: "\n\t\t\t\t\t\t\t<div>큰푸른물 - 03:55</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">시원함이 넘치는 바닷가 \n나는 오늘 이 바다를 삼키려고 해 \n짜증만 나는 이 더위 저 더위 \n바다가 내 뱃속에 있으면 얼마나 좋을까 \n\n저 그러면 혹시 내 뱃속에 \n해파리, 미역, 멍게, 해삼 다들어 있겠네 \n야 즐거워라 오늘은 저 바닷가로 \n\n갈매기 따라 이 바다 저 바다로 \n나는 저 갈매기 따라 바다를 날고 싶어 \n갈매기 따라 저 바다 속으로 \n아싸 즐거운 여행되겠네 \n\n야 즐거워라 \n인생사가 모두 이런 거 \n야 행복해라 오늘은 저 바닷가로 \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/255/15026255_1409029811203_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 4618, song_num: 16130127, lowkey: nil, highkey: nil},
  {album_id: 45, singer_id: nil, team_id: 16, title: "小覇王(소패왕)", genre1: "가요", genre2: "인디", runtime: "02:54", lyrics: "\n\t\t\t\t\t\t\t<div>小覇王(소패왕) - 02:54</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">아름다운 부모의 사랑과 노력으로\r\n밝은세상만 바라보며 건강히 자라나\r\n온세상을 다가진듯 충만한 행복과\r\n해맑은 눈빛으로\r\n호호할아버지도 두렵지 않은 용감한 우리청년\r\n눈부신 이땅의 부잣집 도련님들\r\n넘쳐나는 품위와 여유를 만끽하는\r\n부족함이란 없는\r\n\r\n땀나면 짜증나고 말만하면 돈나오고\r\n빽사서 다빼주는 멋진아빠 존경하고\r\n털면 먼지대신 돈나오는 엄마를\r\n난 사랑하네\r\n못입고 못쓰는 놈들은 거지같고\r\n돈많은 존만한 니들모여 서로서로 띄어주며\r\n힘좀쓰는 줄 잘나가는듯 착각하는 보면 볼수록 한심한\r\n\r\n이런 개같은 지랄같은 망나니 십새기들\r\n\r\n소패왕 넌 어딜가도 양아치</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/255/15026255_1409029811203_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130128, lowkey: nil, highkey: nil},
  {album_id: 45, singer_id: nil, team_id: 16, title: "공작새", genre1: "가요", genre2: "인디", runtime: "03:42", lyrics: "\n\t\t\t\t\t\t\t<div>공작새 - 03:42</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">불타는 방랑자여 무엇을 그리 말하나\r\n뭘 그렇게 말하나\r\n하늘과 닿는자여 왜 슬피 우는가\r\n왜 그렇게 슬피 우는가\r\n언제나 그렇게 바보처럼 그래 그렇게 바보처럼\r\n혼자 울고 울고 또 울고\r\n\r\n그대의 가슴속에 담겨있는 슬픔을 모두 던져버려\r\n그대의 가슴속에 무한대로 펼쳐진 아름다운 이상\r\n일어서서 달리는 거야 그래 그렇게 달리는거야\r\n하하하하 미소를 보내 주는걸\r\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/255/15026255_1409029811203_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130129, lowkey: nil, highkey: nil},
  {album_id: 45, singer_id: nil, team_id: 16, title: "도시천사", genre1: "가요", genre2: "인디", runtime: "05:53", lyrics: "\n\t\t\t\t\t\t\t<div>도시천사 - 05:53</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">도심속에 농아든 넌 도시천사 \n아름다운 모습은 온데 간데업고 \n푸른하늘 훨훨날던 기세도 이젠 없어 \n아름답고 깨끗한 너의 날개는 이젠 잿빛처럼 물들고 \n흘날리는 깃털들은 도시를 수놓아 \n투명한눈 희뿌연 하늘 한번 바라보고 \n차가운 저 빌딩숲대답을 기다려봐도 \n시들어버린 사라져버린 푸른꽃밭은 \n이젠 숨쉬지 않아 \n검게물든 강물에 몸실어 떠나보나 \n아슬팔트위 기어 흙향기맡아보나 \n슬픈구름의 눈물로 몸씻으며 꿈을 그려보나 \n\n이제는 날아가 이제는 떠올라 사람들속에서 \n또 다른 세상으로 \n이제는 날아가 이제는 돌아가 \n도심속에 녹아든 도시천사여 \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/255/15026255_1409029811203_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130130, lowkey: nil, highkey: nil},
  {album_id: 45, singer_id: nil, team_id: 16, title: "우연히", genre1: "가요", genre2: "인디", runtime: "03:55", lyrics: "\n\t\t\t\t\t\t\t<div>우연히 - 03:55</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">우연히 열어본 일기장속 한 소년의 작은 이야기들\r\n쑥쓰럽고 부끄럽던 애숭이 같은 사람들\r\n뜬금없는 얘기만 했던 어설펐던 시간들\r\n일기장 수십장을 가득채운 촌스러운 너의 이름들\r\n\r\n머리속이 하얘지도록 기다렸지\r\n내 평생 잊지못할 밤이 됐지\r\n밤새도록 잔인하게 비가 내렸지\r\n이별 하면 아프다는데 알아누웠지\r\n기억들은 빛바랜 사진 처럼 흐려져\r\n하지만 추억엔 유통기한 이라곤 없어\r\n오늘밤은 그날의 달빛아래\r\n추억의 잠에 빠져드나\r\n\r\n난 꿈속에서 너를 찾아 추억들은 날 웃게하나\r\n\r\n손만잡고 달만 바라봤던 놀이터 벤치의 시간들\r\n레몬향이라곤 없었던 쑥쓰러웠던 첫키스\r\n지금은 녹슬어버린 니가 준 은색 반지\r\n너에게 선물했던 초라하기만한 나의 선물들\r\n머리속이 하얘지도록 기다렸지\r\n내 평생 잊지못할 밤이 됐지\r\n밤새도록 잔인하게 비가 내렸지\r\n이별 하면 아프다는데 알아누웠지\r\n기억들은 빛바랜 사진 처럼 흐려져\r\n하지만 추억엔 유통기한 이라곤 없어\r\n오늘밤은 그날의 달빛아래\r\n추억의 잠에 빠져드나\r\n\r\n난 꿈속에서 너를 찾아 추억들은 날 웃게하나\r\n\r\n놀랍게도 나는 어느새 어른이 되고\r\n너도 어디선가 어여쁜 숙녀가 되어 살아가겠지\r\n너의 얼굴을 기억하려 흰 종이 위에 그려보지만\r\n내 눈 앞에 펼쳐진 얼굴\r\n처음보는 낯선 아가씨의 징그러운 미소만\r\n난 꿈속에서 너를 찾아 추억들은 날 웃게하나\r\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/255/15026255_1409029811203_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 11707, song_num: 16130131, lowkey: nil, highkey: nil},
  {album_id: 45, singer_id: nil, team_id: 16, title: "I Was Down Pt.1", genre1: "가요", genre2: "인디", runtime: "00:36", lyrics: "\n\t\t\t\t\t\t\t<div>I Was Down Pt.1 - 00:36</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">I was down I was down 세상이 나를 버릴땐 말야 \r\nI was down I was down 세상을 내가 버리땐 말야 \r\n인생은 생방송이야 송대관아저씨의 아름다운 그 가르침말야 \r\n인생은 생방송이야 내겐 너무나도 절실한 이 한마디말야.</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/255/15026255_1409029811203_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130132, lowkey: nil, highkey: nil},
  {album_id: 45, singer_id: nil, team_id: 16, title: "I Was Down Pt.2", genre1: "가요", genre2: "인디", runtime: "03:04", lyrics: "\n\t\t\t\t\t\t\t<div>I Was Down Pt.2 - 03:04</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">철가방불끈쥐고 거리를 달리는총각 \r\n(철가방불끈쥐고 거리를 달리는총각) \r\n스쿠터 커피싣고 외출하는 아가씨 \r\n(스쿠터 커피싣고 외출하는 아가씨) \r\n한밤중 꽃집에서 빨강꽃파는 누나 \r\n(한밤중 꽃집에서 빨강꽃파는 누나) \r\n모두들 제발날 내버려 두지마(내버려두지마) \r\n\r\nwho wants to be alone, all alone \r\nwho wants to be alone, all alone \r\nwho wants to be alone, all alone \r\nwho wants to be alone, all alone \r\n\r\n지하계단 신문깔고 도를 닦는 아저씨 \r\n(지하계단 신문깔고 도를 닦는 아저씨) \r\n계단에서 굴렀다고 웃는우리 착한아들 \r\n(계단에서 굴렀다고 웃는우리 착한아들) \r\n매일매일 아들자랑 혼자사는 할머니 \r\n(매일매일 아들자랑 혼자사는 할머니) \r\n눈물이 흘렀어 내버려 두지마(내버려두지마) \r\n\r\nwho wants to be alone, all alone \r\nwho wants to be alone, all alone \r\nwho wants to be alone, all alone \r\nwho wants to be alone, all alone \r\n\r\n요란한거리 눈부신세상에너무나힘이들고 외롭다고 \r\n찡그린 얼굴 너의얼굴 거리의 얼굴 \r\n모두가 외로움에 누군갈 원하고 있잖아 \r\n세상을 산다는게 힘이든다란건 알아 \r\n세상에 필요없는 사람은 없다는걸 아나? \r\n조금만 다가서면 외로움쯤이야 \r\n나눌수도 있잖아 \r\n\r\nwho wants to be alone, all alone</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/255/15026255_1409029811203_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130133, lowkey: nil, highkey: nil},
  {album_id: 45, singer_id: nil, team_id: 16, title: "I Was Down Pt.3", genre1: "가요", genre2: "인디", runtime: "00:37", lyrics: "\n\t\t\t\t\t\t\t<div>I Was Down Pt.3 - 00:37</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">I was down I was down 세상이 나를 버릴땐 말야 \r\nI was down I was down 세상을 내가 버릴땐 말야</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/255/15026255_1409029811203_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130134, lowkey: nil, highkey: nil},
  {album_id: 45, singer_id: nil, team_id: 16, title: "파라다이스", genre1: "가요", genre2: "인디", runtime: "01:33", lyrics: "\n\t\t\t\t\t\t\t<div>파라다이스 - 01:33</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">외로운 밤엔 우리마을로 와요\r\n붉은 불빛가득 낙원으로 오세요\r\n뜨겁게 조금더 뜨겁게\r\n아무 걱정없이 몸녹이고 가세요\r\n\r\nWell come to thr paradise\r\n\r\n외로운 밤엔 우리 마을로 와요\r\n붉은 불빛 가득 낙원으로 오세요\r\n마르지 않는 샘물 가득\r\n아무 걱정 없이 몸녹이고 가세요\r\n\r\nWell come to thr paradise</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/255/15026255_1409029811203_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130135, lowkey: nil, highkey: nil},
  {album_id: 45, singer_id: nil, team_id: 16, title: "까르비통", genre1: "가요", genre2: "인디", runtime: "02:10", lyrics: "\n\t\t\t\t\t\t\t<div>까르비통 - 02:10</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">화장 안하곤 밖에도 못나가\r\n가장 무도회 속에서 사나 환장\r\n하도록 허영에 파묻혀 분장속 자신의 진실을 외면하나\r\n가방속 물건들을 꺼내놓아\r\n봐 나역시 너를 빛나게 해주는\r\n수많은 널리고 널린 악세사리 중의 하날뿐\r\n\r\n너의 눈부신 그 핸드백\r\n사랑스런 너의 자동차\r\n포근히 감싸는 그 밍크\r\n너는 매력덩어리\r\n너에게 어울리는 그를 찾아가\r\n난 너무 초라해서 안되겠어\r\n나에게 자랑거리 라곤 없어\r\n내가가진건 이 마음뿐이야\r\n\r\n비싼 양복대신 반바지\r\n고급 와인보단 소주지\r\n나는 그저 그런남자지\r\n수준낮은 사랑할테지\r\n너에게 어울리는 그를 찾아가\r\n난 너무 초라해서 안되겠어\r\n나에게 자랑거리 라곤 없어\r\n내가가진건 이 마음뿐이야\r\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/255/15026255_1409029811203_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130136, lowkey: nil, highkey: nil},
  {album_id: 45, singer_id: nil, team_id: 16, title: "마리와 나", genre1: "가요", genre2: "인디", runtime: "04:47", lyrics: "\n\t\t\t\t\t\t\t<div>마리와 나 - 04:47</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">하늘의 별을 따달라던 너 마리야\r\n친구들과 케익집에 있어 우아한 사랑\r\n나만을 사랑한다다 미소짓는 천사의 얼굴\r\n너무바빠 날 만날수 없는 너 슬픈 마리아\r\n\r\n내일밤엔 거리에 나가\r\n한손엔 우체통을 들고\r\n제상의 모든 케익집을 부셔버릴꺼야\r\n넌 내게 돌아오겠지\r\n\r\n생각해봐 그럼 난 감옥에 갈것같아\r\n영원히 널 다시 만날수 없겠지\r\n니가 다시 돌아오길 바라는 것 뿐인데\r\n마리야 마리야 마리야 나를 말려줘\r\n\r\n멋진남자의 품에 안겨 천사의 미소를 짓는 널 찾았어\r\n내손에는 우체통이 아직도 들려있어\r\n하늘의 별을 따달라던 너 마리야\r\n친구들과 케익집에 있어 우아한 사랑\r\n나만을 사랑한다다고 미소짓는 천사의 얼굴\r\n마리야 마리야 마리야 나를 말려줘</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/255/15026255_1409029811203_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130137, lowkey: nil, highkey: nil},
  {album_id: 45, singer_id: nil, team_id: 16, title: "Let It Go At That", genre1: "가요", genre2: "인디", runtime: "02:31", lyrics: "\n\t\t\t\t\t\t\t<div>Let It Go At That - 02:31</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">푸하하하 웃긴세상 더러운세상 시간따윈 버리고서 나가놀아라\r\n너혼자서 사는세상 행복한세상 니가가진 모든것이 너의 전부다\r\n니멋대로 살아봐라 놀아도 봐라 어느하나 만족하며 살아왔더냐\r\n날아가는 저새들도 귀를 막았네 We Will Let It Go At That \r\n\r\n울다지쳐 웃다지쳐 쓰러져가네 쓰러진게 쓰레긴지 내 몸뚱인지\r\n가지가지 높은가지 올라타봐라 하늘높은 땅바닥에 쳐박힐테니\r\n구제불능 완전무능 저시 서오능 머리속을 물어준다 몸을 묻는다\r\n더이상은 물지마라 아프다 내 귀 We Will Let It Go At That \r\n\r\n세상을 다 바꿔버린다고 목터져라 외쳤다고 쓰러진다고\r\n세상을 다 바꿔버린다고 내몸하나 간직하고 떠나간다고\r\n세상을 다 바꿔버린다고 목터져라 외쳤다고 쓰러진다고\r\nWe Will Let It Go At That</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/255/15026255_1409029811203_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130138, lowkey: nil, highkey: nil},
  {album_id: 45, singer_id: nil, team_id: 16, title: "모르겠어요", genre1: "가요", genre2: "인디", runtime: "04:50", lyrics: "\n\t\t\t\t\t\t\t<div>모르겠어요 - 04:50</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">모르겠어요 여기가 어딘지 \n모르겠어요 볼 수도 없으니 \n어딘지 알 수 없는 이 곳 난 모르겠어요 \n\n모르겠어요 모르겠어요 모르겠어요 모르겠어요 \n모르겠어요 모르겠어요 모르겠어요 모르겠어요 \n\n모르겠어요 지금이 몇시인지 \n몇일이 되었는지 모르겠어요 \n어쩌다 굴러와보니 겨울이네요 \n\n모르겠어요 모르겠어요 모르겠어요 모르겠어요 \n모르겠어요 모르겠어요 모르겠어요 모르겠어요 \n\n외롭고 추워요 혼자 밖에 있으니 \n암흑에 가려져 세상을 볼 수가 없어요 \n\n아침이 오면 내 맘을 밝혀줄 태양이 떠오를지도 \n난 모르겠어요 \n그저 태양이 떠오르기만 기다린다 언제 뜰지도 \n모르는 태양을난 움직일수도 없다 볼수도 없다. \n암흙에 가려져나 하나도 모르겠다. \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/255/15026255_1409029811203_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 9553, song_num: 16130139, lowkey: nil, highkey: nil},
