  {album_id: 46, singer_id: 61, team_id: nil, title: "Intro", genre1: "가요", genre2: "발라드", runtime: "00:38", lyrics: "\n\t\t\t\t\t\t\t<div>Intro - 00:38</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가사 정보가 없습니다.</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/256/15026256_1462942024221_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130141, lowkey: nil, highkey: nil},
