  {album_id: 46, singer_id: 61, team_id: nil, title: "Miracle", genre1: "가요", genre2: "발라드", runtime: "03:38", lyrics: "\n\t\t\t\t\t\t\t<div>Miracle - 03:38</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">널 마주친 건 나에겐 또 다른 행운의 시작이었어 \n나 몰랐었던 내 안에 잠자던 사랑을 깨운 너니까 \n\n난 다짐했어(I'll promise you) 이대로 너를 보낼 순 없다고 \n넌 나의 미래 커 가는 바램 멈추게 하지는마 \n\nOne time 다가와 봐 Two time 눈 맞춰봐 Three time 너의 그 맘을 보여봐 \nOne time 다정하게 Two time 바라보게 Three time 사랑에 빠져 버리게 \n이 순간만은 너만을 내 여자친구로 만들고 싶어 \n내 가슴속에 너무나 그리던 환상을 찾은 거니까 \n\n날 바라보며 (I want your love) 그렇게 어렵게 생각하지마 \n날 보는 눈빛(날 보는 눈빛) 끝없는 기대(끝없는 기대) 감추려 하지는마 \n\nYou are the one 아름다운 너 You are my love \nGonna make you mine You are my soul. 네가 필요해 \nYou are my dream 나의 곁에 </p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/256/15026256_1462942024221_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130143, lowkey: nil, highkey: nil},
  {album_id: 46, singer_id: 61, team_id: nil, title: "My Love", genre1: "가요", genre2: "발라드", runtime: "03:40", lyrics: "\n\t\t\t\t\t\t\t<div>My Love - 03:40</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">Tonight 한동안 웃고 지냈던 지난 추억을 꺼내어보다 \n얼마나 미안했었는지 한참을 난 울기만 했어 \n\n항상 곁에 있어 주었기에 니가 얼마나 소중했는지 \n난 모르고 있었던거야 이제서야 깨달은 거야 \n\nMy love 어떤 말도 너를 위로할 순 없겠지만 \nMy love 달려가 너에게 내 사랑을 전하고 싶어 \n\nI love you everyday every my 단 한번도 그 마음 변한거 아니었는데 \n너에게 익숙해져가는 시간속에서 조금씩 잊혀졌을뿐 \n\nI love you everyday every my you're a my life 다시 돌아올순 없겠니 \n언제나 지금처럼 항상 변하지 않는 사랑을 가득 안고서 널 기다릴께 \n\n이제 빛바랜 사진들처럼 내겐 잊혀진 사랑이라고 \n넌 말할수도 있겠지만 난 아무말 못하겠지만 \n\nMy love 그러지마 니가 편한건 아니었잖아 \nMy love 한번만 나에게 기회를 줄 수는 없겠니 \n\nI love you everyday every my 단 한번도 그 마음 변한거 아니었는데 \n너에게 익숙해져가는 시간속에서 조금씩 잊혀졌을뿐 \n\nI love you everyday every my you're a my life 다시 돌아올순 없겠니 \n언제나 지금처럼 항상 변하지 않는 사랑을 가득 안고서 널 기다릴께 \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/256/15026256_1462942024221_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130144, lowkey: nil, highkey: nil},
  {album_id: 46, singer_id: 61, team_id: nil, title: "Endress", genre1: "가요", genre2: "발라드", runtime: "03:48", lyrics: "\n\t\t\t\t\t\t\t<div>Endress - 03:48</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">미안해 하지 말아요 혼자 남게 되겠죠 괜찮아요 \n그대 언제나 기다릴께요 이대로 간직할께요 지난 날은 가슴에 담아둘께요 \n그대는 알겠죠 난 그대뿐이죠 수많은 날이 흘러가도 내안엔 그대만 가득한 \n거죠 보고싶겠죠 많이 울겠죠 언젠간 나도 지쳐가겠죠 내 걱정말아요 편하게 지내요 \n그대를 위해서라면 난 어떤것도 참을테니까 \n\n조금씩 잊어가겠죠 그래서 나는 없겠죠 하지만 난 그대를 원망 안해요 세상은 말이죠 나 원하는 \n대로 모든걸 주진 않나봐요 그대도 마찬가진 것 같아요 \n\n보고싶겠죠 많이 울겠죠 언젠간 나도 지쳐가겠죠 \n내 걱정말아요 편하게 지내요 그대를 위해서라면 난 어떤것도 참을테니까~ \n\n뒤돌아 보아요 들리지 않나요 아직도 그대 부르잖아요 \n\n대답은 없겠죠 나 바보 같겠죠 그래도 세상 가득한건 나의 사랑 그대니까 </p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/256/15026256_1462942024221_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130145, lowkey: nil, highkey: nil},
  {album_id: 46, singer_id: 61, team_id: nil, title: "사랑은 없다", genre1: "가요", genre2: "발라드", runtime: "03:51", lyrics: "\n\t\t\t\t\t\t\t<div>사랑은 없다 - 03:51</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">한번은 봐줬지 웃으며 봐줬지 할테만 다해봐 끝까지 한번 해봐 나를 또 한번 \n\n속여봐 원래 그런 애였었니 날 보고 \n말해봐 한심할 뿐이야 한두번이 아니야 정말 넌 답이 안나와 \n\nchorus) \n늦었어 이젠 말할께~ 너란 여잘 만날걸 내 인생에 가장 상처란걸 멀리멀리 사라져 날 잊어줘 \nMy life 상관하지마 제발 멀리 떠나줘 날 지워줘 My love 다 끝난거야 사랑은 없어 \n\noh 딱 잘라서 말해 빙빙 돌리지마 솔직하게 말해 삭삭 피해가지마 제발 \n헤어지자 말해 몰래 만나는 사람들 모두 내 친구들 정말로 대단해 인정할건 인정해 너도 잘못을 인정해 \n\n거짓된 모습 그만해 너 안에 가둔 사랑은 더 이상 없어 쉿 I hey baby be quiet 혹시라도 \n나에게 눈물이 남아 가슴 아플지 몰라 하지만 더 너에게 흘릴 눈물은 없어 다 지난거야 사랑은 없어 \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/256/15026256_1462942024221_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130146, lowkey: nil, highkey: nil},
  {album_id: 46, singer_id: 61, team_id: nil, title: "혼자쓰는 사랑", genre1: "가요", genre2: "발라드", runtime: "04:08", lyrics: "\n\t\t\t\t\t\t\t<div>혼자쓰는 사랑 - 04:08</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">오늘도 조금씩 지워가 내 주위 머물던 니 흔적들을 또 다른 사랑을 채워도 낯설지 않을만큼 \n달라지려고 그래 난 이렇게 너를 잊으려 했어 하지만 그런 니맘 조금은 서운하지 않을까 괜한걱정만 남아 \n\nchorus) \n아주 잠시라도 아니 꿈에라도꼭 한번만 니 모습 만난다면 나는 내사랑과 보낼텐데 \n끝난뒤에 너를 잊은 뒤에 다시 내게로 네가돌아온단 얘길 할까봐 \n\n세상 어딘가 네가 부를 것 같아 자꾸만 헤메인 나 그래 난 니가 있는 곳 알면 지금 달려갈 텐데 \n\n혹시 야윈 나의 모습 보면 미안해질까 흐르는 \n눈물도 참아왔던 나~ 어떻게 지내냐는인사도 힘겨울 테지만 그냥 우연이라도 널 보고싶어 \n\n니가 아니라도 조금 닮았어도 혹시 네가 아닐런지 붙드는 그런 바보같은 \n사랑인데 늦기전에 모두 잊기전에 나의 눈속에 다시 돌아오는 널 보게해줘 그게 아니라도 널 보고싶어 \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/256/15026256_1462942024221_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 10712, song_num: 16130147, lowkey: nil, highkey: nil},
  {album_id: 46, singer_id: 61, team_id: nil, title: "네가 없는 날 위해", genre1: "가요", genre2: "발라드", runtime: "03:40", lyrics: "\n\t\t\t\t\t\t\t<div>네가 없는 날 위해 - 03:40</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">ah yeah 2002 kicking it the old school\r\nand the new\r\nmy man KSH make some noise!\r\nshake baby shake give me what you got\r\nI want some more if you got a lot\r\nlooking so sexy like a fantasy\r\njust come on baby do the freak with me\r\ncome on shake it make you shake it\r\nain't no time for you to be fakin\r\nwanna to flex with a bad ass g\r\njust come on baby do the freak with me\r\n\r\n조금만 더 나에게 준비 할 시간을 줄래\r\n아직도 너에게서 떠날 정리될 내 맘 그때까지\r\n하나씩 하나씩 간직하던 추억은\r\n더 이상 네가 없는 나 혼자 남겨진 기억으로\r\n이제는 조용히 지울꺼야\r\n\r\n걱정은 하지 않아도 괜찮아\r\n너 돌아오라고 와 달라고\r\n네 맘 돌리려 하진 않을께 눈물도 꼭 참아볼꺼야\r\n잠시동안 네 외로움 채우기 위해서\r\n빌린 나의 사랑\r\n그 뿐이래도 널 만난 걸 후회하지 않겠어\r\n\r\n그렇게 힘든 부탁을 한 거였니\r\n그것조차도 넌 내게 해줄수 없다고 말하지마\r\n웃으면서 널 보내고 싶어\r\n\r\n걱정은 하지 않아도 괜찮아\r\n너 돌아오라고 와 달라고\r\n네 맘 돌리려 하진 않을께 눈물도 꼭 참아볼꺼야\r\n잠시동안 네 외로움 채우기 위해서\r\n빌린 나의 사랑\r\n그 뿐이래도 널 만난 걸 후회하지 않겠어\r\n\r\n서둘러 떠나길 바라니\r\n나 받아들일께 끝이란 걸\r\n너를 잊기 위해 할 수 있는\r\n방법 전부를 가르쳐 줘\r\n보고 싶어 참지못한 아픔에\r\n혹시 널 미워할지 몰라\r\n\r\n새롭게 나를 찾는거야 시간은 흐르겠지\r\n그뿐이래도 널 만난걸 후회하지 않겠어</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/256/15026256_1462942024221_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 5859, song_num: 16130148, lowkey: nil, highkey: nil},
  {album_id: 46, singer_id: 61, team_id: nil, title: "Lady", genre1: "가요", genre2: "발라드", runtime: "04:12", lyrics: "\n\t\t\t\t\t\t\t<div>Lady - 04:12</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">마치 어제 만난 것처럼 모든게 그대로 나의 마음속에 남아있는데 잘 지내란 \n한마디 앞에 가슴이 시려와 말 할수 없었죠. \n\n난 두 눈에 흐르던 내 눈물 때문에 잘 볼수 없어 \n믿을수가 없네요 아직 난 이별이라는 그 말도 모르죠. baby \n\nchorus) \nlady~돌아와 줘요 그댄 날 떠나갔지만 난 너에게 사랑한다 \n는 말은 한번 뿐이라 내 다음 사랑도 그대죠 \n(마지막에도 just my love) never gonna make it anymore \n\n떠난 그대 잘 지낼까요 어쩜 내 생각에 한숨만 짓고 있진 않을까요 다른 사람이 \n날 물을 때 잠시 알고 지냈다하진 않겠죠 난 그대를 말할 때 내 모두 주어도 모자랄 \n만큼 사랑하고 있다고 다신 채워질수 없을 거라고 말하죠 baby \n\n괜한 걱정일까 그대에게 하지 못한 말이 남았죠 언젠가 그대 나처럼 기대 쉴 곳이 \n필요할 때 부족하겠지만 내가 될께요 오 </p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/256/15026256_1462942024221_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130149, lowkey: nil, highkey: nil},
  {album_id: 46, singer_id: 61, team_id: nil, title: "If", genre1: "가요", genre2: "발라드", runtime: "04:03", lyrics: "\n\t\t\t\t\t\t\t<div>If - 04:03</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">만약에 내가 네 곁에 있다면 환한 미소 \n안겨 줄텐데 만약에 내게 돌아와 준다면 너의 그 지친 어깨 감싸줄텐데 \n\nchorus) \n널 사랑한(내 사랑을) 나를 놓치 않았다면 지금의 눈물은 없었을텐데 날 사랑할 너의 마음이 \n모자라도 나는 널 기다릴 수 있어 돌아와 널 안아줄 내 맘 내 곁으로 늦지 않았음을 \n너도 잘 알잖아 다음 세상이 기다려도 너 없어선 안돼 제발 돌아와 널 위한 내게로 \n\n사랑할수밖에 없는 나의 널 위해 내 모든 걸 \n다 줄수 있는 널 위해 그런 너 하날 바라보며 살아가는 이유 그게 바로 나란걸 기억해줘 \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/256/15026256_1462942024221_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130150, lowkey: nil, highkey: nil},
  {album_id: 46, singer_id: 61, team_id: nil, title: "회상", genre1: "가요", genre2: "발라드", runtime: "03:47", lyrics: "\n\t\t\t\t\t\t\t<div>회상 - 03:47</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">혼자란게 싫어서가 아니야 \r\n너 아니면 안되는 \r\n내 간절한 이유가 있어 \r\n너에 비해 모자란건 알지만 \r\n널 위해 내 하루를 \r\n내 모든 것을 다 줄꺼야\r\n\r\n좋은 시간들만 듣기 좋은 얘기만 \r\n눈물은 없고 웃음만 있는 \r\n그런 우리 만들어가\r\n\r\nlove you forever \r\n아름다운게 너무 많아 \r\n소리 없이 쌓인\r\n나의 사랑을 지켜봐\r\nlove you forever \r\n너의 지나간 추억보다 \r\n더 커다란 사랑 안겨줄께 \r\n약속해\r\n\r\n누굴 만나는지 \r\n어디서 뭘 하는지 의심치않고 \r\n거짓말 않는 그런 우리 만들어가\r\n\r\nlove you forever \r\n아름다운게 너무 많아 \r\n소리 없이 쌓인\r\n나의 사랑을 지켜봐\r\nlove you forever \r\n너의 지나간 추억보다 \r\n더 커다란 사랑 안겨줄께 \r\n약속해\r\n\r\n예전에 그 사람 우연히 마주치면 \r\n편하게 스쳐 갈 수 있게 \r\n나의 팔에 기대어 줘\r\n\r\nlove you forever \r\n아름다운게 너무 많아 \r\n소리 없이 쌓인\r\n나의 사랑을 지켜봐\r\nlove you forever \r\n너의 지나간 추억보다 \r\n더 커다란 사랑 안겨줄께 \r\n약속해</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/256/15026256_1462942024221_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 5766, song_num: 16130151, lowkey: nil, highkey: nil},
  {album_id: 46, singer_id: 61, team_id: nil, title: "이미 시작된 사랑", genre1: "가요", genre2: "발라드", runtime: "04:06", lyrics: "\n\t\t\t\t\t\t\t<div>이미 시작된 사랑 - 04:06</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">무심코 나의 얼굴을 봤죠 오늘도 환한 \n모습이에요~ 아마도 그대를 만나 후부터 나 좋은걸 감추지 못해요 \n\n나만을 빤히 쳐다보는 그대가 처음엔 많이 \n어색했었죠 그대를 어떻게 대해야할런지 혼자서 고민이 많았죠 \n\nchorus) \nbecause i love you how always with me 그대 절대 실망시키지 않아 옆에만 있어도 충분해요 \n내게 이미 그대는 내 마음 내 모든 걸 가졌죠 \n\n혹시나 그대 내 사랑 의심 난데도 내가 더 노력할꺼에요 \n나도 오래 전부터 꿈꿔온 사랑을 놓칠 수 없어 그대 바래요 \n\nbecause i love you how always with me 그대 절대 실망시키지 않아 옆에만 있어도 \n충분해요~ 내게 이미 그대는 내 마음 (이젠 우리 그냥 사랑해요) \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/256/15026256_1462942024221_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130152, lowkey: nil, highkey: nil},
  {album_id: 46, singer_id: 61, team_id: nil, title: "우리의 아픔 그리고 추억", genre1: "가요", genre2: "발라드", runtime: "03:18", lyrics: "\n\t\t\t\t\t\t\t<div>우리의 아픔 그리고 추억 - 03:18</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">행복했었다고 정말 행복했었다고 말해줄래 우리 그 시절 가슴 깊은 곳에 묻어 두고 \n너의 그 시간 소중히 여기며 다시 시작하려해 이 노래를 바치며 \n\nPlease baby don'n cry 기억하니 함께해왔던 \n우리의 추억 영원할거라 약속했던 그 시절 약속 미안해 이제야 이렇게 말 할 수 있고 \n\n그 동안 힘든 시간 때문에 망설이며 말못해 왔었던 너의 따스함이소중함을 \n\n알아 아름다운 모습 힘들어도 나 널 보며 \n이겨낼게 행복했던 시간 이제는 가슴에 한 장의 추억으로 간직하며 Oh baby \n\n너의 사랑에 흘렸던 눈물을 잊을 순 없어 괜찮아하며 울먹이던 너의 모습까지도 \n한번의 이별 더 가까워진 우리의 만남을 영원하길 바라며 기억되길 바랄게 이별이란 슬픔은 없기를 \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/256/15026256_1462942024221_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130153, lowkey: nil, highkey: nil},
  {album_id: 47, singer_id: 62, team_id: nil, title: "Killing me softly", genre1: "가요", genre2: "R&amp;B/소울", runtime: "01:54", lyrics: "\n\t\t\t\t\t\t\t<div>Killing me softly - 01:54</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가사 정보가 없습니다.</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/257/15026257_1458548715515_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130154, lowkey: nil, highkey: nil},
  {album_id: 47, singer_id: 62, team_id: nil, title: "Novita", genre1: "가요", genre2: "R&amp;B/소울", runtime: "04:58", lyrics: "\n\t\t\t\t\t\t\t<div>Novita - 04:58</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">고마울 뿐야 나를 떠나준 그대\r\n이미 예감하듯 넌 웃고 있어\r\n\r\n슬프지 않아 메마른 눈물\r\n지쳐있는 내겐 이제 아무 감각이 없어\r\n\r\nOh You can't take my heart \r\n나도 누굴 울린 기억이나 허탈해져\r\nOh You can't take my heart \r\n나를 그도 많이 원망했겠지\r\n\r\nI know 떠나간 그댄 알 수 없겠지 (I'll be your soul)\r\n돌아와 준다면 또 흔들릴 내 맘 (uh Yeah)\r\n마지막 배련 더욱 초라해\r\n그대가 날 버린 건 이미 오래 전인데나를 걱정해?\r\n\r\n슬프지 않아 남은 정에 \r\n우는 척할 뿐 더 이상 난 느낄 아픔도 없어\r\n\r\nOh You can't take my heart \r\n나도 누굴 울린 기억이나 허탈해져\r\nOh You can't take my heart\r\n나를 그도 많이 원망했겠지\r\n\r\nI know 떠나간 그댄 알 수 없겠지 (I'll be your soul)\r\n돌아와 준다면 또 흔들릴 내 맘 (Huh Yeah)\r\n마지막 배련 더욱 초라해\r\n그대가 날 버린 건 이미 오래 전인데 나를 걱정해?\r\n\r\n차마 떠날 용긴 없어 참고 기다렸을 뿐\r\n그러니 어서 가줘 아픔 더 원치 않아 \r\n\r\nAnd I 떠나간 그댄 알 수 없겠지 (adlibs)\r\n하루하룰 그냥 견딜 수 없는 날 (adlibs)\r\n잠시 모든 게 멈춰 희미해\r\n애써 기억해봐도 떠오르지 않는 걸 그대 모습도 \r\n\r\nBaby come to me Let me hold you in my arms\r\n제발 돌아와 내 눈물을 닦아줘\r\nBaby come to me Let me hold you in my arms\r\n제발 돌아와 내 눈물을 닦아줘</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/257/15026257_1458548715515_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 10311, song_num: 16130155, lowkey: nil, highkey: nil},
  {album_id: 47, singer_id: 62, team_id: nil, title: "지금은 헤어져도", genre1: "가요", genre2: "R&amp;B/소울", runtime: "04:41", lyrics: "\n\t\t\t\t\t\t\t<div>지금은 헤어져도 - 04:41</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">이밤이 끝나면 그대와 헤어져야겠죠\r\n이걸로 우리의 사인 끝난건가요\r\n붙잡고 싶지만 애써 난 참았죠\r\n좋은 기억으로 남아야 하니까\r\n\r\n우린 첨부터 영원할 수 없는 사인걸 알지만\r\n이렇게 이별이 빨리 올 준 몰랐죠\r\n내 손을 잡아요 그리고 날 봐요\r\n마지막 그대를 느낄 수 있도록\r\n\r\n사랑해줘요 헤어진다 해도 그대의 기억을 난 갖고 떠나요\r\n오늘 이밤이 우리의 마지막 시간이 된대도 지금은 잊어요\r\n\r\n그대를 잊고 살기 위해 누군갈 만나도\r\n결국엔 그대에 사랑 찾게 되겠죠\r\n이제는 느껴요 슬픈 이별까지\r\n이미 우리에게 준비돼 있단 걸\r\n\r\n사랑해줘요 헤어진다 해도 그대의 기억을 난 갖고 떠나요\r\n오늘 이밤이 우리의 마지막 시간이 된대도 지금은 잊어요\r\n\r\nWish that tonight you will hold me forever\r\n지금은 헤어져도 난 믿을게요 돌아올 그대를\r\nWish that tonight you will hold me forever\r\n눈물이 흐르지만</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/257/15026257_1458548715515_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 10012, song_num: 16130156, lowkey: nil, highkey: nil},
  {album_id: 47, singer_id: 62, team_id: nil, title: "그리워하며 미워하며", genre1: "가요", genre2: "R&amp;B/소울", runtime: "03:54", lyrics: "\n\t\t\t\t\t\t\t<div>그리워하며 미워하며 - 03:54</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">아는지 나에게 하는 말 \r\n고개를 숙인 채 헤어지자는 말 \r\n그래야 한다고 그래야 한다고 \r\n혼자 다짐하는 것 같다는 걸 \r\n\r\n하지만 이 걸로 됐어 꿈같은 추억이 고마울 뿐인걸 \r\n더 이상 날 위해 애쓰려 하지마 \r\n오히려 더 힘들어 질 테니까 \r\n\r\n헤아릴 수 없이 많은 날들을 \r\n다시 혼자서 몇 번을 살겠지 \r\n처음으로 사랑을 알게 한 널 그리워하며 미워하며 \r\n\r\n언제나 내 눈을 보면서 넌 나만 있으면 된다고 말했지 \r\n믿을 수가 없어 너의 세상 속에 \r\n이제 나만 없으면 된다는 걸 \r\n\r\n헤아릴 수 없이 많은 날들을 \r\n다시 혼자서 몇 번을 살겠지 \r\n처음으로 사랑을 알게 한 널 \r\n그리워하며 미워하며 널 잊으며 \r\n\r\n다시 누군가 내게 온다면 \r\n사랑할수록 두려워지겠지 \r\n처음으로 이별을 알게 한 널 \r\n원망하면서 그렇게 난 널 잊을게</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/257/15026257_1458548715515_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130157, lowkey: nil, highkey: nil},
  {album_id: 47, singer_id: 62, team_id: nil, title: "천국의 연인들", genre1: "가요", genre2: "R&amp;B/소울", runtime: "04:43", lyrics: "\n\t\t\t\t\t\t\t<div>천국의 연인들 - 04:43</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">널 안은 지금 난 그대에 눈을 감아 \r\nlet me love you down \r\n멈춰진 시간을 이젠 영원히 너와 나 함께 해 \r\n\r\n너를 찾게 해준 것 정말 감사해 \r\n항상 기도할게 너 헤어질 수 없어 너와 나 \r\n나를 선택해준 너 정말 고마워 \r\n이제야 너를 만날 수 있었던 거야 baby \r\n\r\nthink about you day and night \r\n매일 밤 생각해 너와 나 \r\nand blow out the candlelight all right we sing \r\n\r\n내게 항상 말해줘 tell me what you want oh baby \r\n내가 힘이 들 때면 그대 나를 안아줘 baby \r\n언제나 너만의 자리를 비워두겠어 all right \r\n나만의 장소도 있기를 간절히 바래 baby \r\n\r\nthink about you day and night \r\n매일 밤 생각해 너와 나 \r\nand blow out the candlelight yeah sing it \r\n\r\nYou know I feel so good inside \r\n그대 나 forever 함께 하길 \r\nYou know you make me feel \r\nall right baby yeah forever \r\n\r\nTake our time Day and night \r\nTake you there all through the night \r\nMake my move Feel the mood \r\nTake you there all through the night \r\n\r\n널안은 지금 난 그대에 눈을 감아 \r\nlet me love you down \r\n멈춰진 시간을 이젠 영원히 너와나 함께 해</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/257/15026257_1458548715515_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130158, lowkey: nil, highkey: nil},
  {album_id: 47, singer_id: 62, team_id: nil, title: "At last", genre1: "가요", genre2: "R&amp;B/소울", runtime: "03:27", lyrics: "\n\t\t\t\t\t\t\t<div>At last - 03:27</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">At last\r\nMy love has come along\r\nMy lonely days are over\r\nAnd life is like a song\r\n\r\nAt last\r\nThe star's above the blue\r\nMy heart was wrapped up in clover\r\nThe night I looked at you\r\n\r\nI found a dream that I could speak to\r\nA dream that I can call my own\r\nI found a thrill to press my cheek to\r\nA thrill that I never known\r\n\r\nYou smile you smile\r\nOh and then the spell was cast\r\nAnd here we are in heaven\r\nFor you are mine at last</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/257/15026257_1458548715515_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130159, lowkey: nil, highkey: nil},
  {album_id: 47, singer_id: 62, team_id: nil, title: "Not again", genre1: "가요", genre2: "R&amp;B/소울", runtime: "04:52", lyrics: "\n\t\t\t\t\t\t\t<div>Not again - 04:52</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">Baby not again 그대 향한 바람\r\n또 다른 기다림 또 다시 시작된 건 \r\nI wanna read your mind\r\n다시 너 생각해 나 이대로 끝낼 수는 없는 걸 \r\nYeah baby baby\r\n지나간 시간동안 느낀 건 아무것도 없었니 \r\n\r\nwhy why why why \r\nbaby no no no no no \r\nbaby not again yeah\r\nI just wanna know one thing\r\n\r\n그대여 나...기다림 견디지 못해요 날 위해 나를 안아줘\r\n아무도 그대를 채울 수 없는 걸 \r\n돌아와 나...시간이 지나면 누군가 대신할 나의 자리 \r\n생각하면 나 정말 견딜 수 없어 난\r\n우리 다시 다른 우리 찾을 수 없을 테니\r\n\r\nBaby not again 다시 이런 사랑 \r\nBaby tell me why 내게 이런 아픔\r\nI wanna know your mind\r\n내방에 널려 있는 사진들 지쳐 버린 한숨들\r\nYeah baby baby\r\n내 안에 남아있는 네 숨결 아직 모두 기억해\r\n\r\n아직도 그 자리 I'm still in love\r\n그대와 둘이서 이제 다시 \r\n나 너와 만났던 그날부터 모든 건 정해졌어\r\n다시 돌아온 그대 날 위해 다시 헤어지지마</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/257/15026257_1458548715515_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130160, lowkey: nil, highkey: nil},
  {album_id: 47, singer_id: 62, team_id: nil, title: "사랑한다는 말", genre1: "가요", genre2: "R&amp;B/소울", runtime: "04:35", lyrics: "\n\t\t\t\t\t\t\t<div>사랑한다는 말 - 04:35</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">사랑한다는 말 네겐 농담처럼 들리니 \r\n사랑한다는 말\r\nEvery time I'm Feeling Every time I'm Feeling \r\n\r\n나의 고백들이 너무 어리석게 들리니\r\n제발 받아주길\r\nEvery time I'm Feeling Every time I'm Feeling \r\n\r\n내가 아무리 너 밖에는 \r\n그 누구라도 사랑하지 못한다 해도\r\n너는 내게 그렇게 할 수 없어\r\n\r\n차갑기만 한 얼굴 꼭 그래야만 했는지 모르겠어\r\n내가 먼저 다가가서 모두 고백한 게 넌 첨이 아니었어\r\n아무것도 몰랐던 거야 감출 수가 없었던 거야\r\n나를 보여준 게 너무 큰 잘못이었었니\r\n\r\n너의 뒷모습을 다신 보고 싶지가 않아\r\n믿을 수가 없어\r\nEvery time I'm Feeling Every time I'm Feeling\r\n\r\n내가 아무리 너 밖에는 \r\n그 누구라도 사랑하지 못한다 해도\r\n너는 내게 그렇게 할 수 없어\r\n\r\n아프기만 한 말들 꼭 그래야만 했는지 모르겠어\r\n니 가 없이 안된 다고 하는 이런 내가 우습게만 보였어\r\n아무것도 몰랐던 거야 감출 수가 없었던 거야\r\n너를 사랑한 게 너무 큰 잘못이었었니\r\n\r\n눈물이 나도 왜 참아야 하는지 아픈 건 나 혼자 일 텐데\r\n\r\n사랑한다는 말 네겐 농담처럼 들리니\r\n사랑한다는 말\r\nEvery time I'm Feeling Every time I'm Feeling</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/257/15026257_1458548715515_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130161, lowkey: nil, highkey: nil},
  {album_id: 47, singer_id: 62, team_id: nil, title: "All for you", genre1: "가요", genre2: "R&amp;B/소울", runtime: "04:20", lyrics: "\n\t\t\t\t\t\t\t<div>All for you - 04:20</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">웃고있는 너를 보았지 \r\n너는 나를 보고있지 않았지만 \r\n잊을 수가 없었지\r\n멀리 서 너의 모습 보여도 \r\n떨리는 마음만은 너에게도 \r\n들릴 것 같아\r\n일부러 못 본 듯 지나가 언젠가는 \r\n널 다시 나는 만날 것만 같았어\r\n하고 싶은 말들이 있다며 내 앞에 \r\n온 오늘에야 너를 보게 된 거야 \r\n\r\n너는 수줍은 듯 내게 말했지\r\n망설였던 마음 \"I love you\" 받아주겠니\r\n너도 그 이유를 알 수는 없지만 \r\n나만 바라보게 된 거라고\r\n\r\nOh Every time are you lonely night\r\nCause I let me know all your heart\r\n내게도 사랑이 찾아 온 거야 \r\nOh Every time are you lonely night\r\nCause I let me know all your heart\r\n언제나 널 보아왔지\r\n\r\n너는 꿈꾸듯이 내게 말했지\r\n망설였던 마음 \"I love you\" 받아주겠니\r\n너도 언제부턴지 알 수는 없지만 \r\n나만 사랑하게 된 거라고\r\n\r\nOh Every time are you lonely night\r\nCause I let me know all your heart\r\n애타는 기다림 받아 준거야\r\nOh Every time are you lonely night\r\nCause I let me know all your heart\r\n누구보다 행복한걸\r\n\r\n아주 작은 눈빛조차 느꼈던 거니 \r\n맘으로 넌 나에게 말을 해\r\n거짓말같이 넌 나에게 말을 걸었지 \r\n\r\nOh Every time are you lonely night\r\nCause I let me know all your heart\r\n기다린 사랑이 너였던 거야\r\nOh Every time are you lonely night\r\nCause I let me know all your heart\r\n이제 날 보여줄게 For you!</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/257/15026257_1458548715515_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130162, lowkey: nil, highkey: nil},
  {album_id: 47, singer_id: 62, team_id: nil, title: "Irony", genre1: "가요", genre2: "R&amp;B/소울", runtime: "03:46", lyrics: "\n\t\t\t\t\t\t\t<div>Irony - 03:46</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">You don't ever feel my love for you \r\n그렇게만 내게 말해줘 \r\n처음부터 너의 사랑에 난 없었다고 \r\nYou don't ever feel my love for you \r\n그렇게만 믿게 해줄래 \r\n언제까지 나의 사랑을 넌 모른다고 \r\n\r\n널 탓하려 하는 건 아니지만 \r\n너 이것만은 알아야 할 것 같아 \r\n네가 내게 잘못한 일이라면 \r\n그를 내게 보여 줬다는 것 \r\n\r\n먼 곳에서 난 매일 바라보며 \r\n언젠가는 나만의 그이기를 \r\n난 언제나 원하며 바랬지만 \r\n허전함만 깊어져 가 \r\n\r\n한동안 나 매일 울겠지만 \r\n지금보단 나을 꺼야 \r\n기대 없는 나의 마음속엔 \r\n두 번 다시 남겨질 슬픔도 없을 테니 \r\n\r\n돌이키려 하는 게 아 잖아 \r\n널 변명하려 그렇게 애쓰지마 \r\n처음이자 마지막 부탁이야 \r\n나를 이해해 줄 순 없겠지 \r\n\r\n처음부터 혼자만 사랑할 걸 \r\n널 믿었어 날 도와준댔잖아 \r\n하지만 니 마음을 모르겠어 \r\n두려움만 커져 갈 뿐 \r\n\r\nYou don't ever feel my love for you \r\n그렇게만 내게 말해줘 \r\n처음부터 너의 사랑에 난 없었다고 \r\nYou don't ever feel my love for you \r\n그렇게만 믿게 해줄래 \r\n언제까지 나의 사랑을 넌 모른다고 \r\nBut I'm still in love...</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/257/15026257_1458548715515_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130163, lowkey: nil, highkey: nil},
  {album_id: 47, singer_id: 62, team_id: nil, title: "I never", genre1: "가요", genre2: "R&amp;B/소울", runtime: "03:28", lyrics: "\n\t\t\t\t\t\t\t<div>I never - 03:28</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">I'll never gonna fall in love \r\n믿을 수 없어 나 지금 너를 do do do\r\n미안한 척 얘기 하진 마 \r\n내게 준 아픔 니가 지을 수 없어 \r\n\r\nI'll never gonna fall in love \r\n사라져버려 떠나버려 do do do\r\n이렇게도 어리석은 난 \r\n잊지 못하니 너무 잔인한 너를\r\n\r\n아무것도 아냐 너 날 그냥 내버려둬\r\n아주 날 버려줘 미련 없이\r\n\r\n니가 그때 왜 그랬었는지 \r\n이제야 모든걸 알겠어\r\n솔직히 날 사랑할 \r\n마음조차 없었다는 거잖아\r\n지금에 와 왜 그런 말을 해 \r\n그녀를 잊을 수 없다고\r\n널 사랑하기 전 말했어야 했잖아\r\n\r\n아무것도 아냐 넌 날 그냥 내버려둬\r\n아주 날 버려줘 남김없이\r\n\r\n처음부터 나에게 다가온 사람은 \r\n너인걸 잊었니\r\n설명해봐 왜 하필 \r\n나를 택해 비참하게 한 거니\r\n지금에 와 왜 그런 \r\n말을 해 내가 부담스러웠다고\r\n첨부터 나에게 말했어야 했잖아\r\n\r\n난 몰랐었어 사랑하고 있었는데 왜 날 떠나갔어\r\n난 정말 니가 미워\r\n\r\n잊겠어 널 난 잊어야 해 \r\n그녀를 잊지 못하고 있는 너를 \r\n나조차 너처럼 그래선 안되잖아</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/257/15026257_1458548715515_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130164, lowkey: nil, highkey: nil},
  {album_id: 47, singer_id: 62, team_id: nil, title: "Don't stop", genre1: "가요", genre2: "R&amp;B/소울", runtime: "01:15", lyrics: "\n\t\t\t\t\t\t\t<div>Don't stop - 01:15</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가사 정보가 없습니다.</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/257/15026257_1458548715515_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130165, lowkey: nil, highkey: nil},
  {album_id: 47, singer_id: 62, team_id: nil, title: "깊은 슬픔", genre1: "가요", genre2: "R&amp;B/소울", runtime: "03:45", lyrics: "\n\t\t\t\t\t\t\t<div>깊은 슬픔 - 03:45</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">널 생각하며 난 웃다 문득 놀라 허전해 \r\n그렇게 널 보내며 난 이별을 또 배워가는데\r\n\r\n네게 주려 했던 나의 낡은 일기장엔\r\n왜 너를 사랑한단 말들만 가득한지\r\n\r\n늦어버린 사랑은 나 혼자 해야 하는 걸\r\n지금도 미소로 너는 날 타이르고 있는데 \r\n이제는 그리움이야 다 참아보지만 \r\n난 매일 조금씩 더 야위어 가는 걸 난\r\n\r\n아마 잊을 만큼 시간이 흐르고 나면 \r\n한때는 그러면서 네 얘길 하고 싶어\r\n\r\n아직 내겐 너무 많은 시간이 남아있나\r\n지금은 네 생각이나 난 가슴이 너무 아파 \r\n네 사진 모두 버려도 더 그리워해 \r\n난 매일 조금씩 더 야위어 가는 걸 \r\n\r\n널 다시 또 본대도 아마 나는\r\n못 본 척 지나가고 돌아서서 후회할 걸 \r\n그래도 꼭 한번만은 거리에서 웃고 있는 \r\n니 모습을 보고싶어 행복하게 지내줘야 해 \r\n내 마음 놓이게 내 마지막 기도일 뿐이야 널 위한...</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/257/15026257_1458548715515_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130166, lowkey: nil, highkey: nil},
  {album_id: 47, singer_id: 62, team_id: nil, title: "너를 보낸 후에도", genre1: "가요", genre2: "R&amp;B/소울", runtime: "04:10", lyrics: "\n\t\t\t\t\t\t\t<div>너를 보낸 후에도 - 04:10</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">너를 보낸 후에도 내 마음 빈 자리엔 \r\n아직도 네가 거기에 \r\n하얗게 웃고 있는 것 같아 \r\n나는 너의 모습 다시 찾는다\r\n\r\n그리울 수록 견딜 수 있었던 \r\n너를 향한 나의 이 아픔을\r\n널 사랑한 만큼 떠나 보낼 수 있었던 \r\n널 향한 나의 눈물은 \r\n\r\n너를 보낸 후에도 내 마음 빈자리엔 \r\n아직도 너는 남아서 \r\n그대로 살고 있는 것 같아 \r\n나는 너의 숨결 다시 느낀다 \r\n\r\n그리운 만큼 참을 수 있었던 \r\n너를 향한 나의 이 고통을 \r\n너를 사랑한 만큼 찢긴 나의 가슴에 \r\n널 내 가슴에 묻을게 \r\n\r\n언젠가 내게로 너 돌아와 \r\n우리의 이별이 끝날 때 \r\n외롭고 지친 널 더운 내 품안에 \r\n아름답던 그 미소로 쉬게 할 때까지 \r\n\r\n그리운 만큼 난 견딜 수 있어 \r\n너를 향한 나의 이 슬픔을 \r\n널 사랑한 만큼 찢긴 나의 가슴에 \r\n널 내 가슴속에 묻을게</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/257/15026257_1458548715515_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130167, lowkey: nil, highkey: nil},
