  {album_id: 48, singer_id: nil, team_id: 17, title: "Next Generation's Song", genre1: "가요", genre2: "인디", runtime: "02:50", lyrics: "\n\t\t\t\t\t\t\t<div>Next Generation's Song - 02:50</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">똑똑한 사람이 너무 많아 미칠 것 같아 나같은 바보는 발 붙일 곳 없는 것 같아 \n잘난 너 못난 나 함께 어울려 흔들어보자 가진 나 못가진 너 눈물나게 맞짱 떠보자 \n나는 천재요 너는 바보야 너의 마음을 난 절대 읽을 수가 없어 \n\n바보들의 세상 바보같은 세상 바보없는 세상 다 똑똑한 바보들 \n바보처럼 삽시다 바보가 되봅시다 바보가 뭐 어때서 다 똑똑한 바보들 \n\n세상은 너무 빨리 변하고 있어 유행은 유행처럼 휙 지나가요 \n내가 사랑했던 것들 다 잊혀졌고 니가 바라던 것들은 일장춘몽이야 \n나는 바보야 너는 천재야 나의 마음을 넌 절대 읽을 수가 없어 \n\n바보들의 세상 바보같은 세상 바보없는 세상 다 똑똑한 바보들 \n바보처럼 삽시다 바보가 되봅시다 바보가 뭐 어때서 다 똑똑한 바보들 \n\n똑똑한 사람이 너무 많아 미칠 것 같아 나같은 바보는 발 붙일 곳 없는 것 같아 \n나는 바보야 너도 바보야 너의 마음을 난 절대 읽을 수가 없어 \n바보들의 세상 바보같은 세상 바보없는 세상 다 똑똑한 바보들 \n바보처럼 삽시다 바보가 되봅시다 바보가 뭐 어때서 다 똑똑한 바보들 \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130181, lowkey: nil, highkey: nil},
  {album_id: 48, singer_id: nil, team_id: 17, title: "마이너리그 스타", genre1: "가요", genre2: "인디", runtime: "03:55", lyrics: "\n\t\t\t\t\t\t\t<div>마이너리그 스타 - 03:55</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">거대한 야망 불같은 열정 두 주먹 불끈 쥐고 왔네 L.A 다저스 뉴욕 메츠 그곳만을 바라보았네 \n하지만 그건 정말 쉽지 않았다 감독님이 날 보자 하네 락커룸에서 짐을 챙겼네 서러움이 불을 당긴다 \n정말 슬펐네 그래도 난 코리아에선 잘 나갔었는데 처절하도록 무너지다니 나 밤새도록 펑펑 울었네 \n난난난 이기리 나 이겨내리 오늘을 절대 잊지않으리 stepbystep 인생은 daybyday 이제부터 난 마이너리그 스타 \n\n외로움과의 끝없는 싸움 풀리지않는 수많은 질문들 하얀 인간들 차가운 눈빛 고개숙인 나의 에너지 \n토스트쨈 우유 매일 되는 고된 훈련들 말이라도 통하면 좋으련만 내가 왜 왔나 지금 무얼 하나 \n나 밤새도록 펑펑 울었네 \n난난난 이기리 나 이겨내리 오늘을 절대 잊지않으리 stepbystep 인생은 daybyday 이제부터 난 마이너리그 스타 \n\n수개월 동안 피눈물 먹은 나의 뼈와 살을 보아라 강해졌노라 단단해졌노라 이제 기회를 만드노라 \n꿈에 그리던 푸른 다이아몬드 열광하는 수많은 저 사람들 초구는 직구 두번짼 변화구 세번째 결정구를 넣으리 \n나의 인생과 난 난 나만의 결정구 오늘은 나의 날이 되리라 \n난난난 이기리 나 이겨내리 오늘을 절대 잊지않으리 stepbystep 인생은 daybyday 이제부터 난 마이너리그 스타 \n\n나의 인생과 난난난 나의 결정도 오늘은 나의 날이 되리라 이몸이 으스러져도 여기 쓰러진대도 \n이제부터 난 마이너리그 스타 이제부터 난 마이너리그 스타 언젠가는 메이저리그 스타 \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130182, lowkey: nil, highkey: nil},
  {album_id: 48, singer_id: nil, team_id: 17, title: "Today", genre1: "가요", genre2: "인디", runtime: "02:26", lyrics: "\n\t\t\t\t\t\t\t<div>Today - 02:26</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">오늘또 하루가 시작이구나 어떤이를 만나서 무엇을 할수 있을까 또 어떤 기억을 밟아갈 수 있을까 알게 될꺼야 \n하루하루 내 인생은 타들어가고 어제와 같지 않으려 달라지려 애써보지만 쉽지는 않아 정말 쉽지않아 \n어색하게도 오늘은 나를 닮았어 \n제발 솔직해주오 나의 모든 것 나에게만은 웃지 않을게 비웃지 않을게 모두 버리고 시작하는 것도 좋아 \n\n오늘또 하루가 시작이구나 어떤이를 만나서 무슨 말을 할수 있을까 힘없는 어깨를 내가 만져준다면 다시 일어서주렴 \n오늘또 하루를 힘차고 씩씩하게 살아야만 하는 이유가 있어 내일은 없어 기다리지마 오늘 없인 내일은 오지 않으니 \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130183, lowkey: nil, highkey: nil},
  {album_id: 48, singer_id: nil, team_id: 17, title: "오징어튀김과 공보빵", genre1: "가요", genre2: "인디", runtime: "02:53", lyrics: "\n\t\t\t\t\t\t\t<div>오징어튀김과 공보빵 - 02:53</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">아 엄만 오늘 오징어 튀김 사오셨나 봐 \r\n아 물을 떠다 간장 찾아 종지에 붓네 \r\n\r\n그런데 오징어 튀김 안에 \r\n오징어가 사라졌구나 \r\n오징어없는 오징어 튀김 먹고있는 \r\n내가 정말 한심하구나 \r\n\r\n오.징.어. 튀김 멋져 \r\n아 엄만 오늘 오징어가 정말 먹고 싶었나보다 \r\n아 우리 누난 오징어가 정말 먹고 싶었을거야 \r\n\r\n아 엄만 오늘 곰보빵을 사오셨나 봐 \r\n아 우유 떠다 접시 찾아 빵을 올려 놔 \r\n\r\n그런데 곰보빵 위에 맛있는 \r\n곰보를 누가 떼어먹었어 \r\n맛없는 그냥 빵을 먹고 있는 \r\n내가 정말 한심하구나 \r\n\r\n곰.보.빵. 곰보 멋져 \r\n아 엄만 오늘 곰보가 정말로 먹고 싶었나보다\r\n아 우리 누난 곰보가 정말로 먹고 싶었을거야 \r\n\r\n내게도 기회를 줘 알맹이 다 빼먹고 \r\n맛없는 껍데기만 내게로 왔나 \r\n껍데긴 정말 싫어 돈없고 빽없으면 \r\n껍데기 하나에도 목숨을 걸지 \r\n오.징.어 튀김 -</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130184, lowkey: nil, highkey: nil},
  {album_id: 49, singer_id: 63, team_id: nil, title: "주사위", genre1: "가요", genre2: "블루스/포크", runtime: "03:28", lyrics: "\n\t\t\t\t\t\t\t<div>주사위 - 03:28</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">던저진 세상속에 살아봐\n알수도 없는길에 모여봐\n단한번사랑속에 빠저봐\n던저진 주사위처럼..\n돌아가는 내 모습 차마 볼 수가 없어\n그래도 난 어느 면에서는 달라진 내 모습으로..\n살아가야 하는 거야\n숨이 막혀 힘들어도..\n포기할수 없는거야..\n내자신을 중심으로\n\n후렴\n\n돌아가는 내 모습 차마 볼 수가 없어\n그래도 난 어느 면에서는 달라진 내 모습으로..\n살아가야 하는 거야\n숨이 막혀 힘들어도..\n포기할수 없는거야..\n내자신을 중심으로   \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/259/15026259_1407999542451_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 12320, song_num: 16130185, lowkey: nil, highkey: nil},
  {album_id: 49, singer_id: 63, team_id: nil, title: "부족한 사랑", genre1: "가요", genre2: "블루스/포크", runtime: "04:43", lyrics: "\n\t\t\t\t\t\t\t<div>부족한 사랑 - 04:43</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">변하지 않았었니 다른 사람도 만나 사랑할\r\n그긴 시간을 넌 포기한채날 그대로 기억하고 있니\r\n어쩜 너의 마음은 하나도 잊지 않은채로날\r\n그긴 시간을 외로움에 지쳐 나만을 기다려 왔니\r\n\r\n나 어떻게 너를 사랑해\r\n나의 사랑은 네게 부족한 짐이될 뿐이야\r\n얼마나 많은 시간이 널 잡아 그렇게도\r\n아픔만 가지라고 했나~~~~~~~~~~\r\n\r\n어쩜 너의 마음은 하나도 잊지 않은채로날\r\n그긴 시간을 외로움에 지쳐 나만을 기다려 왔니\r\n\r\n나 어떻게 너를 사랑해\r\n나의 사랑은 네게 부족한 짐이될 뿐이야\r\n얼마나 많은 시간이 널 잡아 그렇게도\r\n아픔만 가지라고 했나~~~~~~~~~\r\n\r\n나 어떻게 너를 사랑해\r\n나의 사랑은 네게 부족한 짐이될 뿐이야\r\n얼마나 많은 시간이 널 잡아 그렇게도\r\n아픔만 가지라고 했나~~~~~~~~~</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/259/15026259_1407999542451_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 10416, song_num: 16130186, lowkey: nil, highkey: nil},
  {album_id: 49, singer_id: 63, team_id: nil, title: "가겠소?", genre1: "가요", genre2: "블루스/포크", runtime: "03:10", lyrics: "\n\t\t\t\t\t\t\t<div>가겠소? - 03:10</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">걸어걸어가다보면 한 줄 바람이라도 와 \n나의 이름 부르며 외로움 달래주렴아 \n세상 끝까지 까지 걸어서 갈수 없다면\n나의 꿈을 실어서 바람에게라도 주렴아 이봐요\n혼자 가지말고 나와 함께 가겠소 가겠소 가겠소\n나와 같이 가겠소 희망을 찾아서 나와 함께 가겠소 \n가겠소 가겠소 우리 걸어 가겠소\n\n걸어 걸어 가다 보면 한줄 바람이라도 불어 와\n나의 이름 부르며 외로움 달래주렴아\n세상 끝까지 까지 걸어서 갈수 없다면\n나의 꿈을 실어서 바람에게라도 주렴아 이봐요\n혼자 가지말고 나와 함께 가겠소 가겠소 가겠소\n나와 같이 가게소 사랑을 찾아서 나와 함께 가겠소 \n가겠소 가겠소 우리 걸어 가겠소\n\n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/259/15026259_1407999542451_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130187, lowkey: nil, highkey: nil},
  {album_id: 49, singer_id: 63, team_id: nil, title: "사랑의 노래", genre1: "가요", genre2: "블루스/포크", runtime: "02:59", lyrics: "\n\t\t\t\t\t\t\t<div>사랑의 노래 - 02:59</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">찬란하게 빛나는 거리를 걸었으면 싶네\r\n사과나무 한 그루까지도 꿈을 담아\r\n어느 계절언제나 웃을 수 있는 사람들만\r\n모여 살고 싶어라 친구들 자유롭게\r\n\r\n라랄라라라 부르며 라랄라 라라 노래를\r\n라랄라라라 부르며 라랄라 라라 사랑의 노래를\r\n라랄라라라 부르며 라랄라 라라 라이랄라\r\n하늘위를 나는 새들의 날개짓을 달고\r\n그대위에 부르는 이 노래 꿈을 담아\r\n하루해가 저물어 가는 곳 저 언덕을 넘어\r\n모두 함께 부르는 이 노래 자유롭게...</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/259/15026259_1407999542451_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130188, lowkey: nil, highkey: nil},
  {album_id: 49, singer_id: 63, team_id: nil, title: "시작", genre1: "가요", genre2: "블루스/포크", runtime: "04:03", lyrics: "\n\t\t\t\t\t\t\t<div>시작 - 04:03</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">버릴수가 없어\n이제 내모든것\n잃어버렸다던 단한번 기회라고 \n난 이순간을 놓칠수가 없어\n이게 내 마지막 꿈인걸\n영원히 변하지않는\n시작과 끝이 되어준\n내남은 시간 다주어도 좋을사람 그대\n사랑할수만있다면\n그대와 함께있다면\n내남은 시간 다주어도 좋을사람 그대\n\n놓칠수가없어\n이게 내 마지막 꿈인걸\n영원히 변하지않는 \n시작과 끝이 되어준\n내남은 시간 다주어도 좋을사람 그대\n사랑할수만 있다면\n그대화 함께있다면\n내남은 시간 다주어도 좋을사람 그대</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/259/15026259_1407999542451_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130189, lowkey: nil, highkey: nil},
  {album_id: 49, singer_id: 63, team_id: nil, title: "바람아", genre1: "가요", genre2: "블루스/포크", runtime: "03:55", lyrics: "\n\t\t\t\t\t\t\t<div>바람아 - 03:55</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">바람이 내게 불어와 그 싸늘했던 바람이\r\n눈부시도록 아름답던 그 꽃들이 바람에 날려\r\n\r\n**세월이 가고 오는길 그 길따라 나도 함께\r\n머나먼 길을 헤매오다 이제야 바람을 만나\r\n\r\n바람아 바람아 나를 실어갈 수 있을까\r\n불어와 불어와 나를 친구로 받아줘\r\n\r\n바람아 바람아 나를 묻어갈 수 있을까\r\n불어와 불어와 나를 그속에 안아줘\r\n\r\n\t\t\t\t\t</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/259/15026259_1407999542451_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130190, lowkey: nil, highkey: nil},
  {album_id: 49, singer_id: 63, team_id: nil, title: "그대에게", genre1: "가요", genre2: "블루스/포크", runtime: "04:16", lyrics: "\n\t\t\t\t\t\t\t<div>그대에게 - 04:16</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">그대 떠난다는 그 말 한 마디가 \n가슴속에 남아 울고 있는데\n\n시간이 약이라는 잊혀진 그 말귀에\n그리움만 가득안고 내게 남아있네\n\n그대 돌아와요 다시 내게로\n우리에겐 상관없는 그런 얘기처럼\n\n사랑해~ 사랑해~ 난 아직 그대를 \n이 순간을 영원히 후회하진 않아\n\n마지막 한마디 그대에게 묻는다면 \n다시 남처럼 떠날 수 있는지\n\n그대 돌아와요 다시 내게로\n우리에겐 상관없는 그런 얘기처럼\n\n사랑해~ 사랑해~ 난 아직 그대를\n이 순간을 영원히 후회하진 않아\n\n마지막 한마디 그대에게 묻는다면 \n다시 남처럼 떠날 수 있는지\n\n사랑해~ 사랑해~ 난 아직 그대를\n이 순간을 영원히 후회하진 않아\n\n마지막 한마디 그대에게 묻는다면 \n다시 남처럼 떠날 수 있는지\n\n다시 남처럼 보낼 수 있는지</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/259/15026259_1407999542451_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130191, lowkey: nil, highkey: nil},
  {album_id: 49, singer_id: 63, team_id: nil, title: "떠나려해", genre1: "가요", genre2: "블루스/포크", runtime: "04:16", lyrics: "\n\t\t\t\t\t\t\t<div>떠나려해 - 04:16</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">시간이 가면 또 잊혀지려나\n멀리서 바라만 봤던 그 모습\n 나에겐 다가올 내일이 있어\n모든걸 뒤로 인정해 두려해\n\n너를 만나서 참 좋았다고\n이렇게 멀어져 미안하다고\n서로를 위해 더 잘된거라고\n모든걸 뒤로 인정해 두려해\n\n무지한 나의 모습이 싫어져 \n갈곳을 찾아 나 헤매기 위해\n떠나려해 난 떨나려해 나를 찾아 워 나를 찾아\n떠나려해 난 떨나려해 나를 찾아 워 나를 찾아</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/259/15026259_1407999542451_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130192, lowkey: nil, highkey: nil},
  {album_id: 49, singer_id: 63, team_id: nil, title: "다시회상", genre1: "가요", genre2: "블루스/포크", runtime: "04:01", lyrics: "\n\t\t\t\t\t\t\t<div>다시회상 - 04:01</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">마지막인가\n이제 떠나가면\n끝내 못다이뤄 다친 쓴 과거일수 밖에\n잊으려 했나 지난 모든일을\n\n끝내 다 잊을 수 없는 아픈 상처로 남아\n몇밤이 날빌어 하얗게 바래졌는지\n\n소중한 사람이 다시 버릴 수 없어서\n그렇게 돌아보면은 늘 같은자리\n\n늘 같은 생각 속에 날 가둬두고\n지쳐 나 지쳐 떠나갈래</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/259/15026259_1407999542451_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130193, lowkey: nil, highkey: nil},
  {album_id: 49, singer_id: 63, team_id: nil, title: "이별 뒤에 서서", genre1: "가요", genre2: "블루스/포크", runtime: "04:00", lyrics: "\n\t\t\t\t\t\t\t<div>이별 뒤에 서서 - 04:00</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">토라져 돌아앉았네..\n\n눈물을 흘리네\n무엇이 둘사이를 멀게했을까\n\n일어나 바라보네\n쓴웃음을 주네\n발길을 돌리네\n\n어디로 가는가 이별을 안고\n낯선사람들처럼\n\n사라져버렸네 \n사랑의 마지막을 남기고\n\n어디로가는가 눈물을 흘리며\n사라졌네\n다른사랑 찾아 떠나네</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/259/15026259_1407999542451_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130194, lowkey: nil, highkey: nil},
  {album_id: 49, singer_id: 63, team_id: nil, title: "눈물이 나…", genre1: "가요", genre2: "블루스/포크", runtime: "05:22", lyrics: "\n\t\t\t\t\t\t\t<div>눈물이 나… - 05:22</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">추워..날개가 얼어붙어서\r\n날지도 못하는 날에는..\r\n멀리멀리 날고 싶다는 꿈\r\n바람..아무도 막아주지 않네..\r\n그 시리도록 찬 바람을..\r\n외롭게 혼자 서있네..\r\n눈물이나 하염없이 눈물이나..\r\n눈물이나 얼어붙은 눈물하나 마음속에 눈물이 나네\r\n\r\n\r\n추워..날개가 얼어붙어서\r\n날지도 못하는 날에는..\r\n멀리멀리 날고 싶다는 꿈\r\n바람..아무도 막아주지 않네..\r\n그 시리도록 찬 바람을..\r\n외롭게 혼자 서있네..\r\n눈물이나 하염없이 눈물이나..\r\n눈물이나 얼어붙은 눈물하나 마음속에 눈물이 나네\r\n눈물이나 하염없이 눈물이나..\r\n눈물이나 얼어붙은 눈물하나 마음속에 눈물이 나네</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/259/15026259_1407999542451_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130195, lowkey: nil, highkey: nil},
  {album_id: 49, singer_id: 63, team_id: nil, title: "꽃이 지기까지…", genre1: "가요", genre2: "블루스/포크", runtime: "04:47", lyrics: "\n\t\t\t\t\t\t\t<div>꽃이 지기까지… - 04:47</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">보면 볼수록 아름답고 너 여기에 왜..\n그 숨가쁜 너의 향기 느낄수가 없었나\n\n이젠 너에게 용서를 빌어야겠어\n그동안 미안해\n\n*얼마나 힘들었을까\n꽃과 가지만 남아 이쁜 얼굴로 볼때 까지\n꽃이 지기 까지..*\n\n이젠 너에게 용서를 빌어야겠어\n그동안 미안해\n\n**\n\n얼마나 아파했을까\n꽃과 가지만 남아 이쁜 얼굴로 볼때 까지\n꽃이 지기 까지..   \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/259/15026259_1407999542451_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130196, lowkey: nil, highkey: nil},
