  {album_id: 50, singer_id: nil, team_id: 18, title: "Respect You", genre1: "가요", genre2: "랩/힙합", runtime: "03:35", lyrics: "\n\t\t\t\t\t\t\t<div>Respect You - 03:35</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">사건의 발단 이 세계의 \r\n동경으로부터 실력 향상은 \r\nMusician 향한 존경에서부터 \r\n하지만 그 후 어느 순간부턴 \r\n존중 존경보다는 지기가 \r\n싫다는 이유로 질투와 시기가 \r\n발동해 생긴 불필요한 \r\n오만함 원체 빈 깡통 소리가 \r\n훨씬 요란한 법 M\r\nicrophone Check (12) \r\n외치는 다수의 MC들이여 \r\nListen Closely \r\nI gave you some \r\nanalysed reason \r\nOh I missin' \r\nsomething lynching이란 \r\n단어 아니 (Yes~)\r\n이런 짓을 행한 자는 \r\n댓가를 치룬다는 말인 \r\n이 단어 새겨 들어 \r\n언젠간 너 역시도 \r\nDisrespect에 의한 \r\nPay Back분명 확실히 꼭 \r\n(톡톡히) 받게 될 테니 \r\nA Yo거기 너 Faggy \r\n니 어리석었던 행동 이제 \r\nNo more That's it \r\nCheck this ma lyrical \r\ntactic Yo! Ya betta respect me \r\nCause u can't never follow ma \r\ninfinite rhyme's technic \r\n\r\nClick Click Internet \r\n단어들이 빚어 낸 \r\n껍데기만 있는 싸움에 \r\n굉음에 Rap Game에서 지어 낸 \r\n헛소리는 우리와 상관 없네 \r\n옛 소리로 이내 곧 \r\n씹어 내 뱉으니 \r\n하나 같이 타인을 \r\n비판으로 상대해 \r\n뿌리를 보지 못하는 \r\n너의 맘에게 들리는 \r\nNapow에 서로의 의미에 \r\n내 뱉음에 배움의 \r\n끝은 없어 \r\n어리석음에 미움의 \r\n눈을 가리게 \r\n마음에 믿음의 \r\n문신이 보이게 \r\n네 가치가 바로 서게 \r\nThis is not a same \r\nHip Hop Story가 \r\n결코 아닌 이상 모조리 \r\n도토리 키재기 하고 \r\n있는 건 아닐까 \r\nThink about it 생각을 가두니 \r\n물에 흐름에 비친 \r\n맘은 이미 헛도니 \r\nYo~ 그대로 보여질 수 없으리 \r\n서로의 연결 고리는 \r\n절대 이뤄질 수 없으리\r\n\r\n(넋업샤니 a.k.a 이밀라국거리)\r\nTo ma fabolous brotha \r\nBe untouchable brotha \r\nYou You Respect You \r\nIt's time to get wreck \r\nwith' da 무한류 \r\n\r\n(Goliath Monsta a.k.a young GM)\r\nGot to be the illest brotha \r\nYa betta keep it real brotha \r\nYou You Respect You \r\nIt's time to get wreck \r\nwit' da 무한류</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/262/15026262_1421202561930_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130225, lowkey: nil, highkey: nil},
  {album_id: 50, singer_id: nil, team_id: 18, title: "Respect You (Urban Night Mix)", genre1: "가요", genre2: "랩/힙합", runtime: "03:44", lyrics: "\n\t\t\t\t\t\t\t<div>Respect You (Urban Night Mix) - 03:44</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">verse1(Goliath Monsta) \r\n사건의 발단 이 세계의 동경으로부터 실력향상은 \r\n뮤지션 향한 존경에서부터 \r\n하지만 그 후 어느 순간부턴 존중, \r\n존경보다는 지기가 싫다는 이유로 \r\n질투와 시기가 발동해 생긴 \r\n불필요한 오만함 원체 빈 깡통소리가 훨씬 요란한 법 microphone check(1,2) \r\n외치는 다수의 MC들이여\r\nlisten closely I gave you some analysed reason \r\noh, I missin' something lynching이란 단어 아니? \r\n이런 짓을 행한자는 댓가를 치룬다는 말인 \r\n이 단어 새겨들어 언젠간 너역시도 disrespect에 의한 payback분명 확실히 꼭 \r\n(톡톡히)받게 될테니 a-yo거기 너 faggy \r\n니 어리석었던 행동 이제 no more that's it \r\ncheck this ma lyrical tactic yo! ya betta respect me cause u can't never follow ma infinite rhyme's technic \r\n\r\nchorus \r\nto ma fabolous brotha(respect you) \r\nbe untouchable brotha(respect you) \r\nyou you respect you it's time to get \r\nwreck wit' the 무한류 \r\ngot to be the illest brotha(respect you) \r\nya betta keep it real brotha(respect you) \r\nyou you respect you it's time to get \r\nwreck wit' the 무한류 \r\n\r\nverse2(nuckeub-shaan) \r\n인터넷 단어들이 빚어낸 껍데기만있는 싸움에 굉음에 rapgame에서 지어낸 헛소리는 우리와 상관없네 \r\n옛소리로 이내 곧씹어 내뱉으니 \r\n하나같이 타인을 비판으로 상대해 \r\n뿌리를 보지못하는 너의 맘에게 들리는 napow에 \r\n서로의 의미에 내뱉음에 \r\n배움의 끝은 없어 어리석음에 미움의 눈을 가리게 \r\n마음에 믿음의 문신이 보이게 \r\n네 가치가 바로서게 this is not a same hiphop story가 \r\n결코아닌이상 모조리 \r\n도토리 키재기 하고있는건 아닐까? \r\nthink about it 생각을 가두니 \r\n물에 흐름에 비친 맘은 이미 헛도니 \r\nyo! 그대로 보여질 수 없으리 \r\n서로의 연결고리는 절대 이뤄질 수 없으리 \r\n\r\nvocal hook(Cubic) \r\n믿음에 나의 삶이 있고 그 삶에 진실함이있고 \r\n진실은 당신을 부르고 당신은 내 믿음이 되고 \r\n\r\nchorus x2</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/262/15026262_1421202561930_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130226, lowkey: nil, highkey: nil},
  {album_id: 50, singer_id: nil, team_id: 18, title: "Dialogue (Soulful Experience Mix)", genre1: "가요", genre2: "랩/힙합", runtime: "04:50", lyrics: "\n\t\t\t\t\t\t\t<div>Dialogue (Soulful Experience Mix) - 04:50</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가사 정보가 없습니다.</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/262/15026262_1421202561930_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130227, lowkey: nil, highkey: nil},
  {album_id: 50, singer_id: nil, team_id: 18, title: "Ask For A Truce (Skit)", genre1: "가요", genre2: "랩/힙합", runtime: "00:27", lyrics: "\n\t\t\t\t\t\t\t<div>Ask For A Truce (Skit) - 00:27</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가사 정보가 없습니다.</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/262/15026262_1421202561930_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130228, lowkey: nil, highkey: nil},
  {album_id: 50, singer_id: nil, team_id: 18, title: "Respect 4 Brotha", genre1: "가요", genre2: "랩/힙합", runtime: "05:14", lyrics: "\n\t\t\t\t\t\t\t<div>Respect 4 Brotha - 05:14</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">intro(Leo k'koa) \r\nyeah we comoin' atcha \r\nlive live in directly \r\nurban league peaple we \r\nbrings correctly \r\nrespect 4 brotha yo \r\ndefinitely K to tha O D \r\nto tha broInfinite Flow \r\nand I to tha Z yo \r\nuhhere we go oh \r\n\r\n(6point) \r\n자연스레 어우러진 \r\n친구들과 함께 \r\n서로를 사랑하고 \r\n아끼는 마음아래 \r\n같은 하늘아래 \r\n있음이 분명해 \r\n나이와 성별을 초월한 \r\n서로의 솔직함과 \r\n벽없는 신뢰가 \r\n있기에 내 몸을 \r\n던져 맡길수 있네 \r\n하루가 길다하여 \r\n그리운 존재는 아니지만 \r\n같이 할때만은 행복을 \r\n던져주는 친구들이 있기에 \r\n내가 존재해 \r\n끝없는 하행곡선을 \r\n탄다하여도 \r\n잊어선 안돼 \r\nrespect for brothers \r\n항상 너의 뒤에서 \r\n지켜보면서 너를 위해 \r\n기도하는 형제가 있어 \r\n오로지 혼자란 \r\n생각은 버리고 \r\n언제나 손을 내미는 \r\n형제들의 품속으로 \r\n한길을 걷는 이상 \r\n주위의 눈치를 볼 \r\n필요는 없어 느끼는대로 \r\n형제의 선행에는 \r\n끝없는 박수를 \r\n형제의의 오판엔 \r\n격려의 박수를 \r\n시기와 질투가 아닌 \r\n사랑으로 모두를 대할때 \r\n느껴지는 respect \r\nfor brothers \r\n\r\nsa bi(Leo k'koa) \r\nQuestion the answer \r\nis the wrong road \r\nunravel travel ma soul x3 \r\n우리의 노랜 \r\n사랑으로 만들어졌기에 \r\n또 하나같이 \r\n다 믿음으로 화합했기에 yo \r\n\r\n(Goliath Monsta) \r\nu n i t y로 \r\n하나됨 대신에 주위엔 \r\n아직다 서로 \r\n적으로만 인식해 \r\n이 더러운 rap \r\nscene에 형제의 배신에 \r\n여전히 답답한 \r\n2nd round rap시대 \r\n가식적 악수와 \r\n가식적 만남에 \r\n가식적 박수와 \r\n가진것만 탐내 \r\n가짜는 쏟아지되 \r\n진짜는 잠잠해 \r\n우리 형제들의 미래 \r\n앞이 너무 깜깜해 \r\nDat's why we(we) \r\njoin together yeah\r\nUrban league \r\n형제들로부터 인해서 \r\nnow iz the time 4 \r\nproper propaganda \r\n지금 이 scene의 \r\n상태는 한마디로coma \r\n치유는 형제들의 \r\nmassage로 말미암아 \r\n흘러가는 유행이 \r\n아닌 영원으로 남아 \r\n가슴에 깊이 새겨질 \r\nrespect 4 brotha shit \r\niz real what the deal\r\nthis is not a drama \r\n\r\n(Bae3) \r\n아름다운 세상을 \r\n살아가는 방법 \r\n내 친구들과 \r\n항상곁에서 생각하는것 \r\n형제가 내주위에 있기에 \r\n나에게 그힘을 \r\n나눠주기에 \r\n수많은 잘못과 \r\n깨우침 그덕에 \r\n주위의 조언이 \r\n나를 만들었네 \r\n나를 막아줬네 \r\n우리를 잡아줘 \r\n(wordlove &amp; peace \r\nthat is all we need yo) \r\n시기와 질투는 아니라고 \r\n잘못된 믿음또한 \r\n아니라고 오직 \r\n믿음과 사랑만이 필요하다고 \r\n이둘이 서로에게 \r\n원하는 것이라오 \r\nKOD B three원하는건 \r\n내가믿는 친구들에게 바라는건 \r\nHIPHOP도 음악도 \r\n모든것이 니 가슴속에 있다고 \r\n\r\nsa bi(Leo k'koa) \r\n\r\n(m one) \r\n첫째로 요구되는 \r\n것이 바로 믿음 \r\n조금씩 변해가는 \r\n이 거리의 리듬 \r\n끝없는 배움속에 \r\n가치를 깨달아 \r\n시간이 흐를수록 \r\n깊이는 더해가 \r\n(a yo brotha)느끼는가 \r\n지금이 움직임은 \r\n중심으로 다가가 \r\n수많은 의심속에 \r\n흔들리지 않아\r\n(넌 분명히 답을 알고 있잖아) \r\n지식과 이성으로 \r\n피를 이룬 형제여 \r\n영혼의 언어들로 \r\n피를 나눈 형제여 \r\n너와나 보다는 우리를 느끼니 \r\n비로서 시작되는 \r\n내면의 혁명이 \r\ndat's ma people\r\n(내게 믿음을)\r\n지금이 움직임은 \r\n형제없인 없음을 \r\n거리로 전해지는 \r\n무한의 외침은\r\n(한없는 마음에 끝은 없어) \r\n넋업샨이 전해 \r\n대지의 시로 \r\n(내면을 밝혀주는 \r\n지식의 등불로) \r\n내모든 형제들을 \r\n좀 더 높은 곳으로 \r\n\r\n(nuckeub shaan) \r\n전쟁터라는 이시대에 \r\n뱉음의 가치는 무뎌져가 \r\n그냥 지나쳐버릴건가 \r\n아직도 영혼에 \r\n걸친 옷 들만을 \r\n화려하게 내새운 \r\n거친문장들 \r\n앞을걷는자여 \r\n서로의 의미를 배워내 \r\n네진심으로 \r\n형제를 원한다면 \r\nIt's a beautiful thing \r\n이건마치 부모님의 대물림 \r\n쉽진않지 현재이시대에 \r\n깊게 깊게 들어가 파뭍힌 \r\n(그릇된 움직임) \r\n이젠 잊어버려 서로의 \r\n영혼을 그대로 \r\n느끼는것이 \r\nthat's the right thing \r\nsa bi(Leo k'koa) x2</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/262/15026262_1421202561930_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130229, lowkey: nil, highkey: nil},
  {album_id: 50, singer_id: nil, team_id: 18, title: "Dialogue (Original Ver.)", genre1: "가요", genre2: "랩/힙합", runtime: "04:11", lyrics: "\n\t\t\t\t\t\t\t<div>Dialogue (Original Ver.) - 04:11</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">verse1 \r\nlet's talk about 전혀다른 색감의 소재로 \r\ninfinite flow의 다른 물감으로 칠한 노래로 \r\nyo닫힌 문들에겐 내면의 열쇠로 물음으로 시작해 \r\n네 정해진 답은 없네 \r\nyes or no,해선 안될 것 해답과 결정은 \r\n자신의 양심의 몫 \r\nword, dat't for sure 내게 믿음을 줘 울림으로... \r\n흘려버린 감정은 다른 시각으로 네 편견으로 \r\n쌓여진 오해로 인해 가려진 \r\n불쌍한 나의 가녀린 형제여 눈을 떠야지 \r\n올바로 서는것과,똑바로 걷는 법 \r\n진실과 사실은 꼭 느껴야 하는 것 \r\nI told ya 사는 건 still harder than you thought \r\nJus like Nas says ya betta \r\ngot'ur self a gun this song iz 4 ma brotha\r\n흔들리는 나무 같던 \r\n믿음을 잡아주어 바로 내 옆에서 \r\n\r\nsa-bi \r\nthey know 무엇이 옳고 그른지의 태도 \r\n다만 현실에 벽앞에 무너져 이탈한 괘도 \r\nain't nobody 손을 내밀지 않았다 해도 \r\nwe hope u got yo'head up \r\nso brotha neva give up x2 \r\n\r\nverse2 (넋업샨) \r\n내게 주어지는 가치는 hip 네게 뱉음은 hop \r\n무형의 시험지안에 물음과 답 \r\nhiphop don't stop yo! u know dat word \r\n우리에겐 숙명으로 다가온 또다른 길인 걸 \r\n\r\n(Goliath Monsta) \r\nkeep it dun 이미 넌 이길에 대한 의미도 잊었을꺼란 \r\n의심으로 I'm too worry about'cha son \r\nlet me tell ya some'em\r\n항상 한길만을 고집한 자에게만 \r\n오직 보일 정상의 고지 \r\n\r\n(넋업샨) 정상의 고지에서는 너를 낮춰 \r\n시기보단 열정으로 \r\n자신을 다스려 확신을 만들어 불을 붙여 \r\n주위를 둘러봐 하나되는 걸 관념과 허울은 \r\n망상의 쓰레기통인 걸 \r\n\r\n(Goliath Monsta) satya agraha사랑과 진리가 \r\n힘을 뭉쳐 이룩할 proper propaganda \r\nthis song iz 4 ma brotha흔들리는 나무 같던 \r\n믿음을 잡아줘(infinite flow) 바로 옆에서 \r\n\r\nsa-bi) they know 무엇이 옳고 그른지의 태도 \r\n다만 현실에 벽앞에 무너져 이탈한 괘도\r\nain't nobody 손을 내밀지 않았다 해도 \r\nwe hope u got yo'head up \r\nso brotha neva give up x2</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/262/15026262_1421202561930_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130230, lowkey: nil, highkey: nil},
  {album_id: 50, singer_id: nil, team_id: 18, title: "Dialogue (Original Ver.) (Inst.)", genre1: "가요", genre2: "랩/힙합", runtime: "04:05", lyrics: "\n\t\t\t\t\t\t\t<div>Dialogue (Original Ver.) (Inst.) - 04:05</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가사 정보가 없습니다.</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/262/15026262_1421202561930_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130231, lowkey: nil, highkey: nil},
  {album_id: 50, singer_id: nil, team_id: 18, title: "Respect You (Urban Night Mix) (Inst.)", genre1: "가요", genre2: "랩/힙합", runtime: "03:42", lyrics: "\n\t\t\t\t\t\t\t<div>Respect You (Urban Night Mix) (Inst.) - 03:42</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가사 정보가 없습니다.</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/262/15026262_1421202561930_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130232, lowkey: nil, highkey: nil},
  {album_id: 51, singer_id: 64, team_id: nil, title: "Interude (탯줄)", genre1: "가요", genre2: "랩/힙합", runtime: "01:29", lyrics: "\n\t\t\t\t\t\t\t<div>Interude (탯줄) - 01:29</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가사 정보가 없습니다.</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/263/15026263_1354260776067_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130233, lowkey: nil, highkey: nil},
  {album_id: 51, singer_id: 64, team_id: nil, title: "Lyricist", genre1: "가요", genre2: "랩/힙합", runtime: "03:38", lyrics: "\n\t\t\t\t\t\t\t<div>Lyricist - 03:38</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">(verse1) \r\n\r\n신건의 신들린 flow 진실도 100% lyric 모 아니면 도 식의 rhyme \r\n\r\n이 세 가지로 불규칙적인 공식의 출구가 없는 미로의 문을 열고 들어서 \r\n\r\n비포장도로처럼 걸어가기도 힘들어 새로 개척해 나가는 건 바로 \r\n\r\n이걸 듣는 모든 이의 머리와 가슴에 나의 가사로 \r\n\r\n마법을 걸어slow slow 천천히 야금야금 전염되어 가고 \r\n\r\n하나 둘씩 신건의 참 모습을 알아가고 \r\n\r\n수년간 참아왔던 울분을 이제야 토 해내고 때로는 그로 인해 피해의 쓴맛도 많이 봤고 \r\n\r\n또 많은 것을 깨달았고 겉과 속이 다른 인간과 나는 꾀 달랐고 \r\n\r\n정답은 고 난이도의 내 비유와 은유의 사정권 안에 들어 있어 \r\n\r\n벼락 맞아도 도리를 벗어날 수는 없어 \r\n\r\n(verse2) \r\n\r\n삶으로서 부딪혀 온몸으로 부디껴 \r\n\r\n피부가 느낄 때 비로소 나 펜을 쥐어 \r\n\r\n몸과 마음이 일치했을 때 내 안의 세포들도 만장일치 \r\n\r\n생각이 꿈틀거려 종이와의 마찰이 시작돼 \r\n\r\n자석의 S극과 N극 서로를 빨아들여 \r\n\r\n그땐 마치 최면상태 넋나간 시인 너의 마음을 바꿔놓는 또 하나의 마술인 \r\n\r\n고요함과 동시에 영감들이 몰려와 가슴이 말해주는 충고가 들려와 \r\n\r\n어떠한 유혹들도 내 의지를 방해 할 수 없어 \r\n\r\n어떠한 혼란들도 내 뜻을 거역할 수 없어 \r\n\r\n신이 있다해도 그 역시 나에게 빠져 들테니 \r\n\r\n동감 할테니 진실함이 승자임이 밝혀 질테니 \r\n\r\n절대 두렵지 않다 랩을 토해내는 순간에도 \r\n\r\n(verse3) \r\n\r\n끝없이 반복되는 비트로 인해 비로소 뇌는 발동을 걸어 산전수전에 \r\n\r\n공중전 까치 치러낸 내 눈에는 보여 거짓된 말들 \r\n\r\n여기 저기서 배끼기는 너무나도 쉬워 \r\n\r\n함부로 내 뱉는 무책임한 말들 \r\n\r\n억지로 짜내는 혼이 없는 생각들 \r\n\r\n소용없어 언행불일치 MIC잡을 자격이 없어 \r\n\r\n나 한동안 펜을 놓아야해 하지만 상관없어 난 썩어도 준치 \r\n\r\n돌아와도 챔피언십시리즈 1차전 선발 투수감 문제없어 심장박동의 비트가 뛰는 이상 \r\n\r\n이상할거 하나 없어 맥박이 뛰는 이상 숨을 쉬는 이상 동서남북 어디 있건 나는 존재하니 \r\n\r\n또한 lyric역시 진행될 테니</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/263/15026263_1354260776067_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130234, lowkey: nil, highkey: nil},
  {album_id: 51, singer_id: 64, team_id: nil, title: "Refrgction (굶주림)", genre1: "가요", genre2: "랩/힙합", runtime: "04:05", lyrics: "\n\t\t\t\t\t\t\t<div>Refrgction (굶주림) - 04:05</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">(verse1) \r\n너무나 긴 시간을 나 기다림 속에 보냈던 나 지난 세월들 오랜 무지함에 염증을 느껴 이제 \r\n때가 왔음을 감지한 나 매울 신 그리고 굳셀 건 신건 ~ uh \r\n매서운 총알랩을 이제 장전 더 이상 신건의 탄환은 과녁을 빗나가지 않아 \r\n모든 것을 꿰뚫는 총알탄에 모두들 경탄만 자아내 \r\n내 소중한 침묵은 백보 전진을 위한 한보 후퇴였지 탁월한 start를 끊기 위해 wait \r\n과거를 거울삼아 현실에 강하게 대처해 이제 출발점에 서 엔진에 시동을 걸어 내 모든 걸 걸어 \r\n전력질주 모두와의 정당한 경주 이미 선두와의 격차는 아주 크지만 따라 잡는건 시간문제 \r\n그 후는 백중지세 이제 승부를 판가름 하는건 인내심의 한계 \r\n\r\n(chorus) \r\n동트기 직전이 가장 어둡고 추운 법 하늘이 땀의 위대함을 가르쳐주는 방법 \r\n동트기 직전이 가장 어둡고 추운 법 길고 짧은 건 한번 대봐야 아는 법 \r\n동트기 직전이 가장 어둡고 추운 법 비가 온 뒤에는 항상 땅이 더 굳는 법 \r\n동트기 직전이 가장 어둡고 추운 법 이제는 토해 내네 모든 걸 발산하네 \r\n\r\n(verse2 ) \r\n심장박동으로 인해 만들어지는 자연의 비트를 통해 맘속의 고뇌와 후회 그리고 기대 \r\n한숨을 길게 내 뿜고 등을 벽에 기대 인생의 지도를 펼쳐 놓고 내 길이 어딘지도 찾지 못해 \r\n자화상에 형태만 그려 놓은 채 4B연필을 더 이상 잡지 못해 \r\n나조차 내 생각의 바다의 깊이를 측량하지 못해 \r\n지금껏 날 괴롭혀준 고난과 난관 역경에게 경의를 표해 \r\n정의에 용감했고 부끄러움 없이 당당하게 살아온 랩인생 \r\n처음 시작할 때의 마음가짐을 절대 잃지 말자는 굳은 맹세와 \r\n함께 혼자서 위풍당당 나는 출전 대기중인 돈키호테 \r\n내 눈앞에 겉 멋든 오합지졸의 수는 내 의지의 크기와 비례 \r\n\r\n(verse3 ) \r\n불확실한 힙합 문명에 어느새 모두가 원하는 건 돈과 명예 \r\n난 다시 한번 놀라 비명 5년 동안 무일푼에 무명 \r\n하지만 신경 안 써 난 전형적인 외유내강형 \r\n제길 이건 분명 내 운명 제갈 공명과도 같이 좁은 우물을 나와 난세를 평정해줄 2002년 \r\n시작하기 전 최후의 마음가짐은 진인사대천명 \r\n이 바닥에 태풍의 눈 더 넓은 세계로의 문을 열자마자 \r\n첫술에 배부를 수는 없는 법이지 남이 따 주는 열매는 달지 못하듯이 \r\n내가 갈 길은 비무장 지대 위험 천만 산 넘어 산 진정한 삶을 살 건지 \r\n숨쉬는데 만족할건지 선택할 시간 이제 눈감아 만감이 교차하는 순간 (느낄수 있어) \r\nmicrophon은 이미 내 신체의 일부 신건의 신들린 flow로 지뢰밭을 요리조리 뛰어넘고 \r\n내 랩에 혼을 싫어 넋을 잃게 만들어 일망타진 비로소 굶주림의 한계를 뛰어 넘어 \r\n\r\n(chorus) \r\n동트기 직전이 가장 어둡고 추운 법 하늘이 땀의 위대함을 가르쳐주는 방법 \r\n동트기 직전이 가장 어둡고 추운 법 길고 짧은 건 한번 대봐야 아는 법 \r\n동트기 직전이 가장 어둡고 추운 법 비가 온 뒤에는 항상 땅이 더 굳는 법 \r\n동트기 직전이 가장 어둡고 추운 법 이제는 토해 내네 모든 걸 발산하네</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/263/15026263_1354260776067_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130235, lowkey: nil, highkey: nil},
  {album_id: 51, singer_id: 64, team_id: nil, title: "정신차려", genre1: "가요", genre2: "랩/힙합", runtime: "04:03", lyrics: "\n\t\t\t\t\t\t\t<div>정신차려 - 04:03</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">(hook) b. o. n. double g. a. p. a.k.a mc 신건의 오른손에 micro phon 이제 내가 장전하면 꼼짝 말고 귀를 열어 \r\n\r\n(verse1) \r\n마음씨 좋은 MC신건의 눈살을 찌푸리게 만드는 행동들을 보게 \r\nMIC는 너의 노리개가 아니야 가만히 두고 보자 하니 해도 너무해 \r\n하늘 높은 줄 모르고 기어올라가네 시작과 동시에 대두가 되 버려 \r\n씌워줄 수 있는 왕관이 모자랄 정도네 이제는 깨끗이 정돈해 \r\n제발 정신 차리게 아직도 이해 못해 모두 다 똑같애 \r\n어설픈 흉내는 통하지 않아 결과는 안 봐도 뻔하지 않아 \r\n서로 짖어대고 으르렁대고 아무런 가책도 없이 너무 쉽게 헐뜯는 \r\n상황이 돼버린 힙합의 도로 지금껏 쌓아 놓은 탑이 도로아비타불 \r\n이 되 버릴 위기이기에 이 기회에 똑바로 바로잡아 \r\n신건의 신들린 FLOW로 겸손함을 잃지 안는 MC로 인도 \r\n\r\n(chorus)*2 \r\n정신차려 영웅이 되기보단 충실한 모습으로 걸어가길 \r\n정신차려 출구가 없는 미로 절대 변함 없는 마음으로 해쳐 가길 \r\n\r\n(verse2) \r\nHey! 거기 땅 집고 헤엄치는 풋내기 자격 없는 Sucker Micro Phone Checker \r\n이제 잡고있는 마이크를 그만 내려놓아 HIPHOP의 단맛에 것 멋에 푹 빠져 \r\n니가 써댄 가사의 잉크가 마르기도 전에 그 뜻을 그르쳐 기고 만장해 자신과의 약속을 어겨 \r\n그런 정신으로 코트를 누비며 하늘을 나는 KOBE를 바라고 있었으니 코스비 가족도 비웃을 이야기 \r\n언제나 노코멘트로 일관해도 부정할 수 없어 허영에 가득 찬 코 흘리게 꼬마 MC \r\n하루빨리 깨달아 철 좀 들어 집에 가서 엄마 젖 좀 더 먹고 있어 \r\n달려오는 황소 앞에서 빨간 MICROPHONE을 쥐고 대적할 수 있을 용기가 생길 때 그때까지 \r\n\r\n(chorus) \r\n\r\n(verse3) \r\n순항하던 함대 폭풍을 만나 뒤섞여버린 물과 기름으로 난장판 \r\n함부로 너도나도 이판사판 눈뜨고 보기 싫을 정도로 개판 \r\n한배에 사공이 너무나도 많고 올라타려 하는 사람은 넘치고 \r\n모두가 4번 타자만을 원하고 감독은 뒷짐지고 관중은 부추기고있으니 해결될 리 없고 \r\n고래들의 세력다툼 새우등은 남아나질 않고 내 코 역시 석자 \r\n험담꾼이나 어느새 금도끼만을 원하는 나무꾼이나 \r\n내가 보기에는 모두 도토리 키 재기 쓰러져 가는 힙합의 성지 \r\n이제 정신차리고 똑바로 해야지 각자 자기포지션에서 최선을 \r\n욕심은 버리고 six man or 1Point 릴리프 라도 \r\n\r\n(chorus)*2 \r\n정신차려 영웅이 되기보단 충실한 모습으로 걸어가길 \r\n정신차려 출구가 없는 미로 절대 변함 없는 마음으로 해쳐 가길 \r\n\r\n(verse4) \r\n영웅이 되기보다는 충실한 모습으로 출구가 없는 미로 선택의 기로 열쇠는 신건의 신들린 FLOW \r\nMC라면 무대위로 올라와 모든걸 토 해내고 내 rap으로 마법을 걸어 니마음을 흔들어 \r\n로봇이 아니라면 자비를 베풀어 혼자 \r\n자고로 서로 맞든 백지장이 가볍다는 걸 명심하고 \r\n각자가 내뱉는 힙합론 기억해 정답은 절대로 하나가 아니라고..</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/263/15026263_1354260776067_1_600x600.JPG", jacket_middle: nil, 