  {album_id: 51, singer_id: 64, team_id: nil, title: "'ㄱ'해", genre1: "가요", genre2: "랩/힙합", runtime: "04:20", lyrics: "\n\t\t\t\t\t\t\t<div>'ㄱ'해 - 04:20</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">(verse1) \r\n1998년 4월 25일 신촌역 8번 출구를 나온 세 친구 \r\n나 신건 함께한 deegie와 vinnie 팀명은 riota \r\n우리가 도모했던 작은 폭동은 시작 됐고 설레는 가슴 안고 첫 발 디딘 지하세계 \r\nclub master plan 이곳은 세상과는 또 다른 놀라운 세계 \r\n헤리포터가 호그와트를 처음 보았을 때 기분이 그랬겠지 \r\n헬리콥터의 프로펠라 만큼이나 빨리 뛰기 시작한 내 심장박동 수는 멈출 줄 모르고 \r\n또 어디를 봐도 모두 우리 같은 족속 놀라움을 금치 못해 모두들 훌륭한 랩꾼 \r\n무대 위에 올라 내 꿈을 펼치기 시작했고 이때부터 내 인생은 180도 바뀌기 시작했어 \r\n\r\n(verse2) \r\n끝없는 비트 루핑 위에 랩 서핑 순식간에 무아지경으로 빠져들고 \r\n때로는 환희와 슬픔이 교차 서로의 마음간의 격차의 차이는 커져만 가고 \r\n새로운 시작 cb mass를 잠시 거쳐 불투명했던 나의 거처 \r\n다시 deegie와의 의기투합 작은 전설로 남아있는 pdpd로의 순항 끝에 또 난항 \r\n하지만 주위에는 천군만마와도 같은 형제들 당시 공포의 외인구단 822는 안식처로 틀림없었지만 \r\n때로는 나에게는 참을 수 없는 자극과 연극 결국에는 대립할 수밖에 없는 극과 극 \r\n나락으로 떨어질 수밖에 없는 비극 내 랩 인생은 믿을 수 없는 연속극의 연속 고개 연속의 끝 \r\n\r\n(chorus) \r\n열 손가락 모두 깨물어 달라는 아이들의 성화로 상처받은 어미의 심정 \r\n미처 다 못 깨물어 떡 하나 더 받지 못해 서운해하는 아이의 표정 \r\n못다 이룬 형제간에 우애와 우정 마침표를 찍기까지의 기나긴 여정 \r\n가장 소중했던 추억에 취해 부려보는 주정 이제 떠나야 하는 이의 마지막 투정 \r\n\r\n(verse3) \r\n강산이 반쯤은 변해버린 지금 시점에서 나에겐 시작과 끝 only 지하club \r\n만신창이가 될 정도의 펑고를 모두 받아낸 허름한 glove \r\n알게 모르게 진행됐던 차별과 불리한 조건 어디서 굴러 \r\n먹다온 개뼉다구 까지도 어이없는 가호와 거만 아예 글러 \r\n먹은 싹수가 노랗다 못해 누런 걷잡을 수 없는 \r\n균열과 파열음 끝없는 잡음 속에서도 겉으론 one luv \r\n안타까움에 내 가슴은 타 들어갔고 이미 늦어버렸나 엎질러진 glass \r\ntop class를 향한 끝없는 전투 내 눈에는 본질을 잊어버린 망나니 난투 \r\n욕망을 누르지 못해 제멋에 취해버려 몰락한 동탁과 여포 \r\n\r\n(verse4) \r\n마이크로폰 독주자로부터의 운들 그사이에 일어난 100000000km의 필름의 상영 \r\n누가 뭐래도 현재의 힙합씬을 낳아버린 산모 나를 뻑 가게 만든 그녀와 결혼해버린 내게는 장모 \r\n사람이라는 존재의 어찌할 수 없는 어리석음의 잔재 있을 때 못 느끼고 비로소 멸한 뒤에야 \r\n알게되는 소중함과 성공의 과정을 잊어버리는 나쁜 습관 고치지 못해 왜 \r\n알면서도 바꾸지 못해 왜 바보 같이 단단한 자존심은 백두산천지 보다 훨씬 더 높고 \r\n뭉쳐버린 똥 고집은 동해의 바닥 보다 더 깊이 박혀있고 \r\n성지가 난지가 될 때까지 시끌벅적 서로 책임회피뿐 기억하겠어 \r\n\r\n(chorus) \r\n열 손가락 모두 깨물어 달라는 아이들의 성화로 상처받은 어미의 심정 \r\n미처 다 못 깨물어 떡 하나 더 받지 못해 서운해하는 아이의 표정 \r\n못다 이룬 형제간에 우애와 우정 마침표를 찍기까지의 기나긴 여정 \r\n가장 소중했던 추억에 취해 부려보는 주정 이제 떠나야 하는 이의 마지막 투정</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/263/15026263_1354260776067_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130237, lowkey: nil, highkey: nil},
  {album_id: 51, singer_id: 64, team_id: nil, title: "발자국 (Feat. Da Track)", genre1: "가요", genre2: "랩/힙합", runtime: "04:48", lyrics: "\n\t\t\t\t\t\t\t<div>발자국 (Feat. Da Track) - 04:48</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">신건&gt; Microphone Check one 한반도의 지붕 개마고원 보다 높은 우리들의 소원(so what) open the door 이제 힙합의 문을 열어 신구의 hiphop人을 구원하기 위한 track의 초원 위에서 맘껏 달려 hiphop水를 들이부어 가만히 누워 기다린다면 아무도 너의 손을 잡아 주지 않아 눈을 떠 귀를 열어 먹구름을 걷어 잘라 말하면 이미 차원이 달라 신구의 역사를 알리는 신호를 터트리려는 찰라 Number one TRACK의 꺼지지 않는 불꽃은 이미 점화 누구도 두 번 다시 재현할 수 없는 신화 無 와 有는 종이 한 장 차이 백지장을 맞든 우리 Mic Controller 辛健이 불러 합친 hiphop전도사들과 함께 길이 남을 발자국을 남겨. \r\n\r\n(chorus) \r\n한 손의 마이크(mic) 힙합의 마인드(mind) mic로 보여주는 판토마임 \r\n진실한 리릭(lyric) 환상의 라임(rhyme) T.R.A.C.K THE TRACK... \r\n\r\nBK&gt; T.R.A.C.K the track 과 함께 젊음이란 시침과 이루기 힘든 꿈이라는 분침 한줌의 불씨. 뿌리를 내리고 싹을 틔운지도 트랙人인으로의 궤도 속으로. 힙합의 지도 위에 내 삶의 여정을 인도. 천년이 두번 지나가도 전력질주의 가속도로 랩핑이랑 버스 타고 힙합이란 집으로 모두같이 Let's go!! \r\n\r\nReal.K&gt; 1980부터 현재의 2002년까지 힙합의 발자국을 찾아온 마이크 컨트롤러 real k가 불러대는 real flow와 함께 라임 파도를 타며 손을 들어. 머리위로. 신건의 가슴부터 T TO DA K까지 연결된 NON-STOP의 탄탄 대로를 타고 hiphop의 의미심장한 무릉도원에 빠져.심장박동 최대치 울리는 비트가 될 때까지 PLAY ON. \r\n\r\n\r\n마진&gt; 여기 힙합의 정해진 의미를 개척할 마인드 랩만 잘하면 모두가 만만히 보는 힙합의 단맛 이제 트랙이 전할 메세지를 들어볼 시간 이 순간만큼은 마인드 컨트롤이 없는 공간 힙합이좋고 合이 좋으면 TOP이될수있지 그래서 이제 트랙의 커서를 다시 움직여 우리가 개항하는 우리의 희망 드디어 대망의 시작을 알리는 벨이 울리는 시간. \r\n\r\nEv&gt; 그래 하여간 M.I.C Check 1,2 처음 시작했던 그 마음 절대 변치 않을 꺼라 믿던 \r\n그 믿음 어디서 부터 언제 부터 변해 왔지? 깨닫지 못한 다음... \r\n그 다음 부터 So mothefucker!! 비트속의 한음한음 깨져만 갈수록 커져만 가는 \r\n고뇌속 괴로움.. yo! 두 번 다시 찾지 못할 진정 나 다운 삶 \r\n\r\n(chorus) \r\n한 손의 마이크(mic) 힙합의 마인드(mind) mic로 보여주는 판토마임 \r\n진실한 리릭(lyric) 환상의 라임(rhyme) T.R.A.C.K THE TRACK... \r\n\r\n동운&gt;한걸음 띄고 그리고 또 한걸음을 띄고 힘겹게 내딜 때 마다 느껴지는 깨달음 \r\n내게 힙합이란 한여름 모래사막에서 맛볼수 있는 시원한 한조각의 얼음 \r\n내게 MIC란 S.E.X에서 절대 느낄수 없는 극적 희열에 오르가즘 \r\n가슴가득 채운(아픔) 세상(고민)과 시름이 합합 정진을 위한 나만의 밑거름 \r\n\r\nYELLO&gt; 신구 힙합의 시발점이 되기 위해 힙합의 의미를 이해 시키기 위해 위해 되는 음악에서 탈출시키기 위해 오늘도 난 어김없이 이 무대 위에 입에서 터져나오는 랩에 온 몸을 바쳐 나의 8마디 흔적에 너흰 모두 갇혀 쿵짝 한 마디에 나의 삶을 논하려 트랙인이 되어 기여하는 내게 모두맞춰. \r\n\r\n자건&gt;힙합천하인의 최초의 단합 그 여세를 몰아 (모두같이) 입을 모아 \r\n\"T\" to da murder fuckin \"K\" yo! da track's mic (all right) Like that! \r\nuh~ 신건 n 자건 그 중에 나 자건으로부터 읊어지는 메아리 속으로 니네 고막을 땡겨 (들어) 나쁠건 하나도 없어 모든 건 다시 yes yes all.. (oH~ yes yes all~) \r\n\r\n(chorus) \r\n한 손의 마이크(mic) 힙합의 마인드(mind) mic로 보여주는 판토마임 \r\n진실한 리릭(lyric) 환상의 라임(rhyme) T.R.A.C.K THE TRACK...</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/263/15026263_1354260776067_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130238, lowkey: nil, highkey: nil},
  {album_id: 51, singer_id: 64, team_id: nil, title: "會者定離 (회자정리)", genre1: "가요", genre2: "랩/힙합", runtime: "04:19", lyrics: "\n\t\t\t\t\t\t\t<div>會者定離 (회자정리) - 04:19</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">(verse1) \r\n만남과 헤어짐은 실과 바늘 같이 시작과 끝과 같이 어떤 걸로도 대신할 수 없는 가치 \r\n좃 같지만 불가항력적인 것이기에 그 무엇도 탓 할수는 없지 만남과 동시에 결정되는 이별 \r\n칼루이스 보다도 빠른 세월 앞에 마이크타이슨도 당해낼 수 없어 \r\n세상 어디서도 예외란 없고 그 누구도 피해갈 수 없어 받아들일 수밖에 \r\n나도 절대로 인정하고 싶지 않았고 받아들이기까지는 말할 수 없는 고통과 고뇌의 시간을 미리 치러야 했고 수많은 방황과 허무함 속의 바다 속에서 허우적대고 \r\n어차피 측량 할 수도 없을 만큼의 깊이 인정하지 못하고 기피 \r\n언젠가는 이 세상 모든 것과 헤어져야 한다는 걸 마음 한구석에 다 처박아 두고 살아가지 \r\n세상 모든 사람들이 \r\n\r\n(chorus) \r\n만남이란 이별이라는 크나큰 벌에 대한 보상인가 봐 \r\n이별이란 만남이라는 크나큰 선물에 대한 대가인가 봐 \r\n\r\n(verse2) \r\n현실으로 부터의 도피 입에 문 담배 한 개피 \r\n운명을 받아들이기까지의 어려움 이제껏 살아온 인생에 있어 \r\n셀 수 없을 만큼 끊임없이 반복되는 만남과 이별 만나고 해어지고 또 만나면 해어지고 \r\n때로는 의미 없는 만남으로 시작해 가슴이 찢어지는 이별로 변하고 \r\n가끔은 절실했던 만남이 의미 없는 이별로 변하고 \r\n세상이치는 이치로도 예상할 수 없는 매덕스의 변화구 \r\n비상구를 찾지 못해 초조해 또다시 악송구를 범하고 \r\n감당할 수 없는 혼란 속의 미로 \r\n견디지 못하다가 악을 쓰고 울고불고 매달려도 변하는 건 하나도 없어 \r\n마음속의 정이 고갈 된 사람은 절대로 죽기 직전까지 이해 못해 \r\n\r\n(chorus) \r\n만남이란 이별이라는 크나큰 벌에 대한 보상인가 봐 \r\n이별이란 만남이라는 크나큰 선물에 대한 대가인가 봐 \r\n\r\n(verse3) \r\n운명이란 게 절대 뜻대로 되지도 않고 인연이란 게 참 웃기지도 않아 \r\n영원히 변치 않을 거라 여겼던 당연시했던 철없던 \r\n멈출 수 없는 직선의 인생을 원이 되길 바랬던 어린 시절 \r\n배 고픈거 외에는 걱정 없이 뛰어 놀았던 놀이터 \r\n뒤를 돌아보내 어느새 22m 거짓말같이 그어 져있어 \r\n지금 가장 가지고 싶은 것은 고무 지우개 딱 10m만 지우게 \r\n지나간 소중했던 시간들을 빠짐없이 기억 해두게 \r\n정해진 하늘의 순리를 한번쯤 배신 해보게 \r\n두 번 다시 돌이킬 수 없는 길이니 후회 없기를 \r\n빈손으로 출발해 빈손으로 돌아오는 여행이 였음을 \r\n매순간순간을 감사하는 마음을 잊지 않기를 \r\n\r\n(chorus) \r\n만남이란 이별이라는 크나큰 벌에 대한 보상인가 봐 \r\n이별이란 만남이라는 크나큰 선물에 대한 대가인가 봐 \r\n\r\n(hook)*2 \r\n생과 사 사랑과 우정 믿음과 배신 \r\n그 속에 담긴 회자 정리의 원리</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/263/15026263_1354260776067_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130239, lowkey: nil, highkey: nil},
