  {album_id: 51, singer_id: 64, team_id: nil, title: "바밤밤바! (Babaambaamba!)", genre1: "가요", genre2: "랩/힙합", runtime: "04:00", lyrics: "\n\t\t\t\t\t\t\t<div>바밤밤바! (Babaambaamba!) - 04:00</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">(intro) \r\n(R) \r\nyeah~ I'm the man RedRoc \r\nwe came to drop the bomb \r\non your head right here \r\nb-boy &amp; b-girl 귀를 귀울여 Party를 \r\n원한다면 원을 만들어 \r\n신건 &amp; Mister V 특별한 만남 \r\nWho am I? R.E.D (-Roc) that's right \r\nthree MC &amp; NO DJ \r\nMy sprit with DJ WRECKX \r\n\r\n(verse1) \r\n(S) \r\n언행불일치 내 눈 속으로 비친 욕심쟁이들의 \r\n계산된 적과의 동침 \r\n(V) \r\n언약불일치 내 가슴속으로 비친 아첨꾼들의 \r\n속보인 간지러운 속삭임 \r\n(S) \r\n여섯 전사의 단호한 결의 모두 물거품 \r\n굳게 믿고 있었지 내 곁에 있는 천군만마 \r\n(V) \r\n아니 만군억마 가슴이 느끼기에는 억군조마 \r\n우리가 탄 마차를 이끌었던 적토마 \r\n너무나 든든한 나머지 따뜻한 품속에서 \r\n태어난 변칙 FLOW \r\n하지만 날이 갈수록 더해지는 아의 의지와는 \r\n상관없이 생겨났던 일들 \r\n(S) \r\n계속된 fumble 시작부터 무인도에 묶이면 \r\n승패가 뻔한 부르마블 \r\n결국 손에 쥐어진건 이스탄불 대가는 \r\n물에 젖은 솜이불 \r\n오~ 나무아미타불 \r\n\r\n(chorus) \r\n(R) \r\nIf wan't a party? put ya'll put \r\nya'll hands up hands up \r\nIf wan't a party? put ya'll put \r\nya'll hands up hands up \r\nIf wan't a party? come shake \r\nya'll body \r\nIf wan't a party? put ya'll put \r\nya'll hands up hands up \r\n\r\n(verse2) \r\n(V) \r\n사람은 사람처럼 짐승은 짐승처럼 \r\n도움이 안된다면 미친개처럼 \r\n그것을 바라보자니 내마음 무척이나 더덤 \r\n(덤디리덤 디리덤덤) \r\n(S) \r\n지금 니가 파고 있는 건 니 무덤 수단과 \r\n방법 가리지 않고 \r\n반칙과 무지를 남용하고도 태연 구멍남 \r\n콘돔 만큼이나 위험 \r\n(V) \r\n이것보게 신건(웅) 내가 너에게 묻는건 \r\n사람과 사람 사이의 도리에 대해서야 \r\n(R) \r\n설마 그놈에 대해서? \r\n(S) \r\n아~ 신중해 그러면 우리입이 더러워 질지도 몰라 \r\n(V) \r\n그건 상관 없으니 이제 니 생각을 얘기해봐 \r\n(S) \r\n그래.. yo!yo! 흠 yo! 내말좀 들어봐봐 \r\n문제는 이거잖아 \r\n사람의 가치와 이용가치를 혼돈하는\r\n 바보 멍텅구리 구리구리 젠장 \r\n얼굴이 생각나 토할것만 같아 \r\n상욱하 휴지통좀 가져와봐 \r\n(V) \r\n그건 곤란해 넘쳐버릴지도 몰라 \r\n니맘 다알아 우리 모두 마찬가지잖아 \r\n이제 진저리가나 너! \r\n(ALL) \r\n사람대접 받으려면 알아서 기어 \r\n(R) \r\none two three to da four \r\n사람을 점수 메기니 나는 몇점 Gimmie some mo \r\ntwo three four to da five \r\n너 무슨 띠니 같은 띠 잖아 이러지마 \r\n생일좀 빠르다고 제발 그러지좀마 \r\nthree four five to da six \r\nwho's that? doller doller bill to da \r\n\r\n(chorus) \r\n(R) \r\nIf wan't a party? put ya'll put \r\nya'll hands up hands up \r\nIf wan't a party? put ya'll put \r\nya'll hands up hands up \r\nIf wan't a party? come shake \r\nya'll body \r\nIf wan't a party? put ya'll put \r\nya'll hands up hands up \r\n\r\n(verse3) \r\n(S) \r\n누가 니 속을 알아 \r\n(V) \r\n니가 속을 꺼내기 전까진 누가 널 알아 \r\n(S) \r\n세상을 너맘대로 이용하려면 \r\n(V) \r\n그전에 적을 알아 \r\n(S) \r\n니가 지금 까지 올라온게 누구 덕인지 알아? \r\n바로 도날드덕~  \r\n도덕점수 0점 잔머리는 100점 \r\n하지만 든든한 너의 방패는 영원하지 않아 \r\n달면 (꿀꺽) 삼키고 쓰면 (냉큼) 뱉는 \r\n더러운 이중 인격자 \r\n날이 갈수록 너의 안티는 눈에 띄게 불어나~ \r\n(V) \r\n이제는 뿔뿔이 흩어진 사람들이 \r\n제각자 두손을 들고 거리를 누비니 \r\n점점 없어져가는 앤돌핀 그들이 \r\n누굴 헐뜻든 나와는 상관없지 \r\n더 이상 나를 괴롭히지 말게나 \r\n내 가슴속에 수북히 쌓인 사건들의 \r\n기억은 수증기로 타올라 \r\n아 갈증난다 먹고 싶다 바밤바~ \r\n(ALL) \r\n아! 입아프다 그만하자 빠밤빰~</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/263/15026263_1354260776067_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130241, lowkey: nil, highkey: nil},
  {album_id: 51, singer_id: 64, team_id: nil, title: "Lyricist (Inst.)", genre1: "가요", genre2: "랩/힙합", runtime: "03:39", lyrics: "\n\t\t\t\t\t\t\t<div>Lyricist (Inst.) - 03:39</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가사 정보가 없습니다.</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/263/15026263_1354260776067_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130242, lowkey: nil, highkey: nil},
  {album_id: 51, singer_id: 64, team_id: nil, title: "Clock Wise (Live)", genre1: "가요", genre2: "랩/힙합", runtime: "04:13", lyrics: "\n\t\t\t\t\t\t\t<div>Clock Wise (Live) - 04:13</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">약 이만육천팔백일동안의 나날 우리에게 주어진 전부임을 아나 \r\n지금 남의 얘기하고 있는건지 아나 지금껏 걸어온 길을 한번 돌아봐봐 \r\n\r\n[singun] \r\n일초 일초가 모여 60초 60초는 일분 \r\n일분 일분이 모여 60분 60분은 한시간 \r\n한시간이 24번이면 하루 하루를 365번 맞이하면 일년 \r\n일년이 일년이 백 번이 될 때까지 그때까지 \r\n눈을 뜰 수 있는가 남의 일이라 생각하나 언제까지 이팔청춘 일 꺼라 생각하나 \r\n화살같이 꼿히는 우리의 인생사 소중한 시간을 무의미하게 먼지 날리듯 \r\n아무 생각 없이 낭비하고 있진 않는가 하루를 소비하는 건 세계제일의 사치일수 있어 \r\n시간은 금이라지 사실은 금 따위와는 비교자체가 불가능할 정도의 신의 고귀한 선물 \r\n우리가 아무렇지도 않듯이 흘려보내는 오늘은 어제 눈을 감은 이가 그토록 갈망하던 내일 \r\n\r\n약 이만육천팔백일동안의 나날 우리에게 주어진 전부임을 아나 \r\n지금 남의 얘기하고 있는건지 아나 지금껏 걸어온 길을 한번 돌아봐봐 \r\n\r\n[miniman] \r\nMicrophone Check one 내 말 들어 신건 시간이 중요한 건 누구나 아는걸 \r\n허나 어차피 언젠간 먼 곳으로 돌아갈 수 밖엔 없는 우리네 인생 \r\n죽기 전에 무엇인가 남기자는 말 말도 되지 않아 yo! 웃기지도 않아 \r\n누굴 위해 내가 무얼 남겨야만 하나 부와 권력과 명예 따윈 죽음 뒤엔 없네 \r\n내일이 너에게는 마지막이 될 수도 있으니 시간을 아끼라는 건 \r\n애초부터 앞뒤가 맞지 않는 말인걸 세상의 종말이 내일이라면 \r\n썩을 사과나무보단 차라리 창녀촌으로 남은 시간 그저 내가 꿀리는 대로 \r\n마구 펑펑 써버린다 해도 끝은 뻔할 뻔 방법이 달라도 마지막엔 원점 \r\n\r\n약 이만육천팔백일동안의 나날 우리에게 주어진 전부임을 아나 \r\n지금 남의 얘기하고 있는 건지 아나 지금껏 걸어온 길을 한번 돌아 봐봐 \r\n\r\n[singun] \r\n인생의 규칙은 정해져 있지 않아 yo! Miniman 생각해봐 심판은 자신이야 판단은 자기 몫이야 자신이 만족한다면 그거면 니 삶을 지키기 위해 이를 갈아 \r\n[miniman] \r\nok.내 갈길은 내가 갈고 닦아서 내 빛으로 비추어 내 어두운 미래 앞으로 \r\n[singun] \r\n100%에 도달 해야해 탄탄대로를 만들어 나갈 프로그램을 짜놓아 우리는 프로인생사잖아 \r\n[miniman] \r\n정해놓은 너의 시계 방향대로 방황말고 앞으로 그저 니가 원하는 만큼 나아가 \r\n니 눈앞에 놓여있는 모든 사물들이 전부 너의 소유가 될 수 있음을 \r\n[singun] \r\n훗날 한줌의 재가 될 때 까지 일분일초에 최선을 다해 많은 시간이 지나간 후에 \r\n돌아 봤을 때 후회하지 않기를 모두에게 기를... 초가 다 탈 때까지 \r\n\r\n약 이만육천팔백일동안의 나날 우리에게 주어진 전부임을 아나 \r\n지금 남의 얘기하고 있는건지 아나 지금껏 걸어온 길을 한번 돌아봐봐</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/263/15026263_1354260776067_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130243, lowkey: nil, highkey: nil},
  {album_id: 52, singer_id: 65, team_id: nil, title: "Moment", genre1: "가요", genre2: "전체", runtime: "04:16", lyrics: "\n\t\t\t\t\t\t\t<div>Moment - 04:16</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">울지 말아요 내 사랑아. 더 많은 시간이 있으니까 \n아주 조금만 이대로 내 곁에 있어요. 내가 기억할 수 있게 \n말하지 않아도 나는 알아요. 우린 항상 그래 왔으니까 \n사랑하는 만큼 그대가 행복하다면 나 기꺼이 그대를 보내요 \n약속해요. 언젠가는 돌아올 거라고 나 없이도 행복할 거라고 \n오랜 시간 동안 힘들어하는 그대를 더 이상 볼 수가 없네요 \n\n말하지 않아도 나는 알아요. 우린 항상 그래 왔으니까 \n사랑하는 만큼 그대가 행복하다면 나 기꺼이 그대를 보내요 \n약속해요. 언젠가는 돌아올 거라고 나 없이도 행복할 거라고 \n오랜 시간 동안 힘들어하는 그대를 더 이상 볼 수가 \n\n미안해요. 그대를 지켜줄 수가 없네요 \n이렇게 또 그대를 울리네요 \n모든 걸 버리고 다시 만난 그대를 또 보내야만 해요 \n\n약속해요 \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/264/15026264_1408677389563_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130244, lowkey: nil, highkey: nil},
  {album_id: 52, singer_id: 65, team_id: nil, title: "Too sexy", genre1: "가요", genre2: "전체", runtime: "04:08", lyrics: "\n\t\t\t\t\t\t\t<div>Too sexy - 04:08</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가사 정보가 없습니다.</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/264/15026264_1408677389563_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130245, lowkey: nil, highkey: nil},
  {album_id: 52, singer_id: 65, team_id: nil, title: "멈출수만 있다면", genre1: "가요", genre2: "전체", runtime: "03:56", lyrics: "\n\t\t\t\t\t\t\t<div>멈출수만 있다면 - 03:56</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">멈출 수만 있다면\n그만둘래 너 하나만 바라 보는 일\n해도해도 끝이 없는 이 부질없는 일\n사랑인지 집착인지 그대만 보면\n잡고 싶어 가두고 싶어 나만 볼 수 있게\n제발 날 한번만 바라봐줘\n내가 숨 쉴수 있게 쓰러져가는 나를 잡아줘\nPlease take my love\n내 사랑을 끝낼 수 있다면\n내게서 널 지울 수 있다면\n어떻게든 널 내게 데려올 수 있다면\n살 수 있을텐데\n너무 진한 내 모습을 지켜보는 일\n애를 써도 내 마음대로 되지 않는 일\n노력하고 또 다짐해도 그대만 보면\n갖고 싶어 느끼고 싶어 다시 볼 수 없어도\n멈출 수만 있다면\n\n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/264/15026264_1408677389563_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130246, lowkey: nil, highkey: nil},
  {album_id: 52, singer_id: 65, team_id: nil, title: "우린 끝났어", genre1: "가요", genre2: "전체", runtime: "04:08", lyrics: "\n\t\t\t\t\t\t\t<div>우린 끝났어 - 04:08</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">이리 와서 내 곁에 좀 앉아 있어봐\n자꾸 내 마음을 피하려고 하지만 말고\n차마 털어놓지 못한 말들 다 얘기해봐\n너의 뜻대로 무슨 말이든 들어줄테니\n그말만은 제발 하지 않기를 바랬었는데 \n내가 생각한게 틀리길 \n이미 끝났어 그래 너의 말처럼\n함께 지낸 시간따윈 중요하지 않아\n이젠 다 마음이 떠났으니\n니가 아니라도 많이 지쳐있는 날 버려둔채\n\n일어서지 마 나를 봐 나를 보라고\n어떤 말로도 널 잡으려고 하지 않을테니\n잡을 수 더는 잡아서도 안된다는 말\n나도 그러지 않아도 \n\n저 문을 나서면 다 잊을 수 있게\n더 비참하게\n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/264/15026264_1408677389563_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130247, lowkey: nil, highkey: nil},
  {album_id: 52, singer_id: 65, team_id: nil, title: "Never mind", genre1: "가요", genre2: "전체", runtime: "03:54", lyrics: "\n\t\t\t\t\t\t\t<div>Never mind - 03:54</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가사 정보가 없습니다.</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/264/15026264_1408677389563_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130248, lowkey: nil, highkey: nil},
  {album_id: 52, singer_id: 65, team_id: nil, title: "너를 위해", genre1: "가요", genre2: "전체", runtime: "04:02", lyrics: "\n\t\t\t\t\t\t\t<div>너를 위해 - 04:02</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">믿어줘 너를 위해 내가 했던 모진말들을\n다시 돌아가 더 늦기 전에 널 사랑하기 전에...\n내 자신도 주체 할수 없는 날 너의 곁에 두려하지\n마\n네 사랑이 더는 다치지 않게 다시는 돌아보지마\n나의 눈물이 헛되지 않도록 이대로 나를 떠나서 \n행복하길 바래\n너의 사랑이 더는 아프지 않게 나같은건 잊어버려\n너에게는 모두 짐이 될 뿐야 내게 있는 모든 것들\n이\n난 또다시 힘든 세상 속으로 잔인한 햇살속으로...\n나의 눈물이 헛 되지 않도록 이대로 나를 떠나서 \n행복하길 바래\n너의 사랑이 더는 아프지 않게 나 같은 건 잊어 버\n려\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/264/15026264_1408677389563_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130249, lowkey: nil, highkey: nil},
  {album_id: 52, singer_id: 65, team_id: nil, title: "Astro", genre1: "가요", genre2: "전체", runtime: "04:12", lyrics: "\n\t\t\t\t\t\t\t<div>Astro - 04:12</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">멀고먼 하늘 깊은 어둠 속에서 홀로 부르는 \n슬픈 melody 이제는 함께 할 수 없을 것 같아 \n여기서 이대로 잠들 테니 이세상 모든 것 \n사라진다해도 우리 약속은 남아 있는걸 서로가 \n같은 별을 보고 있다면 우리는 이렇게 가까이\n있는 거라고 너를 사랑해 언제까지나\n어디에서라도 조금 먼곳에 있다해도 널 지켜줄게 \n저 높은 곳에 작은 별이 되어 내가 없어도 \n행복하길 바라며 우리 함께했던 밤하늘 그위로 \n눈부시던 별들의 hamorny 서로가 같은 별을 \n보고 있다면 우리는 언제나 가까이 있는 거라고\n\n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/264/15026264_1408677389563_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130250, lowkey: nil, highkey: nil},
  {album_id: 52, singer_id: 65, team_id: nil, title: "[es cafe]", genre1: "가요", genre2: "전체", runtime: "03:56", lyrics: "\n\t\t\t\t\t\t\t<div>[es cafe] - 03:56</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">\n너의 눈속엔 내가 없는걸 \n길을 잃어 잠시 쉬고 싶을뿐 \n술에 취한 눈빛 내게 던진 너의 미소 \n우린 함께 춤을 추고 있지만 \n나의 맘속엔 네가 없는걸 \n추억속의 그녀가 떠오를뿐 \n운명이라 믿던 그녀가 내게 준것은 \n사랑의 기쁨 그 잔인한 행복 \n\n*사랑이 싶어지면 깊어질수록 \n이별의 아픔만 커져 가는 것 \n이밤이 깊어 가면 깊어갈수록 \n외로움만 더해져 가는 것 \n\n그 누굴 찾아 여기 왔는지 \n내 곁에서 잠들어 버린 너는 \n흔들리는 불빛 애처로운 너의 모습 \n따스한 체온 그 차디찬 숨결 \n\n*repeat\n\n오늘 이밤도 지난 추억처럼 사라져 가네 \n\n*repeat x2\n\n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/264/15026264_1408677389563_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130251, lowkey: nil, highkey: nil},
  {album_id: 52, singer_id: 65, team_id: nil, title: "아름다울 수 있을 때까지", genre1: "가요", genre2: "전체", runtime: "04:05", lyrics: "\n\t\t\t\t\t\t\t<div>아름다울 수 있을 때까지 - 04:05</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">돌아선 네 등뒤에 살며시 입맞춤하고 어느새 \n길어지는 그림자 안아도 보고 세상이 바라는 \n대로 이제는 너를 돌려줄게 곁에 두고 싶은 \n욕심만으론 잡을 수 없다는걸 보내줄게 나보다 \n더 익숙했던 그자리로 모두가 축복할수 있도록\n기다릴게 마지막 사랑은 내가 될수 있게\n아름다울수 있을 때까지 이제는 마음편히 \n그에게 안길 수 있게 너의 그 사람 또한 여전히 \n행복할 수 있게 바랄수 없는 행복은 모두를 위해 \n접어둔채 늘 기도할게 우리의 사랑 영원으로 \n이어지길\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/264/15026264_1408677389563_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130252, lowkey: nil, highkey: nil},
  {album_id: 52, singer_id: 65, team_id: nil, title: "If you love me still", genre1: "가요", genre2: "전체", runtime: "03:30", lyrics: "\n\t\t\t\t\t\t\t<div>If you love me still - 03:30</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">\nWhy did you come into my life? \nWhen I needed a commitment \nAnd you say you want to leave me now \nTell me what I have done wrong \nDo you even know what love is \nOr do you even care what my love meant to you \nI was always true to you \nNever forget that I gave you \neverything I had and more \n\n*please don't let me down like this \nand Tell me what is that I did wrong to you \nif you want me to(make it up then I surely will) \nIf you love still baby, Pleaselet my love heal\n(Let my love proceed) I don't want you to leave, \ncause think that I don't love you \n\nFor your love I gave up all I had \nbut Never asked the same fron you \nall I asked was for you to be with me \nNow did I ask too much from you? \nI love you for who you are \nI never ever compared \nyou with someone else, did I? \nYou come back to me and see, \nIf I really love you so \nAnd I'll give you all I have and more\n\n*repeatx2\n\n(Why baby why, Let me know right now, \nTell me what I have done wrong) \n\n\n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/264/15026264_1408677389563_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130253, lowkey: nil, highkey: nil},
  {album_id: 52, singer_id: 65, team_id: nil, title: "연인", genre1: "가요", genre2: "전체", runtime: "03:42", lyrics: "\n\t\t\t\t\t\t\t<div>연인 - 03:42</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">연인~~♡\n\n늘 같은 자리에 그대가 있었죠\n매일 보는 풍경처럼\n이 세상에 길들여 쉽게 생각했죠\n더 가까워져 갈 수록....\n\n하지만 지친 내 하루에 그대 두 눈\n모두 따뜻했었죠.\n그대 모습 그대로가 좋아요 \n나만 바라보는 사람 초라한 나와의 시간을 \n소중히 하는 사람..............\n\n그대 말한 것처럼 있을지 모르죠\n나와 더 잘 맞는 연인\n하지만 내가 원하는거. 이 세상에 단 한사람 뿐인걸\n그대, 모습 그대로가 좋아요 \n나만 바라보는 사람 초라한 나와의 시간을 소중히 하는 사람..\n\n......세상이 다 하는 날까지 오~ 그대\n\n그대 모습 그대로가 좋아요\n나를 사랑해 줄 사람 먼 훗날 나 없는 시간을\n쓸쓸히 보낼 사람.......\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/264/15026264_1408677389563_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130254, lowkey: nil, highkey: nil},
  {album_id: 52, singer_id: 65, team_id: nil, title: "잊지마", genre1: "가요", genre2: "전체", runtime: "03:53", lyrics: "\n\t\t\t\t\t\t\t<div>잊지마 - 03:53</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">하나도 조금도 잊지말아요\n내가 곁에 없어도 잊지말아요\n\n처음도 지금도 나의 사랑은\n가까이있는데도 멀리 있네요\n\n** 내가 지켜줄게요\n그곳이 어디라도 언제라도 내가\n\n기다려요 내가 갈때까지\n처음 만났던 때로 다시\n\n내가 가는길이 조금 늦더라도\n잊지마 잊지마 내가 찾을때까지\n\n** Repeat\n\n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/264/15026264_1408677389563_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130255, lowkey: nil, highkey: nil},
