  {album_id: 53, singer_id: 66, team_id: nil, title: "Street's Raised Us (180 remix)", genre1: "가요", genre2: "랩/힙합", runtime: "04:09", lyrics: "\n\t\t\t\t\t\t\t<div>Street's Raised Us (180 remix) - 04:09</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">Joosuc&gt; \r\nyeah...It's Jay Cee beatz...year 2002...yup!! \r\n거리가 바로 내 어머니 모든 행동은 \r\n내 의지 이제 생각해 가만히 \r\nCuz street's raised us 난 artist! '\r\n내 소유 Matiz'가 '렌트한 Bimaz'보다 차라리 낫지 \r\n또 원치 않는 일로 번 돈 만원보다 \r\n내가 원하는 일로 번 돈 백원의 가치 스스로 \r\n발생 시켜 모든 행동의 결과 내 심장이 \r\n내켜 하지 않는 일은 별다른 이유 없인 절대 \r\n로 하지 않지 만금의 돈보다 중요한 건 \r\n마음이 걷고 싶어하는 행로 Hiphop이라면 \r\nno make up Hiphop이라면 don't make a \r\n망가지는 모습 멋진 가사를 써놓고 웃긴 \r\n모습 보여주는 건 최악 의 모순 \r\n\r\n(Hook) \r\n온실 속 화초 보다는 거친 들판의 잡초가 \r\n되어 내 꿈을 펼쳐 내 인생을 내 자신을 위해 바쳐 \r\n\r\nSupasize&gt; \r\nYo! 말쑥하게 차려 입을 생각만 말고 기억을 \r\n더듬어 근본을 떠올려봐 그냥 차례대로 \r\n거슬러 올라가면 답이 나오 \r\n잖아 hiphop the culture from the street \r\n그것도 모르고 덤비니 앞뒤가 안 맞지 \r\n가만히 보면은 머리만 커져 버린 세살박이 \r\n갓난아이 말이 안 나오지 한글을 배우기 \r\n전 알파벳을 외우는 꼴이지 마치 허수아비 \r\n튼튼한 boom box 한대면 걱정마 OK 어디 \r\n면 어때 스프레이 한 통이면 OK 무대가 아니라도 \r\n춤을 추고 노래해 그래 원래 우린 이래 \r\n니네들은 알지 못해 평생 이해하지 \r\n못해 왜 Cuz we were born like this and live like this \r\n산 중턱에서 정상의 공기를 맛볼 순 없어 됐어 \r\n계속해서 I take this \r\n\r\n(Hook) \r\n\r\n(Hook 2) \r\n항상 문 앞에 어슬렁거리는 하지만 열지는 못해 \r\n당장 눈앞에 어른거리는 유혹만을 \r\n계속해 뒤쫓아 하지만 우린 자신 \r\n의 감정에 너무나 솔직해 \r\n그 누가 아무리 뭐라 해도 신경 쓰지 않고 \r\n해나가 멋지게 \r\n\r\nJoosuc&gt; \r\nBlood to the brovas INC. 시간이 지나면 \r\n이제 모두 알겠지 독립된 노선, 음악 wit \r\nma man C-h-a-s-h-u 배추벌레 \r\n보다도 더딘 걸음이 될지언정 자존심을 \r\n무너뜨리며 like 'World Trade Center' \r\n살 순 없겠어 get into yourself 이제 \r\n거머줘 네 인생의 선택권 \r\n\r\nSupasize&gt; \r\n그래 물론 어미가 없이 자란 고아도 \r\n자기 자릴 찾아 갈 수 있을 정도로 존재 가치가 \r\n있겠지만서도 결코 알 수 없어 \r\n따뜻한 엄마의 품은 yo 절대로 \r\n여기도 마찬가지로 in this rap game respect \r\neverything without history 현재는 존재할 수 \r\n없듯이 like Jay Cee say 모두 하나 둘씩 \r\n거리로 나가 \r\n\r\n(Hook)</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/266/15026266_1407314421777_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130269, lowkey: nil, highkey: nil},
  {album_id: 53, singer_id: 66, team_id: nil, title: "현실의 자각", genre1: "가요", genre2: "랩/힙합", runtime: "03:56", lyrics: "\n\t\t\t\t\t\t\t<div>현실의 자각 - 03:56</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">(hook) \r\n누가 내 볼 좀 콱 깨물어 \r\n오늘도 난 내게 캐물어 \r\n답은 날 향해서 되물어 누가 \r\n이 현실을 되물어 (내일도 알지 못해 물론) \r\n\r\n(verse 1) \r\nI don't know dough 이리저리 뒤척이며 \r\n밤잠을 설치다 침상에 바로 누워도 \r\n아무리 머릴 감싸며 생각 해봐도 \r\n나로썬 이해할 수가 없다는 걸 알아 \r\n나도 펼쳐진 백사장의 한 톨 \r\n모래알보다도 귀한 그대와의 인연이 초래한 \r\n걷잡을 수 없는 아픔의 파도 밀려와 \r\n내 모래성을 무참히 밟아 돌아가는 \r\n룰렛의 타겟 희망을 모두 파괴 \r\n마지막 촛농까지도 검게 타게 현실감이 \r\n현저히 떨어지는 떠나는 \r\n순간조차 고통이 아닌 착각에 \r\n거북의 등껍질보다 단단한 서로와 서로에 \r\n대한 믿음의 탄탄함 이젠 돌려놔 구멍난 \r\n내 가슴에 분실물 갖다놔 \r\n\r\n(hook) \r\n\r\n(verse 2) \r\n아직도 계속해 깨닫지 못했니 기나긴 시간을 \r\n보내고 보내도 해답은 안 오고 너무나 \r\n나는 많은걸 파는 걸 봤는걸 \r\n그래서 이젠 믿을 수없어 나는 널 불타는 \r\n노을 바라보며 짓는 한숨 단숨에 가슴에 \r\n서리가 앉아 창백해진 내 얼굴 \r\n지극히 단순한 이치 현실 바라보지 못하니 \r\n주어진 열쇠로 열 수 있는 문은 하나뿐인걸 \r\n잔뜩 꾸민 널 외면할 수밖에 없었어 \r\n꿈이 날 인도해준다 믿었지 널 지키는 \r\nbaby-sitter가 되고 싶어 주위의 \r\n누가 말린다고 해도 \r\n묵묵히 땅을 파는 고고학자 그만의 \r\n보고(寶庫)에 발을 놓아보고 싶어 훗날 \r\n시간이 지나면 너도 나도 덤벼들겠지만</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/266/15026266_1407314421777_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130270, lowkey: nil, highkey: nil},
  {album_id: 53, singer_id: 66, team_id: nil, title: "싫거나 혹은 좋거나", genre1: "가요", genre2: "랩/힙합", runtime: "04:25", lyrics: "\n\t\t\t\t\t\t\t<div>싫거나 혹은 좋거나 - 04:25</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">(Joosuc) \r\n내가 바라는 건 이 세계의 Michael Jordan \r\n말로만 떠벌 떠벌대며 정작 mic를 줘도 \r\n절대 아무것도 하지 못하는 녀석과는 달라 \r\n여태껏 말했잖아 난 super rhyme maker \r\n지금 세상 살아가는 누구나 다 각자 저마다의 \r\n다른 색을 비추며 함께 살아가 \r\nWWF의 superstar the Rock조차 싫어할 수 있는 \r\n취향의 다양성 난 그래서 전혀 신경 쓰지 않아 \r\n누가 날 싫어하던 누가 날 좋아하던말야 \r\n내가 rhyme을 끊어먹든 라면을 끓여먹든 \r\n중요한 건 바로 내 의지와 의사 \r\n그냥 맘에 들지 않으면 안 들으면 그만 \r\n의미 없는 beef 난 원치 않아 그만 \r\nTo all ma playa &amp; hater 어찌됐든 \r\n내게 관심을 가져준 그 모두에게 감사 \r\n\r\n(Chorus) * 2 \r\nSee, u can hate me but u can luv me \r\n선택하는 건 당신의 마음대로 \r\n날 싫어하던 날 좋아하던 이 자리에 서 있는 \r\n나는 변하지 않아 \r\n\r\n(Supasize) \r\n꽃향기를 쫓아 날아가는 꿀벌처럼 해를 따라 \r\n움직이는 해바라기 꽃들처럼 내 맘이 가는 곳 \r\nalways one way \r\nno way 다른 사람 꿈 꾼 적 없어 \r\nevery thug needs lady Yeah e yeah, \r\nplease holla me back babe \r\n그러나 언제나 답이 없는 편지 그래 나 \r\n두려울 게 없지 굳이 말하면 나비가 \r\n오기만을 기다리는 꽃 한 송이 \r\n선택은 네 맘대로 난 항상 이 자리 여기 \r\n\r\n(Joosuc) \r\nU can hate me or u can luv me 선택하는 건 \r\n당신의 마음대로 당신다운 테러 \r\n내 맘의 한가운데로 \r\n던진 사랑의 힘은 너무나 강력해 \r\nlike pharaoh 물론 결정은 \r\n당신의 맘 단지 내 맘 알아주길 \r\n바라고 바라지 단순해 난 \r\n부디 현명한 선택을 바래 그래 난 \r\n돈키호테 oh my 둘시네아 포기못해 \r\n\r\n(Chorus) \r\n\r\n(Bridge) \r\nWhat u think about? I can't live without u probably \r\n하지만 난 강요하진 않아 단지 선택을 \r\n네게 맡길 뿐 It's up to you \r\n\r\n(Sam) \r\n꽉 찬 비트와 운율이 가슴을 조여 \r\n음악이 흐르면 좀 더 볼륨을 높여 \r\nya can hate me or luv me \r\n내 적과 팀 사이에서 선택을 해</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/266/15026266_1407314421777_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 10227, song_num: 16130271, lowkey: nil, highkey: nil},
  {album_id: 53, singer_id: 66, team_id: nil, title: "Intermission : Live On Stage", genre1: "가요", genre2: "랩/힙합", runtime: "00:32", lyrics: "\n\t\t\t\t\t\t\t<div>Intermission : Live On Stage - 00:32</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">모두 머리 위로! (Yo, ready!) \r\nGet yo hands up like this yo!\r\n(Yo, ready!) \r\nPut yo mothafuckin' hands up!\r\nWhen I say JoosuC yo say yeah!\r\nWhen I say JoosuC you sat yeah!</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/266/15026266_1407314421777_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130272, lowkey: nil, highkey: nil},
