  {album_id: 53, singer_id: 66, team_id: nil, title: "Out Of Control", genre1: "가요", genre2: "랩/힙합", runtime: "04:00", lyrics: "\n\t\t\t\t\t\t\t<div>Out Of Control - 04:00</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">(Hook)\r\n\r\n이미 우리는 out of control\r\n\r\n이미 당신은 out of control \r\n\r\n(Joosuc)\r\n\r\nMa skill''s hot like chilli hot pot\r\n\r\n한번 경험 후 절대 안미칠리 없다\r\n\r\n미리 한판, 조작은 매우 간단\r\n\r\n이 은혜는 훗날에 필히 갚아\r\n\r\nSuper rhyme maker, 도구는 펜과 paper\r\n\r\n요리의 재료들 바로 축적된 데이터\r\n\r\nInside-outside 모두 탄탄하니\r\n\r\n걱정 없지 like LA Lakers\r\n\r\n매일같이 오르는 무대 마치 직장인의 통근 버스\r\n\r\nYo 형제들이 \"ho\" 소리치기 전에 먼저 제발 lady first\r\n\r\n이제는 염두에 둬 내 마음가짐은 do or die\r\n\r\n내 주위 모두보다 비장하단다\r\n\r\n두 번 다신 멈출 수는 없어\r\n\r\nCuz I dig too deep so I''m addicted to this\r\n\r\n(Hook)\r\n\r\n(Sam)\r\n\r\nit''s bout time 4 da comin ov a new age\r\n\r\nSammy Sosa up in da stage\r\n\r\nnow new n freshy page를 쓴다\r\n\r\n이제 씹스러운 새끼들 stop\r\n\r\n언제나 내가 거리 위를 거닐 땐\r\n\r\nheadfone은 머리에 star-tac은 허리에\r\n\r\nT. N. F. 가방을 어깨에\r\n\r\n짊어진 남들과는 달리 걷는 걸음걸이 항상 껄렁껄렁\r\n\r\n모자도 절대로 똑바로 쓰지 않아 헐렁헐렁\r\n\r\n하는 나 누가 봐도 문제아 같은 나\r\n\r\nSammy Sosa reprezentin'' Project Peepz\r\n\r\nyo dunz betta check ma steez \r\n\r\nya''ll wanna see me how high I get?\r\n\r\nI get as high as Mef n Red\r\n\r\nso don''t put me 2 da test\r\n\r\n(Hook)\r\n\r\n(Joosuc &amp; Sam)\r\n\r\nI be the J to the C yo, microphone whut check yo!!\r\n\r\nUnstoppable 브레이크 없는 레이싱 카, \r\n우린 이미 out of control\r\n\r\nI be S to the S yo, microphone을 1, 2 check yo!!\r\n\r\nUnstoppable 브레이크 없는 레이싱 카, \r\n우린 이미 out of control\r\n\r\n(Hook 2)\r\n\r\n하나부터 열, 처음부터 끝까지\r\n\r\nSammy &amp; Jay Cee gonna rock u\r\n\r\nplease be slow 지금 너무 급하지\r\n\r\nstill here!! 최고의 선물 4 u</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/266/15026266_1407314421777_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130275, lowkey: nil, highkey: nil},
  {album_id: 53, singer_id: 66, team_id: nil, title: "The Anser", genre1: "가요", genre2: "랩/힙합", runtime: "04:30", lyrics: "\n\t\t\t\t\t\t\t<div>The Anser - 04:30</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">Yo Joosuc Final Soon \r\nYou Know How We Do \r\nFor The 2002 Capital \r\nJ Nigga It's The D \r\nCho PD Nigga D-Conn \r\nIt's The 강의 \r\n[너 정말] 못해 You \r\nThe Wake MC 주석 인정 \r\n왜 Style 있으니 \r\n약간은 삐뚤어진 \r\n너의 마음이 아직은 \r\n배울 자세가 안 되있으니 \r\n평소에 부족할 땐 \r\n2% Hip Hop공부할땐 \r\nD를 불러 내가 Hip \r\nHop생활한지 벌써 10년 \r\n너흰 나를 존경한게 3년 \r\nHip Hop의 진실 가르쳐 주실 \r\n그 이름 DM 들어봐 \r\n소릴 그 속에 꽂힐 \r\n[최고로] 남길 \r\n역사에 새길 명언을 얘길 \r\n내가 Hip Hop음악 들려줄게 \r\n니가 댄스무대 \r\n보여줄래 힙합좋아한건 \r\n고맙지만 아무나 \r\nMic잡지 말아줄래 \r\n\r\nUh Uh Uh 남들관 \r\n다르다 하는 말따위를 \r\n내뱉는 그대 입은 \r\n바른가 부끄럽다 \r\n그만하는게 낫겠는데 \r\n땅은 왜 파내는데 \r\n왜 들어가게 그래 \r\n어설픈 자네 \r\n그래 말은 쉽다만 \r\n이건 너무 쉽잖아 \r\n작년에 Rap을 \r\n시작하는 착한 사람아 \r\n버튕겨 봤자야 \r\n머리를 짜봐라 \r\n명함도 못 내민다 \r\n그 실력으로 Rapper \r\n되기가 쉬운것 같더냐 \r\n세상을 바꿔라 \r\n가져라 하는 말이 \r\n이미 니 머리를 \r\n다쳤다 신념을 바쳤나 \r\n그게 뭔가 쉬운게 \r\n아니란 말이야 \r\n하지만 이 잔인한 바닥은 \r\n니가 자리할 곳이 \r\n아니다 하지 말란 말이야 \r\n쉽게 말해서 내 \r\n말은 참지 말란 말이다 \r\n우리면 충분 하니까 \r\n모두가 흥분하니까 \r\n다들 구분하니까 \r\n(You Know) \r\n듣는것으로 만족 \r\n했으면 하네 불쌍한 자네 \r\n\r\n이것이 너를 향한 대답 Yeah \r\nDM &amp; DEFCONN이 주는 Answer \r\n이것이 너를 위한 해답 Uh \r\n조PD와 JC가 주는 Answer \r\n이것이 너를 향한 \r\n대답 Yo DM &amp; \r\nDEFCONN이 주는 Answer \r\n이것이 너를 위한 해답 Why \r\n조PD와 JC가 주는 Answer \r\n\r\nYo Yo 언제나 급박한 \r\n우리 삶 그 싸움 속에서 \r\n순박한 맘으로 쌓아온 \r\n내 음악의 시작은 \r\n미미하나 끝은 \r\n창대하리 대박 \r\n만이 좋은 음악 짧은 \r\n생각 막상 멍석 깔면 \r\n오락가락 맨날 \r\n오락이나 하는 \r\n니놈이 무슨 놈의 음악을 \r\n무슨놈의 대박을 \r\n또 최고의 쾌락을 \r\n일은 하는 둥 마는 \r\n둥 하다 결국엔 \r\n시큰둥 하면서 오락과 \r\n하루를 빈둥빈둥 \r\n삶은 토끼와 \r\n거북이의 경주처럼 \r\n이기기 마지막에 \r\n웃는 이를 위한 게임 \r\n더욱이 대박의 압박 \r\n속에서 드러난 본색 \r\n음악을 말하기 전에 \r\n먼저 인간이 되라 \r\n이 새꺄 띨빡한 놈 \r\n낫놓고도 기억자도 몰라 \r\n맘놓고 제 무덤도 \r\n몰라보는 놈이랑 놀면 클나 \r\n하물며 벼도 익으면 \r\n고개를 숙이는데 \r\n아무리 골이 벼도 \r\n익기전부터 썩어 졸라 \r\n\r\n하나 At You 내 말을 \r\n대충 안듣길 바라며 간다 \r\n라면발보다 속이 \r\n더 빙글빙글 꼬인 자들아 \r\n터진게 입이라 나오는 말이 \r\n있지만 알수가 없는 \r\n깊이가 무엇을 탓하지 \r\n니가 말하는 단어속안에 \r\n무엇을 담았 던 간에 \r\n솔직해져야 한다네 \r\n그래야 바로 판단해 \r\n매일 혼자 방구석 인터넷 \r\n그래 흔히 말하는 \r\n우물이 바로 \r\n거기 단지 멋대로 \r\n가사를 쓰고 마이클 \r\n잡았다고 착각하지마 \r\n다 구워진 빵행세 \r\n하는 넌 내가 볼때 \r\n아직도 반죽 \r\n기발한 비유 하나 해내지 \r\n못하면서 남의 흉내를 내는 \r\n침팬지와 다를게 없어 \r\n네가 갈 곳은 저기요 \r\n또 속도경쟁하니 \r\n넌 혹시 육상선수 \r\n화려한 기교는 \r\n누구나 흉내낼 수 있어 \r\n하지만 얄팍한 복사기로 \r\n나만의 온갖 메타포 \r\n절대 Copy 할 수 없어 \r\n(Yo 틀림없어) \r\n\r\n이것이 너를 향한 대답 \r\nYeah DM &amp; DEFCONN이 \r\n주는 Answer \r\n이것이 너를 위한 해답 \r\nUh 조PD와 JC가 \r\n주는 Answer \r\n이것이 너를 향한 대답 \r\nYo DM &amp; DEFCONN이 \r\n주는 Answer \r\n이것이 너를 위한 해답 \r\nWhy 조PD와 JC가 \r\n주는 Answer X2</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/266/15026266_1407314421777_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130276, lowkey: nil, highkey: nil},
  {album_id: 53, singer_id: 66, team_id: nil, title: "Outro : 감사의 말", genre1: "가요", genre2: "랩/힙합", runtime: "02:16", lyrics: "\n\t\t\t\t\t\t\t<div>Outro : 감사의 말 - 02:16</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">its the JC\r\n내 주위의 모든 사람\r\n전하고 싶은 감사의 마음\r\nAppreciate \r\n첫 째 주님과 부모님,\r\n둘 째 내 말을 현실화 시켜준 협력자\r\nMASTER PLAN의 모든 스텝들 감사\r\nAppreciate\r\n내 뒤를 항상 받쳐주는 Schedule-1,\r\nSAM, SUPERSIZE, Vasco &amp; QJ\r\n그 모든 형제들에게 전하고 싶은 감사\r\nYeah, Appreciate\r\n2nd 앨범을 위해 힘을 써준\r\n모든 rapper, singer, producer\r\n모두에게 감사\r\nYo, Appreciate\r\nYou &amp; You &amp; You\r\nFutuer Flow, Weapon X, IFN, John Lee\r\n그 모두에게 감사\r\nThats for Yall \r\nYeah, Appreciate\r\nDope MC &amp; Michael 셰셰 \r\nRochy &amp; Roger\r\nTo all of ma people in Hongkong\r\nand Taiwan \r\nYo, Apprecaite\r\nZEEBRA, Maccho, DJ Ceroli,이노벤다\r\n오레오 사포-트 시떼쿠레루 민나\r\n부로쿤 야츠, \r\n오토노 쿄다이다찌 민나 칸샤\r\n(나를 서포트해준 모두, 서툰 녀석,\r\n 남자형제들 모두 감사) \r\nAppreciate\r\n내가 여기서 뭘하든 저기서 뭘하든\r\n나와 내 음반을 지지해주는\r\n모든 팬들에게도 감사\r\nI wanna say Appreciate\r\n마지막으로 날 싫어하는 Hater\r\n!@\#$%^&amp;&amp;?? 당신들에게도 감사 하하\r\nYo, Appreciate\r\n\r\n \r\n\t\t\t\t\t</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/266/15026266_1407314421777_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130277, lowkey: nil, highkey: nil},
  {album_id: 53, singer_id: 66, team_id: nil, title: "Street's Raised Us (Original Ver.)", genre1: "가요", genre2: "랩/힙합", runtime: "04:13", lyrics: "\n\t\t\t\t\t\t\t<div>Street's Raised Us (Original Ver.) - 04:13</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">Joosuc&gt; \r\nyeah...It's Jay Cee beatz...\r\nyear 2002...yup!! \r\n거리가 바로 내 어머니 모든 행동은 \r\n내 의지 이제 생각해 가만히 \r\nCuz street's raised us \r\n난 artist! '내 소유 Matiz'가 '렌트한 Bimaz'보다 \r\n차라리 낫지 또 \r\n원치 않는 일로 번 돈 만원보다 \r\n내가 원하는 일로 번 돈 백원의 가치 \r\n스스로 발생 시켜 \r\n모든 행동의 결과 내 심장이 \r\n내켜 하지 않는 일은 별다른 이유 없인 \r\n절대로 하지 않지 \r\n만금의 돈보다 중요한 건 마음이 \r\n걷고 싶어하는 행로 Hiphop이라면 \r\nno make up Hiphop이라면 \r\ndon't make a 망가지는 모습 멋진 \r\n가사를 써놓고 웃긴 \r\n모습 보여주는 건 최악의 모순 \r\n\r\n(Hook) \r\n온실 속 화초 보다는 거친 들판의 잡초가 되어 \r\n내 꿈을 펼쳐 내 인생을 내 자신을 위해바쳐 \r\n\r\nSupasize&gt; \r\nYo! 말쑥하게 차려 입을 생각만 말고 \r\n기억을 더듬어 근본을 떠올려봐 \r\n그냥 차례대로 거슬러 올라가면 답이 \r\n나오잖아 hiphop the culture from the street \r\n그것도 모르고 덤비니 앞뒤가 안 맞지 가만히 \r\n보면은 머리만 커져 버린 \r\n세살박이 갓난아이 말이 \r\n안 나오지 한글을 배우기 전 알파벳을 \r\n외우는 꼴이지 마치 허수아비 \r\n튼튼한 boom box 한대면 \r\n걱정마 OK 어디면 어때 스프레이 한 통이면 \r\nOK 무대가 아니라도 춤을 추고 노래해 \r\n그래 원래 우린 이래 니네들은 알지 못해 \r\n평생 이해하지 못해 왜 \r\nCuz we were born like this and live like this \r\n산 중턱에서 정상의 공기를 맛볼 순 없어 됐어 \r\n계속해서 I take this \r\n\r\n(Hook) \r\n\r\n(Hook 2) \r\n항상 문 앞에 어슬렁거리는 하지만\r\n열지는 못해 당장 눈앞에 어른거리는 \r\n유혹만을 계속해 뒤쫓아 하지만 \r\n우린 자신의 감정에 \r\n너무나 솔직해 그 누가 아무리 \r\n뭐라 해도 신경 쓰지 않고 해나가 멋지게 \r\n\r\nJoosuc&gt; \r\nBlood to the brovas INC. 시간이 지나면 \r\n이제 모두 알겠지 독립된 노선, \r\n음악 wit ma man C-h-a-s-h-u 배추벌레보다도 \r\n더딘 걸음이 될지언정 자존심을 무너뜨리며 \r\nlike 'World Trade Center' 살 순 없겠어 \r\nget into yourself 이제 거머줘 네 인생의 선택권 \r\n\r\nSupasize&gt; \r\n그래 물론 어미가 없이 자란 고아도 \r\n자기 자릴 찾아갈 수 있을 정도로 존재 가치가 \r\n있겠지만서도 결코 알 수 없어 \r\n따뜻한 엄마의 품은 yo 절대로 여기도 마찬가지로 \r\nin this rap game respect everything \r\nwithout history 현재는 존재할 수 없듯이 \r\nlike Jay Cee say 모두 하나 둘씩 거리로 나가 \r\n\r\n(Hook)</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/266/15026266_1407314421777_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130278, lowkey: nil, highkey: nil},
