  {album_id: 56, singer_id: 67, team_id: nil, title: "내가 만든 이별", genre1: "가요", genre2: "전체", runtime: "05:02", lyrics: "\n\t\t\t\t\t\t\t<div>내가 만든 이별 - 05:02</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">하루가 또 시작하려해 \n늘 그래왔었던 너의 마음처럼 \n\n오늘이 어제이기를 바래 \n흐르는 시간이 두려운 것일까 \n\n이렇게 떠나는 너를 그리워 할수도 없는 \n나만의 시간이 두려워 \n\n너에게 나의 마음을 전해야만 하는데 \n되돌릴 수도 없어 \n\nyou never stay with me tonight \n이렇게 지쳐있는 나 내가 만든 슬픈 이 순간들 \n\nyou never turn back to me now \n차가운 나의 눈물이 우리들의 어젤 외면하는데... \n\n내가 만든 우리의 이별이 \n나에겐 상처만 남겼을 뿐인데 \n\n조금만 더 사랑했다면 \n시간이 흐르길 기다릴 수밖에 \n\n이렇게 떠나는 너를 그리워 할 수도 없는 \n혼자만의 시간이 두려워 \n\n이렇게 떠나는 너를 그리워 할 수도 없는 \n혼자만의 시간이 두려워 \n\n너에게 나의 마음을 전해야만 하는데 \n되돌릴 수도 없어 \n\nyou never stay with me tonight \n되돌아 갈 수도 없는흐르는 시간 속에 사는 너 \n\nyou never turn back to me now \n차라리 모든 기억을 의미없이 지우고 싶어져 나 \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/269/15026269_1406172014250_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130304, lowkey: nil, highkey: nil},
  {album_id: 56, singer_id: 67, team_id: nil, title: "The Name 名字", genre1: "가요", genre2: "전체", runtime: "03:51", lyrics: "\n\t\t\t\t\t\t\t<div>The Name 名字 - 03:51</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">수 천 번 수 만 번 불러왔던 이름을 \r\n다시 애써 지우려고 하는데 \r\n누구를 만나도 누굴 불러보와도 \r\n너의 이름이 입가에 맺혔어 \r\n\r\n얼굴을 그려보아도 \r\n체온을 느끼려해도 아무것도 \r\n생각나질 않아 모두 잊은 듯 한데. \r\n\r\nI remember name \r\n시간이 흐른 지금도 \r\n내 맘 속에 슬픔으로 남아있어 the name \r\n\r\n먼 훗날 내게도 그런 날이 오겠지 \r\n남은 하나의 숨쉬는 그 날이 \r\n마지막 부르는 네 이름이 될꺼야 \r\n어서 그 날이 오면 좋을 것 같아 \r\n\r\n하지만 하늘이 있어 \r\n그 속에 삶이 있다면 또 다시 널 \r\n그리워 지우며 살아야 하는 걸까 \r\n\r\nI forgot your name \r\n다시는 부를 수 없는 이름으로 날아가 \r\n\r\n이젠 모두 버려 너의 아름다웠던 모습도 \r\n미소도 향기도 이름마저 \r\n이젠 지워버려 모두다... \r\n\r\n눈감아 또 다른 삶이 있다하여도 \r\nI remember name \r\n다시 또 부를 수 있는 이름으로 \r\n기억되지 않았으면 the name</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/269/15026269_1406172014250_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130305, lowkey: nil, highkey: nil},
  {album_id: 56, singer_id: 67, team_id: nil, title: "이제서야 사랑합니다", genre1: "가요", genre2: "전체", runtime: "04:27", lyrics: "\n\t\t\t\t\t\t\t<div>이제서야 사랑합니다 - 04:27</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">바라는 대로 너에게 친구사이로 남을걸 \n보고싶어서 미칠 것만 같아 \n\n괜찮다고 나 믿었었는데 \n점점 더 자신이 없어지는걸 \n\n겉잡을 수 없는 이런 그리움 \n너무 많이 사랑해 네가 떠난 것인지 \n\n시간이 지칠만큼 흐르고 \n혹시 잊을 수도 있는 날까지 \n\n묻어 두는 거야 너를 내 맘 속 깊이 \n이제 조금씩 익숙해지면 돼 \n\n네가 내게 주는 아픔이기 때문에 \n견딜께 사랑이라 여기고 \n다시 돌아오지 않을 너를 위해서 \n\n시간이 지칠만큼 흐르고 \n혹시 지울 수도 잊는 날까지 \n담에 두는 거야 너를 내 맘속 가득히 \n나도 모르게 익숙해지면 돼 \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/269/15026269_1406172014250_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130306, lowkey: nil, highkey: nil},
  {album_id: 56, singer_id: 67, team_id: nil, title: "지금은 사랑할때", genre1: "가요", genre2: "전체", runtime: "03:39", lyrics: "\n\t\t\t\t\t\t\t<div>지금은 사랑할때 - 03:39</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">마주친 너의 눈빛과 \r\n네 젖은 입술에 머문 \r\n기다림 날 원하고 있어 \r\n\r\n네 작은 떨림까지도 \r\n이 순간 놓칠 수 없어 \r\n오늘 밤 널 느끼고싶어 \r\n\r\n널 뜨겁게 담고 싶은 나의 사랑을 \r\n멈추고 싶지 않아 \r\n\r\ntake my truth in a minute \r\nyes it's time to belive it's true \r\n\r\nfeel my love in a minute \r\nwe can love to the limit it's true \r\n\r\n조금도 망설이지마 \r\n지그 네 모습 그대로 \r\n나에게 좀더 다가오면 돼 \r\n\r\n뜨거운 너의 숨결로 타버릴 나의 사랑을 \r\n오늘밤 모른 척 외면하지 말아줘 \r\n\r\n나 지금껏 기다려온 너의 사랑을 \r\n이 밤 느낄수 있게 제발</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/269/15026269_1406172014250_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130307, lowkey: nil, highkey: nil},
  {album_id: 56, singer_id: 67, team_id: nil, title: "동행", genre1: "가요", genre2: "전체", runtime: "04:10", lyrics: "\n\t\t\t\t\t\t\t<div>동행 - 04:10</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">하늘이 보냈죠. 날닮은 그대 \n천상에 못다 이룬 사연이 남아 \n천사에 영혼을 빌려서 다시 난 태어나 \n그댈위해 사는거죠.. \n내게 와 영원해 질수 있게 \n꿈에도 기다렸죠.. \n내 사랑 내 미래 다 그대 몫이기에.. \n\n기적을 믿나요..?.. \n나처럼 그대.. \n떨리는 두눈마저 낯설지 않아. \n잃었던 날개를 찾아서 강해진 새처럼 \n그댈위해 사는거죠.. \n내게와 영원해질수 있게 \n꿈에도 기다렸죠.. \n내 사랑 내 미래 다 그대 몫이기에.. \n\n아무것도 필요없죠, 그대 곁에 있다면 \n감히 나 약속해요, 그대가 나에 운명이라고 \n세상이 날 속여도 지켜낼 사랑은 있기에 행복해요.. \n영원히 사랑해요 \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/269/15026269_1406172014250_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130308, lowkey: nil, highkey: nil},
  {album_id: 56, singer_id: 67, team_id: nil, title: "내안의 너", genre1: "가요", genre2: "전체", runtime: "03:57", lyrics: "\n\t\t\t\t\t\t\t<div>내안의 너 - 03:57</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">이렇게 하루하루 너를 지우며 살아가는게 \r\n난 매일이 어색하고 힘든지 \r\n너없이 아무것도 할 수 없는 나 \r\n어떻게 할지 또 이렇게 나도 모르게 밤새 눈물이 \r\n\r\n니가 내게 준 사랑 그것만으로도 난 고마울뿐야 \r\n그래도 맘이 아픈건 이렇게 서로를 잊어가게 될까봐 \r\n잊진 말아죠 너와 나 사랑했던 기억만은 \r\n내겐 영원한 사랑 그런 너를 가슴속에 묻어야만 해 \r\n\r\n내가 널 사랑했던것 만큼만 날 사랑했다면 \r\n처음처럼 행복했었을텐데 \r\n나없이 정말 너는 괜찮은건지 묻고 싶지만 \r\n널 바라볼 그런 용기조차 없는 나인데 \r\n\r\n*세상 어느 누구도 너만큼 사랑하지 못할꺼야 \r\n아름다웠던 우리에 사랑 되돌릴 순 없지만 \r\n하지만 난 괜찮아 언젠간 나도 익숙해지겠지 \r\n이젠 너없이 내 눈물과 함께 너를 보내야만해 \r\n\r\n소중히 간직된 사랑 그 하나만은 내겐 충분하니까 \r\n니가 내게 준 사랑 그것만으로도 난 고마울뿐야 \r\n그래도 맘이 아픈건 이렇게 서로를 잊어가게 될까봐 \r\n잊진 말아줘 너와 나 사랑했던 기억만은 \r\n내겐 영원한 사랑 너를 가슴속에 묻어야만 해 \r\n\r\n*반복</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/269/15026269_1406172014250_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130309, lowkey: nil, highkey: nil},
  {album_id: 56, singer_id: 67, team_id: nil, title: "날 알고있어", genre1: "가요", genre2: "전체", runtime: "04:40", lyrics: "\n\t\t\t\t\t\t\t<div>날 알고있어 - 04:40</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">헛된 일이야 또 다시 만난다는건 \r\n우리 서로가 몇년동안 힘들었어 \r\n잘 잊혀져가는데 이젠 없던 일인데 \r\n우리 서로가 왜 다시 아파야해 \r\n\r\n알고있어 이런 가슴아픈 사랑을 \r\n이 세상 살아가면서 마지막인걸 \r\n난 알고있어 우리 다시 사랑한다면 \r\n예전보다 더 큰 상처만 남기게 될뿐이야 \r\n\r\n지나가버린 나에 옛 기억 속에서 \r\n그렇게 너는 기다리고 있었지만 \r\n이젠 잊혀져가는데 이젠 없던 일인데 \r\n우리 서로가 왜 다시 아파야해 \r\n\r\n알고있어 이런 가슴아픈 사랑을 \r\n이 세상 살아가면서 마지막인걸 \r\n난 알고있어 우리 다시 사랑한다면 \r\n예전보다 더 큰 상처만 남기게 될뿐이야 \r\n\r\n돌아서야만해 너를 위해서 \r\n\r\n알고있어 이런 가슴아픈 사랑을 \r\n이 세상 살아가면서 마지막인걸 \r\n난 알고있어 우리 다시 사랑한다면 \r\n예전보다 더 큰 상처만 남기게 될뿐이야</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/269/15026269_1406172014250_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130310, lowkey: nil, highkey: nil},
  {album_id: 56, singer_id: 67, team_id: nil, title: "Too late To Know", genre1: "가요", genre2: "전체", runtime: "04:57", lyrics: "\n\t\t\t\t\t\t\t<div>Too late To Know - 04:57</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">처음 나에게 다가온 순간보다 더 아름다운 너 \r\n너의 눈물이 아니면 이별인줄 난 몰랐을텐데. \r\n\r\n사랑은 떠날 때 더 아름다운건지 이별이 아니라면 널 안고싶어 \r\nI don't wanna let you go \r\nI haven't  known about your love \r\nbefore you leave \r\n\r\n마지막 느낀 사랑을 다시 너에게 줄 수 있다면. \r\n\r\n넌 내 곁을 떠나면 이별이라 난 믿어왔는데. \r\n왜 아직도 난 떠난 널 사랑이라 난 믿고 있는지. \r\n\r\n사랑은 이별 후 더 간절해자는지 지금 내 가슴속엔 너의 생각뿐. \r\n\r\nI don't wanna let you go \r\nI haven't  known about your love \r\nbefore you leave \r\n\r\n마지막 느낀 사랑을 다시 너에게 줄 수 있다면.</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/269/15026269_1406172014250_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130311, lowkey: nil, highkey: nil},
  {album_id: 56, singer_id: 67, team_id: nil, title: "Like It", genre1: "가요", genre2: "전체", runtime: "04:09", lyrics: "\n\t\t\t\t\t\t\t<div>Like It - 04:09</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">난 너의 어떤 의미였니 \n난 너의 전분 될 수없니 \n나를 만나 행복하지 않았니 \n나의 사랑이 틀렸던 거니 \n\nwhatam i gonna do uh baby \nso i don't wanna lose in my mind \n넌 당당했고 내겐 항상 자상 했었어 \n그게 사랑이라 믿었던 게 \n나의 착각이었니 \n\nwoo, don'tleave me now \n널 보낼수 없어 \nwoo, i've got my word \ni'll never let you down again \n\n넌 이제 내가 싫어졌니 \n이젠 너의 길에 방해된다 생각하니 \n나의 사랑 왜 집착이 된 거니 \n내가 떠나길 바랬던 거니 \n\nwhat am i gonna do uh baby \nso i don't wanna lose in my mind \n너 항상 내게서 거리감을 두었고 \n그게 나는 몹시 불안했어 \n다시 시작 할 수 없니 \n\nand now it's real can you fell me heartbeat same \nand so i gotta do you are the only onewho \nto spend my life with you \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/269/15026269_1406172014250_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130312, lowkey: nil, highkey: nil},
  {album_id: 56, singer_id: 67, team_id: nil, title: "널 위한 체념", genre1: "가요", genre2: "전체", runtime: "04:10", lyrics: "\n\t\t\t\t\t\t\t<div>널 위한 체념 - 04:10</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">아직도 니가 슬퍼보여서 웃을 수가 없었어 \n나떠나 부디 행복하라고 너를 보낸걸 아니 \n미안해 너무 사랑하기에 아프다는 널 이젠 피하고 싶어 \n날 떠나서 다시는 눈물짓지 말아줘 \n그렇게 슬프게 나를 바라보지는 마 \n\n투명했던 모습 기억하는데 사랑이 자라서 \n슬픔이 된 너를 보면서 보내야만 하는 내 마음 이해해줘 \n너만을 위한 이별이 아픔이 되어 아직도 슬퍼보여 \n그 모습 그대로 더 이상 눈물 흘리지마 \n힘겨운 사랑도 내게 있었어 기억만 해줘 \n\n나없이 니가 행복할거라 바보같이 믿었어 \n내곁에 항상 슬퍼보이는 너를 견딜 수 없어 \n조금만 아껴 사랑했다면 눈물도 없이 우리 행복했을텐데 \n떠나서 이제는 행복하게 웃어줘 \n더이상 아프게 나를 사랑하지는 마 \n\n투명했던 모습 기억하는데 사랑이 자라서 \n슬픔이 된 너를 보면서 보내야만 하는 내 마음 이해해줘 \n너만을 위한 이별이 아픔이 되어 아직도 슬퍼보여 \n그 모습 그대로 더 이상 눈물 흘리지마 \n힘겨운 사랑도 내게 있었어 \n\n너만을 위한 이별이 아픔이 되어 아직도 슬퍼보여 \n그 모습 그대로 모두 잊고 살아가 \n너를 보내는 내 마음만 기억해줘 \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/269/15026269_1406172014250_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130313, lowkey: nil, highkey: nil},
  {album_id: 56, singer_id: 67, team_id: nil, title: "내 사랑으로 빛은", genre1: "가요", genre2: "전체", runtime: "04:38", lyrics: "\n\t\t\t\t\t\t\t<div>내 사랑으로 빛은 - 04:38</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">그대 지내온 회색 빛 \n우울한 그 나날 사이로 \n피곤에 지쳐 기댈 곳 찾던 \n내 사랑으로 빚은 사람아 \n그대 지내온 어두운 굴 속같은 나날도 \n이제는 모두 잊어버려요 \n내 사랑으로 빚운 사람아 \n새벽녘 설운 가슴 쓰러 안으며 \n참 많이도 아파했었지 \n참 많이도 힘겨웠었지 \n곤한 머리 내 어깨 기대어 \n편히 쉬어요 내 사람아 \n그대 그모습  있는 그대로 \n내게 와요 내사람아 \n새벽녘 설운 가슴 쓰러 안으며 \n참 많이도 아파했었지 \n참 많이도 힘겨웠었지 \n곤한 머리 내 어깨 기대러 \n편히 쉬어요 내 사람아 \n그대 내 모습 있는 그대로 \n내게 와요 내사람아 \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/269/15026269_1406172014250_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130314, lowkey: nil, highkey: nil},
  {album_id: 56, singer_id: 67, team_id: nil, title: "Feel The Brand New Dance", genre1: "가요", genre2: "전체", runtime: "04:39", lyrics: "\n\t\t\t\t\t\t\t<div>Feel The Brand New Dance - 04:39</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">\n*우와 바람이 분다 우와 바람이 불어 \n내 남자의 가슴속에 야 이 나쁜 님아 \n우와 바람이 분다 우와 바람이 불어 \n그냥 넘어갈 생각하지마\n\n(우와)채로 넘어가 (우와) 뒤로 빠져가 꺼져가 못 가 \n\n네 해도 내 속에 이기적인 마음은 점점 더해 가는 걸 \n딴 찾아갈 네 모습이 오 이리 불길한지 물어봐 \n다른 여자가 있는지 그냥 이대로 넘어갈 생각은 꿈에도 꾸지마\n\n섹시한 나의 눈빛에 빠져 버리고 싶다 했잖니 \n싫증이 난 거니 원래 너 그런 거니 \n우리의 사랑이 장난이니 왜 눈치만 보고있어 \n내게 잘못한 일 있는 거야 핸드폰 왜 끄니 \n왜 그리 바쁜 거야 그렇게 날 속일 생각만 \n\n* Repeat\n\n(우와) 너 혹시 진짜 였니 (우와) 너 혹시 진실이니 \n도대체 그냥 지나친 이유가 뭐니 \n어쩌니 아님 너 혹시 바람 피면 기분이 좋았니 (기분이 좋습니까)\n날 버리면 아니 숨기면 모든게 끝날 거라 생각했다면 큰 착각이야 \n그냥 지나간 다음을 기약하겠어 \n\n섹시한 나의 입술에 묻혀 버리고 싶다 했잖니 \n싫증이 난 거니 예전에도 그랬니 \n우리의 사랑도 같은 거니 왜 기다려 주길 바래 \n나도 너말고 딴 사람 있어 내가 민들레니 그렇게 약해 보여 \n무언가 보여줄 때가 됐어\n\n* Repeat\n\n우와 바람이 분다 우와 바람이 불어 \n내 마음 속 깊은 곳에 야 이 나쁜 님아 \n우와 바람이 분다 우와 바람이 불어 \n너만 그렇다 생각하지마\n\n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/269/15026269_1406172014250_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130315, lowkey: nil, highkey: nil},
  {album_id: 56, singer_id: 67, team_id: nil, title: "Outro : For The Rest", genre1: "가요", genre2: "전체", runtime: "01:00", lyrics: "\n\t\t\t\t\t\t\t<div>Outro : For The Rest - 01:00</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">i'm so happy now that \ni could sing a song \nmore than you will ever know, \nyou've touched my soul \nand i'm not afraid ti come in \ntell you sonow thanks to god \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/269/15026269_1406172014250_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130316, lowkey: nil, highkey: nil},
  {album_id: 57, singer_id: 68, team_id: nil, title: "동경 (憧憬)", genre1: "가요", genre2: "랩/힙합", runtime: "01:44", lyrics: "\n\t\t\t\t\t\t\t<div>동경 (憧憬) - 01:44</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가사 정보가 없습니다.</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/270/15026270_1407308166573_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130317, lowkey: nil, highkey: nil},
  {album_id: 57, singer_id: 68, team_id: nil, title: "Where U At", genre1: "가요", genre2: "랩/힙합", runtime: "04:47", lyrics: "\n\t\t\t\t\t\t\t<div>Where U At - 04:47</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">Intro] Back in the place to be for all those who've been supportin' us faithfully from year 2000 \r\nfor all y'all true hip-hop heads who be forever wylin' \r\nand for the candy-ass rappers and muh'fucking beat-jackers \r\nand for those who've been sleeping on us all along to this date \r\nI think your ass need some schooling right now \r\n\r\n이 비좁은 길에 들어선지 햇수로 4~5년, 이쯤에서 걸어온 길을 돌아보면 \r\n이미 우리 뒤를 따라오던 이들 중 많은 수가 감당 못할 실력의 차를 실감하는 순간 이 게임의 바깥으로 도망쳐버렸지 \r\n애초에 시작부터 아무런 개념없이 선두를 자처하던 이들의 발걸음은 조금씩 \r\n느린 화면을 보는 듯 무겁게 움직이며 아주 자연스럽게 뒤처져버렸네 어느새 주윌 둘러보니 우리의 곁엔 \r\n가벼이 스치는 향기로운 바람만이..huh... 눈을 감고 그냥 가만히 \r\n귀를 기울이면 어디선가 들리는 소리가 있어 이젠 그 소리를 따라 한발짝씩 더 \r\n내딛어 갈 뿐, 급하거나 숨가쁠 이유가 없네.. 있어도 아주 가끔? \r\n\r\nHook] \r\nYou know you can't escape this, u gotta face this It's VJ and Krazy Kricc (Get it) \r\n매일 씹고 씹히는 철없는 애들 아무런 의미없이 그냥 사라지는 노래들 \r\nWe beyond that level,We beyond all that! Now take a look at you, where y'all at? \r\n\r\nYou know you can't escape this, come on and face this It's VJ and Krazy Kricc \r\n매일 씹고 씹히는 철없는 애들 아무런 의미없이 그냥 사라지는 노래들 \r\nWe beyond that level, We beyond all that! Now take a look at you, where y'all at? \r\n\r\n물론 우리 전부가 처음부터 확실한 vision 으로 뭉쳐있던건 아니었지. 컴컴한 어둠과 안개가 걷히기 이전으로 \r\n돌아가보면 믿음에 차 보였던 이도 조그만 시련이 닥치면 등을 돌려버리고 어디론가 떠나버렸지. \r\n각자의 길을 찾아 떠난다는데 지저분한 감정없이 그들을 보내줬네 \r\n하지만 그들에게선 어떤 반전 역시 기대할 수 없는 법 \r\n다시 돌아와 진지하게 무언가를 추구하는 척 해봤자 아무런 소용이 없어. \r\n어쩌면 처음부터 전혀 이 길이 아닌 사람은 정해져 있어서 각자의 길을 가게 되는 건지도 몰라. \r\n지금의 우리는 예전의 우리보다 냉정한 눈으로 사람을 봐 누군가는 차갑다 말하지만 솔직히 다들 상황을 봐. \r\n\r\nHook] \r\nYou know you can't escape this, u gotta face this It's VJ and Krazy Kricc (Get it) \r\n매일 씹고 씹히는 철없는 애들 아무런 의미없이 그냥 사라지는 노래들 \r\nWe beyond that level,We beyond all that! Now take a look at you, where y'all at? \r\n\r\nYou know you can't escape this, come on and face this It's VJ and Krazy Kricc \r\n매일 씹고 씹히는 철없는 애들 아무런 의미없이 그냥 사라지는 노래들 \r\nWe beyond that level, We beyond all that! Now take a look at you, where y'all at? \r\n\r\n그 동안 참 많은 일이 있었지. 구석진 곳에서 열심히 쓴 가사로 \r\n억지 diss 도 해 보고, 모함과 유치한 선전포고, 가지가지로 놀더군. 하지만 어떤 방법으로도 \r\n우리의 자릴 차지할 순 없어. 잘 생각해봐. 시간이 갈 수록 더 선두와의 차이는 점점 멀어지고 있어. \r\n아직도 rhyme or not - 말도 안되는 선택의 기로에서 망설이고 있는 hip-hop kids 여 \r\n엉뚱한 곳에서 그대 젊음이 다 시들어 버리길 원하지 않는다면 just put the mic down \r\n적절한 시기를 모르겠다면 right now 이런 얘기만 하면 모두 자신를 속이네 \r\neverybody's a scaredy cat 지금 이 곡을 듣고 우리가 얼마나 왔나를 똑바로 봐 \r\ncompared to that of yours and realize where you at \r\n\r\nHook] x2 fade out \r\n\r\nHook reprise]</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/270/15026270_1407308166573_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130318, lowkey: nil, highkey: nil},
  {album_id: 57, singer_id: 68, team_id: nil, title: "A Light Step", genre1: "가요", genre2: "랩/힙합", runtime: "02:14", lyrics: "\n\t\t\t\t\t\t\t<div>A Light Step - 02:14</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가사 정보가 없습니다.</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/270/15026270_1407308166573_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130319, lowkey: nil, highkey: nil},
  {album_id: 57, singer_id: 68, team_id: nil, title: "Fantasy Rider", genre1: "가요", genre2: "랩/힙합", runtime: "03:18", lyrics: "\n\t\t\t\t\t\t\t<div>Fantasy Rider - 03:18</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">겉보기에 그 곳은 흔히보이는 평범한 Bar의 모습을 지니고 있네 \r\n하지만 그 속에 숨겨져있는 매력에 난 오늘밤에도 이끌리네 \r\n밤 열시가 다 되어서야 겨우 문을 열 시간, 간판의 불을 켜 \r\n이 야경속에 숨은 그림 찾기를 만들어내는 작은 클럽의 이름 \r\n-Fantasy Rider- 작게 흘러나오는 음악에 맞춰 문을 열고 들어가면 \r\n늘 날 반겨주는 브로마이드 속 이름 모를 삼바 아가씨의 미소 어두운 조명 아래 겨우 익숙해 \r\n진 내 눈에 비치는 무대 부스의 DJ는 이제 오늘의 선곡을 마치곤 주위를 둘러보는데 \r\n달콤한 Portuguese 속삭임과 나른한 선율로 가득한 시간 이 밤의 시작은 늘 -보사노바- \r\n이럴땐 둘이 더 외롭네, -혼자보다- \r\n\r\nHook 1] tonight, 심야의 보랏빛(sky) 하늘에 내리는 소나기가 나른해 \r\n이 밤 내 마음을 흘러가는 수많은 노랫말들로 내 삶 속에서 가장 편한 시간들을 써내려가다 \r\n문득 되뇌이게 되는 이름 (say) Fantasy Rider (Fantasy Rider) \r\n\r\n열일곱 살 부터 스물일곱 살 그 사이에서 나일 구분하지 못할 묘한 표정과 오라에 둘러쌓인 \r\n그녀가 건네준 갈색 메뉴 파일 늘상 즐기는 Nacho &amp; Hooch 대신 오늘따라 끌리는 칵테일을 주문 했지 \r\n가벼운 미소로 추천을 대신 하고 돌아선 그녀 이 클럽의 may queen \r\n필라멘트 백열등 빛아래 낯익은 그림자가 내게 손짓하네 \r\n아직 빈 자리가 더 많은 평일밤의 클럽 난 받아들여 진걸까, 이 공간에선? \r\n날마다 변하는 램프의 아로마 (and) 그보다 부드러운 리듬의 파도가 (내) 오감을 감싸고 돌아, \r\n이밤 만일 니가 내 곁에 있다면 난 너의 마음을 읽을수 있을지도 몰라 \r\n시간이 지나 Fantasy Riderz들로 가득한 이 클럽 안을 봐, 모든이가 마법을 원하는 밤 \r\n\r\nHook 2] tonight, 심야의 보랏빛(sky) 하늘에 내리는 소나기가 나른해 \r\n이 밤 내 마음을 흘러가는 수많은 노랫말들로 내 삶 속에서 가장 편한 시간들을 써내려가다 \r\n문득 찾아가게 되는 클럽(where) Fantasy Rider (Fantasy Rider) \r\n\r\n몇 달째 멈춰있는 pin ball game의 high score 오늘도 그 기록에 도전하던 알바걸은 마침내 \r\n잭팟 타깃을 명중시키네 모두가 그녈 주시하는 건 그녀의 기쁨이 뭘 의미하는 것인가를 잘 알기 때문이네 \r\n이 밤의 마법의 주문은 이제 그 효력이 발휘돼 테이블마다 스페셜 샌드위치 &amp; 피나 콜라다 \r\n서비스가 전해지고 부스 안의 DJ는 음악을 조금씩 fade-out해 술렁이는 사람들의 소란을 \r\n잠재우는 이 밤의 헤드라이너 밤새 무표정했던 DJ는 간만에 미소 지으며 무대의 bass를 잡네 \r\n클럽 마스터가 드럼 세팅을 마칠 무렵 문득 나와 눈이 마주친 그녀가 내게 물었네 \r\n\"듣고 싶은 노래 있어요?\" Yeah I wanna listen to your \"Puppy Love\" you know?</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/270/15026270_1407308166573_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130320, lowkey: nil, highkey: nil},
  {album_id: 57, singer_id: 68, team_id: nil, title: "Puppy Love", genre1: "가요", genre2: "랩/힙합", runtime: "02:14", lyrics: "\n\t\t\t\t\t\t\t<div>Puppy Love - 02:14</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가사 정보가 없습니다.</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/270/15026270_1407308166573_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130321, lowkey: nil, highkey: nil},
  {album_id: 57, singer_id: 68, team_id: nil, title: "오늘은", genre1: "가요", genre2: "랩/힙합", runtime: "03:45", lyrics: "\n\t\t\t\t\t\t\t<div>오늘은 - 03:45</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">B-Soap] \r\n오늘도 아침을 거른채 시계 바늘의 눈치를 살피는 걸로 시작하는 하루네 \r\n늘 바쁘게 그리고 숨 가쁘게 흘러 감을 당연하게 난 늘 여겨 왔는데 \r\n지난밤엔 비, 문득 올려다 본 맑게 게인 깨끗한 하늘 아래 투명하게 살짝 맺힌 \r\n손 닿으면 흩어질 것 같은 구름 넌 내 바쁜 걸음을 멈추게 만드는 걸 \r\n출근 인파속에 섬처럼 떠있는 나 이 흐름의 끝엔 대체 뭐가 놓여있는가? \r\n그건 의미없는걸 나에게 지금 이순간 가장 중요한건 경쾌한 내 걸음의 리듬감 \r\n그래 오늘 하루만은 어제와는 다른 날 찾는 날 나를 아는 법을 알아가는 날 \r\n가벼운 발걸음으로 평소완 다른 방향을 향하네 달콤한 이 멜로디와 함께 \r\n\r\nChorus(정인)]  Everyday, and everytime when you're feeling so sweet in yo life \r\nthere's a reason like sunshine that make you high \r\nEveryday, and everytime when you're feeling so tired of going your way \r\njust close your eyes and get your time for self \r\n\r\nVerbal Jint] 차가운 밤바람에 술냄새 날마다 내 지나간 하루를 후회해 \r\n물론 어제 역시 오늘을 후회없이 보내겠다고 속으로 되뇌었지 \r\n하지만 이 세상은 나에게 협조해 주지 않네 가방 속에 처박혀 있는 편지지 안에 \r\n그 사람에게 전하지 못한 말들 마치 난 언제나 나 혼자만을 의지하며 이 길을 가야만 한다는 것처럼 \r\n오 하느님은 어쩌면 내게 이런 소심한 성격을 주셨나요? \r\n너무 피곤해..뜨거운 물로 샤워를 하고 침대에 엎드려 젖은 몸을 말리면서 \r\n내가 제일 아끼는 펜으로 일기를 써 오늘도 이렇게 하루를 보냈어 Dien Michel, 이 소녀를 위로해줘 \r\n\r\n[Chorus] x8 \r\n\r\nSteady B] 나는 내가 대단한 사람이 아니기에 평소 살아가는 생활은 아주 평범하지 \r\n하지만 난  평범함 속에서 나이기에 나에게만 있어서 특별한 서너가지 \r\n쯤은 내 속안에 있다고 생각해  내안에 채 표현 안된 수많은 생각에 \r\n여러 밤을 지새우며 또 다른 내 삶의 대안의 글귀를 쓰며 오늘을 살아간다네 \r\n내 앞에 주어진 조각의 시간을 모아서 걸어 온 자취를 한곳에 담으려고 모았어 \r\n하나씩 생각나는 기억들 지금 돌아서 생각하면 너무 어려서 부끄러웠던 때와 \r\n미칠정도로 힘들었던 나와의 대화 여러 갈림길에 섰던 방황의 한때 다 \r\n이제는 가슴 한켠에 고이 간직한 채 한 단계 높은 내 자신을 기다리려 하네 \r\n\r\n[Chorus w/ fade out] \r\n\r\n\r\n- 뒤로 -</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/270/15026270_1407308166573_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130322, lowkey: nil, highkey: nil},
  {album_id: 57, singer_id: 68, team_id: nil, title: "Nightbloomers", genre1: "가요", genre2: "랩/힙합", runtime: "02:46", lyrics: "\n\t\t\t\t\t\t\t<div>Nightbloomers - 02:46</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가사 정보가 없습니다.</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/270/15026270_1407308166573_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130323, lowkey: nil, highkey: nil},
  {album_id: 57, singer_id: 68, team_id: nil, title: "Don't Sell Yourself", genre1: "가요", genre2: "랩/힙합", runtime: "03:32", lyrics: "\n\t\t\t\t\t\t\t<div>Don't Sell Yourself - 03:32</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">Ix Gotti] \r\n어느덧 스물 하나, 자그마한 이 어둡고 불안한  길 위에서 먼 곳을 바라 보며 돌이켜 보면 순식간의 찰나 \r\n였다고 말하기는 힘든 ma life 선택의 길을 따라 걸어가며 내가 겪었던 삶, 사람 그리고 사랑 \r\n어차피 인생은 살아야만 한단 말야 당신이 원하던, 원하지 않던 \r\n\r\n2 Dirty] (16x) \r\n평범하게 꿈을 접고 살아 가긴 싫다네 쉽지 않다는걸 잘알고 있음에도, 이 삶에 \r\n빠져버린 이상 내 자신과의 약속안에 후회 하지 않게 다짐 또 다짐을 하네 \r\n차례 차례 무거워 지는 삶의 무게에 그리고 살면서 맞대는 문제들에 대해 \r\n절실하고도 빛나는 지혜로 모두가 내게 공감할테니 변화에 대한 확신을 갖으리 \r\n내가 온 무대를 하나씩 밟아가듯이 삶속에서 다진 내세계의 가르침 \r\n그자체로 나의 삶속의 운명은 반드시 내 의지대로 개척하며 나만의 rule을 만들지 \r\n어둠이 삼킨 빛과도 같은 갈림길에서 내가 택한 방식 대로 바로 이자리에서 \r\n거침없이 난 달리겠어 미쳐버린 이 삶위에서.. \r\n\r\nHook] \r\nDon't sell yourself (Don't sell yourself) \r\n그리 길지 않은 삶에서 무엇에 도전하는 용기를 얻게, 후회는 없게 (가끔 잡을 수 없게) \r\n혹은 찾을 수 없게 (막다른 골목에서 참을 수 없게 된다해도 시험과 실험의 차이를 기억해) \r\n용기란 언제나 가까이 늘 니 곁에 (두 손안에 잡기를 이렇게) \r\n\r\n2 Dirty] \r\n나는 여태껏 혹은 아직도 인생이라는 이름의 길 그길을 달리고 있다는 사실을 잊고 지내지 않아 \r\n시간은 빠르게만 흘러 가고 있는데 흐린빛 하늘 아래 멈출순 없어 어떤 큰힘이 나를 \r\n누른다해도 그만둘순 없어 바로 내 삶을걸어온 길에대해 후회 하지 않아 나는 \r\n알고 있어 후회해도 소용없다는 말을.. \r\n\r\nIx Gotti] \r\n과거의 선택 은 언제나 현재 혹은 이 다음의 언제 자신에게 돌아 올 일종의 거래 \r\n서로 다른 갈라진 길에 달라질 미래 지레 겁을 먹는 보이지 않는 길에 불안감은 비례 \r\n분명 정해지지 않은 운명 그 속에, I will be there 눈 앞에 펼쳐지는 갈등과 반전 \r\n또 다른 이야기로 발전 언젠가 한번 보았던 지루한 영화 중 한 편에 나올 법한 이야기의 장면이지만 반면 \r\n그것과는 다르게 대본은 없어 오늘은 또 어떤 가파른 언덕이 날 기다릴런지, 숨 가쁘게 헐떡 \r\n거리며 바삐 내 옆을 따라 지나치는 사람들을 바라보면서 나는 또 하루의 태엽을 감아 \r\n\r\nHook] \r\nDon't sell yourself (Don't sell yourself) \r\n그리 길지 않은 삶에서 무엇에 도전하는 용기를 얻게, 후회는 없게 (가끔 잡을 수 없게) \r\n혹은 찾을 수 없게 (막다른 골목에서 참을 수 없게 된다해도 시험과 실험의 차이를 기억해) \r\n용기란 언제나 가까이 늘 니 곁에 (두 손안에 잡기를 이렇게) \r\n\r\n\r\n- 뒤로 -</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/270/15026270_1407308166573_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130324, lowkey: nil, highkey: nil},
  {album_id: 57, singer_id: 68, team_id: nil, title: "Unspoken Love", genre1: "가요", genre2: "랩/힙합", runtime: "02:23", lyrics: "\n\t\t\t\t\t\t\t<div>Unspoken Love - 02:23</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가사 정보가 없습니다.</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/270/15026270_1407308166573_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130325, lowkey: nil, highkey: nil},
  {album_id: 57, singer_id: 68, team_id: nil, title: "생각나", genre1: "가요", genre2: "랩/힙합", runtime: "03:22", lyrics: "\n\t\t\t\t\t\t\t<div>생각나 - 03:22</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">Intro] Kandid Collection volume one VJ &amp; Krazy Kricc once again \r\nIt's about the memories, bro Check it, say \r\n\r\nHook] \r\n그 땐 그 모든 것들이 영원히 그대로일 것만 같아 머리를 두리번거리며 멍청한 얼굴로 행복하다 말했네. \r\nAnd the years passed by like 하나 둘 셋 넷 시간이란 건 참.. 그건 참 나도 모르게 \r\n기억의 film 들을 새하얗게 태워놔 망각이란 현상 그리워서 다시 들춰보려하지만 그 땐 이미 너무나도 아련한 \r\n\r\n우리 집 뒤를 흐르던  조그만 강을 따라 걸어갈 때면 귓가를 간지럽히는 바람, 그리고 꼭 시간이 멈춘 듯 \r\n나의 눈 가득히 햇빛을 받으며 멈춰 서 있었던 특히 나른한 토요일 오후면 꼭 그랬었던 그 때가 생각나 \r\n언제건 어디에서건 그냥 cool 함을 넘어선 beyond cool 을 염불 외듯이 가슴에 새기고 \r\n힘 빠진 이 도시의 낡은 회색 위로 조금은 다른 자국을 남기리라 다짐했네 비록 아직 어리지만 \r\n진실한 자신의 얘기로 빛을 발한다면 뭔가 달라질지도 모른다고, 자신이 아름다워야 이 세상이 조금이라도 \r\n아름다울 꺼라고, 속물의 '속' 자만 들어도 뱃 속부터 입까지 전부 다 올라오려고 했었던 \r\n\r\nHook] \r\n그 땐 그 모든 것들이 영원히 그대로일 것만 같아 머리를 두리번거리며 멍청한 얼굴로 행복하다 말했네. \r\nAnd the years passed by like 하나 둘 셋 넷 시간이란 건 참.. 그건 참 나도 모르게 \r\n기억의 film 들을 새하얗게 태워놔 망각이란 현상 그리워서 다시 들춰보려하지만 그 땐 이미 너무나도 아련한 \r\n\r\n학교 앞을 천천히 걸어 지나갈 때면 일상적인 말이나 어떤 정확한 개념, \r\n그 중 어떤 것으로도 설명이 되지 않는 나만의 기준, 아마 내 당시의 세계관으로부터 비롯된 그런 기준을 가지고 \r\n지나가는 애들 하나하나를 각각이 속한 몇 개의 type 으로 분류하곤 했었네. \r\n그 중엔 그냥 좀 곤란했던 애, 너무나 평범했던 애, 그리고 나와 주파수가 맞아보였던 아주 적은 수의 \r\n구체적인 삶의 여건이나 외모는 달라도 주파수가 맞았던 애들이 있었네. 가끔 그 뒤를 따라가선 \r\n별다른 말 없이 그냥 눈빛만 느껴보곤 했네 그건 단순히 사춘기랑 관련된 것만은 아니었네, \r\n나와 그들이 언제 서로를 알아보게 될까 기다리던때 \r\n\r\nHook] \r\n그 땐 그 모든 것들이 영원히 그대로일 것만 같아 머리를 두리번거리며 멍청한 얼굴로 행복하다 말했네. \r\nAnd the years passed by like 하나 둘 셋 넷 시간이란 건 참.. 그건 참 나도 모르게 \r\n기억의 film 들을 새하얗게 태워놔 망각이란 현상 그리워서 다시 들춰보려하지만 그 땐 이미 너무나도 아련한 \r\n\r\n너무나도 아련한 기억, 다시 돌아갈 수 없는 그 날의 향기여. \r\n잠시 어딘가 쉬었다가 다시 몸을 일으키면 마치 먼지처럼 바람에 흩날리며 \r\n이미 두 손으로 잡을 순 없게 되어버리는 기억들.. \r\n지겹도록 다닌 홍대 앞 거리, 그 옆으로 조금만 걸어가면 EP 들을 작업하던 \r\n2001년의 합정동이란 수많은 상념을 자극하는 동네가 있어 \r\n나이 어릴 때부터 골목길가에서 쭈그리고 앉아서 낙서를 하던 곳 \r\n이젠 세월이 흘러가고 낯설은 감정으로 다시 그 길을 걷네. \r\n오랜만에 만난 친구에게 얘기를 건네듯, 친근함과 어색함이 뒤섞인 내 머리 속. \r\nI guess Dien Michel was wrong. It must be more than just the memories, bro..</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/270/15026270_1407308166573_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130326, lowkey: nil, highkey: nil},
  {album_id: 57, singer_id: 68, team_id: nil, title: "Can You Feel It? Part Ⅱ", genre1: "가요", genre2: "랩/힙합", runtime: "02:25", lyrics: "\n\t\t\t\t\t\t\t<div>Can You Feel It? Part Ⅱ - 02:25</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가사 정보가 없습니다.</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/270/15026270_1407308166573_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130327, lowkey: nil, highkey: nil},
  {album_id: 57, singer_id: 68, team_id: nil, title: "도착", genre1: "가요", genre2: "랩/힙합", runtime: "04:32", lyrics: "\n\t\t\t\t\t\t\t<div>도착 - 04:32</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">B-Soap] 그 모든건 다 이미 예정된 결말이었는걸 like Stan Getz의 12'' Girl from Ipanema \r\nSingle과 또 나를 스쳐간 그녀들의 달콤한 입술과 함께 나눈 일들과 많은 문란한 \r\n짓들 따위 진부한 느낌들-만으론 닿을수 없는 곳으로부터 내게 다가온 너를 본 순간 \r\n그 모든건 다 이미 예정된 결말이었는걸 깨닫기란 내게 그다지 어려운건 아니었는걸 아니? \r\n아마도 내 삶의 약 80% 이상은 이 바람속에 휘날리며 사라지겠지만 \r\n그만큼의 희생이라면 감수해도 돼 너라는 앨 얻을 수 있다면 난 그래도 돼 \r\n가끔 니가 내곁에 함께하는 짧은 시간은 마치 비가 내리는 새벽의 보라빛 하늘을 닮은 Magic Time, \r\n내 오감이 디자인 해준 Rhyme에 휩싸인 채 내 삶의 전부를 Melody로 바꿔준 너라는 존잰 \r\n그 어떤 허튼 유혹속에도 멈추지 않을 나만의 노래 설령 모든걸 다 양보해도 다른 누군가의 손에 \r\n넘길 수 없는 단 하나만의 소중함 난 그것만의 노예가 된다해도 내 삶에 만족해 u understand?</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/270/15026270_1407308166573_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130328, lowkey: nil, highkey: nil},
  {album_id: 57, singer_id: 68, team_id: nil, title: "Feed Somebody's Soul", genre1: "가요", genre2: "랩/힙합", runtime: "04:21", lyrics: "\n\t\t\t\t\t\t\t<div>Feed Somebody's Soul - 04:21</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가사 정보가 없습니다.</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/270/15026270_1407308166573_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130329, lowkey: nil, highkey: nil},
  {album_id: 57, singer_id: 68, team_id: nil, title: "Just The Memories", genre1: "가요", genre2: "랩/힙합", runtime: "04:38", lyrics: "\n\t\t\t\t\t\t\t<div>Just The Memories - 04:38</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">I told her\r\n많은 시간을 생각해봤어\r\n우리가 왜 낯선 미래를 따로 맞이해\r\n들어봐 내가 선택한 동반자는 너라고\r\n그때 이후로 물론 한참을\r\n더 반복해서 생각했어\r\n지금 내 앞에서\r\n꼭 대답해줘야만 돌아가겠어\r\n아름답게 저물어가는 태양을 보며\r\n이야기하기 위해\r\n일부러 나는 이 먼 곳까지\r\n널 데리고 왔는데\r\nI just can't wait anymore\r\n대답을 해\r\n분명 우린 다음 단계로 가고 있어\r\n니 마음을 제대로 알고 싶어\r\nShe told me radio 에서 들려오는\r\n이상은의 벽 밀려오는 피곤에\r\n눈 감은 내 벗 너와 내가\r\n조금씩 변해가는 우리의 관계에 대해\r\n내린 서로 다른 해석\r\nyeah i know that\r\n우리는 많이 닮아있어\r\n너의 고백\r\n고민이 혼자만의 것은 아닌걸\r\n하지만 이걸 알아주었으면 해\r\n난 우리가 함께 무엇을 언제\r\n이룰 수 있다 생각하진 않아\r\n유난히 아련한 향기의\r\n사진 하나로 남을 수 있을 정도\r\n딱 그만큼이 좋을 것 같아\r\nIt's not your problem\r\nIt's just the memory\r\n이제는 변해버리고\r\n또 퇴색 되버린 것\r\nJust the memories\r\n하지만 여전히\r\n내 머리 속에 가득 채워진 것\r\nI still\r\nRemember shit\r\nBig Pie feel like this\r\n서로가 택한 각자의 길\r\n각자의 길 어디에서\r\n다시 만나도\r\n반가이 미소질 수 있을 그런 사이길\r\n이 도심의 싸늘한 밤공기에\r\n뒤섞인 네 가느다란 목소리엔\r\n이제부터 시작될\r\n너의 아픈 얘기의 해답이\r\n이미 깃들어 있네\r\n밤새 눈물에 젖은 네 검은 머릿결\r\n지난 밤중에 겪은게\r\n서툰 첫 이별 전화 한통화에도\r\n머뭇거리던 처음관 다른\r\n그 남자의 난폭한 태도\r\n흔히 친구라고 말 하는 관계로\r\n너의 일상일 수 있음에\r\n만족한 채로 지내온 삶의 리듬에\r\n이제는 나도 익숙해 졌기에\r\n차분히 널 위로하고 싶은데\r\n사실은 지금 내 안의 진심이 나\r\n자신을 비웃네 마음을\r\n숨기지마라고 외치네\r\n만일 그 대신에 나였다면\r\n먼저 서로에게 관심을 가졌다면\r\n수많은 가정법 안에 빠져버린\r\n내 마음을 아는지\r\n넌 내게 기대와\r\n헤너시 한모금 만큼\r\n뜨거운 이 열기\r\n우린 그저 무거운 침묵 속에 취해가\r\n난 너의 긴 삶 초반에 스쳐가\r\n버리긴 원치 않아\r\n널 안기엔 아직도 난 어리지\r\n지금은 이렇게 힘든 널\r\n위로해 줄수 있는\r\n편한 존재로만 나를 기억해도 되\r\nIt's just the memory\r\n이제는 변해버리고 또 퇴색 되버린 것\r\nJust the memories\r\n하지만 여전히\r\n내 머리 속에 가득 채워진 것\r\nI still Remember shit\r\nBig Pie feel like this\r\n서로가 택한 각자의 길\r\n각자의 길 어디에서 다시 만나도\r\n반가이 미소질 수 있을 그런 사이길\r\n내 맞은편에 자리했던\r\n너란 다른 존재\r\n익숙해진 예전\r\n하루하루를 등 뒤에 논 채\r\n가졌던 서로만의 다른 기억들의 조각\r\n하나씩 맞춰 가고팠어\r\n너와 있는 동안\r\n가끔 너의 눈안에서\r\n비춰질 내 모습 생각하면 불안해져\r\n그래서 나는 좁은 틀 안에서\r\n헤어 나지 못해\r\n눈을 피해 애써 너와 대화 했어\r\n탁상 위의 너의 사진 앞의\r\n나의 다짐 미숙한 사랑의\r\n틀을 뛰어넘은 마음가짐\r\n네가 하는 말이\r\n오래껏 가슴앓이\r\n했던 나를 지탱해 준\r\n단 한가지\r\n한 하늘 아래\r\n남과 다른 삶을 사는 이들\r\n그들과 별다르지 않은 우리의\r\n하루 이틀 속에서 확인 하려 했던\r\n서로간의 믿음\r\n허나 불안정한 우리 과거를 돌이켜봐\r\n지금 그렇게 또다른 작은 탑은 무너져\r\n현실의 시작을 아는 나는 두려워\r\n이 새벽 후엔 사뭇 다른\r\n일과가 주어져\r\n내겐 너의 감각들은 점차 무디어져\r\nIt's just the memory\r\n이제는 변해버리고 또 퇴색 되버린 것\r\nJust the memories\r\n하지만 여전히\r\n내 머리 속에 가득 채워진 것\r\nI still Remember shit\r\nBig Pie feel like this\r\n서로가 택한 각자의 길\r\n각자의 길 어디에서 다시 만나도\r\n반가이 미소질 수 있을 그런 사이길\r\nIt's just the memory\r\n이제는 변해버리고 또 퇴색 되버린 것\r\nJust the memories\r\n하지만 여전히\r\n내 머리 속에 가득 채워진 것\r\nI still Remember shit\r\nBig Pie feel like this\r\n서로가 택한 각자의 길\r\n각자의 길 어디에서 다시 만나도\r\n반가이 미소질 수 있을 그런 사이길</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/270/15026270_1407308166573_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130330, lowkey: nil, highkey: nil},
  {album_id: 57, singer_id: 68, team_id: nil, title: "Movin' It", genre1: "가요", genre2: "랩/힙합", runtime: "04:22", lyrics: "\n\t\t\t\t\t\t\t<div>Movin' It - 04:22</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">Krazie Kricc, 니가 바라보기엔, \r\n이 무대의 가장 큰 문제가 뭔지 말해줄래? \r\n\r\n그래 말해줄게, 따분한 래퍼들 때문에.\r\n적응이 안되는 그녀, 애꿎은 입술만 깨무네\r\n\r\n그럼 지금 이 분위기를 어떻게 바꿀래?\r\n\r\n쌔끈한 우리의 Rhyme과 Beat\r\n\r\nThe game is set, 끝내 우리앞에 망가진, \r\nparty girls, 우린 그 맘 속을 간파하지\r\n\r\nYo, Party, All over the night\r\n무엇보다 tight/ 하게 펼쳐지는 우리의 modern한 rhyme\r\n이속에서만/ 느낄수 있는 짙은 색깔이 묻어난 밤\r\n그위에서 난\r\n너의 귀에서 머리로, 머리에서 온몸으로\r\n자연스레 흘러드는 flow로\r\n이끌어, 시선을 내게로, 자 우리만의 다른 세계로,\r\nWe got you, 느껴봐 이 기분을 제대로. \r\n\r\nYou see'em cats they try'na move me\r\nBut the rhymes they got, you know it's kinda goofy\r\n어느덧 밤은 깊어 시간은 두시,\r\nWe ain't got much time, please get out UZI!!!\r\n후회해도 오늘 밤은 흘러가면 그만\r\n그대들의 마음 가득찬 불만을 씻어 줄만한 \r\n단 하나의 crew, 우리에게 맡겨주길 바래\r\nBaby boo, 이제 조금 이해가 돼?\r\n\r\n*We give it out,\r\nto all the ladies in the clubs, and the pubs\r\nKeep it movin', keep it movin',\r\nDJ's on the cut, and all the girls just starting to rub\r\nthey all just, Keep it movin', keep it movin'\r\n\r\n준비되었나? 지금 시작하는 나\r\nG-Ball의 구절을 잘 새겨봐\r\n이제 그대의 갈증을 칵테일\r\n한잔 같은 말로 풀어 갈테니\r\n\r\n모든 female 들이 우리에게 보내는 e-mail\r\n이제 기대일 곳을 찾은거지 (guess what?) \r\nInhale~ exhale~ \r\n너흴 위해 이제 거두는 이 베일\r\n\r\n이미 시작되버린 밀레니엄\r\n흐름 속에 묻혀진건 아니야\r\nAlmighty (Westyle)\r\n롸임의 (엑스타)시 그게 우리 의미야\r\n\r\nWestyler로 하나된 G-Ball, Hustla~la~la~\r\n섣불리 판단하지 말라.\r\n너희의 생각과는 차원부터가 달라.\r\n순간의 찰나 에도 *나 빨라.\r\n\r\nClik Clik Pow\r\nHow ya like me now\r\n나와 Hustla가 뿜어내는 운율\r\n(그것의 정교함은 마치 백 분율)\r\n와도 같아 이제 이 시간을 맡아\r\n\r\n너의 사타 구니 적실 우리의 혁신\r\n형식을 타파하는 우리의 정신.\r\n명심 하고들어 역시 우린 넘버원 아직도 모르고 있니 병신\r\n\r\n* Repeat\r\n\r\n깊은 밤, 귀를 희롱하는 beats and rhymes\r\n내가 알고 있는 가장 익숙한\r\n이 몸의 느낌, 지금 니들을 그냥 보내주기엔\r\n내 손에 들린 microphone 이 몹시\r\n아까워, 아가씨들이 바라던 차원이 다른 flow\r\n그건 바로 날 원한다는 뜻이라고\r\nSo, I'm ready to grab the mic and prove it now\r\nLadies back their ass up like Juvenile\r\n\r\n아직 모르겠나? 우리의 혀를 빌린\r\n너의 본 마음, 이 무대가 일깨워줄 진리\r\nG-ball &amp; Hustla의 Sexual Healing\r\n그건 거부해선 안될 Natural Feeling\r\nCan you feel me? 앞만 떠밀기\r\n바쁜 거칠기 짝없는 자들과 뒤섞일리\r\n없는 나 B-S-O 그리고 Kricc &amp; Jint\r\nDien Michel로 이어진 우리의 Wit\r\n자 Lady~ 못 느낀척 하지는 마\r\n허접 새끼들과 우릴 비교 하긴 불가능\r\n너의 새침한 입술 안 더더욱 깊숙한\r\n곳으로 침투할 지금, 난 이순간을\r\n속삭인 Rhyme은 단지 '16' lines\r\n흥분에 휩쌓인 아가씨의 '18' sign\r\n그래, 예정된 Ecstasy 안봐도 뻔해\r\n그렇게 나와 함께 이순간을 즐기면 되\r\n\r\n* Repeat</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/270/15026270_1407308166573_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130331, lowkey: nil, highkey: nil},
  {album_id: 58, singer_id: 20, team_id: nil, title: "나비의 겨울", genre1: "가요", genre2: "R&amp;B/소울", runtime: "04:23", lyrics: "\n\t\t\t\t\t\t\t<div>나비의 겨울 - 04:23</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">시간을 멈출 수 있다면 \r\n온 힘을 다해 막을 텐데\r\n어쩌면 우리 오늘이 마지막인데\r\n잠시 후면 볼 수 없을 텐데\r\n\r\n조금만 천천히 일어나 주겠니\r\n마지막 그 담배를 다 피울 때까지만\r\n부탁이야 조금만 더 \r\n너를 볼 수 있게\r\n\r\n며칠 전 우연히 보았던 \r\n짙은 화장의 취한 네 모습\r\n숨기고 싶은 또 다른 삶이 있다면 \r\n언제까지 모른 척 할 텐데 \r\n\r\n한번만 되돌려 줄 수는 없겠니 \r\n어떻게 이대로 사랑이 끝나니\r\n행복했던 처음으로 돌아갈 수 있게\r\n허락해줘\r\n\r\n너도 기억하니 \r\n숨이 멎을 듯 사랑했던\r\n꿈보다도 더 아름다워 \r\n부서질것 같던 눈부신 순간들\r\n\r\n기어코 날 두고 떠나야 한다면\r\n추억이 눈물이 되어야 한다면 \r\n부탁이야 조금만 더 \r\n너를 볼 수 있게</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/271/15026271_1404725281148_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 10075, song_num: 16130332, lowkey: nil, highkey: nil},
  {album_id: 58, singer_id: 20, team_id: nil, title: "좋은 사람", genre1: "가요", genre2: "R&amp;B/소울", runtime: "03:57", lyrics: "\n\t\t\t\t\t\t\t<div>좋은 사람 - 03:57</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">준비 없이 비를 만난 것처럼\r\n아무 말 못한 채 너를 보낸 뒤에\r\n한동안 취한 새벽에 잠을 청하며 \r\n너를 그렇게 잊어보려 했어\r\n\r\n시간이 가도 잊혀지지 않는 널 \r\n생각하면서 깨달은 게 있어\r\n\r\n좋은 사람 사랑했었다면 \r\n헤어져도 슬픈 게 아니야\r\n이별이 내게 준 것은 \r\n곁에 있을 때 보다 \r\n너를 더욱 사랑하는 맘\r\n\r\n셀 수 없이 많은 날을 울면서 \r\n힘든 가슴을 보이지 않았던 널\r\n끝내날 나쁜 남자로 만들었던 널 \r\n어떻게든 미워하려 했어\r\n\r\n어떤 말로도 미워할 수 없는 널 \r\n생각하면서 깨달은 게 있어\r\n\r\n좋은 사람 사랑했었다면 \r\n헤어져도 슬픈 게 아니야\r\n이별이 내게 준 것은 \r\n조금 멀리 떨어져 \r\n너를 헤아릴 수 있는 맘\r\n\r\n늦었겠지만 너의 맘 아프게 했던 \r\n바보 같은 날 용서해줘\r\n\r\n단 한번만 허락해 준다면 \r\n나를 믿고 돌아와 준다면\r\n언제나 말하곤 했던 \r\n그런 사람이 되어 \r\n너를 지켜주고 싶은데\r\n다시 돌아올 순 없겠니</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/271/15026271_1404725281148_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 10036, song_num: 16130333, lowkey: nil, highkey: nil},
  {album_id: 58, singer_id: 20, team_id: nil, title: "You N Me", genre1: "가요", genre2: "R&amp;B/소울", runtime: "04:40", lyrics: "\n\t\t\t\t\t\t\t<div>You N Me - 04:40</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">너를 처음 만난 순간부터 아픔이란 것\r\n니가 떠나가는 그때 느꼈지\r\n내가 부족한 건지 난 늘 묻곤 했지만\r\n아무 대답도 아무 말도 없었던 거야\r\n\r\n좀 더 내게 가까이 와봐\r\n오늘만은 나와 있어 줘\r\n다시 너를 한번 안아 보고 싶어\r\nYou and me \r\n헤어지는 사람들처럼 이러지는 마\r\n바보같이 보내 주는 게 싫어\r\n\r\nJust to try to let you know\r\n이제야 널 알 것 같은 데\r\n다시 나를 받아 줄 수 있겠니?\r\nJust to try once tonight\r\n환한 밤이 날 괴롭히면\r\n너도 내가 많이 걱정됐다고 말해줘\r\n\r\n한 땐 나를 떠난 니 생각에 한참 동안을\r\n잠도 못 이룬 채 뒤척였었지\r\n네게 하려 했던 말 끝내 하지 못한 건\r\n니맘 다치게 하고 싶지 않았던 거야\r\n\r\n나의 눈물 더는 믿지 마\r\n나의 노랠 이젠 듣지 마\r\n슬픈 꿈을 꾼 것처럼 모두 잊어\r\nYou and me\r\n아무것도 모르던 내게 보여준 세상\r\n나만 혼자 남겨 놓고서 \r\n\r\nJust to try to let you know\r\n이제야 널 알 것 같은데\r\n다시 나를 받아줄 수 있겠니\r\nJust to try once tonight\r\n환한 밤이 날 괴롭히면\r\n너도 내가 많이 걱정됐다고 말해줘\r\n\r\n흐르는 눈물은 없겠지\r\n네가 아닌 누굴 사랑했다면\r\n\r\nRain drops falling down my face\r\n밤새 들려오는 빗소리\r\n그 빌 흠뻑 맞고 거릴 걸어도\r\noh my life is like a song\r\n내게 남겨진 슬픈 노래\r\n나 하나만 사랑한다 했잖아\r\n그 말 때문에 울잖아</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/271/15026271_1404725281148_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130334, lowkey: nil, highkey: nil},
  {album_id: 58, singer_id: 20, team_id: nil, title: "그후", genre1: "가요", genre2: "R&amp;B/소울", runtime: "04:54", lyrics: "\n\t\t\t\t\t\t\t<div>그후 - 04:54</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">니가 날 떠난 지 벌써 일년이 지났어\r\n주위엔 변한 것도 많았었지\r\n하지만 나는 그대로 머문 것 같아\r\n지난 시간은 아직 어제와 같은걸\r\n\r\n널 잊을 거라고 믿고 \r\n다 없던 일처럼 살았어\r\n하지만 내겐 더 힘들뿐인걸 알았어\r\n너 지금 이순간 혹시라도 \r\n내 뒤에 서 있다면\r\n망설이지 말고 날 불러줘 \r\n널 볼 수 있도록\r\n\r\n너 떠나간 후에 나도 널 잊어보려고\r\n다른 여자도 몇 번 만났었지 \r\n너와 성격이 조금 닮았단 이유로\r\n한땐 결혼도 잠시 난 생각 해봤어\r\n\r\n널 잊을 거라고 믿고 \r\n다 없던 일처럼 살았어\r\n하지만 내겐 더 힘들뿐인걸 알았어\r\n너 지금 이순간 혹시라도 \r\n내 뒤에 서 있다면\r\n망설이지 말고 날 불러줘 \r\n널 볼 수 있도록\r\n\r\n오늘 널 잊는다고 해도 \r\n다시 내일이 오면\r\n또 다른 너를 잊어야만 하겠지\r\n\r\n널 잊을 거라고 믿고 \r\n다 없던 일처럼 살았어\r\n하지만 내겐 더 힘들뿐인걸 알았어\r\n너 지금 이순간 혹시라도 \r\n내 뒤에 서 있다면\r\n망설이지 말고 날 불러줘 \r\n널 볼 수 있도록</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/271/15026271_1404725281148_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130335, lowkey: nil, highkey: nil},
  {album_id: 58, singer_id: 20, team_id: nil, title: "Girl Of My Dreams", genre1: "가요", genre2: "R&amp;B/소울", runtime: "03:55", lyrics: "\n\t\t\t\t\t\t\t<div>Girl Of My Dreams - 03:55</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">난 선택했어 \r\n너를 처음 본 순간 난 빠져버렸어 \r\n넌 몰라도 좋아 그건 내 맘인걸 \r\n\r\n난 잠이 들 때면 \r\n꿈속의 그녀를 태우고 \r\n여행을 떠났지만 \r\n그녀의 까만 얼굴에 다가갈 때면 \r\n난 꿈에서 깨 \r\n\r\n누굴 사랑하는 건 \r\n네가 첨일 거야 \r\n나의 마음 모두 가져간 그녀 \r\n이젠 네게 다가가 \r\n사랑한단 말하고 싶어 \r\n더 이상 꿈을 꾸긴 싫어 \r\n\r\n(Rap)\r\n\r\n넌 냉정했어 \r\n오랜 고민 끝에 난 너에게 다가가 \r\n내 마음을 모두 고백했었지만 \r\n넌 다른 누군가를 \r\n이미 만나고 있다면서 \r\n뒤돌아 섰던 거야 \r\n하지만 너를 \r\n이렇게 포기하기가 난 어려운걸\r\n\r\n누굴 사랑하는 건 \r\n네가 첨일 거야 \r\n나의 마음 모두 가져간 그녀 \r\n이젠 네게 다가가 \r\n사랑한단 말하고 싶어 \r\n더 이상 꿈을 꾸긴 싫어 \r\n\r\n누굴 사랑하는 건 \r\n네가 첨일 거야 \r\n나의 마음 모두 가져간 그녀 \r\n이젠 네게 다가가 \r\n사랑한단 말하고 싶어 \r\n더 이상 꿈을 꾸긴 싫어 \r\n\r\n(Rap)\r\n\r\n누굴 사랑하는 건 \r\n네가 첨일 거야 \r\n나의 마음 모두 가져간 그녀 \r\n이젠 네게 다가가 \r\n사랑한단 말하고 싶어 \r\n더 이상 꿈을 꾸긴 싫어 \r\n\r\n누굴 사랑하는 건 \r\n네가 첨일 거야 \r\n나의 마음 모두 가져간 그녀 \r\n이젠 네게 다가가 \r\n사랑한단 말하고 싶어 \r\n더 이상 꿈을 꾸긴 싫어</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/271/15026271_1404725281148_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130336, lowkey: nil, highkey: nil},
  {album_id: 58, singer_id: 20, team_id: nil, title: "괜찮아", genre1: "가요", genre2: "R&amp;B/소울", runtime: "04:32", lyrics: "\n\t\t\t\t\t\t\t<div>괜찮아 - 04:32</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">괜찮아 \r\n너와 헤어진 지도 아주 오래되었고\r\n지독한 아픔도 거의 다 지웠어\r\n요즘은 말야 \r\n너의 기억도 없이\r\n아무 때고 흘러내린 눈물이\r\n오히려 미소로 변해 버렸어\r\n\r\n이젠 혼자서도 잠을 깨고\r\n니가 없는 텅 빈 방을 정리하며\r\n하룰 보내곤 해\r\n오래됐던 친구들과 \r\n지난 얘길 함께하며\r\n농담 섞인 웃음에 \r\n예전의 날 다시 찾았어\r\n\r\n너를 사랑했듯이 나를 사랑했다면\r\n널 잃지 않았고 \r\n아픈 상처도 없었을 텐데\r\n너를 사랑했듯이 나를 사랑했다면\r\n널 잃은 후에도 조금 더 빨리 널 \r\n떨쳐 버렸을 텐데\r\n\r\n이젠 혼자서도 꿈을 꾸고\r\n너와 함께 즐겨보던 \r\n드라마도 볼 수 있게 됐어\r\n길을 걷다 우연히 \r\n네 친굴 만났을 때도\r\n너의 안불 물어도 \r\n아무렇지 않게 되었어\r\n\r\n너를 사랑했듯이 나를 사랑했다면\r\n널 잃지 않았고 \r\n아픈 상처도 없었을 텐데\r\n너를 사랑했듯이 나를 사랑했다면\r\n널 잃은 후에도 조금 더 빨리 날\r\n추스렸을 텐데\r\n\r\n괜찮아\r\n우리 다시 만나면\r\n오랜만에 만난 친구처럼만\r\n반가워했으면 정말 좋겠어</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/271/15026271_1404725281148_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 11363, song_num: 16130337, lowkey: nil, highkey: nil},
