  {album_id: 58, singer_id: 20, team_id: nil, title: "사랑보다 깊은 상처", genre1: "가요", genre2: "R&amp;B/소울", runtime: "04:42", lyrics: "\n\t\t\t\t\t\t\t<div>사랑보다 깊은 상처 - 04:42</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">오랫동안 기다려 왔어 \r\n내가 원한 너였기에 \r\n슬픔을 감추며 널 보내줬었지 \r\n날 속여가면서 \r\n잡고 싶었는지 몰라 \r\n\r\n너의 눈물 속에 내 모습 \r\n아직까지 남아있어 \r\n추억을 버리긴 너무나 아쉬워 \r\n난 너를 기억해 \r\n이젠 말할게 나의 오랜 기다림 \r\n\r\n너 떠나고 너의 미소 볼 수 없지만 \r\n항상 기억할게 너의 그 모든 걸 \r\n사랑보다 깊은 상처만 준 난 \r\n이젠 깨달았어 후회하고 있다는 걸 \r\n\r\n이젠 모두 떠나가지만 \r\n나에게 넌 남아있어 \r\n추억에 갇힌 채 넌 울고 있었어 \r\n난 그런 너에게 \r\n아무런 말도 할 수 없어 \r\n\r\n그런 넌 용서할지 몰라 \r\n부족했던 내 모습을 \r\n넌 나를 지키며 항상 위로했었지 \r\n난 그런 너에게 \r\n이젠 이렇게 아픔만 남겼어 \r\n\r\n너 떠나고 너의 미소 볼 수 없지만 \r\n항상 기억할게 너의 그 모든 걸 \r\n사랑보다 깊은 상처만 준 난 \r\n이젠 깨달았어 후회하고 있다는 걸 \r\n\r\n나는 상상했었지 나의 곁에 있는 널 \r\n이젠 모든 나의 꿈들을 너에게 줄게\r\n\r\n너 떠나고 너의 미소 볼 수 없지만 \r\n항상 기억할게 너의 그 모든 걸 \r\n사랑보다 깊은 상처만 준 난\r\n이젠 깨달았어 후회하고 있다는 걸</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/271/15026271_1404725281148_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130339, lowkey: nil, highkey: nil},
  {album_id: 58, singer_id: 20, team_id: nil, title: "그녀를 알아요", genre1: "가요", genre2: "R&amp;B/소울", runtime: "04:16", lyrics: "\n\t\t\t\t\t\t\t<div>그녀를 알아요 - 04:16</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">그녈 욕하지 마요 \r\n우리 만나온 동안 \r\n나도 미워한 적이 없는데\r\n오직 한번뿐이죠 \r\n나를 아프게 한 건\r\n그렇게 많이 날 사랑했는데\r\n \r\n내가 슬퍼 한데도\r\n나를 위로 한데도\r\n내게 나쁘다고는 말하지 않기를\r\n그녈 떠나 보내고 \r\n나 아직 살고 있는데\r\n남은 날들도 난 걱정 말아요\r\n \r\n내 곁을 떠나며 \r\n차갑게 웃던 그대를\r\n거친 말들로 난 원망 했었죠\r\n하지만 알고 있어요 \r\n그대의 낯선 모습에\r\n나 쉽게 그대를 잊게 되기를 \r\n바랬던 거죠\r\n\r\n누구라도 좋아요 \r\n나를 사랑해줘요\r\n더는 나 혼자서는 \r\n잊을 수 없기에\r\n이젠 상관없어요 \r\n그녀가 아니라면\r\n내겐 누구도 다 똑같은 걸요\r\n \r\n내 곁을 떠나며 \r\n차갑게 웃던 그대를\r\n거친 말들로 난 원망 했었죠\r\n하지만 알고 있어요 \r\n그대의 낯선 모습에 \r\n나 쉽게 그대를 잊게 되기를 \r\n바랬던 거죠\r\n \r\n나를 지금껏 사랑한 적 없다고\r\n애써 웃음 짓던 그대 사랑을 \r\n난 알아요\r\n\r\n그대를 보내며 \r\n쉽게 다 잊을 것처럼\r\n아픈 말들로 난 돌아섰지만\r\n내 맘을 알고 있나요 \r\n그대도 힘든 것 같아\r\n쉽게 나의 곁을 떠나가라고 \r\n그랬던 나를</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/271/15026271_1404725281148_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 10105, song_num: 16130340, lowkey: nil, highkey: nil},
  {album_id: 58, singer_id: 20, team_id: nil, title: "사랑한걸로 됐어요", genre1: "가요", genre2: "R&amp;B/소울", runtime: "04:05", lyrics: "\n\t\t\t\t\t\t\t<div>사랑한걸로 됐어요 - 04:05</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">아무런 걱정하지 말아요\r\n나 하나 없다고 \r\n이세상이 바뀌진 않아\r\n참을 수 없이 아픈 상처도\r\n그대가 줬으니 \r\n소중하게 간직할게요\r\n\r\n그대를 향한 미움도\r\n날 위해 준 선물이라 생각하며 \r\n날 살아가겠죠\r\n\r\n사랑한 걸로 됐어요 \r\n내가 더 뭘 바랄 수 있을까요\r\n그댈 조금 더 곁에 두려 했던 \r\n헛된 욕심이 죄인걸요\r\n\r\n영원히 잊고 살아요 \r\n나도 그댈 모른다 말할게요\r\n두고 보세요 \r\n우린 단 한번도 이세상에서 \r\n만난 적 없다고 말할 테니까\r\n\r\n그대를 향한 미움도\r\n날 위해 준 선물이라 생각하며 \r\n날 살아가겠죠\r\n\r\n사랑한 걸로 됐어요 \r\n내가 더 뭘 바랄 수 있을까요\r\n그댈 조금 더 곁에 두려 했던 \r\n헛된 욕심이 죄인걸요\r\n\r\n영원히 잊고 살아요 \r\n나도 그댈 모른다 말할게요\r\n두고 보세요 \r\n우린 단 한번도 이세상에서 \r\n만난 적 없다고 말할 테니까</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/271/15026271_1404725281148_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130341, lowkey: nil, highkey: nil},
  {album_id: 58, singer_id: 20, team_id: nil, title: "Feel Me", genre1: "가요", genre2: "R&amp;B/소울", runtime: "03:56", lyrics: "\n\t\t\t\t\t\t\t<div>Feel Me - 03:56</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">자꾸 달아나지마 난 이미 시작됐어\r\n너의 맘은 내꺼야\r\n더는 피할데가 없어 솔직히 니맘\r\n날 자꾸 신경쓰잖아\r\n\r\n매일 똑같은 만남에 지루한 널 알아\r\nYou can change a love oh\r\n운명같은 사랑을 꿈꾸고 있잖아\r\nListen to my heart\r\n잠시 너의 손을 나에게 내밀어\r\n내가슴을 날 만져봐\r\n너의 사랑이 나라는걸\r\n바삐 뛰는 내 숨결 느껴봐\r\n\r\n너무 서두르진마 \r\n쉬운건 재미없어 \r\n천천히 널 열거야\r\n아직 내 사랑은 길어 \r\n함께할 시간 조금씩 보여 줄거야\r\n\r\nuh a ya! (you're be my love)\r\nuh a ha\r\nuh a ya (날 원하고 있잖아)\r\n\r\n너를 원하는 사람이 많은걸 알지만 \r\nwho can loving you ! oh!\r\n니맘 열을 열쇠는 내게만 있어\r\nI want get your love\r\n\r\n때론 레몬처럼 상큼한 니 미소가\r\n그냥두긴 위험한걸 \r\n하지만 조그만 질투조차 \r\n느껴본적 없는걸 \r\n니맘 아니까\r\n\r\n너무 서두르진마 \r\n쉬운건 재미없어 \r\n천천히 널 열거야\r\n아직 내 사랑은 길어 \r\n함께할 시간 조금씩 보여 줄거야\r\n\r\n첨 시작한 예쁜 연인처럼 \r\n설레이게 해줄게 \r\n나를 믿어도 좋아\r\n\r\nuh a ya! (you're be my love) \r\nuh a ha\r\nuh a ya (날 원하고 있잖아)\r\n\r\n너무 서두르진마 \r\n쉬운건 재미없어 \r\n천천히 널 열거야\r\n아직 내 사랑은 길어 \r\n함께할 시간 조금씩 보여 줄거야\r\n\r\n자꾸 달아나지마 난 이미 시작됐어\r\n너의 맘은 내꺼야\r\n더는 피할데가 없어 솔직히 니맘\r\n날 자꾸 신경쓰잖아</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/271/15026271_1404725281148_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 13488, song_num: 16130342, lowkey: nil, highkey: nil},
  {album_id: 58, singer_id: 20, team_id: nil, title: "살아있는 건", genre1: "가요", genre2: "R&amp;B/소울", runtime: "04:07", lyrics: "\n\t\t\t\t\t\t\t<div>살아있는 건 - 04:07</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">간절히 원할수록 \r\n세상은 관대하지 않아 \r\n또다시 같은 곳에 쓰러지긴 싫어서 \r\n누군가 내 어깨를 감싸주려 할때면 \r\n달아나곤 했던 지난날.. \r\n\r\n하지만 너는 다가와 \r\n나의 하늘을 열고 \r\n내가 나를 가뒀던 \r\n두려움을 벗고서 \r\n자유롭게 해 \r\n살아있는건 사랑하고 있는것 \r\n다시 쓰러진대도 세상에 \r\n날 열어두는것 \r\n\r\n가지려고 할수록 \r\n오히려 넉넉하지 않아 \r\n가난한 내 모습을 보여주긴 싫어서 \r\n누군가 내 가슴을 두드리려 할때면 \r\n굳게 걸어 잠근 지난날.. \r\n\r\n하지만 너는 다가와 \r\n나의 하늘을 열고 \r\n내가 나를 가뒀던 \r\n두려움을 벗고서 \r\n자유롭게 해 \r\n살아있는건 사랑하고 있는것 \r\n다시 쓰러진대도 세상에 \r\n날 열어두는것 \r\n\r\n또하나의 내가 되어주겠니 \r\n아득한 삶의 길에 \r\n나를 일으켜줄 빛이 되어 준다면 \r\n무엇도 난 두렵지 않아 \r\n\r\n떠난다해도 다시 슬퍼진대도 좋아 \r\n너의 얘기를 기억하니까 \r\n살아있다면 사랑해야 한다고 \r\n슬퍼해본 사람이 \r\n행복을 느끼는 거라고\r\n\r\n살아 있다면 사랑해야 하는것 \r\n상처입은 날개로 \r\n또 한번 더 높이 나는 것\r\n상처입은 가슴을 \r\n말없이 꼭 안아 주는 것</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/271/15026271_1404725281148_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 11079, song_num: 16130343, lowkey: nil, highkey: nil},
  {album_id: 58, singer_id: 20, team_id: nil, title: "모래성", genre1: "가요", genre2: "R&amp;B/소울", runtime: "04:24", lyrics: "\n\t\t\t\t\t\t\t<div>모래성 - 04:24</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">잊혀질만큼 괜찮을만큼 \r\n조금만 사랑했다면 좋았을텐데\r\n너도 나처럼 이런 생각하는지\r\n오늘은 왠지 더욱 힘들어 잠들수없어 \r\n\r\n우리 사랑한 날들 매일을 마지막처럼 \r\n너무 간절히 사랑한 추억은 \r\n이별이란 파도에 무너진 모래성처럼 \r\n아름다울수록 더 아프단걸 \r\n왜 그때 우린 알지 못했나 \r\n\r\n아니라는걸 안된다는걸 \r\n맨처음 알게 됐을때 포기했다면 \r\n너같은 사람 마음 아프게 하고 \r\n미련한 나를 만나는 일은 없었을텐데 \r\n\r\n우리 사랑한 날들 매일을 마지막처럼 \r\n너무 간절히 사랑한 추억은 \r\n(너무 간절히 사랑한 추억은) \r\n이별이란 파도에 무너진 모래성처럼 \r\n아름다울수록 더 아프단걸 \r\n왜 그때 우린 알지 못했나 \r\n\r\n노력해볼게 오랜뒤에 다시 만나면 \r\n된다고 참아낼 수 있다고 \r\n웃으며 말하던 네가 나보다 더 힘들테니까 \r\n너무 소중한 추억 하나 마저 \r\n\r\n시간이란 파도에 다시는 씻기지 않게 \r\n나의 마음속에 널 간직할게 \r\n영원히 무너지지 않도록</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/271/15026271_1404725281148_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 10629, song_num: 16130344, lowkey: nil, highkey: nil},
  {album_id: 58, singer_id: 20, team_id: nil, title: "운명이란 뜻이죠", genre1: "가요", genre2: "R&amp;B/소울", runtime: "04:08", lyrics: "\n\t\t\t\t\t\t\t<div>운명이란 뜻이죠 - 04:08</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">정말 모를 일이죠\r\n쉽게 할 말은 아니죠 \r\n내 인생이 다 변할 것 같은 \r\n그 순간을\r\n나 어떻게 찾을까 \r\n\r\n운명이란 뜻이죠 \r\n혹시나 그대인가요\r\n자연스럽게 다가오는 너\r\n마음속에 숨긴 사람 같아요\r\n\r\n지금인가요 \r\n뒤돌아서면 모든 것이 \r\n꿈처럼 사라져\r\n내일이 또 올 것 같지 않아\r\n그냥 갈까요 \r\n언젠가 그리워질 기억처럼\r\n지나고 또 흘러서 \r\n그저 되돌리며 볼 수만 있게 \r\n\r\n운명이란 뜻이죠 \r\n혹시나 지금인가요\r\n나도 모르게 찾아온 시간\r\n마음속에 숨긴 세상 같아요\r\n\r\n지금인가요 \r\n뒤돌아서면 모든 것이 \r\n꿈처럼 사라져\r\n내일이 또 올 것 같지 않아\r\n그냥 갈까요 \r\n언젠가 그리워질 기억처럼\r\n지나고 또 흘러서 \r\n그저 되돌리며 볼 수만 있게 \r\n\r\n내가 벌써 두려운가 봐 \r\n(또 바보처럼) \r\n여기서 멈추려 하네\r\n언제나 시간 속을 떠돌다 \r\n늘 엇갈리는지 \r\n이젠 누군가 \r\n운명이라 말해준다면 좋겠어\r\n\r\n지금인가요 \r\n내일이 또 올 것 같지 않아\r\n그냥 갈까요 \r\n언젠가 그리워질 기억처럼\r\n지나고 또 흘러서 \r\n그저 되돌리며 볼 수 있도록</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/271/15026271_1404725281148_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 12598, song_num: 16130345, lowkey: nil, highkey: nil},
  {album_id: 58, singer_id: 20, team_id: nil, title: "행복한가요", genre1: "가요", genre2: "R&amp;B/소울", runtime: "04:41", lyrics: "\n\t\t\t\t\t\t\t<div>행복한가요 - 04:41</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">나 잊을 수 있다고 그대 모른다고 \r\n애써 눈물을 감추었죠 \r\n그대 그렇게 떠나버린 후에\r\n\r\n또 하루가 지나고 시간이 흐르면\r\n괜찮아 질까 생각했죠\r\n하지만 그 누구도 대신할 수 없게 돼버린\r\n내 빈자리만 남았을 뿐\r\n\r\n날 기억 하나요 \r\n지친 내 모습 벌써 잊었나 봐요\r\n이별도 내겐 힘이 드는데 \r\n그렇게 쉽게 널 잊으라고 하지 마요\r\n\r\n긴 잠에서 깨어나 혹시라도 그대 \r\n다시 내게로 돌아올까 \r\n하지만 내 곁에서 \r\n이미 떠나버린 그대의\r\n흐린 추억만 남아있죠\r\n\r\n날 기억 하나요 \r\n지친 내 모습 벌써 잊었나 봐요\r\n이별도 내겐 힘이 드는데 \r\n그렇게 쉽게 널 잊으라고 하지 마요\r\n\r\n다른 사랑이 찾아온다 해도 \r\n처음부터 난 두려워지겠죠 \r\n\r\n날 떠나갔나요 행복하나요\r\n그래도 나에겐\r\n그대 사랑이 전부였던걸 \r\n떠나간 후에야 알게 됐죠\r\n\r\n날 기억하나요 \r\n내 모습 벌써 잊었나 봐요\r\n이별도 내겐 힘이 드는데\r\n그렇게 쉽게 널 잊으라고 하진 마요</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/271/15026271_1404725281148_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 10838, song_num: 16130346, lowkey: nil, highkey: nil},
  {album_id: 59, singer_id: 69, team_id: nil, title: "INTRO : This is da vink", genre1: "가요", genre2: "락", runtime: "01:13", lyrics: "\n\t\t\t\t\t\t\t<div>INTRO : This is da vink - 01:13</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가사 정보가 없습니다.</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/272/15026272_1341542860001_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130347, lowkey: nil, highkey: nil},
  {album_id: 59, singer_id: 69, team_id: nil, title: "거짓말", genre1: "가요", genre2: "락", runtime: "04:14", lyrics: "\n\t\t\t\t\t\t\t<div>거짓말 - 04:14</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">그렇게 모질게도 내게 등돌리던 그대\r\n당신없이 살순 없다고 눈물 흘렸던 건 \r\n다 거짓말이야\r\n사실 나 우리 지루한 만남 \r\n그대 못지않게 짜증났었는걸\r\n우유부단한 나 대신 먼저\r\n그대가 말한 것 뿐이야\r\n그대의 그 입술과 체온이\r\n때론 바보처럼 그립기도 해\r\n그대의 그 눈빛과 속삭임도\r\n한결같이 다 거짓말일 뿐\r\n그 흔한 눈물도\r\n난 아직 모든게 실감나지 않아 또\r\n하루가 흐르면서 그냥 \r\n그대가 희미해지기만 해\r\n또 난 밤엔 취해 비틀거리고 \r\n의미없이 사람을 만나고\r\n그대와 비슷한 누굴봐도 이젠\r\n아무렇지도 않아\r\n\r\n그대의 그 입술과 체온이\r\n때론 바보처럼 그립기도 해\r\n그대의 그 눈빛과 속삭임도\r\n한결같이 다 거짓말일 뿐 \r\n\r\n그대의 그 입술과 체온이\r\n때론 바보처럼 그립기도 해\r\n그대의 그 눈빛과 속삭임도\r\n한결같이 다 거짓말일 뿐 \r\n\r\n\r\n\t\t\t\t\t</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/272/15026272_1341542860001_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130348, lowkey: nil, highkey: nil},
  {album_id: 59, singer_id: 69, team_id: nil, title: "Krazyboi", genre1: "가요", genre2: "락", runtime: "03:42", lyrics: "\n\t\t\t\t\t\t\t<div>Krazyboi - 03:42</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">i'm not a good boy\r\n때로는 미친듯한 mad boy\r\n그래 난 누가봐도 또라이\r\n항상 모자란 듯한\r\n그래서 나는 내가 더욱 좋아\r\nyou are a good guy\r\n언제나 유머있는 sweet guy\r\n하지만 너무 잘난 너의 그 뻔한 잔머리때매\r\n주변 사람 피곤한거는 아니?\r\n미친 듯한 ...\r\n날 보며 너는 뭐라 투덜대지만\r\n똑똑한 척 ...\r\n하는 너보단 난 그냥 내가 더 좋아\r\n뭘 봐?내 말이 아니꼽니?\r\n그래 넌 항상 그런식이지\r\n아무리 노력해봐도 우린 사는물이 틀려\r\n어차피 한번 사는 인생\r\n네가 뭔데 남을 지지고 볶고?\r\n난 그냥 내 갈 길을 갈 뿐\r\n아까운 인생 그렇게 살지마\r\n미친 듯한 ...\r\n날 보며 너는 뭐라 투덜대지만\r\n똑똑한 척 ...\r\n하는 너보단 난 그냥 내가 더 좋아\r\n미친 듯한 ...\r\n날 보며 너는 뭐라 투덜대지만\r\n똑똑한 척 ...\r\n하는 너보단 난 그냥 내가 더 좋아\r\n참 아까운 너의 재능 그건 내가 인정해\r\n하지만 그게 잘못된 만큼 너의 인생이 복잡해 질 수 있단 말씀...\r\n미친 듯한 ...\r\n날 보며 너는 뭐라 투덜대지만\r\n똑똑한 척 ...\r\n하는 너보단 난 그냥 내가 더 좋아\r\n미친 듯한 ...\r\n날 보며 너는 뭐라 투덜대지만\r\n똑똑한 척 ...\r\n하는 너보단 난 그냥 내가 더 좋아 \r\n\r\n\t\t\t\t\t</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/272/15026272_1341542860001_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130349, lowkey: nil, highkey: nil},
  {album_id: 59, singer_id: 69, team_id: nil, title: "내 진심", genre1: "가요", genre2: "락", runtime: "04:27", lyrics: "\n\t\t\t\t\t\t\t<div>내 진심 - 04:27</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">고민이 되니 \r\n내가 너에게 충분한건지 \r\n그래 나 이해해 \r\n나의 노력이 부족했겠지만 \r\n지켜봐줄래? \r\n다 맘에 들진 않았겠지 \r\n하지만 말야 \r\n가끔씩 나도 눈물 감추려고 \r\n하늘만 볼 때가 있단 말야 \r\n\"미안해\" 말을 하기엔 용기가 없어\r\n마냥 웃음만 지었던 거야 \r\n네가 내 마음 속에 들어온다면 \r\n모두 내 진심을 보여줄텐데 \r\n쉽진 않았겠지 \r\n언제쯤에야 서로 웃으며 함께 할 수 있을까 \r\n모두 가질 순 없다는 걸 이해하지만 \r\n너에겐 내가 작은 존재 이지만 \r\n넌 나에겐 큰 전부인걸 \r\n얼마나 사랑하냐고 나에게 묻는\r\n너의 모습조차 사랑했어 \r\n나의 무딘 입술은 말은 안해도 \r\n그저 편안하게 여겼으면 해 \r\n너무나 걱정만 하지 않았으면 해 \r\n조금만 더 기다려 너의 곁을 꼭 지켜줄께 \r\n\r\n오늘도 하루 해가 빨리 저물지만\r\n난 웃음 짓는 것만으로도 족해 \r\n너와 함께 할 수 있으니 \r\n\r\n\r\n\t\t\t\t\t</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/272/15026272_1341542860001_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130350, lowkey: nil, highkey: nil},
  {album_id: 59, singer_id: 69, team_id: nil, title: "동그란 눈 빨간 머리 핀의 예쁜 내 친구", genre1: "가요", genre2: "락", runtime: "05:01", lyrics: "\n\t\t\t\t\t\t\t<div>동그란 눈 빨간 머리 핀의 예쁜 내 친구 - 05:01</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">we are not the children\r\n그땐 우린 아무것도 몰랐던 아이\r\n네게 상처준 걸 알지만\r\n그 땐 모든게 익숙치 않아\r\n난 당황했던 것 뿐야\r\nwe are not the children\r\n이젠 우린 모든 걸 알아버린 나이\r\n모두 잊은 것만 같지만\r\n아직 내 맘속 깊은 곳엔\r\n네 맑은 눈빛이 남아있어\r\n\r\n그렇게 시간은 흘러가고\r\n우린 어긋난 줄 알았는데\r\n숨가삐 한참을 흘러온 지금\r\n세월의 흔적도 없이 지금 내 앞엔\r\n\r\n(chorus)\r\n동그란 눈 빨간 머리 핀의 예쁜 내 친구\r\n날 기다린 듯 슬픈 눈물 지며 내 앞에 서 있네\r\n\r\n(bridge)\r\n쑥스러운 듯한 얼굴로\r\n우린 이렇게 마주 서 있지만\r\n늘 그댈 그리워 했던 내 맘은 진심이란 말야\r\n세월에 밀려 어느 덧\r\n우린 이렇게 많은 게 변했지만\r\n잊은 줄로만 알았던 우리 약속\r\n나 같이 너도 기억하니?\r\n\r\n(chorus)\r\n동그란 눈 빨간 머리 핀의 예쁜 내 친구\r\n날 기다린 듯 슬픈 눈물 지며 내 앞에 서 있네\r\n\r\n\t\t\t\t\t</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/272/15026272_1341542860001_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130351, lowkey: nil, highkey: nil},
  {album_id: 59, singer_id: 69, team_id: nil, title: "Memories", genre1: "가요", genre2: "락", runtime: "03:41", lyrics: "\n\t\t\t\t\t\t\t<div>Memories - 03:41</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">우리 많이 웃고\r\n많이 기뻐하고\r\n사랑했던 날들도 이젠 옛일\r\n때론 보고 싶고\r\n만나고도 싶고\r\n아직 그댄 내 맘속에 살아있어\r\n따스한 햇살과\r\n그 어떤 기쁨도 그대없는 지금 내겐 무의미 한 걸\r\n그때 그렇게 날 그대 떠난 이유\r\n이제서야 난 알것 같아\r\n\r\n하루하루 난 그댈 잊고\r\n모른척 그냥 버티고 있지만\r\n이렇게 살아야 하는 이유는 모르겠어\r\n난 그저 그대 없이도\r\n예전처럼 달리고 있지만\r\n이젠 이 모든걸 접어야 할 때 인것 같아\r\n우리 많이 웃고\r\n많이 기뻐하고\r\n사랑했던 날들도 이젠 옛일\r\n때론 보고 싶고\r\n만나고도 싶고\r\n아직 그댄 내 맘속에 살아있어 \r\n\r\n우리 많이 웃고\r\n사랑했던 날들도 이젠 옛일\r\n\r\n\r\n\t\t\t\t\t</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/272/15026272_1341542860001_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130352, lowkey: nil, highkey: nil},
  {album_id: 59, singer_id: 69, team_id: nil, title: "Story of us", genre1: "가요", genre2: "락", runtime: "05:19", lyrics: "\n\t\t\t\t\t\t\t<div>Story of us - 05:19</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">저 어둠의 끝까지 떨어져 저 위의 빛을 볼 땐\r\n난 아주 다른 곳 인줄로 늘 믿었었지\r\n내가 그 곳에 다다랐을땐 그 곳은 뜻 밖에\r\n천국도 지옥도 아닌 그저 현실 이었을 뿐\r\n\r\n이젠 더 이상 흘릴 눈물조차 남아있지 않은 지금\r\n그저 난 이제 아무 감각도 없이\r\n그저 널 향해 가고는 있지만 난\r\n때로는 너무 힘들어 주저 앉고 싶을때도 난...\r\n계속 내 눈에 맴도는\r\n네 눈물이 이렇게 날 다시 일어나게 하는 거지\r\n\r\n그대..\r\n이젠 난 아무 느낌도 생각도 없이\r\n그냥 이렇게 난 달리기만 할 뿐\r\n그대..\r\n지금도 힘든 기다림에 지쳐\r\n그냥 주저앉고 싶기도 하겠지만\r\n그대...\r\n지친 눈에 비치는 세상이 내겐 커다란 등불이 되고\r\n그대...\r\n그토록 날 기다린 그대 품에\r\n난 안겨 눈물 흘리며 눈을...\r\n감는거지 \r\n\r\n\r\n\r\n\t\t\t\t\t</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/272/15026272_1341542860001_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130353, lowkey: nil, highkey: nil},
  {album_id: 59, singer_id: 69, team_id: nil, title: "Friends-part2", genre1: "가요", genre2: "락", runtime: "05:07", lyrics: "\n\t\t\t\t\t\t\t<div>Friends-part2 - 05:07</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">그래 이렇게 우리 함께 많은 시간을 흘러오다 보면\r\n함께 만들고 또 함꼐 나누었던 우리 추억들\r\n내겐 너무 소중해\r\n그래 모든 것들은 다 나이처럼 시간 앞에선 무력해지지만\r\n그래도 너의 어깨 뒤 그 숨가쁜 일상 저편에는\r\n내가 서 있다는걸 기억해\r\n힘들땐 우린 웃고\r\n언제나 우린 함께이지\r\n너무나도 짧은 우리 삶\r\n그렇게 우린 같이 나일 먹어가지\r\n부담된다고 널 피하기도 했지\r\n그래 우습겠지만\r\n만만치 않은 세상과 싸우는 동안\r\n사실 네 생각이 너무 났어\r\n그래 이젠 모든 게 다 부질없이 내 맘대로 되는게 없지만\r\n그래도 항상 그렇게 날 반겨주는 건\r\n그토록 무심했던 저 멀리의 내 친구\r\n힘들땐 우린 웃고\r\n언제나 우린 함께이지\r\n너무나도 짧은 우리 삶\r\n그렇게 우린 같이 나일 먹어가지\r\n아직 많이 남은 듯한 우리 일생\r\n이렇게 바삐 살아보지만\r\n생각해보면 우리 잊혀진 웃을들\r\n그게 바로 내가 원한거지 \r\n힘들땐 우린 웃고\r\n언제나 우린 함께이지\r\n너무나도 짧은 우리 삶\r\n그렇게 우린 같이 나일 먹어가지\r\n\r\n힘들땐 우린 웃고\r\n언제나 우린 함께이지\r\n너무나도 짧은 우리 삶\r\n그렇게 우린 같이 나일 먹어가지\r\n힘들땐 우린 웃고\r\n언제나 우린 함께이지\r\n너무나도 짧은 우리 삶\r\n그렇게 우린 같이 나일 먹어가지</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/272/15026272_1341542860001_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130354, lowkey: nil, highkey: nil},
  {album_id: 59, singer_id: 69, team_id: nil, title: "Country boy ver 2.02", genre1: "가요", genre2: "락", runtime: "05:26", lyrics: "\n\t\t\t\t\t\t\t<div>Country boy ver 2.02 - 05:26</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">난 정말 모르겠어 대체 뭐가 뭔지\r\n그냥 아무 생각없이\r\n지금까지 흘러온 내 시간이 난 문득 한없이 낯설기만 해\r\n반듯한 내 일상 저편에는\r\n비뚤어진 바램도 있어\r\n때론 나도 아무 생각없이\r\n춤추고 취하고 널 느끼고 난 그렇게\r\n뭐든 느끼고 싶은거지\r\n꿈 같은 지난 날도 한낮 추억일 뿐\r\n어차피 혼자 인거\r\n철없던 순수한 내 추억이 난 왠지 피하고만 싶은 걸\r\n이리저리 재는 네 눈빛도\r\n그걸 모른척 하는 나도\r\n우린 같은 걸 원하면서도 빙빙돌려 내면서 뭘 그렇게 재는 건지\r\n반듯한 내 일상 저편에는\r\n비뚤어진 바램도 있어\r\n때론 나도 아무 생각없이\r\n춤추고 취하고 널 느끼고 난 그렇게\r\n뭐든 느끼고 싶은거지\r\n\r\n난 그래...\r\n춤추고 취하고 널 느끼고 넌 그렇게\r\n뭐든 느끼고 싶은거지\r\n난 그래...</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/272/15026272_1341542860001_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130355, lowkey: nil, highkey: nil},
  {album_id: 59, singer_id: 69, team_id: nil, title: "Outro : 이젠 우린 함께인거지", genre1: "가요", genre2: "락", runtime: "01:33", lyrics: "\n\t\t\t\t\t\t\t<div>Outro : 이젠 우린 함께인거지 - 01:33</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가사 정보가 없습니다.</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/272/15026272_1341542860001_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130356, lowkey: nil, highkey: nil},
  {album_id: 59, singer_id: 69, team_id: nil, title: "거짓말(original)", genre1: "가요", genre2: "락", runtime: "04:14", lyrics: "\n\t\t\t\t\t\t\t<div>거짓말(original) - 04:14</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">그렇게 모질게도 내게 등돌리던 그대\r\n당신없이 살순 없다고 눈물 흘렸던 건\r\n다 거짓말이야\r\n사실 나 우리 지루한 만남\r\n그대 못지않게 짜증났었는걸\r\n우유부단한 나 대신 먼저\r\n그대가 말한 것 뿐이야\r\n\r\n\r\n그대의 그 입술과 체온이\r\n때론 바보처럼 그립기도 해\r\n그대의 그 눈빛과 속삭임도\r\n한결같이 다 거짓말일 뿐\r\n\r\n그 흔한 눈물도\r\n난 아직 모든게 실감나지 않아 또\r\n하루가 흐르면서 그냥\r\n그대가 희미해지기만 해\r\n또 난 밤엔 취해 비틀거리고\r\n의미없이 사람을 만나고\r\n그대와 비슷한 누굴봐도 이젠\r\n아무렇지도 않아\r\n\r\n\r\n그대의 그 입술과 체온이\r\n때론 바보처럼 그립기도 해\r\n그대의 그 눈빛과 속삭임도\r\n한결같이 다 거짓말일 뿐</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/272/15026272_1341542860001_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130357, lowkey: nil, highkey: nil},
