  {album_id: 62, singer_id: 72, team_id: nil, title: "서로 다른 이별", genre1: "가요", genre2: "발라드", runtime: "04:07", lyrics: "\n\t\t\t\t\t\t\t<div>서로 다른 이별 - 04:07</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">니가 없는데도 웃는 날 보면 작은 외로움도 없는 날 보면 우리 헤어지며 돌아선 그날 \n널 보내준 기억이 내겐 없나봐 깊은밤 이름없는 별이 질때면 나는 아직도 널 위한 기도해 \n잘자란 전화도 이젠 못해줄텐데 너를 지켜줄 걱정만 하는 나 \n내가 보내줬는데, 떠난 너인데 널 볼 수 없는게 난 정말 믿기지 않아 \n내겐 거짓말처럼 모두 꿈처럼 눈 감으면 우리사랑 처음 그대로 다시 내게 오는 너를 보는걸 \n\n혼자서 너와 걷던 길을 걸으며 너를 놓친듯 뒤돌아 보곤해 \n그땐 널 다 놓아주길 바랬었는데 작은 기억도 그대로있는 너 \n내가 보내줬는데, 떠난 너인데 널 볼 수 없는게 난 정말 믿기지 않아 \n내겐 거짓말처럼 모두 꿈처럼 눈 감으면 우리사랑 처음 그대로 다시 내게 오는 너를 보는걸 \n\n내 멈춰진 기억은 항상 내 안에 널 데려와 니가 원한것처럼, 떠난 너처럼 \n편하게 지내도 내 사랑 줄지가 않아 많이 보고 싶다고, 내게 오라고 \n내 맘속에 너를 보며 얘기하는 날 니가 없는 나도 너를 보잖아 내겐 널 보내준 기억이 없어 \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130384, lowkey: nil, highkey: nil},
  {album_id: 62, singer_id: 72, team_id: nil, title: "영원으로", genre1: "가요", genre2: "발라드", runtime: "04:35", lyrics: "\n\t\t\t\t\t\t\t<div>영원으로 - 04:35</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">아무말 하지마요 그렇게 날 떠나면 돼요 조금씩 천천히 내게 오던 길은 지우고 또 다른 길 찾아가요 \r\n이별이 오나봐요 눈물이 날 위로하네요 나를 떠나실 그대를 위해 준비한 말도 없는데 바보처럼 눈물이 나네요 \r\n잘했어요 그대를 위한거라면 미안해말아요 난 괜찮을테니 \r\n한가지 슬픈 이유는 날 떠나는 그댈 아직도 사랑하고 싶은 내 맘 때문이죠 \r\n\r\n날 걱정하실테죠 알아요 늘 그랬잖아요 \r\n사랑한다는 흔한말조차 귀하게 느껴지는건 나 그대를 사랑하기 때문에 \r\n\r\n잘했어요 그대를 위한거라면 미안해 말아요 난 괜찮을테니 \r\n한가지 슬픈 이유는 날 떠나는 그댈 아직도 사랑하고 싶은 내 맘 때문이죠 \r\n얼룩진 내 얼굴이 뭘 말하는건지 모르나요 \r\n\r\n사랑해요 그 말론 모자라지만 가시는 그 길이 힘들지 않도록 곁에서 기도할게요 \r\n늘 행복하도록 이제 난 그대를 보낼 수 있죠 영원으로 나의 눈물이 떠나는 날 쯤엔</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 9873, song_num: 16130385, lowkey: nil, highkey: nil},
  {album_id: 62, singer_id: 72, team_id: nil, title: "후회", genre1: "가요", genre2: "발라드", runtime: "03:50", lyrics: "\n\t\t\t\t\t\t\t<div>후회 - 03:50</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">말없이 그때 널안아줄껄 그랬어 누굴 탓해도 원망해도 후회는 내 몫인걸 \n아마넌 그때가 마지막이였겠지 떠난 내품을 아쉬워했었던 시간이 말로는 안해도 그렇게날 몰랐니 \n아직도 니가 내 전부라는걸 그토록 차갑게 나를 버린 그날도 내맘따윈 상관안했던거니 \n혹시너 내가 다시 그리울때 아무것도 묻지 말고와 그저 니멋대로 날 떠났던 거처럼 \n이젠 너를 모두 지웠다고 싫다고 말해도 모두 맘에 없는 거짓일꺼야 (말없이 그때 널 안아줄껄 그랬어) \n\n그때는 아품이 아직 모자랐나봐 흘릴 눈물이 남아있던 것도 아닌데 아마 넌 나보다 힘겨웠을지 몰라 \n버린 추억마져 돌아볼만큼 하지만 나역시 두려웠었던거야 다시 너로 인해 아파할까봐 \n혹시너 내가 다시 그리울때 아무것도 묻지 말고와 그저 니멋대로 날 떠났던 거처럼 \n이젠 너를 모두 지웠다고 싫다고 말해도 모두 맘에 없는 거짓일꺼야 \n\n다시는 만나지 말자던 그때 조금도 느낄수 없었니 내가 나를 용서할수 없던 슬픔을 \n어쩜 내가 필요했을 너를 그렇게 뿌리쳤던걸 죽을만큼 후회하고 있잖아 \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130386, lowkey: nil, highkey: nil},
  {album_id: 62, singer_id: 72, team_id: nil, title: "타인", genre1: "가요", genre2: "발라드", runtime: "04:22", lyrics: "\n\t\t\t\t\t\t\t<div>타인 - 04:22</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">너의 야윈 모습에 잠깐 흔들린거야 다신 이렇게 날 찾아 오지말아줘 \n너의 젖은 얼굴이 나를 아프게 해도 우린 만나서는 안될 사람이잖아 \n얼마나 사랑했는지 너는 알 수 없겠지 돌아서는 너를 그냥 보낸 이유도 \n너 없이 난 잠시도 살아갈 수 없지만 붙잡기엔 너무 늦었어 \n이젠 더이상 날 힘들지 않게 작은 미련도 남기지마 다시 떠날 너를 안고서 두번 아프긴 싫어 \n어쩌다 내 모습 떠올라 슬픈 그리움에 울어도 지켜줄 수 없는 날 용서해 \n\n하루도 못견디고서 나를 찾아 오려고 그리 쉽게 다른 사랑할 수 있었니 \n버려졌던 아픔을 넌 나만큼만 느껴줘 잔인했던 깊은 상처를 \n이젠 더이상 날 힘들지 않게 작은 미련도 남기지마 다시 떠날 너를 안고서 두번 아프긴 싫어 \n어쩌다 내 모습 떠올라 슬픈 그리움에 울어도 지켜줄 수 없는 날 용서해 너의 기억에서 날 지워줘 \n\n사랑했던 너의 모습도 더는 내것이 아니겠지 함께 했던 작은 추억도 내겐 고통일뿐야 \n어쩌다 내 모습 떠올라 슬픈 그리움에 울어도 지켜줄 수 없는 날 용서해 너의 기억에서 날 지워줘 \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130387, lowkey: nil, highkey: nil},
  {album_id: 62, singer_id: 72, team_id: nil, title: "Never", genre1: "가요", genre2: "발라드", runtime: "03:33", lyrics: "\n\t\t\t\t\t\t\t<div>Never - 03:33</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">너만은 아닐거라고 말했지 어떤 어려움이 와도 지켜줄 수 있다고 \n나만은 다를 거라고 말했지 지난 헤어짐에 눈물 잊게할 수 있다고 \n어렵게 날 허락한 널 그냥 바라봐도 행복했었는데 왜 자꾸만 이러는지 또 다른 곳을 보는 나 \n\n워워워워워워워 never mind 나를 걱정하지마 네게서 떠나가는 나를 용서하지 마라 \n먼 훗날 무너진 가슴도 슬픔도 내 몫일뿐 got out of got out of got out of tonight \n\n언젠가 너는 나에게 말했지 너는 나로 인해 다시 태어난 것 같다고 \n가만히 나의 어깨에 기댈때 지금 흘러내린 눈물 기쁨이라고 말했지 \n그렇게 넌 나만을 믿어왔지 너를 품에 안을 자격도 없는 날 눈물로 날 부르지마 더 숨을 곳이 없는 나 \n\n워워워워워워워 never mind 나를 걱정하지마 네게서 떠나가는 나를 용서하지 마라 \n먼 훗날 무너진 가슴도 슬픔도 내 몫일뿐 got out of got out of got out of tonight \n\n며칠밤을 지내며 혼자서 아플 널 알지만 어디서도 도와줄께 널 위한 길일테니까 \nNever say 아무말 하지마 그래도 구차하게 변명따윈 하기 싫어 처음널 만났던 그때로 돌아갈수 있다면 \nwanna be wanna be wanna be with you \nnever mind 나를 걱정하지마 네게서 떠나가는 나를 용서하지 마라 \n먼 훗날 무너진 가슴도 슬픔도 내 몫일뿐 got out of got out of got out of tonight </p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130388, lowkey: nil, highkey: nil},
  {album_id: 62, singer_id: 72, team_id: nil, title: "바램", genre1: "가요", genre2: "발라드", runtime: "03:51", lyrics: "\n\t\t\t\t\t\t\t<div>바램 - 03:51</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">예전보다 많이 행복해 보여 그동안 더 예뻐진것 같아 \n니곁을 떠나기를 잘 했었나봐 환히 웃는 모습 참 보기 좋은걸 \n내 그리움에 무너져 널 찾아왔을때 아직 혼자이길 바랬었는지 \n몰래 지켜보다 돌아선 빛나는 니 미소에 가져온 내 사랑 버리고갈께 \n너를 잃은뒤 나의 삶의 전부였던 그 추억마저 착각이라 외면해볼께 \n아직 힘겨운 나의 숨쉬는 것조차 아프지만 모두 견디며 잊어볼께 \n\n난 소리낼까 두려워 삼키었던 눈물 지친 걸음만큼 힘겨웠지만 \n이젠 나보다 널 아껴줄 그가 니곁에 있어 이제서야 내맘도 조금 편해 \n너를 잃은뒤 나의 삶의 전부였던 그 추억마저 착각이라 외면해볼께 \n아직 힘겨운 나의 숨쉬는 것조차 아프지만 모두 견디며 잊어볼께 \n\n한때는 꿈만 같았던 영원할 것만 같았던 사랑했던 기억 눈물로만 적셔도 혹시 널 미워하지 않도록 \n이젠 영원히 내겐 아픔만 남아도 너 다시 찾은 사랑만은 기뻐해줄께 \n다신 영원히 내겐 올 수 없을만큼 행복해줘 내가 다가갈 수 없도록 다신 너를 찾지 않도록 </p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130389, lowkey: nil, highkey: nil},
  {album_id: 62, singer_id: 72, team_id: nil, title: "그대 내게 오는 날 (Duet)", genre1: "가요", genre2: "발라드", runtime: "04:00", lyrics: "\n\t\t\t\t\t\t\t<div>그대 내게 오는 날 (Duet) - 04:00</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">아무도 없다해도 외로움 난 몰라요 사랑도 세상도 모두 내꿈에 살죠 \r\n기다릴 그대 있어 지금을 난 견뎌요 내 안의 그대와 이별없는 곳에서 \r\n\r\n같은 시간속 같은 추억을 이젠 나눠요 너무 먼 곳에 있지 않기를 기쁨의 그날이 \r\n그대 내게 오는 날 숨겨온 눈물 지워 그대와 남은건 오직 사랑뿐이길 \r\n\r\n슬픔은 없는걸요 내안의 그대 있어 혼자가 아님을 그대 혹시 아나요 \r\n기다릴 그대 있어 지금을 난 견뎌요 내 안의 그대와 이별없는 곳에서 그대 이젠 내게로</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130390, lowkey: nil, highkey: nil},
  {album_id: 62, singer_id: 72, team_id: nil, title: "Tonight", genre1: "가요", genre2: "발라드", runtime: "03:49", lyrics: "\n\t\t\t\t\t\t\t<div>Tonight - 03:49</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">그런 눈빛으로 나를 보지마 이미 변해버린 너란 걸 알아 \n괜한 걱정 모두 집착이겠지 하지만 이렇게 끝날 순 없어 \n이밤이 지나기전에 나의 손을 잡아 다시 머물러 잠시라면돼 다신 널 찾는 일로 힘든일 없을테니까 \n널 지워가는 just tonight 그 멈춘시간 속에 있는 날 외면하지마 \n그 어두운 기억속에서 더이상 견딜 수 없어 break my heart through the night \n\n포기할 수 없는 악몽에 있어 다른 품에 안긴 너를 보지만 \n행복하길 바라는 날 알겟니 내 전부로 널 구할 수 있다면 \n이밤이 지나기전에 나의 손을 잡아 다시 머물러 잠시라면돼 다신 널 찾는 일로 힘든일 없을테니까 \n널 지워가는 just tonight 그 멈춘시간 속에 있는 날 외면하지마 \n그 어두운 기억속에서 더이상 견딜 수 없어 break my heart through the night \n\n날 떠나가는 just tonight 수많은 추억 속에 버린 날 떠나가지마 \n아무런 의미도 없어 너 없는 세상이라면 break my heart through the night \n널 지워가는 just tonight 그 멈춘시간 속에 있는 날 외면하지마 \n그 어두운 기억속에서 더이상 견딜 수 없어 break my heart break my heart through the night \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130391, lowkey: nil, highkey: nil},
  {album_id: 62, singer_id: 72, team_id: nil, title: "너를 위해", genre1: "가요", genre2: "발라드", runtime: "04:32", lyrics: "\n\t\t\t\t\t\t\t<div>너를 위해 - 04:32</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">늘 언제나 힘들어 했어 지친 어깨를 뒤로 안쓰런 눈빛에 괜찮다며 돌아서긴 했지만 뒤로 흐르던 눈물 모를거야 \n눈을 감아도 온통 너의 생각 뿐인걸 애써 감추려던 만큼 아픔도 큰걸 난 알기에 \n이세상 끝날까지 너의 뒤에 남아 항상 너를 지키며 살께 \n넌 비록 몰라도 괜찮아 난 숨이 멎는 날까지 함께 있을꺼야 영원히 너를 위해 \n\nRAP] 이른아침 잠에서 깨 밤새 흘렸었던 눈물을 닦으며 애써 거울앞에 서서 \n웃음 지어 보지만 아닌척해 보지만 어색한 표정뿐인걸 알고 있기에 \n여전히 지나가는 너의 추억 그안에 숨쉬는 너의 슬픈기억 \n어떡해야 멈출수가 있는건지 어떡해야 다버릴수 있는건지 \n\n멈출수 없어 너무 사랑했던 이유로 쉽게 다가설수 없는 슬픔이란걸 난 알기에 \n이대로 모든게 멈추길 마지막 소원을 기억해 너에 행복을 비는 내 모습이 너무 미워 포기할지 몰라도 \n이세상 끝날까지 너의 뒤에남아 항상 너를 지키며 살께 \n넌 비록 몰라도 괜찮아 난 숨이 멎는 날까지 함께있을꺼야 영원히 너만을 위해 \n\n이세상 끝날까지 너의 뒤에남아 항상 너를 지키며 살께 \n넌 비록 몰라도 괜찮아 난 숨이 멎는 날까지 함께 있을꺼야 영원히 너를 위해 </p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130392, lowkey: nil, highkey: nil},
  {album_id: 62, singer_id: 72, team_id: nil, title: "내가 사랑한 사람", genre1: "가요", genre2: "발라드", runtime: "04:00", lyrics: "\n\t\t\t\t\t\t\t<div>내가 사랑한 사람 - 04:00</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">그대 가끔 들러줄까요 우리가 처음 만나 걷던 이길을 나처럼또 눈물날까요 두눈을 감아야 다시 오는 사랑에 \n아무리 지워보려해봐도 밤새 자란 손톱만큼 그리워 믿을 수 있나요 헤어졌어도 끝이 아닌걸 달라진게 없는 걸 \n한번쯤 날떠나 후회가 됐는지 가슴 속에서라도 내 이름을 불러보는지 \n하루만큼 더 기다리는 나를 아는지 대답해줘요 내가 사랑한 사람 \n\n오늘도 행복한 저 연인들 그때 우리 역시 부러웠겠죠 난 믿고싶어요 우연이라도 볼수 있기를 내가 돌아오기를 \n한번쯤 날떠나 후회가 됐는지 가슴 속에서라도 내 이름을 불러보는지 \n하루만큼 더 기다리는 나를 아는지 대답해줘요 내가 사랑한 사람 \n\n이별이란 정말 잔인하네요 아주 작은 것조차 더는 알 길 없으니 워 \n이렇게도 힘든 날 알고나 갔는지 그대 가신 가져가 눈물 많은 나를 아는지 \n그대에게 또 난 괜찮은 추억인건지 기억해줘요 내가 사랑한 사람 내가 태어나 가장 사랑한 사람 \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130393, lowkey: nil, highkey: nil},
  {album_id: 62, singer_id: 72, team_id: nil, title: "Hello My Love", genre1: "가요", genre2: "발라드", runtime: "03:29", lyrics: "\n\t\t\t\t\t\t\t<div>Hello My Love - 03:29</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">같이 늘 편한 너였지 남자애 같다며 항상 놀리던 나지만 오래 비워둔 나의 사랑을 보며 그만큼 너가 채워준걸까 \r\n알고 있니 힘들게 너 내 친구 좋다며 고백한 밤 그완 안될꺼라고 네게 상처줬지만 널 잃을까봐 두려웠던 나 \r\n언제나 숨쉬듯 편한 느낌속에서 너에게 날 맡기고 있었나봐 \r\n지금껏 내가 부른 니 이름 늘 친구란 말속에 내 오랜 사랑 있는걸 \r\n\r\n기억하니 술에 취해 널안고 바보라 말했던 나 그냥 실수였다고 괜히 둘러됐지만 널 좋아한단 그말 대신야 \r\n언제나 숨쉬듯 편한 느낌속에서 너에게 날 맡기고 있었나봐 \r\n지금껏 내가 부른 니 이름 늘 친구란 말속에 내 오랜 사랑 있는걸 \r\n\r\n지금까지 내가 느낀 너의 모습 그만큼만 나를 느끼게 할수만 있다면 \r\n언제나 그렇듯 서로 바로보지만 더자란 내사랑을 너는 알까 \r\n오늘도 내가 부른 니 이름 그 친구란 말 속에 내 사랑 담아 다가가고 있잖아 \r\n나를 봐 어제와는 다를꺼야 널 향한 내 마음이..</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130394, lowkey: nil, highkey: nil},
  {album_id: 62, singer_id: 72, team_id: nil, title: "지킬 수 없는 약속", genre1: "가요", genre2: "발라드", runtime: "04:17", lyrics: "\n\t\t\t\t\t\t\t<div>지킬 수 없는 약속 - 04:17</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">미안해 사랑하지 마 우리 만나서는 안되죠 그대 내게 전화했지만 그냥 끊었었죠 \n어두운 골목길에서 그대 돌아오는 모습을 이젠 지켜보는 것 조차도 그만둬야 하겠죠 \n\n괜찮아요 못난 나는 그대가 이세상에 있으니깐.. \n힘들었죠 지친 그대 모습이 날 아직까지 기다리고 있는 것 같아 \n그대여 내 생각 하나요 날 잊지 못해 울고 있나요 \n그러면 안되잖아요 날 잊고 산다고 나에게 약속해 줘요.. \n\n고마워요 언제라도 돌아와 달라는 말 해준 그대.. \n단 한번도 잊어본 적 없지만 내 이런 마음 그대에겐 짐이 되겠죠 \n하늘이 데려갈 때까지 내 마음 그대 모르길 바래 \n사랑한다는 이유로 더 이상 그대를 힘들게 하면서 잡을 수 없어요.. \n\n그대여 내생각 하나요 날 잊지 못해 울고 있나요 \n그러면 안되잖아요 날 잊고 산다고 나에게 약속해 줘요 </p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 13149, song_num: 16130395, lowkey: nil, highkey: nil},
  {album_id: 62, singer_id: 72, team_id: nil, title: "사랑을 위하여", genre1: "가요", genre2: "발라드", runtime: "03:35", lyrics: "\n\t\t\t\t\t\t\t<div>사랑을 위하여 - 03:35</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">이제 다시는 숨지 않겠어 달아나지 않아 나의 무릎을 꺽은 그것이 운명이라면 아까운 청춘이잖아 \n내버려두긴 그냥 묻혀 버리기엔 올테면 와봐 또다시 나를 꺽어봐 이제는 안돼 \n나를 살게한 사랑을 위해 두번 다시는 죽지 않겠어 나를 지켜봐줘 \n\n시간 저편에 묻어둔 얘기 이제는 말할께 진심 아니야 모두 오해야 나를 믿어줘 \n언제나 나의 곁에서 아무 말없이 나를 지켜 주었지 견딜 수 있어 이렇게 다시 일어서 다시 시작해 \n나를 살게한 사랑을 위해 두번 다시는 죽지 않겠어 나를 지켜봐줘 \n\n견딜 수 있어 이렇게 다시 일어서 다시 시작해 \n나를 살게한 사랑을 위해 두번 다시는 죽지 않겠어 나를 지켜봐줘 \n나를 살게한 사랑을 위해 두번 다시는 죽지 않겠어 나를 지켜봐줘 \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130396, lowkey: nil, highkey: nil},
