  {album_id: 63, singer_id: 73, team_id: nil, title: "Is It Love (Feat. As One)", genre1: "가요", genre2: "발라드", runtime: "04:41", lyrics: "\n\t\t\t\t\t\t\t<div>Is It Love (Feat. As One) - 04:41</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">Is it love Is it love \n어쩜 좋아 어쩜 좋아 이럴 때 지금 나는 꿈을 꾸고 있는걸까 이럴 때 어떡하는 것일까 \n나만 홀로 이러는 것일까 어떻게 해 Is it love, Is it love, 이런 게 사랑이라고 말하는 것일까 \nIs it love, wanting to be with you in every single moment of my life. You are my whole life. \n사랑이란 날 들뜨게 하는 거 When I'm with you, I am always feeling high \n\n이럴 때 어떡하는 것일까? 나만 홀로 이러는 것일까 어떻게 해 \nIs it love, 이런 게 사랑이라고 말하는 것일까 baby \nIs it love, wanting to be with you in every single moment of my life. You are my whole life. \n그대 없이는 살아갈 수 없는데 어떡하라는 말야 \n\nIs it love, 이런 게 사랑이라고 말하는 것일까 baby \nIs it love, wanting to be with you in every single moment of my life. You are my whole life. \nIs it love, 이런 게 사랑이라고 말하는 것일까 baby \nIs it love, wanting to be with you in every single moment of my life. You are my whole life. \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/276/15026276_1405993398291_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130399, lowkey: nil, highkey: nil},
