  {album_id: 63, singer_id: 73, team_id: nil, title: "We All Need A Lifetime (Feat. 불독맨션)", genre1: "가요", genre2: "발라드", runtime: "04:46", lyrics: "\n\t\t\t\t\t\t\t<div>We All Need A Lifetime (Feat. 불독맨션) - 04:46</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">앞서가는 저 사람 그런 사람 바쁜 일도 많겠지만 뒤따라오는 사람 그런 사람 나 같아서 좋아 \n그토록 사랑하는 사람도 여지껏 함께한 사람까지도 Come on Everyone \n\nWe all need a 예술 같은 Lifetime. We don't need a 거지 같은 Lifetime. We all need a 매직 같은 Lifetime. \nI know realthing 혼자가 아냐 그게 살고 싶은 Lifetime \n\n지금까지는 니가 아니 니가 귀찮아 미루어왔어 이제부터는 내가 아니 내가 깔쌈이 할꺼야 \n여전히 혼자 있는 사람도  그러다 날 만난 사람까지도 Come on everyone \n\nWe all need a 예술 같은 Lifetime. We don't need a 거지 같은 Lifetime. We all need a 매직 같은 Lifetime. \nI know realthing 혼자가 아냐 그게 살고 싶은 Lifetime \n\n걱정하니 우리가 너와 늘 함께 하잖아 그래도 괜찮아 Come on everyone \nWe all need a 예술 같은 Lifetime. We don't need a 거지 같은 Lifetime. We all need a 매직 같은 Lifetime. \nI know realthing 혼자가 아냐 그게 살고 싶은 Lifetime \nCome on everyone \nWe all need a 예술 같은 Lifetime. We don't need a 거지 같은 Lifetime. We all need a 매직 같은 Lifetime. \nI know realthing 혼자가 아냐 그게 살고 싶은 Lifetime \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/276/15026276_1405993398291_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130406, lowkey: nil, highkey: nil},
  {album_id: 63, singer_id: 73, team_id: nil, title: "Why Can’t We (Feat. 이소정)", genre1: "가요", genre2: "발라드", runtime: "04:20", lyrics: "\n\t\t\t\t\t\t\t<div>Why Can’t We (Feat. 이소정) - 04:20</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">I'm standing here to tell you that I can't go on. I'm sorry, dear. \nTried everything, but I think we must say good-bye. \n\nYou're standing there once again in the same place where I can't be. \nAlways too far for me to reach my hand to you. \n\nTell me why it feels you're always far away. Tell me why I cannot wipe your tears away. \nTell me why I can't be with you every single night \nwhy we can't be together when I'm in love with you \nwhen you're in love with me, why can't we. \n\nIt's hard to say that we were never meant to be. I'm sorry, dear. \nEasy to say that we were never meant to be. I'm sorry, dear. \n\nTell me why it feels I'm never meant for you. Tell me why then I still feel this love for you. \nTell me why you can't be with me every single night \nwhy we can't be together when you're in love with me \nwhen I'm in love with you, why can't we. \n\nAlthough I still have so much love for you what good is it when I make you cry at night \n\nwe both know that there is nothing we can do. \nI guess there're things we cannot change or overcome \nBaby, you should (just) turn around and walk away from me \nso you can't see the tears that I'm holding back from you tears that know our love is through. \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/276/15026276_1405993398291_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130407, lowkey: nil, highkey: nil},
  {album_id: 63, singer_id: 73, team_id: nil, title: "사랑하오 (Feat. 윤상)", genre1: "가요", genre2: "발라드", runtime: "05:10", lyrics: "\n\t\t\t\t\t\t\t<div>사랑하오 (Feat. 윤상) - 05:10</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">그대 사랑하오.\r\n아직도 사랑을 알지 못하지만 이 나이 되도록. \r\n\r\n그대 사랑하오. \r\n그대의 눈빛은 영원히 빛나오. 날 믿어주오.\r\n \r\n그대가 나를 모른다 해도 그러다 날 버린다 해도\r\n바보처럼 그 자리에서 사랑하오.\r\n\r\n나는 약속하오. \r\n우리의 사랑이 영롱한 빛으로 물들 것임을.\r\n \r\n그대가 나를 모른다 해도 그러다 날 버린다 해도. \r\n바보처럼 그 자리에서 사랑하오.\r\n \r\n그대 사랑하오. \r\n말로 다 이 맘을 표현 못하지만 난 사랑하오. \r\n\r\n그대가 이 맘을 허락해준다면 이 세상 끝까지 함께 하겠소.\r\n \r\n그대 사랑하오. \r\nOh And I and I always love you 말로 다 못하오. 난 사랑하오.</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/276/15026276_1405993398291_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130408, lowkey: nil, highkey: nil},
