  {album_id: 64, singer_id: nil, team_id: 19, title: "Bravo, My Life", genre1: "가요", genre2: "락", runtime: "04:23", lyrics: "\n\t\t\t\t\t\t\t<div>Bravo, My Life - 04:23</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">해 저문 어느 오후, 집으로 향한 걸음 뒤에 \r\n서툴게 살아왔던 후회로 가득한 지난 날 \r\n그리 좋지는 않지만 \r\n그리 나쁜 것만도 아니었어 \r\n\r\n석양도 없는 저녁, 내일 하루도 흐리겠지 \r\n힘든 일도 있지 드넓은 세상 살다보면 \r\n하지만 앞으로 나가 내가 가는 것이 길이다\r\n \r\nBravo Bravo my life 나의 인생아 \r\n지금껏 달려온 너의 용기를 위해 \r\nBravo Bravo my life 나의 인생아 \r\n찬란한 우리의 미래를 위해 \r\n\r\n내일은 더 낫겠지, 그런 작은 희망 하나로 \r\n사랑할 수 있다면, 힘든 1년도 버틸 거야 \r\n일어나 앞으로 나가 니가 가는 것이 길이다 \r\n\r\nBravo Bravo my life 나의 인생아 \r\n지금껏 달려온 너의 용기를 위해 \r\nBravo Bravo my life 나의 인생아 \r\n찬란한 우리의 미래를 위해  \r\n\r\n고개들어 하늘을 봐 창공을 가르는 새들 \r\n너의 어깨에 잠자고 있는 \r\n아름다운 날개를 펼쳐라 \r\n\r\nBravo Bravo my life 나의 인생아 \r\n지금껏 달려온 너의 용기를 위해 \r\nBravo Bravo my life 나의 인생아 \r\n찬란한 우리의 미래를 위해\r\n\r\nBravo Bravo my life 나의 인생아 \r\n지금껏 달려온 너의 용기를 위해 \r\nBravo Bravo my life 나의 인생아 \r\n찬란한 우리의 미래를 위해 \r\n\r\nBravo Bravo my life 나의 인생아 \r\n지금껏 달려온 너의 용기를 위해 \r\nBravo Bravo my life 나의 인생아 \r\n찬란한 우리의 미래를 위해 Bravo</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/277/15026277_1368152773341_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 9768, song_num: 16130415, lowkey: nil, highkey: nil},
  {album_id: 64, singer_id: nil, team_id: 19, title: "화해연가 (和解戀歌)", genre1: "가요", genre2: "락", runtime: "05:03", lyrics: "\n\t\t\t\t\t\t\t<div>화해연가 (和解戀歌) - 05:03</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">그대여 날좀봐요! \r\n계속 토라져 있을건가요. \r\n용기내어 다가가는 날 버려두진 않겠죠. \r\n그대여 웃어봐요! \r\n그댄 웃는 모습이 귀여워요. \r\n시간이 이렇게 흐르면 \r\n우리는 후회하고 말꺼야. \r\n내 말 들어봐요. \r\n\r\n잊었나봐요. 우리가 처음 만난날을 \r\n세상은 온통 핑크빛 구름 위 였었죠. \r\n힘이 들땐 위로하고 서로 그리워 하던 \r\n그때로 우리 잠깐 돌아가보도록 해요. \r\n\r\n알아요. 나도 이러고 싶진 않아요. \r\n하지만 그대의 무뚝뚝한 모습을 보면 \r\n난 아무말도 못하겠어요. \r\n넌 내 반쪽이 아니라 전부라 밀하던 당신이 \r\n이런 내 모습까지 사랑해 줄순 없는 걸까요. \r\n\r\n그대여 날좀 봐요. \r\n계속 토라져 있을건가요. \r\n용기내어 다가가는 날 버려두진 않겠죠. \r\n그대여 웃어봐요. \r\n그댄 웃는 모습이 귀여워요. \r\n시간이 이렇게 흐르면 \r\n우리는 후회하고 말꺼야. \r\n내 말 들어봐요. \r\n\r\n잊진 않겠죠. 우리가 했던 약속들을 \r\n세상끝까지 변치 말고 행복하자던 \r\n용서하며 사는것이 인생아니던가요. \r\n그대여. 고개들어 같은 곳을 바라봐요</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/277/15026277_1368152773341_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130416, lowkey: nil, highkey: nil},
  {album_id: 64, singer_id: nil, team_id: 19, title: "In The City", genre1: "가요", genre2: "락", runtime: "05:18", lyrics: "\n\t\t\t\t\t\t\t<div>In The City - 05:18</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">There Are Many People In The City \r\nThere Are Many Walkers On The Street \r\nThere Are Many Sympathies In My Mind \r\nThere Are So Many Desire Out There \r\n\r\nThere Are Many People In The City \r\nThere Are Many Walkers On The Street \r\nThere Are Many Sympathies In My Mind \r\nThere Are So Many Desire Out There \r\n\r\n그 많은 사람속에 숨어있는 \r\n그리운 나를 찾아가면 \r\n그 모습 그대로 남아있는 \r\n그리운 나를 찾을 수 있을까? \r\nYou Bet Your Boots! \r\n\r\nThere Are Many People In The City \r\nThere Are Many Walkers On The Street \r\nThere Are Many Sympathies In My Mind \r\nThere Are So Many Desire Out There \r\n\r\nThere Are Many People In The City \r\nThere Are Many Walkers On The Street \r\nThere Are Many Sympathies In My Mind \r\nThere Are So Many Desire Out There \r\n\r\n그 많은 사람속에 숨어있는 \r\n그리운 나를 찾아가면 \r\n그 모습 그대로 남아있는 \r\n그리운 나를 찾을 수 있을까? \r\nYou Bet Your Boots! \r\n\r\nThere Are Many People In The City \r\nThere Are Many Walkers On The Street \r\nThere Are Many Sympathies In My Mind \r\nThere Are So Many Desire Out There</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/277/15026277_1368152773341_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130417, lowkey: nil, highkey: nil},
  {album_id: 64, singer_id: nil, team_id: 19, title: "갈망", genre1: "가요", genre2: "락", runtime: "00:33", lyrics: "\n\t\t\t\t\t\t\t<div>갈망 - 00:33</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가사 정보가 없습니다.</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/277/15026277_1368152773341_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130418, lowkey: nil, highkey: nil},
