  {album_id: 64, singer_id: nil, team_id: 19, title: "Je Suis Violet", genre1: "가요", genre2: "락", runtime: "00:23", lyrics: "\n\t\t\t\t\t\t\t<div>Je Suis Violet - 00:23</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가사 정보가 없습니다.</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/277/15026277_1368152773341_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130420, lowkey: nil, highkey: nil},
  {album_id: 64, singer_id: nil, team_id: 19, title: "사랑하나봐", genre1: "가요", genre2: "락", runtime: "05:36", lyrics: "\n\t\t\t\t\t\t\t<div>사랑하나봐 - 05:36</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">그대의 사랑은 보라 \r\n나의 사랑의 빛은 자주 \r\n일렁이는 사랑의 색은 불타는 환희 \r\n그대 숨결은 저 구름 \r\n나의 가슴은 파란 하늘 \r\n물결치는 그대 날개는 창공의 희열 \r\n이대로 시간이 멈춘다면... \r\n그대 눈빛에 나는 얼어버리고 말 것 같아 \r\n우 - 나 사랑하나봐 \r\n우 - 널 사랑하나봐 너를... \r\n\r\n그대는 나의 천국 그대는 나의 이상 \r\n그대는 잠자는 나의 욕망의 분출 \r\n이대로 시간이 멈춘다면... \r\n나의 영혼은 그만 불타버리고 말 것 같아 \r\n우 - 나 사랑하나봐 \r\n우- 널 사랑하나봐 너를... \r\n\r\n우 - 나 사랑하나봐 \r\n우- 널 사랑하나봐 너를...</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/277/15026277_1368152773341_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130421, lowkey: nil, highkey: nil},
  {album_id: 64, singer_id: nil, team_id: 19, title: "너는 지금쯤...", genre1: "가요", genre2: "락", runtime: "03:49", lyrics: "\n\t\t\t\t\t\t\t<div>너는 지금쯤... - 03:49</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">책상서랍 속 구석에 간직한 편지 속에는 \r\n너와 내가 오래 전에 나눈 얘기 담겨있어 \r\n먼훗날 다른 사람 만나 사랑해도 \r\n날 잊지 말고 찾아 줘, \r\n너의 고민 내가 풀어줄께.\r\n \r\n좋은 사람 만나 행복하면 \r\n나도 웃음 지을 수 있어, \r\n너만 행복하면 난 괜찮아 \r\n갈 수 없는 지난날들\r\n이젠 기억 속에 사라지고 \r\n이룰 수 없는 지난 약속 \r\n이젠 기억하지 않기로 해 \r\n\r\n너는 지금쯤 어디서 누구와 살고있을까? \r\n너와 내가 오래 전에 나눈 얘기 기억하니? \r\n먼훗날 다른 사람 만나 사랑해도 \r\n날 잊지 말고 찾아 줘, \r\n너의 고민 내가 풀어줄께. \r\n\r\n좋은 사람 만나 행복하면 \r\n나도 웃음 지을 수 있어, \r\n너만 행복하면 난 괜찮아 \r\n갈 수 없는 지난날들 \r\n이젠 기억 속에 사라지고 \r\n이룰 수 없는 지난 약속 \r\n이젠 기억하지 않기로 해 \r\n\r\n나 어디서든 너를 마주치면 얘기할 꺼야 \r\n너와 내가 오래 전에 나눈 얘기 잊지 말자...</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/277/15026277_1368152773341_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130422, lowkey: nil, highkey: nil},
