  {album_id: 64, singer_id: nil, team_id: 19, title: "2001-10-17", genre1: "가요", genre2: "락", runtime: "00:24", lyrics: "\n\t\t\t\t\t\t\t<div>2001-10-17 - 00:24</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">오늘은 미래가 있다는 전제에 이미 과거이다. \r\n나의 과거는 그래도 돌아가고픈 \r\n아스라한 추억으로 남았는데 \r\n\r\n과연 오늘이란 과거는 \r\n어떤 모습으로 남을지 \r\n\r\n살면 살수록 알면 알수록 힘든 세상 \r\n그래도 황폐한 내일을 위해 \r\n오늘을 느끼며 살아야겠다</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/277/15026277_1368152773341_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130424, lowkey: nil, highkey: nil},
