  {album_id: 65, singer_id: 75, team_id: nil, title: "내친구 Radio", genre1: "가요", genre2: "발라드", runtime: "05:17", lyrics: "\n\t\t\t\t\t\t\t<div>내친구 Radio - 05:17</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">나 어릴 적엔 외로운 아이\n내 옆엔 항상 Radio 있었지\n캄캄한 밤에도 내 귀에 가까이\n언제나 내게 Radio 있었지\n\nRadio 나는 너를 기억해\nRadio 너를 잊을 수 없어\nRadio 소중했던 내 친구\nRadio 지금도 널 기억해\n\n그러던 어느날 새로운 친구\n화려한 모습의 그건 Television\nTV가 온 뒤로 TV와 가까이\n버림받았던 너는 외로웠지\n\nREPEAT) Radio 나는 너를 기억해\nRadio 너를 잊을 수 없어\nRadio 소중했던 내 친구\nRadio 지금도 널 기억해</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130429, lowkey: nil, highkey: nil},
  {album_id: 65, singer_id: 75, team_id: nil, title: "어떻게 말할까", genre1: "가요", genre2: "발라드", runtime: "05:24", lyrics: "\n\t\t\t\t\t\t\t<div>어떻게 말할까 - 05:24</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">어떻게 말할까\n\n어떻게 전할까\n\n어떻게 내 마음 속에 있는 내생각을 ...\n\n시간은 흐르고 있는데....\n\n어떻게 말할까 ..\n\n내 마음......\n\n날 이해 해줄까 ? 날 받아들일까? \n\n혹시 나를 외면 하진 않을까 ?\n\n\n\n후렴)\n\n어쩌면 그 럴지 도 몰라 ..\n\n어쩌면 안그럴지도 몰라 .\n\n나에게는 오직 너뿐이란 말야 \n\n내 맘은 온통 , 너의 그리움에 가득 싸여 있다고 \n\n우~~~~~우~~~~</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130430, lowkey: nil, highkey: nil},
