  {album_id: 65, singer_id: 75, team_id: nil, title: "그책 (The Book The Bible)", genre1: "가요", genre2: "발라드", runtime: "04:41", lyrics: "\n\t\t\t\t\t\t\t<div>그책 (The Book The Bible) - 04:41</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">나 외로울 때 그 책을 꺼내 조용한 방에 그 책을 읽지\n내 모든 고민 해답을 주지 그책은 항상 나를 위로해\n** 그 책, 그 책, 그 책 바로 그 책 *2\n\n나 아파 누워 괴로워할 때 그 책을 꺼내 가슴에 안지\n내 모든 고통 치료해주지 그 책은 항상 나를 치료해\n**그 책(The Book The Bible), 그 책(The Book The Bible),\n그 책(The Book The Bible) 바로 그 책 *2\n속에 가면 나 편하지\n어떤 근심도 다 사라져 그 책, 바로 그 책</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130434, lowkey: nil, highkey: nil},
