  {album_id: 65, singer_id: 75, team_id: nil, title: "새힘 (New Power From Heaven)", genre1: "가요", genre2: "발라드", runtime: "05:46", lyrics: "\n\t\t\t\t\t\t\t<div>새힘 (New Power From Heaven) - 05:46</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">dedicated to N.Y.W.T.C\n새힘을 얻어야 해 이대로 좌절할순 없어\n내가 아무리 힘들어도 내게 희망이 없다해도 새힘을\n새힘을 가져야 해 이렇게 포기할순 없어\n고통이 내게 몰려와도 깊은 상처로 끄라려도\n새힘이 필요해\n내머리위에 검은 먹구름 또 비바람이 불어도\n독수리처럼 큰 날개짓하며 더 높이 날아야 하는거야!\n그위로 날면 고요한 평화의 바람\n평안한 쉼이 있는거야 고통의 상처가 없는곳 그위엔 그위엔 \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130437, lowkey: nil, highkey: nil},
