  {album_id: 66, singer_id: nil, team_id: 20, title: "종로에서", genre1: "가요", genre2: "전체", runtime: "03:54", lyrics: "\n\t\t\t\t\t\t\t<div>종로에서 - 03:54</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">그렇게 떠나야만 했던\r\n시간 속에서\r\n너를 보내기는 정말 싫었어\r\n돌아서는 너의 슬픈 미소속에\r\n사무친 그리움을 나는 알았어\r\n회기로 향하던\r\n쓸쓸한 플랫폼에서\r\n서성이던 모습 보이지 않고\r\n허전한 빈 공간 속을 걷고있는\r\n너의 모습 생각해봤어\r\n오고가는 많은 사람들 속에서\r\n너는 무얼 생각하고 있을까\r\n두눈에 이슬 가득담고\r\n슬픈미소 지으며\r\n무얼 그리워하고 있을까\r\n내가 곁에 있어도\r\n그립다고 말하던 그대여\r\n힘겹던 네 모습이\r\n나를 울리네\r\n내가 곁에 있어도\r\n그립다고 말하던 그대에게\r\n내일은 사랑한다 말해줄꺼야\r\n오고가는 많은 사람들 속에서\r\n너는 무얼 생각하고 있을까\r\n두눈에 이슬 가득담고\r\n슬픈미소 지으며\r\n무얼 그리워하고 있을까\r\n내가 곁에 있어도\r\n그립다고 말하던 그대여\r\n힘겹던 네 모습이\r\n나를 울리네\r\n내가 곁에 있어도\r\n그립다고 말하던 그대에게\r\n내일은 사랑한다 말해줄꺼야\r\n내가 곁에 있어도\r\n그립다고 말하던 그대에게\r\n내일은 사랑한다 말해줄꺼야</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/280/15026280_1408953314623_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130451, lowkey: nil, highkey: nil},
  {album_id: 66, singer_id: nil, team_id: 20, title: "너 이길 바래", genre1: "가요", genre2: "전체", runtime: "03:34", lyrics: "\n\t\t\t\t\t\t\t<div>너 이길 바래 - 03:34</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">잊어줘 그냥 지금처럼 곁에\r\n보여줘 그냥 너의 그 마음을\r\n말해줘 그냥 날 사랑한다는 그 말을...\r\n\r\n*rap\r\n저기 높은 하늘 위로 날아가는 새들이 내눈에 들어와\r\n너와 내가 영원히 하나가 되어\r\nMake one the best couple in the world\r\n그댈 보면 가슴이 떨려 너무 기쁜 마음에 눈물이 흘러\r\nMy feeling like a heaven in the lucky seven\r\n너는 나의 귀여운 looney tune\r\n\r\n너이길 바랬어 나의 사랑은 그러길 바랬어 나의 마음도\r\n아니길 바랬어 다른 사람은 그러길 바랬어 너의 마음도\r\n나이길 바래...\r\n\r\n*rap\r\n가만히 눈을 감아 내 앞에 그녀를 상상해\r\n그대 위로 햇살 넓은 들판에 크나큰 나무 한그루\r\n그 아래 우리 둘 Just the two of us\r\n기지개를 펴며 우리 함께 쉬는 한숨 향긋한 꽃 내음\r\n상쾌한 이 기분 내 옆에 있는 너를 한껏 안아 줄 꺼야\r\n모든 내 모든 것들을 네게 보여주고 싶은 내 맘을\r\n이런 내 맘을 알겠니 워우워...\r\n\r\n*rap\r\n나 여자친구 생겼는데 너무나 이쁘고 무지하게 착하고\r\n내게 누구보다 잘해 주는 여자 애야\r\n그래 그래 너 잘났다 나는 어째 요모양인지\r\n나에게 자랑 좀 해봐\r\n이세상 누구와도 바꿀 수 없는 그녀\r\n그냥 함께 있고 싶어지는 내맘\r\n와 좋겠다 나의 님은 어디에 너만 말고 나좀 도와주라\r\n\r\n넌 예전처럼 그냥 난 지금처럼 그냥\r\n이제 서로에게 항상 함께 할 수 있는 날에\r\n우리 행복할 수 있도록 제발~~\r\n이대로 이길 바랬어 나의 사랑은\r\n그러길 바랬어 나의 마음도 아니길 바랬어 다른 사람은\r\n그러길 바랬어 너의 마음도 너이길 바랬어 나의 사랑은\r\n그러길 바랬어 나의 마음도 아니길 바랬어 다른 사람은\r\n그러길 바랬어 너의 마음도 너이길 바래...</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/280/15026280_1408953314623_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130452, lowkey: nil, highkey: nil},
  {album_id: 66, singer_id: nil, team_id: 20, title: "그대 없인 난 늘 이별일텐데", genre1: "가요", genre2: "전체", runtime: "04:36", lyrics: "\n\t\t\t\t\t\t\t<div>그대 없인 난 늘 이별일텐데 - 04:36</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">내 전화 없인 못 일어날 그댄데 \n어쩌면 오늘도 늦을텐데 \n수화길 매만지다가 그대 번홀 누르다 \n한숨처럼 끊는 날 모르겠죠 \n\n그댈 웃게 할 얘긴 더 필요 없는데 \n이젠 나만 웃게 하면 되는데 \n사진 속 그대가 그 곁에 행복한 내가 \n눈물밖엔 줄게 없다 하네요 \n\n괜찮아질까요 점점 나아질까요 \n아직 그댈 위해 해줄게 더 내겐 많은데 \n익숙해질까요 정말 잊혀질까요 \n숨을 쉬는 것도 내겐 벅찬데 \n\n그대 방안에 내 사진 그대로인지 \n아니면 모두다 버렸는지 \n자꾸만 생각날까봐 또 울게 될까봐 \n빈 상자 속에 담아보네요 \n\n우리 시간엔 어제 그 후횐 없는지 \n그대 생일에 난 뭘 해야할지 \n다신 못 본다면 다시는 못볼꺼라면 \n조금만 더 머물 순 없었는지 \n\n괜찮아질까요 점점 나아질까요 \n아직 그댈 위해 해줄게 더 내겐 많은데 \n익숙해질까요 정말 잊혀질까요 \n숨을 쉬는 것조차 그대가 없어 힘든데 \n\n생각한 것처럼 안돼요 내 맘이 안돼요 \n차라리 그대가 와 줄순 없나요 내게 \n\n괜찮아질까요 점점 나아질까요 \n아직 살아가야 할 날이 더 내겐 많은데 \n익숙해질까요 정말 잊혀질까요 \n그대 없인 난 늘 이별일텐데\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/280/15026280_1408953314623_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130453, lowkey: nil, highkey: nil},
  {album_id: 66, singer_id: nil, team_id: 20, title: "Why", genre1: "가요", genre2: "전체", runtime: "04:17", lyrics: "\n\t\t\t\t\t\t\t<div>Why - 04:17</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">지금부터 사랑에 대한 몇마디 지금까지 겪어온\n주저리 소리 지난날에 사랑에 생각의 테두리\n지친 너희들의 관념밖에 탈피 지루한 너희들의 마음들을\n정지 시킬 수 있을만한 사랑의 정의\n비로소 너의 맘을 덮어주는 우리 티없이 맑고 아름다운\n우리 얘기\n\nPlease feel me nedder shout with me 지금까지 깊이\n당한적 있지 하지만 나는 절대 어중이 떠중이가 아니지\n나는 hip-hop을 사랑하는 korean mc\n나는 여태껏 짓밟혀 살아왔어 20년 동안 기한번 못펴봤어\n그나 저나 그 loser는 왜 자꾸 TV에 나와\n빠리리 cf는 너무 싫어\n\n(왜 울었는지 사랑은 없는건지 돌아봐야 할 세상이 왜\n이렇게 보이는지 힘껏 뛰어볼래 마구 소리 질러볼래\n많은 사람이 웃을 수 있는 세상 만들어 볼래)\n\n*rap\n아픔을 겪은 후에 후회한 후에 무너진 마음에\n가지고 있는 rhyme에 모두다 A-men\n부서져버린 망가져버린 내 이상 내 낙원 버린내 끝내\n형체도 없는 흑체 사랑이 무너져버린이\n우리 앞에 내리던 비 마치 지옥의 Pain\nmercy를 베푸는 beautyful한 세상이 오기 만을 기다리리\nyo...\n\n지금 내게 주어진 세상에서 버려진 이들을 위해\n살아가기 힘들어할 필욘없어\n중요한건 돈이 아냐 종교를 위해 하는것도 절대 아냐\n이 세상은 너만의 것이 아니라는 것을 아니\n어려운 일을 위해 자신보다 못한 사람을 위해 나의 것을\n아주 조금 분해 해준다면 보다 좋을꺼야\n순환 되지 않는 사랑이란 말에 순한 사람들의 마음은\n상처받고 수산이라고 말하는 현실에 할 수만 있다면\n사랑을 난 하고싶어\n수많은 연인들이 행복하고 수탄한 적도 수십번이지만\n수단 방법 가리지 않고 살아가면 온순한 사랑\n결국 이룩할 수 있어\n\n어두운 곳 그늘진 곳 세상 등지고 살아가는\n그들을 힘껏 안아봐</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/280/15026280_1408953314623_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130454, lowkey: nil, highkey: nil},
  {album_id: 66, singer_id: nil, team_id: 20, title: "Just One", genre1: "가요", genre2: "전체", runtime: "04:07", lyrics: "\n\t\t\t\t\t\t\t<div>Just One - 04:07</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">너를 버리려는 나를 원망 하지는 마\n떠나가는 나를 보며 눈물 짓지는 마\n내겐 나만을 바라보며 웃음짓는\n또 나없이는 살아 갈 수가 없는 소중한 여인이 있어\n모두 거짓말 이였어 나를 잊어줘\n너의 사랑을 져버리고 떠나가는 못된 남자따윈\n이젠 그만 잊어버려\n\n내게 그런 말하지 않아도 이미 멀어졌다 생각해\n떠나 보내기 싫어서 였어 제발 나에게 돌아 와 줘\n\n*한번 뿐이라고 생각해 너 하나 뿐이라 생각해\n하지만 이미 혼자 아닌 너에게 향한 내 마음은\n많이 기다릴 수 도 있어 혹시 내게 올 수 있겠니\n사실은 이미 다른 사람 택해도 이대로 있을게 괜찮아\n\n*rap\n한번 뿐이라고 생각해 단 한번 뿐이라고 생각해\n떨어지는 낙엽처럼 누군가가 밟아 으스러진 낙엽처럼\n갈기갈기 찢겨져 버린 너를 안아주고 싶어\n조금만 아주 조금만 일찍 너를 만났다면\n영원히 너만을 사랑했을꺼야 사랑해\n\n어떤말도 이겨낼게 주위에 시선 따윈 상관없어\n다음이라도 너와 함께 있는 것만이 나의 바램 전부잖아</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/280/15026280_1408953314623_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130455, lowkey: nil, highkey: nil},
  {album_id: 66, singer_id: nil, team_id: 20, title: "Forever With You", genre1: "가요", genre2: "전체", runtime: "03:44", lyrics: "\n\t\t\t\t\t\t\t<div>Forever With You - 03:44</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">온 세상이 하얗던 그날 너와 만난 이 겨울\n헤어지고 싶지 않은 이 밤 오 너의 집 앞~\n조금만 더 있겠다는 너의 입술엔 따뜻한 너의 입술\n\n*이렇게 어지러운 내 머리위로 내리는 눈을 바라보며\n함께 웃지 언제나 날 아껴주는 너의 그 귀여운 마음을\n언제까지나 지켜줄래\n**가끔은 나를 아프게 해 울고 있을 때 넌\n곧장 내게 달려와 잘못했다며 나를 안아주지만\n사실은 아주 작은 것 하나 잊지 않고 날 기쁘게 해\n너를 사랑해 Forever with you....\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/280/15026280_1408953314623_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130456, lowkey: nil, highkey: nil},
  {album_id: 66, singer_id: nil, team_id: 20, title: "진이", genre1: "가요", genre2: "전체", runtime: "03:10", lyrics: "\n\t\t\t\t\t\t\t<div>진이 - 03:10</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">진이~ 진이~ \n\n진이 너 없는 동안에 나 한번도 널 잊은 적 없고\noh~ 진이 넌 모를꺼야 너외엔 다른 사람 없다는 걸\n\n한번만 더 늦기전에 나를 사랑한다고 해줘\n넌 나의 전부야 그건 너의 오해야 \n날 믿어주길 바래\n\n이 시간이 간이 간이 지나가기 전에 \n내게 용기를 내어서 돌아와줘\n나의 맘이 맘이 맘이 변하기 전에 \nI wanna be the MR.Lee\n\n진이 너의 사진 속에 행복해 보이는 우리가 있고\noh~ 진이 함께한 날보다 이별이 더 중요하진 않아\n\n한번만 더 늦기 전에 나를 사랑한다고 해줘\n넌 나의 전부야 그건 너의 오해야\n날 믿어주길 바래\n\n이 시간이 간이 간이 지나가기 전에 \n내게 용기를 내어서 돌아와줘\n나의 맘이 맘이 맘이 변하기 전에 \nI wanna be the MR.Lee\n\n밤이면 너의 창에 불이 꺼지겠지 \n너의 꽃길로 날 만나러 와줘\n이젠 더이상 망설일 필요 없어 \n처음 그 느낌처럼\n\n이 시간이 간이 간이 지나가기 전에 \n내게 용기를 내어서 돌아와줘\n나의 맘이 맘이 맘이 변하기 전에 \nI wanna be the MR.I wanna be the MR.\nI wanna be the MR.Lee\n\n진이~ 진이~\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/280/15026280_1408953314623_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130457, lowkey: nil, highkey: nil},
  {album_id: 66, singer_id: nil, team_id: 20, title: "My Love", genre1: "가요", genre2: "전체", runtime: "03:53", lyrics: "\n\t\t\t\t\t\t\t<div>My Love - 03:53</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">Say you love me now I reallly need you \ntonight oh my baby I love you \nSay I love you now I do want you tonight \noh my baby I love you \n\n(Narration) \n\n왜 자꾸 니가 떠오르는 건지 \n내 자신이 정말 싫어 \n내 앞엔 너 아닌 다른 사람이 이미 앉아 있는데 \n깨끗이 끝난 줄 알았었는데 \n다시 또 흔들린 나를 이해 할 순 없어 \n미워할수록 자꾸만 보고 싶어 잊으려 했지만 \n알았어 나에겐 너만이 전부라는 걸 \n\nMy love 다시 너에게 갈 수 있도록 나를 도와줘 \n두려워하는 나의 두 손을 잡아 줘 다시는 영원히 놓치 않게 \nMy love 날 꼭 안아 줘 니 곁을 떠나서 갈 수 없게 \n너를 떠났던 그 시간 만큼 그 만큼 함께 있으면 돼 \n\n깨끗이 끝난 줄 알았었는데 \n다시 또 흔들린 나를 이해 할 순 없어 \n미워할수록 자꾸만 보고 싶어 \n잊으려 했지만 알았어 나에겐 너만이 전부라는 걸 \n\nMy love 다시 너에게 갈 수 있도록 나를 도와줘 \n두려워하는 나의 두 손을 잡아 줘 다시는 영원히 놓치 않게 \nMy love 날 꼭 안아 줘 니 곁을 떠나서 갈 수 없게 \n너를 떠났던 그 시간만큼 그 만큼 함께 있으면 돼 \n\nMy love 다시 찾은 널 놓치지 않게만 해 달라고 \n너를 보내준 하늘에게 난 우리의 영원한 사랑을 기도 할께 \nMy love 날 꼭 안아줘 니가 나를 사랑하는 만큼 \n날 힘들게 한 그 시간만큼 영원히 함께 해주면 돼\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/280/15026280_1408953314623_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130458, lowkey: nil, highkey: nil},
  {album_id: 66, singer_id: nil, team_id: 20, title: "너 잘났어", genre1: "가요", genre2: "전체", runtime: "03:55", lyrics: "\n\t\t\t\t\t\t\t<div>너 잘났어 - 03:55</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">정말이지 난 모르겠어 지금 너만은 다른 남자와 \n다를 거라 생각하며 널 만났었지 \n너의 개방적인 이성관을 이미 알곤 있었지만 그렇게 \n여러 여자와 사귈 줄 몰랐어 \n내게 말해온 너의 미래와 날 위해 보낸 너의 어제 \n그 모두가 모두가 너의 장난 이라니 \n내가 하루하루 의무감에 싸여 순간 순간 너를 또 \n확인하고 구속하듯이 참견하는 니 성격이 싫어 \n그래 너 잘났어 다정한 그 눈빛을 왜 내게 줬던 거야 \n널 믿고 바보같이 울던 내가 너무나 싫어 \n\n너의 개방적인 이성관을 이미 알곤 있었지만 나만은 \n너의 여자 인줄로만 알았어 \n내게 말해온 너의 미래와 날 위해 보낸 너의 어제 그 \n모두가 모두가 너의 장난이라니 \n나도 나의 맘을 정말 모르겠어 널 사랑하지 못할 것만 \n같아 사랑한다는 건 또 다른 슬픔의 시작 일뿐 \n그래 너 잘났어 이게 그 유치한 미련이라는 거니 널 \n잊지 못해 울고 있는 내가 너무나 싫어 \n내가 하루하루 의무감에 싸여 순간 순간 너를 또 \n확인하고 구속하듯이 참견하는 니 성격이 싫어 \n그래 너 잘났어 이게 그 유치한 미련이라는 거니 \n널 잊지 못해 울고 있는 내가 너무나 싫어 \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/280/15026280_1408953314623_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130459, lowkey: nil, highkey: nil},
  {album_id: 66, singer_id: nil, team_id: 20, title: "종로에서 (MR)", genre1: "가요", genre2: "전체", runtime: "03:54", lyrics: "\n\t\t\t\t\t\t\t<div>종로에서 (MR) - 03:54</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가사 정보가 없습니다.</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/280/15026280_1408953314623_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130460, lowkey: nil, highkey: nil},
  {album_id: 66, singer_id: nil, team_id: 20, title: "그대 없인 난 늘 이별일텐데 (MR)", genre1: "가요", genre2: "전체", runtime: "04:33", lyrics: "\n\t\t\t\t\t\t\t<div>그대 없인 난 늘 이별일텐데 (MR) - 04:33</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가사 정보가 없습니다.</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/280/15026280_1408953314623_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130461, lowkey: nil, highkey: nil},
  {album_id: 67, singer_id: nil, team_id: 21, title: "여정 (旅程)", genre1: "가요", genre2: "R&amp;B/소울", runtime: "04:31", lyrics: "\n\t\t\t\t\t\t\t<div>여정 (旅程) - 04:31</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">먼곳에서라도 한번만 더 다시 볼수 있기를 아무말이라도 단 한마디라도 건낼수 있기만을 \n\n너무나 간절했어 (너를 첨 봤을때) 하지만 두려웠어 (지쳐 버릴까봐) \n볼수만 있다면 난 더이상 바랄게 없을만큼 사랑했어 \n\n어느샌가 우리 가까워졌고 내곁에만 있기를 혹시 꿈이라도 하룻밤이라도 이대로 영원하길 \n아무리 보아도 모자라기만 할뿐 아무리 주어도 채워지지 않을 사랑이 \n\n너무나 간절했어 (너와 함께해도) 하지만 두려웠어 (너를 잃을까봐) \n곁에만 있다면 더 바랄게 없는줄 알았는데 \n\n사랑하면 할수록 멀어져가는 너의 맘을 몰랐어 \n너무나 간절했어 (다시 돌아오기를) 하지만 두려웠어 (내가 돌아설까) \n추억만 있다면 내 기다림 쉬울줄 알았는데 \n\n보내야 하는가봐 (이제라도 너를) 잊어야 하는가봐 (내가 살기위해) \n마지막 조차도 행복하라는 그말을 못할만큼 사랑했어 \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130462, lowkey: nil, highkey: nil},
  {album_id: 67, singer_id: nil, team_id: 21, title: "감춰진 사랑", genre1: "가요", genre2: "R&amp;B/소울", runtime: "03:12", lyrics: "\n\t\t\t\t\t\t\t<div>감춰진 사랑 - 03:12</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">처음 나를 봤을때 누굴 닮았다했지 지금까지 찾았던 사람이라며 \n아무 의심 없었지 너만 곁에 있다면 니가 원한 모습에 맞춰갔었지 \n\n너의 지갑속에 있는 사진을 봤어 변한 내 모습과 똑같은 그사람 \n첨부터 나란건 없었던거니 떠나간 사랑을 대신하려 만난거니 \n이제와 그에게 돌아갈꺼니 버려진 내맘은 어떡할꺼니 \n\n나의 지난 추억을 간직했던 나에게 지나버린 사랑은 잊으라했지 \n아무 상관 없었어 너를위해서라면 내가 가진 모든걸 버려도됐지 \n\n너의 지갑속에 있는 사진을 봤어 변한 내 모습과 똑같은 그사람 \n첨부터 나란건 없었던거니 떠나간 사랑을 대신하려 만난거니 \n이제와 그에게 돌아갈꺼니 버려진 내맘은 어떡할꺼니 \n너의 지갑속에 있는 사진을 봤어 변한 내 모습과 똑같은 그사람 \n\n첨부터 나란건 없었던거니 떠나간 사랑을 대신하려 만난거니 \n이제와 그에게 돌아갈꺼니 버려진 내맘은 어떡할꺼니 \n첨부터 나란건 없었던거니 떠나간 사랑을 대신하려 만난거니 \n이제와 그에게 돌아갈꺼니 버려진 내맘은 어떡할꺼니 \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130463, lowkey: nil, highkey: nil},
  {album_id: 67, singer_id: nil, team_id: 21, title: "너하나 없는데", genre1: "가요", genre2: "R&amp;B/소울", runtime: "04:43", lyrics: "\n\t\t\t\t\t\t\t<div>너하나 없는데 - 04:43</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">후회를 한다고 소용없는 일인줄 알지만 널 보낸후 아무것도 난 할수없어 \n아침에 일찍 눈을 뜰 이유조차 없고 혼자 보낼 휴일도 내겐 견디기 힘든 시간이였지 \n너만 없는데 나 그뿐인데 왜 모든게 변해야 되는지 나처럼 너도 변해갔는지 \n이런것이 니가 말한 행복이란 것인지 아직도 너만을 사랑하는 나에게 돌아와 \n\n서로의 행복을 위한거라 넌 내게 말했지 지금 우리 니 말처럼 행복한거니 \n아침에 일찍 눈을 뜰 이유조차 없고 혼자 보낼 휴일도 내겐 견디기 힘든 시간이였지 \n너만 없는데 나 그뿐인데 왜 모든게 변해야 되는지 나처럼 너도 변해갔는지 \n이런것이 니가 말한 행복이란 것인지 아직도 너만을 사랑하는 나에게 돌아와 \n정말 우리들의 행복을 빈다면 나에게로 돌아와 \n\n너만 없는데 나 그뿐인데 내 모든게 변해야 되는지 나처럼 너도 변해갔는지 \n이런것이 니가 말한 행복이란 것인지 아직도 너만을 사랑하는 나에게 돌아와 \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130464, lowkey: nil, highkey: nil},
  {album_id: 67, singer_id: nil, team_id: 21, title: "상처", genre1: "가요", genre2: "R&amp;B/소울", runtime: "04:01", lyrics: "\n\t\t\t\t\t\t\t<div>상처 - 04:01</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">내 품에 잠들은 그녀의 모습을 보면서 떠난 널 지우고 이젠 잠이 들고 싶어 \n아침에 눈뜨면 날 깨우는 그녈 바라보며 너의 기억도 꿈처럼 다 잊고 싶어 \n아무리 잊으려 해봐도 널 지울순 없기에 오늘밤 떠난 니 생각에 나 잠 못들 것 같아 \n이제는 너 아닌 사랑에 내 상처뿐인 그 모든 기억들을 지우려 눈을 감아도 또 눈물만 \n\n내 앞의 그녀를 나 웃으며 바라보지마 또다시 내 안엔 온톤 너의 생각만이 \n네 손을 잡은듯 나 그녀의 손에 누워봐도 낯선 체온에 너무 슬퍼질 뿐인데 \n아무리 잊으려 해봐도 널 지울순 없기에 오늘밤 떠난 니 생각에 나 잠 못들 것 같아 \n이제는 너 아닌 사랑에 내 상처뿐인 그 모든 기억들을 지우려 눈을 감아도 또 눈물만 \n\n다신 돌아갈 순 없는데 난 너의 곁에 없는데 얼마나 많이 너를 지나야 내 안의 넌 지워질까 \n너를 잊으려 해봐도 널 지울순 없기에 오늘밤 떠난 니 생각에 나 잠 못들 것 같아 \n이제는 너 아닌 사랑에 내 상처뿐인 그 모든 기억들을 지우려 눈을 감아도 또 눈물만 \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130465, lowkey: nil, highkey: nil},
  {album_id: 67, singer_id: nil, team_id: 21, title: "Today", genre1: "가요", genre2: "R&amp;B/소울", runtime: "04:24", lyrics: "\n\t\t\t\t\t\t\t<div>Today - 04:24</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">How can you leave me alone tonight 우린 너무 사랑했었잖아 \n그런 니가 날 떠나가 버리면 이젠 가진게 없잖아 \n아니지 꿈이지 혹시 내 사랑이 식은건지 데우기 위해 나와 헤어지는 척 할꺼없지 \n너에게 서운해 잠시 겁을 주려 했던거지 끝내잔 말이 진짜 니 마음과 다른 거지 \n\nHow can you leave me alone tonight 우린 너무 사랑했었잖아 \n그런 니가 날 떠나가 버리면 이젠 가진게 없잖아 \n매일 먼저 눈을 뜨면 니가 보고 싶을텐데 나 어떻게 해야하니 \n네 생각나는만큼 네게 전화하고 싶을텐데 나 어떻게 견뎌보니 \n널 아는 친구들이 너의 소식 물을텐데 나 어떻게 또 피해가니 \n너 없는 하루조차 내겐 니 생각들텐데 대체 어떻게 살아가니 \n\nHow can you leave me alone tonight 우린 정말 행복했었잖아 \n오랜 시간이 흘러가 지나도 난 너를 잊을 수 없잖아 \n끝내 모르고 넌 갈꺼야 내게 머물렀던 순간들이 \n남은 날들의 기다림을 매일 눈물처럼 보태 울꺼란걸 \n\nHow can you leave me alone tonight 우린 정말 사랑했었잖아 \n그런 니가 날 떠나가버리면 이젠 가진게 없잖아(사랑했었잖아) \nHow can you leave me alone tonight 우린 정말 행복했었잖아 \n오랜 시간이 흘러가 지나도 난 너를 잊을 수 없잖아 \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130466, lowkey: nil, highkey: nil},
  {album_id: 67, singer_id: nil, team_id: 21, title: "여우 (女優)", genre1: "가요", genre2: "R&amp;B/소울", runtime: "03:35", lyrics: "\n\t\t\t\t\t\t\t<div>여우 (女優) - 03:35</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">애써 감추지 말아죠 니가 떠나는 이유를 며칠째 너의 눈물이 나에겐 더 우스운걸 \n나보다 좋은 사람을 만났다고 하면 쉬운데 가증스런 눈물로 니맘을 숨기려하니 \n이제 너의 사랑은 필요없어 서둘러 떠나가줘 나도 사실은 너를 데리고 잠시 논거뿐야 \n널만나 널 사랑한적 없어 잠시 스친거뿐이야 먼저 떠나는 니 사랑을 기다렸던거야 \n\n아무말하지 말아줘 이대로 그냥 떠나줘 구차한 너의 혀끝의 변명이 더 잔인할걸 \n잠시라도 니곁에 머물렀던 나를 후회해 바보처럼 너의 사랑을 조금은 원했던거야 \n이제 너의 사랑은 필요없어 서둘러 떠나가줘 나도 사실은 너를 데리고 잠시 논거뿐야 \n널만나 널 사랑한적 없어 잠시 스친거뿐이야 먼저 떠나는 니 사랑을 기다렸던거야 \n\n제발 미안하다고 말하지마 뒤돌아 웃음질텐데 더는 어설픈 그 말들로 나를 놀리지마 \n이제 너의 사랑은 필요없어 서둘어 떠나가줘 나도 사실은 너를 데리고 잠시 논거뿐야 \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130467, lowkey: nil, highkey: nil},
  {album_id: 67, singer_id: nil, team_id: 21, title: "훔친사과가 맛있다", genre1: "가요", genre2: "R&amp;B/소울", runtime: "03:36", lyrics: "\n\t\t\t\t\t\t\t<div>훔친사과가 맛있다 - 03:36</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">나의 눈앞에 니가 있는데 머리 속엔 그녀가 너의 입술이 내게 닿을 땐 그녈 떠올리곤 해 \n우리에겐 모두다 서로가 사랑하는 사람이 있는 사실을 알지만 \n사랑하지 않아도 그보다 두근대는 가슴을 내게 알려준 그녀를 난 잊을 수 없어 \n마지막이란 다짐하고 만날 때마다 나도 모르게 더욱 깊이 그녀 속에 빠져 \n\n꼭 한번이라 약속하고 입술을 뺏었지만 그때 알았지 훔친 입술이 더욱 달콤하단걸 \n우리에겐 모두다 서로가 사랑하는 사람이 있는 사실을 알지만 \n사랑하지 않아도 그보다 두근대는 가슴을 내게 알려준 그녀를 난 잊을 수 없어 \n마지막이란 다짐하고 만날 때마다 나도 모르게 더욱 깊이 그녀 속에 빠져 \n언젠가는 이런 만남이 끝이 보인다해도 이순간을 영원하기를 \n\n마지막이란 다짐하고 만날 때마다 나도 모르게 더욱 깊이 그녀 속에 빠져 \n마지막이란 다짐하고 만날 때마다 나도 모르게 더욱 깊이 그녀 속에 빠져 \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130468, lowkey: nil, highkey: nil},
  {album_id: 67, singer_id: nil, team_id: 21, title: "미인 (美人)", genre1: "가요", genre2: "R&amp;B/소울", runtime: "04:16", lyrics: "\n\t\t\t\t\t\t\t<div>미인 (美人) - 04:16</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">왜 울고만 있나요 내 앞에 너무도 아름다운 그대여 제발 고개를 들어요 내 사랑이 아직은 그대 곁에 있는데 \n나 그대 처음 만난 그날의 환한 미소로 나를 보내줘 그대 그 슬픈 얼굴을 나 본적 없었기에 \n나 기억 못할지도 몰라요 \n\n그대는 떠날때도 아름다워야 해요 그대 화장이 눈물로 지워지지않길 \n내 곁에서 떠나는 그 순간까지 아직은 내 사랑인데 초라한 모습은 싫어요 \n\n나 웃을 수 있어요 남겨진 나를 걱정 말아요 그대여 그대 그 여린 가슴에 내 슬픈 모습 오랜시간 상처될까봐 \n그대는 떠날때도 아름다워야 해요 그대 화장이 눈물로 지워지지않길 \n내 곁에서 떠나는 그 순간까지 아직은 내 사랑인데 초라한 모습은 싫어요 \n\n날 돌아보지 말아요 나 흔들릴지 몰라요 지금 모습 그대로 제발 날 떠나가기를 \n난 또 어떻게든 살겠죠 그대 없는 그 날들을 잠시 그대를 사랑했었던 기억에 \n그대 날 떠나가도 아름다워야 해요 누굴 만나도 항상 그 모습 간직하길 \n나 그대를 보내며 내 흘린 눈물만큼 그대에게 준 미소가 마지막 내 웃음이었죠 \n\n그대는 떠날때도 아름다워야 해요 그대 화장이 눈물로 지워지지않길 \n내 곁에서 떠나는 그 순간까지 아직은 내 사랑인데 초라한 모습은 싫어요 \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130469, lowkey: nil, highkey: nil},
  {album_id: 67, singer_id: nil, team_id: 21, title: "마지막 배려", genre1: "가요", genre2: "R&amp;B/소울", runtime: "03:35", lyrics: "\n\t\t\t\t\t\t\t<div>마지막 배려 - 03:35</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">수많은 날들 그 사람을 끝내 지울 수 없었던 나인거죠 오직 나만을 바라보던 그대 사랑하지 못한 날 용서해요 \n참 많이 아팠죠 그대 나를 볼때면 내가 떠나면 더는 나를 사랑하지 않겠죠 It's hard to say goodbye \n나같은 나쁜 사람은 다신 그대에게 없기를 이대로 날 떠나도 뒤돌아보지 말아요 그대 눈물을 난 볼 수 없기에 \n\n그 어떤 말도 그대에겐 위로조차 될 수 없는 날 용서해요 \n난 알고 있어요 그대 안의 슬픔을 다 알수 없는 사랑을 나 역시 간직한걸요 It's hard to say goodbye \n나같은 나쁜 사람은 다신 그대에게 없기를 이대로 날 떠나도 뒤돌아보지 말아요 그대 눈물을 난 볼 수 없기에 \n\n언젠가 사랑을 잊고 다시 사랑할 수 있다면 그때 찾을께요 It's hard to say goodbye \n그대의 아픈 사랑은 내가 마지막이 되기를 이렇게 날 떠나도 언제나 기억할께요 \n그대 내게 줬던 사랑을 It's hard to say goodbye \n나같은 나쁜 사람은 다신 그대에게 없기를 이대로 날 떠나도 뒤돌아보지 말아요 \n그대 눈물을 난 볼 수 없기에 이젠 지워요 그 사랑을... \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130470, lowkey: nil, highkey: nil},
