  {album_id: 68, singer_id: 76, team_id: nil, title: "Beloved", genre1: "가요", genre2: "댄스", runtime: "04:15", lyrics: "\n\t\t\t\t\t\t\t<div>Beloved - 04:15</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">1. 나 이렇게 사는 걸\r\n오늘도 여전히 니가 궁금해 많이\r\n널 볼 수는 없어도\r\n그저 조금만 멀리 있는 거라고\r\n나는 알잖아 견뎌야 하는 걸\r\n이젠 너 없이 살아 내야 하니\r\n널 보내고 모든 것을 잃은 것처럼\r\n이제는 난 아무것도 할 수 없잖아\r\n\r\n* one ( love u ) two ( so much )\r\n이렇게 하루하루 세어가며 나는\r\n\r\nthree ( need u ) four ( so bad)\r\n매일 또 그 아픈 이별을 해\r\n\r\n( 보이지 않니 ) 너의 ( 너의 ) 자린 ( 자린 ) 여기야\r\n다시 내게 돌아와\r\n\r\n언재나 그 모습 그대로 인채 beloved\r\n\r\n2. 우연이라도 널 볼 순 없을까\r\n할 수 있는 건 널 기다리는 일\r\n꼭 사랑이 아닌 다른 이유를 대신해\r\n가끔은 내게 기대어 올 순 없니\r\n\r\n* one ( love u ) two ( so much )\r\n이렇게 하루하루 세어가며 나는\r\n\r\nthree ( need u ) four ( so bad)\r\n매일 또 그 아픈 이별을 해\r\n\r\n( 보이지 않니 ) 너의 ( 너의 ) 자린 ( 자린 ) 여기야\r\n다시 내게 돌아와\r\n\r\n언재나 그모습 그대로인 채 워우워~~\r\n\r\n혹시 라도 널 다시 보면 말할께\r\n나의 사랑 아직은 끝나지 않았다고\r\n\r\non&amp;on ( on&amp;on ) together ( together )\r\n이렇게 멈추지 않는 눈물이 바로\r\n\r\nwhenever ( whenever ) whatever ( whatever )\r\n못다한 나의 애기인거야\r\n\r\n( 들리지 않니 ) 이렇게 나만의 사랑이\r\n널 바라보며 언제나 그랬어\r\n\r\n혼잣말처럼 beloved\r\n\r\n\t\t\t\t\t</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/282/15026282_1381998405116_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130475, lowkey: nil, highkey: nil},
