  {album_id: 68, singer_id: 76, team_id: nil, title: "심 (心)", genre1: "가요", genre2: "댄스", runtime: "03:54", lyrics: "\n\t\t\t\t\t\t\t<div>심 (心) - 03:54</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">지금 떠나가는 그대가 나의 삶에\r\n내가 잃은 전부라는 걸 아니?\r\n세상 끝이라도 지켜주고픈 \r\n내 사랑은 그대하나인 걸 아니?\r\n나 태어나 하루를 머물어도 가져가는건\r\n그대의 모습 그대의 이름뿐이야\r\n너를 위해서 할 수 있는 거라면\r\n그저 그냥 원하는 그대로 보낼께 그래왔던 것처럼\r\n나를 잊어도 변하는 건 없을 거야\r\n하늘아래 너만을 위하는 \r\n한사람 그건 바로 나일테니까\r\n\r\n\r\n나 태어나 하루를 머물어도 가져가는 건\r\n그대의 모습 그대의 이름뿐이야\r\n너를 위해서 할 수 있는 거라면\r\n그저 그냥 원하는 그대로 보낼께 그래왔던 것처럼\r\n나를 잊어도 변하는 건 없 거야\r\n하늘 아래 너만을 위하는\r\n한사람 그건 나이니까\r\n\r\n너를 위해 살고 너를 위해 꿈꾸던 나\r\n이제는 다 잊어버려 다 지워버려~\r\n넌 누구보다 내 맘을 잘 알잖아 난 괜찮아\r\n조금도 넌 미안해 하지마\r\noh~제발~~~oh~baby~baby~~baby\r\n넌 나를 잊고 언제나 행복해줘\r\n다시는 내게 돌아오지마\r\n그때는 세상에 나는 없으니까 \r\n\t\t\t\t\t</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/282/15026282_1381998405116_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130478, lowkey: nil, highkey: nil},
