  {album_id: 69, singer_id: 77, team_id: nil, title: "Intro", genre1: "가요", genre2: "발라드", runtime: "00:39", lyrics: "\n\t\t\t\t\t\t\t<div>Intro - 00:39</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">음악이여\r\n\r\n그대는 사막같은 날 깨우고,\r\n\r\n한여름 소나기로 내게 다가섰습니다.\r\n\r\n내 오만함을 일깨우고,\r\n\r\n나의 부족함으로 긴 시간을 돌아\r\n\r\n지금 함께 있습니다.\r\n\r\n그대는 날 기댈수밖에없게 합니다. \r\n\r\n[마지막여행]</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/283/15026283_1444022595986_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130484, lowkey: nil, highkey: nil},
  {album_id: 69, singer_id: 77, team_id: nil, title: "나 때문이죠", genre1: "가요", genre2: "발라드", runtime: "03:55", lyrics: "\n\t\t\t\t\t\t\t<div>나 때문이죠 - 03:55</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">난 또 어려워져요 이러지않으려고 \r\n나를 달래왔는데 눈물이 또 넘쳐서\r\n그댈 힘들게 해요 이러면 안되는데\r\n자꾸 열이 나네요 아니 괜찮아요\r\n아니예요 감기예요\r\n바람이 너무 청아해서 어제 산책을 했거든요\r\n내가 원래 좀 어설프죠\r\n그대 걱정만 하게하고 자꾸 속만 상하게 하죠\r\n내가 없다고 아침 거르지마요\r\n늦잠자면 안되요 잔소리만 하네요\r\n내가 그렇잖아요\r\n나때문이죠 그대 잘못없는데\r\n우리 마지막인데\r\n나때매 그대가 또 울게되네요\r\n\r\n아니 말해요\r\n오늘 하루만큼은 내게 기대어줘요\r\n나를 살피지마요 그럼 화낼꺼예요\r\n노력했지만 정말 안되나봐요\r\n그댈 사랑하지만 \r\n이렇게 밖에는 안되나봐요\r\n혼자 힘들어야할 그댈\r\n남겨두기가 자꾸 미안해져요\r\n내가 없다고 아침 거르지마요\r\n늦잠자면 안되요 잔소리만 하네요\r\n내가 그렇잖아요 \r\n나때문이죠 그대 잘못없는데 \r\n우리마지막인데 나땜에 그대가 또 울게 되네요</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/283/15026283_1444022595986_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 9794, song_num: 16130485, lowkey: nil, highkey: nil},
  {album_id: 69, singer_id: 77, team_id: nil, title: "요즘 우리는", genre1: "가요", genre2: "발라드", runtime: "03:32", lyrics: "\n\t\t\t\t\t\t\t<div>요즘 우리는 - 03:32</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">OH I WANNA BE WITH YOU 하지만 너무 어려워. \nOH I WANNA KEEP YOUR LOVE 하지만 이렇게는 안\n되지. \nOH I WANNA FORGIVE YOU 이대로 멋대로 굴게 되\n겠지. \nOH I WANNA BE WITH YOU 요즘 나 정말 너무 힘\n들어. \n자기가 성질이 급한건 정말 모르지 모든 게 내 \n탓이구 내가 잘못한거지. \n이런말 듣기 싫어 하는 건 알겠지만 그렇게 피\n한다고 되는 일이 아니야. \n이러다간 우리사이 어떻게 될 지 몰라 괜히 그\n러는 게 아냐 \n너무나 참고 참아온 일인걸 영화를 보러 가도 \n니가 보고 싶은 것 \n친구를 만난 대도 니네 친구들이지. 뭐든지 니 \n맘대로 니가 우선이잖아. \n지금도 빠져나갈 궁리만 하고 있지. 오! 이러지\n마 예전으로 돌아와줘 \n다정한 세심한 포근한 너였지. 이러지 않았었잖\n아 너의 그런 많은 이유로 \n날 구속하는 지금도 난 오로지 바로 한가지 우\n리 서로 조금씩 어긋나고 있는 것. \n달라진건 내가 아닌 너의 이기심일 뿐 이라는 \n걸. 너의 이해만을 내게 강요한 \n네 모습이 우리사일 어긋 나게 하고 있는 걸. \n우리도 남들처럼 식어가고 있는지? \n아니면 이게 바로 헤어지기 위한 순서인건지?</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/283/15026283_1444022595986_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130486, lowkey: nil, highkey: nil},
  {album_id: 69, singer_id: 77, team_id: nil, title: "너무 다른 널 보면서", genre1: "가요", genre2: "발라드", runtime: "03:54", lyrics: "\n\t\t\t\t\t\t\t<div>너무 다른 널 보면서 - 03:54</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">I don't think I can't wait until you go \naway \n너무 다른 널 보면서 더는 자신 없어 \nforever more 이젠 널 보내달라던 말 정말 어렵\n겠지만 \n난 들어줄 수 밖에 이대로 나는 기대하고 있었\n지 \n너를 만나러 걸어올 때까지도 그래 하지만 너\n의 모진 말들이 \n나를 도울거라고 그렇게 나는 믿을게 내게 밤새\n워 얘기를 해봐도 \n너의 이름을 불러도 이젠 소용없다는 걸 알아 \n나를 사랑했다는 \n그말 이젠 하지말아줘 혼자 견뎌가야 할 나를 \n위해 많은 시간이 \n또 난 필요하겠지 아주 먼곳으로 너를 보낼때까\n지 그래 하지만 \n너를 잡는 것보다 조금 쉬울거라고 그렇게 나\n는 믿을게 \n내게 밤새워 얘기를 해봐도 너의 이름을 불러\n도 이젠 소용없다는 걸 알아 \n나를 사랑했다는 그말 이젠 하지 말아줘 혼자 \n견뎌가야 할 나를 위해 끝내 \n이별 앞에 쓰러져 주저 앉은 나지만 그래도 너\n뿐인걸 알고 있는지 \n오늘 초라한 나는 모두 지우기를 바래 처음 나\n의 모습만 기억해줘 \nI don't think I can't wait until you go \naway \n너무 다른 널 보면서 더는 자신 없어 \nforever more 이젠 널 보내달라던 말 정말 어렵\n겠지만 \n난 들어줄 수 밖에 너를 위해 \nI don't think I can't wait until you go \naway \n너무 다른 널 보면서 안녕 My love∼</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/283/15026283_1444022595986_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130487, lowkey: nil, highkey: nil},
  {album_id: 69, singer_id: 77, team_id: nil, title: "그래서", genre1: "가요", genre2: "발라드", runtime: "04:05", lyrics: "\n\t\t\t\t\t\t\t<div>그래서 - 04:05</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">설마 그대가 아니야 아닐거야 \n그럴 리가 없잖아 너무 겁이나 \n내가 뭐를 본거야 내가 꿈을 꾼거야 \n내게 왜이래 아무말도 하지마 그녀는 아니야 \n대답하지마 돌이키지 못해 \n괜스레 화가 나는 걸 다정한 말투 \n내게 스며드는 너 아프게 웃는 니가 미워져 \n너를 보니 또 나 눈물이 나와 \n그랬던거니 그래 이거였었니 \n그래서 날 피했니 없었던거야 \n나는 모르는 거야 그러니 너도 잊어 \n내게 왜이래 아무말도 하지마 그녀는 아니야 \n대답하지마 오히려 니가 더 나에게 화가 나겠\n지 \n버리지 못해 못 본 채 하는 내가 \n하지만 아직 너를 사랑해 \n너를 보니 또 나 눈물이 나와 돌이키지 못해 \n괜스레 화가 나는 걸 다정한 말투 \n내게 스며드는 너 아프게 웃는 니가 미워져\n너를 보니 또 나 눈물이 나와 \n그녀 생각에 또 눈물이</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/283/15026283_1444022595986_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130488, lowkey: nil, highkey: nil},
  {album_id: 69, singer_id: 77, team_id: nil, title: "처음이자 마지막", genre1: "가요", genre2: "발라드", runtime: "04:29", lyrics: "\n\t\t\t\t\t\t\t<div>처음이자 마지막 - 04:29</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">\n마음에 들어 오래 준비했는데 \n이런 이게 아닌데 자꾸 엉망이 되네 \n오늘만은 예쁘게 보이고 싶어 \n마지막 모습일테니 \n\n* 다 새겨둬야지 \n너의 숨소리 이 떨림 까지도 \n나 너무나 행복해 널 가지고 살테니 \n처음이자 마지막이 돼버릴 이 밤 \n나 너무나 고마워 넌 아프게 울지만 \n울음이 터져 버릴만큼 난 행복해 \n\n다시 안고 안아도 모자라고 모자라 \n아무리 널 보고 또 봐도 너무 그리운 너 \n애를 태우는 시간 안타까운데 \n창으로 아침이 오네 \n\n* Repeat\n\n니 붉어진 얼굴도 애틋한 눈빛도 \n그 모든 아픔 내가 가져 갈테니 \n넌 그만 잊어 힘겨울 너는 내가 싫은걸 \n그때처럼 처음처럼 넌 \n나 너무나 행복해 널 가지고 살테니 \n처음이자 마지막이 돼버릴 이 밤 \n나 너무나 고마워 넌 아프게 울지만 \n울음이 터져 버릴만큼 난 행복해\n\n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/283/15026283_1444022595986_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130489, lowkey: nil, highkey: nil},
  {album_id: 69, singer_id: 77, team_id: nil, title: "조금만 사랑했다면", genre1: "가요", genre2: "발라드", runtime: "04:17", lyrics: "\n\t\t\t\t\t\t\t<div>조금만 사랑했다면 - 04:17</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">1.날 이해할 순 없겠지 \r\n이런 내 모습 미안해 \r\n이룰수 없는 우리 사랑을 알아 \r\n아프도록 눈물로 날 달래어 보지만 \r\n오히려 지쳐갈 뿐 \r\n조금만 사랑했다면 우리 행복했을텐데 \r\n너무 어려운 사랑을 했었나 봐 \r\n사랑했던 기억에 많이 힘들겠지만 \r\n이제는 보내야 해 \r\n\r\n*널 떠나야 하겠지 이것밖에 해줄 수 없는데 \r\n소중한 기억만으로 난 살아갈 수 있는 걸 \r\n함께 했던 시간이 행복할 수 있었던 건 \r\n고단했지만 그대 내게 있었으니 \r\n제발 나를 잊고 행복해 줘 견딜 수 있도록 \r\n영원히 널 사랑해 \r\n\r\n2.차라리 편히 울어줘 너무 애쓰려 하지마 \r\n젖은 목소리 오늘도 힘들었니 \r\n괜찮은 듯 웃지만 \r\n참고 있던 눈물이 촉촉히 느껴질 뿐 \r\n조금만 사랑했다면 우린 행복했을텐데 \r\n바랄 수 없는 사랑을 했었나봐 \r\n너무나도 간절히 너를 원했었지만 \r\n이제는 잊어야 해 \r\n\r\n*Repeat</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/283/15026283_1444022595986_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 9414, song_num: 16130490, lowkey: nil, highkey: nil},
  {album_id: 69, singer_id: 77, team_id: nil, title: "내가 아는 것", genre1: "가요", genre2: "발라드", runtime: "03:33", lyrics: "\n\t\t\t\t\t\t\t<div>내가 아는 것 - 03:33</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">\n왜 이래야만 해 이해가 안돼 \n왜 사랑하며 헤어져야 해 \n날 사랑한다면 진심이라면 \n그걸로 내겐 너무 충분해 \n\n*넌 나에게 부족하단 그 말로만 건네지만 \n그건 아냐 정말 아냐 날 위한게 아냐 \n아무리 날 위해서라고해도 \n그렇게 설득하려고 해도\n나는 몰라 정말 몰라 그런 건 몰라 \n이렇게 내 맘이 아프다는 것 \n니가 없이 살 수 없다는 것 \n그것만이 내가 아는 전부일뿐야 \n\n난 울고있잖아 아파하잖아 \n왜 말없이 넌 보고만 있어 \n날 언제까지나 지켜줄꺼란 \n니가 했던말 거짓인거야 \n\n* Repeat\n\n세상 누가 뭐라해도 너무나도 힘들어도 \n난 괜찮아 견딜꺼야 너만 있으면 돼 \n서로가 어울리지 않는단 말 \n날 행복하게 할 수 없단 말 \n나는 몰라 정말 몰라 그런건 몰라 \n내 곁엔 니가 있어야 한단 것 \n그것 만이 내 삶이라는 것\n그것만이 내가 아는 전부일뿐야 \n\n* Repeat\n\n\n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/283/15026283_1444022595986_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130491, lowkey: nil, highkey: nil},
  {album_id: 69, singer_id: 77, team_id: nil, title: "오해", genre1: "가요", genre2: "발라드", runtime: "04:00", lyrics: "\n\t\t\t\t\t\t\t<div>오해 - 04:00</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">\n우린 같은 영혼인걸 한 눈에 알아봤는데\n어쩌면 그것은 내 오핸지도 몰라\n\n*내게 던져진 슬픔을 두려워했던 맨 처음\n날 설득한 니 약속 다 바람같은 거야\n사랑이란 늘 잔인한 아픔을 뒤에 숨겨두고\n결국엔 날 혼자 가두고 웃는 걸 난 또 잊었어\n시들어 간 내 가슴 가엽긴 하지만\n니가 원한대로 보내줄꺼야\n잊어줄수 있어 짐이 될 눈물도 삼켰어 \n허나 오늘만은 혼자두지마\n\n* Repeat\n\n제발 오늘만은 혼자 두지마\n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/283/15026283_1444022595986_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 8118, song_num: 16130492, lowkey: nil, highkey: nil},
  {album_id: 69, singer_id: 77, team_id: nil, title: "원", genre1: "가요", genre2: "발라드", runtime: "03:53", lyrics: "\n\t\t\t\t\t\t\t<div>원 - 03:53</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">\n더는 바라지 않아 더는 원하지 않아 \n이렇게 니 곁에만 있게 해줘 이대로 볼 수 있게만 \n아냐 나를 바라봐 아냐 내 곁에 있어줘 \n알아도 모르는 척 하는거니 이렇게 바라보는 날 \n\n*그래 나는 안되겠니 그래 나는 아닌 거니 \n이토록 아픈게 사랑인거니 나를 견딜수 없게 해 \n사랑이 머물수 없도록 사랑이 살수 없도록 \n가슴이 죽어 버렸으면 해 더는 너를 찾지 않게 \n\n*Repeat \n\n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/283/15026283_1444022595986_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130493, lowkey: nil, highkey: nil},
  {album_id: 69, singer_id: 77, team_id: nil, title: "그 사람을 부탁해요", genre1: "가요", genre2: "발라드", runtime: "03:58", lyrics: "\n\t\t\t\t\t\t\t<div>그 사람을 부탁해요 - 03:58</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">부탁해요 많이 힘들거에요\r\n그의 곁에 있어줘요 \r\n혼자 있으면 외로워 할 거에요 \r\n옆에서 따뜻하게 웃어주세요 \r\n\r\n아이처럼 해맑은 사람이죠 오.. \r\n아주 여리고 착한사람이죠 \r\n술은 좀 줄여야 해요 원래는 안 그래요 \r\n나 때문이죠 \r\n너무나 속을 많이 썩혀서 \r\n잘해 주세요 너무 못해주었죠 \r\n당신만 믿을게요 이제는 편히 갈 수 있죠 \r\n한동안 힘겨웠던 사람 잘 부탁해요 \r\n너무 주제 넘지만 너무 염치 없지만 부탁해요</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/283/15026283_1444022595986_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 17532, song_num: 16130494, lowkey: nil, highkey: nil},
  {album_id: 69, singer_id: 77, team_id: nil, title: "Rona's Lie", genre1: "가요", genre2: "발라드", runtime: "02:17", lyrics: "\n\t\t\t\t\t\t\t<div>Rona's Lie - 02:17</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">너의 이런저런 점은 나빠나빠하며 \r\n너를 또 들춰내고 있어 \r\n너를 잊어버리자고 잊는다고하며 \r\n오히려 들먹이고 있지 \r\n아니야 아무렇지 않아 \r\n아무런 기억조차 나지 않아 \r\n\r\n* come back 매일같이 나를 속이는 나\r\ncome back 날 속이며 너를 찾는 나 \r\n우리 아무일도 없었던 것처럼 지내자고 \r\ncome back 매일같이 너를 잊어가니 \r\ncome back 그렇게도 너는 쉬운거니 \r\n다시 내게로 니가 있던 자리로 와야해 \r\n\r\n나는 니가 눈치채길 기다렸던 거지 \r\n하지만 너는 돌아섰어 \r\n그래 우리 조금 어색해지긴 했지만 \r\n친구로 남을 수 있잖니 \r\n아니야 나는 또 다른 말을 했어 \r\n나마저 속여가고 있었던거지 \r\n\r\n*Repeat \r\n\r\n*Repeat</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/283/15026283_1444022595986_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130495, lowkey: nil, highkey: nil},
  {album_id: 69, singer_id: 77, team_id: nil, title: "그녀의 사람을", genre1: "가요", genre2: "발라드", runtime: "03:55", lyrics: "\n\t\t\t\t\t\t\t<div>그녀의 사람을 - 03:55</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">\n그녀의 사람을 나 사랑했으니 \n그녀의 사람을 나 가지려 했으니 \n그래 그 댓가를 받아야 하지 \n그래 나 제자리로 돌아가야지 \n다 잊은 것처럼 모두 지워버리고 \n\n*사랑이 우릴 배신한거지 \n너와 난 아니야 우린 아니야 \n하지만 자꾸 난 니가 미워져 \n마음대로 할 수 없는 건 내 마음인 걸 \n\n사랑은 늘 두 눈을 멀게 했었지 \n사랑은 늘 무모함을 부추겼었지 \n그래서 여기까지 와야 했지만 \n사랑은 허울좋은 변명을 하지 \n또 버림받았지 다시 아파야 했지 \n\n* Repeat\n\n숨가빴던 사랑 흔적없이 사라지나 \n영원한 사랑은 없어 \n그래 이미 알면서도 \n나 이번만은 아닐거라고 \n사랑이 또 날 버리네 \n\n* Repeat\n\n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/283/15026283_1444022595986_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 10187, song_num: 16130496, lowkey: nil, highkey: nil},
  {album_id: 69, singer_id: 77, team_id: nil, title: "하지 못한 말", genre1: "가요", genre2: "발라드", runtime: "03:51", lyrics: "\n\t\t\t\t\t\t\t<div>하지 못한 말 - 03:51</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">\n수도 없는 변명 되뇌이어 봐도 \n나를 용서할 수 없는 걸 \n그댈 위한 길이었다고 \n나는 믿었었는데 믿었었는데\n부서질 것 같아 그대를 만지면 \n이내 사라질 것만 같아 \n너무 두렵고 난 무서워 \n이제 그만 눈을 떠 제발 깨어나줘 \n\n*아직 하지 못한 말이 있단말야 \n사랑한다는 말 하지 못했어 \n사랑한다고 널 사랑한다고 \n그 한마디 해야만 하는데\n\n단 며칠만이라도 아냐 단 하루만 \n우리 이대로는 안돼요 \n누구든 좀 도와줘요 우릴\n어떻게 나 이렇게 그대 보내라고 \n\n* Repeat\n\n* Repeat\n\n사랑한다고 사랑한다고 해야만 하는데\n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/283/15026283_1444022595986_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 12536, song_num: 16130497, lowkey: nil, highkey: nil},
  {album_id: 69, singer_id: 77, team_id: nil, title: "그는 떠나고 나는 남았다", genre1: "가요", genre2: "발라드", runtime: "04:36", lyrics: "\n\t\t\t\t\t\t\t<div>그는 떠나고 나는 남았다 - 04:36</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">\n문득 찻잔을 두 잔 꺼내었죠 \n이젠 하나면 충분한 일인데 \n나는 그대를 위해 우리를 위해 \n아침을 준비했죠 \n모두 잊어도 좋을 것 같은데 \n너무 익숙해져 버린 나는 \n또 잔인하게도 손이 먼저 가요 \n함께한 오래된 습관이 \n서로를 닮아가게 했지만 \n그대를 보낸 나를 서성이게 해 \n아직도 그대 빈자리에 그대를 채워두고 \n사는 바보는 두렵겠죠 남은 날들이 \n\n* 세상에 태어나 나 단 한사람 \n오직 그를 욕심낸 것 뿐인데 \n그것조차 허락할 수 없나요 도대체 왜인가요 \n한번만 한번만 부탁할게요 \n그를 내게 다시 데려다줘요 \n더는 아무것도 원치 않을게요 \n제발 내 곁에 돌려줘요 \n\n햇살이 가득한 날이면 \n그대가 불러주던 노래를 \n나도 모르게 흥얼거리게 돼죠 \n한가한 휴일이라도 되면 \n귀찮게 나를 베고 눕던 그대를 \n다시 한번 안고 싶은데 \n\n* Repeat\n\n내게 남겨진 생의 반을 \n그에게 줄 순 없나요 \n이건 아녜요 더는 못해요 \n\n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/283/15026283_1444022595986_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 6079, song_num: 16130498, lowkey: nil, highkey: nil},
  {album_id: 69, singer_id: 77, team_id: nil, title: "나 때문이죠 (BONUS TRACK)", genre1: "가요", genre2: "발라드", runtime: "03:57", lyrics: "\n\t\t\t\t\t\t\t<div>나 때문이죠 (BONUS TRACK) - 03:57</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">난 또 어려워져요 이러지않으려고 \r\n나를 달래왔는데 눈물이 또 넘쳐서\r\n그댈 힘들게 해요 이러면 안되는데\r\n자꾸 열이 나네요 아니 괜찮아요\r\n아니예요 감기예요\r\n바람이 너무 청아해서 어제 산책을 했거든요\r\n내가 원래 좀 어설프죠\r\n그대 걱정만 하게하고 자꾸 속만 상하게 하죠\r\n내가 없다고 아침 거르지마요\r\n늦잠자면 안되요 잔소리만 하네요\r\n내가 그렇잖아요\r\n나때문이죠 그대 잘못없는데\r\n우리 마지막인데\r\n나땜에 그대가 또 울게되네요\r\n\r\n아니 말해요\r\n오늘 하루만큼은 내게 기대어줘요\r\n나를 살피지마요 그럼 화낼꺼예요\r\n노력했지만 정말 안되나봐요\r\n그댈 사랑하지만 \r\n이렇게 밖에는 안되나봐요\r\n혼자 힘들어야할 그댈\r\n남겨두기가 자꾸 미안해져요\r\n내가 없다고 아침 거르지마요\r\n늦잠자면 안되요 잔소리만 하네요\r\n내가 그렇잖아요 \r\n나때문이죠 그대 잘못없는데 \r\n우리마지막인데 나땜에 그대가 또 울게 되네요</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/283/15026283_1444022595986_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130499, lowkey: nil, highkey: nil},
