  {album_id: 71, singer_id: 79, team_id: nil, title: "Small steps", genre1: "OST", genre2: "전체", runtime: "03:27", lyrics: "\n\t\t\t\t\t\t\t<div>Small steps - 03:27</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가사 정보가 없습니다.</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/285/15026285_1404875258560_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130505, lowkey: nil, highkey: nil},
  {album_id: 71, singer_id: 79, team_id: nil, title: "Do you?(우리 사랑하기를)", genre1: "OST", genre2: "전체", runtime: "04:07", lyrics: "\n\t\t\t\t\t\t\t<div>Do you?(우리 사랑하기를) - 04:07</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">기억해 우리처음 느꼈었던\r\n가슴시린 설레임\r\n단 하루도 꿈꾸지 못한 사랑\r\n이젠 말 할 수 있겠죠.\r\n\r\n수줍은 그대의 웃음이\r\n여전히 나의 마음을 설레게 해요.\r\n다시는 슬프지 않기를\r\n그대와 나 서로 같은 바램 그대\r\n사랑하기를 사랑하기를 해줄것 없는\r\n내 작은 맘 다 사랑하기를\r\n함께 나눌 수 없었던 오랜 기억은\r\n아직도 그대에겐 아프겠지만\r\n\r\n수줍은 그대의 웃음이 여전히 나의 마음을 설레게 해요.\r\n다시는 슬프지 않기를\r\n그대와 나 서로 같은 바램 그대만을\r\n사랑하기를 사랑하기를 해줄것 없는\r\n내 작은 맘 다 사랑하기를\r\n함께 나눌 수 없었던 오랜 기억은\r\n아직도 그대에겐 아프겠지만\r\n\r\n항상 그대 사랑한다고 말하고있나요.\r\n내 서글픈 사랑을 우리가 지켜갈 수 있게\r\n사랑하기를 사랑하기를 해줄것없는\r\n내 작은 맘 다 사랑하기를\r\n함께 나눌 수 없었던 오랜 기억은\r\n아직도 그대에겐 아프겠지~만\r\n\r\n사랑하기를</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/285/15026285_1404875258560_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130506, lowkey: nil, highkey: nil},
