  {album_id: 71, singer_id: 79, team_id: nil, title: "Shining smile", genre1: "OST", genre2: "전체", runtime: "03:00", lyrics: "\n\t\t\t\t\t\t\t<div>Shining smile - 03:00</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가사 정보가 없습니다.</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/285/15026285_1404875258560_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130514, lowkey: nil, highkey: nil},
  {album_id: 71, singer_id: 79, team_id: nil, title: "Papillon(나비)", genre1: "OST", genre2: "전체", runtime: "03:28", lyrics: "\n\t\t\t\t\t\t\t<div>Papillon(나비) - 03:28</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가사 정보가 없습니다.</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/285/15026285_1404875258560_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130515, lowkey: nil, highkey: nil},
  {album_id: 71, singer_id: 79, team_id: nil, title: "널 그리다.(sung by Yiruma)", genre1: "OST", genre2: "전체", runtime: "03:28", lyrics: "\n\t\t\t\t\t\t\t<div>널 그리다.(sung by Yiruma) - 03:28</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">언젠가 파란 하늘 사이로 \r\n너에게 보낸 나의 마음은\r\n천천히 나를 스쳐 지나가는 바람속에 \r\n가만히 두 눈을 감고 나만의 널 그리다\r\n맑은 너의 그 미소는 따뜻한 여름비처럼\r\n너와 지금 이 순간도 함께 나누고 있어\r\n\r\n천천히 나를 스쳐 지나가는 바람속에 \r\n가만히 두 눈을 감고 나만의 널 그리다\r\n맑은 너의 그 미소는 따뜻한 여름비처럼\r\n너와 지금 이 순간도 함께 나누고 있어\r\n\r\n새하얀 너의 미소는 깨끗한 눈송이처럼\r\n너와 지금 이 순간도 함께 나누고 있어\r\n\r\n천천히 나를 스쳐 지나가는 바람속에 \r\n가만히 두 눈을 감고 \r\n나만의 널 그리다</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/285/15026285_1404875258560_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130516, lowkey: nil, highkey: nil},
  {album_id: 71, singer_id: 79, team_id: nil, title: "Flowers we...", genre1: "OST", genre2: "전체", runtime: "03:07", lyrics: "\n\t\t\t\t\t\t\t<div>Flowers we... - 03:07</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가사 정보가 없습니다.</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/285/15026285_1404875258560_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130517, lowkey: nil, highkey: nil},
  {album_id: 71, singer_id: 79, team_id: nil, title: "사랑하기를(sung by 정재욱)", genre1: "OST", genre2: "전체", runtime: "04:35", lyrics: "\n\t\t\t\t\t\t\t<div>사랑하기를(sung by 정재욱) - 04:35</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">기억해요 우리 처음 느꼈었던 \r\n가슴 시린 설레임\r\n단 한번도 꿈꾸지 못한 사랑 \r\n이젠 말할수있겠죠 \r\n\r\n*수줍은 그대의 웃음이 여전히 나의마음을 설레게해요 \r\n다시는 슬프지않기를 \r\n그대와 나 서로 같은 바램 그대(그대만을)\r\n사랑하기를 사랑하기를 해줄것없는 내 작은 맘 날 사랑하기를\r\n함께 나눌수 없었던 오랜 기억은 아직도 그대에겐 아프겠지만\r\n\r\n*Repeat\r\n\r\n항상 그댈 사랑한다고 말해도 목이메이는 \r\n내 서글픈 사랑을 우리가 지켜갈수있겠죠\r\n사랑하기를 사랑하기를 해줄것없는내 작은맘 날 사랑하기를 \r\n함께 나눌수 없었던 오랜기억은 아직도 그대에겐아프겠지만\r\n사랑하기를..</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/285/15026285_1404875258560_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130518, lowkey: nil, highkey: nil},
  {album_id: 72, singer_id: nil, team_id: 22, title: "고물라디오", genre1: "가요", genre2: "인디", runtime: "04:32", lyrics: "\n\t\t\t\t\t\t\t<div>고물라디오 - 04:32</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">One! Two! Three! Four! \r\n타오르는 뜨거운 이 밤 나의 가슴을 적셔주는 싸구려 고물 라디오 \r\n한여름 밤 어여쁜 당신과 밤새도록 미친 춤을 추고 싶어 오예 랄랄라 \r\n형아가 부셔버린 고물 라디오 \r\nrock n'roll! rock n'roll! rock n'roll! tonight! \r\n불타던 나의 입술에 전설처럼 쉽게 지워지지 않는 새빨간 립스틱 \r\n학창시절 그리운 얼굴들 고물라디오처럼 사라져 버린 나의 사랑아 \r\n형아가 부셔버린 고물 라디오 \r\nrock n' roll! rock n' roll! rock n' roll! Guitar! \r\n\r\n당신은 알고 있나요 오래 전부터 꿈꿔왔던 나의 세상이 사라져 버린걸 \r\n하지만 울지 않아요 나의 사랑이 이렇게 웃고 있잖아요 오예 랄랄라 \r\n형아가 부셔버린 고물 라디오 \r\nrock n'roll! rock n'roll! rock n'roll! tonight! \r\n엄마 무릎 베고 듣던 고물라디오에선 지금 \r\n흘러간 옛 노래만이 나의 가슴을 적셔주네? 오예? \r\n타오르는 뜨거운 이 밤 나의 가슴을 적셔주는 싸구려 고물 라디오 \r\n한여름 밤 어여쁜 당신과 밤새도록 미친 춤을 추고 싶어 오예 랄랄라 \r\n불타던 나의 입술에 전설처럼 쉽게 지워지지 않는 새빨간 립스틱 \r\n학창시절 그리운 얼굴들 고물라디오처럼 사라져 버린 나의 사랑아 \r\n\r\n고물라디오처럼 내 곁을 떠나가 버린 \r\n부서진 나의 기타여! 다시는 볼 수가 없는 \r\n흑백사진들처럼 추억만 남기고 떠난 \r\n싸구려 고물라디오 \r\n형아가 부셔버린 고물 라디오 \r\nrock n' roll! rock n' roll! rock n' roll! over night! \r\n타오르는 뜨거운 이 밤 나의 가슴을 적셔주는 싸구려 고물 라디오 \r\n한여름 밤 어여쁜 당신과 밤새도록 미친 춤을 추고 싶어 오예 랄랄라 \r\n형아가 부셔버린 추억만 남기고 간 이제는 볼 수 없는 \r\n형아가 부셔버린 고물 라디오 \r\nrock n' roll! rock n' roll! rock n' roll! tonight!</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/287/15026287_1406280229720_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 10465, song_num: 16130530, lowkey: nil, highkey: nil},
  {album_id: 72, singer_id: nil, team_id: 22, title: "필살 Off Side", genre1: "가요", genre2: "인디", runtime: "04:06", lyrics: "\n\t\t\t\t\t\t\t<div>필살 Off Side - 04:06</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">뛰어라 내 다리야 이 세상 끝날 때까지\r\n게 섯거라 이 세상아 내 노래 끝날 때까지\r\n멀어지는 저 노을 뒤 어두워 가는 세상에\r\n노래하자 내 친구야 폭풍처럼 가자\r\n\r\n문득 올려다본 하늘 붉게 물든 노을 같은 내 꿈아\r\n수 없이 반짝이는 별들 나의 가슴만 아파 오게 하는데\r\n쉴새 없이 날아드는 태클 심판은 나를 보지 못했나\r\n순간 나는 알게 되었죠 나는야 언제나 혼자요\r\n뛰어라 내 다리야 이 세상 끝날 때까지\r\n게 섯거라 이 세상아 내 노래 끝날 때까지\r\n\r\n소라 껍질 속에 갇혀 버린 헤엄칠 수 없는 나의 바다여 \r\n나의 노래 소리 들리는가 그렇다면 나와 함께 일어나 \r\n똑같이 복사된 세상에 버려진 나는 바보 못난이 \r\n이제 앞뒤 가릴 것 없다 받아라 필살 offside \r\n뛰어라 내 다리야 이 세상 끝날 때까지\r\n게 섯거라 이 세상아 내 노래 끝날 때까지\r\n멀어지는 저 노을 뒤 어두워 가는 세상에\r\n노래하자 내 친구야 폭풍처럼 가자\r\n(락엔롤) 어젯밤 꿈과 같이 날던 기타여\r\n(여자여) 오늘밤 나와 함께 정열의 건배를\r\n(할테요) 요술과 같은 나의 여행길을 같이 떠나자\r\n오늘밤도 내일밤도\r\n\r\n뛰어라 내 다리야 이 세상 끝날 때까지 \r\n게 섯거라 이 세상아 내 노래 끝날 때까지 \r\n멀어지는 저 노을 뒤 어두워 가는 세상에 \r\n노래하자 내 친구야 폭풍처럼 가자 \r\n뛰어라 내 다리야 이 세상 끝날 때까지 \r\n게 섯거라 이 세상아 내 노래 끝날 때까지 \r\n멀어지는 저 노을 뒤 어두워 가는 세상에 \r\n노래하자 내 친구야 폭풍처럼 가자</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/287/15026287_1406280229720_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130531, lowkey: nil, highkey: nil},
  {album_id: 72, singer_id: nil, team_id: 22, title: "너구리", genre1: "가요", genre2: "인디", runtime: "04:16", lyrics: "\n\t\t\t\t\t\t\t<div>너구리 - 04:16</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">하늘을 들어 미래를 보다 지친 우리 보조개 \n썩은 나의 미소 나를 만드는 초라한 조각가 \n끊어진 사람들 성냥을 그어 \n나 이 도시 속에 숨어있는 \n너구리가 되어 볼까나 \n찬 우리 속에 갇혀 이 밤을 세워 춤을 추는 사람들 \n그 여림 속에서도 가만히 별빛을 보는 시인들 \n타인의 발에 맞춰 푸른 새벽 칼이 되는 전깃줄 \n그 강함 속에서도 비틀댈 수 있는 나의 보금자리여 \n\n하늘을 들어 다시 알 수 없는 까만 발걸음 \n헤이 너는 어디 다시 하얀 꿈을 꾸고 있겠지 \n끊어진 사람들 성냥을 그어 \n나 이 도시 속에 숨어있는 \n너구리가 되어 볼까나 \n찬 우리 속에 갇혀 이 밤을 세워 춤을 추는 사람들 \n그 여림 속에서도 가만히 별빛을 보는 시인들 \n타인의 발에 맞춰 푸른 새벽 칼이 되는 전깃줄 \n그 강함 속에서도 비틀댈 수 있는 보금자리여 \n모두 똑같아 뛰어가고 걸어가 그 뿐이야 \n여기 나의 놀이터 그대여 떠나지 말아요 \n이런 젠장 지금은 6시 난 지금 나가봐야 하겠어 \n끊어진 기타줄 끼고 멋쟁이 너구리들 만나러 \n\n찬 우리 속에 갇혀 이 밤을 세워 춤을 추는 사람들 \n그 여림 속에서도 가만히 별빛을 보는 시인들 \n타인의 발에 맞춰 푸른 새벽 칼이 되는 전깃줄 \n그 강함 속에서도 비틀댈 수 있는 나의 보금자리여\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/287/15026287_1406280229720_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 10762, song_num: 16130532, lowkey: nil, highkey: nil},
  {album_id: 72, singer_id: nil, team_id: 22, title: "퀵서비스맨", genre1: "가요", genre2: "인디", runtime: "03:42", lyrics: "\n\t\t\t\t\t\t\t<div>퀵서비스맨 - 03:42</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">나는 퀵서비스맨 오호 라빠라빠 \n배달 해드립니다 오직 초스피드 \n그리움에 빠진 연인들이나 원자폭탄도 배달됩니다 \n차가 막혀도 걱정 없는 나는야 퀵서비스맨 \n\n\"감사합니다. 퀵서비습니다.\" \n\"예, 퀵서비스죠? 잃어버린 제 사랑도 배달되나요?\" \n\"네, 배달됩니다.\" \n\"히야∼\" \n\n오늘 하루 쉽니다 사고 났거든요 \n너무 빨리 가다가 여자 한테 채였죠 \n이제 사랑은 배달 안 해요 너무 빨르면 안되거든요 \n그녀 맘도 몰라준 난 바보야 난 바보야 \n\n이제 사랑은 배달 안 해요 너무 빨르면 안되거든요 \n손님께서 원하신다면 정 원하신다면 \n언제든지 전화주세요 번개처럼 달려갑니다 \n제가 직접 사랑해 드려요 이제는 천천히 \n내 이름은 퀵서비스맨 여러분의 초스피드맨 \n랄랄라라 랄랄랄랄라 랄랄라라 라라랄랄라 \n텍미홈 컨트리 로드도 달려갑니다 \n언제든지 초스피드로 달려갑니다 \n오늘도 눈썹 떨어지게 그대 곁으로 \n달려가는 나는야 진정한 멋쟁이 퀵서비스맨\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/287/15026287_1406280229720_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 10470, song_num: 16130533, lowkey: nil, highkey: nil},
  {album_id: 72, singer_id: nil, team_id: 22, title: "소크라테스 클럽", genre1: "가요", genre2: "인디", runtime: "03:17", lyrics: "\n\t\t\t\t\t\t\t<div>소크라테스 클럽 - 03:17</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">떠나는 조각배 저 노을 속으로 잊혀진 꿈들을 찾아 \n같이 가자 친구야 이젠 안녕 \n빛나는 작은 별 길을 비춰주겠지 가진 것 없는 너와나 \n꿈을 찾아 함께 떠나자 가자 \n지독한 노래도 신기한 노래도 당신과 함께 할 수 있다며는 \n언제까지 노래할 수 있어요 \n길지 않은 인생에 우울했던 젊은 날 패배자는 쉬지 말고 울어라 \n고통은 날아올라 \n새가 되어 가보자 별이 되어 빛나자 \n단 한번만이라도 날아올라 꿈을 융단폭격 해보자 \ndub 소크라테스 \n\n상처뿐인 소년들 날개 잃은 도시 위의 검은 천사 \n어둠 속에 한 줄기 빛 눈먼 나의 나침반이 되어주오 \n빛나는 작은 별 길을 비춰주겠지 가진 것 없는 너와나 \n꿈을 찾아 함께 떠나자 가자 \n지독한 노래도 신기한 노래도 당신과 함께 할 수 있다며는 \n언제까지 노래할 수 있어요 \n길지 않은 인생에 수많은 영광들 패배자여 울지 말고 노래하라 \n아픈 나의 꿈들을 노래하자 \n허무한 성냥개비만이 앙상히 남아있네 \n새하얀 백발 노인들이 즐겁게 웃고있네 \n조그만 꼬마아이들이 사탕만 빨고있네 \n시계는 멈췄지만 세상은 잘도 돌아가네 \n새가 되어 가보자 별이 되어 빛나자 \n단 한번만이라도 꿈을 폭격해보자 \n새가 되어 가보자 별이 되어 빛나자 \n액션배우가 되어 날라차기 해보자 \n(자꾸자꾸만 생각이 나는) 다시 한번 일어나 \n(아쉬웠던 나의 지난날이여!) 꿈을 꿀 수 있다면 \n(다시 꿈을 꿀 수 있다며는) 날라차기 해보자 \n(날아올라 새가 되겠지. 언젠가) 새가 되어 가보자\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/287/15026287_1406280229720_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 10636, song_num: 16130534, lowkey: nil, highkey: nil},
  {album_id: 72, singer_id: nil, team_id: 22, title: "오드리", genre1: "가요", genre2: "인디", runtime: "05:23", lyrics: "\n\t\t\t\t\t\t\t<div>오드리 - 05:23</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">고독의 문을 열고 그대를 바라보네 \n그녀는 말이 없네 사랑은 스쳐갔네 \n오늘도 노를 젖네 그대를 생각하며 \n그녀는 미소 짖는 나의 오드리 \n향기가 흩어지며 아침을 맞이하네 \n고독한 나의 꿈에 항상 넌 기억되네 \n그 날의 한잔 술에 그녀는 기대왔지 \n사랑과 낭만의 나의 꿈 오드리 \n내게 돌아와 오늘도 먼지가 나는 \n나의 방구석 널 잊지 못 하는데 \n그 날의 기억 해변가 아침이슬 \n로망과 데스 정렬의 화신이여 \n\n후∼ 사랑은 마치 개미지옥에 \n잘못 빠진 여왕벌과도 같은 것이지 \n개미지옥에 잘못 빠진 여왕벌 \n나는 오늘도 그 여왕벌처럼 비틀댄다네 \n베이베 그대를 불러보네 \n그녀는 말이 없네 허망한 모래성아 \n아침이 돌아오면 내 귀에 속삭여주어 \n어젯밤 꿈처럼 너를 사랑해 아우! \n\n내게 돌아와 오늘도 먼지가 나는 (내게 와요 우린 이제) \n나의 방구석 널 잊지 못하는데 (다시올 수 없는 길을) \n그 날의 기억 해변가 가로등 밑에 (함께 가요 그곳에서) \n정열의 키스 낭만의 여자여 (우리들의 꿈을 찾아) \n잊지 않겠다 나 살아 숨쉬는 날에 (설레였던 그 시간들) \n시간아 오라 널 다시 안는 날 (꿈속에도 날 안아줘) \n가슴을 묻고 우리 로마로 떠나자 (로마에서 빗속에서) \n사랑에 추억 (사랑해) 꿈속의 여인이여 \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/287/15026287_1406280229720_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130535, lowkey: nil, highkey: nil},
  {album_id: 72, singer_id: nil, team_id: 22, title: "황금마차", genre1: "가요", genre2: "인디", runtime: "05:11", lyrics: "\n\t\t\t\t\t\t\t<div>황금마차 - 05:11</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">하늘에서 부는 바람 나는 나의 노랫소리여 \n게 섯거라 내가 간다 붙잡지 마라 세월이여 \n술 마시다 바달 보니 벌써 달이 떠있구나 \n이태백이 놀던 달아 같이 한번 놀아보자 \n전설에서나 만날 수 있는 달빛이여 \n술 취하면은 나타나는 황진이 \n오늘밤에도 달빛은 무너지고 \n작은 물새가 그 위를 가르네 \n\n친구들은 춤을 추고 가야금은 노래하네 \n어쩔시구 엉덩방아 정신차리게 이 서방아 \n달과 꽃을 벗님 삼아 천년만년 놀아봅세 \n사랑놀이 이젠 싫어 친구들이 제일 좋아 \n전설에서나 만날 수 있는 세상 \n술 취하면은 나타나는 황진이 \n오늘밤에도 달빛은 무너지고 \n하염없이 그리워만지는 \n나의 옛사랑이 달빛처럼 보여 \n강 위에 뜬 달을 건지러 저 멀리 강속으로 \n오늘밤도 달빛은 좋구나 \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/287/15026287_1406280229720_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 12229, song_num: 16130536, lowkey: nil, highkey: nil},
  {album_id: 72, singer_id: nil, team_id: 22, title: "사망가", genre1: "가요", genre2: "인디", runtime: "02:17", lyrics: "\n\t\t\t\t\t\t\t<div>사망가 - 02:17</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">나는 가리라 절망 끝까지 내 육신의 속박 멍에 벗고서 \n생의 끝까지 질주하리라 저주받은 내 운명을 죽이리라 \n\n내 청춘은 권태의 무덤이요 내 젊음은 광대의 미소이니 \n난 가리라 끝까지 한숨의 꼬리잡고 잘려진 두발로 나가리라 \n낭만은 허무함의 동반자 추억은 서러움의 예언자 \n그래 모두를 없애고 나는 당당하리라 내겐 잃을 것이 하나도 없다 \n나는 가리라 절망 끝까지 내 육신의 속박 멍에 벗고서 \n생의 끝까지 질주하리라 저주받은 내 운명을 죽이리라 \n\n나는 가리라 절망 끝까지 내 육신의 속박 멍에 벗고서 \n생의 끝까지 질주하리라 저주받은 내 운명을 죽이리라 \n그래 세상이 나에게 고민을 강요하며 나의 피묻은 절규를 달래겠지만 \n나의 차가운 면도날 칫솔에 깊이 박고 내가 갖지 못한 것들을 씹으리라 \n그래 세상이 나에게 고민을 강요하며 나의 피묻은 절규를 달래겠지만 \n나의 차가운 면도날 칫솔에 깊이 박고 내가 갖지 못한 것들을 씹으리라 \n나는 가리라 절망 끝까지 내 육신의 속박 멍에 벗고서 \n생의 끝까지 질주하리라 저주받은 내 운명을 죽이리라 \n나는 가리라 절망 끝까지 내 육신의 속박 멍에 벗고서 \n생의 끝까지 질주하리라 저주받은 내 운명을 죽이리라 \n나는 가리라 절망 끝까지 내 육신의 속박 멍에 벗고서 \n생의 끝까지 질주하리라 저주받은 내 운명을 죽이리라 \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/287/15026287_1406280229720_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 11026, song_num: 16130537, lowkey: nil, highkey: nil},
  {album_id: 72, singer_id: nil, team_id: 22, title: "타이거 당췌!", genre1: "가요", genre2: "인디", runtime: "05:11", lyrics: "\n\t\t\t\t\t\t\t<div>타이거 당췌! - 05:11</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">나의 꿈아 그대는 누굴 닮았니 오늘밤도 우리는 만날 순 없니 \n당췌 난 알 수가 없구나 \n어린 시절 가끔 쓴 나의 일기 이제는 알 수 없는 나만의 열기 \n이젠 어디 숨었나 찾고파 \n철이 지나 떠난 새처럼 어느 샌가 나도 모르게 \n눈이 오고 비가 내리면 낙엽처럼 떨어져 나 떠나갈까 \n엄마한테 매맞으며 받아쓰기 할 때부터 \n공부 따윈 하기 싫다 반항했지 \n새장 속에 갇힌 나 홀로 듣던 rock n' roll \n나의 꿈을 태웠네 \n나 소리친다 세상에 당장 나와 한판 붙자고 \n앞뒤로 꽉꽉 막힌 이 세상 타다 남은 불씨하나로 \n나 꿈을 꾼다 \n\n종이 위에 받아쓴 나의 글씨 언제나 맞지 않는 나의 답안지 \n당췌 집엔 언제 가냐고 \n모두다 똑같은 얼굴을 들고 똑같은 생각에 감옥신세 \n이제 받아쓰기는 싫어요 \n철이 지나 떠난 새처럼 어느 샌가 나도 모르게 \n눈이 오고 비가 내리면 낙엽처럼 떨어져 \n엄마한테 매맞으며 받아쓰기 할 때부터 \n공부 따윈 하기 싫다 반항했지 \n새장 속에 갇힌 나 홀로 듣던 rock n' roll \n나의 꿈을 태웠네 \n난 소리친다 세상에 당장 나와 한판 붙자고 \n앞뒤로 꽉꽉 막힌 이 세상 타다 남은 불씨하나로 \n나 꿈을 꾼다 청춘의 아름다운 불꽃 피어라 \n번져라 활활 타오르며 쓰리라 나만의 답안지를 \n아련하게 떠오른 그 저녁 놀 달님들과 함께 떠든 락엔롤 아아아∼ \n밤새 모여 주고받던 이야기 함께 떠날 우리 꿈의 여행기 아아아∼ \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/287/15026287_1406280229720_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 10603, song_num: 16130538, lowkey: nil, highkey: nil},
  {album_id: 72, singer_id: nil, team_id: 22, title: "Oh My 007", genre1: "가요", genre2: "인디", runtime: "03:09", lyrics: "\n\t\t\t\t\t\t\t<div>Oh My 007 - 03:09</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">아가씨 날 쳐다봐요 이렇게 춤을추고 있잖아요 \r\n오늘밤 어떻게하면 당신과 키스할수 있을까요 \r\n수줍은 나의 입술에 맥주만 홀짝홀짝 넘어가네 \r\n오 오 오 오마이달링 링링링 나와함께 춤을 춰요 \r\n이렇게 화려한 밤에 한없이 수줍어지는 내자신이 \r\n너무싫어 죽고만 싶네 \r\n사랑은 너무 어려워 맥주는 너무 달콤해 \r\n여기 맥주나 한잔 주세요 \r\n\r\n도대체 뭘드셨길래 당신은 이다지도 예쁜가요 \r\n달콤한 초콜릿처럼 수줍은 나를 살살 녹여조요 \r\n당신도 춤을춰봐요 신나는 토요일밤이잔아요 \r\n오 오 오 오마이달링 링링링 모두 함꼐 춤을 춰요 \r\n\r\n진주사파이어 위스키 아름안이 \r\n나에겐 가진것은 하나도 없어요 \r\n그래도 웬지나는 너무 멋져 보이지요 \r\n아마 나에게 키스할꺼에요 \r\n왜냐면 나의 춤은 너무 황홀하거든요 \r\nOK that's right cum on and rock n'roll \r\n수줍은 오빠도 세침떼기 언니 \r\n모두함께 흔들흔들 신나게 춤춰요</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/287/15026287_1406280229720_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 12892, song_num: 16130539, lowkey: nil, highkey: nil},
  {album_id: 72, singer_id: nil, team_id: 22, title: "양치기 소년의 항해일지", genre1: "가요", genre2: "인디", runtime: "06:22", lyrics: "\n\t\t\t\t\t\t\t<div>양치기 소년의 항해일지 - 06:22</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">두둥실 바다 위 나는 뿌리 없는 꽃이라네 \n저기멀리 춤을 추는 노랑나비 불러보네 \n달래고 달래봐도 춤을 추고 노래해도 \n다가갈 수 없는 난 바다 위에 핀 꽃이라네 \n잠자는 어린 목동 길을 잃은 양들이여 \n근심 걱정 하나 없는 아름다운 소년이여 \n하늘엔 뭉게구름 울어울어 종달새야 \n머리 위에 꽃 모자 쓴 아리따운 어린 소녀 \n새들은 노래하고 꽃들은 춤을 추고 \n어린 시절 나의 꿈들은 사라지고 \n멀리 바다를 바라만 보고 있네 \n새벽 비에 젖은 작은 꽃잎만이 \n힘겹게 고개 들어 하늘을 쳐다보네 \n어린 목동은 아직도 자고있네 \n\n커다란 술독 안에 난 헤엄치는 올챙이 \n밖으로 나가기엔 너무나도 취했네 \n어른이 되기 전에 나는 나갈 수가 없겠지만 \n차라리 노래하는 몽상가를 꿈꿀 테야 \n술잔 밖에 보이는 아름다운 세상이여 \n잡으려 손짓해도 잡히지가 않는구나 \n어른이 되기 전에 나는 나갈 수가 없겠지만 \n개구리 될 때면 나는 폴짝 뛰어가네 \n방황은 별이 되고 새벽은 밝아오고 \n기차는 떠났지만 기적소리만이 \n어린 소년을 슬퍼만 하게 하네 \n죽음은 별이 되고 고통은 사라지고 \n바다로 떠날 거야 한없이 푸른 별 \n이제는 잠들고 싶어 \n\n방황은 별이 되고 새벽은 밝아오고 \n기차는 떠났지만 기적소리만이 \n어린 소년을 슬퍼만 하게 하네 \n죽음은 별이 되고 고통은 사라지고 \n바다로 떠날 거야 한없이 푸른 별 \n이제는 잠들고 싶어 \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/287/15026287_1406280229720_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130540, lowkey: nil, highkey: nil},
  {album_id: 72, singer_id: nil, team_id: 22, title: "개가 말하네", genre1: "가요", genre2: "인디", runtime: "05:30", lyrics: "\n\t\t\t\t\t\t\t<div>개가 말하네 - 05:30</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">7년 전에 시작되어 \n아무것도 모르면서 꿈을 꾸는 줄도 모르고 \n회색시멘트 발자국 내다 \n그저 욕만 바가지로 먹고있는 줄고 모르고 \n일어나 세상의 더러운 쓰레기는 니가 아냐 \n부족한 것은 없어 단지하나 \n그저 너에게 잘 보이고 싶어 꼬리치네 \n차가운 사람들 속 어찌하나 \n나는 이 도시 속에 구식난로를 태울 거야 \n개가 말하네 \n\n가지 마라 밥 좀 다오 \n그저 나는 배고파서 세상 무서운지 모르고 \n똥개라 해도 상관치 않아 \n그저 나는 따스한 사랑이 필요한지 모르지 \n일어나 세상의 더러운 쓰레기는 니가 아냐 \n허무한 세상 속 꿀단지하나 \n빠져 나오기 힘들어하는 작은 개 하나 \n차가운 사람들 속 어찌하나 \n나는 이 도시 속에 구식난로를 태울 거야 \n개가 말하네 멍멍 짖네 개가 말하네 멍멍 짖네 \n\n하늘아 조그맣게 내가 가야 할 곳을 만들어 \n저 초록빛 숲에서 너와 함께 (너와 함께) 너와 함께 \n부족한 것은 없어 단지하나 \n그저 너에게 잘 보이고 싶어 꼬리치네 \n차가운 사람들 속 어찌하나 \n나는 이 도시 속에 구식난로를 태울 거야 \n허무한 세상 속 꿀단지하나 \n빠져 나오기 힘들어하는 작은 개 하나 \n차가운 사람들 속 어찌하나 \n나는 이 도시 속에 구식난로를 태울 거야 \n개가 말하네 멍멍 짖네 개가 말하네 멍멍 짖네 \n개가 말하네 멍멍 짖네 개가 똥싸네 멍멍 짖네 \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/287/15026287_1406280229720_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 11289, song_num: 16130541, lowkey: nil, highkey: nil},
  {album_id: 72, singer_id: nil, team_id: 22, title: "불꽃놀이", genre1: "가요", genre2: "인디", runtime: "03:44", lyrics: "\n\t\t\t\t\t\t\t<div>불꽃놀이 - 03:44</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">저 별빛은 내게 무얼 말하려 하나? \n저 별빛은 내게 아무 말도 없겠지 \n뜨거운 눈물은 이유 없이 흐르고 \n갑자기 하늘에 별들이 쏟아지네 \n아름답던 나의 연인은 붉은 장미빛깔 칵테일 \n지금은 독이 돼버린 붉은 포도주 \n뜨거운 눈물은 이유 없이 흐르고 \n갑자기 하늘에 별들이 쏟아지네 \n불꽃놀이마다 하늘에 별이 되고 \n축제는 끝나고 나만 홀로 남았네 \n회전목마 타고 떠나버린 님이여 \n무엇을 기다리나? \n돌아 돌아 돌아라 회전목마여! \n\n불꽃놀이마다 하늘에 별이 되고 \n축제는 끝나고 나만 홀로 남았네 \n회전목마 타고 떠나버린 님이여 \n돌아올 수 없는 강을 건넌 건가요? \n축제는 끝나고 나만 홀로 남았네 \n사랑은........................ \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/287/15026287_1406280229720_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130542, lowkey: nil, highkey: nil},
  {album_id: 72, singer_id: nil, team_id: 22, title: "빽구두", genre1: "가요", genre2: "인디", runtime: "02:16", lyrics: "\n\t\t\t\t\t\t\t<div>빽구두 - 02:16</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">밑 빠진 아저씨와 정신나간 아줌마 \n세 다리 불가사리 미운 오리 노가리 \n나 지금 가겠어요 붙잡으심 안돼요 \n역겨워 하지 마요 박하사탕 먹어요 \n꿈이라는 게 이리 힘든 건 줄 몰랐어 \n사랑은 내게 가스고지서만 남기고 말았는걸 \n그래서 이제는 나 사랑 않을래 \n지하철 타고 두 번 갈아타요 \n그리고 그녀는 내게 말도 없이 \n빽구두 씹새ㄱ기랑 날랐네 \n\n돌아가 버리면은 어지럽고 아파요 \n비 오면 비자내고 미국으로 날라요 \n세상이 말이 되냐 뭐라고 농담 하냐 \n세계화가 다 그렇지 거스름돈 가져요 \n\n그래서 이제는 나 사랑 않을래 \n지하철 타고 두 번 갈아타요 \n그리고 그녀는 내게 말도 없이 \n빽구두 씹새ㄱ기랑 날랐네 \n그래서 이제는 나 사랑 않을래 \n지하철 타고 두 번 갈아타요 \n그리고 그녀는 내게 말도 없이 \n빽구두 씹새ㄱ기랑 날랐네 \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/287/15026287_1406280229720_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130543, lowkey: nil, highkey: nil},
