  {album_id: 74, singer_id: nil, team_id: 24, title: "사랑은 없다", genre1: "가요", genre2: "댄스", runtime: "03:53", lyrics: "\n\t\t\t\t\t\t\t<div>사랑은 없다 - 03:53</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">그녀를 사랑하고 너무 힘든 나\n그녀를 아름답게 보내줘야해\n그녀야 나보다도 나은 사람과 \n행복하게 잘살아가야해\n\n너를 보내는게 너무 슬프구나\n남잔 나의 사랑 방식이지 \n그래도 니가 처량하구나 \n부디 좋은 사람 만나기를\n\n너와 처음 만나 행복했을때\n너를 안아 주며 사랑했을때\n너와 영원 하길 기도했을때\n그때 그 기억에 눈물이\n\n*아마 너도 지금 울고 있겠지\n(아마 너도 지금 울고 있겠지)\n나보다도 심한 슬픔 속에서\n(나보다도 심한 슬픔속에서)\n그렇지만 일년이 지나고나면\n(그렇지만 일년이 지나고 나면)\n다시 강해지고 좋아지걸\n\n\n벌써 몇년이 흘러갔겠구나\n어디서 어디에 있는지\n가끔은 내 생각을 하는지 \n바보같은 생각으로 살아\n\n너와 처음 만나 행복했을때\n너를 안아 주며 사랑했을때\n너와 영원 하길 기도했을때\n그때 그 기억에 눈물이\n\n*Repeat\n\n그래 더이상 너를 &amp;#52287;는건 추억을 슬프게만해\n이제 이렇게 되길 바라며 그리며 잊어버릴께\n\n*Repeat\n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/290/15026290_1305632542088_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130565, lowkey: nil, highkey: nil},
  {album_id: 74, singer_id: nil, team_id: 24, title: "행복해라", genre1: "가요", genre2: "댄스", runtime: "03:26", lyrics: "\n\t\t\t\t\t\t\t<div>행복해라 - 03:26</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">*그 여자에게 좋은일들만! 행복하게만! 아릅답게만! \n\n내사랑에게 다가올 이별만큼은 \n\n그늘이 없는 저태양처럼 \n\n\n\n오늘도 너의 생각에 슬퍼서 너의 기억으로 울지만\n\n이제 또 사라지면 가슴 아픈사랑 그게 나인걸\n\n\n\n그렇게 너에 그모습 수줍던 눈빛 촉촉한 입술 \n\n그느낌 이제는 내가 더이상 바래서는 안돼는 \n\n꿈인걸 알지만\n\n\n\n언젠가 함께 갔었던 바다와 너와 지워가던 대지와\n\n처음 너와의 입맞춤 모두 어제 얘기같은걸\n\n\n\n이젠 딴사람 품에 안길 니가 나에 눈물되어 흘러도 \n\n그때 날 비켜 가서 행복한 거라면 그걸로됐어\n\n\n\n정말 그랬던 우리에 슬프던 그리면 시간잊을려나 \n\n그대자꾸파 내맘아파 그대맺힌 눈물이 나와\n\n하루이틀 그대 그리며 살아\n\n\n\n그녀는 나의 첫사랑 전분걸 사랑한것만큼 슬퍼도\n\n너에 발끝을 보면서 널 어김없이 떠나 보냈지\n\n이젠 딴사람 품에 안길 니가 나에 눈물되어 흘러도\n\n그때 날 비켜가서 행복한 거라면 그걸로 됐어\n\n\n\n난 이렇게 살지만 너에 기억에 울지만\n\n넌 어디를 가든지 너만은 행복해\n\n\n\n오늘도 담배연기에 그려진 너에 기억으로 울지만\n\n이젠 또 사라진건 가슴 아픈사랑 그게 나인걸\n\n\n\n내일도 너에 생각에 슬퍼서 너에 기억으로 울지만\n\n이젠 또 사라진건 가슴아파\n\n\n\n* Repeat\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/290/15026290_1305632542088_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130566, lowkey: nil, highkey: nil},
