  {album_id: 74, singer_id: nil, team_id: 24, title: "어차피", genre1: "가요", genre2: "댄스", runtime: "03:57", lyrics: "\n\t\t\t\t\t\t\t<div>어차피 - 03:57</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">날 사랑한거야 너 그럴거야\n너 널 위한 준비 우린 사랑했지\n그렇다고 말해줘 어차피 떠날 너인데\n사랑했을 때만큼 우린 좋았어\n\nloney loney 처음 만날 때\nonly only 서로 사랑해\nloney only loney 영원하기를\n\n우니 우니 뭐가 슬프니\n우린 이제 헤어지니\n왜 함께할 때 이리 좋은데 가니\n\n날 사랑한거야 너 그럴거야\n너 널 위한 준비 우린 사랑했지\n그렇다고 말해줘 어차피 떠날 너인데\n사랑했을 때만큼 우린 좋았어\n\n(Cause I feel) loney loney\n우리 가슴에 기억으로 남아주길\n우리 사랑했던 추억 아름다웠어\n\nI was maxin, relaxin, watching TV\nThinking about that time\nwhen you said you wanted to leave me\nNow I'm ready, my nerves are steady\nBefore you leave baby\ntalk to me please \nSince we're through answer one thing\nWas our love true or just a little feeling\nnow keep this in mind\nbefore the singer sings\nYou're my queen and\nI'll always be your king\n\n날 사랑한거야 너 그럴거야\n너 널 위한 준비 우린 사랑했지\n그렇다고 말해줘 어차피 떠날 너인데\n사랑했을 때만큼 우린 좋았어\n\n날 사랑한거야 너 그럴거야\n너 널 위한 준비 우린 사랑했지\n그렇다고 말해줘 어차피 떠날 너인데\n사랑했을 때만큼 우린 좋았어\n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/290/15026290_1305632542088_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130569, lowkey: nil, highkey: nil},
  {album_id: 74, singer_id: nil, team_id: 24, title: "해&amp;해", genre1: "가요", genre2: "댄스", runtime: "03:38", lyrics: "\n\t\t\t\t\t\t\t<div>해&amp;해 - 03:38</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">햇살 아래 눈부시게\r\n나를 유혹하는 그대 모습\r\n해가 없는 하늘이란\r\n정말 상상할 수 없는 얘기\r\n\r\n햇살 아래 비가 내려 그대 촉촉하게 젖어와도\r\n\r\n순순하게 미소짓는\r\n그대 모습 잊을 수가 없어\r\n더운 태양 아래서 소리 없이 늘 햇살처럼\r\n너만 아끼는 사랑을 할테니\r\n\r\n다시 Oh by my side 내게로 돌아와\r\n작은 실수쯤은 까맣게 잊을게\r\n매일 같은 그리움에\r\n하루를 보내는 내 모습\r\n\r\n그를 향한 니 느낌은 그저 한 순간에\r\n바람일뿐 돌아서면 잊혀지는\r\n그런 흔한 사랑일뿐야\r\n\r\n제발 내게 돌아와\r\n하나뿐인 널 보고싶어\r\n너의 하늘이 되줄게 내 사랑\r\n\r\n\r\n다시 Oh by my side 내게로 돌아와\r\n작은 실수쯤은 까맣게 잊을게\r\n매일 같은 그리움에\r\n하루를 보내는 내 모습\r\n\r\nYo, where the sun at?\r\n이 좋은 날에 좀 사랑하면 어때\r\nYo, where the girl at?\r\n이 햇살 아래 너와 내가 함께\r\nHmmmmm 내 생각엔 이 뜨거운 태양 아래\r\n우리에 사랑도 저 태양처럼 타오르게\r\n\r\nNow come chill wit me \r\n매일 같은 그리움에 올해가 다 가기 전에\r\n이 해와 저 해 속에 \r\n깊고 넓은 저 바다처럼 \r\n마치 내 마음처럼\r\n우리의 사랑도 변함없이 더 커져가\r\n\r\nThis heart si yours!\r\nYeah this love is yours\r\n내가 원하는 사랑\r\nthat's all you have to show\r\nNow here I go 그대를 찾으러\r\n잊지 못할 나의 연인 사랑 찾으러\r\n\r\nI just want you hold you\r\n네 곁에 있을게 \r\n다시 예전처럼 사랑을 말해줘\r\n네가 없는 세상이란\r\n내게는 의미가 없는걸</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/290/15026290_1305632542088_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130570, lowkey: nil, highkey: nil},
  {album_id: 74, singer_id: nil, team_id: 24, title: "Forget About Love", genre1: "가요", genre2: "댄스", runtime: "03:32", lyrics: "\n\t\t\t\t\t\t\t<div>Forget About Love - 03:32</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">깨뜨려 너의 두려움 사랑이 필요해\nIt's gotta be you\n주사윌 이제 던져봐 사랑이 다가와\n운명에 너를 맡겨봐 너 자신을 믿어\nIt's gotta be you\n잡지 못하면 이제는 \nForget About Love, Girl!\n\n너와 나 하나 되기까지 얼마 남았나\n(Yo! 나 기다렸어)\n이제와서 나 마음을 굳힌 나\n더 이상 딴 말을 하지마\n(come on, think it baby)\nYo, baby~ come and get it\n너를 위한 내가 있어\n\n친구던 사랑이던 넌\ncome and grap and take the dance\n\n기회를 만들어줘\n너를 사랑할 수 있게 좀 oh Baby!\n마음을 닫고 나면 너를 가질 수 없어\n\n사랑해 이 말 하는게 그렇게 어렵니?\nIt's Gotta Be You\n너에게 온 이 기회도 그렇게 온거야\n이 기횔 우리 놓치면 영원히 후회해\nIt's Gotta Be You\n잡지 못하면 이제는\nForget About Love, Girl!\n\n두려워 나 이제는 내가 너의 마지막 Oh Baby!\n사랑이 되고 싶어 제발 나를 선택해\n이제부터 너에게 모든게 달렸어\nIt's Gotta Be You\n\n나에겐 오직 너만이 있단걸 알아줘\n하지만 이제 선택은 네가 해야하지\nIt's Gotta Be You\n나 이제 너를 맞이할 준비가 돼있어\n\nYo, Qwickdraw! Whuddup P-Phunk?\nForget it 생각해봤자 더 이상 이제 그때만도 못해\n나 어제 그녀 생각에 술과 하나가 됐네\nGoddamn it 이제 그만하고 미래를 향해\nYo, P-Phunk! Whuddup Qwickdraw?\n내 마음에 남아있던 그녀도 이제 내 곁에 없네\nWe're bout to set this record straight!\nBees ain't shees! Qwickdraw\nP-Phunk on a smooth love tip!\n\n깨뜨려 네 두려움~\n주사윌 이제 던져~\n운명에 널 맡겨봐~\n그렇게 어렵다면\nGirl Forget About Love!\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/290/15026290_1305632542088_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130571, lowkey: nil, highkey: nil},
  {album_id: 74, singer_id: nil, team_id: 24, title: "사랑은 유치하게", genre1: "가요", genre2: "댄스", runtime: "03:29", lyrics: "\n\t\t\t\t\t\t\t<div>사랑은 유치하게 - 03:29</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">사랑이 동화처럼 내게 오지 않을까\n이 세상 그 누구에게도 지지 않을 자신 있어\n\n무엇이 그대에게 다가갈 수 없게 하나\n바로 내 앞에 그댈 두고\n\n단 한 번만 한 번이라도 그댈 바라보는\n그 시선 속에 서 있는 날 느낄 수 있다면\n용기를 내어 어색하지 않도록 \n내 맘을 전해라도 볼텐데\n\nYou're my sunshine, in da darkness\nYou're my highness, you're my princess\nWhat a nice surprise\nyou're the love inside\nIn a rainy day, yeah you make my day\n\nI'll be your sunshine girl yo\nin your darkness\nYou're my princess  that gives\nme true happiness\nUnless you test and show\nme much hateness\nI'll be the one who rids your sadness\nNow if you want it I'll give you the whole world\nThe least I can do for my number 1 girl\n영화처럼 동화처럼 찾아온걸\n이 세상 제일 멋진 my girl\n\n소나기라도 내려 준비한 내 우산을\n그대가 신세지게 되는\n우연을 만들 순 없나\n\n사랑은 유치하게 사람을 변하게 한단\n그 말 바로 날 두고 했는지\n\n한 번쯤은 스쳐간대도 지금의 나처럼\n그 누군가를 가슴에 담아둔 적 있다면 \n그대도 아마 내 마음을 알겠지\n때로는 서글픈 이 마음을\n\n때로는 서글픈 이 마음을\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/290/15026290_1305632542088_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130572, lowkey: nil, highkey: nil},
  {album_id: 74, singer_id: nil, team_id: 24, title: "방랑자", genre1: "가요", genre2: "댄스", runtime: "03:29", lyrics: "\n\t\t\t\t\t\t\t<div>방랑자 - 03:29</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">(누구에게나)\n다 올 수 있는 기회가 아냐 이건\n(모두에게 다)\n주워진 능력따윈 믿지도 않아\n(멋진놈인 나)\n내 인생을 내가 개척해 나가\n(세상에서 나)\n내 인생 막지나 마라 자 내가 간다\n\n누구에게 주어진 세상에 \n그대보다 뒤쳐질 수 없는 것\n주저말고 부딪쳐 싸우리 언젠가\n세상을 얻으리라\n\n저기 날아가는 새 나를 반겨주는 해\n저기 푸르른 산 나에게\n넌 무엇을 원하나\n나 가진 것 없는 이 세상 속에 방랑자\n\n사랑을 원하나 돈을 원하나\n명예를 원하나 세상 원하나\n내 모든 걸 줄 수 있는 남자야\n잃어도 꿋꿋이 남을 남자야\n\n가끔 내가 왜 살아야 하나\n생각을 할 때가 있지\n사람에 취해 사랑에 취해\n돈에 취해 세월에 취해\n\n세상에 등을 지며 내 앞에 주어진\n이 길을 피해갈 순 없지\n자신을 위해 미래를 위해\n사랑을 위해 막지나마라 자 내가 간다\n\n누구에게 주어진 운명에\n그대라는 사랑을 만나고\n내 모든 걸 믿어준 그대가\n세상에 하나인 아름다움\n\n저기 날아가는 새 나를 반겨주는 해\n저기 푸르른 산 \n나에게 넌 무엇을 원하나\n나 가진 것 없는 이 세상 속에 방랑자\n\n사랑을 원하나 돈을 원하나\n명예를 원하나 세상 원하나\n내 모든 걸 줄 수 있는 남자여\n잃어도 꿋꿋이 남을 남자야\n\n단 내 사랑이 나를 떠나간다면\n모든 걸 다 버리고 그대에게\n\nLet me be da one to step too\nand come through\n내가 사는 이유 삶에 종지부\n\nAin't no clue what I do\nGotta do 자 모두 내 인생 live through\nOne man, true man livin on my own\nLove, hate, stress yo all up in my dome\n인생살이 선택은 내가\n막지나 마라 자 내가 간다\n\n저기 날아가는 새 나를 반겨주는 해\n저기 푸르른 산\n나에게 넌 무엇을 원하나\n난 모든 걸 모두 줄 수 있는 남자야\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/290/15026290_1305632542088_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130573, lowkey: nil, highkey: nil},
