  {album_id: 74, singer_id: nil, team_id: 24, title: "유일무이", genre1: "가요", genre2: "댄스", runtime: "03:50", lyrics: "\n\t\t\t\t\t\t\t<div>유일무이 - 03:50</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">지금껏 길지도 않은 내 인생에\n온전한 내 것을 없었지\n그래서 늘 화를 내며 대들었어\n세상을 향해서\n\n날 향한 비틀린 시선 느낄 때도\n모른척 외면하곤 했는데\n슬픈듯 날 바라본 너만은 달랐어\n\n내가 원해서 가진 것은 \n끝까지 지키질 못했기에\n그런 너를 욕심내면 안되는 나란걸\n너무나 잘 알지만\n\n오늘 하루를 살더라도\n너를 위해 살 수만 있다면\n이젠 조금씩 욕심이나\n너만큼은 웃게 하고 싶어\n항상 될대로 되라했던\n내 인생이 달라져 가는걸\n새로운 내 모습 주고 싶어\n\n항상 위험한 나를 바라봐도\n한 마디 원망도 없는 너\n그래서 더 맘 아픈 내 사랑 아는지\n\n무엇 하나도 줄게 없어\n미안한 마음에 화를 내도\n쉽게 나를 놓지는 마\n내 삶에 사랑은 두 번은 없으니까\n\n오늘 하루를 살더라도\n너를 위해 살 수만 있다면\n이젠 조금씩 욕심이나\n너만큼은 웃게 하고 싶어\n항상 될대로 되라했던\n내 인생이 달라져 가는걸\n새로운 내 모습 주고 싶어\n\nA you here I go, here I come\nhere we go, here we come\nCheck, straight from my dome\n우리 모든 사랑 여기다 담어\n다 주고 싶어\n내 인생 네게 걸고 싶어\n\nGirl you are my number one 사랑\n유일무이 오직 나에게는 하나\nAnd my life goes on, on and on\nWhatever you do you're my one and only one\n\n무엇 하나도 줄게 없어\n미안한 마음에 화를 내도\n쉽게 나를 놓지는 마\n내 삶에 사랑은 두 번은 없으니까\n\n나의 곁에서 머무는 건 \n너무 많은 포기가 필요해\n허나 조금만 기다려줘\n내일은 더 달라질 테니까\n\n나의 진심은 몰라도 돼\n내 자신과 내 삶을 건 약속\n너만은 영원히 지킬거야\n\n사랑해 사랑해 사랑해\n내 마음은 너보다 더 사랑해\n\n함께해 함께 함께해\n아름다운 사랑을 만들어가\n\n사랑해 사랑해 사랑해\n우리에게 슬픈 이별 없다면\n\n너만은 영원히 지킬거야\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/290/15026290_1305632542088_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130575, lowkey: nil, highkey: nil},
  {album_id: 74, singer_id: nil, team_id: 24, title: "미안해", genre1: "가요", genre2: "댄스", runtime: "04:03", lyrics: "\n\t\t\t\t\t\t\t<div>미안해 - 04:03</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">흐르는 누물 흐르게 놔두고 너를 슬프게 한것 딱한 널 버린것 \n\n그저 멍하게 아무말 안하고 혼자가 될 너를 그렇게 버리고 \n\n이미 원했던 대로 됐는데 시무룩 하지마 그녈 넌 잊어야해\n\n\n\n(미안해)사랑해\n\n(내게)돌아와\n\n(그렇게도)널 사랑했었나봐\n\n(미안해)사랑해\n\n(다시)돌아와\n\n(내곁으로)\n\n\n\n소용없는것 아무리 찾아도 너의 어떤 흔적도 어디에 없는것\n\n아니었다고 지우지 말라고 나의 기억을 내게 돌아갈\n\n테니 아~내가 네게 했었던 그 못된 짓들 어떻게 해야 기억에서 지워져\n\n\n\n(미안해)사랑해\n\n(내게_돌아와\n\n(그렇게도)널사랑했었나봐\n\n(미안해)사랑해\n\n(다시)돌아와\n\n(내곁으로)\n\n\n\n돌아와 나에게 옜날로 돌아가 행복하게 다시는 널 내게서 내게있어 \n\n넌 하나뿐인걸 없어선 안될 나의 소중한너\n\n\n\nI''m so glad~널 사랑했었나봐 \n\nI''m so glad~I''m so glad~ \n\nThat we were friends before lovers\n\nNo matter what you do I''m so glad\n\n널 사랑해~널사랑해~\n\n미안해 널 사랑했었나봐\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/290/15026290_1305632542088_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130576, lowkey: nil, highkey: nil},
  {album_id: 74, singer_id: nil, team_id: 24, title: "행복해라(Remix)", genre1: "가요", genre2: "댄스", runtime: "03:44", lyrics: "\n\t\t\t\t\t\t\t<div>행복해라(Remix) - 03:44</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">그 여자에게 좋은 일들만\r\n행복하게만 아름답게만\r\n\r\n내 사랑에 다가올 이별만큼은\r\n그늘이 없는 저 태양처럼\r\n\r\n그대와 내가 나누던 같이 했었던\r\n모든 기억에 있던 동화속 같던\r\nLike fairy tale 내게 다가와\r\n내 맘 앗아가 어느덧 세월 흘러\r\n이제 내 곁에 없잖아\r\n\r\n열혈남아 나 혼자 있으되\r\n그댄 언제나 내 맘 속에 숨쉬며\r\n사랑하며 살아가나\r\nYour memories fading away like the sun in da night\r\nKeep it tighy right\r\nNow it's time to find the light\r\n\r\n언젠가 함께 갔었던 바다와\r\n너와 쉬어 가던 벤치와\r\n처음 너와의 입맞춤\r\n모두 어제 얘기 같은걸\r\n\r\n이젠 딴 사람 품에 안길\r\n네가 나의 눈물 되어 흘러도\r\n그때 날 비켜가서 행복한\r\n너라면 그걸로 됐어\r\n\r\n오늘도 담배 연기에 그려진\r\n너의 기억으로 울지만\r\n이내 또 사라지면\r\n가슴 아픈 사랑 그게 나인걸\r\n\r\n그녀는 나의 첫사랑 첫이별\r\n사랑한 것만큼 슬퍼도 \r\n너의 발끝을 보면서 \r\n널 힘없이 떠나보냈지\r\n\r\n이젠 딴 사람 품에 안길 네가\r\n나의 눈물 되어 흘러도\r\n그 때 날 비켜가서 행복한\r\n너라면 그걸로 됐어\r\n\r\n내일도 너의 생각에 슬퍼서\r\n너의 기억으로 울지만\r\n이내 또 사라지면 가슴 아픈 사랑\r\n그게 나인걸\r\n\r\nBecause I back in the days I used to love\r\nyou want to me more closed to you do\r\nthe things I used to do and do more crazy\r\nthings about you\r\n\r\n우리 자주 싸우다가 가끔씩\r\n아주 넌 내 가슴을 베개삼아 기대며\r\nlove you miss you\r\n\r\n그런 사랑의 속삭임으로\r\n내 가슴 깊은 곳으로 들어와 자리잡고\r\n하지만 그댄 이미 내 곁에서 떠났으니\r\n내 마음 구름 위에 둥실 띄어 보내리\r\n\r\n그 여자네게 좋은 일들만\r\n행복하게만 아름답게만\r\n\r\n내 사랑에 다가올 이별만큼은\r\n그늘이 없는 저 태양처럼</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/290/15026290_1305632542088_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130577, lowkey: nil, highkey: nil},
  {album_id: 75, singer_id: 81, team_id: nil, title: "순수", genre1: "가요", genre2: "전체", runtime: "03:39", lyrics: "\n\t\t\t\t\t\t\t<div>순수 - 03:39</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">조금더 와도돼 와야해\r\n끌어당겨 봤자 너는 또\r\n저만치가 날 다시 민망하게해 \r\n아무리 지킬 건 다 지키는\r\n듬직한 남자라 하여도\r\n넌정말로 해도해도 넘해 \r\n가끔씩 스리슬쩍\r\n은근슬쩍 내가 붙어 앉으면\r\n벌써넌 슬금슬금 원래 그자리\r\n한번쯤 두근두근 \r\n쌔근쌔근 숨을 쉬는 나를 봐\r\n나역시 여잔데 그걸 왜 몰라줘 \r\n\r\n워워워 I love you\r\n날 사랑하면 그뿐이지 어때 뭐\r\n책임질일 생길까봐 그래\r\n왜 애가타는 \r\n내맘 몰라줘 오우워우워우워\r\nmy love 너 그렇다면\r\n이래서는 안돼 \r\n너 열번백번 말보다\r\n하루 한번 안아줘 \r\n\r\n저런걸 왜놀래 왜 또 놀래\r\n요샌 어디서든 키스해\r\n너 그만 좀\r\n촌스럽게 굴어 친구들 \r\n맨날 맨날 자기자기\r\n지들 애인 자랑해\r\n조금은 야한 얘기 사건도 많아\r\n그럼 난 말도 못해 \r\n속이 타서 그냥 한잔 또 한잔\r\n이러다 정말나 무슨 일낼꺼야 \r\n\r\n워워워 I love you\r\n날 사랑하면 그뿐이지\r\n어때 뭐\r\n책임질일 생길까봐 그래 왜\r\n애가타는 \r\n내맘 몰라줘 오우워우워우워\r\nmy love 너 그렇다면\r\n이래서는 안돼 \r\n너 열번백번 말보다\r\n하루 한번 안아줘 \r\n\r\n어딜 가 오늘 만은 못가\r\n더이상\r\n나 봐주지 않아 그래봐\r\n남자도 아냐 한번만\r\n한번만 안아줘 \r\n오우워우워우워 my love\r\n나 그런대도 니가너무 좋아 \r\n뭐 아쉽지만 오늘 또\r\n내가 먼저 키스해 오우 워우워</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/291/15026291_1453271555956_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 10149, song_num: 16130578, lowkey: nil, highkey: nil},
  {album_id: 75, singer_id: 81, team_id: nil, title: "Only One", genre1: "가요", genre2: "전체", runtime: "03:45", lyrics: "\n\t\t\t\t\t\t\t<div>Only One - 03:45</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">내일 너를 만나 난\r\n다시한번 묻고 싶어 \r\n나를 사랑하니 그래 어제\r\n그 카페에서 만난\r\n그앤 단지 친구야 \r\n\r\n*너에게 바래 오\r\n너에게 바라는 거야\r\n난 하나 밖에 몰라\r\n너 밖에 몰라\r\n제발 날 믿어봐 \r\n나 어제는 오랜 친굴\r\n만났던 것 뿐\r\n우연히 너를 만나 잠시\r\n당황한것 뿐야 \r\n\r\n그렇게 속 좁은 줄은\r\n알고 있지만\r\n(있지만) 믿어야 하잖아 \r\n왜이래 정말 너 정말\r\n귀엽게 봐준게\r\n어디 한번 뿐이야 \r\n너무나 힘들어\r\n자꾸 오해하지마 \r\n\r\n나를 사랑한 이유로 구속하니\r\n제발 그러지마 함께\r\n사랑한 기억의 바램 마져\r\n무너지 잖아 \r\n\r\n너에게 바래 오\r\n너에게 바라는 거야\r\n난 하나 밖에 몰라\r\n너 밖에 몰라\r\n제발 날 믿어봐 \r\n나 어제는 오랜 친굴\r\n만났던 것 뿐\r\n우연히 너를 만나 잠시\r\n당황한것 뿐야 \r\n\r\n내일쯤 만나자고\r\n약속하지만\r\n(하지만)\r\n만나서 하는말 그렇고\r\n그런 애기들 \r\n날 너무 잘 안다며\r\n너는 애기 하지만\r\n넌 나를 너무나 몰라\r\n조금도 몰라 \r\n\r\n나를 사랑한 이유로\r\n구속하니 제발\r\n그러지마 함께 사랑한\r\n기억의 바람 마져 무너지잖아 \r\n\r\n너에게 바래 오\r\n너에게 바라는 거야\r\n난 사랑받고 싶어\r\n난 사랑스런 너만의 여자야 \r\n난 너에게 원해\r\n난 너밖에 없는데\r\n사랑한다면 나를 믿어\r\n나는 너의 여자야 \r\n사랑한다면 나를 믿어\r\n나는 너의 여자야 (여자야)</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/291/15026291_1453271555956_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130579, lowkey: nil, highkey: nil},
  {album_id: 75, singer_id: 81, team_id: nil, title: "이별 그 후에 이야기... (Feat. 이재훈 of Cool)", genre1: "가요", genre2: "전체", runtime: "04:37", lyrics: "\n\t\t\t\t\t\t\t<div>이별 그 후에 이야기... (Feat. 이재훈 of Cool) - 04:37</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">그댈 기다려준 사랑에 지친\r\n또 다른 사랑이\r\n이젠 그대보다\r\n더 많은 추억 이란걸 아는지 \r\n이별 그 하나로 흘렸던 나에\r\n그많은 눈물속에서\r\n다시 나에게\r\n돌아올 그대만을\r\n기다려 왔지만 \r\n\r\n함께 할땐 몰랐어 아직까지\r\n그댈 잊지 못할 나를 이미\r\n늦어버린걸 알면서도\r\n왜 잊지못할까 \r\n\r\n오랜 이별 그 후에 이야기\r\n속에 남겨진 건 (남겨진 건) \r\n그대와 나에 말 못했던\r\n가슴속에 늘 숨겨왔던\r\n사람일 테지만 \r\n그때는 왜 서로에 소중함을\r\n몰랐나 철없었던 사랑 \r\n이젠 두번 다시는\r\n돌아갈 수 없어\r\n다 잊어줘야해 \r\n\r\n함께 할땐 몰랐어\r\n(알수없었어)\r\n아직까지 그댈 잊지못할\r\n나를 \r\n이미(alone)\r\n늦어버린걸 (늦었단걸)\r\n알면서도(ha) 왜 잊지못할까 \r\n\r\n오랜 이별 그 후에 이야기\r\n속에 남겨진 건 (남겨진 건) \r\n그대와 나에 말 못했던\r\n가슴속에 늘 숨겨왔던\r\n사람일 테지만 \r\n그때는 왜 서로에 소중함을\r\n몰랐나 철없었던 사랑 \r\n이젠 두번 다시는\r\n돌아갈 수 없어\r\n다 잊어줘야해</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/291/15026291_1453271555956_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130580, lowkey: nil, highkey: nil},
  {album_id: 75, singer_id: 81, team_id: nil, title: "알잖아!", genre1: "가요", genre2: "전체", runtime: "03:42", lyrics: "\n\t\t\t\t\t\t\t<div>알잖아! - 03:42</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">미안하면 왜 그런말을 해\r\n더 이상 나는 듣고싶지 않은데 \r\n내맘 아는데 왜 떠나가려 해\r\n어떻게 내가 변할지 알면서\r\n니가 원하는 그녈 알아 \r\n내게 보인 미소 눈물인걸 알지만\r\n모른척 웃었어 난 애써 피했어\r\n제발 이별만은 오지말라고 \r\n\r\n(날 버리지마) 가지마\r\n날 혼자두고 가지마\r\n너 하나밖에 모르는 날 알잖아 \r\n니가 날 사랑안해도\r\n내가 사랑하면 돼\r\n처음부터 내가 원한\r\n너니까 날 모르겠니 \r\n왜몰라 다 보이는데\r\n왜 몰라 너없인 나도\r\n 없다는걸 알잖아 \r\n어쩜 난 죽을지몰라\r\n다신 못볼지 몰라\r\n어떻게든 놓지 못할 내사랑\r\n날 알잖아 \r\n\r\n너를 데려간 그녈 보면\r\n나쁜 여자라고 원망하려 했지만 \r\n오히려 초라한 나를\r\n더 느꼈어 내게 용설 비는\r\n그녈 보면서 \r\n\r\n(날 버리지마) 가지마\r\n날 혼자두고 가지마\r\n너 하나밖에 모르는 날 알잖아 \r\n니가 날 사랑안해도\r\n내가 사랑하면 돼 처음부터\r\n내가 원한 너니까\r\n날 모르겠니 \r\n왜몰라 다 보이는데\r\n왜 몰라 너없인 나도\r\n없다는걸 알잖아 \r\n어쩜 난 죽을지몰라\r\n다신 못볼지 몰라\r\n어떻게든 놓지 못한\r\n내사랑 날 알잖아 \r\n\r\n내게 더 잘할께 곁에만 있어줘\r\n제발 날 버리지마 \r\nha 화가나 널 사랑해서 화가나\r\n나 보더 더 큰 그녀\r\n사랑 화가나 \r\n내가 더 미안하겠지\r\n나의 잘못이겠지\r\n알면서도 널 보낼수\r\n없는나 날 용서해</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/291/15026291_1453271555956_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130581, lowkey: nil, highkey: nil},
  {album_id: 75, singer_id: 81, team_id: nil, title: "뭘 바래!", genre1: "가요", genre2: "전체", runtime: "03:57", lyrics: "\n\t\t\t\t\t\t\t<div>뭘 바래! - 03:57</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">뭘바래 뭘바래 늘바래 늘바래 \r\n누가 봐도 정말 괜찮은 얼굴에\r\n매너 좋고 말도 잘하고 \r\n가끔은 날 놀래주던 너 항상\r\n웃는 얼굴 나의 맘을 모두\r\n다 가져버렸고 \r\n갈때까지 갔는데 오 이젠\r\n몰라 내가 미쳤지 완전히\r\n속아버렸네 \r\n진실은 하나 속마음은\r\n둘 사귀는 여자 셋\r\n난 네번째 여자 오해말라고 \r\n애원해봐도 솔직히\r\n너무 황당해 \r\n\r\n더이상 (뭘바래 뭘바래)\r\n내마음 울려놓고\r\n(뭘바래 뭘바래) \r\n내사랑 가져놓고\r\n(늘바래 늘바래)\r\n항상 넌 말뿐이야 \r\n믿을수 없어\r\n(우우우 우우우)\r\n한번만 참아볼까 생각했지만 \r\n너는 타고난\r\n바람둥이라서 안돼 \r\n\r\n그 언젠가 누가 이런 말\r\n했던가 겉 다르고\r\n속 다르다고 혹시\r\n나 아닐까 했는데 \r\n이럴 수는 없어\r\n내 맘대로 너를 할수만 있다면\r\n바랄것이 없겠네 \r\n오 참을래도 참을수 없어\r\n말로는 표현이 안돼 \r\n사랑은 하나 바람펴서\r\n둘 잘난척하면 셋\r\n결국엔 넌 제로 \r\n세상남자들 모두 똑같해\r\n모든게 정말 문제야 \r\n\r\n더이상 (뭘바래 뭘바래)\r\n내마음 울려놓고\r\n(뭘바래 뭘바래) \r\n내사랑 가져놓고\r\n(늘바래 늘바래)\r\n항상 넌 말뿐이야 \r\n믿을수 없어 (우우우 우우우)\r\n한번만 참아볼까 생각했지만 \r\n너는 타고난 바람둥이라서 안돼 \r\n\r\nNO 오 (우우우 우우우)\r\n자존심 구겨놓고\r\n왜 나를 찾아 너는 사랑을\r\n밥먹듯이해서 안돼 뭘바래</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/291/15026291_1453271555956_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130582, lowkey: nil, highkey: nil},
