  {album_id: 75, singer_id: 81, team_id: nil, title: "Saddist (Feat. T &amp; Bubble Sisters)", genre1: "가요", genre2: "전체", runtime: "04:19", lyrics: "\n\t\t\t\t\t\t\t<div>Saddist (Feat. T &amp; Bubble Sisters) - 04:19</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">너의 눈속에 너의 입술에\r\n너의 손끝에 아직도\r\n내가 있는지 \r\n바보 같은 나 어리숙한\r\n나 너를 보내고 어색한\r\n웃음짓던 나 \r\noh~니 이름 부르다 잠이\r\n들곤해 잊을 수 없는 기억에 \r\n오늘도 거리엔 다정한\r\n연인들 넌 지금 어디 있는지 \r\n\r\nIt wasn't long ago you told me\r\nthat you'd stay u promised me\r\nforever but \r\npromises turned to raing days\r\nwhoever said that love was\r\nsimple try to walt \r\nbut i feel crippied so\r\ni let you back in my life\r\nand i made the same\r\nmistake twice. \r\n\r\nhow could this be i never\r\nthought id have to set you\r\nfree Addicted to \r\nthe pain i couldnt bring\r\nmyself to leave But deep\r\ninside lies the truth of \r\nyou and i you're not ready\r\nfor my love and so\r\ni have to say good-bye \r\n\r\n아주 우연히 널 만난다면\r\n그때처럼 너를 보내놓고 혼자남아 \r\n깊은 한숨속에 또 돌아서 갈까\r\n나는 왜 이럴까 널 사랑하면서 \r\n널 보내야만 하는지 널닮은\r\n눈이와 널 잡은 그순간\r\n다 녹아버린 나처럼</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/291/15026291_1453271555956_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130584, lowkey: nil, highkey: nil},
