  {album_id: 76, singer_id: 82, team_id: nil, title: "To My Mother", genre1: "가요", genre2: "댄스", runtime: "03:50", lyrics: "\n\t\t\t\t\t\t\t<div>To My Mother - 03:50</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">항상 나만 힘들거라고 슬픔만이 내것이라고 \r\n\r\n외로움엔 익숙하다고 그렇게 생각하며 살았어\r\n\r\n끝을 알 수 없는 어둠을 헤매이며 \r\n\r\n빛을 잃어가던 나에게 그대는 두려움에 빠져 움츠른 \r\n\r\n내모습 감싸주며 나를 위로해주었어 \r\n\r\n나는 이렇게 큰 사랑안에서 살아가고 있다는 것을 난 느껴\r\n\r\n당신이 주는 사랑을 알지만 삐딱한 내가 표현 못 할뿐\r\n\r\n그래 나는 아직도 헤아릴 수 없는 당신의 마음 깊은 곳에 \r\n\r\n상처를 이제는 내가 조금씩 당신을 위로해주고 싶어\r\n\r\n\r\n귀를 닫어 듣지를 않고 입을 막어 말하지 않고 \r\n\r\n눈을 가려 보지를 않고 그렇게 무시하며 살았어 \r\n\r\n항상 그댄 자신안에 숨을 죽이며 얼어붙어 있던 \r\n\r\n영혼의 그대는 내게 남아있는 따스한 마음만 알아보며 \r\n\r\n나를 지켜봐 주었어 나는 언제나 당신의 안에서 \r\n\r\n어리고 약하다는것을 알-아 하지만 그런 나에 모습들이 \r\n\r\n한심해 주저하고 있을뿐 그래 보잘것 없는 이런 나였지만 \r\n\r\n당신을 위해 다가가 보여줄께 지금껏 나를 지켜준 \r\n\r\n당신을 이젠 내가 지킬께\r\n\r\n\r\n나는 이렇게 큰 사랑안에서 살아가고 있다는 것을 난 느껴\r\n\r\n당신이 주는 사랑을 알지만 삐딱한 내가 표현 못 할 뿐\r\n\r\n그래 나는 아직도 헤아릴 수 없는 당신의 마음 깊은 곳에 \r\n\r\n상처를 이제는 내가 조금씩 당신을 위로해주고 싶어</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 5282, song_num: 16130613, lowkey: nil, highkey: nil},
  {album_id: 76, singer_id: 82, team_id: nil, title: "깨달음", genre1: "가요", genre2: "댄스", runtime: "04:06", lyrics: "\n\t\t\t\t\t\t\t<div>깨달음 - 04:06</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">덧없이 흘러간 시간의 흐름속 \n내 마음에 남은 후회의 흔적들 \n내게 남겨진 \n그 슬픔과 눈물들은 사라지고\n\n*모든 걸 잃지 않으려던 나는 \n(이제 내게 남은건 없지만) \n모든 걸 잃고 살아왔던 것을 이젠 알아 \n내 품안에 흐르고 있는 따스함\n영원히 간직할 수 있도록 기도해\n\n**내가 진정 바래왔던 것은 \n저 파란하늘 향해 날아 올라가는 새들의 자유\n내가 항상 꿈꿔왔던 것은 \n따스한 사랑 안에 아주 작은 행복 해맑은 미소들\n\n\n한없이 펼쳐진 내게 남은 미래 잊고 \n지냈던 내안에 숨겨온 \n내가 바라던 그 희망과 소망들을 찾고 싶어\n\n이 소중한 나의 노래를 \n다시 부르리 나는 \n\n내게 다가올 많은 시간엔 \n자신을 믿어 다신 뒤돌아 보는 일은 없을꺼야 \n선명하게 나가선 내 모습 \n이제 후회는 없어 기쁨과 행복한 마음 가득히</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130614, lowkey: nil, highkey: nil},
  {album_id: 76, singer_id: 82, team_id: nil, title: "내게 다가와", genre1: "가요", genre2: "댄스", runtime: "04:12", lyrics: "\n\t\t\t\t\t\t\t<div>내게 다가와 - 04:12</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">if you can handle me then come to me *4\n\n스쳐지나며 네가 남긴 향기 내오감을 마비시키는\n순간에 교차된 완벽한 모습 내 눈 깊이 새겨져 있어\n\ni know how you feel, you are dying to get me \n그래 널 원하고 있어 나는 \nhurry or you lose, boy if you think you're ready\n이미 나는 너를 향해 있는걸\n\n** 도도한 미소 너의 가녀린 어깨 \n나를 애타게 하는 네 모습 \n느끼고 싶어 너를 느끼고 싶어 \n조금씩 천천히 내게 다가와\n붉은 네 입술 도발적인 네 눈빛 \n나를 얼어 붙게 만든 모습 \n느끼고 싶어 너를 느끼고 싶어 \n조금씩 천천히 내게 다가와\n\n\nif you can handle me then come to me *4\n\n온 몸을 파고드는 너의 음성 내 귓속에 맴돌고 있는 \n찰나에 느끼는 황홀한 느낌 내 맘 깊이 새겨져 있어\n\ni know how you feel, you are dying to get me \n그래 널 원하고 있어 나는 \nhurry or you lose, boy if you think you're ready\n이미 나는 너를 향해 있는걸\n\nif you con handle me then come to me (come to me)*8</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130615, lowkey: nil, highkey: nil},
  {album_id: 76, singer_id: 82, team_id: nil, title: "가져가", genre1: "가요", genre2: "댄스", runtime: "03:38", lyrics: "\n\t\t\t\t\t\t\t<div>가져가 - 03:38</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">*가져가 내게 남아 있는 너의 모습들을 \n슬픔만 남은 모든 기억 \n새로운 미랠 위해 다시 나를 찾을꺼야\n꿈에서 깬 내 모습을\n\n스치는 거리마다 돌아선 골목마다 \n내가 느낄 수 있는건 오직 너뿐 \n이제는 혼자 남은 낯설은 공간속에서\n너를 찾아 헤메지만 \n\n*(추억에 갇혀 버린 모습) 오~ 멈춰진 시간\n(희미해져가는 기억들을) 붙잡고있지만\n\nRap) \n언제나 나만을 바라봐 주던 너의 그 눈빛 \n매일 날 향한 그 손짓 never lie love \n절대 거짓이 없는 우리사랑이였기에 \n난 널 믿고 정직한 거울 앞에서도 \n자신있게 널 사랑한다 고백했는데 \n그런 니가 쉽게 날 떠날 줄은 몰랐네 \n그래 이젠 부디 행복하길바래 \nsay good bye! but please dont't take my heart!\n\n내 귀에 속삭이던 달콤한 \n니 목소리 나만을 바라봐주던 너의 그 눈빛 \n언제나 함께 했던익숙한 공간속에서 \n너를 찾아 헤메지만 \n\n아직 너를 잊지 못하는 나의 마음 \n너를 위해 이제 모두 다 잊어줄게 영원히~ \n\n사라져 과거속에 묶인 나의 모습들은 \n걷어차 멀리 던져 버려 \n새로운 미랠 위해 다시 나를 찾을꺼야 \n꿈에서 깬 내 모습을</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130616, lowkey: nil, highkey: nil},
  {album_id: 76, singer_id: 82, team_id: nil, title: "Out Of The Hole", genre1: "가요", genre2: "댄스", runtime: "03:55", lyrics: "\n\t\t\t\t\t\t\t<div>Out Of The Hole - 03:55</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">그대 안에 있는 funky music \r\n나의 마음속에 funky music\r\neverybody wanna funky music\r\n\r\n그댈 위한 나의 funky music \r\n들어봐요 그대 funky music \r\neverybody wanna funky music\r\n\r\neverybody down to this funky sound \r\nDJ be playin wont you turn it loud\r\n\r\n주위를 둘러보면 가식의 허상들과 괴상한 풍경만이 \r\n자신을 잃어버린 지금을 벗어나서 그대를 느껴봐요\r\n\r\n\r\nRap)\r\n스피커를 통해 공명되어 퍼지는 출렁거림에 \r\n몸을 맡겨 니 가슴 실어 너는 싫어?\r\n그러니 너는 무슨 말을 하든 \r\n한 줄의 시로 표현해내지 못하는 것은 당연해\r\n저 해 지기전까지 너는 나를 피해 \r\n그러진 못하면 너를 편안하게 재워줄 한밤을 감수해\r\n넌 니 가슴이 우선인데 머리로 생각해 \r\n\r\n\r\n환상속에 빠져드는 이 기분 두려워하지 말아요 \r\n선율에 몸을 맡겨봐요 \r\n시간을 잊어버려 리듬에 몸을 실어 \r\n모든 걸 내게 맡겨 가슴을 파고드는 \r\n흥겨운 음악속에 전율을 느껴봐요\r\n\r\nRap)\r\nI play that funky music at the drop of a hat \r\nand I beat a body down with at aluminium bat \r\nall you poeple on your asses just get up and \r\nfight or we'll smash your face in the millde \r\nof the night like a pimp I'm pimpin' with a \r\nmic rippin'I'm a bust a move and everybody \r\nbe trippin' cause we rage the effect that \r\nbegins to rock and I'll be summin' it up \r\nstraight gonna rip shit up\r\n\r\n\r\n환상 속에 빠져드는 이 기분 두려워하지 말아요 \r\n선율에 몸을 맡겨봐요 \r\n이제 나와 함께 자신을 기만하는 이성을 멈춰봐요\r\n현실에 묶여있는 사슬을 끊어버려 자유를 느껴봐요 \r\n\r\n\r\n그대 안에 있는 funky music \r\n나의 마음속에 funky music everybody wanna funky music\r\n그댈 위한 나의 funky music \r\n들어봐요 그대 funky music everybody wanna funky music\r\n\r\neverybody down to this funky sound \r\nDJ be playin wont you turn it loud</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130617, lowkey: nil, highkey: nil},
  {album_id: 76, singer_id: 82, team_id: nil, title: "Don't Stop", genre1: "가요", genre2: "댄스", runtime: "03:36", lyrics: "\n\t\t\t\t\t\t\t<div>Don't Stop - 03:36</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">과대포장속에 숨조차 쉴 수 없던 \r\n내게 포기하기만을 강요하는 사람들\r\n왜 나의 모든 걸 왜 나의 모든 걸 \r\n싸늘한 미소로 보고 있는지 \r\n이미 정해 진 길 위를 걷고 있는 너 \r\n그 길에서 벗어날 용기조차 없는 네가\r\n왜 너는 나에게 왜 너는 나에게\r\n니 사고방식을 강요할 수 있니\r\n\r\n이제는 너의 그 텅빈 말들은 내겐 필요없어 \r\n이길은 나의 그 모든 것을 다 빼앗아 간다해도\r\n\r\n*멈출 수 없어 쓰러져 버릴 수 없어 \r\n지친 날개를 다시 펼치고 날아가겠어\r\n멈추지 않아 내가 존재하는 이유 \r\n단 하나뿐 저 빛을 향해 달려가는 이 마음\r\n\r\n어긋난 관심과 편견에 지쳐 버렸던 \r\n내게 절망의 수렁을 선사했던 사람들 \r\n그렇게 태연히 그렇게 태연히 \r\n모든 걸 부정해 버릴 수 있니\r\n내가 하는 말엔 관심조차 없던 너 \r\n무관심한 표정으로 나를 비웃던 네가 \r\n이제와 나에게 이제와 나에게 \r\n알량한 혀끝을 놀리고 있니\r\n\r\n이제는 너의 그 텅빈 말들은 내겐 필요없어 \r\n이길은 나의 그 모든 것을 다 빼앗아 간다해도\r\n\r\n*그 어떤 이유도 나를 막을 수는 없어 \r\n과거의자신을 넘어서 뛰어 오르겠어\r\n멈추지 않아 내가 존재하는 이유 \r\n단 하나뿐 저 빛을 향해 달려가는 이마음</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130618, lowkey: nil, highkey: nil},
  {album_id: 76, singer_id: 82, team_id: nil, title: "하루+하루", genre1: "가요", genre2: "댄스", runtime: "04:07", lyrics: "\n\t\t\t\t\t\t\t<div>하루+하루 - 04:07</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">(달빛에 비춰지는 하루의 그림자 \n다시 밝아오는 햇빛에 새로운 하루가 시작되고)\n새들의 들뜬 속삭임 아침을 재촉하는 새벽 종소리 \n어제와 다른 오늘이 내곁에 다가와 잠을 깨우네 \n거울에 비친 세상은 변하지 않고 여전히 그 자리에 \n하지만 조금씩 다른 시간이 오늘을 채워가네 \n\n*(그렇게 변해가는)\n하루하루는 내게 너무나도 소중한 시간\n(영원할 수 있다면) 떠도는 구름처럼\n(간직할 수 있다면) 살아가고 싶은데 \n(하지만 변해가고)\n\n살며시 저녁 별들이 \n포근히 모든 세상을 감싸주고 \n고요히 잠들어 모두 새로운 내일을 준비하네\n\n소리없이 흐르며 내 맘속에 새겨진 \n감미로운 추억은 다가올 많은 시간이 \n내게 찾아와 희미해져 가는 기억을 채우네\n(영원할 수 있다면)은은한 새벽향기 \n(간직할 수 있다면)나른한 오후햇살 \n(영원할 수 있다면)저무는 저녁노을\n(간질할 수 있다면)깊은밤 고요한 숲\n(하지만 변해가고)그렇게 모든 것이 변해가고\n(또 하루가 가고)</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130619, lowkey: nil, highkey: nil},
  {album_id: 76, singer_id: 82, team_id: nil, title: "이해할 수 없는 사람들에게", genre1: "가요", genre2: "댄스", runtime: "03:32", lyrics: "\n\t\t\t\t\t\t\t<div>이해할 수 없는 사람들에게 - 03:32</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">끝없는 어둠 속을 헤메며 허우적대고 있는 네 모습 \n너의 발목을 잡아끄는 아귀다툼과 같은 세상뿐인 것을 \n하지만 너는 느끼지 못해 이미 빛을 잃은 너에겐 \n그것조차 기쁨과 행복으로 느낀다는 것을 넌 알고있니\n\n어리석음을 깨달음으로 착각하는 \n타성에 젖어 자신의 사고를 잃은 \n그 머리 속에서 뭘 생각하며 \n살아가고 있는 거야 정말 알 수 없어\n아집에 사로잡혀 빛을 잃은 눈동자 \n허황된 가치와 생각만을 쫓아가며 \n욕망만 꿈틀대는 시커먼\n마음속에 무엇 한 나 건질 것이 없어\n\n*나는 네게 아무 말도 하지 않아 \n다만 너의 생각 모습이 아타까워 \n검은 어둠에 둘러 쌓여서 \n물들어 가는 너의 미래는\n\n*끝없는 어둠 속을 헤메며 허우적대고 있는 네 모습 \n너의 발목을 잡아끄는 아귀다툼과 같은 세상뿐인 것을 \n하지만 너는 느끼지 못해 이미 빛을 잃은 너에겐 \n그것조차 기쁨과 행복으로 느낀다는 것을 넌 알고있니\n모를 꺼야 \n\n자만에 빠져들어 보기 싫은 네 모습\n비열한 미소와 가식으로 살아가며 \n자신만 위해 사는 더러운 모습 속에 \n순수한 건 찾을 수 없어\n\nRap : 왜곡되어 코팅된 렌즈로 비춘 mind \n심하게 굴곡되어 빛을 잃어 외면하려 했던 \n모든것들 이제 다 피할수 없는 운명이 되어 \n망설임은 nada 와 왜곡된 mind 로 비추어 본\n굴국된 세상이 준 더러워진 혼 가진 너의 언사 \n너무나 감싸 안아주는 검은 옷을 입은 천사가\n인도하는 길을 따라가다 \n후회하질 않길 제발 내말을 기억해</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130620, lowkey: nil, highkey: nil},
