  {album_id: 77, singer_id: nil, team_id: 25, title: "그렇게 너를 사랑해", genre1: "가요", genre2: "발라드", runtime: "03:21", lyrics: "\n\t\t\t\t\t\t\t<div>그렇게 너를 사랑해 - 03:21</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">사랑한다고 말해줘\r\n언제나 늘 항상 변함없이\r\n하루종일 내린 빗방울 수만큼\r\n사랑한다고 해줘\r\n\r\n그렇게 너를 사랑해\r\n언제나 늘 항상 변함없이\r\n하루 종일 내린 빗방울 수보다 더 \r\n널 사랑하고 있어\r\n세월이 흘러\r\n또 시간이 또 흘러\r\n하늘이 무너져 내려도\r\n내겐 오직 너 하나뿐이야\r\n너만을 사랑하겠어\r\n언제나 늘 항상 변함없이\r\n검푸른 바다보다 그보다 더 깊이\r\n널 사랑하고 있어\r\n\r\n사랑한다고 말해줘\r\n언제나 날 항상 변함없이 \r\n밤 하늘 수놓은 저 별들 수만큼\r\n사랑한다고 해줘\r\n\r\n그렇게 너를 사랑해\r\n언제나 늘 항상 변함없이\r\n우주를 수놓은 그 별들 수보다 더\r\n널 사랑하고 있어\r\n세월이 흘러\r\n또 시간이 또 흘러\r\n하늘이 무너져 내려도\r\n내겐 오직 너 하나뿐이야\r\n너만을 사랑하겠어\r\n언제나 늘 항상 변함없이\r\n붉은 노을보다 그보다 아름답게\r\n널 사랑하고 있어\r\n음 사랑하겠어\r\n음음 너에게 약속해\r\n너만을 사랑한다고</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/294/15026294_1406540890564_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 10690, song_num: 16130625, lowkey: nil, highkey: nil},
  {album_id: 77, singer_id: nil, team_id: 25, title: "비가 내려", genre1: "가요", genre2: "발라드", runtime: "04:18", lyrics: "\n\t\t\t\t\t\t\t<div>비가 내려 - 04:18</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">비가 내리네 그대의 향기를 지우며 \n또다른 이별을 예감하듯 메마른 내가슴 \n바람은 속삭이며 비를 뿌리네\n\n비가 내리네 이렇게 비오는 날이면\n보이지 않는것들 보이고 \n들리지 않던 많은 것이 내게 들려오네\n\n추억과 비가 만나고 남겨진 그리움과 \n내가 만나면 더욱 궁금한 그대의 모습 \n난 언제야 외로움을 벗는가\n\n겨울이 오기전 가을이 지는 자리 \n아픔이 떨어지는 무게로 명주 실오라기처럼 \n풀어져 내리는 비에 젖은 내마음</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/294/15026294_1406540890564_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130626, lowkey: nil, highkey: nil},
  {album_id: 77, singer_id: nil, team_id: 25, title: "그대가 되어 주세요", genre1: "가요", genre2: "발라드", runtime: "03:57", lyrics: "\n\t\t\t\t\t\t\t<div>그대가 되어 주세요 - 03:57</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">나 지금 너에게 하고 싶은 말 있어요\n좀 어지럽긴 하지만 나 괜찮아요\n그 옛날 아버지가 했었다던 \n그 옛날 엄마가 들었다던\n촌스런 말들이에요\n\n저 하늘에 별을 따다 줄게요\n이 한목숨 다바쳐 사랑해요\n장미 백합 해삼 멍게 말미잘\n그대는 나의 태양이죠 \n\n웃지만 말고 말 좀 해봐요\n몰라몰라 가슴쳐줘요\n그대가 없는 곳은 \n오아시스 없는 사막이죠\n내 곁을 떠나지 마요\n\n나 지금 너에게 하고 싶은게 있어요\n좀 어지럽고 울렁이지만 나 괜찮아요\n아버지의 아버지가 그랬듯 \n엄마의 엄마가 그랬듯\n떨리는 순간이에요\n\n저 하늘에 별을 따다 줄까요\n이 한목숨 다바쳐 사랑해요\n장미 백합 해삼 멍게 말미잘\n그대는 나의 태양이죠 \n\n웃지만 말고 눈을 감아요\n그렇게 빤히 보면 나 떨려 못해요\n저 푸른 초원위에 \n그림같은 집을 짓고서\n천만년 살고 싶어요\n\n너 없인 단 하루도 \n살 수가 없을것만 같아요\n그대가 되어 주세요 \n그대가 되어 주세요</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/294/15026294_1406540890564_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 10471, song_num: 16130627, lowkey: nil, highkey: nil},
  {album_id: 77, singer_id: nil, team_id: 25, title: "아버지에게", genre1: "가요", genre2: "발라드", runtime: "04:44", lyrics: "\n\t\t\t\t\t\t\t<div>아버지에게 - 04:44</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">당신을 따라하는게 내겐 가장 중요한 일이었죠 \n어쩌다 집에 일찍 들어오시면 너무 기뻐 떨어질줄 몰랐죠\n조금씩 당신이 항상 옳을수 없다는걸 알게 되면서 \n좀 처럼 웃어주지 않는 당신은 피하고픈 어려움이 되었죠\n나에게~ 해준게 뭐있냐며 뭐든지 반대만하는 당신을 멀리했죠 \n아버지 처럼 살지는 않겠다고 겁많은 당신을 비웃었죠\n어느해 설날이였죠 오랜만에 모두들 모였을때 \n사소한 말다툼 끝에 우리는 서로를 상처내기 시작했죠 \n그때 난 처음으로 당신에 아픔을 느꼈죠 \n언제나 엄한 표정뒤에 있던 여린 당신의 눈물을 보았죠 \n당신의 꿈은 모두 포기한채 혼자 힘든 세상에 부딪혔던 시간들\n이해할수 없던 많은 선택들도 모두 우리를 위해 였다는 걸 \n서로에게 다가가기엔 너무 멀어졌다고 생각 했지만 \n당신은 항상 거기에 있었고 나만 혼자 멀리 떠나왔었죠 \n이제야 난 깨달아요 소중했던 당신의 지혜를 날닮아 \n철없는 아이들에게 당신을 닮은 아빠가 될게요.</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/294/15026294_1406540890564_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130628, lowkey: nil, highkey: nil},
  {album_id: 77, singer_id: nil, team_id: 25, title: "너무 아픈 사랑은", genre1: "가요", genre2: "발라드", runtime: "03:26", lyrics: "\n\t\t\t\t\t\t\t<div>너무 아픈 사랑은 - 03:26</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">슬프게 아름답던 아프게 행복했던\n그대여 내게다시 다가오지마\n사랑이란 그 이름에 우아한 착각속에\n충분히 힘들었어 다가오지마\n그대가 떠나가면 난 많이 힘들겠지\n한때는 방황으로 보내야 겠지\n익숙한 외로움이 차라리 편한거야\n그래 그냥 이렇게 널 포기해\n너무 아픈 사랑은 사랑이 아니래\n그 누구의 노래처럼 널 사랑할 순 없어\n너무 아픈 너 역시 사랑은 아니야\n꿈꾸는 인형처럼 널 사랑할 순 없잖아</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/294/15026294_1406540890564_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130629, lowkey: nil, highkey: nil},
  {album_id: 77, singer_id: nil, team_id: 25, title: "너를 떠나가며", genre1: "가요", genre2: "발라드", runtime: "04:20", lyrics: "\n\t\t\t\t\t\t\t<div>너를 떠나가며 - 04:20</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">날 그리는 너의 젖은 눈을 보았어\n다가가려 했지만 너의 슬픔을 안아줄 수 없어서\n널 사랑하는건 내가 가진 전부였어 \n가장 가까이 에서 너를 항상 지켜주고 싶었어\n\n**스미듯 흘러 내리는 너의 눈물을 힘없이 바라보며\n무거운 상처만 남겨 둔채 널떠나가는 나를 용서해\n\n안녕 내 오랜 사랑아 난 오직 너만을 사랑해\n기억 한켠에라도 내 사랑을 새겨주겠니\n안녕 소중한 사랑아 언제나 널 위해 기도해\n너의 가슴속 깊이 영원히 함께 할 께..\n\n\n**스미듯 흘러내리는 너의 눈물을 힘없이 바라보며\n무거운 상처만 남겨둔채 널떠나가는 나를 용서해\n\n안녕 내 오랜 사랑아 난 오직 너만을 사랑해\n기억 한 켠에라도 내 사랑을 새겨주겠니\n안녕 소중한 사랑아 언제나 널 위해 기도해\n너의 가슴속 깊이 영원히 함께 할 께..</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/294/15026294_1406540890564_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130630, lowkey: nil, highkey: nil},
  {album_id: 77, singer_id: nil, team_id: 25, title: "아무런 이유없이", genre1: "가요", genre2: "발라드", runtime: "04:07", lyrics: "\n\t\t\t\t\t\t\t<div>아무런 이유없이 - 04:07</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">아무런 이유없이 길을 걷다가 아무런 이유없이 눈물 흐를 땐 \n아무런 이유없이 기차를 타고 아무런 이유없이 이곳을 떠나 \n쉽지 않은 너의 삶에 메마른 입술에 단비로 적셔도 보고 \n이름 모를 어느 작은 마을역 빈의자를 바라보다가 \n아무런 이유없이 또 그리워 지고 아무런 이유없이 눈물이 나면 \n아무런 이유없이 내게 전화해 아무런 이유없는 내가 되줄께 음~\n\n\n아무런 이유없이 바람이 불고 아무런 이유없이 먹먹해 질 땐 \n아무런 이유없이 베낭을 메고 아무런 이유없이 이곳을 떠나 \n이룰 수 없었던 너의 그 아픈 사랑도 조금은 덜어도 내고 \n흔들리는 나뭇가지 사이로 밤 하늘 별을 세다가 \n아무런 이유없이 또 서러워 지고 아무런 이유없이 먹먹해 지면 \n아무런 이유없이 내게 돌아와 아무런 이유없이 널 안아 줄께 음~\n\n음~~</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/294/15026294_1406540890564_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130631, lowkey: nil, highkey: nil},
  {album_id: 77, singer_id: nil, team_id: 25, title: "나를 기쁘게 해", genre1: "가요", genre2: "발라드", runtime: "03:44", lyrics: "\n\t\t\t\t\t\t\t<div>나를 기쁘게 해 - 03:44</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">골목길에 뛰노는 아이들의 웃음소리 에서도\n느릿한 할머니를 기다려주는 버스에서\n잘못걸린 전화에 상냥하게 받아주는 목소리\n지친손에 건네는 어깨 툭툭 커피 한잔이 \n나를 기쁘게 하네 나를 행복하게 웃음 짓게하네 \n나를 기쁘게 하네 나를 문득문득 웃음 짓게 해\n\n오랜만에 펼쳐본 촌스러운 초등학교 앨범이\n이른 새벽 들리는 어머님의 기도 소리가\n곰곰히 생각해 보면 왜 나는 모든게 못마땅한지\n저기 앞서가는 세상에 난 나를 맞춰가잖아\n기쁨은 내 안에 있어 \n누구라도 쉽게 행복해 질 수 있어\n다만 나의 등뒤를 돌아보기만 하면\n바로 거기에 있는 걸 \n골목길에 뛰노는 아이들의 웃음소리 에서도\n느릿한 할머니를 기다려주는 버스에서\n잘못걸린 전화에 상냥하게 받아주는 목소리\n지친손에 건네는 어깨툭툭 커피 한잔이</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/294/15026294_1406540890564_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130632, lowkey: nil, highkey: nil},
  {album_id: 77, singer_id: nil, team_id: 25, title: "별", genre1: "가요", genre2: "발라드", runtime: "03:59", lyrics: "\n\t\t\t\t\t\t\t<div>별 - 03:59</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">너의 전부를 원하기엔 많이 모자라지만 이런 나를 받아 주겠니\n오래 전 그날부터 하고 싶던 말 늘 내곁에 함께 있어줘\n너는 나를 더욱 착한 사랑을 하고싶게 이끄는 소중한 나의 빛 \n떨리는 가슴 용기내 오늘 너에게 키작은 내 사랑을 고백해\n\n너의 모두를 바라기엔 많이 부족하지만 내게 너를 열어 주겠니\n내게 주어진 모든걸 너에게 줄 수 있게 언제까지 곁에 있어줘\n너는 나를 더욱 좋은 사람이 되고 싶게 이끄는 소중한 나의 빛 \n떨리는 가슴 용기내 오늘 너에게 키작은 내 사랑을 고백해</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/294/15026294_1406540890564_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130633, lowkey: nil, highkey: nil},
  {album_id: 77, singer_id: nil, team_id: 25, title: "All For One(그 하나를 위해)", genre1: "가요", genre2: "발라드", runtime: "03:18", lyrics: "\n\t\t\t\t\t\t\t<div>All For One(그 하나를 위해) - 03:18</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">우리 함께 울고 웃던 시간이 \r\n한 순간 헛된 꿈이 아니길   \r\n그 하나를 위한 우리 모두의 열매가 맺도록 \r\n주저앉고 싶던 하루 하루가 \r\n힘겹던 우리 지난 시간이   \r\n그 모두를 위한 우리 하나의 희망이 되도록 \r\n후회없이 너의 꿈을 펼쳐 저 타는 태양 아래서 \r\n소리 없이 흘려온 너의 눈물이 아름답잖아 \r\n그 하나를 위한 우리 모두의 그 모두를 위한 \r\n우리 하나의 그대의 그 거친 숨소리가 \r\n더욱 아름답게 그 하나를 위한 우리 모두의 \r\n그 모두를 위한 우리 하나의 \r\n그대의 그 거친 숨소리가 더욱 자랑스럽게</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/294/15026294_1406540890564_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130634, lowkey: nil, highkey: nil},
  {album_id: 77, singer_id: nil, team_id: 25, title: "그대와 함께라면(Acostic Version)", genre1: "가요", genre2: "발라드", runtime: "03:07", lyrics: "\n\t\t\t\t\t\t\t<div>그대와 함께라면(Acostic Version) - 03:07</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">그대 태어난 바로 오늘은 세상에서 제일 기쁜 날\r\n그대는 나에게 기쁨을 주는 어여쁜 사람이라네\r\n때로는 짖궂은 장난을 쳐서 나를 당황하게 하지만\r\n그대 해맑은 환한 미소는 내게 커다란 힘이 되지\r\n\r\n오월의 마지막 날 힘차게 울린 그대 고운 그 울음소리\r\n이 세상 무엇보다도 사랑스러워 넘치는 이 기쁨을 어떻게 말할까\r\n사랑하는 나의 Girl 그대와 함께라면 모든 것을 해낼 수 있어\r\n그대를 내게 주신 커다란 축복에 다시 가슴 벅차 오르네</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/294/15026294_1406540890564_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130635, lowkey: nil, highkey: nil},
  {album_id: 77, singer_id: nil, team_id: 25, title: "둔치(Reprise)", genre1: "가요", genre2: "발라드", runtime: "03:03", lyrics: "\n\t\t\t\t\t\t\t<div>둔치(Reprise) - 03:03</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가사 정보가 없습니다.</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/294/15026294_1406540890564_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130636, lowkey: nil, highkey: nil},
