  {album_id: 78, singer_id: 86, team_id: nil, title: "Sharry", genre1: "가요", genre2: "발라드", runtime: "04:37", lyrics: "\n\t\t\t\t\t\t\t<div>Sharry - 04:37</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">기억속에 아름다운 그대 보고 싶어  oh~ my sharry \r\n살을 스쳐가듯 바람 같은 너에게 난 다시 돌아갈거야 \r\n\r\n나를 봐 서글프게 너무 병들었잖니 \r\n끝없는 상상속에 너를 안고 안은거야 \r\n웃음조차 차게 울리는 깊은 우물속에 쓰러져버린 \r\n너와 나의 시간속에 아름다운 그대 보고 싶어  \r\noh~my sharry \r\n살을 스쳐가듯 바람같은 너에게 난 다시 돌아갈거야 \r\n\r\n나를 봐 서글프게 너를 안고 안은거야 \r\n웃음조차 차게 울리는 깊은 우물속에 스러져버린 \r\n너와 나의 시간속에 아름다운 그대 보고 싶어 \r\noh~my sharry \r\n살을 스쳐가듯 바람같은 너에게 난 다시 돌아갈거야 \r\n차게 울리는 깊은 우물속에 쓰러져버린 \r\n너와 나의 기억들이</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/295/15026295_1304680036967_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 10230, song_num: 16130638, lowkey: nil, highkey: nil},
  {album_id: 78, singer_id: 86, team_id: nil, title: "너에게", genre1: "가요", genre2: "발라드", runtime: "04:20", lyrics: "\n\t\t\t\t\t\t\t<div>너에게 - 04:20</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">아직 나는 작지만 이미 정해진 길도 있지만 \r\n머리 숙이며 난 기다려 왔어 안녕 다 놀라지마 \r\n재로 묻어둔 푸른 꿈들은 오래전 너와 나의 기도였잖아 \r\n지친 날개를 고쳐 숨겨 접은건 변한게 아닌걸 알잖아 \r\n오늘 나는 다른 하늘 날을래 \r\n나도 모를 다른 나를 찾을래 \r\n너라는 큰 힘이 내게 있어 \r\n오 그래 너는 나의 조금 간절한 인사야 \r\n\r\n잘은 모르겠지만 다들 웃는 말로 막겠지만 \r\n이날이 오기를 난 기다려 왔어 안녕 더 붙잡지마 \r\n눈물로 깨물은 분의 나날들 \r\n굳은 다짐으로 이겨 나갈게 고마워 \r\n너는 멈춰선 나를 깊은 잠에서 깨웠잖아 \r\n오늘 나는 다른 하늘 날을래 \r\n나도 모를 다른 나를 찾을래 너라는 큰 힘이 내게 있어 \r\n오 그래 너는 나의 조금 간절한 인사야 \r\n오늘 나는 다른 하늘 날을래 \r\n나도 모를 다른 나를 찾을래 너라는 큰 힘이 내게 있어 \r\n오 그래 너는 나의 오 이제 너는 나의 빛나는 하늘 \r\n나는 다른 하늘 날을래 \r\n나도 모를 다른 나를 찾을래 너라는 큰 힘이 내게 있어 \r\n오 그래 너는 나의 조금 간절한 인사야</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/295/15026295_1304680036967_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 33833, song_num: 16130639, lowkey: nil, highkey: nil},
