  {album_id: 78, singer_id: 86, team_id: nil, title: "외톨이", genre1: "가요", genre2: "발라드", runtime: "04:44", lyrics: "\n\t\t\t\t\t\t\t<div>외톨이 - 04:44</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">하늘을 덮은 크고 어두운 구름위에 난 숨어 살고 있어요 \r\n검은 얼굴의 큰 사람들 손에 거짓없는 혀가 잘려 나갔죠 \r\n입뿐인 나는 오그라들은 심장의 소릴 듣고 자라왔어요 \r\n눈을 감으면 겁에 질린 나 \r\n아무에게도 매만져 달란 말을 못해요 \r\n내 이름을 잘 보세요 \r\n내 이름 고아 손을 펴면 텅빈 거죽뿐이죠 \r\n그대 이름을 보세요 \r\n네 이름 고아 같은 얼굴의 나는 \r\n너 날 믿나 안 믿나 물어볼까요 \r\n\r\n하늘을 덮은 크고 어두운 구름위에 난 숨어 살고 있어요 \r\n검은 얼굴의 큰 사람들 손에 \r\n거짓없는 혀가 잘려 나가 말을 못해요 \r\n내 이름을 잘 보세요 \r\n내 이름 고아 손을 펴면 텅빈 거죽뿐이죠 \r\n그대 이름을 보세요 네 이름 고아 같은 얼굴의 나는 너 \r\n\r\n잘 보세요 내 이름 고아 손을 펴면 텅빈 거죽뿐이죠 \r\n그대 이름을 잘 보세요 \r\n네 이름 고아 같은 얼굴의 나는 너 날 믿나 안 믿나</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/295/15026295_1304680036967_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130642, lowkey: nil, highkey: nil},
  {album_id: 78, singer_id: 86, team_id: nil, title: "겨울, 이별", genre1: "가요", genre2: "발라드", runtime: "04:20", lyrics: "\n\t\t\t\t\t\t\t<div>겨울, 이별 - 04:20</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">겨울 눈이 투명하게 춤추네 \r\n너무 평화로운 오후 초라한 얼굴로 나는 기다리고 있네 \r\n너는 얼은 발걸음을 멈추네 \r\n살을 파고드는 바람 차가운 소리로 \r\n난 시린 손을 흔들며 인사해 \r\n안녕 떠난다며 여전히 알 수 없는 말들로 슬프게해 \r\n안녕 떠난다는 조용히 눈을감고 너를 보내줄게 \r\n\r\n겨울 눈이 투명하게 춤추네 \r\n너무 평화로운 오후 초라한 얼굴로 \r\n난 시린 눈을 감추며 이별해 \r\n안녕 떠난다며 여전히 알 수 없는 말들로 슬프게 해 안녕 떠난다면 조용히 눈을 감아줄게 \r\n나를 너무 아프게 만드네 영원히 묻어 둘게 겨울위에</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/295/15026295_1304680036967_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130643, lowkey: nil, highkey: nil},
  {album_id: 78, singer_id: 86, team_id: nil, title: "나를 사랑하지 않는 그대에게", genre1: "가요", genre2: "발라드", runtime: "04:16", lyrics: "\n\t\t\t\t\t\t\t<div>나를 사랑하지 않는 그대에게 - 04:16</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">난 너에게 편지를 써 \r\n모든걸 말하겠어 \r\n변함없는 마음을 적어주겠어 \r\n난 저 별에게 다짐했어 \r\n내 모든걸 다 걸겠어 \r\n끝도 없는 사랑을 보여주겠어 \r\n\r\n더 외로워 \r\n너를 이렇게 안으면 \r\n너를 내 꿈에 안으면 \r\n깨워줘 \r\n이렇게 그리운 밤 \r\n울고 싶은걸 \r\n난 괴로워 \r\n니가 나 아니라 \r\n다른 사람에게만 \r\n웃고 사랑을 말하고 \r\n또 그렇게 싫어해 날 \r\n\r\n난 욕심이 너무 깊어 \r\n더 많은걸 갖고싶어 \r\n너의 마음을 \r\n가질수 없는 난 슬퍼 \r\n\r\n더 외로워 \r\n너를 이렇게 안으면 \r\n너를 내 꿈에 안으면 \r\n깨워줘 \r\n이렇게 그리운 밤 \r\n울고 싶은걸 \r\n난 괴로워 \r\n니가 나 아니라 \r\n다른 사람에게만 \r\n웃고 사랑을 말하고 \r\n또 그렇게 날 싫어해 날 \r\n\r\n너에게 편지를 써 \r\n내 모든걸 말하겠어</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/295/15026295_1304680036967_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 13560, song_num: 16130644, lowkey: nil, highkey: nil},
  {album_id: 78, singer_id: 86, team_id: nil, title: "순수의 시절", genre1: "가요", genre2: "발라드", runtime: "04:10", lyrics: "\n\t\t\t\t\t\t\t<div>순수의 시절 - 04:10</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">끝이 닳아버린 교복을 보며 \r\n너도 많이 야위었다 힘겨워하던 밤 \r\n불안한 잠에 지친 얼굴을 보며 \r\n나즈막히 숨죽여 노랠 부르던 밤 \r\n\r\n끝도 없는 시험속에 살고 있지만 \r\n그렇게 작은 일에는 서럽게 눈물 짓지마 \r\n구속같은 이 시간을 벗어 나오면 \r\n새롭고 낯설은 딴 세상이 돼 \r\n문을 열어 저 어둡고 사납게 거친 하늘을 봐 \r\n아무도 도울 수 없어 나 혼자 일어서야해 \r\n지금보다 더 힘들고 불안한 삶의 표적들이 내게 다가와 \r\n잊지말아 이 푸르름의 날들을 \r\n\r\n끝도 없는 시험속에 살고 있지만 \r\n그렇게 작은 일에는 서럽게 눈물 짓지마 \r\n구속같은 이 시간을 벗어 나오면 \r\n새롭고 낯설은 딴 세상이 돼 \r\n문을 열어 저 어둡고 사납게 거친 하늘을 봐 \r\n아무도 도울 수 없어 나 혼자 일어서야해 \r\n지금보다 더 힘들고 불안한 삶의 표적들이 내게 다가와 \r\n내앞의 저문을 열어 \r\n저 어둡고 사납게 거친 하늘을 봐 \r\n아무도 도울 수 없어 나 혼자 일어서야해 \r\n지금보다 더 힘들고 불안한 삶의 표적들이 내게 다가와 \r\n잊지말아 이 푸르름의 날들을</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/295/15026295_1304680036967_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 36425, song_num: 16130645, lowkey: nil, highkey: nil},
  {album_id: 78, singer_id: 86, team_id: nil, title: "생일 축하해요", genre1: "가요", genre2: "발라드", runtime: "02:43", lyrics: "\n\t\t\t\t\t\t\t<div>생일 축하해요 - 02:43</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">햇살이 따스하게 내리던 그 날\r\n온통 푸른빛은 더해가고 여린 하늘아래 \r\n아름다운 그대 세상의 빛과 만났죠 \r\n언제나 축복이 곁에 있어주길 \r\n변함없는 모습으로 영원히 \r\n사랑이 그댈 감싸주길 \r\n생일 축하해요 그대 \r\n\r\n꿈처럼 스쳐가는 그대의 미소 \r\n지친 나의 맘을 열어가고 \r\n바라만 보아도 꾸밈없는 마음 \r\n늘 함께 하고 싶어요 \r\n언제나 축복이 곁에 있어주길 \r\n변함없는 모습으로 영원히 \r\n사랑이 그댈 감싸주길 생일 축하해요 그대 \r\nhappy birthday to you \r\nhappy birthday to you \r\nhappy birthday my dear</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/295/15026295_1304680036967_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 14095, song_num: 16130646, lowkey: nil, highkey: nil},
  {album_id: 78, singer_id: 86, team_id: nil, title: "My Nymph", genre1: "가요", genre2: "발라드", runtime: "04:03", lyrics: "\n\t\t\t\t\t\t\t<div>My Nymph - 04:03</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">그녀는 이미 죽었어요 \r\n반듯한 이마에 석고처럼 굳어 창백한 얼굴 \r\n빛나는 황금색 머리카락이 한올한올 \r\n연꽃으로 물에 흘러 떠나가고 \r\n채 식지 않은 살구빛 입술은 \r\n뜨거운 심장으로 살아있는 소년의 눈길을 머물게 하지만 \r\n아무리 걱정스러운 몸짓으로 되 돌리려 해도 \r\n축 늘어진 두 팔을 어쩔 수는 없어요 \r\n해가 달이 되도록 쉬지 않고 조잘대던 상아색 두 발은 \r\n하늘로 곧추 세워진 채 어디로도 움직일 생각은 안 해요 \r\n똑같은 얼굴에 똑같은 가슴 \r\n똑같은 금발에 똑같은 목소리를 가진 \r\n처녀들이 저기 저렇게 많은데 \r\n다시는 어디에서도 알아볼 수 없을 \r\n나의 그녀는 이미 죽었어요</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/295/15026295_1304680036967_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130647, lowkey: nil, highkey: nil},
  {album_id: 79, singer_id: 87, team_id: nil, title: "내 안의 너를 보며...", genre1: "OST", genre2: "한국영화", runtime: "04:25", lyrics: "\n\t\t\t\t\t\t\t<div>내 안의 너를 보며... - 04:25</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">스처지나는 이별의 아픔길어\r\n얼룩져버린 내마음에 니가 남아\r\n사랑이라는 그말 이젠 아무의미없이 \r\n추억속에 묻어버리고 너를 보내고 싶~어\r\n널 보내는 내아픔은 너는아니\r\n잊지못할 흔적만 남아\r\n그냥 이대로 내 뒷모습 바라보며\r\n웃을꺼야 \r\n잊을수 없으니까\r\n\r\n널보내는 내아픔을 너는아니\r\n잊지못할 흔적만남아\r\n그냥 이대로 내 뒷모습 바라보며 웃을꺼야\r\n잊을 수 없으니까\r\n\r\n그래 기다릴께 내안에 너를 보며...</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130648, lowkey: nil, highkey: nil},
