  {album_id: 80, singer_id: nil, team_id: 26, title: "사랑과 야망", genre1: "가요", genre2: "인디", runtime: "03:43", lyrics: "\n\t\t\t\t\t\t\t<div>사랑과 야망 - 03:43</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">어느 따가운 햇살 눈부신 날 가던 걸음을 멈추고 \n그늘 밑에 앉은 내 모습을 잠시 바라본다 \n평생 사랑을 찾아 헤맸지만 마음주고 정주면 \n더 좋은 사람 만났단 단 한마디 남기고 떠났다 \n잘가라 돌아보진 마라 냉정한척 보내고 술잔을 들었다 \n한잔에 눈물, 한잔에 추억 한잔에 미련 한잔에 아쉬움 \n상처만 남은 사랑과 야망 더이상은 후회없다 \n오늘이 가고 내일이 와도 꺼지지 않는 뜨꺼운 내 정열 \n세상이 나를 속일지라도 나는 기다려 내 사랑 \n\n평생 야망을 쫓아 헤맸지만 잡힐 듯이 보이면 \n나보다 잘난 누군가 한발 앞서서 가졌다 \n괜찮아 아무렇지 않아 태연한척 달래고 술잔을 들었다 \n한잔에 눈물, 한잔에 추억 한잔에 미련 한잔에 아쉬움 \n상처만 남은 사랑과 야망 더이상은 후회없다 \n오늘이 가고 내일이 와도 꺼지지 않는 뜨꺼운 내 정열 \n세상이 나를 속일지라도 나는 기다려 내 사랑 \n\n한잔에 눈물, 한잔에 추억 한잔에 미련 한잔에 아쉬움 \n상처만 남은 사랑과 야망 더이상은 후회없다 \n오늘이 가고 내일이 와도 꺼지지 않는 뜨꺼운 내 정열 \n세상이 나를 속일지라도 나는 기다려 내일을 다시 걷는다 \n내인생 나의 사랑과 야망을.. </p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/297/15026297_1411628453610_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130668, lowkey: nil, highkey: nil},
  {album_id: 80, singer_id: nil, team_id: 26, title: "Good Bye My Baby", genre1: "가요", genre2: "인디", runtime: "04:38", lyrics: "\n\t\t\t\t\t\t\t<div>Good Bye My Baby - 04:38</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">아무말도 하지 말아요 이젠 모두 끝났잖아요 \n나 아닌 사랑 찾아 행복하다면 그냥 편히 떠나가세요 \n아무 것도 필요 없어요 더이상 눈물짓지 말아요 \n나없는 세상 살 수 없을 거라던 지난 약속 잊어줄테니 \n세월이 가면 지워지겠죠 \n널위한 사랑도 그 고운 미소도 첨부터 그댄 \n이세상에 없었다고 남겨진 사랑 잊을 수 있게 안녕 \n\n그렇게도 힘들었나요 내 사랑 그리 부담됐나요 \n그대 뒤에서 초라한 내 모습은 두번 다시 없을 테니까 \n세월이 가면 지워지겠죠 \n널 위해 살아도 그 고운 미소도 첨부터 그댄 \n이세상에 없었다고 남겨진 사랑 잊을 수 있게 \n\n힘들꺼라고 아플꺼라고 이젠 내 모습이 바보같다 해도 \n이 세상 그대만을 사랑했던 내 모습을 기억해준다면 \n간직해 준다면 그것으로 충분하니까 \n\nGood Bye My Baby my only laby \n널 위한 사랑도 그 고운 미소도 \n첨부터 그댄 이 세상에 없었다고 남겨진 사랑 잊을 수 있게 \n힘들꺼 라고 아플꺼 라고 그런 내 모습이 바보 같다 해도 \n이세상 그대만을 사랑했던 내 모습을 기억해 준다면 \n간직해 준다면 그것만으로 충분해 \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/297/15026297_1411628453610_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130669, lowkey: nil, highkey: nil},
  {album_id: 80, singer_id: nil, team_id: 26, title: "On My Way", genre1: "가요", genre2: "인디", runtime: "04:00", lyrics: "\n\t\t\t\t\t\t\t<div>On My Way - 04:00</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">세상 살아가는건 힘든일이지만 재밋는 일도 생길거라고 \n그렇게 믿으며 오늘을 보내고 또다시 내일을 기다리는 거야 \n나는 무엇을 위해 살아가는 건지 지금 어디를 향해가고 있는지 \n아무도 모르는 내 꿈을 찾아서 혼자서 이렇게 떠나는거야 \n\n부딪혀 쓰러지고 넘어져도 일어설거야 더이상은 포기하지 않아 \n아무리 힘들어도 외로워도 참을 수 있어 내꿈을 위해서 \n다시 처음부터 해보는거야 내 삶을 걸어 후회하지 않도록 \n정해진 운명 따위는 내 맘대로 바꿔버릴테니까 \n한번 살다가는 세상이라면 멋지게 한번쯤은 살다가야지 \n이세상 끝나는 날 눈물짓지 않도록 후회없이 살거야 \n\n부딪혀 쓰러지고 넘어져도 일어설거야 더이상은 포기하지 않아 \n아무리 힘들어도 외로워도 참을 수 있어 내꿈을 위해서 \n다시 처음부터 해보는거야 내 삶을 걸어 후회하지 않도록 \n정해진 운명 따위는 내 맘대로 바꿔버릴테니까 \n한번 살다가는 세상이라면 멋지게 한번쯤은 살다가야지 \n이세상 끝나는 날 눈물짓지 않도록 후회없이 살거야 \n\n혼자 왔다 혼자 떠나가는게 덧없는 인생이라 말을 하지만 \n어차피 한번뿐인데 미련 따윈 남길 필요없잖아 \n한번 살다가는 세상이라면 멋지게 한번쯤은 살다가야지 \n이세상 끝나는 날 눈물짓지 않도록 후회없이 살거야 </p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/297/15026297_1411628453610_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130670, lowkey: nil, highkey: nil},
  {album_id: 80, singer_id: nil, team_id: 26, title: "The Life", genre1: "가요", genre2: "인디", runtime: "03:56", lyrics: "\n\t\t\t\t\t\t\t<div>The Life - 03:56</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">언제부턴지 몰라도 세상은 혼자 살기에 참 외로울거라고 생각했어 \n가끔은 힘들거라고 그런 시련이 내게 온대도 난 두렵지는 않아 이젠 더이상 \n한번쯤 크게 웃어봐 때론 슬프게 눈물 흘려봐 \n그냥 이렇게 살다 떠나는게 바로 우리네 인생이니까 \n\n사랑도 꿈도 추억도 이젠 희미한 기억이 되어 \n시간의 그림자에 가려져도 이 세상 마지막 날에 \n후회없는 삶을 살았다고 웃으며 너의 곁에서 떠나갈 수 있게 \n한번쯤 크게 웃어봐 때론 슬프게 눈물 흘려봐 \n그냥 이렇게 살다 떠나는게 바로 우리네 인생이니까 \n\n사랑할 수 있지만 미워할 수 도 있는 반복되는 세상속에서 \n우린 무얼 찾으며 살아가고 있는지 알 수 는 없지만 \n한번쯤 크게 웃어봐 때론 슬프게 눈물 흘려봐 \n그냥 이렇게 살다 떠나는게 바로 우리네 인생이니까 \n\n오늘이 가면 내일 오고 지난 미움이 가면 사랑이 오지 \n그냥 이렇게 살다 떠나는게 바로 우리네 인생이니까 \n바로 그런게 인생이잖아 </p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/297/15026297_1411628453610_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130671, lowkey: nil, highkey: nil},
  {album_id: 80, singer_id: nil, team_id: 27, title: "분홍 립스틱", genre1: "가요", genre2: "인디", runtime: "04:00", lyrics: "\n\t\t\t\t\t\t\t<div>분홍 립스틱 - 04:00</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">언제부턴가 그대를 그대를 처음 만날 날 \n남모르게 그려본 분홍 립스틱 \n떨리던 마음같이 사랑스럽던 그 빛깔 \n말없이 바라보던 다정했던 모습 \n\n우리 사랑은 눈부시게 눈부시게 시작됐지만 \n이제는 지워진 분홍립스틱 \n지금은 떠나야할 사랑했었던 그사람 \n이별은 슬프지만 보내야할 사람 \n\n오늘 밤만은 그댈 위해서 \n분홍의 립스틱을 바르겠어요 \n그대 가슴에 지워지지 않을 \n분홍의 입술 자욱 새기겠어요 \n내일이 오면 떠나야 하는 \n그대의 슬픈 눈을 들여다 보면 \n눈물 방울이 얼굴을 적시고 \n분홍의 립스틱을 지워요 \n\n오늘 밤만은 그댈 위해서 \n분홍의 립스틱을 바르겠어요 \n그대 가슴에 지워지지 않을 \n분홍의 입술 자욱 새기겠어요 \n내일이 오면 떠나야 하는 \n그대의 슬픈 눈을 들여다 보면 \n눈물 방울이 얼굴을 적시고 \n분홍의 립스틱을 지워요 \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/297/15026297_1411628453610_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130672, lowkey: nil, highkey: nil},
