  {album_id: 80, singer_id: 97, team_id: nil, title: "용서해", genre1: "가요", genre2: "인디", runtime: "04:54", lyrics: "\n\t\t\t\t\t\t\t<div>용서해 - 04:54</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">미안해요 그저 너무 그대 숨소리가 듣고 싶었죠 \n비가오는 오늘 하루가 이유도 없이 견디기 힘이 든걸요 \n행복해 보이는 모습 너무나 감사드리고 있었었는데 \n그댈 보낸 나였기에 아무 말도 할수 없었지만 \n끝도 없이 솟아나는 내 눈물이 그대 울릴까봐 \n조금씩 그냥 내려버린 내맘 그대 내게 닿을까 \n이제야 후회하는 날 용서해요 \n\n미안해요 그저 그대 뒷모습이라도 보고 싶었죠 \n너무나도 익숙한 이 길 그대는 나와 함께 없는데 \n불꺼진 그대의 창문 그안에 그대는 벌써 잠이 들었나요 \n\n그댈 보낸 나였기에 아무말도 할수 없었지만 \n끝도 없이 솟아나는 내 눈물이 그대 울릴까봐 \n조금씩 그냥 내려버린 내맘 그대 내게 닿을까 \n이제야 후회하는 날 용서해 \n\n내가 남긴 상처들이 그대 이제 잊을수 있다면 \n행복해보인 그대 모습 지켜 살 수 있길 바래요 \n다시는 울지 않기를 기도해요 \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/297/15026297_1411628453610_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130675, lowkey: nil, highkey: nil},
  {album_id: 80, singer_id: 98, team_id: nil, title: "미안해", genre1: "가요", genre2: "인디", runtime: "04:28", lyrics: "\n\t\t\t\t\t\t\t<div>미안해 - 04:28</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">널 보내 날 걱정하지 말아 혹시라도 내 생각에 울지마 고마워 \n나 지금 잘 견뎌내고 있어 가끔 니가 생각날때마다 늘 좋은일만 기억하며 \n\n괜찮아 조금더 익숙해지면 나 웃을수도 있을꺼야 \n너를 떠올리는 그 시간이 즐거울수도 있을꺼야 \n미안해 아직은 눈물이 나와 나 한참더 멀은건가봐 \n너무 사랑한 널 잊기까지 남겨진 내삶의 끝까지 \n\n나 지금 널 마주친다해도 이해할께 그대만이라도 행복하단걸 감사하며 \n괜찮아 조금더 익숙해지면 나 웃을수도 있을꺼야 \n너를 떠올리는 그 시간이 즐거울 수도 있을꺼야 \n미안해 아직은 눈물이 나와 나 한참더 멀은건가봐 \n너무 사랑한널 잊기까지 남겨진 내삶의 끝까지 날 걱정하지는마 \n\n미안해 아직은 눈물이 나와 나 한참더 멀은건가봐 \n너무 사랑한널 잊기까지 남겨진 내삶의 끝까지 날 걱정하지는마 </p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/297/15026297_1411628453610_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130676, lowkey: nil, highkey: nil},
  {album_id: 80, singer_id: 99, team_id: nil, title: "가", genre1: "가요", genre2: "인디", runtime: "03:45", lyrics: "\n\t\t\t\t\t\t\t<div>가 - 03:45</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">어떻게 넌 변한게 없니 그 많은 시간동안 \n날 기다리게 만든 너 이제 느껴 어떻하니 \n너만의 이유는 있겠지 이해할 수는 있어 \n헤어질 수가 없는 너 이젠 니 사랑 가려있어 \n그래 난 알아 너무 어려운걸 늦었지만 너무 힘들지만 \n이젠 떠날게 우리 고단한 이사랑 모두 잊고 떠날게 \n내가 원했던건지 니가 원했던건지 나는 알수 없지만 \n이제 모두 끝났어 너같은 사람을 만나기는 싫어 \n\n그대는 누구를 원하는지 도무지 알수 없어 \n자신을 잃어간 니모습 더이상 보고 싶지 않아 \n함께 해온 것 이젠 잊어야해 서로에게 다른 기억으로 \n지금 널 위해 해줄수 있는 건 없어 그냥 잊고 살아줘 \n내가 원했던건지 니가 원했던건지 나는 알수 없지만 \n이제 모두 끝났어 너같은 사람을 만나기는 싫어 \n\n함께 해온 것 이젠 잊어야해 서로에게 다른 기억으로 \n지금 널 위해 해줄수 있는 건 없어 그냥 잊고 살아줘 \n내가 원했던건지 니가 원했던건지 나는 알수 없지만 \n이제 모두 끝났어 너같은 사람을 만나기는 싫어 \n내가 원했던건지 니가 원했던건지 나는 알수 없지만 \n이제 모두 끝났어 너같은 사람을 만나기는 싫어 \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/297/15026297_1411628453610_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130677, lowkey: nil, highkey: nil},
  {album_id: 80, singer_id: 100, team_id: nil, title: "그대 내게는", genre1: "가요", genre2: "인디", runtime: "03:51", lyrics: "\n\t\t\t\t\t\t\t<div>그대 내게는 - 03:51</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">꿈을 꾸죠 아직 그대 꿈을 아무일 없는 듯 그대를 만나죠 \r\n시간 지나 잊혀질때도 됐지만 내겐 아직도 그대 뿐인걸요 \r\n그대 목소리라도 듣고 싶은 날이면 그대에게 전화를 걸어 보지만 그냥 끊고 말죠 \r\n한번만 한번만이라해도 우리 함께 했었던 그때로 갈수만 있다면 \r\n모든걸 내모든걸 준대도 아깝지 않은걸요 그대 내게는 전부인걸 \r\n\r\n그대 목소리라도 듣고 싶은 날이면 그대에게 전화를 걸어 보지만 그냥 끊고 말죠 \r\n한번만 한번만이라해도 우리 함께 했었던 그때로 갈수만 있다면 \r\n모든걸 내모든걸 준대도 아깝지 않은걸요 그대 내게는 전부인걸 \r\n\r\n언젠가 내게로 돌아올거라했죠 이제까지 기다린 나를 헛되지 않도록 \r\n한번만 한번만이라해도 우리 함께 했었던 그때로 갈수만 있다면 \r\n모든걸 내모든걸 준대도 아깝지 않은걸요 그대에게~ 난~ \r\n\r\n한번만 한번만이라해도 우리 함께 했었던 그때로 갈수만 있다면 \r\n모든걸 내모든걸 준대도 아깝지 않은걸요 그대 내게는 전부인걸</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/297/15026297_1411628453610_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130678, lowkey: nil, highkey: nil},
  {album_id: 80, singer_id: 101, team_id: nil, title: "Thanks to", genre1: "가요", genre2: "인디", runtime: "03:52", lyrics: "\n\t\t\t\t\t\t\t<div>Thanks to - 03:52</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">언제나 그곳에 한결같이 나만을 지키는 내삶의 오직 단 한사람 \n가끔씩 니가 있다는걸 너무 모르고 살았었지 \n항상 내 곁에서 힘이 된 사람 너라는 걸 \n아직은 사랑하기에 내가 부족하지만 언제든지 날 원한다면 \n그래도 내가 필요하다면 널위해 살아가겠어 조금은 두렵겠지만 \n언제나 날 지켜줬잖아 이제는 나의 몫이야 \n\n언제나 나에게 너무나 고마운 사람이 너란걸 널 알고 있는지 \n가끔씩 니가 있다는걸 너무 모르고 살았었지 \n항상 내 곁에서 힘이 된 사람 너라는 걸 \n아직은 사랑하기에 내가 부족하지만 언제든지 날 원한다면 \n그래도 내가 필요하다면 널위해 살아가겠어 조금은 두렵겠지만 \n언제나 날 지켜줬잖아 이제는 나의 몫이야 \n\n기다려줘 너에게 날 모두 줄테니 이제는 내게 기대봐 \n아직은 사랑하기에 내가 부족하지만 언제든지 날 원한다면 \n그래도 내가 필요하다면 널위해 살아가겠어 조금은 두렵겠지만 \n언제나 날 지켜줬잖아 이제는 나의 몫이야 내가 필요하다면 \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/297/15026297_1411628453610_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130679, lowkey: nil, highkey: nil},
  {album_id: 80, singer_id: 102, team_id: nil, title: "나도 애인이 있었으면...", genre1: "가요", genre2: "인디", runtime: "03:56", lyrics: "\n\t\t\t\t\t\t\t<div>나도 애인이 있었으면... - 03:56</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">어떻게든 이번만은 확실하게 내여자를 갖겠어 \n저기 멀리 갈색 머리 그녀 내게 웃으면서 다가오는데 \n세상에 이럴수가 오늘 뭔가 될듯해 \n하지만 나를 지나쳐 다른 남잘 찾아가네 \n\n도대체 왜 이러는건지 뭐가 잘못인지 \n어떡해야 하는지 나도 알수가 없어 나같은 남잔 흔하지 않아 \n날보는 여자들의 눈빛 나를 원하는데 \n다가서면 왜그리 멀어지려하는지 허탈한 마음만 가득할뿐 \n\n어떻게든 오늘만은 실수없이 내여자를 찾겠어 \n한눈에도 딱인그녀 다가가서 말을 걸어보려하는데 \n왜하필 그때인지 발이 서로 꼬였어 \n그녀가 보는 앞에서 완벽하게 넘어졌지 \n\n도대체 왜 이러는건지 뭐가 잘못인지 \n어떡해야 하는지 나도 알수가 없어 나같은 남잔 흔하지 않아 \n날보는 여자들의 눈빛 나를 원하는데 \n다가서면 왜그리 멀어지려하는지 허탈한 마음만 가득할뿐 \n\n어쩜그리 예쁜건지 내친구의 여자들은 모두가 다 아닌 녀석들인데 \n누가봐도 괜찮은 사람 나하나뿐인데 왜 이런날 몰라주는지 \n\n도대체 왜 이러는건지 뭐가 잘못인지 \n어떡해야 하는지 나도 알수가 없어 나같은 남잔 흔하지 않아 \n날보는 여자들의 눈빛 나를 원하는데 \n다가서면 왜그리 멀어지려하는지 허탈한 마음만 가득할뿐</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/297/15026297_1411628453610_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130680, lowkey: nil, highkey: nil},
  {album_id: 80, singer_id: nil, team_id: 28, title: "사랑의 선물", genre1: "가요", genre2: "인디", runtime: "04:09", lyrics: "\n\t\t\t\t\t\t\t<div>사랑의 선물 - 04:09</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">이미알고 있죠 겁먹지 말아요. 내마음과 같다는걸 \n그댄내품안에 안기면 되죠 그리고 느껴봐요 \n어둡던 세상이 밝아져요.(눈이 부셔요) \n그대는 하늘에서 내려온 천사같아 \n눈부신 아침햇살 그대의 잠을 끼워도 놀라지 말아요 \n난 아름다운 그대의 늘 곁에 있어요 \n\n그댈사랑해요 없으면 안되요 난그렇게 믿을께요 \n매일 보는대도 보고싶어요 너무나 그리워요 \n내작은 숨결이 보이나요? (볼수 있어요) \n그대의 곁에 살아있음을 감사해요 \n그어떤 선물보다 갖고싶은건 그대의 사랑뿐인걸요 \n난 숨결처럼 조용히 그대를 지켜요 \n\n눈부신 아침햇살 그대의 잠을 깨워도 놀라지 말아요 \n난 아름다운 그대의 늘 곁에 있어요 \n지나간 시간속에 허락된 사랑 그만큼 소중한 거예요 \n난 숨결처럼 그대의 마음에 있어 힘겨운 그 날까지 </p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/297/15026297_1411628453610_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130681, lowkey: nil, highkey: nil},
  {album_id: 81, singer_id: nil, team_id: 29, title: "내게 와줘", genre1: "가요", genre2: "락", runtime: "04:28", lyrics: "\n\t\t\t\t\t\t\t<div>내게 와줘 - 04:28</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">햇살처럼 눈부시게 내 마음에 쏟아지는 아름다운 그녀 모습 내 마음을 설레게 해 \n혹시 오늘 아침에도 그녈 만날 수 있을까 그럼 이젠 용기를 내서 한 번 말을 걸어볼까 \n\n아침마다 항상 힘들게 눈을 뜨던 나를 이젠 달콤하게 깨우는 그녀 생각 \n자꾸자꾸 웃음이 나와 나의 마음속의 그녀 내 맘을 간지럽히나 봐 \n\n태연한 척 애써봐도 내 가슴을 뛰게 하는 아름다운 그녀모습 점점 다가오고 있네 \n오늘은 꼭 그녀에게 좋아한다 말해야지 무슨 말을 먼저 할까 어떤 표정을 지을까 \n\n너무 떨지 말아야지 무슨 말을 먼저 할까 어떤 옷을 입고 갈까 무슨 말을 먼저 할까 \n\n하지만 내 곁을 무심히 스쳐 지나가는 그녀 다른 남자 품으로 달려가네 \n한낱 꿈에 불과했었나 그녈 원한 나의 마음 또다시 무참히 깨지네 \n\n어디있나 내 사랑은 언제까지 외롭게 날 기다리게 할까 \n어디있나 내 사랑은 언제까지 외롭게 날 기다리게 할까 \n누구일까 내 사랑은 언제까지 외롭게 날 혼자 두려하나 \n\noh oh oh oh 이젠 나도 사랑하고 싶어 \noh oh oh oh oh oh  어디 있나 이젠 내게 와 줘 \n내 사랑아 이젠 내게 와 줘 </p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130682, lowkey: nil, highkey: nil},
  {album_id: 81, singer_id: nil, team_id: 29, title: "Good Life", genre1: "가요", genre2: "락", runtime: "03:23", lyrics: "\n\t\t\t\t\t\t\t<div>Good Life - 03:23</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">한잔 두잔 비워내는 술잔 혀를 지나 목구멍으로 넘어가는 순간 이제부터 시작되는 너와나의 시간 \n흘러가는 나그네들에 유일한 위안 한잔의 데낄라 같은 쓰디쓴 내 인생은 \none shots liquorshots to my 세상 의미 현실에 우물안 같은 내 버림 내 삶 깊이 너와나 \nold my time 바꿔 삶에 그림자 같은 의미 \n\n끝없는 경쟁 속에 나는 우정속에 터지는 기쁨에 눈물 조이는 내 목에 텅 빈 내맘 위해 불러보는 \n슬픈노래 손에 슬픈 술잔 속에 친구 자니 be walking the dark until he's back bright back \n힙합은 나의 술 so where are you at? 이젠 내 가슴에 파인 상처로 매꿔 그리고 마셔 여지껏 쌓인 나의 울분을 토해 뱉어 \n\nchorus) \n채워줄께 가득히 one shots 잔을위로 come on 머리위로 come on 건배 to my 세상 yo everybody come on \n우리위한 축배를 one shots 잔을위로 come on 머리위로 come on 건배 to my 세상 yo everybody come on \n\nyo 조용히(히)해 내 말좀 들어봐봐 내 술잔처럼 깨져버린 내 인생의 drama 나를 버리고 간 너 곧 후회하지(지) \n지금 누구도 나를 건든다면 후회하지(히) 나는 drunken 주정뱅이 끝없이 지껄이는 나 비틀비틀거리는 yo 쓰러져가는 팽이 \n괜히 저 눈길이 가는 저 table에 lady we can make(wah!!) we can make better \n\n항상 내 기대치만큼 더 이상에 만큼 좀 더 깊이 다가가지 못할지라도 항상 텅빈 나의 가슴 채우지 못할지라도 \n내 인생과 난 모든 진실을 위해 내 인생 그것을 위해 우리들에 입에 straight on shots 독한물에 취해 \n나에 심장으로 부터나온 삶에 많은 얘기 후에 clark와 같이 바람과 함께 나는 사라지네 \n\n* chorus X 3 \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130683, lowkey: nil, highkey: nil},
  {album_id: 81, singer_id: nil, team_id: 29, title: "거울", genre1: "가요", genre2: "락", runtime: "05:19", lyrics: "\n\t\t\t\t\t\t\t<div>거울 - 05:19</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">그 벽에 걸려있는 거울 속에 나를 비춰봐 일그러진 얼굴 또 흐트러진 머리카락뿐 \n하나도 빠짐없이 있는 그대로 보여질 거야 신경 좀 써라 이 몰골이 뭐냐 \n마음속에 거울 속에 나를 비춰봐 바닥이 드러난 나의 얕은 모습들 뿐야 \n하나도 빠짐없이 있는 그대로 보여질 거야 신경 좀 써라 뭐 하는 짓이냐 \n\n자꾸 보고 수시로 비춰 어디서든 수시로 비춰 \n앉으나 서나 수시로 비춰 고쳐 안그러면 나를 망쳐 \n\n거울 속에 있는 내 모습을 자세히 봤다 이게 보기 좋냐 이게 정말 보기 좋냐구 \n\nye ye ye 거울 속의 나 \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130684, lowkey: nil, highkey: nil},
  {album_id: 81, singer_id: nil, team_id: 29, title: "혈액형", genre1: "가요", genre2: "락", runtime: "05:34", lyrics: "\n\t\t\t\t\t\t\t<div>혈액형 - 05:34</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">추운 거리는 우리들의 발자국을 기다리고 군화 위엔 흙먼지들 \n젊음을 삼킨 두려운 싸움에 미쳐버리는 눈빛 잠에서 깨라 총에 맞기 전에 \n\n나의 팔에 새겨있는 나의 혈액형 나의 군번아 싸움에서 나의 영혼을 지켜다오~ 오~ \n여기 싸늘한 이 땅에서 나의 피를 묻으리 행운을 빌어다오 나의 행운을 빌어다오 \n\nNarration) \n빅토르의 노래가 들린다. 싸늘한 그의 무덤 앞에 더많은 빅토르가 모여 \n세상을 향해 울부짖는다. 지금도 그의 노래가 끝나지 않은 이유를 우리는 알아야 한다. \n\n고통스러운 이 잔인함을 좀 멈출 수 있다면 내 심장을 이곳에 던질 수도 있어 \n이젠 자유를 얻고싶어 평화를 갖고 싶어 눈물 흘리는 기도 속에 총소리만이. </p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130685, lowkey: nil, highkey: nil},
  {album_id: 81, singer_id: nil, team_id: 29, title: "너를 보내고", genre1: "가요", genre2: "락", runtime: "04:35", lyrics: "\n\t\t\t\t\t\t\t<div>너를 보내고 - 04:35</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">구름낀 하늘은 왠지 니가\r\n살고있는 나라일 것 같아서\r\n창문들 마저도 닫지 못하고\r\n하루종일 서성이며 있었지\r\n삶의 작은 문턱조차 쉽사리\r\n넘지 못했던 너에게 나는\r\n무슨 말이 하고파서 였을까\r\n\r\n먼 산 언저리마다 너를 남기고 돌아서는\r\n내게 시간은 그만 놓아주라는데\r\n난 왜 너 닮은 목소리마저 가슴에 품고도\r\n같이가자 하지 못했나\r\n\r\n(간주)\r\n\r\n길 잃은 작은 새 한 마리가\r\n하늘 향해 그리움 외칠 때\r\n같이 놀던 어린 나무 한 그루\r\n혼자남게 되는 게 싫었지\r\n해 저가는 넓은 들판 위에서\r\n차가운 바람 불어도\r\n들려오던 노래 내 곁에 없었지\r\n\r\n먼 산 언저리마다 너를 남기고 돌아서는\r\n내게 시간은 그만 놓아주라는데\r\n난 왜 너 닮은 목소리마저 가슴에 품고도\r\n같이가자 하지 못했나\r\n\r\n먼 산 언저리마다 너를 남기고 돌아서는\r\n내게 시간은 그만 놓아주라는데\r\n난 왜~~~~~~~~~~~~~~~~~~~~~~~~~\r\n너 닮은 목소리마저 가슴에 품고도\r\n같이가자 하지 못 했나</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130686, lowkey: nil, highkey: nil},
  {album_id: 81, singer_id: nil, team_id: 29, title: "사랑TWO", genre1: "가요", genre2: "락", runtime: "05:15", lyrics: "\n\t\t\t\t\t\t\t<div>사랑TWO - 05:15</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">나의 하루를 가만히 닫아주는 너\r\n은은한 달빛따라 너의 모습 사라지고\r\n홀로 남은 골목길에 수줍은 내 마음만\r\n\r\n나의 아픔을 가만히 안아 주는 너\r\n눈물 흘린 시간 속엔 언제나 네가 있어\r\n상처 받은 내 영혼에 따뜻한 네 손길만\r\n\r\n처음엔 그냥 친군줄만 알았어\r\n아무 색깔 없이 언제나 영원하길\r\n또 다시 사랑이라 부르진 않아\r\n아무 아픔 없이 너만은 행복하길\r\n\r\n널 만나면 말없이 있어도\r\n또하나의 나처럼 편안했던거야\r\n널 만나면 순수한 내모습에\r\n철없는 아이처럼 잊었던 거야\r\n\r\n내겐 너무 소중한너\r\n내겐 너무 행복한너\r\n\r\n\r\n처음엔 그냥 친군줄만 알았어\r\n아무 색깔 없이 언제나 영원하길\r\n또다시 사랑이라 부르진 않아\r\n아무 아픔 없이 너만은 행복하길\r\n\r\n널 만나면 말없이 있어도\r\n또하나의 나처럼 편안했던거야\r\n널 만나면 순수한 내모습에\r\n철없는 아이처럼 잊었던거야\r\n\r\n내겐 너무 소중한너\r\n내겐 너무 행복한너\r\n\t\t\t\t\t</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130687, lowkey: nil, highkey: nil},
  {album_id: 81, singer_id: nil, team_id: 29, title: "흑백사진", genre1: "가요", genre2: "락", runtime: "04:25", lyrics: "\n\t\t\t\t\t\t\t<div>흑백사진 - 04:25</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">창문을 두드리며 너를 불렀었지 어두운 골목에 한참 서 있다가 \n돌아서 올 때면 소리 없이 찾아드는 그리움 \n\n어떤 날은 밤새워 기다렸었지 창문 아래 서성이며 내게 말해 \n아직도 모르니 너 없이는 의미 없는 세상을 \n\n저 멀리서 조그만 모습이 내게 걸어 올 때면 \n가슴이 터질듯해 숨어버린 초라한 모습 \n\n낡은 앨범 흑백사진처럼 눈감으면 내 앞에 떠오르는 추억 \n이젠 다시 돌아갈 수 없나 어릴 적 소녀의 모습 </p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130688, lowkey: nil, highkey: nil},
  {album_id: 81, singer_id: nil, team_id: 29, title: "꿈꾸는 소녀", genre1: "가요", genre2: "락", runtime: "04:51", lyrics: "\n\t\t\t\t\t\t\t<div>꿈꾸는 소녀 - 04:51</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">나의 마음속에 언제나 \r\n꿈을 꾸는 소녀 살고있지\r\n별을 좋아하던 푸른하늘 같은 너\r\n너의 꿈을 찾아 떠나간\r\n그대를 생각하네\r\n\r\n꿈꾸는 소녀야 별들아\r\n그대들은 멀리있지만\r\n꿈꾸는 소녀야 별들아\r\n언젠가는 같은 하늘에 뜰꺼야\r\n\r\n오래전 그 노래 다시 부를거야\r\n너의 가슴속에 나의 노래하나를\r\n\r\n나의 의마음속에 꿈꾸는 소녀가\r\n소녀마음속에 꿈을 꾸는 별들이\r\n꿈을 꾸는 이세상 모든 것들\r\n꿈을 꾸는 이세상 모든 것</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130689, lowkey: nil, highkey: nil},
