  {album_id: 81, singer_id: nil, team_id: 29, title: "이 땅에 살기 위하여", genre1: "가요", genre2: "락", runtime: "04:22", lyrics: "\n\t\t\t\t\t\t\t<div>이 땅에 살기 위하여 - 04:22</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">찬 시멘트 바닥에 스치로폴 깔고 가면 얼마나 가겠나 시작한 농성 \n삼백일 넘어 쉬어 터진 몸부림에도 대답하나 없는 이땅에 살기 위하여 \n일본땅 미국땅까지 원정 투쟁을 떠나간다 \n\n이땅에 살기 위하여 살기 위하여 \n\n이땅에 발딛고 설 자유조차 빼앗겨 빼앗겨 지상 수십미터 아찔한 고공 농성 \n지하 수백미터 막장 봉쇄 농성 식수조차 못먹고 말라 쓰러져가며 \n땅속에다 허공에다 울부짖는다 울부짖는다 \n\n이땅에 살기위하여 햇살 가득한 거리에 숨어 수배자로 쫏기고 쇠창살에 갇혀가며 \n우리는 절규한다 기꺼이 표적이 되어 뜨거운 피를 이땅 위에 쏟는다 \n\n우리가 태어나고 자라온 이땅 우리의 노동으로 일터 세운 이땅에 \n사람으로 살기 위하여 사랑으로 살기위하여 저 지하 땅끝에서 하늘 꼭대기까지 \n우리는 쫏기고 쓰러지고 통곡하면서 온몸으로 투쟁한다 피눈물로 투쟁한다 \n이땅의 주인으로 살기 위하여 이땅의 주인으로 살기 위하여 </p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130691, lowkey: nil, highkey: nil},
  {album_id: 81, singer_id: nil, team_id: 29, title: "담배가게 아가씨", genre1: "가요", genre2: "락", runtime: "07:55", lyrics: "\n\t\t\t\t\t\t\t<div>담배가게 아가씨 - 07:55</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">우리동네 담배가게에는 아가씨가 예쁘다네\r\n짧은 머리 곱게 빚은 것이 정말로 예쁘다네\r\n온 동네 청년들이 너도나도 기웃기웃기웃\r\n그러나 그 아가씨는 새침떼기\r\n앞집의 병열이 녀석은 딱지를 맞았다네\r\n만화가게 진원이 녀석도 딱지를 맞았다네\r\n그렇다면 동네에서 오직 하나 나만 남았는데\r\n아! 기대 하시라 개봉 박두\r\n\r\n다음날 아침 일찍부터 담배 하나 사러가서\r\n가지고 간 장미 한 송이를 살짝 건네어 주고\r\n그 아가씨가 놀랄 적에 눈싸움 한 판을 벌인다.\r\n아 자자자자자자자자\r\n아 그 아가씨 웃었어\r\n\r\n하루 종일 가슴 설레이며 퇴근 시간 기다렸지\r\n오랜만에 말끔히 차려입고 그 아가씰 기다렸지\r\n점잖게 다가서서 미소 띄며 인사를 했지\r\n그러나 그 아가씬 흥 콧방귀\r\n\r\n그렇다고 이대로 물러나면 대장부가 아니지\r\n그 아가씨 발걸음 소리 맞춰 뒤따라 걸어간다.\r\n틀려서는 안 돼지 번호 붙여 하나 둘 셋\r\n아 위대한 손 나의 끈기\r\n\r\n바로 그때 이것 참 야단 났네\r\n골목길 어귀에서 아랫동네 불량배들에게\r\n그 아가씨 포위됐네 옳다구나 이 때다\r\n백마의 기사가 나가신다.\r\n아자자자자자자자자자\r\n으 하늘빛이 노랗다\r\n\r\n우리동네 담배가게에는 아가씨가 예쁘다네\r\n지금은 그 때보다도 백배는 예쁘다네\r\n나를 보며 웃어주는 아가씨\r\n나는 정말 I LOVE YOU\r\n아자자자자자자자\r\n아 나는 지금 담배 사러 간다. \r\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130692, lowkey: nil, highkey: nil},
