  {album_id: 82, singer_id: 108, team_id: nil, title: "The Day", genre1: "가요", genre2: "발라드", runtime: "04:19", lyrics: "\n\t\t\t\t\t\t\t<div>The Day - 04:19</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">그대 내게 언제까지라도 말을 해 이 답답한 마음을 잊진 말아 \nLove me Touch me 나하나만 사랑하길 원해 어떻게 해야해 제발 내게 보여줘 (말해줘) \n이젠 우리가 헤어져 서로 갈 길을 떠나 가던지 아니면 다시 만나 예전처럼 사랑해줘 날 \nI need your love baby I need your love 너없인 내 하루가 너무 길게 느껴져 \nI need your love 우리 다시 시작해 이제 그만 날 슬프게 하고 \n\nKiss me Tease me 나하나만 사랑하길 원해 어떻게 해야해 제발 내게 말해줘 \n이젠 우리가 헤어져 서로 갈 길을 떠나 가던지 아니면 다시 만나 예전처럼 사랑해줘 날 \nI need your love baby I need your love 너없인 내 하루가 너무 길게 느껴져 \nI need your love 우리 다시 시작해 이제 그만 날 슬프게 하고 \n\nDon't take me breath away 나만의 이기적인 그 자존심이 널 아프게 한걸 \n이젠 너무나도 후회해 Just give me one more chance \n\nI need your love baby I need your love 너없인 내 하루가 너무 길게 느껴져 \nI need your love 우리 다시 시작해 이제 그만 날 슬프게 하고 \nDon't break my heart I need your love \nI love I need you I need your love your love \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/299/15026299_1328492431583_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 11259, song_num: 16130698, lowkey: nil, highkey: nil},
  {album_id: 82, singer_id: 108, team_id: nil, title: "사랑", genre1: "가요", genre2: "발라드", runtime: "04:30", lyrics: "\n\t\t\t\t\t\t\t<div>사랑 - 04:30</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">How could you How could you Baby \r\nHow could you leave me like this.. \r\n그토록 오래 기다린 줄 몰랐죠 그대 이기에 나만에 그대였기에 \r\n\r\n힘들어도 난 정말 행복했었죠 너무 사랑했기에 아직도 사랑하기에 \r\n바보처럼 울기만 했어 붙잡지도 못한채 그냥 그대로 거기에 서서 \r\n제발 아침에 떠나가요 아무 말 않을 테니까 \r\n이제 아주 끝난건가요 왜 믿기지가 않나요 나는 \r\nHow could you leave me like this, baby \r\n\r\n힘들어도 난 정말 행복했었죠 너무 사랑했기에 아직도 사랑하기에 \r\n바보처럼 울기만 했어 붙잡지도 못한채 그냥 그대로 거기에 서서 \r\n제발 아침에 떠나가요 아무 말 않을 테니까 \r\n이제 아주 끝난건가요 왜 믿기지가 않나요 나는 \r\n\r\nHow could you leave me like this 나에겐 니가 마지막 사랑일뿐 영원히 \r\nBaby I can't let you walk away I'm never gonna hold you any more \r\n이제 아주 끝난건가요 왜 믿기가 않나요 나는 \r\n왜 잊을수가 없나요 그대</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/299/15026299_1328492431583_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130699, lowkey: nil, highkey: nil},
  {album_id: 82, singer_id: 108, team_id: nil, title: "Get It Up", genre1: "가요", genre2: "발라드", runtime: "04:03", lyrics: "\n\t\t\t\t\t\t\t<div>Get It Up - 04:03</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">우연처럼 널 마난게 아니라는 걸 알면서도 점점 네게 빠져드는 나 \n그게 사랑이란걸 그게 아픔이란걸 많은 시간이 흐른 뒤에야 왜 알아야 했나 \n어쩌다가 날 속인게 아니라는걸 알면서도 모르는척 바보같은나 \n그게 시작이란걸 그게 이별이란걸 인정하고 싶지 않아 오늘 밤만은 \n\nEverybody just get it up 우리 모두 함께 신나게 All through the night \n아무런 걱정도 없이 오늘 처음 만난거 같아 아무 생각 말고 get down tonight \nEverybody just get it up 우리 모두 함께 신나게 All through the night \n아무런 걱정도 없이 오늘 처음 만난거 같아 아무 생각 말고 get down tonight \n\n어쩌다가 날 속인게 아니라는걸 알면서도 모르는척 바보같은나 \n그게 시작이란걸 그게 이별이란걸 인정하고 싶지 않아 오늘 밤만은 \n\nEverybody just get it up 우리 모두 함께 신나게 All through the night \n아무런 걱정도 없이 오늘 처음 만난거 같아 아무 생각 말고 get down tonight \n\nEverybody just get it up 우리 모두 함께 신나게 All through the night \n아무런 걱정도 없이 오늘 처음 만난거 같아 아무 생각 말고 get down tonight \n\n이게 마지막이야 다신 안그럴거야 사랑이 그렇게 힘든거라면 never again \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/299/15026299_1328492431583_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130700, lowkey: nil, highkey: nil},
  {album_id: 82, singer_id: 108, team_id: nil, title: "그대안의 블루(Slow Jam Mix)", genre1: "가요", genre2: "발라드", runtime: "03:42", lyrics: "\n\t\t\t\t\t\t\t<div>그대안의 블루(Slow Jam Mix) - 03:42</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">I just can't close my eyes 빛과 그대 모습 사라져 이제 어둠이 밀려오네 \r\n저 파란 어둠속에서 그대 왜 잠들어가나 세상은 아직 그대 곁에 있는데 \r\n\r\n사랑은 아니지만은 우리의 만남 어둠은 사라지네 \r\n시간은 빛으로 물들어 또 다시 흐르네 Cause you are in my heart \r\n\r\n난 난 꿈을 꾸어요 그대와의 시간은 멈춰지고 \r\n이제 어둠이 밀려오네 빛바랜 사랑속에서 그대 왜 잠들려 하나 \r\n시간은 오 아직 baby I wanna be in your eyes \r\n\r\n사랑은 아니지만은 우리의 만남 어둠은 사라지네 \r\n시간은 빛으로 물들어 또 다시 흐르네 Cause you are in my heart \r\n\r\nBaby I can see inside of your blue in side \r\nin side of your blue inside of your blue in side</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/299/15026299_1328492431583_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130701, lowkey: nil, highkey: nil},
  {album_id: 82, singer_id: 108, team_id: nil, title: "다시는", genre1: "가요", genre2: "발라드", runtime: "05:01", lyrics: "\n\t\t\t\t\t\t\t<div>다시는 - 05:01</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">헤어지나요 우린 항상 행복하란 말뿐이군요 또 시간이 지나 우연히 만나면 웃어주겠냐고 \n눈물이 나네요 이젠 그대 소식조차 알수 없군요 하지만 이미 네게 줘버린 사랑을 어쩔수 없군요 \n\n가지 말라고 제발 떠나지 말라고 말해야 했는데 \n이제와서 아무렇치 않게 날 바보로 만든 널 붙잡을 수도 잊어버릴수도 없는거야 \n왜 떠나야만 했는지 들을수 없지만 왜 날 잊어야 했는지 알 수 없지만 \n왜 그래야만 했는지 물을 수 없지만 내 이 마음을 어쩔수 없군요 \n\n가지 말라고 제발 떠나지 말라고 말해야 했는데 \n이제와서 아무렇치 않게 날 바보로 만든 널 붙잡을 수도 잊어버릴수도 없는거야 \n왜 떠나야만 했는지 들을수 없지만 왜 날 잊어야 했는지 알 수 없지만 \n왜 그래야만 했는지 물을 수 없지만 내 이 마음을 어쩔수 없군요 \n\n왜 떠나야만 했는지 들을수 없지만 왜 날 잊어야 했는지 알 수 없지만 \n왜 그래야만 했는지 물을 수 없지만 내 이 마음을 어쩔수 없군요 내 이 사랑을 어쩔수 없군요 </p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/299/15026299_1328492431583_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130702, lowkey: nil, highkey: nil},
  {album_id: 82, singer_id: 108, team_id: nil, title: "빠삐(상상속으로의 여행)", genre1: "가요", genre2: "발라드", runtime: "03:48", lyrics: "\n\t\t\t\t\t\t\t<div>빠삐(상상속으로의 여행) - 03:48</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">한번쯤 모두 내게 빠져 정신없이 서로 싸우는 꿈에 그럴리 없겠지만 상상만으로 난 좋은걸 \n처음 보는 누군가에게서 난생 처음 사랑 느끼는 꿈을 그럴리 없겠지만 상상만으로 난 좋은걸 \n꿈은 꿈일 뿐이지 그게 전부는 아니야 정말로 원하는건 너를 갖고 싶어 \n\n한겨울 비가 내리는 날 우산없이 마구 춤추는 꿈을 내게로 향한 사람들의 시선이 난 좋은걸 \n꿈은 꿈일 뿐이지 그게 전부는 아니야 정말로 원하는건 너를 갖고 싶어 너를 \n\n소리높여 노래부르는 꿈을 내게로 향한 사람들의 시선이 난 좋은걸 \n꿈은 꿈일 뿐이지 그게 전부는 아니야 정말로 원하는건 너를 갖고 싶어 너를 갖고싶어 \n꿈은 꿈일 뿐이지 그게 전부는 아니야 정말로 원하는건 너를 갖고 싶어 너를 너를 너를 \n꿈은 꿈일 뿐이지 그게 전부는 아니야 정말로 원하는건 너를 갖고 싶어 \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/299/15026299_1328492431583_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130703, lowkey: nil, highkey: nil},
  {album_id: 82, singer_id: 108, team_id: nil, title: "난", genre1: "가요", genre2: "발라드", runtime: "04:40", lyrics: "\n\t\t\t\t\t\t\t<div>난 - 04:40</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">이해할수 없는 얘기들 나만 모르고 지낸 날들 너역시 모른척했던 일들 내가 울어야 했던 이유 \n내가 어떡할까요 말해줘요 그럼 난 이제 혼자인가요 두고 두고 원만할께요 그럼 편해질까요 \n겁날게 없던 사랑이 나밖에 없던 사람이 모두 사라진 후엔 \n가진게 하나 없는 난 잃을게 없는 난 이젠 다시 내겐 \n\n내가 어떡할까요 말해줘요 그럼 난 이제 혼자인가요 두고 두고 원만할께요 그럼 편해질까요 \n겁날게 없던 사랑이 나밖에 없던 사람이 모두 사라진 후엔 \n가진게 하나 없는 난 잃을게 없는 난 이젠 다시 내겐   \n\n가지마 가지마라 그 말 한마디 하기가 왜 이리도 어려운지 \n널 보내야 하는건지 사랑은 없어 그런것 따윈 \n겁날게 없던 사랑이 나밖에 없던 사람이 모두 사라진 후엔 \n가진게 하나 없는 난 잃을게 없는 난 그래 이젠 다신 내겐 사랑은 없어 그런것 따윈   \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/299/15026299_1328492431583_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130704, lowkey: nil, highkey: nil},
