  {album_id: 83, singer_id: 109, team_id: nil, title: "<span class=\"ic-limit\">19금</span>\n\t\t\t\t\t\n\t\t\t\t\tSo Sniper", genre1: "가요", genre2: "랩/힙합", runtime: "04:33", lyrics: "", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/300/15026300_1360720696095_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130728, lowkey: nil, highkey: nil},
  {album_id: 83, singer_id: 109, team_id: nil, title: "솔아 솔아 푸르른 솔아", genre1: "가요", genre2: "랩/힙합", runtime: "04:43", lyrics: "\n\t\t\t\t\t\t\t<div>솔아 솔아 푸르른 솔아 - 04:43</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">솔아솔아 푸르른 솔아 샛바람에 떨지 마라 \r\n창살아래 내가 묶인곳 살아서 만나리라 \r\n\r\n나의 영혼 물어다줄 평화 시장 비둘기 \r\n위로 떨어지는 투명한 소나기 \r\n그 다음날엔 햇빛 쏟아지길 바라며 참아왔던 고통이 \r\n그 찢겨져 버린 가지 될 때까지 묵묵히 지켜만 보던 벙어리 \r\n몰아치는 회오리 속에 지친 모습이 \r\n말해주는 가슴에 맺힌 응어리 \r\n여전히 가슴속에 쏟아지는 빗줄기 \r\n\r\n아름다운 서울 청계천 어느 공장 \r\n허리하나 제대로 펴기 힘든 먼지로 찬 닭장 \r\n같은 곳에서 바쁘게 일하며 사는 아이들 \r\n재봉틀에 손가락 찔려 울고있는 아이는 \r\n배우지 못해 배고픔을 참으며 졸린 눈 비벼 \r\n밖이 보이지 않는 숨막히는 공장에 갇혀 \r\n이틀 밤을 꼬박 세워 밤새 일하면 \r\n가슴에 쌓인 먼지로 인해 목에선 검은 피가 올라와 \r\n여길 봐 먼지의 참 맛을 아는 아이들 \r\n피를 토해 손과 옷이 내 검은 피에 물들 때 \r\n손에 묻은 옷깃에 묻은 현실의 모든 \r\n피를 씻어낼 곧 조차 없는 열악한 환경 속에 \r\n노동자만을 위한 노동법은 사라진지 오래 \r\n먼지를 먹고 폐병이 들어 비참히 쫒겨 날 때 \r\n여전히 부패한 이들은 술 마시며 숨통 조이는 닭장 \r\n에서 버는 한 두 달 봉급 을 여자의 가슴에 꽂아 주겠지\r\n\r\n나의 영혼 물어다줄 평화 시장 비둘기 \r\n위로 떨어지는 투명한 소나기 \r\n그 다음날엔 햇빛 쏟아지길 바라며 참아왔던 고통이 \r\n그 찢겨져 버린 가지 될 때까지 묵묵히 지켜만 보던 벙어리 \r\n몰아치는 회오리 속에 지친 모습이 \r\n말해주는 가슴에 맺힌 응어리 \r\n여전히 가슴속에 쏟아지는 빗줄기 \r\n\r\n비에 젖은 70년대 서울의 밤거리 \r\n무너지고 찢겨 져 버린 민족의 얼룩진 피 \r\n를 유산으로 받은 나는 진정한 민중의 지팡이 \r\n모든 상황은 나의 눈으로 보고 판단, 결단 \r\n살기 위해 허리띠를 조인 작업 장 안의 꼬마는 \r\n너무나도 훌쩍 커버린 지금 우리 내 아버지 \r\n무엇이 이들의 영혼을 분노하게 했는 지 \r\n알 수는 없지만 나는 그저 홀로 속상할 뿐이지 \r\n인간으로써 요구 할 수 있는 최소의 요구 \r\n자식 부모 남편이길 버리고 죽음으로 맞선 \r\n이들에겐 너무도 절실했던 바램 하지만 \r\n무자비한 구타와 연행 으로 사태를 수습한 \r\n나라에 대한 집단 비판 현실에 대한 혼란 \r\n으로 이어져 몸에 불지른 전태일의 추락 \r\n나는 말하네 늙은 지식인들이 하지 못한 \r\n많은 것들을 이들은 몸으로 실천했음을\r\n\r\n나의 영혼 물어다줄 평화 시장 비둘기 \r\n위로 떨어지는 투명한 소나기 \r\n그 다음날엔 햇빛 쏟아지길 바라며 참아왔던 고통이 \r\n그 찢겨져 버린 가지 될 때까지 묵묵히 지켜만 보던 벙어리 \r\n몰아치는 회오리 속에 지친 모습이 \r\n말해주는 가슴에 맺힌 응어리 \r\n여전히 가슴속에 쏟아지는 빗줄기 \r\n\r\n이제는 모든 것을 우리 스스로 판단할 차례 \r\n7.80년대 빈곤한 내 부모 살아온 시대 \r\n그때의 저항과 투쟁 모든 게 나와 비례 \r\n할 순 없지만 길바닥에 자빠져 누운 시대 \r\n가 되가는 2000년대 마지막 꼬리를 잡고 \r\n억압된 모든 자유와 속박의 고리를 끊고 \r\n표현의 자유를 누릴 수 있는 나는 예술인 \r\n으로 태어날 수 있는 나 진짜 한국인 \r\n\r\n나의 영혼 물어다줄 평화 시장 비둘기 \r\n위로 떨어지는 투명한 소나기 \r\n그 다음날엔 햇빛 쏟아지길 바라며 참아왔던 고통이 \r\n그 찢겨져 버린 가지 될 때까지 묵묵히 지켜만 보던 벙어리 \r\n몰아치는 회오리 속에 지친 모습이 \r\n말해주는 가슴에 맺힌 응어리 \r\n여전히 가슴속에 쏟아지는 빗줄기 \r\n\r\n솔아솔아 푸르른 솔아 샛바람에 떨지 마라 \r\n창살아래 내가 묶인 곳 살아서 만나리라 \r\n\r\n솔아솔아 푸르른 솔아 샛바람에 떨지 마라 \r\n창살아래 내가 묶인곳 살아서 만나리라 \r\n\r\n솔아솔아 푸르른 솔어 샛바람에 떨지 마라 \r\n창살아래 내가 묶인 곳 살아서 만나리라.</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/300/15026300_1360720696095_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130729, lowkey: nil, highkey: nil},
