  {album_id: 85, singer_id: 109, team_id: nil, title: "삶의 도피 (featuring Room9)", genre1: "가요", genre2: "랩/힙합", runtime: "05:44", lyrics: "\n\t\t\t\t\t\t\t<div>삶의 도피 (featuring Room9) - 05:44</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">눈을 감고 어둠을 봤듯 두려움에 손을 잡는 삶에 시련이 내 손가락 마디마디 \n뼈속까지 느껴짐은 내가 가진 슬픔이 먼저 지나간 삶의 고충을 대변하는 듯 한데 \n꼬마야 울지말고 이리 가까이 오렴 내가 살기에 힘에 겨워도 살아볼만은 할테니 \n꼬마야 눈물을 닦고 좀더 이겨내보렴 세상을 보는 눈동자는 절대 울지 않으니 \n\nBK] 눈물이 너무도 많았던 그 시절 그때 뜻하지 않던 원치않던 죽음의 길을 \n물려받은 병든 영혼의 슬픔을 보고자란 소년의 눈에 깃든 슬픔이 담긴 눈동자는 \n행복의 날은 없었으니 절망의 날만을 봤으니 나약해져만 갔으니 사라져 갔던 믿음 \n자기탓이라 흘리던 부모의 눈물 더욱더 무거워만 갔던 인생의 짐들 \n그 시절 생사의 고비가 걸린 그 곳 그 공간안에서 철없이 웃기만 했던 \n아직 고통의 진실을 모르던 내게 포근한 미소를 보여준 나와 함께 웃어준 이여 \n그땐 그 미소가 고통을 묻은 쓰디쓴 웃음이었다는 것을 깨달았지 \n진실이 슬픔을 몰고 오네 슬픔은 눈물이 되고 나는 울고 있네 \n\nROOM9] \n세상이라는 그물망에 원치않게 포획되버린 R 그리고 Double O M Nine 삶의 소리 \n원치 않던 학교 그 시작부터가 잘못 돈의 노예 부모에 선택은 끝내 이혼을 \n그 고통 무게 또한 내게로 삶은 비관의 끝을 집이 사라진 슬픔보다 나를 아프게 함은 \n가족이 곁에 없어 함께 식사할 이가 누구Yo 고민을 털어놀 이가 없어 홀로 슬픔에 안겨 \n\nBK] 그토록 간절히 잡으려던 꿈은 던져버리고 이제는 절실히 생명 또 현실만을 \n찾게되는 자기 인생에 모두를 밀어내려 했던 건 확신이 없었던 미래였기에 때문에 \n모든걸 포기하게 해버린 저주의 대상도 어느덧 자신으로 돌아갔지 \n이젠 가슴 한구석 한가득 품고 이 쓴 서러움에(서글픔에) 눈물도 메말라만 갔기에 \n\n눈을 감고 어둠을 봤듯 두려움에 손을 잡는 삶에 시련이 내 손가락 마디마디 \n뼈속까지 느껴짐은 내가 가진 슬픔이 먼저 지나간 삶의 고충을 대변하는 듯 한데 \n꼬마야 울지말고 이리 가까이 오렴 내가 살기에 힘에 겨워도 살아볼만은 할테니 \n꼬마야 눈물을 닦고 좀더 이겨내보렴 세상을 보는 눈동자는 절대 울지 않으니 \n\nROOM9] 절대울지 않으니 Today 날마다 내게 다짐 Yo 나는 거짓말쟁이 \n지키지 못한 다짐에 날 조여오는 삶의 짐 눌러버린 돈의 힘 \n날버린 그들에 대한 원망 이젠 내게도 실망 갈망하던 꿈들은 사망 그저 나홀로 사막 \n서막의 시작일뿐 내 앞날이 너무 막막 깜깜한 어둠에 홀로 내버려진 꼬마 \n소망이 있다면 그저 화목한 집안 \n\nBK] 하늘 아래 같은 하늘 아래서 태어나 축복받지 못한 이들이여 그리고 너와나 \n달라진 건 없지만 서글픈 멜로디에 털어버리고픈 마음속의 상처라네 \n아직은 날수있는 날개를가지고 하늘만 쳐다보는 한마리 새 \n어두워만가는 정신위로 태양이 떠오를때 하늘 높이 날고 있을 너를 그려보네 \n\nROOM9] 나의 고통을 덜어주는 건 오직 한잔의 술뿐 어깨동무 나의 친구 \n다잊구 시작하라구 삭제할 수 없는 기억에 제차 그자릴 맴도네 적재량을 넘어선 술로 \n몸은 이러다 골로 Slow 나의 삶은 마냥 제자리에서 Flow Hero 되겠다던 어린시절 꿈은 Error \n나는 솔로 늘쌍 홀로 너무 싫어 손은 술로 몸은 피로 맘은 괴로움을 이길수 없어 울고 \n남들 겪는 학창시절 나는 하찮은 아르바이트 볼쌍 사나운 세상이 싫어 세상을 향해 \n오바이트를 볼수 없음에 들리지 않음에 난 잡을 수 없음 빈부의 격차보다 힘든 빈곤 \n연속에 흐름 서툰 나로써는 남들보다 더 삶이 힘듬 해픈 너희삶은 나처럼 삶이 싫음 \n바라보는 내밀어주는 눈빛 따스한 손길 온기 그뿐이면 난 행복함 아임을.. \n\n눈을 감고 어둠을 봤듯 두려움에 손을 잡는 삶에 시련이 내 손가락 마디마디 \n뼈속까지 느껴짐은 내가 가진 슬픔이 먼저 지나간 삶의 고충을 대변하는 듯 한데 \n꼬마야 울지말고 이리 가까이 오렴 내가 살기에 힘에 겨워도 살아볼만은 할테니 \n꼬마야 눈물을 닦고 좀더 이겨내보렴 세상을 보는 눈동자는 절대 울지 않으니 \n\nSNIPERZ] 어린아이가 응석부리듯 성장이 멈춘 좁은 시야 나역시도 괴로운시간 \n술로 다 씹었어 생활전선의 연장선은 곱지못한 시선 그럴수록 억세지는 나를 \n보지만 눈먼 장님에게는 빛도 없어 끝없는 삶의 질서 찾을수 없는 공통분모 우리내 \n등뒤의 부모 괴로움이 어깨를 눌러 발목이 잡혀도 끝까지 내 넋두리 삶의 소리 \n변하지 않는 대가리 내가 니놈 등위를 지키니 쫄지말고 덤벼 네게 욕보인 삶을 향해 \n좀더 빡세게 개겨 누가머래도 붓다베이비 내가 총알받이 네놈보고 술값내라는 소리는 \n안할테니 오늘먹다 내일죽어도 내게 소중한 의리 내가 일궈낸 권리 있을수 없는 포기 \n죽는 소리 그만하고 이제는 힙합안에서 우리이름 붓다베이비는 삶을 토하는 MC \n\n눈을 감고 어둠을 봤듯 두려움에 손을 잡</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/302/15026302_1405059477286_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130746, lowkey: nil, highkey: nil},
