  {album_id: 85, singer_id: 109, team_id: nil, title: "B.K LOVE ( Radio Edit ) ( featuring 유리)", genre1: "가요", genre2: "랩/힙합", runtime: "04:22", lyrics: "\n\t\t\t\t\t\t\t<div>B.K LOVE ( Radio Edit ) ( featuring 유리) - 04:22</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">나의 마음 알고있었니 정말로 너만을 생각하며 지냈던 날들 \n하지만 너에 대한 마음이 커지면 커질수록 나는 더욱더 힘들어해야만 했어 \n불안에 떨어야만 했어 이제는 내 자신이 지쳐서 너를 볼 자신이 없어 \n그래 비겁하게 너에게 등을 보이고 도망가려하는 내 자신이 너무도 싫어 \n하지만 나는 너무 늦게 알아 버린 거야 \n내가 너를 좋아한다는 걸 알았을 때 하지만 그땐 너무도 늦어 버렸어 모든 게 변해버렸어 \n나는 너무도 초라했던 내가 너에게 말할 용기도 자신도 모두 잃어버렸어 \n하지만 그냥 그게 좋았었지라고 생각했던 내가 어리석었어 \n그게 그렇게 힘들 줄은 난 정말로 몰랐던걸 이제야 늦게나마 난 깨달았던 거야 \n\n이 모든게 너에겐 변명으로 들리겠지 하지만 내 사랑은 오직 하나 너뿐이었다는 걸 \n그래 이거 하나만은 알아줬으면 해 나만큼 너를 사랑해줄 사람 없다는 걸 \n이 모든게 너에겐 변명으로 들리겠지 하지만 내 사랑은 오직 하나 너뿐이었다는 걸 \n그대 이거 하나만은 알아줬으면 해 나만큼 너를 사랑해줄 사람 없다는 걸 \n\n돌아서는 네 모습 바라보는 내게 더 이상의 슬픔은 없어 \n끝이 된 사랑을 놓지 못해 슬픔에 울지 못해 baby 제발 \n\n내 가슴에 젖은 내 친구의 처진 목소리 처음부터 어긋나버린 끝이 된 사랑얘기 \n내 친구의 아픔을 이해 못할 슬픔을 달래긴 힘겨워서 불러본다 노래 \n진정 네가 사랑했던 꽃잎 같은 그녈 위해 많은 시간 홀로 지내며 준비했던 사랑 \n그 한송이 꽃을 피우기 위해 흘러내린 눈물은 빛을 발하지 못하고 한줌 흙이 되어 날려 \n수많은 날을 밤을 한숨으로 보내며 지내며 생각의 마지막에 어렵게 내려진 결론 \n그건 결코 쉽지 않게 내려진 그녈 위한 너를 위한 네 사랑의 결별의 종말론 \n언젠가는 이루지 못한 너의 둘의 안타까운 사랑이 저하늘의 두빛으로 만나 \n하늘에 줄을 긋는 별똥별이 되어 다음 생엔 그 사랑이 분명히 이뤄지길 바래 \n\n내 친구는 아직 그녈 사랑해요 하지만 그녈 위해 내 친구는 떠난 데요 \n이런게 사랑이라 생각하면 숨막혀요 그래서인지 내친구는 아직 우나 봐요 \"bk\" \n내 친구는 아직 그녈 사랑해요 하지만 그녈 위해 내 친구는 떠난 데요 \n이런게 사랑이라 생각하면 숨막혀요 그래서인지 내친구는 아직 우나 봐요 \"bk\" \n\n돌아서는 네 모습 바라보는 내게 더 이상의 슬픔은 없어 \n끝이 된 사랑을 놓지 못해 슬픔에 울지 못해 baby 제발</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/302/15026302_1405059477286_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130749, lowkey: nil, highkey: nil},
  {album_id: 85, singer_id: 109, team_id: nil, title: "Bird Flying Through The Night", genre1: "가요", genre2: "랩/힙합", runtime: "04:34", lyrics: "\n\t\t\t\t\t\t\t<div>Bird Flying Through The Night - 04:34</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">illinit) \r\nYo 낮에 겉만 번지르르한 것들 붓다의 몽둥이로 밤으로 대려와 끝없이 맨땅에 번지점프를 시키고 부르르 떨게 만드는 칠흙같은 어둠 반짝 빛나고 두눈 끓어 오르는 소리는 파르르 합 마치 합기도처럼 기합을 넣고 기도하는 맘으로 밤으로 달려가 벌이는 시합 어둠의 미학을 아는 천하제일의 붓다베이베 절대 내일은 걱정안해 Word ULT \r\n\r\nULT) \r\n함께 나누는 즐거움보다는 나와의 싸움을 즐기는 우리 붓다베이비 시작은 붓따섬 한계는 없다쳐 현재를 다그쳐 얻은 보석들은 해를 대신해 눈을 빛나게 팬을 신나게 백에 물든 흑의 의미 내가능성을 결정짓는 준비된 값어치 무한대 에너지가 깃든 영감들은 새벽공기를 재료삼아 눈을 뜨며 일어서!! \r\n\r\nROOM9&amp;Baezik) \r\nYo 밤에만 피는 장미 Yo 알콜홀릭 룸나인 밤에 공기를 파는 Yo 베스핏의 베이직 Yo 달이 뜸과 동시에 내맘에 꽃은 피네 꽃이핌과 동시에 또다른 오늘의 History Classic 탄생 길을 헤메 마우스만 까딱까딱 바닥과 언더를 기어 바다처럼 넓다 넓디넓은 깊은 바다는 눈으론 확인불가~ 순간순간으로 만들어진 인생은 숨이가빠 가빠없는 사내에 FeverNight 노력의 끄트머리에 가파오르는 뮤직의 가빠에 홀로 정면으로 맞서 정성이 부족해 힙합은 경성을 떠나 학교를 전학 올드에서 뉴로 이제는 트루 미확인 스루 패스한방에 골인지점은 눈앞 정박자의 힙합리듬을 이제 관객에게로 선사 정상은 멀지 않아 밤이 만든 수퍼스타 yo \r\nBaezik &amp; Room9 Style yo~ 회기로부터 출발 \r\n\r\nSniperz) \r\ni like KRS-1 buddha mind \r\n나의 의식은 바른 신념 Real MC \r\n살아있는 자의 소리 Real MC \r\n머리보다 가슴이다 나의 메세지 \r\ni like KRS-1 buddha mind \r\n나의 의식은 바른 신념 Real MC \r\n살아있는 자의 소리 Real MC \r\n머리보다 가슴이다 붓다베이비 \r\n\r\nBK) \r\n활짝 펼친 날개 아침은 멀었다네 슬픔은 던져버리고 새희망을 가슴에 품고 넘기는 술잔하나에 어느새 아침은 밝아오지만 다시 새벽은 찾아오겠지 우리 올빼미 부따베이비 잠못이루는 새벽 아침의 공기가 너무 상쾌해 저기 새벽 밤하늘을 보며 빠져드는 붓다마인드 해탈의 경지 \r\n\r\nSniperz) \r\n해탈의 경지 밤에 사는 올빼미 수많은 밤의 결실 우리들의 스타일 \r\n따스한 침실보다 편한 작업실 그것이 우리들이 존재하는 진실 \r\n\r\ni like KRS-1 hiphop mind 언제나 붓다베이비 안에 있으라 \r\ni like KRS-1 hiphop mind 언제나 붓다베이비 안에 있는 나 \r\n\r\nZenio7) \r\n웃고 떠든 낮이 지나 밤이 되면 어둠을 밝힌 공간안에 나는 생각에 빠져들고 짙게 깔린 어둠을 타고 내린 나의 팬은 종이위로 나의 생각을 정립하네 수많은 별처럼 내머린 꽉 차서 쉴시간 찾아보니 삐까뻔쩍 해뜨고 커튼을 내치고 \r\n자리를 박차며 또다시 준비하네 다시한번 달 뜨고 \r\n\r\n병희) \r\n한줄의 시로 달의 정기를 기로 어둠속에서 홀로 정리되서 떠오르는 시구절을 종이위로 끝없이 또 펼쳐지는 우주속의 광활함도 혼을 실어담아내 내귓가의 영혼들을 달래 \r\n\r\npsyops &amp; Taktak36) \r\n나의 얘기속은 달랐어 달렸어 우주의 끝에서 나 흐르는 은하수를 마시며 취해 하나의 시인으로 한편의 시를 써내려가며 조용한 어둠 속에서 밝은 곳에서 절대 