  {album_id: 86, singer_id: 110, team_id: nil, title: "No. 1", genre1: "가요", genre2: "댄스", runtime: "03:11", lyrics: "\n\t\t\t\t\t\t\t<div>No. 1 - 03:11</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">어둠 속에 니 얼굴 보다가 나도 몰래 눈물이 흘렀어 \r\n소리 없이 날 따라오며 비춘 건, Finally 날 알고 감싸준거니 \r\n처음 내 사랑 비춰주던 넌 나의 이별까지 본거야 \r\n\r\nYou Still my NO.1 날 찾지 말아줘 나의 슬픔 가려줘 \r\n저 구름 뒤에 너를 숨겨 빛을 닫아줘 그를 아는 이 길이 내 눈물 모르게 \r\n\r\n변한 그를 욕하진 말아줘 니 얼굴도 조금씩 변하니까 But I miss you.. 널 잊을 수 있을까 \r\n( want you back in my life I want you back in my life ) 나의 사랑도 지난 추억도 모두 다 사라져 가지만 \r\n\r\nYou still my NO.1 보름이 지나면 작아지는 슬픈 빛 \r\n날 대신 해서 그의 길을 배웅해줄래 못다 전한 내 사랑 나처럼 비춰줘 \r\n\r\n가끔 잠든 나의 창에 찾아와 그의 안불 전해줄래 \r\n나 꿈결 속에서 따뜻한 그의 손 느낄 수 있도록 \r\n\r\nhuh~ doo doo doo doo~ \r\n\r\n하지만 오늘밤 날 찾지 말아줘 나의 슬픔 가려줘 \r\n저 구름 뒤에 너를 숨겨 빛을 닫아줘 그를 아는 이 길이 내 눈물 모르게 \r\n\r\n보름이 지나면 작아지는 슬픈 빛 날 대신 해서 그의 길을 배웅해줄래 \r\n못다 전한 내 사랑 You still my NO.1</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/304/15026304_1323325464584_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130816, lowkey: nil, highkey: nil},
  {album_id: 86, singer_id: 110, team_id: nil, title: "My Sweetie", genre1: "가요", genre2: "댄스", runtime: "03:38", lyrics: "\n\t\t\t\t\t\t\t<div>My Sweetie - 03:38</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">그대만 보면 너무 좋았죠 언제나 환한 얼굴만을 보여준 그대 \n가끔씩 들려준 포근한 노래들로 작은 시련쯤 모두 이겨낼 수 있었죠 \n\n그대를 보러 가는 길이 좋아요 내일은 햇살 가득한 아침도 \n한 걸음씩 걸었죠 단숨에 달려갈 수도 있지만 아껴두고 싶은 맘인걸 \n\n아무것도 그댄 모르는 것 같아요 내가 그댈 사랑하고 있는 것도 \n\nchorus) \n(one, two) 이젠 어리지가 않죠 (two, two) 숙녀라고 볼 순 없죠 \n하지만은 언젠가는 나도 여자가 돼 있겠죠 때론 달콤하게 조심스럽게 사랑을 말할 수도 있겠죠 \n(one, two) 이젠 어리지가 않죠 (two, two) 숙녀라고 볼 순 없죠 \n하지만 사랑해도 될까요 나 언젠가는 그대 맘을 사로잡는 여자가 되고 싶어 나를 기다려 줘요 \n\n그대는 내게 딱 걸렸어요 나 매일 그대 꿈을 꾸기만을 빌어요 \n잠에서 깨어나 그대가 마치 날 본 것 같아 부끄러워질 때도 있죠 \n\n혹시라도 눈이 마주치는 날이면 하루종일 그댈 피해 다녔죠 \n\n(one, two) 이젠 어리지가 않죠 (two, two) 숙녀라고 볼 순 없죠 \n하지만 사랑해도 될까요 나 언젠가는 그대 맘을 사로잡는 여자가 되고싶어 나를 기다려 줄 수 있나요 \n\n오늘 아침 왠지 그대 눈빛에 슬픔들이 고인 것 같아 누가 그댈 힘들게 했나요 \n그대 맘에 있는 누군가 보다 더 잘 할 자신 내게 있어요 Wow~ Ha~ Ha~ \n\n* chorus \n\nOne! Two! \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/304/15026304_1323325464584_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 5896, song_num: 16130817, lowkey: nil, highkey: nil},
  {album_id: 86, singer_id: 110, team_id: nil, title: "늘 (Waiting)", genre1: "가요", genre2: "댄스", runtime: "04:15", lyrics: "\n\t\t\t\t\t\t\t<div>늘 (Waiting) - 04:15</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">우리 얼마 만인가요 \r\n참 오랜 시간이 흘렀네요 \r\n왜 자꾸 내 맘이 아픈건지 \r\n왜 그리 아파하나요 \r\n혹시라도 힘든 일 있었나요 \r\n왜 아무말하지 않나요 \r\n지금인데 그대 앞인데 \r\n말해야 하는데 나의 마음을 \r\n오랜 시간 그대를 향한\r\n길었던 내 기다림을 \r\n바보 같죠 항상 그랬죠 \r\n그래야 했죠 그댈 위해서\r\n사랑해요 여전히 감사해요 \r\n왜 날 잡지 않았나요\r\n왜 아무것도 묻지 않았나요 \r\n그대 없는 내가 괜찮을 것 같나요 \r\n지금인데 그대 앞인데 \r\n말해야 하는데 나의 마음을 \r\n오랜 시간 그대를 향한 \r\n길었던 내 기다림을 \r\n바보 같죠 항상 그랬죠 \r\n그래야 했죠 그댈 위해서 \r\n사랑해요 여전히 감사해요 \r\n나 알고 있어요 \r\n내가 그대에게 \r\n마지막 한가지 해줄 수 있는 것이 \r\n이별뿐이라는 것 \r\n이제서야 깨달은 나의 \r\n모자란 사랑을 용서해 줘요 \r\n사랑해요 여전히 감사해요 \r\n사랑해요 이말이 하고 싶었죠</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/304/15026304_1323325464584_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130818, lowkey: nil, highkey: nil},
  {album_id: 86, singer_id: 110, team_id: nil, title: "Tragic", genre1: "가요", genre2: "댄스", runtime: "03:49", lyrics: "\n\t\t\t\t\t\t\t<div>Tragic - 03:49</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">Whatever you do for me make sure its from the heartbeat 언제나 하나라고 믿고 있어 babe \n서로가 너무 멀리 있다해도 far away 그 어떤 것도 우릴 가를 순 없어 \n\nchorus) \nWe make for one thing love revolution Oh~ 더 이상은 없어 \n하늘만이 허락하는 crazy tragic now \n언제까지 나를 가둘 수 있을지 tragic all my inside 내 두 손을 잡아줘 \n잊지 말아 제발 너를 믿고 있어 기다리고 있어 내게 기대도 돼 \n\nWhatever you do for me.. far away 언제나 하나라고 믿고 있어 babe \n서로가 너무 멀리 있다해도 far away 그 어떤 것도 우릴 가를 순 없어 \n\n* chorus \n\n영원히 우리함께 살아갈 수 있는 날이 있을 거라 나는 믿어 \n그 누구도 우릴 막을 수 없는 날 (crazy tragic now) \n\n언제까지 나를 가둘 수 있을지 tragic all my inside 내 두 손을 잡아줘 \n잊지 말아 제발 너를 믿고 있어 기다리고 있어 내게 기대도 돼 X 2회 반복 \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/304/15026304_1323325464584_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130819, lowkey: nil, highkey: nil},
  {album_id: 86, singer_id: 110, team_id: nil, title: "Shy Love", genre1: "가요", genre2: "댄스", runtime: "03:36", lyrics: "\n\t\t\t\t\t\t\t<div>Shy Love - 03:36</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">너의 어깨에 기대고 싶은 내 맘을 더 이상 감출 순 없어 oh babe \n눈을 감아도 아닌 척 해봐도 넌 이미 내게 있는걸 come on \n\n작은 내 맘에 살며시 부는 바람은 아마도 사랑인가 봐 oh no \n마법에 걸린 주인공처럼 너에게 점점 다가가 \n\n좋아한다고 말을 해볼까 아님 모른 척 조금 기다려볼까 \n친구들 내 맘 모두 알고 있는데 왜 너만 내 맘 모르는 거야 (babe) \n\n날 받아줘 날 안아 줘 처음처럼 내 맘처럼 언제까지나 \nBaby wanna 날 영원히 웃게 할 사람 오직 너뿐야 I wanna baby love tonight \n\nRap) \nyo, yo! wanna spend my days wit' you stay devoted &amp; true get through the issues \nI'm askin' did you think about me today about the games you &amp; me gon' play hit the lights have you \ncallin' my name can't refrain from the pull the queen that guides my rule heavy on my mind wanna \nspend some time all my days &amp; all my nights share all that bitter-sweetness I got you in my business \n\n밤이 새도록 전화기 들고서 달콤한 니 향기에 잠들고 싶어 \n널 바라보긴 이젠 너무 힘들어 혹시나 놓칠까봐 두려워 (babe) \n\n날 받아줘 날 안아 줘 처음처럼 내 맘처럼 언제까지나 \nBaby wanna 날 영원히 웃게 할 사람 오직 너뿐야 I wanna baby love tonight \n\n조금 더 가까이 나에게 다가와 I feel love tonight babe \n\n날 받아줘 날 안아 줘 오늘까지 친구로만 날 바라봐 줘 \nBaby wanna 내 이런 맘 이렇게 쉽게 오진 않지만 I wanna baby love tonight </p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/304/15026304_1323325464584_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130820, lowkey: nil, highkey: nil},
  {album_id: 86, singer_id: 110, team_id: nil, title: "Day", genre1: "가요", genre2: "댄스", runtime: "04:13", lyrics: "\n\t\t\t\t\t\t\t<div>Day - 04:13</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">아무것도 아니라고 나를 위로하려 했던 너의 그런 모습이 나를 더욱 힘들게 해 \n\n너도 나를 원하고 있잖아 애써 나를 외면하려 하지마 내게 다가와 \n\n너만을 원했던 나만을 생각 해줘 그렇게 힘들다면 (내 곁에서) \n더 이상 내게서 달아나려 하지마 조금 더 좀 더 가까이 (가까이) \n\nchorus) \nAll alone just day by day All the time just I can't go on \n나를 도와줘 누구라도 막을 순 없어 너 그렇게만 있다면 \n아무것도 두려울 것은 없어 내게 솔직하게 말을 해줘봐 \n\n어떻게 생각하니 너에 대한 지금 나의 마음을 모르는 척 하고있니 \n나의 눈을 보면서 말을 해 너를 원치 않는다고 니 맘을 내게 말해봐 \n\n그렇게 말할 수 없는걸 나도 알아 너도 날 원하니까 (그래 이젠) \n한번도 느끼지 못했던 나의 맘을 느껴봐 지금 그대로 (그대로) \n\n* chorus \n\n힘들었다면 내가 짐이었다면 아무 때나 너의 곁을 떠나줄 수 가 있어 \n하지만 너도 나를 사랑하잖아 이런 너를 두고 갈 수는 없어 \n\n* chorus \n* chorus </p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/304/15026304_1323325464584_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130821, lowkey: nil, highkey: nil},
  {album_id: 86, singer_id: 110, team_id: nil, title: "Dear My Love..", genre1: "가요", genre2: "댄스", runtime: "04:03", lyrics: "\n\t\t\t\t\t\t\t<div>Dear My Love.. - 04:03</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">그대에게 조금씩 내 마음을 보여주고 싶어요 \r\n언제나 그대 곁에서 그대를 바라보며 숨겨왔던 나의 그 모든 사랑을 \r\n\r\n그대의 곁에 있던 나의 그 모습을 나의 곁에 항상 있어준 그대만의 모습을 \r\n이제 서로의 소중한 마음으로 조금씩 지켜주고 싶어 사랑하는 맘으로.. 언제나~ \r\n\r\n그대에게는 아직 부족한 나란 걸 알고 있어요 \r\n하지만 그대만을 위한 그런 내 마음만을 이젠 그대에게 모두 주고 싶어요 \r\n\r\nchorus) \r\n서로의 마음만이 중요한 거죠 그대만이 나의 그 사랑을 채울 수 있죠 \r\n수줍은 얼굴로 그대에게 말해요 지켜줘요 다른 누구도 아닌 그대만이 날.. 영원히~ \r\n\r\n그대의 그 어떤 모습도 내겐 너무나 소중한걸요 \r\n그대의 해맑은 미소도 그 눈빛도 내게는 행복인걸요..</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/304/15026304_1323325464584_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130822, lowkey: nil, highkey: nil},
  {album_id: 86, singer_id: 110, team_id: nil, title: "난 (Beat It!)", genre1: "가요", genre2: "댄스", runtime: "03:29", lyrics: "\n\t\t\t\t\t\t\t<div>난 (Beat It!) - 03:29</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">항상 널 그리워했던 늘 눈물뿐이던 내 초라해진 모습을 봤어 \n이제는 더이상 너의 뒤에 있었던 그때 내가 아냐 \n\n가끔씩은 너를 닮아버린 내 모습이 날 힘들게 했지만 \n모든게 변했어 이제 더이상 난 니모습 조차 떠오르지 않아 \n\nchorus) \n난~ 난 너의 눈빛도 난 너의 향기도 난 모두 지웠어 \n더는 다가오려 하지마 이젠 알 수 있어 난 \n니가 없는 세상도 행복할 수 있단 걸 (난 이젠) \n\n오랜 시간이 흘러도 날 볼 순 없어 난 이미 변해버렸어 \n\n가끔씩은 니가 남기고 간 우리 추억이 날 힘들게 했지만 \n모든게 변했어 그 추억 조차도 내 기억속에서 잊혀질꺼야 \n\n* chorus \n\n혹시 너 예전처럼 다시 돌리고 싶다해도 \n이제 내게 조금도 더는 아파야할 가슴조차 남아있질 않아 \n\n* chorus \n\nRap) \nooh ooh baby! I want you back and all of that still ride high when I catch a contact never mind \nwhat I said here to find my way back from the dead oh how your groove still lingers bob my head \nto your curves to the touch of your fingers I be this here rap singer with one last breath left \nto bring her back I'm knowing the odds be stacked but ain't no doubt we're still a match \n\n* chorus \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/304/15026304_1323325464584_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130823, lowkey: nil, highkey: nil},
  {album_id: 86, singer_id: 110, team_id: nil, title: "P.O.L.(Power Of Love)", genre1: "가요", genre2: "댄스", runtime: "05:14", lyrics: "\n\t\t\t\t\t\t\t<div>P.O.L.(Power Of Love) - 05:14</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">내게 말해 줄 수 없니 만남의 의미가 뭔지 왜 또 사랑에 빠지는지 \n나의 맘의 한 부분을 아니 내 마음의 전불 그 모든 걸 넌 가져갔지 \n\n그래 그날 그때 그 장소 처음으로 널 만나기까지의 날들은 \n이젠 생각이 나지 않을 정도죠 시간은 멈추어버리고 너밖엔 누구도 보이지 않아 \n\nI wanna believe in the power of love baby \n빛을 비추어 주길 바래 나의 품안에서 터질것 같은 나의 마음에 \n숨겨온 내 사랑 자꾸만 커져갈뿐 언제까지나 기다릴께 \n나의 두 손으로 잡고싶어 나 느끼고 싶어 사랑이란 마법을 기다릴 꺼야 \n\n이제 그만 가르쳐 줘 만나고 또 헤어지고 이별의 눈물 흘리는 걸 \n외로움의 의민 뭔지 아니 이별이 뭔지도 모르는 채 반복을 하죠 \n\n운명이, 사랑이 있다면 믿을래요 똑같이 반복된 날들에 이젠 안녕을 해야겠죠 \n가까이 다가가 손닿을 거리에 서서 나 이제 널 느끼고 싶어 \n\nI wanna believe in the power of love baby \n내게 용기를 주길 바래 나의 마음속에 달아나 버릴 듯한 나에게 \n너 떠나간 뒤 빈 그 자리 채우기는 너무 허전해 힘들겠지 \n나 말할 수 있어 더 늦기 전에 고백할 꺼야 사랑이란 마법을 난 믿을 꺼야 \n\n그래 그날 그때 그 장소 처음으로 널 만나기까지의 날들은 \n이젠 생각이 나지 않을 정도죠 시간은 멈추어버리고 너밖엔 누구도 보이지 않아 \n\nI wanna believe in the power of love baby \n빛을 비추어 주길 바래 나의 품안에서 터질것 같은 나의 마음에 \n숨겨온 내 사랑 자꾸만 커져갈뿐 언제까지나 기다릴께 \n나의 두 손으로 잡고싶어 나 느끼고 싶어 \n\nI wanna believe in the power of love baby \n내게 용기를 주길 바래 나의 마음속에 달아나 버릴 듯한 나에게 \n너 떠나간 뒤 빈 그 자리 채우기는 너무 허전해 힘들겠지 \n나 말할 수 있어 더 늦기 전에 고백할 꺼야 사랑이란 마법을 난 믿을 꺼야 \n\nI wanna believe in the power of love baby \n내게 용기를 주길 바래 나의 마음속에 달아나 버릴 듯한 나에게 \n너 떠나간 뒤 빈 그 자리 채우기는 너무 허전해 힘들겠지 \n나 말할 수 있어 더 늦기 전에 고백할 꺼야 사랑이란 마법을 \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/304/15026304_1323325464584_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130824, lowkey: nil, highkey: nil},
  {album_id: 86, singer_id: 110, team_id: nil, title: "My Genie", genre1: "가요", genre2: "댄스", runtime: "04:14", lyrics: "\n\t\t\t\t\t\t\t<div>My Genie - 04:14</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">그대 먼저 떠났죠 내게는 아무 말 못하고 그대 가슴속에 사연을 모두 남긴 채 \r\n그렇게 슬픔만 주고 가버린 그대가 미웠어요 나 그대를 위해 눈물만 흘렸어도 \r\n\r\n친구들은 말했죠 조금씩 잊혀질 거라고 잊으려고 노력했어요 미안했었죠 \r\n흐르는 시간 속에서 그대의 기억을 지워봐도 난 버릴 수가 없었어요 \r\n\r\n그 날도 울다 지쳐 잠이 들어 버린 나 날 이끄는 느낌에 눈을 떴어요 그대 나를 깨웠죠 \r\n그대는 별빛아래 환한 미솔 지었어요 행복한 그대 모습 나를 바라보았죠 \r\n\r\nchorus) \r\n그대는 날 떠난 게 아니었어요 날 지켜 주는 수호천사였죠 \r\n램프 속의 요정 지니가 소원을 들어주듯이 \r\n소망을 이뤄주진 못한다 해도 내 바램처럼 나와 함께 했죠 \r\n느낄 수 있어요 내 곁에 머무는 My Genie \r\n\r\n어제 밤 꿈속에서 다시 그댈 만난 나 날 깨우는 온기에 눈을 떴어요 그대 손길이었죠 \r\n\r\n그대는 햇살 속에 내 아침을 열어줬죠 그대와 시작하는 꿈결같은 내 하루 \r\n\r\n* chorus</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/304/15026304_1323325464584_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 10051, song_num: 16130825, lowkey: nil, highkey: nil},
  {album_id: 86, singer_id: 110, team_id: nil, title: "Pain-Love", genre1: "가요", genre2: "댄스", runtime: "03:40", lyrics: "\n\t\t\t\t\t\t\t<div>Pain-Love - 03:40</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">Come on Kiss my baby give away say good-bye baby take in my soul \n\n잊는 다는 건 너무 아픈 일인 것 같아요 그댈 알지 못 했던 나를 다시 찾는 건 \n그렇게 라도 나를 떠나 잊고 산다면 그대 행복할까요 my baby \n\nRap) \nuh- feel the rhythm ride out peep the sound make the world go round \n\nchorus) \n마지막이라는 걸 너도 알고 있다면 사랑했던 기억만을 넌 생각해 \n가버린 날들의 기억을 되살려 하고 싶은 얘기 모두 날리고 떠나가 \n이제 난 알겠어 그댈 믿어왔던 사랑들이 버릴 수 없는 나란 걸 \n\n숨 죽여왔던 차갑게 닫혀진 내 가슴을 두근거리게 만들었었던 \n그런 나를 버린다는 게 미안하지 않나요 어린 내 사랑을 멈춰야만 하는걸 \n\nRap) check out the sound make the world go round let the rhythm ride out \n\n* chorus \n\nRap) yo age be that number got me thinkin' where I've been &amp; where I need to be wit' you \nin some far off place picture white sands &amp; crystal waters us holdin' hands it only gets \nhotter chief rocka number one \n\n그대를 지워야만 하는 거라면 내 기억 모두 가져가요 \n\n가버린 날들의 기억을 되살려 하고 싶은 얘기 모두 날리고 떠나가 \n이제 난 알겠어 그댈 믿어왔던 사랑들이 버릴 수 없는 나란 걸 \n\nCome on Kiss my Baby give away say good-bye baby take in my soul \nCome on Kiss my Baby give away say good-bye baby take in my soul   \n\n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/304/15026304_1323325464584_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130826, lowkey: nil, highkey: nil},
  {album_id: 86, singer_id: 110, team_id: nil, title: "Happiness Lies", genre1: "가요", genre2: "댄스", runtime: "03:55", lyrics: "\n\t\t\t\t\t\t\t<div>Happiness Lies - 03:55</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">친구하고 둘이 그냥 여행가고 싶다 하길래 \n난 그렇게 보낸 거야 널 믿었던 그 만큼 \n\n눈뜨면 아쉬움에 난 그곳 일기 예볼 보며 \n애절한 마음도 어느새 잊고 지낸 어느날 \n\nchorus) \n갈색 얼굴로 나타난 그녀와 똑같은 너의 모습에 \n순간 난 한눈에 보았지 여태 니가 말한 친구는 그녀였던걸 \nIf you want your freedom now 두 여자를 왔다 갔다 \nIf you want to play those games 완벽했지 \nRing ring ring on the telephone 친구라고 말은 하지만 \n(It's) that where happiness It's that where happiness lies~ \n\n그녀하고 있을 때도 아무런 걱정 없겠지 \n그 시간에 내 전화는 또 친구라면 될 테니 \n\n* chorus \n\nIt's there where happiness lies 그녀한테는 날 숨긴 너 \nIt's there where happiness lies 이제는 선택해 me &amp; her~ \n\nRing ring ring on the telephone Knock knock knock on the front door \nFind and see jump the pager Just give me an answer \n\nLie lie lie is all that you go Why why why should I listen to you \nTry try try walking in my shoes Is it me or her \n\nchorus 2) \nIf you want your freedom now 두 여자를 왔다 갔다 \nIf you want to play those games 완벽했지 \nRing ring ring on the telephone 친구라고 말은 하지만 \n(It's) that where happiness It's that where happiness lies~ \n\n* chorus 2 \n\nIf you want your freedom now If you want to play those games \n\nRing ring ring on the telephone \n(It's) that where happiness It's that where happiness   \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/304/15026304_1323325464584_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130827, lowkey: nil, highkey: nil},
  {album_id: 86, singer_id: 110, team_id: nil, title: "Realize (Stay With Me)", genre1: "가요", genre2: "댄스", runtime: "04:16", lyrics: "\n\t\t\t\t\t\t\t<div>Realize (Stay With Me) - 04:16</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">언제나 멀리서 바라보고 있던 나 그렇게 널 기다려왔던 난 \n너에게는 그런 나의 모습도 아무런 느낌 없겠지 \n\n언제나 아무렇지 않은 듯 아무 느낌도 없는 것처럼 \n너를 사랑하는 마음 속여가며 그렇게 네 곁을 맴돌았지만 \n\nchorus) \n너무나 사랑하는 그댈 곁에 두고싶은 난 \n이렇게 기다리는데 이렇게 널 원하고 있는데 \n이젠 내게 다가와 이렇게 널 애타게 기다리고 있는 내게로 \n\nRap) 오늘도 나 이렇게 너만을 기다리며 우리 함께 했던 모든 시간 떠올리며 \n그렇게 나 너만을 원해 huh 이렇게 나 너만을 그리고 있어 더이상의 망설임은 이제는 없어 \n여기서 널 기다리는 나를 바라봐 조금씩 천천히 내게 다가와 줘 그리고 날 안아 줘 \n\n너에게 내 마음을 보여 주고 싶어 솔직한 날 보여 주고 싶어 \n이렇게 나 너를 바라보는 기다림의 끝에 서있어 \n\n조금씩 커져가는 사랑에 힘들어져만 가는 나에게 \n이젠 조금씩 너의 마음을 열어 이젠 조금씩 내 모습 바라봐 \n\n* chorus \n\n너 없이 보냈던 날들 혼자 너를 그리워했던 나 \n이젠 어떤 것도 그 모든 시간도 너와 함께 할 수 있게 해줘 \n\n* chorus \n* chorus</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/304/15026304_1323325464584_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130828, lowkey: nil, highkey: nil},
  {album_id: 86, singer_id: 110, team_id: nil, title: "Azalea", genre1: "가요", genre2: "댄스", runtime: "04:38", lyrics: "\n\t\t\t\t\t\t\t<div>Azalea - 04:38</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">그대는 모르죠 내 거짓미소 \r\n애써 숨겨온 나의 사랑이 그댄 걸 그는 모르죠 \r\n\r\n어쩌다 흘린 듯한 짧은 눈빛에 \r\n일기장 가득 써 내려갔던 그대 이름이 날 아프게 해 \r\n\r\nchorus) \r\n왜 아직도 그대로니 다짐했잖아 \r\n늘 나의 사랑은 내 안에 있는데 넌 나의 그림자 \r\nhold me tight I can see in your eyes 원하는 날 돌아 봐줘 \r\nhere I'm waiting for you until you look at me 이렇게 기다리는걸 \r\n\r\n우연히 알게된 너의 번호 \r\n아무런 말도 하지 못해서 나에게 화도 났겠죠 \r\n\r\n아련히 들리는 웃음소리에 \r\n멀리서 바라만 보고있는 나의 모습이 날 아프게 해 \r\n\r\n* chorus \r\n\r\nTell me how you feel I'm waiting for you \r\n내겐 한 사람 너 하나 뿐이니 \r\n\r\n그대 항상 뒤에 있는 나를 이제 알아주길 \r\n이렇게 항상 기도 할테니 \r\n\r\nhold me tight I can see in your eyes 원하는 날 돌아 봐줘 \r\nhere I'm waiting for you until you look at me 이렇게 기다리는걸</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/304/15026304_1323325464584_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130829, lowkey: nil, highkey: nil},
  {album_id: 86, singer_id: 110, team_id: nil, title: "Listen To My Heart (Bonus Track)", genre1: "가요", genre2: "댄스", runtime: "03:55", lyrics: "\n\t\t\t\t\t\t\t<div>Listen To My Heart (Bonus Track) - 03:55</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">Woo baby 무엇을 보고 있어 거꾸로 불어오는 바람 너머 \n저 눈에 비친 미래에 그려진 하늘은 Oh 어디에 \nWoo baby 외로웠던 밤을 지나 오래된 습관처럼 \n전화해도 떠나지않아 내 곁에 투명한 외로움 흩어지는 \n\nchorus) \nNever say ever say never ever say Woo 시간의 빛깔을 따라 커져가고 \nEvery night every night never ever say 보이지 않는 마음의 끝이여 \nListen to my Heart looking for your dream \n원하고 있는 그 곳에선 자유로운지 꿈을 그리는 그대 곁에 내가 있나요 \nListen to my Heart looking for your dream \n멈추지 않는 바람 끝에 속삭여지는 빛의 노래를 따르고있어 \n\nWoo baby 한 번 더 생각해도 후회 만으로만 남길 수는 없어 \n흔히 맴도는 생각에 들리지 않게 내 맘 전해 \nWoo baby 사랑이라는 말 조차 무거운 느낌 말할 수 없지만 \n널 바라보고 싶어져 나만을 향하게 하고 싶어 \n\nNever say ever say never ever say Woo 서로가 다른 내일이라 해도 \nEvery night every night never ever say 잊지는 않아 너의 눈동자 \n\nListen to my Heart looking for your dream \n우연 속의 이 길을 따라 닿을 시간은 어디쯤인지 부드럽게 담아 주겠니 \nListen to my Heart looking for your dream \n감춰진 거리 어딘가로 나를 부르는 따뜻한 바람 눈뜨는 곳에 \n\n* chorus \n\nListen to my heart looking for your dream Listen to my heart looking for your dream \nListen to my heart looking for your dream Listen to my heart looking for your dream \nEvery night every night never ever say Listen to my heart looking for your dream \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/304/15026304_1323325464584_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130830, lowkey: nil, highkey: nil},
