  {album_id: 88, singer_id: nil, team_id: 31, title: "잊지 못해", genre1: "가요", genre2: "전체", runtime: "03:32", lyrics: "\n\t\t\t\t\t\t\t<div>잊지 못해 - 03:32</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">기억하고 싶진 않았어 지나간 너의 모습마저도 아픔만이 내게 찾아올뿐야 \n되돌리려하지 말아줘 내게 말을 해봐 너의 그런 태도는 내겐 바보 같은 변명인걸 \n\n너는 모르겠니 이런 나의 마음을 say my love 왜 변해 간거야 잊지 못해 \n니가 한 지난 기억들은 이쯤에서 너에게 돌려줄거야 \n잊지 못해 언제나 함께한 우리의 지난 추억을 보내야 할 내맘의 상처도 난 그렇게 떠나 보냈지 \n나와의 아픈 기억마저도 이런 날 넌 이해할 수 없겠지 \n내가 원한게 아니잖아 내게 말을해봐 너의 그런 태도는 내겐 바보같은 변명뿐인걸 \n\n너는 모르겠니 이런 나의 마음을 say my love 왜 변해간거야 잊지 못해 \n니가 한 지난 기억들은 이쯤에서 너에게 돌려줄거야 \n잊지 못해 언제나 함께 한 우리의 지난 추억을 보내야해 내 맘의 상처도 가까이 보고싶어 많이 울기도 했어 \n이런 나에게 넌 이럴 수가 있니 말도 안되는 일인거야 잊지 못해 \n니가 한 지난 기억들은 이쯤에서 너에게 돌려줄거야 \n잊지 못해 언제나 함께한 우리의 지난 추억을 보내야해 내 맘의 상처도 \n\n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/306/15026306_1323074527738_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130853, lowkey: nil, highkey: nil},
  {album_id: 88, singer_id: nil, team_id: 31, title: "내게로", genre1: "가요", genre2: "전체", runtime: "04:09", lyrics: "\n\t\t\t\t\t\t\t<div>내게로 - 04:09</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">내가 널 처음 본 그날에 너의 포정 속에 숨겨져 있던 슬픈 상처를 너의 허락없이 난 보았어 (in my mind) \n지금도 생각하고 있니 널 아프게만 했던 그녈 지울순 없어 가슴 안에 사랑으로 키우고있니 \n\nI wanna be your love (be your love)love me bebe \n더이상 너만의 상처가 아니야 매일 눈물로 가득차있는날 안아줘 나를 사랑해줘 \n우리 만난지도 일년돼 하루하루 속에 나의 기쁨이 슬퍼 보이니 그건너의 슬픔 때문인걸 (in my mind) \n지금도 널기다리고 있어 널사랑하게 했던 그녈 원망 못허고 너의 맘이 내게 돌아오길 기다려 \n\nI wanna be your love (be your love)love me bebe \n이제는 너의 마음을 내게줘 항상 너만을 바라보는 내게 애태우지말고 내게로 \nI will be there for you (be your love) love you bebe \n더이상 너만에 상처가 아니야 매일 눈물로 가득차있는 날 안아줘 사랑해줘 아프게 하지마 \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/306/15026306_1323074527738_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130854, lowkey: nil, highkey: nil},
