  {album_id: 90, singer_id: nil, team_id: 31, title: "Intro (Dear My Friend)", genre1: "가요", genre2: "전체", runtime: "00:38", lyrics: "\n\t\t\t\t\t\t\t<div>Intro (Dear My Friend) - 00:38</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가사 정보가 없습니다.</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/308/15026308_1323074757068_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130862, lowkey: nil, highkey: nil},
  {album_id: 90, singer_id: nil, team_id: 31, title: "편지 (The Letter)", genre1: "가요", genre2: "전체", runtime: "03:47", lyrics: "\n\t\t\t\t\t\t\t<div>편지 (The Letter) - 03:47</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">시린 세상 눈물 속에 지웠던 사랑보다 소중했던 우정이 \n내 가슴에 흰 겨울 첫눈처럼 남아서 \n오늘 흐린 세상 아래 내리네 \n그땐 널 많이 의지했어 내 방 가득 채운 촛불처럼\n따뜻했던 너의 미소로 모두 다 감싸주면서 \n말없이 안아주었어 \n\nOh,My Friend 널 보내지 않아 너도 잘 알잖아\n내 영혼의 집을 네 맘에 지어 놓은 걸\n기억해줄래 너의 마음 안에서 나 사는 날까지 \n우리 예쁜 맘 바라봐 주길 바래\n\n기억들이 변해 가는건 별이 지고 해가 멀어지고 \n달이 지는 시간들처럼 당연해\n하지만 우리 추억은 보낼 수 없어\n\nOh,My Friend 널 떠나지 않아 너도 잘 알잖아\n내 영혼의 집을 네 맘에 지어 놓은 걸 \n잊지 말아 줘 너의 마음 안에서 나 사는 날까지 \n우리 예쁜 맘 바라봐 주길 바래\n\n나에게 가장 소중한 것 너에게만 전하고 싶어 \n너의 방 창가 위에서 빛나는 푸른 별처럼\n널 보내지 않아 너도 잘 알잖아 \n내 영혼의 집을 네 맘에 지어 놓은걸 \n\n기억해줄래 너의 마음 안에서 나 사는 날까지 \n우리 예쁜 맘 바라봐 주길 바래\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/308/15026308_1323074757068_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130863, lowkey: nil, highkey: nil},
  {album_id: 90, singer_id: nil, team_id: 31, title: "S. II. S (Soul To Soul)", genre1: "가요", genre2: "전체", runtime: "03:33", lyrics: "\n\t\t\t\t\t\t\t<div>S. II. S (Soul To Soul) - 03:33</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">두 가지 가슴과 두 영혼들을 가진 나를 느꼈죠... \n부끄러워 숨지만 또 다른 내가 \n그댈 원했던 걸요... 허락해 줘요 \n\n*Baby, not enough, not enough baby.. \n그 눈물로 나를 적셔요 \n난 거부할 수 없었죠.. My goody love... \n그의 사랑이, 마력이 나를 구름위로 날려버려요 \n아직도 모자란걸 그댄 알 수 있겠죠 \n\n그대만이 나에게, 세상을 다 가진 것보다 \n더 소중한 가치가 있단 걸 알게 했죠 \n음~ 그대만의 나에겐 더 이상 두려울 필요가 없어..난 그냥 나를 맡긴 채 \n\nBaby, not enough, not enough baby.. \n그 눈물로 나를 적셔요 \n난 거부할 수 없었죠.. My goody love... \n그의 사랑이, 마력이 나를 구름위로 날려버려요 \n아직도 내가 어리다고 말할 건가요 \n\nBaby, little more, little more baby.. \n눈을 뜰 수조차 없어요 \n꿈속에 들어와 버린 건 아닌지.. 잠든 건지 \n그대 안의 나, 내 안의 그대.. \n우리 하나란 걸 알겠죠.. \n더 이상 내가 알던 세상이 아닌 거죠 \n\n오늘밤은 잠을 이룰 수가 없을 거예요... \n달 그림자에 누워 기억할 수 있는 그대 모든 것.. \n내 가슴에 새겨, 잊을 수 없게 \n\n*Repeat \n\nBaby, little more, little more baby.. \n눈을 뜰 수조차 없어요 \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/308/15026308_1323074757068_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130864, lowkey: nil, highkey: nil},
  {album_id: 90, singer_id: nil, team_id: 31, title: "Season In Love", genre1: "가요", genre2: "전체", runtime: "03:37", lyrics: "\n\t\t\t\t\t\t\t<div>Season In Love - 03:37</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">You! 조금 더 가까이 있어 줘 긴 시간을 지나치게 하지마 \nOh! 당신만 내 곁에 있으면 아무것도 나는 두렵지 않아요 \n\n잠든 너의 꿈속으로 찾아갈께 네가 알 수 없게 \n슬픔의 어둔 밤은 깊어 가지만 저 끝은 보여요 \n\n엇갈린 시간 속 상처받은 나의 지금처럼 \n이 세상 속에 넘친 사랑 많지만 이젠 너와 함께 \n\n*Repeat \n\n언제나 웃고 있던 당신의 모습 지금은 슬프네요 \n아무것도 말하지 않는 계절은 우릴 지나쳐 가고 \n\n넘치는 눈물의 밤을 지내고 쓰러질 듯 해도 \n사라지지 않는 나의 생각은, 이젠 너와 함께... \n\n*Repeat \n\nOh Baby Love! I'll be on your side And be my love! Season in my heart \n만날 수 없어 잠시 외로운 순간에도 당신을 느껴요 \nBetween Us, Endless Time.. \n\n*Repeat \n\n**You! 조금 더 가까이 있어 줘 긴 시간을 지나치게 하지마 \nOh! 당신만 내 곁에 있으면~ \n\n**Repeat \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/308/15026308_1323074757068_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 10453, song_num: 16130865, lowkey: nil, highkey: nil},
  {album_id: 90, singer_id: nil, team_id: 31, title: "샤랄라 (Sharala)", genre1: "가요", genre2: "전체", runtime: "03:22", lyrics: "\n\t\t\t\t\t\t\t<div>샤랄라 (Sharala) - 03:22</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">*Woo∼ Don't turn around, cause we're into me and you, \nWoo∼ Don't bring me down, cause I'll be yours forever \n\n이제 그만 널 잊는다는 게 한참이나 난 외롭겠지만 \n기다려 니가 오기를 까만 밤이 희게 새도록 \n\n기억 속에선 너의 향기가 내 꿈속에선 너의 목소리 \n`Beautiful Lady` 내 귓가에 들려오는데 \n\n**Say `I love you`, Come back to me 외로움 속에서 울지 않을께 \n떠나지마 돌아와 줘 널 기다리고 있는 내게로 \n\n연기처럼 하얗게 번지는 행복했던 너와의 기억이 \n조금씩 눈물이 되어 나의 뺨에 흘러내릴 때 \n\n어디선가 넌 날 기억할까 함께 듣던 음악이 흐르면 \n또다시 그리워 나에게로 올 것만 같아 \n\n**Repeat 샤랄라라∼ 샤랄라라~ oh yeah \n\n*Repeat 샤랄라라∼ 샤랄라라~ \n떠나지마 돌아와 줘 널 기다리고 있는 내게로 \n   \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/308/15026308_1323074757068_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130866, lowkey: nil, highkey: nil},
