  {album_id: 90, singer_id: nil, team_id: 31, title: "Love Game", genre1: "가요", genre2: "전체", runtime: "04:27", lyrics: "\n\t\t\t\t\t\t\t<div>Love Game - 04:27</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">Tell me, Tell, Tell, I want to know baby what to do Can you hear me \n\n도대체 너 왜 이러는지 속 시원히 말 좀 해봐 \n한두번 이런 게 아니잖아 무슨 얘기 좀 해봐 \n\n아침부터 거울 앞에 앉아 종일 니 전화만 기다렸지 \n몇 시간째 아무 연락도 없고 전화도 받질 않아 \n\n*이제는 나도 정말 지쳐버렸어 애정이 식은거니 아니면 뭐니 \n그 못된 바람이라도 피는거니 이렇게 헤어지긴 싫은데 \n만난 지 얼마나 됐다고 이러니 나 더 이상 참고 싶지 않아 나만큼 너도 힘들게 \n해 줄 거야 \n\nYou've gotta tell me now \nI wanna know oh~ You better, You better tell me what to do \n\n수없이 전활 걸었을 때 잠이 덜 깬 니 목소리 \n그제서야 달려오면 뭐해 기분이 영 아닌데 \n\n미안하단 말은 필요 없어 너의 변명도 난 듣기 싫어 \n애교로 봐줘도 한두번인데 벌써 넌 몇 번째니 \n\n**이제는 나도 정말 할말이 없어 니 맘이 떠난거니 아니면 뭐니 \n어느새 다른 여자가 생긴거니 난 정말 헤어지긴 싫은데 \n만난지 얼마나 됐다고 이러니 나 더 이상 이해할 수 없어 나만큼 너도 힘들게 \n해줄거야 \n\n너 처음엔 이러지 않았잖아 언제나 날 챙겼잖아 \n어떤게 진짜 너인건지 도무지 알 수가 없잖아 \n\n*Repeat **Repeat \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/308/15026308_1323074757068_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130868, lowkey: nil, highkey: nil},
  {album_id: 90, singer_id: nil, team_id: 31, title: "Happiness", genre1: "가요", genre2: "전체", runtime: "03:20", lyrics: "\n\t\t\t\t\t\t\t<div>Happiness - 03:20</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">패션이 뭔지 몰라 헤메는 일상에 기회를 줘 \n탱탑에 멋진 몸매와 그대만의 눈빛 또 특별한 칼라 \n\n너의 눈에 선, 거울 앞에 선 누가 서있는지 잘 느껴봐 \n넌 이제 알아, 너도 그 안에서 달라진 너를 볼 수 있는걸 \n\n*이제는 Happiness 나만의 Happiness 니 모습 그대로를 내게 보여 줘 \n이제는 Happiness 나만의 Happiness 니 안에 담겨있는 자신을 봐줘 \n\n너에겐 관심 없을걸 그 세상은 잊고 떠나버려 \n내일의 모든 일들을 다 자신 있게 해 별거 아닌거야 \n\n사진 속에서, 그 기억 속에서 바보 같은 니 표정 지워봐 \n알고 있니 넌 이 세상 속에서 몇 안 되는 멋진 여자란 걸 \n\n*Repeat \n\n이제는 보이니 행복이라는 건 가까이 있는 걸 \n저 붉은 태양도 니 마음속에서 빛나고 있잖아 \n\n*Repeat *Repeat \n\n   \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/308/15026308_1323074757068_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130869, lowkey: nil, highkey: nil},
  {album_id: 90, singer_id: nil, team_id: 31, title: "꿈을 모아서 (Just In Love)", genre1: "가요", genre2: "전체", runtime: "05:01", lyrics: "\n\t\t\t\t\t\t\t<div>꿈을 모아서 (Just In Love) - 05:01</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">그대에게 줄께요 나의 모든 사랑을 세상에서 오직 하나뿐인 당신을 위해서 \n당신에게 줄께요 우리 헤어져 있어도 \n아름다운 미소로 다가오는 매일을 \n\n오래도록 기다려왔었던 사랑은 따뜻한 바람 타고 \n잠에서 깬 나무들 속에서 순결한 꽃잎처럼 빛나고 \n이제 태어나는 구름 이제 피어나는 꿈들이 \n메말았던 이 세상에 아름다운 색으로 내리고 있는걸 \n\n당신과 걸어가요 꿈을 모두 모아서 저 하늘 속으로 내 마음 모두 담아둘께요 \n당신과 걸어가면 보이지 않던 미래도 \n너무 밝게 우리를 비춰주기 때문에 \n\n기다림을 모르는 사람들 세상에 모두 등을 돌리지만 \n무너져버릴 것 같은 추억 모두의 작은 두 손 가득히 \n내가 간직해온 시절 그땐 무얼 사랑했었나 \n기억나요 두려움에 아무것도 나는 믿을수 없었지만 \n\n그대에세 줄게요 나의 모든 사랑을 세상에서 오직 하나뿐인 당신을 위해서 \n당신에게 줄께요 우리 헤어져 있어도 \n아름다운 미소로 다가오는 매일을 \n\n눈물이 왜 흐를까요 \n태양이 저무는 곳에서 \n저 석양이 질 때까지 그 빛이 모두 사라져 버릴때까지 \n\n당신과 걸어가요 꿈을 모두 모아서 저 하늘 속으로 내 마음 모두 담아둘께요 \n당신과 걸어가면 보이지 않던 미래도 \n너무 밝게 우리를 비춰주기 때문에 \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/308/15026308_1323074757068_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130870, lowkey: nil, highkey: nil},
