  {album_id: 91, singer_id: nil, team_id: 32, title: "First Love", genre1: "가요", genre2: "댄스", runtime: "04:21", lyrics: "\n\t\t\t\t\t\t\t<div>First Love - 04:21</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">First love.. \nThis song is dedicated to my one and only love \n\n보이니 아직은 어린 조금은 서툰 내 사랑이 느껴지니 \n너도 들리니 어설프지만 내 맘을 전하는 \n나의 작은 기도소리 들리니 \n내 손끝에 내 눈 끝에 항상 널 느껴 \n어떤 말로 이 느낌을 다해 자꾸 웃는 내 모습이 \n이상한가봐 너도 보면 웃을 꺼야 바보 \n눈을 감으면 꿈속으로 와 잠시도 떨어지기 싫거든 \n아침이 오면 달려갈 꺼야 비오는 그런 날이라도 워우워- \n소중한 네 목소리로 내 하루를 깨워줄 너 \n그래서 편안하게 난 잠들 수 있어(uh-) \n정말 난 고마워 가슴으로 안아줘서 \n너로 인해 세상이 아름다워져 \n\nGet ready girl like I suppose to I pitty the punk, supersprung You \nBring the bomb, From Collaborated, There be all about the bigger the figure \nI trigger lyrics ever the drum \n\n너무, 사랑스런, 아름다운, 소중한 내 First Love \n그 누구도 우리의 사랑 앞을 막을 수는 없어 \n나는 너를 지켜 입가에 맴돌던 내말 다 전하지 못해 \n속상하게 그냥 돌아섰는데 멀리서 널 부르던 넌 \n이렇게 말했어 말 안해도 너의 맘 맘 다 알아 \n우리 둘이서만 사진 찍어 내 방에 붙일래 \n늘 곁에 있게 내 전화에 너의 목소리도 담을래 놓칠 순없어 \n단 한번뿐인 소중한 첫사랑이 될 테니(워예-) \n누구보다도 행복한 날들 \nWe can make love and make it through night 오워예~ \nThink about it girl, all those things, \ncame to be as a great blessing' \ncause of you girl, my first love. \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/309/15026309_1323223876035_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 9000, song_num: 16130877, lowkey: nil, highkey: nil},
  {album_id: 91, singer_id: nil, team_id: 32, title: "All Your Dreams (Remix)", genre1: "가요", genre2: "댄스", runtime: "04:22", lyrics: "\n\t\t\t\t\t\t\t<div>All Your Dreams (Remix) - 04:22</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">어느 날 갑자기 나의 모든 것 환상처럼 한꺼번에 모두 다 사라져 버렸지 \n웬지 세상 모든게 다 나를 미워해 정말로 이렇게 패배자로 살고 싶지 않아 \n학벌 없고 돈과 지위도 없고 이변 없는 Lets go to shelter place!!! \n이제는 모든 걸 버리고 떠나 갈 시간이 왔어. 나의 영혼은 자유로워지는 거야 \n그렇게 찾아온 불행 죽음을 불러오는 고통 자신있는 모습으로 맞서 싸워 이겨 \n너만이 너의 고민을 해결할 수 있어 그렇게 무너진 모습 예전에 너는 아닌거야 \n시작해(시작해) 다시 일어나(일어나) 다시 살아가는 것이 두려운가? Shut up! \n어떻게 내 마음을 이해해 영화에서도 소설에서도 있어왔던 일들 언제까지 \n남의 일인 줄만 알았어 Cheer up! 생각해 우릴 타오르게 한 그 지난날 못난 나에게 \n뭐가 남아 있는데 이런 나에게 이런 나에게 I remember all of your dreams \n자신 있게 꿈꾸던 그때 눈빛도 너 이루는 그날까지 포기는마 다시 시작해 \n아무도 나에게 묻지 않았지 괴로운지 두려운지 도대체 뭐가 문젠지 \n이젠 세상 누구도 난 이해 못하나 떠나간 너에게 모든 핑곈 대고 싶진 않아 \n망가진 미래 날 바라보는 가족 무능한 나 Lord, What your doing to me!!! \n지금껏 나의 조건만을 사랑했었니 그럴 땐 우리가 있어 넌 결코 혼자가 아니야 \n고통 한번 찾아오지 않는 삶은 없어 이보다 더욱 괴로운 순간이 올 수도 있어 \n그럴 땐 내일을 믿어 내 꿈이 이뤄진 그날을 생각해(생각해) 다시 기억해(기억해) \n다시 살아가는 것이 두려운가? 그래 또 다시 키워갈 나의 꿈을 위해 \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/309/15026309_1323223876035_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130878, lowkey: nil, highkey: nil},
  {album_id: 91, singer_id: nil, team_id: 32, title: "해결사 (The Solver)", genre1: "가요", genre2: "댄스", runtime: "03:39", lyrics: "\n\t\t\t\t\t\t\t<div>해결사 (The Solver) - 03:39</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">Intro Rap \nYou never give up. the more passion easy come and easy go \nYou never give up. the more passion easy come and easy go \n\nChorus \n마지막까지 난 너를 포기할 순 없어 더 이상 주저하지마 \n다시는 쓰러지지 않게 또 우린 다시 일어서야 해~ \n\n1st Rap \n\n어쩌다가 이 사회가 이리됐을까 이젠 그 누구에게도 보장받던 삶은 갔어 \n주머니 속의 빈곤은 곧 따뜻했던 가슴속의 빈곤들로 이어지고 \n그 누구도 믿을 수가 없어 다른 사람에게 양보해 줄 수도 없어 \n나 하나가 잘살기도 힘든 세상이니까 다 욕심이 넘쳐 욕심이 넘쳐 \n\n2nd Rap \n남을 배려하는 마음이 모두 사라지고 착한 너의 목이 조여지고 있어 \n맥없이 다들 맥없이-공든 탑의 무너짐을 바라보았어 모든게다 하나같이 \n혼돈의 수렁 속에 깊이 잠겨 있어 우린 누군가가 필요해- 절대적인 힘을 \n가진 해결사를 원해 \n\nCHORUS (REPEAT) \n\nBridge Rap \n모두 바꿔 싹-뜯어고쳐 이 시대의 권위주의 모순 속에 \n더 이상 병들지 않게 더 시들지 않게 \n\nGet up your soul power be like mine \n\nD.part \n굳게 닫혔던 마음을 열고서 세상을 둘러봐-- \n바로 지금의 그대의 모습을 넌 찾고 있었던 거야 \n\nCHORUS (REPEAT) \n\n3rd Rap \n더 이상 그대여 더 이상 이제는 앞만 보지 말고 다시 한번 옆으로 돌아봐 \n그대가 잃고 사는 것이 어쩌면 그대의 순수한 영혼일지 몰라 \n자신을 믿고 타인을 믿고 소중한 인간성을 잃어 가지 말고 다시 일어서 \nNever꺾이지 않는 의지-- 고결한 그대의 투지를 보여줘 \n\nCHORUS (REPEAT) \nOUTRO (REPEAT) \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/309/15026309_1323223876035_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130879, lowkey: nil, highkey: nil},
  {album_id: 91, singer_id: nil, team_id: 32, title: "Falling In Love", genre1: "가요", genre2: "댄스", runtime: "04:10", lyrics: "\n\t\t\t\t\t\t\t<div>Falling In Love - 04:10</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">Tryin' to remember all the times we had in our days \nknow I just can't help fallin' in love with you \n\n눈뜨면 바라봐요 우리 사랑이 보여지나요 \n그대만 바라보면 내 마음이 행복해 \n\n가만히 들어봐요 우리 사랑이 느껴지나요 \n그대 있음으로 난 하루를 살아요 \n\n나 그대 영원토록 바라보며 살께요 \n나 그대 사랑해요 Just Falling in love with you \n\n오늘도 난 그대 생각에 젖어 있는 걸요 (Oh tell me) \n이런 기쁨을 내게 보내 준 하늘이 난 (Oh baby) 고마워 \n\n아침이 오면 난 그대 숨결이 느껴져요 \n하루에도 몇 번씩 그대보고 싶은 나 \n\n나 그대 영원토록 바라보며 살께요 \n나 그대 사랑해요 Just Falling in love with you \n\n이젠 마주 바라보며 그래요 \n언제나 함께 해요 and I now \n느끼는 사랑이죠 내 가슴속에 언제까지나 \n\n나 이제 약속해요 감사하며 살께요. 나 그대 사랑해요 \nJust Falling in love with you (Just Falling in love ) \nJust Falling in love with you \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/309/15026309_1323223876035_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130880, lowkey: nil, highkey: nil},
  {album_id: 91, singer_id: nil, team_id: 32, title: "Only One", genre1: "가요", genre2: "댄스", runtime: "03:52", lyrics: "\n\t\t\t\t\t\t\t<div>Only One - 03:52</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">Oh! Come on baby, (My) heart beating tonight- \n지금 너에게로 가까이 난 다가갈거야 \nI've been waiting! You make me crazy \n너를 처음 만난 그 순간부터 \n\n멀리 있어도 자꾸 네가 보여 그 작은 환상에서 깰 수 없게 날 데려가봐 \n너를 알수 있게해봐 이모든 것이 나 혼자의 꿈인걸 yeah- \nShes only one! 그댈 차지하고 싶어. 끝까지 포기 난 못해 \nMy dearlin shes only one! 내 인생 끝까지 \n오 내 여자로 만들겠어 \n\nrap) \n어제 너의 사서함을 봤나? \n너의 손에 코미를 끼워 봤나? \n그건 너를 위한 나의 디디다! 디디다! \n그대 작은 손에 나를 끼워지고 싶다. \n그래 언제까지 외면할 수 있나 \n나를 피해 도망가려 하면 할수록, 언제나 너의 뒤를 스쳐가는 시선을 느껴라 \n네가 쓰는 샴푸를 나는 알아, 즐겨찾는 줌이 어딘지도 알아 \n멀리 가지마 넌 혼자가 아니야 난 너의 품안에 살고 있어 \n하늘은 느껴 정해진 너의 운명 같이 \n그것 만이 네 인생을 찾는길 yeah \n\nshes only one! 그댈 차지하고 싶어 \n끝까지 포기 난 못해 \nMy darlin shes only one! \n내 인생 끝까지 오-! 내 여자로 만들겠어 \n\nDon't go away from me, I must ganna get you- \nmy heart is so deep - \n모두 상관없어 나를 거부해도 넌 막을 수가 없어 이젠 \n내게 열어줘 너의 마음을 이제 그만 내가 들어갈수 있게 \n그댈 느낄 수가 있게 네게 보여줘 너의 사랑을 \n이제 그만 내가 편히 쉴 수 있게 언제까지 그럴건데 \n\nshes only one! 그댈 차지하고 싶어 끝까지 포기 난 못해 \nMy darlin shes only one! 내 인생 끝까지 \n오 내 여자로 만들겠어 \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/309/15026309_1323223876035_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 8901, song_num: 16130881, lowkey: nil, highkey: nil},
  {album_id: 91, singer_id: nil, team_id: 32, title: "Yo (악동보고서)", genre1: "가요", genre2: "댄스", runtime: "03:55", lyrics: "\n\t\t\t\t\t\t\t<div>Yo (악동보고서) - 03:55</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">We return to the battle ground! we are the 신화! \n\n그대가 서 있을곳이 아니야 살아서 숨쉬는 것을 느껴봐 \n종이 울린다 문이 열린다 내 인생을 후회없이 살아보고 싶은 꿈이 열린다 \n1999, (my) dream it's come again-like birdy. the birdy, boom boom track \n\n너는 인정해 줄 사람하나 없는 바보 너는 그 누구도 배려하지 않는 바보 \n내가 왜 악동이 됐나 사랑하는 법을 가르치는 곳이 하나 없어 \n\n*Yo 너 뭐될래 진짜 니 맘대로 살아갖고 뭐 할래 \n너는 언제나 니 멋대로 하고 싶고 살고 싶고 다들 무시하잖아 \nYo 너 뭐될래 진짜 니 맘대로 살아갖고 뭐할래 \nDo you live for me niggas answer me 모든걸 잃어버린 실패자가 되지마 \n\nMoney and power to dust to dust 오직 그것만을 쫓는자가 되지 않아 \n세상에서 내가 해줄 몫이 있어 오직 나만이 나만이 할수 있는 멋진 job이 있어 \nrap a rock 신화 daddy's home 그 어떤 것보다 소중한거야 \n너를 다른 곳에 맞출 필요없어 Boogie down baby check it boogie down baby \n\n내가 왜 악동이 됐나 나를 반항하게 하는 자가 누구야 \n본보기는 없다 표본도 없다 타인 아닌 나를 완성하고 싶다 \n\n꿈이 있죠 하늘보다 높은 그런꿈이 있죠 나는 알고싶어요 \n내 뜻대로 밀고 나갈 자신감들만 줄수 없나요 \n\n* Repeat \n\n실패하지 않는 자는 없다 물러서지 않고 맞서 극복하는 인간 \n보다 그 이상의 아름다움 없을 뿐이다 나를 믿어야만 한다 \n\n* Repeat \n\n나에게 사랑과 존경하는 법을 가르칠 수 없나요 \n내 뜻대로 홀로서는 법을 알게 해줄 마음이 없나요 \n\n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/309/15026309_1323223876035_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 8209, song_num: 16130882, lowkey: nil, highkey: nil},
  {album_id: 91, singer_id: nil, team_id: 32, title: "천일유혼 (Sharing Forever)", genre1: "가요", genre2: "댄스", runtime: "03:54", lyrics: "\n\t\t\t\t\t\t\t<div>천일유혼 (Sharing Forever) - 03:54</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">나를 진정 원하시면 언제든지 널 따라가겠어 \n내 인생을 한순간도 너를 잊고 살아 본적 없어~~~ \n\nChorus&gt; in the night this so right holding your body \ntight close to me close to you baby-- \n모든게 꿈같아 너를 잃는다는 게...단 한번만 그대를 안고 싶어 \n\n내 곁에서 너 떠나간 후 매일 밤 꿈속에 널 봤어-baby \nyou don't be scared you don't be shy \n다신 너를 혼자 두지 않겠어.. \n\nbridge&gt; 왜 하늘은 나에게 이 시련을 주는지 오 내사랑 떠나지마 \n너 있는 곳에 날 데려가 줘 \n\nChorus&gt; in the night this so right holding your body \ntight close to me close to you baby-- \n모든게 꿈같아 너를 잃는다는 게...단 한번만 너를 안을 수 있다면 \n\nD.section&gt; 누가 뭐라 해도 난 상관없어 나 혼자만이 너를 볼 수 있게 해줘 \n빛을 잃고 나 쓰러진다 해도 my lady forever 날 포기하려 하지마 \n\nRap&gt; 니가 떠난 후 난 1000일 동안 매일 너의 사진을 품에 안고 \n\n1000번을 네 이름을 불렀어 1000개의 눈물 방울이 너의 \n사진을 적셨어 &lt;천일유혼&gt;영혼의 모습으로 내게 돌아온 거야 \n\n차가운 너의 작은 몸을 안고 무지무지 달콤한 너의 살을 \n느껴 보고 싶어-아침이 오면 너를 보내야만해- \n또다시 천년 같은 기다림을 참아야만해- \n\n하지만 괜찮아 불어오는 바람결에 너의 머릿결을 느낄 수가 있고 \n너도 역시 다른 세상에서 나를 그리워하고 있을 테니까.. \n다만 현실의 벽을 넘어 영겁의 세월로 이어지길 바래.. \n\nE. Rap) yeah just me and you, if I ever doin' things that you \nwanna do, a pump it up yeah, a just me and you, \ncome on come on, a just me and you, uh. \n\njust me and you, if I ever doin' things that you wanna do, yeah, uh \na just me and you, you know a play my heart my little bangin's \nwith you, a come on. \nyeah a just me and you, if I ever doin' things that you wanna do, \nhuh yeah, a just me and you, pump it up girl, just me and you \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/309/15026309_1323223876035_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130883, lowkey: nil, highkey: nil},
  {album_id: 91, singer_id: nil, team_id: 32, title: "으샤 으샤 (Uh Sha Uh Sha)", genre1: "가요", genre2: "댄스", runtime: "03:33", lyrics: "\n\t\t\t\t\t\t\t<div>으샤 으샤 (Uh Sha Uh Sha) - 03:33</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">1st Rap) \n한밤중에 기차 타고 가네 어린 시절의 바다를 찾아가네 \n걱정거리, 근심거리 하나 없던 그 시절로 돌아가고 싶어. \n\n아! 나 이제 피곤해요 일 그만 할래요! \n다 접어두고 우리함께 물놀이가면 안될까요! \n\nVerse 1) \n시원하게 부서지는 파도, 햇살, 모래사장, 바닷가 좋아 \n덥지도 않고 질리지도 않는 수박은 더 좋아. \n이렇게 좋은 여름을 기다려 온 나는 기분 좋아(덤디리 덤) \n\nVerse 2) \n여름밤이 찾아오면 모닥불을 피워놓고 둘러앉아 \n이것저것 아무 재미없는 얘기(도) 할거야. \n썰렁한 얘기라도 그런 밤엔 다 용서할 수 있어(덤디리 덤) \n\n간주 Rap) \n\n나-나! 어릴 적에 살던 동네 여름 오면 너무너무 행복했지 \n시냇가에 친구들도 (첨벙첨벙) 덩달아 바둑이도 (깡충깡충) \n그렇게 앉아있지 말고 나랑 같이 가요. \n안되는 일 억지로 붙잡고 늘어져서 된다는 보장하나 없을 테니까. \n\nCHORUS) \n인생을 낭비하지 마세요. \n늘 그렇게 살다보면 찌들어 가니까 \n한 번이라도 툭툭 털고 모든 걸 잊고 즐기며 살아봐요! \n\nVerse 3) \n하루종일 지루하고 짜증나는 일이 많이 있었다면 \n이것저것 재보지 말고 여행을 떠나봐 \n기차를 타고 버스를 타고서 떠나자- \n\n2nd Rap) (Melodic) \nHey! Come on everybody Swimming in the Sea- \n(Saying doo waa diddy diddy dum dee ree dum!) \nHey! Come on everybody Walking down the Sea- \n(Saying doo waa diddy diddy dum dee ree dum!) \n\n(CHORUS→Verse 3) 반복→ending \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/309/15026309_1323223876035_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130884, lowkey: nil, highkey: nil},
  {album_id: 91, singer_id: nil, team_id: 32, title: "Wedding March (너의 곁에서 II)", genre1: "가요", genre2: "댄스", runtime: "04:23", lyrics: "\n\t\t\t\t\t\t\t<div>Wedding March (너의 곁에서 II) - 04:23</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">눈부신 햇살에 눈을 뜨며 너의 모습을 떠올려 봐 그토록 기다려 왔던 사랑의 \n그날 또 다른 세상이 있다해도 그 어떤 아픔이 있다 해도 모두가 축복했죠 \n아름다운 우리 둘만의 사랑 기억하나요 그 무엇보다 더 소중했던 우리사랑 세상이 \n하얗게 물든 지금 이 순간 이제우리 같은 곳만을 바라봐요 나 언제까지나 변치 \n않는 보석 같은 그런 내 사랑으로 널 지켜줄게요 이젠 이 세상 끝날 때까지- \nYou see a, Know my love is you, Love is me and a, Know one ever will lovin' \nYou forever (Ever) 아무리 힘든 일이 있다해도 항상 네 곁에서 너만을 지켜줄게 \nMy love 아무런 생각도 들지 않아 너와나 함께 할 수 있다면 언제나 꿈꿔왔던 \n영원한 너와 나의 그 모든 것 이 세상 끝난대도- 저 깊어만 가는 시간 속에 변해버린 \n많은 사람들처럼 난 변치 않아요 항상 언제 까지나 영원히 \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/309/15026309_1323223876035_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130885, lowkey: nil, highkey: nil},
