  {album_id: 91, singer_id: nil, team_id: 32, title: "Maybe (신곡)", genre1: "가요", genre2: "댄스", runtime: "04:13", lyrics: "\n\t\t\t\t\t\t\t<div>Maybe (신곡) - 04:13</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">이미 너도 모를걸 \n\n* 이제야 말할게 너 없는 세상은 될 수 없어 \n아직도 모르는거니 조금은 알겠어 \n니가 차지한 나의 모든 걸 깊어진 너와 내 사이 \n\n오랜만에 느끼게 됐던 너의 모습에 난 준비했던 모든 말도 잊었었지 \n왜 그리 딴 소리만 늘어 논건지 하늘만 바라보며 너를 불러야 했어 \n\n\n** 돌아온 널 막을 수 없어 얼마나 기다려 온 날이었는 데 \n돌아온널 잡으려 해도 잃어 갈 가슴엔 한숨분만 \n\n* Repeat \n\n너에겐 작아진 내 모습 할 수 없지만 이제 다가가려 하는 나를 잡아준다면 \n두 번 다시 너를 떠나 있진 않을게 너의 그 표정이 나에게 희망이라며 \n\n** Repeat \n* Repeat \n\n어쩌면 행복할지 모를 네게 다가가기는 힘이 든 나란 걸 \n알지만 너를 내품에 안는 날 너의 행복은 내가 지킬게 \n\n* Repeat \n\n(Rep)그대를 기다리지는 않겠어 내 마음을 내가 알아 \n후회하지 난 절대로 네게 입맞출수 없는 사람 \ngo it, so..so.. 네 까만 머릿결에 다시 한 번 \n입맞추고 싶어 알 수 있는 내 마음 \n\nYou'll keep me tight tills I'm in you rise-up on your side, Maybe \nbecause I'm love for you \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/309/15026309_1323223876035_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130887, lowkey: nil, highkey: nil},
  {album_id: 91, singer_id: nil, team_id: 32, title: "Into My Heart (신곡)", genre1: "가요", genre2: "댄스", runtime: "04:16", lyrics: "\n\t\t\t\t\t\t\t<div>Into My Heart (신곡) - 04:16</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">혼자 울며 슬퍼하며 넌 항상 외로워했었지 \r\n늘 언제나 외로워하며 혼자만의 세상의 널 두었지 \r\n니 곁의 나를 언제나 피하려고만 하는지 \r\n니 곁엔 내가 보이지 않는 거니 \r\nOh girl- (Don’t cry baby) \r\n\r\n* And I love you forever into my heart \r\n저 하늘이 나를 부를때까지\r\n너의하늘을 내가 지켜줄께 \r\n이젠 눈물흘리지마~\r\n\r\n만은시간 만은 날들 난너와 함께 했었지\r\n늘니곁에 있었다는걸 넌느끼지못함이 두려웠어\r\n니곁에 나를 언제나 기다리게만 할거니\r\n더 이상 나를 기다리게 하지마 Oh girl- (hold me baby) \r\n\r\n* Repeat \r\n\r\n하늘은 널 혼자 두지 않아 니 곁에 날 보낸 거잖아 \r\n하늘이 보내준 (I’m your man) 너의 나를 (피하지마) \r\n난 이젠 너의 기사가 되어줄게~ \r\n\r\n* Repeat \r\n\r\n(Narration) Everyone pay attention now cuz we about to say somethin’ serious \r\nyo look around our hood and tell me what you see dog I see some people with \r\nsome problems they need our hands yo they definitely need our hands so what \r\nare we gonna do now? with some love caring we present this song to our next \r\ngeneration... \r\n\r\nForever lasting love one can imagine. Don’t ever let it go always in you heart. \r\nI can see it in your eyes yes so cleary. Your love is into my heart</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/309/15026309_1323223876035_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130888, lowkey: nil, highkey: nil},
