  {album_id: 93, singer_id: nil, team_id: 32, title: "HIWAY(Ride with me)", genre1: "가요", genre2: "댄스", runtime: "04:14", lyrics: "\n\t\t\t\t\t\t\t<div>HIWAY(Ride with me) - 04:14</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">Rap) Now uh, who wanna ride with me my youthful expressions my styles don't come cheap got \r\ninfinite potential this f-n highway be free clock my quarter mile speed rip through turnpikes \r\nspit game through two mic's come up for air, po-po out of sight got radars gunnin' on this \r\nrap phenomenon a hundred miles and runnin stunnin' on-lookers- wondering hear me comin' \r\n\r\n끝도 볼 수 없지만, 내가 가는 이 길이 정말, 내가 원해왔던 길일까.. \r\n셀 수 없는 갈등과 내 현실 앞에 끝없이 싸워야만해.. \r\n모두 이겨낼 수 없겠지, 난 가야만해.. \r\n\r\n가진 것도 없고, 믿는 것도 없지만 내 안엔 나를 믿어주는 친구도 있어. 날 일어설 수 있게 해줘 \r\n\r\n.. \r\n\r\n* 바람과 함께 달려가겠어, 나의 꿈을 잡겠어. 두려움 없는 나를 만나기 위해.. \r\n그 누구도 날 대신할 수 없단 걸 다 알고 있어. 기적을 만드는 것 또한 나의 몫인걸.. \r\n\r\n사람들은 믿겠지, 힘과 돈과 명예가 세상을 바꿔 놓을 수 있다는 걸 \r\n그건 아냐, 도전정신과 나에 대한 믿음과 젊음만이 가질 수 있는 용기 \r\n\r\n가진 것도 없고, 믿는 것도 없지만.. 때묻은 그대 손을 뿌리칠 수가 있지.. \r\n난 나의 길을 가겠어 \r\n\r\n** 셀 수 없는 시간 속에 흘린 땀과 눈물과 함께.. 오, 나는 웃고 있겠지 \r\n이 길의 끝에서 난 후회하지 않겠어 지금 이 순간 최선을 다해낼꺼야.. \r\n\r\nRap) Givin' y'all the best that I got like Anita can't hesitate- for me to make my lines \r\nrelate take it upon myself to make it all heartfelt a bless the track with a little light and \r\nwatch it all melt a long way from home but found my resting grounds to be at peace \r\n난 지금이 순간, 최선을 다하지 모든 순간들에 의미를 부여하고, 10년이 지난 뒤 내게 \r\n아마도 후회 같은 부질없는 일을 만들진 않겠지.. \r\n\r\n* Repeat X 2 \r\n\r\n** Repeat</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/311/15026311_1323224045390_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130901, lowkey: nil, highkey: nil},
  {album_id: 93, singer_id: nil, team_id: 32, title: "Lost in Love", genre1: "가요", genre2: "댄스", runtime: "04:04", lyrics: "\n\t\t\t\t\t\t\t<div>Lost in Love - 04:04</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">Yeah that's right, girl you just move on \r\n\r\nRap) 사랑해 널 잡지 못해 미안해 널 안지 못해 미안해 니곁에 있지 못해 \r\nTo make u stop cryin' Is this the end *2 \r\n\r\n내게 이제 남은 건 지난날의 상처뿐 내 눈에 적실 눈물조차 말라 버렸어 \r\n죽기보다 힘든 건 내 지난 시간들.. 그건 아니였어 그건 아니였겠지 \r\n\r\n오랫동안 간직했던 말 그리고 널 위해 준비했던 한편의 이 시 \r\n그렇게도 모자랐던 나의 사랑에 난 기억조차 할 수 없이 널 떠날 꺼야 \r\n\r\n* 아직 내게서 멀어지려 하지마 Tonight (내 안으로 와 Baby~) \r\n작은 내 맘에 젖어드는 네 모습 (널 끌어안고 잠이 들고파) \r\n이제 나에겐 너의 숨소리 마저 Oh Baby~ (난 잊지 못해) \r\n다신 내 맘에 지워 지려 하지마 (날 떠나려 하지마) \r\n\r\n어디선가 찾아온 너의 작은 미소가 내 사랑을 내 마음을 또 어지럽게 해 \r\n빛이 바랜 추억 속에 너의 이름을 난 소리쳐 보지만 yeah~ \r\n\r\n날 수 없이 바라보던 너의 눈빛은 날 한순간 너의 환상 속으로 빠져들게 해 \r\n끝이 없는 나의 기억 속에서 이젠 이별조차 할 수 없이 하늘위로 날아가 \r\n\r\n* Repeat \r\n\r\nRap) One love, One kind One girl, One creep and a One GOD, One life for One soul All I \r\n\r\never need is one try for the one girl (그런걸) 사랑할수록 고통이 큰 법 이미 전부 지나가 버린걸 \r\n네 추억 네 미소 지워버려 모든 기억 이젠 없어 And that's my word \r\n\r\n창 밖으로 보이는 새하얀 눈길 위에서 다시 깨지 않을 꿈처럼 사랑을 다해 \r\n사랑이란 모든 걸 소유할 수 없는 거라 하지만 나의 마지막을 넌 알 수 있게 이젠 \r\n(By the time you realize, Girl you see how it is what I mean to you) \r\n\r\n아직 내게서 멀어지려 하지마 Tonight (First I wanna get down with you buy you stuff I'm a die for U) \r\n작은 내 맘에 젖어드는 네 모습 (널 끌어안고 잠이 들고파) \r\n(Next I just wanna ride with U, hope on my car, what's wrongs with you) \r\n이제 나에겐 너의 숨소리 마저 Oh Baby~ (난 잊지 못해) \r\n(Then a straight out make love with you, baby baby tell me what you gonna do) \r\n다신 내 맘에 지워 지려 하지마 날 떠나려 하지마</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/311/15026311_1323224045390_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 10620, song_num: 16130902, lowkey: nil, highkey: nil},
  {album_id: 93, singer_id: nil, team_id: 32, title: "너의 결혼식(Wedding)", genre1: "가요", genre2: "댄스", runtime: "03:27", lyrics: "\n\t\t\t\t\t\t\t<div>너의 결혼식(Wedding) - 03:27</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">Rap) Hold up, Let's take it from the top hot box Booming System Floshin' pure rocks, in the six drop 4, minute on \nstop see money lookin' alright yeah what up pop plus the girl throwin' signals I'm throwin' em back flowin' cuz I \nfound you like that, p baby boy style hopin' We match she set me crown royal with a note attached \n\n난 너를 처음 본 순간부터 움직일 수 없었어 숨을 쉴 수조차 없었어 \n왜 너를 이제야 만난 건지 하필 내 동생의 결혼식에서 신부가 된 너를 \n이제 나는 어떡해야 하나 \n\n* 내가 찾던 꿈의 이상형을 난 이제 보고 말았어 난 그저 바라볼 수밖에 없겠지 아냐 만족해 \n안 돼 모든 순간 그녈 보는 게 내겐 악몽일거야.. 하지만 피할 수도 없는걸 내겐 첫사랑인걸 \n\n시간을 돌리고 싶어...단 몇 일만이라도... \n\nDo you loving me? and come with me? 영화 '졸업' 같은 일이 생길까.. \n나에겐 그런 용기가 없어.. 난 축하 해줄 수도 없었어.. 그대신 내가 너를 가졌던 걸 상상도해 Tonight \n\n* Repeat \n\n용서받지 못할 감정도 널 향해 터질 듯한 내 온 가슴도 \n혼자만의 사랑 같은 착각 속에 빠진 것은 아닐까 난 두려워 \n\nRap) 가슴이 폭발할 정도로 뛰는 심장박동 최고 속도로 어차피 내게 다른 길은 없어 \n오직 난 한길로 모든게 끝이라 해도 \n\n시간을 돌리고 싶어...Love me.. \n\n그녀가 날 보고 웃잖아 난 그녀 뒤에 설 수밖에 없지만 행복해요 \n그녀만큼 날 흔들어 놓을 수 있는 사람 없으니깐 oh yeah \n\n지금 이 순간도 나를 견딜 수가 없을 것 같아 그녀의 옆자리에 서고 싶었어 참을 수 없이 \n지금 이 순간도 지나버리면 돌릴 수가 없겠지 난 매일 미쳐가고 있겠지 그녀는 알지 못한 채 \n\n* Repeat</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/311/15026311_1323224045390_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130903, lowkey: nil, highkey: nil},
  {album_id: 93, singer_id: nil, team_id: 32, title: "Soulmate", genre1: "가요", genre2: "댄스", runtime: "04:05", lyrics: "\n\t\t\t\t\t\t\t<div>Soulmate - 04:05</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가끔 혼자가 지겨워질 때면 너를 찾아가 맘을 달래곤 해 \n이런저런 얘기 속에 난 어느새 괜찮아져 \n\n수많은 이야기는 다 지나도 우린 변한 게 많이 없어 \n언제부터 내 안에 있는 널 보게 된 거야 아름다운 널 \n\n* 그런 것도 나는 몰랐던 거야 좋아한단 말을 하기가 난 두려워 \n우~ 소중한 친구를 잃을지도 몰라 가슴만 조여가고 있는걸 \n\nRap) 고백하게 될 꺼야, 어색할지도 몰라, 여태까지 기다려 온 순간이 지금 온 거야 \n하루종일 기다렸어 말을 할까 망설이고 미쳐, 버려, Dash 해 버려 Reload, 이제부터가 시작이야 \nUh C'mon bring it on \n\n가끔 네 곁에 누군가 있으면 괜히 왜 맘이 편하지 않는지 \n너도 외로워서 나를 찾을 때 가슴이 설레는지 \n\n작은 것들을 모아 생각해봤어 이젠 좀 뭔가 알 것 같아 \n멀게만 느껴지던 단하나의 그녀는 곁에 있단 걸 \n\n* Repeat \n\n넌 무슨 생각하니 나의 마음 들킨 건 아니겠지 \n(maybe you like me you like me too) \n어색해져 가는 나를 바라보는 너에게 \n\n이젠 고백할게 너를 좋아해 이말 하기가 힘들어 잠도 못 잔걸 \n우~ 이런 나의 마음 받아주길 바래 cause baby you are the biggest part of me \n그런 것도 나는 몰랐던 거야 (Yo, That's the way It gots to be 친구로는 남지 못한다해도) \n우~ 이런 나의 마음 받아주길 바래 (Yo, This is from the bottom my heart) \ncause baby you are the biggest part of me \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/311/15026311_1323224045390_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 13413, song_num: 16130904, lowkey: nil, highkey: nil},
  {album_id: 93, singer_id: nil, team_id: 32, title: "비밀(My own secret)", genre1: "가요", genre2: "댄스", runtime: "03:43", lyrics: "\n\t\t\t\t\t\t\t<div>비밀(My own secret) - 03:43</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">이 세상 무엇도 사랑할 수 없던 나 그 누구에게 맘 열지 못한 내게 \r\n아무도 가르쳐주지 않았었던 것 그 안에 숨겨진 비밀을 오늘 알게된 것 같아 \r\n\r\n기적 같은 일을 내려주신 그 분에게 난 감사하고 싶어 \r\n살아가며 기쁨 가득해질 그 이유가 내게 주어진 거야 \r\n하늘 높이 날아가고 싶어 나의 천사와 함께 \r\n저 멀리 행복을 찾아서 (oh baby) 함께 가지 않을래 허락해 줘 \r\n\r\n그 무엇보다도 소중한 존재 된 너 왜 멀리에서 날 찾지 못해 You can't \r\n너무도 오래 지나온 내 기다림의 끝에 너를 찾았어 그 안에 숨겨진 진실을 오늘 알게된 것 같아 \r\n\r\n쉽게 만났던 수많은 사람들 그 만남 속에서 진실한 맘은 어디에 너만은 달라 \r\n어두운 밤중에도 빗방울 떨어져도 한줄기 빛으로 다가와 \r\n\r\nRap) 널 만나고 난 뒤에 나 모든 것이 달라져버렸어 하루하루 살아가기 바뻐 무료한 삶 그 속에서 널 봤어 \r\n매일 밤 나 기도했어 영원히 너와 내가 함께 힘든 날이 온다해도 영원히 우린 Stay true \r\n기적 같은 일을 내려주신 살아가며 기쁨 가득해질 \r\n\r\n하늘 높이 날아가고 싶어 너의 곁으로 가서 말해 줄 꺼야 살아가며 기쁨 가득해질 그 이유가 바로 너였단 걸 \r\n너무도 오래 지나온 내 기다림의 끝에 너를 찾았어 맹세할 꺼야 \r\n살아가며 기쁨 가득해질 그 이유가 바로 사랑이었어 너무도 아름다웠던 나의 천사와 함께 저 멀리 행복을 \r\n찾아서 함께 가지 않을래 허락해 줘</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/311/15026311_1323224045390_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130905, lowkey: nil, highkey: nil},
  {album_id: 93, singer_id: nil, team_id: 32, title: "중독(Deep Sorrow)", genre1: "가요", genre2: "댄스", runtime: "04:36", lyrics: "\n\t\t\t\t\t\t\t<div>중독(Deep Sorrow) - 04:36</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">소리 없이 어둠이 날 감싸주려 하지만, 오 난 그녀의 빛이 되고 싶어.. 지는 노을을 잡으려 잡으려 애써도 안 되는걸.. \r\n제발..나의 그녀가 어둠을 무서워해요...날 이 밤을 밝혀줄 햇빛이 되게 해주세요 \r\n\r\n* 그녀 곁에서라면, 무엇이든 돼도 좋아요..핸드백, 손수건과 따뜻한 코트, 립스틱 그녀 구두까지도.. \r\n그녀 곁에 있다면, 소중한 게 될 수 없어도 난 정말 행복해요.. \r\n가로등이라도 그녀 오는 길을 볼 수 있다면.. \r\n\r\nRap) Girl You the flyiest 34, 24, 35에 완벽한 뒷모습을 보네 허나 그녀 가는 길은 정반대, \r\nI'm a turn back then 하늘에 별이라도 다 따다줄게 니가 원하는 것 다 내가 줄게 \r\n눈감아도 보일수 밖에 내가 너를 첨 봤을때 \r\n\r\n아직도 모자란 것들만 생각이 나는 거죠 그녈 위해 난 난 해준 것이 아무것도 없어요. \r\n세상의 반을 가진다해도 내가 그녀 곁에 없다면 의미도 없는 것일 뿐... \r\n\r\n*Repeat \r\n\r\n내일 아침은 해가 뜰 거예요..그녀가 원하니까요.. 환한 미소보다 예쁜 건 없겠지만 \r\n(그래요 난, 난 매일 그녀를 위해서 기도했죠) 하지만 난, 아픈걸요 나의 그녀가 내 이름조차 \r\n모른 채 살아가요..어떻게 하나요... \r\n\r\nRap) 그녀 곁에서라면 나는 무엇이든 좋아 내 하루를 너와 보낼 수 있다는 것만으로 난 좋아 \r\n앞이 보이지 않을 만큼 캄캄할 때 C'mon 무서워마 내가 빛이 될게 \r\n혼자라고 너 생각 들 때 주위를 봐 I'm a here 4 you \r\n\r\n그녀 생각으로 난 하루하루 살수 있죠.. 내 마음과 영혼까지 가져간 사람..오직 그녀만이 전부죠.. \r\n그녀 곁에 있다면 누구라도 되고 싶어요 친구도, 아빠라도,,선생님이라도.. \r\n그녈 사랑한단 말할 수 있게... \r\n\r\n*Repeat \r\n\r\n그녀곁에서라면</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/311/15026311_1323224045390_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130906, lowkey: nil, highkey: nil},
