  {album_id: 93, singer_id: nil, team_id: 32, title: "괜찮아요(Gonna be alright)", genre1: "가요", genre2: "댄스", runtime: "04:21", lyrics: "\n\t\t\t\t\t\t\t<div>괜찮아요(Gonna be alright) - 04:21</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">Narration) It's alright baby don't feel bad for yourself I'm doing fine \n\n잃어 가는 나를 그대로 둘 건가요 보기만 할건가요 \n언젠가 그랬죠 내가 웃지 못하면 더 이상 바랄 것도 없을 거라고 \n\n손 내밀고 기다리나요 날 찾나요 웃기만 하나요 \n혼자가 아니라 믿고 있는 건가요 아녜요 \n정말 혼자가 된걸 느껴봐요 조금 울어도 돼요 \n\n*앞서가죠 늘 그댄 그랬죠 항상 내 배려라곤 하지 않았죠 \n밀려있는 기분 이예요 둘이어도 혼자였나 봐요 \n\nNarration) Girl please listen to me \n\n높이 올라 하늘을 보면 잡히나요 잡힐 것 같나요 \n늘 가까이에 서 있는 사람은 항상 안 보여 \n나중에 후회하기 마련이죠 알고있기나 한지 그대는 \n\n* Repeat \n\n한참 화장이 짙어질 때 있었죠 알았어요 느낌이 온 걸요 \n그때 차라리 피하는 게 지금은 나았었단 생각을 지금 했는지 \n\nRap) 잘 가요 떠나가는 그댈 잡을 수가 없어요 미안해요 어떻게든 되돌리고 싶어요 하지만 \n이대로 그댈 보내주는 게 지금의 우리에게 더 나을 거란 생각이 들어요 \n지나간 날을 생각해 보면 또 그리워만 지겠지 하루가 또 지나가면 \nIt comes right back to me Killing me softly 기억이 나겠지 그대 느낌 그대로 \n거짓말 같이 거기 그대로 있겠지 \n\n괜찮아요 나는 괜찮아요 잠시 힘들다가 말게 되겠죠 \n기억나면 생각하는 건 그건 내 자유여도 되죠 \n\nNarration) Don't worry about me girl I'm gonna be alright</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/311/15026311_1323224045390_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130908, lowkey: nil, highkey: nil},
  {album_id: 93, singer_id: nil, team_id: 32, title: "Get Up", genre1: "가요", genre2: "댄스", runtime: "03:34", lyrics: "\n\t\t\t\t\t\t\t<div>Get Up - 03:34</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">이뤄질 수 없다고 말을 꺼내면서 그땐 왜 나만을 바라보며 사랑이라 말했어. 왜 \n사라져 가기 전 지나버린 날을 돌이켜 서주길 바래. 가지마. \n\n이런 널 선택해서 많은 아픔이 가슴속 가득해져도 그래도 사랑했어. I just want you. \nStay in my love. Stay in my love. 떠나떠나 가지마 \n\n* Get up...Huh Get up....Hey come together. Get up...Huh Get up.... \nGet up...Huh Get up....Hey come together. Get up...Huh Get up... \n\nRap) 앞으로 가는 시간 멈춰버리고 예감해 버린 짐작해 버린 이별을 돌리기엔 네가 너무 \n멀었나. 왜왜 내가 몰랐나.Uh 마주보는 순간이 붙잡은 두 손에 흐르는 눈물이 마지막 마지막. \n거짓 없는 나의 진심. 돌아온 건 너의 변심. 이렇게 내가 택한 결심. \n아무에게도 너를 줄 수 없는 아주 조그만 욕심. \n\n이런 널 선택해서 많은 아픔이 가슴속 가득해져도 그래도 사랑했어. I just want you. \nStay in my love. Stay in my love. 떠나떠나 가지마 \n\n아무 말도 난 하지 못한 채 멀어져만 가는 널 그리워해야만 하나 \n사랑은 끝났겠지만 허락해줄 수가 없어. 세상에 가득한 널.I believe in you \n\n* Repeat x 2 \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/311/15026311_1323224045390_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130909, lowkey: nil, highkey: nil},
  {album_id: 93, singer_id: nil, team_id: 32, title: "Missing U", genre1: "가요", genre2: "댄스", runtime: "04:11", lyrics: "\n\t\t\t\t\t\t\t<div>Missing U - 04:11</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">Rap) It's been a one day 네 맑은 두 눈에 눈물이 고일 때 I'm a find you next day, \n꿈에서 깨 너를 찾아봐도 넌 어디선가 날, 보고 있을 것만 같아 \n\n너의 자스민 향기 너의 눈부신 미소 너의 수줍은 입맞춤 \n너의 따스한 온기 너의 투명한 눈빛 내 귀에 흐르던 목소리 \n\n매일 밤 또다시 행복한 상상 속에 널 찾아 헤매지만 \n\n* 이미 너는 현실 속에 찾을 수도 없는 존재 수도 없이 머리 속에 수천 번 수만 번 외쳐보아도 \n내 마음은 너를 찾아 너를 기억하고 있어 You know I remember you Baby I am missing you \n\nRap) 매일 밤 또 다시 너를 찾아 헤매도 언젠가 부턴가 내 곁에 멀리 갔던 너 내겐 너밖에 없어 \nCan't you see it, 아직까지 나 기다리잖아 When I was feelin' \n\n이젠 희미한 모습 이젠 아련한 미소 너무 간절한 그리움 \n다시 돌아온 계절 이젠 스산한 바람 쓸쓸히 늘어진 그림자 \n\n나에게 사랑은 너밖에 없으니까 멀리서 지켜 봐줘 \n\n** 내가 만든 굴레 속에 내가 만든 아픔이여 추억이란 과거 속에 영원히 미로에 갇혀버린 나 \n다시 돌아 올 수 없는 너의 늪에 빠진대도 너와 함께 한다면 Baby I am missing you \n\nRap) 하루하루가 많이 다르게 느끼지만 상상 속에서 너를 찾아서 헤매지만 \n어떻게도 널 잊을 수가 없어 너의 이름 이젠 부를 수 없어 \n\n매일 밤 또다시 행복한 상상 속에 널 찾아 헤매지만 \n\n*Repeat \n\n**Repeat</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/311/15026311_1323224045390_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 10852, song_num: 16130910, lowkey: nil, highkey: nil},
  {album_id: 93, singer_id: nil, team_id: 32, title: "네가 없다면(Without You)", genre1: "가요", genre2: "댄스", runtime: "04:37", lyrics: "\n\t\t\t\t\t\t\t<div>네가 없다면(Without You) - 04:37</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">Narration) Days gone by, I'm waiting 4 you counting on days, I'm still waiting \r\n\r\n너의 전화가 올 것 같아서 오늘은 왠지 그럴 것 같아서 \r\n하루종일 아무런 약속도 난 못하고 멍하니 기다리고 있었어 \r\n\r\n밤새워 기다린 그 후에야 알았어 한참을 울고 나서야 \r\n이젠 너의 전화는 오지 않는다는 걸 더는 기다리는 일도 아무 소용없단 걸 \r\n\r\n* Yes I know what it means 모두 다 끝났다는 걸 다신 함께 할 행복 따윈 없을 거란 걸 \r\nThere is no one I need 내 곁에 네가 없다면 그래야 하는 거라면 남겨진 내 삶도 더 의미 없는 걸 \r\n\r\nNarration) There's no one in this world, who can love U, like I do. \r\n\r\n우리만 알아들을 수 있던 말투도 내게만 짓던 표정도 \r\n이젠 모두 지나간 기억에만 있겠지 인정하지 않으려 해도 이미 그런 거겠지 \r\n\r\n* Repeat \r\n\r\n정말 난 용서가 안 돼 붙잡지 못했던 내가 널 보낸 내가 \r\n\r\n* Repeat X 2</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/311/15026311_1323224045390_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130911, lowkey: nil, highkey: nil},
  {album_id: 93, singer_id: nil, team_id: 32, title: "79", genre1: "가요", genre2: "댄스", runtime: "04:18", lyrics: "\n\t\t\t\t\t\t\t<div>79 - 04:18</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">Rap) 시작을 알리는 태양이 뜸과 동시에 같은 하늘에 같은 대지에 똑같은 꿈을 꾸며 같이 눈뜨네 \n눈빛은 다르지만 시선은 하나로 아무도 볼 수 없는 신비로운 곳으로 온몸이 빨려 들어 날 기다리는 \n내일로 기억은 잠이 들어 어머니의 품으로 take it slow in 현실의 세계로 \n목숨보다 소중했던 백포스의 가치를 같은 꿈을 꾸던 우린 인정 할 수 있음을 \n그때를 돌아보며 미소 질 수 있음을 내 꿈을 한 박자 빠른 스텝을 밟는 것임을 그 꿈을 꾸며 스테이지 위에 \n뿌린 땀의 개수만큼 너와 나의 우정은 가치를 잴 수 없음을 아아 가치를 잴 수 없음은 아아 우린 알고 있음을 \n\n* One make it fun baby get on the floor And Two got you feeling like you down to ride now \n이 순간에 너와 내가 (나나나나 나나나나) \nThree everybody wanna rock tonight And a Four get you stuff and I'm out to get down \nUh 손을 들어 너와 내가 (나나나나) \n\nRap) Let's have stash keep the heat on a dash It's simple math front get one of the ass and you laughin' you aware \nbest believe be askin' at bath cut you know these finger prints ain't matchin' get at you and dogg it was bound to \nHappen sleep and around and get your push deep uh bang to this wheather blood and creep cuz know I'm only rappin' \nfor that gangsta \n\n내 방식조차 이해할 수 없던 너였으니까 싸우고 맞추고 \n서로 비슷한 걸로 느끼고 그러다 보면 합치고 내 의식은 너로 바뀌고 어떤 말도 (that's all good) \n힘들어질 땐 내게로 와 억지 웃음 짓지 않고 술잔에 따르고 미루고왔던 일들 너의 곁으로 앞으로 \n\n시작 될 고통 모두 함께 \n한대도 묻어버린 너의 모든 것들로 널 다시 바라보지 않도록 \n\n* Repeat \n\nEverybody 하나우리 너와내가 여기모여 Everybody 하나되어 Let's go now 나나나나 나나나나 *2 \n\nRap) Shout~ make it fun, baby get on a floor, 지금에서야 느껴 Wanna get some more one \nplace gimme gimme some more 세상엔 전부다 똑같은걸 Gimme the microphone I'm about to rock some beat \n내가 눈을 뜨는 시간 about A 6 moring, lace's on my sneakers am I ready to go somebody Tell me can you feel me \n\n* Repeat \n\nEverybody 하나우리 너와내가 여기모여 Everybody \n하나되어 Let's go now 나나나나 나나나나 *2 \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/311/15026311_1323224045390_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130912, lowkey: nil, highkey: nil},
  {album_id: 93, singer_id: nil, team_id: 32, title: "노을(You...)", genre1: "가요", genre2: "댄스", runtime: "04:36", lyrics: "\n\t\t\t\t\t\t\t<div>노을(You...) - 04:36</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">움직일 수 없었어 니 앞에 서면 아무것도 보이질 않아 \r\n너무나도 닮아서 어색한 내게 미소를 보였죠 하얀 웃음도 \r\n\r\n예전 내 자신이 떠나보낸 그 사람이 내 안에 숨쉬고 있지만 \r\n사랑이라고 난 믿고 싶은데 남겨진 내 사랑을 줄 수 있다고 믿고 싶은데 \r\n\r\n* 언제까지 너의 곁에서 너만 보며 살아가고 싶어 다시 시작하기엔 힘이 들지만 Oh~yeah~ \r\n그 누구도 알 수 없었던 아픈 사랑 안에 커져 가는 내 자신이기에 널 사랑해 \r\n\r\n가끔 그댈 볼 때면 마음 아파서 눈물 흘린 적도 있지만 \r\n이젠 나도 잊겠죠 한 번의 이별 잊을 수 있겠죠 나의 그대와 \r\n\r\n다시 시작하는 두 번째 사랑이기에 두려움 먼저 앞서지만 \r\n사랑이에요 이제 나에게 다가올 시간 앞에 맹세할게요 나만의 사랑 \r\n\r\n* Repeat \r\n\r\n다시 찾아온 나의 사랑 이렇게 커져만 가죠 약속해요 그대에게 함께 할 수 있다고 영원히 \r\n\r\n* Repeat \r\n\r\n그 무엇도 바꿀 순 없어 영원히 너만을 사랑할게 또 한 번 이별이 온다해도</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/311/15026311_1323224045390_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 17366, song_num: 16130913, lowkey: nil, highkey: nil},
  {album_id: 94, singer_id: nil, team_id: 33, title: "Sea Of Love", genre1: "가요", genre2: "R&amp;B/소울", runtime: "04:23", lyrics: "\n\t\t\t\t\t\t\t<div>Sea Of Love - 04:23</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">언제나 내 꿈엔 비가내려 차가운 바람도 불고 있어 \r\n널 기다리는 내 삶의 끝 본 것만 같아 어떡해 \r\n며칠이 몇 년 같은데 넌 아무렇지 않은지 한번이라도 너를 보여주겠니 \r\n\r\nchorus) \r\nFor the moon by the sea 니가 떠난 바닷가에 눈물이 마를 때까지 (다 마를때까지) \r\n사랑한다는 건 오직 기다림뿐이었단 걸 난 왜 몰랐을까 (난 왜 몰랐을까) \r\n\r\n이제 난 그만 돌아가려 해 너를 몰랐던 그때 네가 없던 세상 \r\n아직은 나에게 내가 전부였던 시절 날 보내 줘 \r\n\r\nFrom the bottom of my heart Girl with you , I'll be true \r\n모두 거짓말인걸 (거짓말야) 맘은 그렇게 먹지만 (맘은 그렇게 먹지만) \r\n절대 너인걸 어떡해 죽어도 못 잊겠어 \r\n\r\n* chorus \r\n\r\n널 잊은채로 나도 살고싶어 하지만 그게 안 돼 아픔만 더해 갈 뿐 \r\n너의 사랑은 끝났지만 나의 사랑은 이제 막 시작했어 \r\n\r\nFrom the bottom of my heart still i'm falling in love \r\n꿈속에 라도 네가(꿈속에서) 돌아와 Kiss해줘(나에게 Kiss 한다면) \r\n약속하지 않아도 돼 난 매일 기다릴테니 \r\n\r\n* chorus \r\n\r\n가끔 네눈에 눈물이 고여 흐른다면 그건 내가 눈물이 말라서 네 눈물 빌린 거야 \r\n돌아와 제발 내게 (난 왜 몰랐을까) \r\n\r\n* chorus X 2 \r\n\r\n내 꿈엔 비가 이젠 그치길....</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/312/15026312_1323138825496_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130914, lowkey: nil, highkey: nil},
  {album_id: 94, singer_id: nil, team_id: 33, title: "Condition Of My Heart", genre1: "가요", genre2: "R&amp;B/소울", runtime: "04:53", lyrics: "\n\t\t\t\t\t\t\t<div>Condition Of My Heart - 04:53</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">그대가 말해주던 이별이 수많은 시간을 흘러가던 날 \r\n내게 물어오는 그대의 전화에 나는 잘 있다고 말을 했지만\r\n 기억을 잊는 건 너무 힘들어 \r\n\r\nHow I cried 날 떠나던 그 날밤 그대 있는 세상에 내가 없길 원해도 \r\n이렇게 남아 그 이별에 무너져 날 버리지 않아요. 자유로운 나를... \r\nYou underestimate the condition of my heart. \r\n\r\n그대만이 삶의 전부였을 때 모든 사랑 전해 줄 수 있었죠 \r\n(언젠가는) 언젠가 나의 곁에 와줄거라 믿었죠 \r\n하지만 이젠 더는 그럴 수 없다는 걸 그대는 아나요. 나 홀로 남겨두면... \r\n\r\nchorus) \r\nWhen I cried 날 떠나던 그 날 밤 그대 있는 세상에 내가 없길 원해도 \r\n나 여기에 남아 그 이별에 무너져 날 버리지 않아요. 자유로운 나를... \r\nYou underestimate the condition of my heart. \r\n\r\n그대가 하고 싶은 말들이 내 앞에 펼쳐지는 \r\n그 순간 예감했었던 이별 (I don't wanna cry again) \r\n마음을 바꿔도 그대가 잃은 건 이미 늦어버린 멀어진 지난 날 \r\n그대가 날 원해도 \r\n\r\n* chorus</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/312/15026312_1323138825496_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130915, lowkey: nil, highkey: nil},
  {album_id: 94, singer_id: nil, team_id: 33, title: "Rains", genre1: "가요", genre2: "R&amp;B/소울", runtime: "04:24", lyrics: "\n\t\t\t\t\t\t\t<div>Rains - 04:24</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">this songs dedicated.. love.. precious love \r\n\r\nMy baby baby 내게 다시 올까봐.. \r\n난 끝없는 말로 너를 깨워보았어.. \r\n지쳤는지 잠든 건지 힘이 없는 네 얼굴 \r\nJust once look at me baby 나를 혼자 남겨 두지마 \r\n\r\nchorus) \r\nRains falling down on my (my) Head to toe and ground \r\n내 품안에 식어 가는 너를 잡고 울었어 \r\n다신 널 볼 수 없단 걸 믿고 싶지 않아 \r\n거짓말일꺼야 Tears falling down on my \r\n(my) Face to face and ground \r\n너를 따라 가겠어.. 난 아낌없이 버릴게 \r\nI know I know 이젠 그만 내 가슴 안에 묻어 두겠어.. \r\n\r\nMy sweety baby 혹시 단념 할까봐 \r\n아픈 네 곁에서 웃음 지어 보였어.. \r\n네 빈자릴 그 무엇으로 채울 수가 없는걸 \r\nJust once take me to your side 나를 혼자 남겨 두지마 \r\n\r\n* chorus \r\n\r\n아직 넌 내 곁에서 곤히 잠들어 있어 \r\n오늘밤이 지나면 깊은 잠에서 넌 깨어 날꺼야 \r\n너를 사랑해 고백할꺼야 나를 보고 웃어줘 \r\n\r\n* chorus</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/312/15026312_1323138825496_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130916, lowkey: nil, highkey: nil},
  {album_id: 94, singer_id: nil, team_id: 33, title: "그대를...(I Know..But..)", genre1: "가요", genre2: "R&amp;B/소울", runtime: "03:54", lyrics: "\n\t\t\t\t\t\t\t<div>그대를...(I Know..But..) - 03:54</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">이토록 힘들단 걸 잘 알고 있었으면서 \r\n이대로 난 그대를 사랑하기로 한 거죠 \r\n영원히 그대를 가질 순 없지만 \r\n(그댈 위해주고 싶은 마음도) 너무 큰 욕심인가요 \r\n\r\n알고 있죠. 바보같은 마음인 걸 이래선 안되는 걸 \r\n(그런데도 이렇게) 그대를 사랑해버렸죠. \r\n\r\n난 정말 괜찮아요. 그냥 볼 수만 있어도 조금씩 \r\n그댈 위해 뭔가 할 수만 있어도 \r\n사실은 너무나 그댈 원하지만 \r\n(더는 사랑할 수 없는 그대기에) 더는 다가갈 수 없어 \r\n\r\nchorus) \r\n알고 있죠. 바보 같은 마음인 걸 이래선 안되는 걸 \r\n(그런데도 이렇게) 그대를 사랑해버렸죠 \r\n\r\n(모르겠죠 이런 날 그댄 영원히) 날 외면한 채 살아요 \r\n(언제까지 그대로) 행복한 그대길 바래요 \r\n\r\n때론 참을 수 없이 날 보여주고 싶지만 \r\n그댈 더 힘들게 하는 일 난 할 수 없는 걸요 \r\n\r\n* chorus</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/312/15026312_1323138825496_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130917, lowkey: nil, highkey: nil},
  {album_id: 94, singer_id: nil, team_id: 33, title: "Future Tonight", genre1: "가요", genre2: "R&amp;B/소울", runtime: "03:49", lyrics: "\n\t\t\t\t\t\t\t<div>Future Tonight - 03:49</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">밤이 내린 적막 속에 홀로 남아버린 나 길 잃은 천사처럼 \r\n나를 배신한 너는 사랑을 그에게 다 가져가 처음이라 말하겠지 \r\n언제나 같은 내 맘이었는데 너로 인해 무너진 나.. \r\n빛 바랜 지난 너와의 기억을 태워보낼 순 없는데... \r\n\r\nchorus) \r\nTime stood still 갖지 못한 모든 걸 언젠가 다시 찾으리 \r\nTime stood still 유혹속에 물든 시련도 이겨낼 수 있는 나\r\n I saw the future tonight. \r\n\r\n강한 나로 태어나 검게 물든 어둠을 이젠 벗어나려 해.. \r\n뛰어가는 사람들 위로 날아 밟고 일어나 실패는 오지 않게.. \r\n사랑도 희망도 또 다른 무엇도 바라보고 놔두면 사라져.. \r\n원했던 바랬던 작은 어느 하나도 놓쳐 버리진 않겠어 \r\n\r\n* chorus \r\n\r\nTonight.. Tonight..과거는 날아갈 Tonight..Oh~ \r\nI saw the future tonight \r\n\r\nRap) \r\nBreak it down 아무런 잘못없는 내게 또 하나의 아픈상처 \r\n나만을 혼자두고 떠난 너 어둠속에 헤매 나의 길을 찾아 나 여기 \r\n\r\nDestiny oh~ 나를 다해서 Destiny oh~ 잡고 말겠어.. \r\n세상에 내린 현실의 운명을 바꿀 수도 있는 거야. \r\n허무한 사랑..절망의 시간도 내가 돌릴 수 있잖아..\r\nAh~ Time stood still \r\n\r\n* chorus</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/312/15026312_1323138825496_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130918, lowkey: nil, highkey: nil},
  {album_id: 94, singer_id: nil, team_id: 33, title: "Say My Name", genre1: "가요", genre2: "R&amp;B/소울", runtime: "04:04", lyrics: "\n\t\t\t\t\t\t\t<div>Say My Name - 04:04</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">Narration) \r\nHey girl Even though you're gone \r\nI want you to know that you can count on me \r\nJust say my name and I'll be there \r\n\r\nGirl I need 그대 두 눈에 맑은 그대 눈동자에 \r\n나의 모습 비춰 질 수 있는 건 유일한 나의 소망이죠 \r\n알아요 그댄 아직도 그를 잊지 못하는걸 하지만 난 괜찮아요 \r\n기다릴게요 그대 마음 내게로 돌아올 날까지 \r\n\r\nOh Say my name girl~ Girl I need you want for me \r\n그댈 바라보는 날 느낄 수 만 있다면 \r\n나의 모든 걸 다해 줄 수 있다면 더는 바라지 않아요 \r\nBaby Say my name \r\n\r\n하루도 그대 없인 난 살아갈 수가 없어요 \r\n허락할 순 없나요 나의 마음은 하늘만큼 커져 가는 나의 사랑을 \r\n\r\n그대의 맑은 두 눈 속에 맺혀진 \r\n슬픈 눈물 속의 사랑을 알고있죠 힘들어하는 걸 \r\n더는 바라볼 순 없어 이젠... \r\n\r\nOh Say my name girl~ Girl I need you want for me \r\n그댈 바라보는 날 느낄 수 만 있다면 \r\n나의 모든 걸 다해 줄 수 있다면 더는 바라지 않아요 Baby \r\n\r\nOh Say my name girl~ Girl I need you want for me \r\n그댈 위해서 라면 난 아무렇지 않죠 \r\n사는 날까지 아니 그 이상까지 그댈 위해 \r\n나 살아갈 테니 Say my name</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/312/15026312_1323138825496_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130919, lowkey: nil, highkey: nil},
  {album_id: 94, singer_id: nil, team_id: 33, title: "Trust", genre1: "가요", genre2: "R&amp;B/소울", runtime: "04:35", lyrics: "\n\t\t\t\t\t\t\t<div>Trust - 04:35</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">오늘 하루도 내 것이 아니였죠 한숨뿐이죠 \r\n내일 하루도 그럴거예요 그대 마음 안에 들어갈 \r\n비밀의 주문을 찾기 전까진 난 매일이 백년 같겠죠 \r\n\r\n난 그대 방에 거울이 되고 싶죠 \r\n하루에도 몇번씩 그댈 마주 볼 수 있게 너무 궁금한 그대 맘을 볼 수 있게요 \r\n\r\n눈을 감아도 눈을 떠봐도 떠오르는 그대 얼굴에 난 힘이 들어요 \r\n보고 싶은데 안고 싶은데 현실은 그게 아니란 게 난 너무 슬퍼져요 \r\n\r\n알고 있나요 내가 곁에 있는걸 그대 웃음 그대 눈물에 \r\n울고 웃는 나를 알고 있다면 이젠 맘을 열어주세요 \r\n\r\n아주 조금씩 아주 천천히 준비해 온 나의 큰 사랑이 헛되지 않길 \r\n나는 바래요 나는 믿어요 조금씩 그대 내 곁으로 오리라 난 믿어요 \r\n\r\n돌아갈 곳이 없는 난 그댈 떠날 수도 없으니까요 \r\n\r\n내 맘 아나요 알아야 해요 날 너무 오랜 시간 혼자 두진 말아요 \r\n기다릴게요 기다려야죠 언젠간 그대 내 곁으로 오리라 난 믿어요</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/312/15026312_1323138825496_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130920, lowkey: nil, highkey: nil},
  {album_id: 94, singer_id: nil, team_id: 33, title: "No More Games", genre1: "가요", genre2: "R&amp;B/소울", runtime: "03:38", lyrics: "\n\t\t\t\t\t\t\t<div>No More Games - 03:38</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">깨어 날수도 없는 그 깊은 꿈들이 나를 더욱더 힘들게 해 \r\n만질 수 조차 없는 너의 형상이 더 깊어지는 어둠 속에 날 잊게 해 \r\n\r\nchorus) \r\nI'm sick and tried of all the games you play \r\nWhy you wanna go make me walk away \r\n이젠 나의 마음속 깊이 함께 해줘 \r\nSay that you want me you're driving me insane \r\nReally don't wanna give up on this game \r\n견딜 수 없는 슬픔 속의 날 데려가 줘 \r\n\r\nRap) \r\nYo baby girl tell me what's on ya mind 'Cause knowing \r\nthat you all upset simply hurts inside \r\nI'm breaking down 'cause you keeping shhh behind my back \r\nWhy you gotta keep playin',as a matter \r\nof fact I'm done, through with you, sick of all ya lies \r\nand games Everytime I ask questions, \r\nyou be actin' strange Now holla back\r\n if ya feelin freak nasty Hunnie hit me up 2-way if ya want me \r\n\r\n네가 알지 못하는 긴 기다림 속에 더 이상 난 견딜 수가 없어 \r\n널 느낄 수 있도록 함께 있어 줘 내 깊은 마음속에 어둠이 내려지기 전에 \r\n\r\nchorus) \r\nI'm sick and tried of all the games you play\r\n Why you wanna go make me walk away \r\n이젠 나의 마음속 깊이 함께 해줘 Say \r\nthat you want me you're driving me insane \r\nReally don't wanna give up on this game \r\n견딜 수 없는 슬픔 속의 날 데려가 줘 \r\n\r\n아무것도 난 복 수 없어 끝이 없는 너의 생각 뿐 \r\n(This time) I've realized that I'm better\r\n off on my own Baby step to me before I'm gone \r\n\r\nRap) \r\nA-yo Listen up closely 'cause you and I Touch \r\nand kissin' is supposed to be I wonder why \r\nbut you gotta keep on lyin to me just tell me \r\nwhy 'cause I can find another girl to freak \r\nIt's hard for me to see you cheat and lyin' constantly \r\nAnd everytime I come around you always \r\ngot some beef But all I wanna know is \r\nwhy you gotta act a fool Eventually what goes around \r\nwill come around to you No Doubt \r\n\r\n* chorus</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG