  {album_id: 94, singer_id: nil, team_id: 33, title: "In Love", genre1: "가요", genre2: "R&amp;B/소울", runtime: "04:05", lyrics: "\n\t\t\t\t\t\t\t<div>In Love - 04:05</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">단 하룰 살 수 있다면 난 어떤 생각이 날까.. \r\n너에게로 난 달려가겠지 \r\n망설일 시간도 눈물도 필요 없겠어 \r\n너 하나로 난 충분하니까.. \r\n\r\n그래서 싫었었나봐 세상을 마주하기엔 \r\n니가 없인 너무 모자란 내가 \r\n\r\nIf I ever have to say goodbye... \r\n시간의 끝인걸 단 한번도 놓지 않을 테니 \r\n\r\n바르게 살아야만 하겠어 \r\n언젠가 데려갈 때면 혹시 기다릴지 몰라 \r\n난 욕심이 생겨 끝이란 없었으면 해 \r\n이 순간이 잠들지 않도록 \r\n\r\n그래서 두려웠나봐 모든 게 끝이 있기에 \r\n허나 이젠 눈을 뜨고 있잖아 \r\n\r\nIf I ever have to say goodbye... \r\n시간의 끝인걸 또 다른 이유를 난 알지 못하니 \r\n내게 남은 날이 다 가고, 꿈꾸지 못한데도 \r\nI will only have a dream of U again \r\n어떤 날이 의미 없는 하루 있을까... \r\n함께 있는 날들엔 찾을 수 없어 \r\n\r\nIf I ever have to say goodbye... \r\n시간의 끝인걸 또 다른 이유를 난 알지 못하니 \r\n내게 남은 날이 다 가고, 꿈꾸지 못한데도 \r\nI will only have a dream of U \r\n너 하나로 나는 충분하니까.....\r\nwith you I will only ever be in love with you</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/312/15026312_1323138825496_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130922, lowkey: nil, highkey: nil},
  {album_id: 94, singer_id: nil, team_id: 33, title: "How Many Nights How Many Days", genre1: "가요", genre2: "R&amp;B/소울", runtime: "04:24", lyrics: "\n\t\t\t\t\t\t\t<div>How Many Nights How Many Days - 04:24</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">어젠 너무 지쳐 전활 걸 뻔 했어 \r\n말했잖아 잠시 헤어지기로 \r\n어제로써 벌써 48일째 \r\n이젠 기다림도 무의미해져 (baby) \r\n\r\n다른 사람을 만나도 많은 친구를 만나도 \r\n마음한구석 허전함의 주인공은 너 \r\n(이젠 돌아와 줘 말 할 수 없는 난 너무 바보같애) \r\n아직 널 기다려 \r\n\r\n이젠 됐잖니 더 이상은 나   \r\nI'll be lost without U by my side I can't go on \r\n니가 보고싶어 (미치도록) \r\n\r\nchorus) \r\nHow many nights, how many days \r\n언제까지 기다려야 그대를 볼 수 있나 \r\n기다림에 지쳐 가는 나를 바라봐 잠시 헤어짐에 \r\n시간이 너를 내게서 빼앗아가 버린 거니, \r\n그럼 그런 거니 아니면 이젠 \r\n내게 돌아 올 수 있는지 내게 가르쳐줘요 \r\n\r\n어디서부터 잘못된 건지 자존심에 \r\n눈이 멀어 볼 수가 없었어 \r\n(그 이후로 내겐 새로운 습관이 생겼어) \r\n하루에도 몇 번씩 들어보는 Empty message \r\n혹시나마 거는 기대는 무너져버리고 \r\n\r\n차라리 화라도 낼 껄 오히려 싸운 뒤라면 \r\n훨씬 쉽지 않았을까 하고 생각해 \r\n(미안해) 잘못 했단 말도 할 수 없는 \r\n난 너무 무기력해 아직도 기다려 \r\n\r\n이젠 됐잖니 더 이상은 나 \r\nI'll be lost without U by my side \r\nI can't go on 니가 보고싶어 baby \r\n\r\n* chorus \r\n\r\n이대로 기다리면 혹시 그냥 잊혀져 갈까봐 난 두려워 \r\n\r\n* chorus \r\n\r\nHow many nights, how many days \r\n기다림에 지쳐가는 나를 바라봐 \r\n헤어짐에 시간이 너를 내게서 빼앗아가 버린 거니, \r\n그런 거니 아니면 이젠 내게 돌아 올 수 있는지 내게 가르쳐줘요</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/312/15026312_1323138825496_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130923, lowkey: nil, highkey: nil},
  {album_id: 94, singer_id: nil, team_id: 33, title: "All My Love", genre1: "가요", genre2: "R&amp;B/소울", runtime: "03:55", lyrics: "\n\t\t\t\t\t\t\t<div>All My Love - 03:55</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">I'll loveing you I will be everything, you're my destiny \r\n\r\n언제 부턴가 나의 꿈속에 자꾸만 \r\n떠오르는 얼굴이 있어 \r\n편안한 오랜 친구로 늘 대했었지만, \r\n부드러운 입술에 입맞추고 싶은 내 맘 \r\n사랑인 것만 같아요, 이런 나의 마음이 장난처럼 웃어넘기지마, \r\n난 이미 너에게 빠져있는걸.. \r\n\r\nchorus) \r\nDon't you know, I can feel you please don't cry \r\nYou don't have to close your eyes \r\n모든 걸 다 줄게, 널 위해 라면 \r\nI can't live, please forgive me steal your heart \r\n날 허락한다면, 나즈막히 네게 말할게 \r\nYou're my everything \r\n\r\nRap) \r\nGirl let's engage in a deep romance \r\nOnly way it's gonna work is if we take a chance \r\nNot too many guys are down with a woman's needs \r\nI'm the type of guy who'll give you \r\neverything so please Understand me, \r\nwhy you waiting Don't know why you hesitating \r\nOther girls have tried before Baby you, \r\nI choose to be my lover \r\n\r\n괜한 고백으로 널 놓치기는 싫은데 \r\n친구처럼 편한 연인으로 영원히 니곁에 머물고싶어.. \r\n\r\n* chorus \r\n\r\n내 맘을 열어 모든 걸, 다 보여 줄 수 있다면 \r\n더 이상 바랄게 없는데.. don't you know...every time \r\n\r\nI can feel you please don't cry \r\nYou don't have to close your eyes \r\n모든 걸 다 줄게, 널 위해 라면 \r\nI can't live, please forgive me steal your heart \r\n날 허락한다면, 나즈막히 네게 말할게\r\n You're my everything</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/312/15026312_1323138825496_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130924, lowkey: nil, highkey: nil},
  {album_id: 94, singer_id: nil, team_id: 33, title: "5 Minutes", genre1: "가요", genre2: "R&amp;B/소울", runtime: "03:16", lyrics: "\n\t\t\t\t\t\t\t<div>5 Minutes - 03:16</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">Rap) \r\nAlways Fussin' &amp; Fightin' How I'm always outta sight'n \r\nYou know what time is it I do my rhymes &amp; music \r\nSo what if I'm suck on K.P.T \r\nIt's never all for me Y'All gotta let me be come on \r\n\r\n차를 타고 나와보니 길이 너무 막혔어.. \r\n한숨이 나왔지만 참았지.. \r\n돌아갈 수 있는 길이 없는 곳인데도 난.. \r\n왜 이렇게 맘이 급해지는 걸까.. \r\n시간은 왜 너무 빠듯한 걸까... \r\n더 이상은 날 기다리지 않을 너니까... \r\n\r\nchorus) \r\n5분쯤은 나를 더 기다려 줄 수 있겠니? (넌 매일 그런 식이잖니..) \r\n5분쯤은 빨리 나왔어야 했는데... (이제 더는 안 봐 주겠어) \r\n그렇지만 이번 역시 기다리고 있겠지.. (그래? 니 맘대로 해) \r\n도착했을 땐 니가 거기 없었어.. (이미 떠나버린 후니까..) \r\n\r\n내가 치를 죄 값이 너무 커.. 조금 늦었다고 나를 떠나버린 너.. \r\n10분 아니고, 9분 아니고.. 5분 늦었다고 이럴 수는 없어.. \r\n\r\n습관적인 나의 버릇일 뿐인데 왜 그래.. \r\n한 두 번 인 것도 아닌데.. \r\n예전처럼 웃어주고 넘길 수가 없을까? \r\n내가 너무 이기적인 것이 잘못, \r\n오랫동안 참아줬던 그녀는 이제.. \r\n더 이상은 내게 기횔 주지 않을 것만 같아 어떡해 \r\n\r\n* chorus \r\n\r\n내가 했던 약속 중에 내가 지킨 건.. 내 기억 속엔 없는 것 같아.. \r\n내게 소중한 사람을 배려한 줄 알았었는데.. 단지 나밖에 몰랐던걸.. \r\n\r\nRap) \r\nNow I'm faced with a dilemma \r\nMe &amp; Them-A Partin' ways and-A \r\nIt's a cryin' shame that my house ain't no home \r\nMy partners avoid me like taxes \r\nSaid I be flakin' too much That I be M.I.A. \r\ntoo much My girl moved back yo her momma house \r\nLeft me askin', \"What's it all about\" So now \r\nit's - 1, 2, 3 My crew &amp; lady just shook the scene \r\nOn the corner of 6th &amp; broadway Wastin' a sunday \r\n\r\n* chorus \r\n\r\n너를 잃어버린 후에 나를 알게 된거야 (자기 자신밖에 몰랐던 걸..) \r\n나를 기다리는 맘을 알지 못했어.. (baby baby.. god I love you so..) \r\n이제부턴 내가 너를 기다리고 있겠어.. (다시 너를 찾겠어..) \r\n너의 가슴에 내가 없을 때까지.. (단 한 사람은 너뿐인걸..) \r\n내가 치를 죄 값이 너무 커.. 5분 안에 내 인생이 변해 버린걸...</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/312/15026312_1323138825496_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130925, lowkey: nil, highkey: nil},
  {album_id: 94, singer_id: nil, team_id: 33, title: "원망 (Tragic Love)", genre1: "가요", genre2: "R&amp;B/소울", runtime: "03:58", lyrics: "\n\t\t\t\t\t\t\t<div>원망 (Tragic Love) - 03:58</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">chorus) \r\n슬픈 비극의 여주인공처럼 내게 다가와 \r\n어느새 날 위한 연극인 것처럼 나를 버리고 떠난 너 \r\n\r\nRap) \r\nBack in the day when I was young\r\n I'm not a kid no more \r\nI've been a fool to all the games \r\nbefore Movin' on 'cause now \r\nI had enough of being abused \r\nThe game was once player Now It's over, ya lose \r\n\r\n차라리 떠나버릴 거라면 좀 더 잔인해져 \r\n지금 니 그 알 수 없는 웃음이 더 나를 괴롭혀 \r\n\r\n* chorus \r\n\r\n어차피 더 비참해진데도 더는 상관없어 끝까지\r\n 날 무시한 채 니맘대로 떠날 거잖아 \r\n\r\n* chorus \r\n\r\n너도 알잖아 내 모든 걸 다 줬던 걸 \r\n마지막이라도 니 진심을 알게해줘 \r\n\r\n* chorus X 2</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/312/15026312_1323138825496_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130926, lowkey: nil, highkey: nil},
  {album_id: 94, singer_id: nil, team_id: 33, title: "Sea Of Love (Fany Version) - Bonus Track", genre1: "가요", genre2: "R&amp;B/소울", runtime: "04:23", lyrics: "\n\t\t\t\t\t\t\t<div>Sea Of Love (Fany Version) - Bonus Track - 04:23</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">언제나 내 꿈엔 비가내려 차가운 바람도 불고 있어 \r\n널 기다리는 내 삶의 끝 본 것만 같아 어떡해 \r\n며칠이 몇 년 같은데 넌 아무렇지 않은지 \r\n한번이라도 너를 보여주겠니 \r\n\r\nchorus) \r\nFor the moon by the sea \r\n니가 떠난 바닷가에 눈물이 마를 때까지 \r\n(다 마를때까지) \r\n사랑한다는 건 오직 기다림뿐이었단 걸 난 왜 몰랐을까 \r\n(난 왜 몰랐을까) \r\n\r\n이제 난 그만 돌아가려 해 너를 몰랐던 그때 네가 없던 세상 \r\n아직은 나에게 내가 전부였던 시절 날 보내 줘 \r\n\r\nFrom the bottom of my heart Girl with you , \r\nI'll be true \r\n모두 거짓말인걸 (거짓말야) 맘은 그렇게 먹지만 \r\n(맘은 그렇게 먹지만) \r\n절대 너인걸 어떡해 죽어도 못 잊겠어 \r\n\r\n* chorus \r\n\r\n널 잊은채로 나도 살고싶어 하지만 \r\n그게 안 돼 아픔만 더해 갈 뿐 \r\n너의 사랑은 끝났지만 \r\n나의 사랑은 이제 막 시작했어 \r\n\r\nFrom the bottom of my heart still i'm falling in love \r\n꿈속에 라도 네가(꿈속에서) 돌아와 Kiss해줘\r\n(나에게 Kiss 한다면) \r\n약속하지 않아도 돼 난 매일 기다릴테니 \r\n\r\n* chorus \r\n\r\n가끔 네눈에 눈물이 고여 흐른다면 \r\n그건 내가 눈물이 말라서 네 눈물 빌린 거야 \r\n돌아와 제발 내게 (난 왜 몰랐을까) \r\n\r\n* chorus X 2 \r\n\r\n내 꿈엔 비가 이젠 그치길....</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/312/15026312_1323138825496_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130927, lowkey: nil, highkey: nil},
