  {album_id: 95, singer_id: 122, team_id: nil, title: "Happy Happy", genre1: "가요", genre2: "발라드", runtime: "02:58", lyrics: "\n\t\t\t\t\t\t\t<div>Happy Happy - 02:58</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">힘겨워 흘린 눈물 당신의 마음속엔 내일이란 없는것 같아요 꿈을 꿀 수 없었죠 \n쉽진 않은 세상에 무릎 꿇어 버린 채 고개 숙여 사는 것 조차도 힘겨웠겠죠 \n누구든지 살다보면 몇 번씩은 좌절하게 되지요 산다는 건 만만치 않죠 그렇지만 오늘은 \n\nchorus) \n모든 것을 잊고 happy happy 웃어봐요 그대의 세상 그댈 위한 노래 always for you 영원하죠 소중한 그대죠 \n\n세상은 말하겠죠 쉽진 않을 거라고 하지만 해 볼만 할텐데요 지금이 시작인걸요 \n괴로움 끝엔 항상 행복이 찾아오죠 누구보다 소중한 그대의 행복인거죠 \n누구든지 살다보면 햇살처럼 기회가 찾아오지요 산다는건 그런거죠 울지말고 일어서요 oh! \n\n* chorus repeat \n알잖아요 지금이 전부가 아닌걸 그댈 사랑하는 많은 사람들이 그댈 그대를 믿어요 \n\n* chorus repeat   \n당신만의 세상이죠~ \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/313/15026313_1323315290090_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 10055, song_num: 16130929, lowkey: nil, highkey: nil},
  {album_id: 95, singer_id: 122, team_id: nil, title: "사랑은 기억보다(Memories)", genre1: "가요", genre2: "발라드", runtime: "05:01", lyrics: "\n\t\t\t\t\t\t\t<div>사랑은 기억보다(Memories) - 05:01</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">한참을 말이 없이 살았죠 말못할 병에 걸린 것처럼 기억조차 하지 못하는 그댈 바라보며 나도 한동안 지운채 살았죠 \n예전 모습 찾지못하는 그댈 나도 그댈 기억 못하는 것처럼 거짓말같은 현실이 아니기를 \n\nchorus) \n모르겠죠 내가 누군지 기억나지 않겠죠 우리 행복했던 그 많은 시간 추억도 이젠 모두 다 지워져있겠죠 \n\n단 한번 내가 예전 그댈 볼수있다면 그럴순 없겠지만 단 한번인데 그것도 안되는거죠 그대에게 난 모르는 사람이죠 \n사랑도 기억보다 먼가요 우리 추억 기억보다 먼가요 내눈을 봐요 오랜 시간 함께 했던 내가 보이지 않나요 볼 수 없나요 \n\n* chorus repeat \n\n단 하루라도 내가 살아 낼 수 있을지 그럴수는 없겠죠 \n단 한번쯤은 괜찮아 질 수 없는지 나도 기억나지 않는 사람처럼 그대에게 난 모르는 사람이죠</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/313/15026313_1323315290090_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130930, lowkey: nil, highkey: nil},
  {album_id: 95, singer_id: 122, team_id: nil, title: "Propose", genre1: "가요", genre2: "발라드", runtime: "04:24", lyrics: "\n\t\t\t\t\t\t\t<div>Propose - 04:24</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">어떤 말부터 꺼내야할지 \r\n어떤 말이 멋질지 \r\n왠지 평소완 다른 내가 \r\n이상해 보이진 않을지 \r\n\r\n어디가 좋을지 고민했어 \r\n어떤 곳이 멋질지 \r\n우리 첨 만났던 이 카페 \r\n이젠 또 다른 두 번째 고백인걸 \r\n\r\n가끔은 이기적인 내가 \r\n많이 힘들었단 걸 알아 \r\n하지만 조금씩 달라질 \r\n내 고백을 받아줄래\r\n\r\n너 없인 옷도 난 잘 고르질 못하잖아 \r\n방도 항상 지저분할 것 같아 \r\n니가 없으면 술에 취한 날들만 \r\n늘어갈 것만 같은데 \r\n너 없인 늦잠 자는 날 깨울 수가 없어 \r\n식사도 제대로 하지 않겠지 \r\n무엇보다 니가 없인 단 하루도 \r\n살수가 없어 \r\n나와 결혼해 주겠니\r\n\r\n\r\n이런 말 나도 많이 어색해 \r\n너의 맘은 어떤지 \r\n왜 자꾸 웃기만 하는 거니 \r\n이런 내 모습이 혹시 낯선 거니 \r\n\r\n때론 힘든 날도 있겠지 \r\n때론 다투기도 하겠지 \r\n하지만 세상 그 무엇도 \r\n우릴 갈라 놓을 순 없어\r\n\r\n너 없인 옷도 난 잘 고르질 못하잖아 \r\n방도 항상 지저분할 것 같아 \r\n니가 없으면 술에 취한 날들만 \r\n늘어갈 것만 같은데 \r\n너 없인 늦잠 자는 날 깨울 수가 없어 \r\n식사도 제대로 하지 않겠지 \r\n무엇보다 니가 없인 단 하루도 \r\n살수가 없어 \r\n나와 결혼해 주겠니\r\n\r\n\r\n아무리 생각해봐도 \r\n멋진 말이 떠오르지가 않아 \r\n매일 아침 눈을 뜰 때마다 \r\n니가 곁에 있으면\r\n\r\n이젠 날 어떻게 부를 건지 생각했니 \r\n예전처럼 오빠라 부를 거니 \r\n아기들은 몇이나 가질거니 \r\n난 둘이면 딱 좋은데 \r\n널 만난 이 세상에 감사 드리며 살게 \r\n혹시 넌 내 마음 알고는 있니 \r\n어떤 두려움 망설임도 없이 \r\n널 선택했어 \r\n그만큼 너를 사랑해</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/313/15026313_1323315290090_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 10103, song_num: 16130931, lowkey: nil, highkey: nil},
  {album_id: 95, singer_id: 122, team_id: nil, title: "바다(Summer)", genre1: "가요", genre2: "발라드", runtime: "00:48", lyrics: "\n\t\t\t\t\t\t\t<div>바다(Summer) - 00:48</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가사 정보가 없습니다.</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/313/15026313_1323315290090_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130932, lowkey: nil, highkey: nil},
  {album_id: 95, singer_id: 122, team_id: nil, title: "고백(Confession)", genre1: "가요", genre2: "발라드", runtime: "04:31", lyrics: "\n\t\t\t\t\t\t\t<div>고백(Confession) - 04:31</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">그래요 그대 마음 나에게 다가와 주길 바래요 그대의 슬픈 눈빛 속에 내가 들어가길 바래요 \r\n안되겠죠 내맘을 그렇게 쉽게 받아줄순 없겠죠 하지만 그대 문을 열고 날 받아주길 바래요 \r\n\r\nchorus) \r\n많은 날들을 그댈위해 포기할수 있어요 소중한건 그대 하나 뿐인 걸 이해할수 있나요 \r\n\r\n수많은 내 사람이 별 되어 그대 곁에 지켜줄께요 포근한 밤 그대와 함께 잠들고 싶은데 \r\n부족한게 많지만 모든걸 그대에게 드릴테니 내 사랑 부디 내 작은 꿈을 받아주길 바래요 \r\n\r\n* chorus repeat \r\n\r\n고마워요 내 맘을 받아준 그댈 위해 난 살께요 그대 모습이 빛 바래져도 그댈 사랑할께요 \r\n그댈 사랑할께요 그댈 사랑할께요</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/313/15026313_1323315290090_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130933, lowkey: nil, highkey: nil},
  {album_id: 95, singer_id: 122, team_id: nil, title: "The Best", genre1: "가요", genre2: "발라드", runtime: "02:52", lyrics: "\n\t\t\t\t\t\t\t<div>The Best - 02:52</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">많은 시련들을 이겨내며 많은 고통들을 견뎌내며 이 자리에 올수있었던건 너의 그 사랑인걸 \r\n어느샌가 변해가는 너를 잡지 못한 초라했던 내가 이젠 모든것이 달라졌어 내가 너의 The best \r\n너를 잃고 눈물로 지새던 밤이 지나고 이젠 모두 완전해진 나의 사랑을 \r\n\r\nchorus) \r\n거부하려해도 소용없어 절대 너는 돌아설수 없어 이젠 절대 포기할수 없어 삶의 이유를 아무 걱정도 이젠 하지마 \r\n\r\n두번 다시 너는 울지않아 이미 완전해진 나의 사랑이 너를 지켜줄 거라는걸 \r\n내가 살아가는 순간동안 나의 삶을 완전하게 한 건 오직 너만이 할수가 있어 넌 나만의 The best \r\n슬픔속에 눈물로 지냈던 많은 날들에 더욱 강해져 완전해진 내 사랑을 \r\n\r\n* chorus repeat \r\n\r\n결국 내가 살아내는 건 네가 이 세상에 있다는 그것 조금 늦는것쯤 상관없어 \r\n조금도 난 흔들림이 없어 나를 가로막던 현실조차 멈출순 없어 사랑해 사랑해 이말 뿐 인걸 \r\n완전한 나의 사랑을 받아줘 이젠 아무것도 거칠것이 없는 새로운 나의 사랑인걸</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/313/15026313_1323315290090_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 10171, song_num: 16130934, lowkey: nil, highkey: nil},
  {album_id: 95, singer_id: 122, team_id: nil, title: "노을(Autumn)", genre1: "가요", genre2: "발라드", runtime: "00:33", lyrics: "\n\t\t\t\t\t\t\t<div>노을(Autumn) - 00:33</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가사 정보가 없습니다.</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/313/15026313_1323315290090_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130935, lowkey: nil, highkey: nil},
  {album_id: 95, singer_id: 122, team_id: nil, title: "추억은 기억보다(Memories #2)", genre1: "가요", genre2: "발라드", runtime: "04:38", lyrics: "\n\t\t\t\t\t\t\t<div>추억은 기억보다(Memories #2) - 04:38</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">어쩔수 없어요 그렇게 말처럼 쉽지가 않네요 \r\n늘 같은 곳 이곳에 있는 일 \r\n우리 약속 난 지켜내고 싶어었는데 어쩔수없었죠 \r\n시간이 갈수록 멀어져가는건 붙잡아 낼 힘이 없었죠 \r\n두 눈을 감으면 볼수 있던 그댈 이젠 볼수가 없죠 \r\n\r\nchorus) \r\n조금만 서둘러줘요 제발 조금만 기억해내요 제발 조금 더 생각해봐요 아주 잠시만이라도 조금도 남아있질 않나요 \r\n\r\n조금도 기억나질 않나요 내가 더 지치기전에 아주 조금만 서둘러줘요 그대가 없이도 또 하룰 살아냈죠 \r\n조금씩 천천히 그대 없는 텅 빈 그 자리가 익숙해져가죠 \r\n그대의 자리가 점점 좁아져가죠 \r\n\r\n* chorus repeat \r\n\r\n가끔은 생각나지 않나요 가끔 내가 그립지않나요 그렇게 오랜 시간을 우린 함께했잖아요 \r\n셀 수 없이 많이 울었는데 난 그랬다 말하고 싶은데\r\n 마지막 말은 못했었는데 이게 끝이면 난 어쩌죠 \r\n조금만 서둘러줘요</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/313/15026313_1323315290090_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130936, lowkey: nil, highkey: nil},
  {album_id: 95, singer_id: 122, team_id: nil, title: "Flower", genre1: "가요", genre2: "발라드", runtime: "04:43", lyrics: "\n\t\t\t\t\t\t\t<div>Flower - 04:43</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">벌써 많은 시간이 흘러지나갔죠 우리 헤어진 시간 그 만큼 길어졌죠 난 아무것도 변한게 없이 그대로죠 \n믿을수 없다 하지만 사실인걸요 괜찮아질거라고 잠시일 뿐 인거라고 나를 타일렀지만 그게 잘 안되나 봐요 \n습관이 돼버려서 이제는 조금씩 나도 그대 없는 시간이 익숙해져만 가는데 \n\nchorus) \n기억해 우리 함께 였었던 그 많은 시간을 내게로 돌아와요 사랑해요 그대를 지금도 내게는 당신이 전분걸요 \n\n많은 시간이 지나가도 언제까지나 기다릴께요 당신께 약속해요 민들레 꽃처럼요 \n사랑은 이런거라고 친구들에게 말해도 모두가 나를 놀리죠 하지만 괜찮아요 세상이란 모두다 사람이란 모두다 \n시간이 지나가면 모두다 잊게 된다고 하지만 왠지 나는 시간이 지나갈수록 더욱 깊어만가죠 그댄 내 곁에 없는데 \n\n* chorus repeat \n이제는 잊어야겠죠 지쳐버린 하루 끝에 그댈 남겨두는 습관조차 이제는 익숙해져야 하는데 우~ \n\n* chorus repeat \n우리 함께였었던 그 많은 시간을 내게로 돌아와요 사랑해요 그대를 지금도 내게는 당신이 전분걸요 \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/313/15026313_1323315290090_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130937, lowkey: nil, highkey: nil},
  {album_id: 95, singer_id: 122, team_id: nil, title: "2032 In CUBA", genre1: "가요", genre2: "발라드", runtime: "03:54", lyrics: "\n\t\t\t\t\t\t\t<div>2032 In CUBA - 03:54</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">햇살이 잠든 고요한 적막속에 어둠속에서 날 비추는 외로운 불빛만 벌써 일년이죠 \r\n당신이 떠난지도 나에겐 운명이죠 이별의 아픔들도 운명인 것처럼 늘 난 그 자리죠 \r\n떠나간 여기 이곳에 나 홀로 남겨져 슬픔 뿐이라 해도 늘 기다리죠 우리 처음 만난 이곳을 기억이나 할까요 \r\n내 기억속에 그대는 언제나 그대로죠 항상 이곳에 있죠 돌아올 수 있다면 난 기다릴께요 \r\n서른해 후의 쿠바로 모두 변하겠죠 그때가 찾아오면 변하지 않은 나의 미소로 늘 이 자리에 있죠</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/313/15026313_1323315290090_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130938, lowkey: nil, highkey: nil},
  {album_id: 95, singer_id: 122, team_id: nil, title: "눈(Winter)", genre1: "가요", genre2: "발라드", runtime: "00:43", lyrics: "\n\t\t\t\t\t\t\t<div>눈(Winter) - 00:43</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가사 정보가 없습니다.</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/313/15026313_1323315290090_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130939, lowkey: nil, highkey: nil},
  {album_id: 95, singer_id: 122, team_id: nil, title: "야상곡(Nocturne)", genre1: "가요", genre2: "발라드", runtime: "04:04", lyrics: "\n\t\t\t\t\t\t\t<div>야상곡(Nocturne) - 04:04</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">잊혀지겠죠 다신 볼 순 없겠죠 아직 남겨진 약속처럼 그런거겠죠 사랑한단 말로도 붙잡을 순 없는거겠죠 \r\n\r\n나의 슬픔이 지워져도 내 미련이 사라져도 그때 다시 돌아와도 나 변함없다해도 늘 그랬듯 지금처럼 \r\n그댈 보낸 나처럼 나 또다시 바보처럼 잡지못하겠죠 \r\n\r\n언젠가는 잊혀질 이름 세월에 사라질 이름 내안의 그대여 나의 눈물의 약속들을 내 슬픔의 외로움을 \r\n내 꿈결의 추억들을 지운채 살겠지만 사랑해요 늘 그랬죠 떠나보냈던 내가 수많은 날을 견딘건 기다림이었죠 \r\n\r\n언젠가는 잊혀질 이름 세월에 사라질 이름 내안의 그대여 나의 눈물의 약속들을 내 슬픔의 외로움을 \r\n기억속에 남아있는 내 모습이 아름다울 수 있게 이젠 우~ \r\n\r\n나의 슬픔이 지워져도 내 미련이 사라져도 그때 다시 돌아와도 나 변함없다해도 늘 그랬듯 지금처럼 \r\n언젠가는 잊혀질 이름 세월에 사라질 이름 내안의 그대여 나의 눈물의 약속들을 내 슬픔의 외로움을</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/313/15026313_1323315290090_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130940, lowkey: nil, highkey: nil},
  {album_id: 95, singer_id: 122, team_id: nil, title: "이별 후에는(One Snowing Day)", genre1: "가요", genre2: "발라드", runtime: "04:33", lyrics: "\n\t\t\t\t\t\t\t<div>이별 후에는(One Snowing Day) - 04:33</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">그런가봐요 많은 시간이 흘러도 변하지 않는건 그럴수 있는건 때로는 웃고 때로는 울고 또 많이 아프기도 하지만 \r\n누군가 있어 내가 행복하다는 건 그것만으로도 큰 의미가 되죠 오늘이 아프더라도 내일은 언제나 당신곁에 있죠 \r\n\r\nchorus) \r\n사랑 그대로의 사랑은 이별 그대로의 이별임을 영원히 함께 하자던 약속도 결국엔 그때만의 꿈이죠 \r\n\r\n끝내 말못한 그 마음은 끝내 지워지지 않음을 영원히 함께인거죠 사랑은 결국엔 그런 추억인거죠 \r\n그저 멀리서 슬픔속에서 바라보는건 힘에 겹겠죠 잊는다는 건 지운다는 건 그것만으로도 \r\n\r\n* chorus repeat \r\n\r\n그런가봐요 많은 시간이 흘러도 변하지 않는 건 그럴수 있는 걸 오늘이 아프더라도 내일은 언제나 당신 곁에 있죠 \r\n그렇게 모든건 다시 시작되죠</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/313/15026313_1323315290090_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130941, lowkey: nil, highkey: nil},
  {album_id: 95, singer_id: 122, team_id: nil, title: "상록수(Pine Tree)", genre1: "가요", genre2: "발라드", runtime: "04:38", lyrics: "\n\t\t\t\t\t\t\t<div>상록수(Pine Tree) - 04:38</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">끝내 말하지 못했어 \n돌아서는 마지막 순간까지 \n\n알아 돌이킬수가 없단걸 \n하지만 쉬운 일이 아닌걸 \n\n널 지우는 일 아직 모든것이 \n너무나 그대로 남아 아프게 해 \n\n*돌아올수 있는 거라면 \n내가 기다려도 괜찮은 거라면 \n언제라도 이자리로 돌아올수 있게 \n너의 곁에서 멀리가진 않을께 이젠~ \n\n이젠 텅빈 그 자리엔 \n웃고있는 네 사진뿐이지만 \n하지만 내가 견딜수 없이 힘든건 \n어디선가 너도 많이 아파서 울진 않을지 \n지금 내모습이 너무도 바보같지만 널 사랑해 \n\n*반복 \n\n혹시라도 힘든 거라면 \n바보처럼 날 떠나 울고있다면 \n이제라도 내곁으로 돌아와 주겠니 \n부족하지만 널 영원히 지킬게 \n널사랑해 \n\n다시 돌아온다는 그 약속조차 \n이제 모두 없겠죠 \n\n네가 남긴 추억하나면 \n아무 욕심없이 살아갈거라고 \n난 괜찮아 세상에 살아가는 동안만 널 맡긴거야 \n잠시뿐인 이별도~ \n널사랑해 \n\n돌아올수 있는거라면</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/313/15026313_1323315290090_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130942, lowkey: nil, highkey: nil},
  {album_id: 96, singer_id: 123, team_id: nil, title: "Present : 포켓속의 그댄(Love In My Pocket)", genre1: "가요", genre2: "락", runtime: "04:14", lyrics: "\n\t\t\t\t\t\t\t<div>Present : 포켓속의 그댄(Love In My Pocket) - 04:14</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">하얀 겨울날 온 세상을 밝혀주는 사람 \r\n아침에 눈을 뜨면 따뜻한 햇살과 함께\r\n\r\n*너무 기다려온 하얀 눈이 와 \r\n맑고 하얀 그댈 닮은 파란하늘아래\r\n온 세상 하얗게 너무나 예쁘게 물들었네요\r\n눈이 와 눈이 와 눈이 와 너무나도 난 기쁘죠 \r\n세상엔 우리뿐이죠 아무도 부럽지 않죠\r\n그대만 사랑할래요 내 사랑~ \r\n창문을 열면 소복이 쌓여있는 눈 위에 \r\n커다랗고 귀여운 눈사람\r\n그 옆엔 당신이 서 있네요\r\n\r\n너무나 사랑스런 우리의 사랑처럼\r\n하얀 눈 위에 당신께 달려가죠 \r\n사랑의 크기만큼 한가득 두 팔 벌려 안아줄래요\r\n\r\n* Repeat \r\n\r\n지난 겨울에 너무나 외로운 어느 날 \r\n창 밖의 눈이 싫어 문닫고\r\n츄리에 플러그도 빼버렸죠\r\n\r\n하지만 나 지금은 이 추운 겨울이 좋아\r\n손이 시렵다고 나의 주머니에 너의 손을 넣고 \r\n나는 그 손을 잡죠\r\n얼굴이 빨개지네요\r\n\r\n너무 기다려온 하얀 눈이 와 내 맘을 환하게 비추고\r\n이젠 더 이상 외롭지도 슬프지도 않아요\r\n눈이 와 눈이 와 눈이 와 온 세상의 하얀 눈이\r\n그대의 두 눈 속에 행복한 나의 얼굴 \r\n하얀 천사들 같아요 우리는</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/314/15026314_1323314872274_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130943, lowkey: nil, highkey: nil},
  {album_id: 96, singer_id: 123, team_id: nil, title: "Present : Alone", genre1: "가요", genre2: "락", runtime: "03:38", lyrics: "\n\t\t\t\t\t\t\t<div>Present : Alone - 03:38</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">나 밖에 왜 커져가라 모든 것이 아픔으로 바래\r\n그걸 원하는 거라 생각하고 싶진 않아 난 뺏긴\r\n나의 모든 것을 찾고 싶어 그냥 난 이제 돌아 \r\n갈 수도 없는 길을 걸어 가 책임 없는 아픔으로\r\n의미 없는 손짓으로 나를 점점 잡아 끌어도 난\r\n어쩔 수도 없이 여태 수 없이 \r\n\r\n이제 와 후회해도 소용 없어 괜찮아\r\n걱정하지마 더 힘들게 하지마\r\n난 모든 것을 잃어 갔어\r\n나의 의지와는 상관 없이\r\n내 곁에는 그 모두가 다른 눈을 가졌어\r\n나 태어나지 않았다면 \r\n차라리 나 그랬다면 워어~\r\n넌 이해 못 해\r\n\r\n첨부터 원하지 않은 건지 내가 존재한 이후 후회한건지 \r\n나에 대한 이 모든 걸 모른 척 하겠지 \r\n왜 내게 그래야 했었는지 듣고 싶지 않아 이유가 어쨌건\r\n이제 와 그게 무슨 소용인 건지 왜 왜 내게만 이래\r\n\r\n어떻게 된 건지 난 모르겠어 모든 게\r\n내게만 이래 왜 버려야만 했어\r\n난 모든 것을 잃어갔어 \r\n나의 의지와는 상관 없이\r\n내 곁에는 그 모두가 다른 눈을 가졌어\r\n나 태어나지 않았다면 차라리 나 그랬다면 워어~\r\n넌 이해 못 해\r\n\r\n그래 영원하지 못 하는 한 순간이라도 당신을\r\n나 볼 수 있다면 제발~\r\n처음으로 다시 돌아가도 이제 모든 것이 변해 있겠지\r\n그래도 난 상관 없어 날 사랑으로 지켜 준다면\r\n다 이해 할게</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/314/15026314_1323314872274_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130944, lowkey: nil, highkey: nil},
