  {album_id: 96, singer_id: 123, team_id: nil, title: "Media", genre1: "가요", genre2: "락", runtime: "05:25", lyrics: "\n\t\t\t\t\t\t\t<div>Media - 05:25</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">Media media media 거짓을\r\nMedia media media 진실로\r\n\r\nMedia 너의 맘을 찢어주고\r\nMedia 너의 꿈을 망쳐 줄께\r\n\r\nMedia media media 거짓을\r\nMedia media media 진실로\r\n\r\nMedia 너의 맘을 찢어주고\r\nMedia 너의 꿈을 망쳐 줄께</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/314/15026314_1323314872274_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130946, lowkey: nil, highkey: nil},
  {album_id: 96, singer_id: 123, team_id: nil, title: "My Life Is...And My Way", genre1: "가요", genre2: "락", runtime: "04:27", lyrics: "\n\t\t\t\t\t\t\t<div>My Life Is...And My Way - 04:27</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">Take my hand 내가 살아가는 이유 \r\nand My Way 나의 음악을 위해\r\n나의 노래 외로운 길이라도 나 살아갈 어려운 길이라도\r\n\r\n나의 노래 외로운 길이라도 나 살아갈 어려운 길이라도\r\n가끔씩 때론 힘겨워 하지만 난 오늘도 내 길을 걸어가네\r\n\r\n나의 음악 나의 얘기 모두를 난 하나의 글로 써내려가네\r\n\r\n*Take my hand 내가 힘겨울 때마다 \r\nand My Way 난 다시 또 일어나\r\nTake my hand 내가 살아가는 이유 \r\nand My Way 나의 음악을 위해\r\n\r\n*Repeat</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/314/15026314_1323314872274_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130947, lowkey: nil, highkey: nil},
  {album_id: 96, singer_id: 123, team_id: nil, title: "아낌없이 주는 나무(Generous)", genre1: "가요", genre2: "락", runtime: "03:43", lyrics: "\n\t\t\t\t\t\t\t<div>아낌없이 주는 나무(Generous) - 03:43</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">그대에게 하고픈 말 사랑해요 사랑한단 말뿐이죠\r\n왜 못 듣죠 내가 한 말 우리 서로 다른 길에 서있는 거겠죠 \r\n안돼 안돼 왜 아파만 해요\r\n난 아무것도 그대에 모든 걸 해줄 수가 난 없는데\r\n\r\n오직 나만이 당신을 안아줄 수가 없는걸\r\n내가 할 수 있는 것이 아무것도 없는 비참한\r\n앙상한 가지의 초라한 보잘것없는 나의 존재 앙상한 마른 나 일뿐\r\n항상 너의 뒤에서 그립겠죠 그대 눈에 내가 비춰 보이던 그때가\r\n\r\nA time for us 커져만 가는 비참한 현실 Go 꺼져만 가는 잿빛 불씨 나의 존재 \r\nA time for us\r\n\r\n그대에겐 내가 보이나요\r\n난 아무것도 보이지 않는걸 나의 마음 그리고 나\r\n\r\n그리워요 그리워요 그대 눈에 내가 비춰 보이던 그때\r\n사랑해요 사랑해요 그대 내겐 나의 마지막 사랑이겠죠</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/314/15026314_1323314872274_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130948, lowkey: nil, highkey: nil},
  {album_id: 96, singer_id: 123, team_id: nil, title: "몇년이 지나도(Longing For You)", genre1: "가요", genre2: "락", runtime: "05:21", lyrics: "\n\t\t\t\t\t\t\t<div>몇년이 지나도(Longing For You) - 05:21</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">왜 나만 그리워해 넌 대답도 없는데\r\n넌 잘 살고 있는데 왜 나만 이렇게 그리워 해야해\r\n\r\n왜 나만 그리워해 넌 대답도 없는데\r\n너 그리워서 그리워도 없는걸\r\n몇 년이 지났는지 난 지금도 너무 힘이 들어\r\n당신은 날 잊고 지내나요\r\n몇 년이 흘렀어도 난 그댈 지금도 잊고 있죠\r\n\r\n행복하단 말 괜찮단 말들로 나를 달래 보려해도\r\n몇 년이 지나도 그랬어도 이젠 잘 되지 않는걸\r\n\r\n왜 나만 그리워해 넌 대답도 없는데\r\n너 그리워서 그리워도 없는걸\r\n몇 년이 지났는지 난 지금도 너무 힘이 들어\r\n당신은 날 잊고 지내나요\r\n몇 년이 흘렀어도 난 그댈 지금도 기억해요\r\n\r\nOh~ 나에 곁에 마지막이기를 나는 Oh~\r\n행복하단 말 괜찮단 말들로 나를 달래 보려해도\r\n몇 년이 지나도 그랬어도 이젠 잘 되지 않는걸\r\n그대여...</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/314/15026314_1323314872274_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130949, lowkey: nil, highkey: nil},
