  {album_id: 96, singer_id: 123, team_id: nil, title: "눈물이 마른 뒤(Love Theme 2)", genre1: "가요", genre2: "락", runtime: "04:20", lyrics: "\n\t\t\t\t\t\t\t<div>눈물이 마른 뒤(Love Theme 2) - 04:20</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">항상 모든 이가 그러했듯 나에게도 찾아왔지\r\n사랑이란 이름의 그리움이란 것\r\n\r\n이별은 준비되어 있고 잊지 못하는 일은\r\n예견된 슬픔이란 걸 그게 사랑인 걸\r\n\r\n사랑이란 말 없이 찾아오고 이별을 또 준비하고\r\n그것은 그리움 되어 그녀도 그러했듯이\r\n\r\n이별은 준비되어 있고 잊지 못하는 일은\r\n예견된 슬픔이란 걸 그게 사랑인걸\r\n\r\n사랑이란 말 없이 찾아오고 이별을 또 준비하고\r\n그것은 그리움 되어 그녀도 그러했듯이 그 사랑\r\n은 또 떠나가네\r\n\r\n살아가는 빛이 되어주고 나의 길이 되어주고\r\n사랑이란 작은 바램들로 나를 속이는걸\r\n\r\n사랑이란 말 없이 찾아오고 이별을 또 준비하고\r\n그것은 그리움 되어 그녀도 그러했듯이 \r\n그녀도 그러했듯이 그 사랑은 또 떠나가네</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/314/15026314_1323314872274_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130951, lowkey: nil, highkey: nil},
