  {album_id: 96, singer_id: 123, team_id: nil, title: "내 마음은..(I Still Believe)", genre1: "가요", genre2: "락", runtime: "03:23", lyrics: "\n\t\t\t\t\t\t\t<div>내 마음은..(I Still Believe) - 03:23</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">언제나 함께 라고 나 믿으며 다시는 나 울지 않을게\r\n언제나 내 옆에 있어 주겠니 나 이제 외롭지 않아 \r\n나 여기에 서기까지 너무나 외롭고 또 많이 아팠어 (울지마)\r\n난 외로운 혼자가 싫어 나 옛날로 돌아가고 싶어(그때로)\r\n\r\n언제나 함께 라고 나 믿으며 다시는 나 울지 않을게\r\n언제나 내 옆에 있어 주겠니 나 이제 외롭지 않아\r\n\r\n너희를 사랑한다 말하면서 난 너희를 슬프게 했어\r\n하지만 내 마음은 그게 아닌걸 이런 날 이해해 주겠니\r\n\r\n너희 여기에 오기까지 너무나 힘들고 또 많이 아팠어 (미안해)\r\n날 기다린 나의 너희에 그 예쁜 마음 지키고 싶어 (정말이야)\r\n\r\n지치고 힘들어 견딜 수 없어도 너희를 위해 노래할게\r\n내 앞에 기다려준 너희를 위해 언제나 난 노래할게\r\n\r\n지치고 힘들어 견딜 수 없어도 너희를 위해 노래할게\r\n내 앞에 기다려준 너희를 위해 언제나 난 노래할게\r\n\r\n언제나 함께 라고 나 믿으며 다시는 나 울지 않을게\r\n언제나 내 옆에 있어 주겠니 나 이제 외롭지 않아\r\n\r\n언제나 함께 라고 나 믿으며 다시는 나 울지 않을게\r\n언제나 내 옆에 있어 주겠니 나 이제 외롭지 않아\r\n\r\n언젠가 너희들이 어른이 돼서 그때가 언제라 해도\r\n내 앞에 사랑하는 너희를 위해 언제나 난 노래할게</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/314/15026314_1323314872274_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130953, lowkey: nil, highkey: nil},
  {album_id: 96, singer_id: 123, team_id: nil, title: "내일이 찾아오면(New Mix-Down)", genre1: "가요", genre2: "락", runtime: "03:41", lyrics: "\n\t\t\t\t\t\t\t<div>내일이 찾아오면(New Mix-Down) - 03:41</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">푸른 바다 저 멀리서 나를 부르는 \r\n파도처럼 밀려오는 너의 모습이\r\n메마른 나의 마음속에 살며시 다가오면 \r\n잃어버린 시간 속에 나의 꿈들이 \r\n하나둘씩 기억 속에 되살아나고\r\n새로운 부푼 희망 속에 가슴은 설레이네\r\n행복이란 멀게만 느껴지지만 우리마음 속에 있는걸\r\n\r\n언젠가는 너에게 말해 줄 꺼야 내일이 찾아오면\r\n너의 고운 두 손 가득히 나의 꿈을 담아주고서\r\n이대로의 너의 모습을 사랑하고 있다고\r\n저기멀리 보일 것 같은 우리만의 희망 찾아서\r\n사랑스런 너의 꿈속에 언제나 달려가리\r\n\r\n내 가슴에 불어오는 모래 바람에\r\n이름 모를 물새들의 날개 짓 소리\r\n눈부신 여름 바닷가에 아침이 밝아오네\r\n그림자만 남아있는 모습들 위로\r\n먼 하늘의 달빛하나 걸려 갈 때면 \r\n노을 진 바다 가운데선 마음은 꿈을 꾸네 \r\n사랑이란 낯설게 느껴지지만 마주보면 눈 속에 있어</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/314/15026314_1323314872274_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130954, lowkey: nil, highkey: nil},
  {album_id: 96, singer_id: 123, team_id: nil, title: "포켓속의 그댄(Love In My Pocket)", genre1: "가요", genre2: "락", runtime: "04:28", lyrics: "\n\t\t\t\t\t\t\t<div>포켓속의 그댄(Love In My Pocket) - 04:28</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">창문을 열면 소복히 쌓여있는 눈 위에 커다랗고 귀여운 눈사람\r\n그 옆엔 당신이 서 있네요 너무나 사랑스런 우리의 사랑처럼\r\n하얀 눈 위에 당신께 달려가죠 사랑의 크기만큼\r\n한가득 두팔 벌려 안아줄래요\r\n\r\n너무 기다려온 하얀 눈이 와\r\n맑고 하얀 그댈 닮은 파란 하늘 아래\r\n(온) 세상 하얗게 너무나 예쁘게 물들었네요\r\n오~ 눈이와 눈이와 눈이와 너무나도 난 기쁘죠\r\n세상엔 우리뿐이죠 아무도 부럽지 않죠\r\n그대만 사랑할래요 내 사랑\r\n\r\n지난 겨울에 너무나 외로운 어느날\r\n창밖의 눈이 싫어 문닫고 츄리에 플러그도 빼버렸죠\r\n하지만 나 지금은 이 추운 겨울이 좋아\r\n손이 시렵다고 나의 주머니에 너의 손을 넣고\r\n나는 그 손을 잡죠 얼굴이 빨개지네요\r\n\r\n너무 기다려온 하얀 눈이와 내맘을 환하게 비추고\r\n이젠 더 이상 외롭지도 슬프지도 않아요\r\n눈이와 눈이와 눈이와 온 세상의 하얀 눈이 그대의 두눈속에\r\n행복한 나의 얼굴 하얀 천사들 같아요 우리는</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/314/15026314_1323314872274_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130955, lowkey: nil, highkey: nil},
  {album_id: 96, singer_id: 123, team_id: nil, title: "우리 이야기(Our Story)", genre1: "가요", genre2: "락", runtime: "06:27", lyrics: "\n\t\t\t\t\t\t\t<div>우리 이야기(Our Story) - 06:27</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">아무것도 넌 모르고 있는걸 \r\n내가 많이 아프단 것도 말예요.\r\n사랑해요 사랑해요 \r\n그건 변함이 없어요.\r\n당신이었죠 그래야만 했죠 \r\n그래서 더욱 더 가슴이 아프죠\r\n미안해요 너무 미안해요\r\n그댈 보내야 하는게\r\n\r\n사랑해요 그대도 나와 같죠 \r\n알아요 그대 울지 말아요\r\n우리 처음 만난 날 너무 행복했어요 \r\n그랬죠 날 떠나지 마요\r\n그대 떠나지 마요\r\n\r\n이젠 떠나갈게요 \r\n다신 나의 곁에서 눈물 흘리지 않게\r\n나 너무 아프지만 이젠 난 행복해요 \r\n그대 숨결속에서 우린 영원한거죠\r\n이별이란 이름으로 함께\r\n\r\n당신을 알고 너무 행복해요 \r\n그래서 더욱더 가슴이 아프죠\r\n너의 눈을(너의 눈을) \r\n다신 못볼까봐(못볼까봐)\r\n난 그게 두려웠어요\r\n\r\n사랑해요 그대만 사랑해요 \r\n언제나 약해지지 말아요\r\n그럴 일 없죠 나에게 말해봐요 \r\n모든게 다 거짓이라고\r\n제발 떠나지 마요\r\n\r\n이젠 떠나갈게요 \r\n다신 나의 곁에서 눈물 흘리지 않게\r\n나 너무 아프지만 이젠 난 행복해요 \r\n그대 숨결속에서 우린 영원한거죠\r\n이별이란 이름으로 \r\n\r\n함께 할 수 없는걸 잘알고 있어 \r\n그런데 왜 날 떠나려해요\r\n우리 이야기만 이렇게 슬픈가요 \r\n힘들땐 잊지 말아요 그대만 사랑해요\r\n\r\n이젠 약속할게요 다신 우리 곁에서 \r\n눈물흘리지 않게 아무리 힘들어도 \r\n이젠 이별은 없죠 이런 아픔속에서 \r\n우린 영원한거죠 사랑이란 이름으로 함께</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/314/15026314_1323314872274_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130956, lowkey: nil, highkey: nil},
  {album_id: 96, singer_id: 123, team_id: nil, title: "사랑이란건(Love Theme 1)", genre1: "가요", genre2: "락", runtime: "04:37", lyrics: "\n\t\t\t\t\t\t\t<div>사랑이란건(Love Theme 1) - 04:37</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">나에게 사랑은 이랬다...\r\n\r\n\r\n사랑이란 건 영원히 변치 말 잔 말 그 말\r\n\r\n믿지 못하겠지만 믿고 싶은 말\r\n\r\n\r\n사랑이란 건 항상 곁에 있고 싶은 그 말\r\n\r\n멀어져 가겠지만 아직은 아니란 말\r\n\r\n\r\nOh~ 나의 곁에 내 사랑이오길\r\n\r\n바래 왔지만 나는 이제 없어\r\n\r\n너를 잊어가겠지 너에게 나는 잊혀지겠지만\r\n\r\n나는 떠나갈 거야 나의 사랑이니까\r\n\r\n\r\n사랑이란 건 아픔을 위한 기다림\r\n\r\n그때가 오지 않길 원치 않는 기다림\r\n\r\n이별이란 건 다른 이름의 또 하나의 사랑 \r\n\r\n그댈 사랑 하기에 떠나가야만 하는\r\n\r\n\r\n너를 잊어 가겠지 너에게 나는 잊혀지겠지만\r\n\r\n나는 떠나갈 거야 나의 사랑이니까 Oh~</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/314/15026314_1323314872274_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130957, lowkey: nil, highkey: nil},
  {album_id: 96, singer_id: 123, team_id: nil, title: "천상의 아리아(Aria Of The Will)", genre1: "가요", genre2: "락", runtime: "03:58", lyrics: "\n\t\t\t\t\t\t\t<div>천상의 아리아(Aria Of The Will) - 03:58</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">나의 모든 것이 몸부림 쳐 다시금 내게 소리쳐. \r\n살아 숨쉬는 모든 것이 내게 무릎 꿇어\r\n내게 살기 위한 그대들의 작은 몸짓을 \r\n*살아 숨쉬는 모든 것이 내게 무릎 꿇어\r\n내게 살기 위한 그대들의 작은 몸짓을\r\n\r\nKill! mind the shock Kill! Win the light ahh! \r\nRight\r\nKill! mind the shock Kill! Win the light ahh! \r\nRight \r\n\r\n**이제껏 살아왔던 가치 못 찾겠지 \r\n무얼 위해 살아왔는지 난 모르겠지\r\n\r\n* Repeat\r\n\r\nKill! mind the shock Kill! Win the light ahh! \r\nRight \r\nKill! mind the shock Kill! Win the light ahh! \r\nRight \r\n\r\n** Repeat\r\n\r\nKill! mind the shock Kill! Win the light ahh! \r\nRight \r\n\r\n** Repeat\r\n\r\n* Repeat\r\n\r\nKill! mind the shock Kill! Win the light ahh! \r\nRight \r\nKill! mind the shock Kill! Win the light ahh! \r\nRight\r\n\r\n**Repeat\r\n\r\n나의 모든 것이 몸부림 쳐 다시금 내게 소리쳐. \r\n나의 모든 것이 몸부림 쳐 다시금 내게 소리쳐.\r\n\r\n나의 모든 것이 몸부림 쳐 다시금 내게 소리쳐. \r\n나의 모든 것이 몸부림 쳐 다시금 내게 소리쳐.</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/314/15026314_1323314872274_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130958, lowkey: nil, highkey: nil},
  {album_id: 96, singer_id: 123, team_id: nil, title: "Alone", genre1: "가요", genre2: "락", runtime: "03:32", lyrics: "\n\t\t\t\t\t\t\t<div>Alone - 03:32</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">Rap) 나 밖에 왜 커져가라 모든 것이 아픔으로 바래\r\n그걸 원하는 거라 생각하고 싶진 않아 난 뺏긴 나의 모든 것을 찾고싶어 \r\n그냥 난 이젠 돌아 갈 수도 없는 길을 걸어가\r\n책임 없는 아픔으로 의미 없는 손짓으로 나를 점점 잡아끌어도 난 \r\n어쩔 수도 없이 여태 수없이 \r\n이제와 후회해도 소용없어 괜찮아 걱정하지마\r\n더 힘들게 하지마\r\n\r\n난 모든 것을 잃어갔어 나의 의지와는 상관없이 \r\n내 곁에는 그 모두가 다른 눈을 가졌어\r\n나 태어나지 않았다면 차라리 나 그랬다면\r\n워~넌 이해 못해\r\n\r\nRap)첨부터 원하지 않은 건지 내가 존재한 이후 후회한 건지\r\n나에 대한 이 모든 걸 모른척하겠지 \r\n왜 내게 그래야 했었는지 듣고 싶지 않아 이유가 어쨌건 \r\n이제와 그게 무슨 소용인지 건지 왜 왜 내게만 이래\r\n\r\n어떻게 된 건지 난 모르겠어 모든 게 내게만 이래\r\n왜 버려야만 했어\r\n\r\n난 모든 것을 잃어갔어 나의 의지와는 상관없이 \r\n내 곁에는 그 모두가 다른 눈을 가졌어\r\n나 태어나지 않았다면 차라리 나 그랬다면\r\n워~넌 이해 못해\r\n\r\n그래 영원하지 못하는 한순간이라도 당신을 나 볼 수 있다면 제발~\r\n\r\n처음으로 다시 돌아가도 이제 모든 것이 변해 있겠지\r\n그래도 난 상관없어 날 사랑으로 지켜준다면 다 이해할게</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/314/15026314_1323314872274_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 9666, song_num: 16130959, lowkey: nil, highkey: nil},
  {album_id: 96, singer_id: 123, team_id: nil, title: "Red &amp; White", genre1: "가요", genre2: "락", runtime: "03:08", lyrics: "\n\t\t\t\t\t\t\t<div>Red &amp; White - 03:08</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">*이번이 마지막이야 너희와의 기억\r\n오래 전 영혼 유린 당한 모습과 \r\n또 한 편의 안타까운 내 손짓을\r\n\r\n**예전엔 그랬어 모두 다 알아\r\n지금에 와서 덮어 둔다고 다 \r\n그 존재가 없어지진 않아\r\n모두 거짓인 걸 이 모든 게 다\r\n\r\n***너에게 남은 내 바램은\r\n(그래 그러면 좋지 아픈 건 우리 뿐 인걸)\r\n널 만나 서러워 하지 않도록\r\n(나 다신 속지 않아)\r\n\r\nWe Wish Shot!\r\nWe Wish Shot!\r\nWe Wish Shot!\r\nWe Wish Shot!\r\n\r\n*Repeat\r\n**Repeat\r\n***Repeat</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/314/15026314_1323314872274_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130960, lowkey: nil, highkey: nil},
