  {album_id: 96, singer_id: 123, team_id: nil, title: "Devil Of Angel", genre1: "가요", genre2: "락", runtime: "05:43", lyrics: "\n\t\t\t\t\t\t\t<div>Devil Of Angel - 05:43</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">천사의 두손에 내목이 조이고 숨막혀 오는 내 맘속에 빛을 잃어 가겠지 \r\n처음부터...\r\n내 발목을 찌르는 덫이 좋아 皮빛에 물들어가고 숨이 막혀 오는 소리\r\n\r\nDevil of .... Angel \r\nDevil of .... Angel \r\n\r\n다시는 이러고 싶지 않아 내 몸보다 작은 감옥 속에 갇혀 있는 나는 이제\r\n\r\nDevil of .... Angel \r\nDevil of .... Angel \r\n\r\nI Scrutinize your brain \r\nI Scrutinize your brain \r\n\r\nYou realize your my slave \r\nYou feel as your my slave \r\n\r\n내 깊은 마음에... 우리 삶이기에\r\n\r\n악마의 영혼을 판 영혼없는 사람들\r\n그들은 아직도 살아 숨쉬고 있다\r\n우리의 영혼을 사기위해\r\n\r\nDevil of .... Angel \r\nDevil of .... Angel \r\nDevil of .... Angel \r\nDevil of .... Angel \r\n\r\n아픔의 기억들 이제는 모든게\r\n\r\nI Scrutinize your brain \r\nI Scrutinize your brain \r\nYou realize your my slave \r\nYou feel as your my slave</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/314/15026314_1323314872274_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130962, lowkey: nil, highkey: nil},
  {album_id: 96, singer_id: 123, team_id: nil, title: "I(Human Individual Cloning)", genre1: "가요", genre2: "락", runtime: "04:25", lyrics: "\n\t\t\t\t\t\t\t<div>I(Human Individual Cloning) - 04:25</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">말 없이 태어난 난 H.I.C. 누군가 만들어내 난 살아간다\r\n나에게 주어진 삶이라며 똑같은 어딘가에 난 또 살아간다 \r\n내 검은 그 늪이 그 늪이 나의 삶이라 정해진 나의 그 길\r\nCross my eyes 제대로 해보지도 못한 외기러기 난 \r\n아직 날지도 못하는데 왜 Go!\r\n왜 날 Break 저기 Mark 위\r\n\r\n그댄 날 위한 거라고 널 위해 살아달라고 \r\n내가 어떻게 되든 상관없이\r\n\r\n투명한 유리 병 속에 그곳이 나를 있게 한\r\n차가운 그 기억을 잊고 싶어\r\n\r\n마지막이기를 두 번 다시 이런 일 없기를\r\n너에게 바랄게 나에게도 내 꿈이 있는걸 너는 왜\r\n\r\n이건 모두 지옥 같은걸 \r\n저기 저기 외기러기 저기 저기 외기러기\r\n저기 저기 외기러기 저기 저기 외기러기 Go!\r\n날 지켜봐 왜 날 Break 날 지켜봐 저기 Mark 위\r\n\r\n그댄 날 위한 거라고 널 위해 살아달라고 \r\n내가 어떻게 되든 상관없이\r\n\r\n마지막이기를 두 번 다시 이런 일 없기를\r\n너에게 바랄게 나에게도 내 꿈이 있는걸 너는 왜\r\n\r\n날 지켜봐 이대로 더 이상 모든 걸 당하고만 있지 않아\r\nBreak</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/314/15026314_1323314872274_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130963, lowkey: nil, highkey: nil},
  {album_id: 96, singer_id: 123, team_id: nil, title: "Heejun With H.I.T. Il", genre1: "가요", genre2: "락", runtime: "04:36", lyrics: "\n\t\t\t\t\t\t\t<div>Heejun With H.I.T. Il - 04:36</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">오늘 즐거웠어요?\r\n아.. 오늘 이틀동안 어제 오늘동안\r\n목을 너무 혹사시켜서\r\n말을 하기가 힘들정도로 목이 아픕니다\r\n\r\n이번 콘서트 이름이 뭔지 아세요?\r\n이번 콘서트 타이틀이 뭐죠? 라이브레볼루션!\r\n다시한번 더크게! 라이브레볼루션!\r\n다시한번 더크게! 라이브레볼루션!\r\n저의 실력을 인정하지않을려고하는 자들에게 더한번 더크게! 라이브 레볼루션!!!!!!!\r\n\r\n오늘을 위해서 어제를 위해서\r\n그리고 저자신을 위해서 사랑하는 여러분들을 위해서\r\n진정 라이브가 무엇인지 그리고 진짜 락(록)이 무엇인지를\r\n들려드리려고 노력을 많이 했습니다\r\n\r\n누가 뭐라건 어느 누가 우리에게 손가락질을 하던\r\n\r\n여러분들과 저만이 진정 락(록) 매니아!!!!!!!!!\r\n\r\n오늘 이렇게 와주신 여러분들 정말 감사드리구요\r\n\r\n오늘 공연즐거웠어요? 정말 즐거웠어요? 즐거웠어요?\r\n즐거웠으면 하늘위로 손을!\r\n\r\n앞으루두 여러분들이 저를 사랑하는데있어서\r\n자랑스러울만큼 피나도록 열심히 음악하겠습니다\r\n\r\n그때까지 내년 이맘때쯤 다시 여기서 만나요\r\n\r\n자,오늘 즐거웠으면 한번더 Scream\r\n\r\n감사합니다 감사합니다 Thank you\r\n\r\n문희준문희준문희준…(외침)\r\n\r\n앵콜앵콜앵콜앵콜…(외침)\r\n\r\n문희준문희준문희준…(외침)</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/314/15026314_1323314872274_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130964, lowkey: nil, highkey: nil},
