  {album_id: 96, singer_id: 123, team_id: nil, title: "White Angels Il", genre1: "가요", genre2: "락", runtime: "06:30", lyrics: "\n\t\t\t\t\t\t\t<div>White Angels Il - 06:30</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">오- 내 사랑 \r\n\r\n*언제나 그대만을 사랑하는 나니까 \r\n날 떠나가도 밉다해도 괜찮아 \r\n언제나 가슴속에 사랑하는 그대뿐 \r\n날 잊어가도 밉다해도 사랑해 \r\n\r\n내 사랑아 날 잊어 가도 돼 내 사랑아 Oh~ \r\n\r\n*Repeat \r\n\r\n내 사랑아 날 지워 가도 돼 내 사랑아 \r\n\r\n*Repeat\r\n\r\n내 사랑아 날 지워 가도 돼 내 사랑아 \r\n\r\n언젠가 그대는 나를 잊어도 내 마음 변함 없이\r\n내게는 그대뿐인걸\r\n\r\n언제나 하나만을 바라보는 너니까 \r\n나 힘들어도 변치 않고 지킬게 \r\n언제나 가슴속에 사랑하는 그대뿐 \r\n오 너희들을 영원히 난 사랑해 라라라~\r\n오 너희들을 영원히 난 사랑해</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/314/15026314_1323314872274_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130967, lowkey: nil, highkey: nil},
  {album_id: 97, singer_id: 123, team_id: nil, title: "My Life And My Way", genre1: "가요", genre2: "전체", runtime: "03:45", lyrics: "\n\t\t\t\t\t\t\t<div>My Life And My Way - 03:45</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">Take my hand 내가 살아가는 이유 and my way 나의 음악을 위해 \n\n나의 노래 외로운 길이라도 나 살아갈 어려운 길이라도 지칠 때 내가 숨쉴 수 없다 해도 \n\n나에겐 내 삶의 전부인 걸 가끔씩 때론 힘겨워 하지만 난 오늘도 내 길을 걸어가네 \n\n나의 음악 나의 얘기 모두를 난 하나의 글로 써 내려가네 \n\nTake my hand 내가 힘겨울 때마다 and my way 난 다시 또 일어나 \n\nTake my hand 내가 살아가는 이유 and my way 나의 음악을 위해 \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/315/15026315_1323314933936_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130968, lowkey: nil, highkey: nil},
  {album_id: 97, singer_id: 123, team_id: nil, title: "I (Human Individual Clothing)", genre1: "가요", genre2: "전체", runtime: "04:15", lyrics: "\n\t\t\t\t\t\t\t<div>I (Human Individual Clothing) - 04:15</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">말 없이 태어난 난 H.I.C. 누군가 만들어 내 난 살아간다 \n\n나에게 주어진 삶이라며 똑같은 어딘가에 난 또 살아간다 \n\n내 검은 그 늪이 그 늪이 나의 삶이라 정해진 나의 그 길 \n\nCross my eyes 제대로 해 보지도 못한 외 기러기 \n\n난 아직 날지도 못하는데 왜 Go! 왜 날 Break 저기 Mark 위 \n\n*그댄 날 위한 거라고 널 위해 살아달라고 내가 어떻게 되든 상관없이 \n\n투명한 유리 병 속에 그 곳이 나를 있게 한 차가운 그 기억을 잊고싶어 \n\n**마지막이기를 두 번 다시 이런 일 없기를 너에게 바랄게 나에게도 내 꿈이 있는 걸 \n\n너는 왜 이건 모두 지옥같은 걸 \n\n저기 저기 외기러기 Go! 날 지켜봐 왜 날 Break 날 지켜봐 저기 Mark 위 \n\n*Repeat **Repeat 날 지켜봐 이대로 더 이상 모든 걸 당하고만 있지 않아 Break \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/315/15026315_1323314933936_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130969, lowkey: nil, highkey: nil},
  {album_id: 97, singer_id: 123, team_id: nil, title: "아낌없이 주는 나무 (Generous)", genre1: "가요", genre2: "전체", runtime: "03:44", lyrics: "\n\t\t\t\t\t\t\t<div>아낌없이 주는 나무 (Generous) - 03:44</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">그대에게 하고픈 말 사랑해요 사랑한단 말 뿐이죠 \n\n왜 못 듣죠 내가 한 말 우리 서로 다른 길에 서있는 거겠죠 \n\n안돼 안돼 왜 아파만 해요 난 아무 것도 그대에 모든 걸 해 줄 수가 난 없는데 \n\n오직 나만이 당신을 안아 줄 수가 없는 걸 내가 할 수 있는 것이 아무 것도 없는 \n\n비참한 앙상한 가지의 초라한 보잘 것 없는 나의 존재 앙상한 마른 나일 뿐 \n\n항상 너의 뒤에서 그립겠죠 그대 눈에 내가 비춰 보이던 그 때가 \n\nA time for us 커져만 가는 비참한 현실 Go \n\n꺼져만 가는 잿빛 불씨 나의 존재 \n\nA time for us 그대에겐 내가 보이나요 난 아무 것도 보이지 않는 걸 \n\n나의 마음 그리고 나 그리워요 그리워요 그대 눈에 내가 비춰 보이던 그 때 \n\n사랑해요 사랑해요 그대 내겐 나의 마지막 사랑이겠죠 \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/315/15026315_1323314933936_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130970, lowkey: nil, highkey: nil},
  {album_id: 97, singer_id: 123, team_id: nil, title: "상자속의 그댄 (Falling In To You)", genre1: "가요", genre2: "전체", runtime: "04:09", lyrics: "\n\t\t\t\t\t\t\t<div>상자속의 그댄 (Falling In To You) - 04:09</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">저 기억 끝에 나를 떠난 기억이란 사랑 아픔이 나에게는 사랑이라고 믿었죠 \n\n*기억하고 있는 나의 그 마음 이제 너를 떠나 나도 사랑하고 싶어 그대 Oh~ \n\n그대 이젠 그대 제발 나를 놔줘요 Good Bye Good Bye 내가 정말 너무한 건가요 \n\n너무 힘겨워요 그댈 원망하진 않을게요 그대 내 말 들어줄 거죠 내 사랑 나의 사랑은 \n\n그댈 못 잊는 걸 모르죠 어떻게 해야 하는 건가요 내가 아픈 줄만 알고 자꾸 울어요 \n\n너무 마음이 아파요 나 어떻게 내 사랑 지키고 싶어 부탁할게요 *Repeat \n\n나의 사랑은 내가 꼭 있어야만 해요 정말로 아무 것도 몰라요 \n\n그댈 처음 만났던 나처럼 자꾸 울어요 너무 마음이 아파요 나 어떻게 내 사랑 지키고 싶어 \n\n부탁할게요 지워 가고 있는 나의 그 맘을 내 맘을 너는 모르겠죠 그대 Oh~ \n\n그대 나는 그댈 잊지 못하나 봐요 Good Bye Good Bye 내가 왜 이러는 건가요 \n\n너무 힘겨워요 그댈 원망하진 않을게요 그대 내 말 들어줄 거죠 내 사랑 \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/315/15026315_1323314933936_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130971, lowkey: nil, highkey: nil},
