  {album_id: 97, singer_id: 123, team_id: nil, title: "아낌없이 주는 나무 (Generous Ballad Ver.)", genre1: "가요", genre2: "전체", runtime: "03:59", lyrics: "\n\t\t\t\t\t\t\t<div>아낌없이 주는 나무 (Generous Ballad Ver.) - 03:59</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">그대에게 하고픈 말 사랑해요 사랑한단 말 뿐이죠 \n\n왜 못 듣죠 내가 한 말 우리 서로 다른 길에 서있는 거겠죠 \n\n안돼 안돼 왜 아파만 해요 난 아무 것도 해 줄 수 없는데 \n\n내가 할 수 있는 것은 그댈 위한 작은 불씨 뿐이겠죠 그립겠죠 그러겠죠 \n\n그대 눈에 내가 비춰 보이던 그대가 이제는 다시는 사랑한다고 말해도 \n\n나는 이제 없는 걸 이게 내 사랑인 걸 그대에겐 내가 보이나요 안 보이죠 내 맘 그리고 나 \n\n그리워요 그리워요 그대 눈에 내가 비춰 보이던 그 때 \n\n사랑해요 사랑해요 그대 내겐 나의 마지막 사랑이겠죠 \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/315/15026315_1323314933936_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130974, lowkey: nil, highkey: nil},
