  {album_id: 98, singer_id: 124, team_id: nil, title: "Love Letter", genre1: "가요", genre2: "발라드", runtime: "04:37", lyrics: "\n\t\t\t\t\t\t\t<div>Love Letter - 04:37</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">오늘 잘 지냈나요 유난히 그립네요 \n아침에 눈뜨면 그대가 제일 먼저 생각나요 \n음 모든 게 새롭네요 그대를 만난 후로 내게는 가벼운 일들도 \n의미 있는 커다란 소망이죠 \n\n* \n사랑해요 약속해요 기억해주세요 내 말 그대가 있어서 살아가죠 \n그대와 영원히 함께 할게요 가끔 흔들릴 땐 첫 만남 생각해요 \n비가 내리고 바람 불어도 이별은 서로 말하지 말아요 \n지나가는 길에 선물 하나 샀죠 그대가 받아 줬으면 해요 \n사랑하는 내 맘도 받아주세요\n\n* Repeat x2 \n\n오늘 잘 지냈나요 유난히 그립네요 \n아침에 눈뜨면 그대가 제일 먼저 생각나요 \n음 모든 게 새롭네요 그대를 만난 후로 내게는 가벼운 일들도 \n의미 있는 커다란 소망이죠 \n\n가끔 흔들릴 땐 첫 만남 생각해요 \n비가 내리고 바람 불어도 이별은 서로 말하지 말아요 \n지나가는 길에 선물 하나 샀죠 그대가 받아 줬으면 해요 \n사랑하는 내 맘도 받아주세요\n\n* Repeat x2\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/317/15026317_1323141799370_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130995, lowkey: nil, highkey: nil},
  {album_id: 98, singer_id: 124, team_id: nil, title: "나같은건 없는건가요", genre1: "가요", genre2: "발라드", runtime: "03:51", lyrics: "\n\t\t\t\t\t\t\t<div>나같은건 없는건가요 - 03:51</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">그대여 떠나 가나요 \r\n다시 또 볼수 없나요 \r\n부디 나에게 사랑한다고 한번만 말해주세요 \r\n제발 부탁이 있어요 \r\n이렇게 떠날 거라면 \r\n가슴 속에둔 내맘마져도 그대가 가져 가세요 \r\n\r\n*혼자 너없이 살수 없을 거라 \r\n그대도 잘 알잖아요 \r\n비틀거리는 내모습을 보면 그대 맘도 아프잖아요 \r\n그대만 행복하면 그만인가요 \r\n더이상 나 같은건 없는 건가요 \r\n한번만 나를 한번만 나를 생각해주면 안돼나요 \r\n\r\n*Repeat \r\n\r\n그래도 떠나 가네요 \r\n붙잡을수는 없겠죠 \r\n부디 나에게 사랑했다고 한번만 말해 주세요</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/317/15026317_1323141799370_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 10283, song_num: 16130996, lowkey: nil, highkey: nil},
  {album_id: 98, singer_id: 124, team_id: nil, title: "지켜보면서 (Stay With Me)", genre1: "가요", genre2: "발라드", runtime: "05:25", lyrics: "\n\t\t\t\t\t\t\t<div>지켜보면서 (Stay With Me) - 05:25</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">지켜보면서 사랑하면서 그대 곁에서 빛이 되고파\n바라보면서 감싸주면서 그대 곁에서 힘이 되고파\n소중한 것들은 사라지고 혼자 남은 것 힘겨울 때\n살아가는 동안 지쳐가도 슬퍼하거나 울지 말아요\n힘겨운 시간은 사라지고 행복한 날들만 올 거 에요\n믿어주세요 도와줄 게요\n\n지켜보면서 사랑하면서 그대 곁에서 빛이 되고파\n바라보면서 감싸주면서 그대 곁에서 힘이 되고파\n\n힘겨운 시간은 사라지고 행복한 날들만 올거에요\n믿어주세요 도와줄 게요\n\n지켜보면서 사랑하면서 그대 곁에서 빛이 되고파\n바라보면서 감싸주면서 그대 곁에서 힘이 되고파\n\n사랑하고파 빛이되고파 감싸주고파 힘이되고파\n\n지켜보면서</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/317/15026317_1323141799370_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130997, lowkey: nil, highkey: nil},
  {album_id: 98, singer_id: 124, team_id: nil, title: "슬픈 사랑 (Sadness)", genre1: "가요", genre2: "발라드", runtime: "04:40", lyrics: "\n\t\t\t\t\t\t\t<div>슬픈 사랑 (Sadness) - 04:40</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">그대없인 슬픈날을 이젠 어떻게 견뎌낼까.. 내 가슴이 다 타버린데도 아픔은 남겠죠\n*혼자남은 텅빈가슴 내가 가엽진 않았나요 뒤돌아 살면서 그대는 맘 편할수 있나요\n참 힘든세상 견뎌낸건 그대 때문인데 쉽게 잊혀지는 그댈 보면\n가슴이 무너져요 난 그렇지 않아요 그대 새각 뿐인데 그대 가는 길에 남겨진건 없나요 내 슬픈사랑아~~\n\n*반복\n\n쉽게 돌아서서 내 눈물 바라보며\n미소짖지 말아요 워~~\n\n그대 가는길에 남겨진건 없나요\n내 슬픈 사랑아 워~~\n\n쉽게 돌아서서 내 눈물 바라보며\n미소짖지 말아요 워~~~\n\n그대가는 길에 남겨진건 없나요\n내 슬픈 사랑아</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/317/15026317_1323141799370_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130998, lowkey: nil, highkey: nil},
  {album_id: 98, singer_id: 124, team_id: nil, title: "``이별 후에 (Com Back Again)``", genre1: "가요", genre2: "발라드", runtime: "04:52", lyrics: "\n\t\t\t\t\t\t\t<div>``이별 후에 (Com Back Again)`` - 04:52</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">오늘도 내 곁에 머무는 바람뿐인 허전한 기억\n시간이 지나가도 여전히 내 맘에 남아\n쓸쓸한 거리에 오후는 낙엽뿐인 허전한 거리 \n가슴에 밀려드는 그리움 견딜 수가 없어요\n사랑해 사랑해요 돌아와 미안해요\n\n*\n다시 돌아와요\n기다려서 기다려서 기다림에 지쳐버린 나에게로 돌아와요\n다시 돌아와요 미안하단 말 한마디 하지 못해 가슴 아픈 나에게로 돌아와요\n쓸쓸한 거리에 오후는 낙엽뿐인 허전한 거리\n가슴에 밀려드는 그리움 견딜 수가 없어요\n사랑해 사랑해요 돌아와 정말 미안해요\n\n* Repeat x2\n\n다시 돌아와요   \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/317/15026317_1323141799370_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16130999, lowkey: nil, highkey: nil},
  {album_id: 98, singer_id: 124, team_id: nil, title: "Love Is...", genre1: "가요", genre2: "발라드", runtime: "03:45", lyrics: "\n\t\t\t\t\t\t\t<div>Love Is... - 03:45</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">사랑은 먼길을 걸어온 나그네처럼 \n그대 곁에 편안히 쉬고 싶은 거예요\n가끔은 그대의 어깨가 안스러워서 \n내게 기대길 간절히 바라는 거예요\n\n*\n어쩌면 더 이상 그대에게 줄게 없어 \n소리 없이 가슴 태우며 눈물 흘리는 거예요\n그래도 그대가 환하게 웃어 준다면\n내가 죽어도 후회 없는 거예요\n\n* Repeat\n\n그래도 그대가 환하게 웃어 준다면\n내가 죽어도 후회 없는 거예요\n그대를 사랑해 잔인한 꿈일지라도 \n내 가슴 헤어져도 그대를 사랑해요\n그대를 사랑해요\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/317/15026317_1323141799370_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131000, lowkey: nil, highkey: nil},
  {album_id: 98, singer_id: 124, team_id: nil, title: "여행 (Get Away)", genre1: "가요", genre2: "발라드", runtime: "03:33", lyrics: "\n\t\t\t\t\t\t\t<div>여행 (Get Away) - 03:33</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">지나가는 시간을 타고 가요\n먼 여행길에 혼자 가는 외로운 풍경\n힘이 들 땐 쉬어 가는 길에 먼 하늘을 봐요\n아름답고 소중한 여행길에 스쳐가는 바람을 타고 가요\n먼 여행길에 혼자 가는 쓸쓸한 풍경\n강을 지나 그리고 숲을 지나 산들을 지나가고\n내 맘 속에 그리움도 지나가고\n\n* \n밤 기차를 타고 하늘을 높이 올라 가 볼까\n높은 곳에 있는 저기 저 별에 올라가 볼까\n창문을 열고 손을 올려 내 꿈을 만져나 볼까\n꿈을 꾸던 그댄 어디쯤에 와 있을까\n스쳐 가는 바람을 타고 가요\n먼 여행길에 혼자 가는 쓸쓸한 풍경\n강을 지나 그리고 숲을 지나 산들을 지나가고\n내 맘 속에 그리움도 지나가고\n\n* Repeat\n\n하지만 다시 떠나 볼까\n내 꿈을 다시 만져 볼까 \n아직은 끝나지 않은 것 같은 \n우리들의 여행 밤 기차를 타고 하늘높이 올라가요\n혼자라도 꿈이 있는 그 곳으로\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/317/15026317_1323141799370_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131001, lowkey: nil, highkey: nil},
  {album_id: 98, singer_id: 124, team_id: nil, title: "새 (Bird)", genre1: "가요", genre2: "발라드", runtime: "05:06", lyrics: "\n\t\t\t\t\t\t\t<div>새 (Bird) - 05:06</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">움츠려진 날개를 펴고 깊은 계곡을 날아서\n상념에 젖은 땅을 깨우고\n슬픔에 젖은 눈물을 음 그치게 하자\n말라버린 가슴들에게 너의 마음을 나눠주고\n꿈을 잃어버린 영혼들에게 니가 누린 하늘을\n음 보여주자\n\n*\n절망이 높아 그늘이 커져버린 어두운 곳에\n빛이 되어 밝혀주자 \n희망이 없어 절망이 커져버린 어두운 곳에 \n그토록 바라던 소망의 빛 날아 가보자 \n나를 버리고 날아 가보자 또 다른 세상 올라 서보자 \n나를 버리고 날아 가보자 또 다른 세상 기대하면서\n\n* Repeat\n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/317/15026317_1323141799370_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131002, lowkey: nil, highkey: nil},
  {album_id: 98, singer_id: 124, team_id: nil, title: "평화 (Peace)", genre1: "가요", genre2: "발라드", runtime: "06:14", lyrics: "\n\t\t\t\t\t\t\t<div>평화 (Peace) - 06:14</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">*\n하늘은 그대의 따뜻한 숨결로 \n날개를 잃어버린 나를 깨우고 \n스치는 바람에 생명은 피어나네 \n내 맘은 그대의 빛으로 가득 차 \n부서진 영혼에 자유를 더하고 \n어두운 세상은 더 이상 어둡지 않아 \n평화 평화 평화 평화 \n할 수 없는 것들이 이루어지는 세상 \n작고 약한 것들이 아름다워지는 세상\n평화 평화 평화 평화 \n\n* Repeat</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/317/15026317_1323141799370_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131003, lowkey: nil, highkey: nil},
