  {album_id: 99, singer_id: nil, team_id: 34, title: "The Sign", genre1: "가요", genre2: "발라드", runtime: "03:51", lyrics: "\n\t\t\t\t\t\t\t<div>The Sign - 03:51</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">기억속으로 젖어든 날에는 그 언덕 너머있는 그곳을 난가지 \n언제까지나 믿어 지나간 날의 약속 같은 시간속에 모든걸 함께했던 지난 날 \n\n손을 잡았던 그 느낌을 난 기억해 찬비에 젖어버렸지만 웃었지 \n눈물은 흘러 붉은 노을 위로 흐르네 끝나진않았어 너를 위한 내 기다림 \n\none 두번 다시 없을 이 순간 마음속에 모든걸 담아 멀리있는 그곳으로 보낼께 \nsigh 변치않을 나의 너에게 우리만의 언어로 지금 말하고 싶어 사랑해 \n\n손을 잡았던 그 느낌을 난 기억해 찬비에 젖어버렸지만 웃었지 \n지쳐버렸던 니 모습 아프게 남아있네 잊지는 않았어 너를 위한 내 기다림 \n\none 두번 다시 없을 이 순간 마음속에 모든걸 담아 멀리있는 그곳으로 보낼께 \nsigh 변치않을 나의 너에게 우리만의 언어로 지금 말하고 싶어 사랑해 \n\none 두번 다시 없을 이 순간 마음속에 모든걸 담아 멀리있는 그곳으로 보낼께 \nsigh 변치않을 나의 너에게 우리만의 언어로 지금 말하고 싶어 사랑해 \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/318/15026318_1323138300764_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 11364, song_num: 16131010, lowkey: nil, highkey: nil},
