  {album_id: 99, singer_id: nil, team_id: 34, title: "널 위해서라면 (Everything For You)", genre1: "가요", genre2: "발라드", runtime: "04:42", lyrics: "\n\t\t\t\t\t\t\t<div>널 위해서라면 (Everything For You) - 04:42</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">난 왜 항상 이렇게 살아가야 하는 것일까 내 곁엔 아무도 없는데 \n모든 것이 다 장난 같아 그래도 난 널 놓칠 수가 없어 Yeah~ \n\n때론 내 앞길만 보고 가는 것이 힘들어 다시 돌아가고 싶어도 \n너의 환한미소가 날 지켜주기때문에 비가 와도 바람불어도 걸어갈래요 널 위해서라면 \n\n가끔씩 약해진 나의 모습 보면서 슬픔을 이기지 못해요 이럴 땐 \n난 누구에게 기대야 하는지 모르지만 내게 올 커다란 꿈을 되새겨봐요 \n\n때론 내 앞길만 보고 가는 것이 힘들어 다시 돌아가고 싶어도 \n너의 환한미소가 날 지켜주기때문에 비가와도 바람 불어도 걸어갈래요 널 위해서라면 \n\nI wanna give you all my love Nathing's gonna come between us \nThis time This time baby I won't let you out of my heart \nI won't let you out of my life \n\n때론 내 앞길만 보고 가는 것이 힘들어 다시 돌아가고 싶어도 \n너의 환한미소가 날 지켜주기때문에 비가와도 바람 불어도 걸어갈래요 널 위해서라면 \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/318/15026318_1323138300764_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131012, lowkey: nil, highkey: nil},
  {album_id: 99, singer_id: nil, team_id: 34, title: "Easy Come Easy Go", genre1: "가요", genre2: "발라드", runtime: "03:19", lyrics: "\n\t\t\t\t\t\t\t<div>Easy Come Easy Go - 03:19</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">There is no one quite like me. There is no one quite like me \n\n잊지마 잊어 가는 건 기억을 사랑을 아주 버린거니까 \n하지만 돌아오는 건 차라리 슬프니 나를 놓아 영원히 \n\n나는 원했는데 넌 끝났다는 그 말을 하고 날 버린다면 \n수많은 날을 울어야 하는 내 아픈 마음까지 다 갖고 떠나 \n\n내가 아닌 누구를 어제의 나로 만들어 \n빛을 잃은 나의 사랑은 너 아니면 안되는데 날 두고가 \n\nIt's not easy being me 사랑도 눈물도 다 시들 테니까 \nIt's not easy being me 지나간 추억은 이젠 나와 사라져 \n\n나를 안아주던 그 포근함도 멀어져 가는 널 느끼게 해 \n날 바라보던 달라진 눈길 그 차가움을 이제서야 알 것 같아 \n\n우리 멀어져도 희미해져 가도 \n소중했던 짧은 순간을 서로에게 담아두고 살기로 해 \n\n잊지마 잊어 가는 건 기억을 사랑을 아주 버린거니까 \n하지만 돌아오는 건 차라리 슬프니 나를 놓아 영원히 \n\n너는 이제 없고 다른 누가 와도 \n쉽게 가는 나의 너처럼 나는 그리 쉽게 맘을 열진 않아 \n\nIt's not easy being me 사랑도 눈물도 다 시들 테니까 \nIt's not easy being me 지나간 추억은 이젠 나와 사라져 \n\n잊지마 잊어 가는 건 기억을 사랑을 아주 버린거니까 \n하지만 돌아오는 건 차라리 슬프니 나를 놓아 영원히 </p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/318/15026318_1323138300764_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131013, lowkey: nil, highkey: nil},
