  {album_id: 99, singer_id: nil, team_id: 34, title: "Double", genre1: "가요", genre2: "발라드", runtime: "03:24", lyrics: "\n\t\t\t\t\t\t\t<div>Double - 03:24</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">더는 듣고 싶지 않았죠 처음 보는 그녀에겐 \n더는 들을 수도 없었죠 내 가슴이 너무 두근거려 \n\n설명할 수 없는 맘으로 집에 가는 길에 주저앉아 \n난 마치 길 잃은 아이처럼 울어야 했어 \n\nDon't say and show me your love 어떻게 내게 그럴 수 있어 \nU said that All that I want is 나만이 그댈 가진거라고 \n\nDon't say and show me your love 믿을 수 없어 참을 수 없어 \nU said that All that I want is 즐거웠나요 나의 사랑이 \n\nShe was me a sad story that there was no true between us \n어떤 말도 할 수 없었죠 단지 난 아니기를 \n\n그런 내 모습이 싫어서 난 되돌리고 싶었지만 \n내 자존심은 벌써 무너져 버렸어 \n\nDon't say and show me your love 어떻게 내게 그럴 수 있어 \nU said that All that I want is 나만이 그댈 가진거라고 \n\nDon't say and show me your love 믿을 수 없어 참을 수 없어 \nU said that All that I want is 즐거웠나요 나의 사랑이 \n\n하나론 부족했나요 그런건가요 아님 내가 그댈 훔쳤나요 그녀의 눈물만큼 \n사랑을 하긴했나요 다 부질 없지만 내가 그댈 용서하길 바라는가요 \n\noh, trust me 어떻해야만 내 말을 믿을 수가 있겠니 \n눈에 비친 것으로 모든 것을 판단하지마 \n너무 지친 표정만으로 내게 물어보네 나를 사랑하긴 하냐고 왜냐고 \n가끔 만나기는 했지만 난 아무런 느낌마저 남아있지 않아 한 가닥의 미련도 \n\nDon't say and show me your love 어떻게 내게 그럴 수 있어 \nU said that All that I want is 나만이 그댈 가진거라고 \n\nDon't say and show me your love 믿을 수 없어 참을 수 없어 \nU said that All that I want is 즐거웠나요 나의 사랑이 \n\nDon't say and show me your love \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/318/15026318_1323138300764_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131016, lowkey: nil, highkey: nil},
  {album_id: 99, singer_id: nil, team_id: 34, title: "I Don`t Know How", genre1: "가요", genre2: "발라드", runtime: "03:23", lyrics: "\n\t\t\t\t\t\t\t<div>I Don`t Know How - 03:23</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">  \n\n\n아티스트 이삭N지연 \n제작사 : SM \n발매사 : IK POP \n발매일 : 2002년 9월 \n\n \n01 C.B.T.M. (Come Back To Me) \n02 Tell Me Baby \n03 One \n04 The Sign \n05 The Way I Love U \n06 널 위해서라면 (Everything For You) \n07 Easy Come Easy Go \n08 Bad, Good Thing \n09 My Wish \n10 Double \n11 I Don't Know How \n12 Pray For You \n\n  \n \n\n  \n\n \n \n\n\n\n\n\n\n01 C.B.T.M. (Come Back To Me) \n\nThat's right. In my heart. baby my boy \n\n너무 원해 왔어 그댈 want you 멋적은 미소조차 나만의 style \n멀리 들려오는 그대 숨결 조금씩 내게로 자꾸 다가와 \n\n몸에 느껴오는 그대와의 feel 내 모든 사랑을 다 보여준 사이 \n잠시 나를 외면하려 했어 하지만 나는 알고 있었어 \n밀려오는 유혹속에 빠져들어 (허전함에) 아무것도 찾지 못해 얼어버린 널 \n\n생각하나마나 결국 보나마나 내곁에 다시 돌아오게 될걸 \n멀리 다가오던 처음 느낌처럼 그 모습 그대로 내게 다가와 \n\n전부 가지려다 모두 잃어버려 그런게 바로 독한 세상인걸 \n너만 바라보던 모든 시간들은 내겐 너무 소중할 뿐야 \n\n보란듯이 내게 말을 했어 다시는 너를 찾지 않을꺼야 \n결국 먼저 나를 찾게 될껄 잊을수 없잖아 내게 돌아와 \n\nShow me your love Give my love for you I'll want nobody else to hold your soul \n괜한 자존심은 필요없어 너 역시 모두 알고 있잖아 \n모두가 널 떠난뒤엔 모든것이 (사라지고) 아픔만이 남을 거야 Take it in my life \n\n생각하나마나 결국보나마나 내곁에 다시 돌아 오게 될걸 \n너만 바라보던 모든 시간들은 내겐 너무 소중할 뿐야 \n\n아무도 모를꺼야 지쳐버린 마음을 나도 모르게 흘러내린 나의 눈물을 \n또다시 누군가를 사랑하게 된다면 다시 너를 택하진 않을꺼야 \n\nwhat you know about this here L O V E try to take \na botha off the streets lock him up in a cage 12 angry \nwomen au wanna spit at a brotha but i know you and \nhow you roll wanna take a brotha's soul you gots to go \n\n보란듯이 나를 떠나갔어 내 모든 사랑을 다 보여준 사이 결국 다시 사랑하게 될걸 \n\n생각하나마나 결국 보나마나 내곁에 다시 돌아오게 될걸 \n멀리 다가오던 처음 느낌처럼 그 모습 그대로 내게 다가와 \n\n전부 가지려다 모두 잃어버려 그런게 바로 독한 세상인걸 \n너만 바라보던 모든 시간들은 내겐 너무 소중할 뿐야 \n\n생각하나마나 결국 보나마나 내곁에 다시 돌아오게 될걸 \n\n\n\n- 뒤로 - \n\n\n\n02 Tell Me Baby \n\n어제밤 새벽에 너의 다른 여자 친구에게서 전화 왔어 \n처음 부터 믿을 수 없는 얘기들로 내 목소린 점점 떨리고 있었지 \n내가 알고 있는 너 전혀 다른 사람이란걸 알고 날 너무 슬프게 했어 Tell Me Baby \n\n얼마만큼 날 속여온건지 그녀와 보낸 시간이 있었는지 나와 보낸 그 많은 시간중 \n나에겐 너밖에 없는데 슬픔은 나 혼자 감당할 수 없어 \nI don't Wanna Play That Game 이제는 달라졌어 Tell Me Baby \n\n이제는 나를 사랑한다 말해주던 그대가 왜 이러는지 \n왜 날 사랑한거야 난 너의 전부가 아닌걸 그래도 널 믿고 싶어 \n나에게 말해줘 I Want You to Tell Me Baby \n\n얼마만큼 날 속여온건지 그녀와 보낸 시간이 있었는지 나와 보낸 그 많은 시간중 \n나에겐 너밖에 없는데 슬픔은 나 혼자 감당할 수 없어 \nI don't Wanna Play That Game 이제는 달라졌어 Tell Me Baby \n\n\n\n- 뒤로 - \n\n\n\n03 One \n\n지금처럼만 사랑하기를 많은 날들을 함께해도 \n\n원 내게 다가와줘. 투 내 손을 잡아줘 \n쓰리 내 어깨를 감싸줘. 포 그리고 사랑을 속삭여줘 \n\n파이브 더 가까이 다가와. 식스 몰래 키스해줘 \n쎄븐. 내 사랑 모두를. 에잇 니가 가져가도돼 널 사랑하니까 \n\n하얀 아침이 오면 제일 먼저 귀여운 니 생각때문에 나도 몰래 웃게하지 \n너를 알게된 이후로 그 누구 하루에 감사하며 나는 행복하기만 한것 같아 \n\n모든 것이 아름다워보여 나에 대한 너의 사랑까지 \n초콜렛도 달콤하진 않아 너의 손을 잡고 있을테면 \n\n원 내게 다가와줘. 투 내 손을 잡아줘 \n쓰리 내 어깨를 감싸줘. 포 그리고 사랑을 속삭여줘 \n\n파이브 더 가까이 다가와. 식스 몰래 키스해줘 \n쎄븐. 내 사랑 모두를. 에잇 니가 가져가도돼 널 사랑하니까 \n\nJust To Be Wish You 나만 사랑해줘. All My Love For you 너만 사랑할게 \nBaby Hold Me Tonight 그 누가 내게 와도 Tell Me It's alright 오직 너뿐야 \n그토록 많이 사랑하니까 \n\n싫어하던 비오는 날에도 니가 있어 난 좋기만한걸 \n알것같은 하루의 느낌이 내가 찾던 그 사랑이란걸 \n\n원 내게 다가와줘. 투 내 손을 잡아줘 \n쓰리 내 어깨를 감싸줘. 포 그리고 사랑을 속삭여줘 \n\n파이브 더 가까이 다가와. 식스 몰래 </p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/318/15026318_1323138300764_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131017, lowkey: nil, highkey: nil},
  {album_id: 99, singer_id: nil, team_id: 34, title: "Pray For You", genre1: "가요", genre2: "발라드", runtime: "03:15", lyrics: "\n\t\t\t\t\t\t\t<div>Pray For You - 03:15</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">알죠 깊은 우정이란 건 쉽게 찾기 힘든 걸 \n이젠 나도 깨달았어요 바로 내 곁에 있는 걸 \n\nWhat a friend We have in Jesus 내 안의 그대 있는걸 \nWhat a privilege to carry 그댈 위해 기도하죠 \n\n사실 조금 지쳐 있었죠 나의 우정의 한계에 \n그대를 만나고서 난 알게 되었죠 나의 모든 것 지켜줄거란 걸 \n\nWhat a friend We have in Jesus 내 안의 그대 있는걸 \nWhat a privilege to carry 그댈 위해 기도하죠 \n\nEverything to God in pray. Everything to God in pray \nEverything to God in pray. Everything to God in pray \nEverything to God in pray. \n\nWhat a friend We have in Jesus 내 안의 그대 있는걸 \nWhat a privilege to carry 오직 그대만을 \n\nWhat a friend We have in Jesus 내 안의 그대 있는걸 \nWhat a privilege to carry 오직 그대만을 \n\nWhat a friend We have in Jesus 내 안의 그대 있는걸 \nWhat a privilege to carry 그댈 위해 기도하죠 \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/318/15026318_1323138300764_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131018, lowkey: nil, highkey: nil},
  {album_id: 100, singer_id: 122, team_id: nil, title: "Blue", genre1: "가요", genre2: "전체", runtime: "04:31", lyrics: "\n\t\t\t\t\t\t\t<div>Blue  - 04:31</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">오늘 다시 이곳에 왔어 \r\n너의 기억 있는 이곳 변한 것 하나 없는데 왠지 바다는 우울해 \r\n\r\n니가 떠난 이 여름이 와 \r\n난 또 다시 허전해져 눈부신 하늘 하얀 파도 보이질 않아 \r\n지금은 어디에서 그 여름을 기억하는지 \r\n이젠 들을 순 없지만 날 다시 찾아와 \r\n아직 못다한 우리들의 축제 너만을 사랑해 \r\n\r\n니가 떠난 이 여름이 와 난 또 다시 허전해져 \r\n눈부신 하늘 하얀 파도 보이질 않아 \r\n지금은 어디에서 그 여름을 기억하는지 \r\n이젠 들을 순 없지만 날 다시 찾아와 \r\n함께 나누던 그 여름은 가고 \r\n쓸쓸한 이별만이 날 아프게 해 \r\n아직 못다한 우리들의 축제 너만을 사랑해 \r\n\r\n오늘 다시 이곳에 왔어 너의 기억 있는 이곳 \r\n변한 것 하나 없는데 왠지 바다는 우울해 \r\n니가 떠난 이 여름이 와 난 또 다시 허전해져 \r\n눈부신 하늘 하얀 파도 보이질 않아</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/319/15026319_1323057416279_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131019, lowkey: nil, highkey: nil},
  {album_id: 100, singer_id: 123, team_id: nil, title: "내일이 찾아오면", genre1: "가요", genre2: "전체", runtime: "03:48", lyrics: "\n\t\t\t\t\t\t\t<div>내일이 찾아오면  - 03:48</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">푸른바다 저 멀리서 나를 부르는 파도처럼 밀려오는 \r\n너의 모습이 메마른 나의 마음속에 살며시 다가오면 \r\n잃어버린 시간속에 \r\n나의 꿈들이 하나둘씩 기억속에 되살아나고 새로운 부푼 희망속에 가슴은 설레이네 \r\n행복이란 멀게만 느껴지지만 우리 마음 속에 있는걸 \r\n\r\n언젠가는 너에게 말해줄꺼야 \r\n내일이 찾아오면 너의 고운 두 손 가득히 \r\n나의 꿈을 담아주고서 \r\n이대로의 너의 모습을 사랑하고 있다고 \r\n저기 멀리 보일 것 같은 우리만의 희망 찾아서 \r\n사랑스런 너의 꿈속에 언제나 달려가리 \r\n\r\n내 가슴에 불어오는 모래 바람에 \r\n이름모를 물새들의 날개짓 소리 \r\n눈부신 여름 바닷가에 아침이 밝아오네 \r\n그림자만 남아있는 모습들 위로 \r\n먼하늘의 달빛하나 걸려질때면 \r\n노을 진 바다 가운데선 마음은 꿈을 꾸네 \r\n사랑이란 낯설게 느껴지지만 마주보면 눈 속에 있어 \r\n\r\n언젠가는 너에게 말해줄꺼야 내일이 찾아오면 \r\n너의 고운 두 손 가득히 나의 꿈을 담아주고서 \r\n이대로의 너의 모습을 사랑하고 있다고 \r\n저기 멀리 보일 것 같은 우리만의 희망 찾아서 \r\n사랑스런 너의 꿈속에 언제나 달려가리</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/319/15026319_1323057416279_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 6070, song_num: 16131020, lowkey: nil, highkey: nil},
