  {album_id: 100, singer_id: 123, team_id: nil, title: "Irv (사랑해요)", genre1: "가요", genre2: "전체", runtime: "04:29", lyrics: "\n\t\t\t\t\t\t\t<div>Irv (사랑해요)  - 04:29</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">오랫동안 내 곁에 항상 있어준 그대 \r\n내가 힘들 때마다 지켜주었죠 \r\n작은 실수 하나도 위로해주던 그대 \r\n내가 지칠 때마다 웃어주었죠 \r\n너무 고마워요 보답 해 줄께요 그대 \r\n내게 있다는 게 너무나도 감사해요 \r\n\r\n사랑해 그대만을 내 모습 많이 변했지만 \r\n영원히 기억해요 그대 곁에 있던 나를 \r\n많이 힘드나요 내 곁에 있는 게 \r\n모두 날 떠난다해도 그대만은 있어줘요 \r\n사랑해 그대만을 다시는 볼 수 없다해도 \r\n영원히 기억해요 그댈 지울 수 없단 걸 \r\n\r\n나를 믿어요 내 눈빛 속에 그댈 지킬 수 있게 \r\n사랑해 그대만을 내 모습 많이 변했지만 \r\n영원히 기억해요 그대 \r\n곁에 있던 나를 그댈 너무 사랑해요</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/319/15026319_1323057416279_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131029, lowkey: nil, highkey: nil},
  {album_id: 100, singer_id: 122, team_id: nil, title: "여름날의 추억", genre1: "가요", genre2: "전체", runtime: "04:07", lyrics: "\n\t\t\t\t\t\t\t<div>여름날의 추억  - 04:07</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">계절이 지나버린 쓸쓸한 바닷가에 \r\n언제나 부서지는 파도만이 [Oh-] \r\n아직도 내 가슴엔 아프게 출렁이고 있는 \r\n지나간 여름날의 추억 \r\n\r\n아무도 찾지 않는 바닷가엔 \r\n어느새 불꽃처럼 솟아오르는 사랑노래 들려오네 \r\n지금은 가고 없는 너의 모습 그리며 \r\n나 이제는 외로이 앉아 사랑노래 불러보네 \r\n짧았던 우리들의 여름은 가고 \r\n나의 사랑도 가고 너의 모습도 파도 속에 사라지네 \r\n불러도 대답 없는 이름이 되어 \r\n이제 추억이 되어 나의 여름날은 다시 오지 않으리 \r\n\r\n아무도 찾지 않는 바닷가엔 \r\n어느새 불꽃처럼 솟아오르는 사랑노래 들려오네 \r\n지금은 가고 없는 너의 모습 그리며 \r\n나 이제는 외로이 앉아 사랑노래 불러보네 \r\n짧았던 우리들의 여름은 가고 \r\n나의 사랑도 가고 너의 모습도 파도 속에 사라지네 \r\n불러도 대답 없는 이름이 되어 \r\n이제 추억이 되어 나의 여름날은 다시 오지 않으리 \r\n\r\n불러도 대답 없는 이름이 되어 \r\n이제 추억이 되어 나의 여름날은 다시 오지 않으리</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/319/15026319_1323057416279_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131030, lowkey: nil, highkey: nil},
  {album_id: 100, singer_id: nil, team_id: 45, title: "Summer In Love", genre1: "가요", genre2: "전체", runtime: "04:04", lyrics: "\n\t\t\t\t\t\t\t<div>Summer In Love  - 04:04</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">우리가 처음 만난 건 오래 전 기억인데 \r\n그 여름 그 바다와 넌 나를 또 찾아와 부르네 \r\n하얀 백사장 연인 속 파란 하늘 아래 우린 만났어 \r\n부서지는 파도 그 안에 실려 내게로 다가왔던 운명 \r\n다시 내게로 다시 내게로 꿈을 그린 먼 훗날 그 약속 \r\n아직 여기서 너를 기다리는데 \r\nSummer in love You leave me alone \r\nCome into my eyes \r\n수줍은 첫 키스 여운도 내 가슴에 남아 그리는데 \r\nCome to me my love \r\n\r\n니가 날 떠났던 아픈 지난 시간 속에서 \r\n이제는 그 해변을 나만 혼자 그렇게 걸었어 \r\n노을 물든 바다처럼 흘린 눈물만큼 내게 남은 너 \r\n파도처럼 밀려 멀어져 가는 짧았던 우리 둘의 사연 \r\n다시 내게로 다시 내게로 \r\n더 이상 기억할 수가 없는 너의 미소는 \r\n다시 볼 수가 없니 \r\nSummer in love You leave me alone \r\nCome into my eyes \r\n가슴 떨린 그 밤 고백도 저 별 속에 남아 그리는데 \r\nCome to me my love \r\n\r\n우리 약속처럼 너는 내 안에 그래 나는 니 안에 \r\n저 바다 안에 새겨둔 나만의 이름 \r\nSummer in love 다시 만날 때까지 \r\n다시 내게로 다시 내게로 더 이상 기억할 수가 없는 \r\n너의 미소는 다시 볼 수가 없니 Summer in love \r\nYou leave me alone Come into my eyes \r\n수줍은 첫 키스 여운도 내 가슴에 남아 그리는데 \r\nCome to me my love \r\n가슴 떨린 그 밤 고백도 저 별 속에 남아 그리는데</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/319/15026319_1323057416279_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 5887, song_num: 16131031, lowkey: nil, highkey: nil},
