  {album_id: 101, singer_id: nil, team_id: 35, title: "My Angel My Light", genre1: "가요", genre2: "댄스", runtime: "03:30", lyrics: "\n\t\t\t\t\t\t\t<div>My Angel My Light  - 03:30</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">You're my angel my light 놀라운 선물로 다가온 너를 사랑해 oh babe~ \r\n\r\nRap] Here we are, one more time for the SMTOWN, check this out, \r\ngonna move your body, shake that body to the beat. Everyone, get on your feet C'mon. \r\n\r\n이렇게 너와 있으면 새로 태어나 은빛 웃음 가득 나를 채워 \r\n내 눈 속에 있는 넌 신비한 빛으로 겨울날의 첫눈처럼 내 안에 들어와 \r\n\r\nYou're my angel my light 사랑을 알게 해준 네게 지금 다가가 Kissing you \r\nYou're my angel my heart 놀라운 선물로 다가온 oh 너를 사랑해 \r\nYou're my angel my light \r\n\r\nRap] 내가 사랑하는 그녀가 좋아하는 겨울이 왔어 하얀 눈을 닮은 그녀는 나의 천사 \r\n잠들기 전 기도해 사랑을 담아 내 곁에 없더라도 널 지켜달라고 \r\n\r\nYou're my angel my light 사랑을 알게 해준 네게 지금 다가가 Kissing you \r\nYou're my angel my heart 놀라운 선물로 다가온 oh 너를 사랑해 \r\nYou're my angel my light \r\n\r\n올해 겨울은 설레고 행복해 첫눈이 (내리고) 크리스마스 (때에도) 함께 할 테니 \r\n\r\n겨울나무 위로 내리는 저 하얀 눈처럼 내게 다가와 Loving you \r\n새하얀 내 마음 예쁜 불빛들로 밝혀준 oh 너를 사랑해 You're my angel my light \r\nWanna be happy Christmas</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/320/15026320_1323061784716_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 10486, song_num: 16131034, lowkey: nil, highkey: nil},
  {album_id: 101, singer_id: 122, team_id: nil, title: "보내는 글", genre1: "가요", genre2: "댄스", runtime: "04:25", lyrics: "\n\t\t\t\t\t\t\t<div>보내는 글 - 04:25</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">이게 전부라 말했잖아요 더 이상 줄 수 없는 것은 \r\n정말 이게 전부이기 때문이죠 그냥 떠나가세요 \r\n이게 전부라 말했잖아요 이미 다 주고 없는 것을 \r\n단 한번도 전부라 생각진 않았죠 오히려 감사해요 \r\n\r\n아무 흠도 어색함도 없는 나를 원하지는 말아요 \r\n우리 다시 만날 그 때엔 지금 내 모습을 기억해 주세요 \r\n아무 흠도 어색함도 없는 나를 원하지는 말아요 \r\n우리 다시 만날 그 곳에서도 나의 모든 것을 드릴 거예요 \r\n\r\n이제 모든 게 처음이지요 물론 다 주고 없는 것을 \r\n단 한번도 아쉬워하지는 않았죠 오히려 감사했죠 \r\n\r\n아무 흠도 어색함도 없는 나를 원하지는 말아요 \r\n우리 다시 만날 그 때엔 지금 내 모습을 기억해 주세요 \r\n아무 흠도 어색함도 없는 나를 원하지는 말아요 \r\n우리 다시 만날 그 곳에서도 나의 모든 것을 드릴 거예요 \r\n나의 모든 것을 드리겠어요</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/320/15026320_1323061784716_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 10678, song_num: 16131035, lowkey: nil, highkey: nil},
  {album_id: 101, singer_id: nil, team_id: 32, title: "이번만큼은", genre1: "가요", genre2: "댄스", runtime: "04:10", lyrics: "\n\t\t\t\t\t\t\t<div>이번만큼은 - 04:10</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">지금 나를 믿을 수 없어 너를 떠난다 해도 \r\n그 시간이 오질 않길 바랬는데 \r\n아직 나의 얼굴에 묻은 너의 진한 향기를 맡으며 \r\n너를 생각하고 있어 \r\n\r\n이번만큼은 너를 사랑해 그것이 헤어짐이라 해도 \r\n어제 우리가 지낸 마지막 시간 되돌아가서 \r\n멈출 수만 있다면 \r\n\r\nRqp] 이대로 너를 구속하고 그러긴 나도 싫어 \r\n널 위로 그 어떤 미련 없이 보내기로 \r\nI can't better 마지막에 떠난 것은 My love \r\n깊은 밤이 또 지나가고 \r\n\r\n어두운 밤하늘 별을 보며 \r\n너를 나의 품속에 안아주던 그 모습을 기억할지 \r\n때론 그리워하겠지만 제발 아무런 약속할 수 없는 \r\n내 현실을 이해해 \r\n\r\n이번만큼은 너를 사랑해 그것이 헤어짐이라 해도 \r\n어제 우리가 지낸 마지막 시간 되돌아가서 \r\n멈출 수만 있다면 \r\n\r\n내가 여기 있는다면 너의 전부를 모두 붙잡고도 싶어 \r\n하지만 그것은 단지 나의 이기적인 욕심일 뿐이야 \r\n\r\nRap] 아마 내가 너와 함께 할 수 없는 나를 \r\n상상할 순 없겠지 \r\n비록 기다려도 여기 서 있어도 오지 않아 \r\n이번만큼은 너를 사랑해 \r\n\r\n어제 우리가 지낸 마지막 시간 되돌아가서 \r\n멈출 수만 있다면 \r\n이번만큼은 너를 사랑해 아직도 너를 느낄 수 있어</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/320/15026320_1323061784716_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131036, lowkey: nil, highkey: nil},
  {album_id: 101, singer_id: 112, team_id: nil, title: "Snow in My Mind", genre1: "가요", genre2: "댄스", runtime: "03:26", lyrics: "\n\t\t\t\t\t\t\t<div>Snow in My Mind  - 03:26</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">눈을 감아봐요 느낄 수 있잖아요 \r\n따스한 불빛에 비춰진 나의 맘을 \r\n그대를 기다려온 시간 아직 남아있던 \r\n지난 계절의 슬픈 내 기억 모두 지워 버릴거야 \r\n\r\n그대 작은 입맞춤 얼어붙은 내 맘을 녹여버렸지 \r\nI know this feeling won't go away \r\n\r\nOh! Christmas time 이 거리에 \r\n그대와 나의 작은 기도만으로 차가웠던 마음 \r\n녹아버리겠죠 그대의 맘을 알아요 \r\n이대로 멈춰 있어줘요 나 기억할거야 \r\n\r\n아직도 그대 모르나요 맘으로 느껴봐요 \r\n수줍은 너의 미소만으로도 난 행복해진 거야 \r\n그대 작은 입맞춤 얼어붙은 내 맘을 녹여버렸지 \r\nI know this feeling won't go away \r\n\r\nOh! Christmas time 이 거리에 \r\n그대와 나의 작은 기도만으로 차가웠던 마음 \r\n녹아버리겠죠 그대의 맘을 알아요 \r\n이대로 멈춰 있어줘요 나 기억할거야 \r\n그대의 진심으로 말해줘 \r\n오직 나뿐이라고 날 사랑한다고 \r\n\r\nOh! Christmas time 이 거리에 \r\n그대와 나의 작은 기도만으로 차가웠던 마음 \r\n녹아버리겠죠 그대의 맘을 알아요 \r\n이대로 멈춰 있어줘요 나 기억할거야</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/320/15026320_1323061784716_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131037, lowkey: nil, highkey: nil},
  {album_id: 101, singer_id: nil, team_id: 33, title: "Blind", genre1: "가요", genre2: "댄스", runtime: "04:30", lyrics: "\n\t\t\t\t\t\t\t<div>Blind - 04:30</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">오늘처럼 슬펐던 밤하늘과 내겐 너무 소중했던 그대와 \r\n함께 있던 지난 겨울은 지나갔지만 \r\njust for a while I'll be there for you \r\n\r\n하얀 종이 위에 그대 있다면 \r\n그대 곁에 내가 함께 있다면 \r\n함께 있던 지난 시간은 끝이 났지만 \r\njust for a while I'll be there for you \r\n언제나 내 안에 머물러요 \r\n그 후론 모든 게 다 멈춰진 듯이 \r\n한없이 그대를 기억하며 아무것도 못 보는 나를.. \r\n\r\n그대가 지금 어디에 있어도 나 없이 웃고 있는지 몰라도 \r\n사랑했던 그 기억 밖에는 없죠 \r\njust for a while I'll be there for you \r\n언제나 내 안에 머무르죠 \r\n그 후로 모든 게 다 멈춰진 듯이 \r\n한없이 그대를 기억하며 아무것도 못 보는 나를.. \r\n\r\n믿을 수 없을테죠 그 날 그 이후로 \r\n내 모든 게 멈춰졌다는 걸 \r\n언제나 내 안에 머무르죠 (내 안에 머물러 줘) \r\n그 후로 모든 게 다 멈춰진 듯이 \r\n한없이 그대를 기억하며 그대만을 느끼는 내 마음을 \r\n(no no no please beside me ever more) \r\n\r\n언제나 내 안에 머무르죠 \r\n그 후로 모든 게 다 멈춰진 듯이 \r\n한없이 그대를 기억하며 아무것도 못 보는, \r\n그대만을 느끼는 이렇게 살아가는 나를</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/320/15026320_1323061784716_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131038, lowkey: nil, highkey: nil},
  {album_id: 101, singer_id: 128, team_id: nil, title: "My Christmas Story", genre1: "가요", genre2: "댄스", runtime: "03:52", lyrics: "\n\t\t\t\t\t\t\t<div>My Christmas Story  - 03:52</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">그대 미소에 모른척했죠 좋아도 \r\n안 그런 척 다만 떨리는 내 맘 들킬까봐 괜히 그런거죠 \r\n학교 갈때도 수업을 받을 때도 자꾸 그대의 생각이나 \r\n정말 내게 이럴순 없는거죠 나 어쩌면 좋아요 oh~no \r\n\r\n눈이 와 하얀 눈이 내려와 \r\n온 세상을 하얗게 이런 기분조차 \r\n내겐 처음인걸 왜 몰라요 \r\n눈이 와 까만 그대 두 눈에 제발 내게로 돌아와 \r\n그대 가까이 더 가까이 내게 와요 \r\n\r\n사랑한다는 말을 해줘요 별로란 말은 말고 \r\n나도 이젠 장난이 정말 아니죠 너무 심각하죠 \r\n예전 내모습 이러지 않았는데 너무 달라진 것만 같아 \r\n사랑이란 아무런 예고없이 내게 찾아오나 봐 oh~no \r\n\r\n눈이 와 하얀 눈이 내려와 온 세상을 하얗게 \r\n이런 기분조차 내겐 처음인걸 왜 몰라요 \r\n눈이 와 까만 그대 두 눈에 제발 내게로 돌아와 \r\n그대 가까이 더 가까이 내게 와요 \r\n\r\n밤새워 기도 드렸죠 오늘밤이 새도록 \r\n영원히 우리 함께 할 수 있게 \r\n눈이 와 까만 그대 두 눈에 제발 내게로 돌아와 \r\n그대 가까이 더 가까이 내게 와요 \r\n가까이 더 가까이 내게 와요</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/320/15026320_1323061784716_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131039, lowkey: nil, highkey: nil},
  {album_id: 101, singer_id: 122, team_id: nil, title: "Silver Bell", genre1: "가요", genre2: "댄스", runtime: "03:36", lyrics: "\n\t\t\t\t\t\t\t<div>Silver Bell  - 03:36</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">거리마다 오고가는 많은 사람들의 \r\n기쁜 크리스마스 또다시 우릴 찾아왔네 \r\n아이들도 어른들도 모두 다 함께 \r\n기쁨의 노랠 부르고 있네 \r\n\r\nSilver bell (Silver bell) Silver bell (Silver bell) \r\nIt's Christmas time in the city \r\nRing-a-ling (Ring-a-ling) hear them ring (hear them ring) Soon it will be Christmas day \r\n\r\nCity sidewalks, busy sidewalks dressed \r\nin holiday style In the air there's a feeling of Christmas \r\nChildren laughing, people passing \r\nMeeting smile after smile \r\nAnd on ev'ry street corner you'll hear \r\n\r\nSilver bell (Silver bell) Silver bell (Silver bell) \r\nIt's Christmas time in the city \r\nRing-a-ling (Ring-a-ling) hear them ring \r\n(hear them ring) Soon it will be Christmas day \r\nSilver bell (Silver bell) Silver bell (Silver bell) \r\nIt's Christmas time in the city \r\nRing-a-ling (Ring-a-ling) hear them ring \r\n(hear them ring) Soon it will be Christmas day</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/320/15026320_1323061784716_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131040, lowkey: nil, highkey: nil},
  {album_id: 101, singer_id: nil, team_id: 43, title: "들어볼래요", genre1: "가요", genre2: "댄스", runtime: "04:13", lyrics: "\n\t\t\t\t\t\t\t<div>들어볼래요 - 04:13</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">Narr] 밤하늘에 하얀 눈이 반짝이는 \r\n우리 눈 안에 가득 쌓이고 \r\n얼어붙은 두 손을 불어가며 조금 멀게만 느꼈었던 \r\n서로의 따스함이 전해지죠 \r\n\r\n깊은 밤 입김으로 하얗게 창문 녹이죠 멀리 보이나요 \r\n저 하늘의 별처럼 그 누군가의 가슴에 \r\n따스한 울림 전할 수 있도록 \r\n\r\n사랑을 시작해봐요 우리와 그대가 손을 먼저 내밀 때 \r\n사라지는 아픔들 \r\n함께 나눠봐요 그대 마음으로 변해 가는 이 세상 \r\n바람 불어와도 내겐 따뜻함이 남았죠 \r\n추위 가득해도 그대의 온기가 전해지는 이 순간 \r\n부디 잡은 손을 영원토록 놓지 말아요 \r\n\r\nNarr] 저기 우리 얘기 좀 들어볼래요 \r\nRap] Yo, 그대 내게 지금 다가와 같이 걸어가 \r\n내게 있는 사랑 단하나 가져가 \r\n따스함을 느낄 수 있게 기다림에 지치지 않게 \r\n한해 또 한해 가기 전에 사랑을 실천해 \r\n\r\n까만 밤 촛불아래 하나 둘 모여들었죠 소원 빌었나요 \r\n그대 마음 속에도 불을 밝혀 보아요 \r\n세상 모든 곳 비출 수 있도록 \r\n\r\n사랑을 시작해봐요 우리와 그대가 손을 먼저 내밀 때 \r\n사라지는 아픔들 \r\n함께 나눠봐요 그대 마음으로 변해 가는 이 세상 \r\n바람 불어와도 내겐 따뜻함이 남았죠 \r\n추위 가득해도 그대의 온기가 전해지는 이 순간 \r\n부디 잡은 손을 영원토록 놓지 말아요 \r\n\r\n함께 나눠봐요 그대 마음으로 변해 가는 \r\n이 세상 바람 불어와도 내겐 따뜻함이 남았죠 \r\n추위 가득해도 그대의 온기가 전해지는 \r\n이 순간 부디 잡은 손을 영원토록 놓지 말아요 \r\n함께 나눠봐요 그대 마음으로 변해 가는 \r\n이 세상 바람 불어와도 내겐 따뜻함이 남았죠 \r\n추위 가득해도 그대의 온기가 전해지는 \r\n이 순간 부디 잡은 손을 영원토록 놓지 말아요</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/320/15026320_1323061784716_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 10634, song_num: 16131041, lowkey: nil, highkey: nil},
  {album_id: 101, singer_id: 124, team_id: nil, title: "그 해 겨울", genre1: "가요", genre2: "댄스", runtime: "04:00", lyrics: "\n\t\t\t\t\t\t\t<div>그 해 겨울 - 04:00</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">하얀 눈이 밤하늘에 안개처럼 덮으면 \r\n기억에 젖어 떠오르는 그대와의 지난겨울 느낌 \r\n눈 내리던 깊은 밤에 부드러운 속삭임 \r\n사랑한다는 너의 목소리와 그리고 달콤한 입맞춤 \r\n\r\n하지만 이젠 또 다른 사랑이 되어 \r\n지금 내리는 흰눈을 바라보나요 \r\n너도 나처럼 살며시 꺼내온 기억에 \r\n지금 눈물을 흘리나요 \r\n변함없이 사랑해요 아름답던 기억을 \r\n사랑한다는 그 목소리와 달콤한 입맞춤을 \r\n\r\n하지만 이젠 또 다른 사랑이 되어 \r\n지금 내리는 흰눈을 바라보나요 \r\n너도 나처럼 살며시 꺼내온 기억에 \r\n지금 눈물을 흘리나요 \r\n변함없이 사랑해요 아름답던 기억을 \r\n사랑한다는 그 목소리와 달콤한 입맞춤을 \r\n달콤한 입맞춤을 달콤한 입맞춤을</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/320/15026320_1323061784716_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131042, lowkey: nil, highkey: nil},
  {album_id: 101, singer_id: nil, team_id: 35, title: "My Angle My Light (Instrumental)", genre1: "가요", genre2: "댄스", runtime: "03:29", lyrics: "\n\t\t\t\t\t\t\t<div>My Angle My Light (Instrumental) - 03:29</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가사 정보가 없습니다.</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/320/15026320_1323061784716_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131043, lowkey: nil, highkey: nil},
  {album_id: 101, singer_id: nil, team_id: 35, title: "Dear My Familly", genre1: "가요", genre2: "댄스", runtime: "05:27", lyrics: "\n\t\t\t\t\t\t\t<div>Dear My Familly  - 05:27</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">내가 설 곳을 찾을 수가 없을 때 \r\n폭풍 속에서 길을 잃어버렸을 때 \r\n언제나 변하지 않는 사랑과 용기를 주셨던 그\r\n들에게 감사를 보내요 \r\n\r\n때론 혼자라고 느꼈을 때가 있었죠 \r\n많이 울었던 지난날의 내 모습에 \r\n얼마나 마음이 아팠을까요 힘들었을까요 \r\n이제서야 난 알 것만 같아요 \r\n\r\n내 인생이 끝날 때까지 이 세상이 끝날 때까지 \r\n우린 영원히 함께 있을 거예요 \r\n작은 마음 모아 큰 힘 되듯 \r\n우린 하나란 것을 믿고 있어요 \r\n우리 함께 행복 만들어요 \r\n메마른 세상 속에 빛이 되는 날까지 사랑해요 \r\n\r\n나와 같은 꿈을 꾸고 있나요 \r\n정말 나와 같은 곳을 바라보고 있나요 \r\n그것만이 세상의 멍든 아픔을 치료할 수 있어요 \r\n서로 아껴 줄 수만 있다면 \r\n\r\n내 인생이 끝날 때까지 이 세상이 끝날 때까지 \r\n우린 영원히 함께 있을 거예요 \r\n작은 마음 모아 큰 힘 되듯 \r\n우린 하나란 것을 믿고 있어요 \r\n우리 함께 행복 만들어요 \r\n메마른 세상 속에 빛이 되는 날까지 사랑해요 \r\n\r\n우리 앞에서 절망해버린 사람들이 있다면 \r\n다시 일어날 큰 힘이 돼 줘야해 \r\n나와 같은 가족의 손길이 필요할 테니까 \r\n\r\n작은 마음 모아 큰 힘 되듯 \r\n우린 하나란 것을 믿고 있어요 \r\n우리 함께 행복 만들어요 \r\n메마른 세상 속에 빛이 되는 날까지 사랑해요</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/320/15026320_1323061784716_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131044, lowkey: nil, highkey: nil},
  {album_id: 101, singer_id: 123, team_id: nil, title: "그대와 영원히", genre1: "가요", genre2: "댄스", runtime: "04:31", lyrics: "\n\t\t\t\t\t\t\t<div>그대와 영원히  - 04:31</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">그대 흐르는 눈물을 닦으며 웃는 그대 모습 들어보아요 \r\n아주 여러 번 그대가 말했죠 그대 눈가에 주름진 사연들 \r\n괜찮아요 이미 다 아는 얘기지만 그대 말하는 동안 \r\n시간이 멈추죠 그때 생각나요 \r\n하늘이 나를 도왔던 거예요 \r\n\r\n나 여기 함께 있어요 그대와 영원히 \r\n그대 우는 모습이 아름다워요 \r\n그댈 사랑했던 내 아픈 기억들이 \r\n그대 머리맡에서 활짝 웃고 있어요 \r\n\r\n그댄 그를 생각하며 울지만 그대 나를 바라보며 웃어요 \r\n아주 오래 전에 사랑했던 만큼 이젠 정말 잊어야 하겠죠 \r\n그래요 나 그대 과거를 다 알고있죠 그대 숨쉬는 동안 \r\n항상 그대를 위해 기도하던 나를 아나요 \r\n이젠 나를 잊지 마요 \r\n\r\n나 여기 함께 있어요 그대와 영원히 \r\n그대 우는 모습이 아름다워요 \r\n그댈 사랑했던 내 아픈 기억들이 \r\n그대 머리맡에서 활짝 웃고 있어요 \r\n\r\n멈추었던 시간도 그대 눈가에 주름진 사연도 \r\n그대 눈물이 멈추면 어느덧 나를 향해 웃고 있죠 \r\n\r\n나 여기 함께 있어요 그대와 영원히 \r\n그대 우는 모습이 아름다워요 \r\n그댈 사랑했던 내 아픈 기억들이 \r\n그대 머리맡에서 활짝 웃고 있어요</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/320/15026320_1323061784716_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131045, lowkey: nil, highkey: nil},
  {album_id: 101, singer_id: 111, team_id: nil, title: "주기도문", genre1: "가요", genre2: "댄스", runtime: "03:20", lyrics: "\n\t\t\t\t\t\t\t<div>주기도문 - 03:20</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">하늘에 계신 아버지 이름 거룩하사 \r\n주님 나라 임하시고 뜻이 이루어지이다 \r\n일용할 양식 주시고 우리들의 큰 죄 다 용서 하옵시고 \r\n또 시험에 들게 마시고 악에서 구원하소서 \r\n대개 주의 나라 주의 권세 주의 영광 영원히 \r\n아멘</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/320/15026320_1323061784716_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131046, lowkey: nil, highkey: nil},
  {album_id: 101, singer_id: 114, team_id: nil, title: "Snow Baby", genre1: "가요", genre2: "댄스", runtime: "03:46", lyrics: "\n\t\t\t\t\t\t\t<div>Snow Baby  - 03:46</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">너를 보았던 그 순간부터 내 곁에 있던 또 다른 겨울 \r\n하지만 널 보내야만했던 지나간 나의 두 번의 겨울 \r\n\r\n기다리겠단 나의 약속과 흰눈과 함께 돌아올 그대 \r\nI'm drumming of a white christmas \r\nI wanna spend the night with you \r\n저 맑은 흰 눈 속에 그때의 슬픈 상처 \r\n모두 감출 수 있도록 \r\nGirl you're all I want on christmas \r\nI don't wanna be without you \r\n그렇게 바래왔던 소중한 우리만의 미랠 \r\n다시 그려 갈 수 있게 \r\n\r\n시간이 지나 흘러갈수록 지울 수 없는 너의 뒷모습 \r\n마지막 날 떠난 그때처럼 내 안에 있던 두 번의 겨울 \r\n\r\n기다리겠단 나의 약속과 흰눈과 함께 돌아올 그대 \r\nI'm drumming of a white christmas \r\nI wanna spend the night with you \r\n저 맑은 흰 눈 속에 그때의 슬픈 상처 \r\n모두 감출 수 있도록 \r\nGirl you're all I want on christmas \r\nI don't wanna be without you \r\n그렇게 바래왔던 소중한 우리만의 미랠 \r\n다시 그려 갈 수 있게 \r\n\r\n때론 견딜 수 없던 수많은 시간 \r\n난 이제 느낄 수 있어 Girl It's you that I won't let go \r\n\r\nI'm drumming of a white christmas \r\nI wanna spend the night with you \r\n저 맑은 흰 눈 속에 그때의 슬픈 상처 \r\n모두 감출 수 있도록 \r\nGirl you're all I want on christmas \r\nI don't wanna be without you \r\n그렇게 바래왔던 소중한 우리만의 미랠 \r\n다시 그려 갈 수 있게</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/320/15026320_1323061784716_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131047, lowkey: nil, highkey: nil},
  {album_id: 101, singer_id: 110, team_id: nil, title: "Jewel Song", genre1: "가요", genre2: "댄스", runtime: "05:21", lyrics: "\n\t\t\t\t\t\t\t<div>Jewel Song  - 05:21</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">Wow Wow Wow.. Wow Wow Wow.. \r\nWow Wow Wow..\r\nHey do you remember?\r\n설레었던 우리는 Time goes by\r\n함께 보낸 계절과 같은 향기\r\n마치 넌 빛처럼 내게로 다가왔지\r\nYou're my jewel\r\n내게 환한 미소를 지어줬지\r\n\r\n때론 다투고 미워하고 울기도 했지\r\n사랑이 무언지도 몰랐을 때니까\r\nYes Do you remember?\r\n이제서야 알았어요 Jewel in my heart\r\n그대를 향하고 있는 내 맘을\r\n\r\n어떻게 말할까 뭐라고 전할까\r\n그대를 원하는 나는 그대의 미소를\r\n몇 번이나 되새기면서 나 방황하면서\r\n또 다가 갈 거야 언제까지나\r\nDreams come true\r\n그대여 영원한 내 맘의 빛으로 남아줘요\r\n\r\nNo I can't forget you 맘 속 깊이 자리한\r\nDear my jewel 무엇과도 바꿀 수 없는 그대\r\n차가운 아침 마주 기댄 새하얀 입김이\r\n전해주는 이 느낌 믿고 싶어요\r\nSo I can't forget you 믿을 수 없을 만큼\r\nJewel in love 그대를 향하고 있는 그리움\r\n\r\n얼마만큼이나 지나야 느낄까 둘만의 시간\r\n소중함 셀 수 없을꺼야 아주 작은 기억까지도\r\n따사로운 봄이 눈부신 여름이 외로운 가을 겨울도\r\n나 약속할께요 그대의 곁에 잠들래요\r\nWow Wow Wow.. Wow Wow\r\n어떻게 말할까 뭐라고 전할까 그대를 원하는\r\n나는 그대의 미소를 몇 번이나 되새기면서\r\n나 방황하면서 또 다가 갈 거야 언제까지나\r\nDreams come true\r\n그대여 영원한 내 맘의 빛으로 남아줘요\r\nForever jewel in my heart\r\nWow Wow Wow.. Wow Wow Wow.. \r\nWow Wow Wow..</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/320/15026320_1323061784716_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 10506, song_num: 16131048, lowkey: nil, highkey: nil},
  {album_id: 101, singer_id: 125, team_id: nil, title: "White Mail", genre1: "가요", genre2: "댄스", runtime: "04:53", lyrics: "\n\t\t\t\t\t\t\t<div>White Mail - 04:53</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">하얀 눈이 오네요 소리 없이 오네요. \r\n그대도 보고 있겠죠 눈을 좋아하니깐\r\n아직도 겨울엔 모자를 안 쓰나요 \r\n눈오는 거리를 말없이 걸었나요\r\n내게 남겨준 그 음악을 아직도 매일 듣고 있어요\r\n소중한 시간 좋은 기억만을 준 그대였어요\r\n*햐안 눈이 내려 내 마음속에 내려 \r\n눈이 오는 계절엔 너무 그리워져요\r\n돌아와요 내게 눈이 멎기 전에 12월이 끝날때 \r\n그대와 함께 있고 싶어요\r\n사랑해요\r\n난 그 자리에 있죠 모두 그대로예요 \r\n그대와 걸었던 그 거리도 항상 사람들이 많아요\r\n하지만 조금씩 난 시들어가요 그대 비워둔 자리 \r\n너무나 커요 힘이 들어요\r\n내게 남겨준 그 사랑만은 아직도 커져가고 있어요 \r\n소중한 시간 좋은 기억만을 준 그대였어요\r\n\r\n* Repeat\r\n\r\n온 세상이 하얗게 눈이 덮여 있어요 \r\n너무나 포근한 솜이불처럼 따뜻해요\r\n그대만 내 곁에 있다면 바랄게 없어 난 정말 행복해\r\n\r\n* Repeat\r\n사랑해요 With You</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/320/15026320_1323061784716_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131049, lowkey: nil, highkey: nil},
  {album_id: 101, singer_id: 112, team_id: nil, title: "I Miss YOU", genre1: "가요", genre2: "댄스", runtime: "03:51", lyrics: "\n\t\t\t\t\t\t\t<div>I Miss YOU  - 03:51</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">저 창밖에 하얀 눈에 어느 샌가 밝아져버린 세상 \r\n지친 내 곁에 작은 내 맘속에 다가와 축복해 줄 수 있다면 \r\nMiss you so much 변치 않도록 기다린 만큼 \r\n더욱 설레게 해 \r\n\r\nRap] Us tell, My dream girl I been Waitin' 4 you, \r\nTime was passed but I'm still 4 you \r\n아주 오랜 시간 나 기다려왔어 To be with you \r\nClose your eyes let me kiss your lips and \r\n널 좋아해 변치 않는 걸 \r\nTime ain't no limit, I could give you what you want \r\n(영원한걸) \r\nYou the girl with the perfect eyes, \r\nYou the girl with the perfect smiles, \r\nYou the girl with the perfect mind. \r\nI just can't let you pass me by, \r\nListen I just make it real, \r\nwith ya. 하얀 눈을 바라보면서 단둘이서 \r\n손가락을 걸고 \"I do\" \r\n\r\n내 맘속에 한순간에 소리도 없이 찾아와 버린 사랑 \r\nMiss You So Much 말못했지만 \r\n오랫동안 너무나 기다렸어 \r\n\r\n내 기억속에 늘 그랬듯이 \r\n눈이 부시게 아름다운 그대를 \r\nOh My Dream comes true 영원하기를 \r\n지금 이 순간 멈춰버리기를 \r\n\r\nMiss you so much 말못했지만 \r\n오랫동안 너무나 기다렸어 \r\n내 기억속에 약속할게 하얗게 쌓인 눈만큼 \r\n간직할게 나만의 그대와 영원하기를</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/320/15026320_1323061784716_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131050, lowkey: nil, highkey: nil},
