  {album_id: 101, singer_id: 176, team_id: nil, title: "Christmas Sale", genre1: "가요", genre2: "댄스", runtime: "03:55", lyrics: "\n\t\t\t\t\t\t\t<div>Christmas Sale - 03:55</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">잘 지내고 있죠...\r\n그대와 헤이지고 며칠을 난 아무것도 할 수 없었죠\r\n다 멈춰버릴것만 같았었는데\r\n그대가 없어도 난 이렇게 또 하루를 살아가죠\r\n다른 사람을 만나고 있단 그말을 \r\n난 어떻게 받아들여야 하나요\r\n내가 없으면 아무것도 못할것 같던 그대라 생각했는데\r\n그댄 벌써 다른사람과 다른 사랑을 하고 있네요\r\n\r\n*그댈 보내면 다 좋아질꺼란 \r\n편해질꺼라 마음먹었던 내가..\r\n이렇게 바보같이 힘들꺼라곤 생각하지 못했죠\r\n행복한가요\r\n그대 옆에 다른 사람이 있다는건 상상조차 할 수 없는데..\r\n잘해주나요..\r\n예전의 나처럼 투정만 부리고 그댈 힘들게 하진 않나요\r\n이젠 그대 힘들어 하지 않았으면 해요\r\n그렇게 이기적인 나에게도 \r\n모질게 대하지 못했던 좋은 사람이었으니까요\r\n\r\n**행복해야해요\r\n그대 옆엔 내가 아닌 다른 사람 이지만 난 괜찮을께요\r\n잘해줘야해요\r\n내가 행복했던것보다 더 행복하게 해줘야해요\r\n기다려도 되나요\r\n이렇게 그댈 바라보기만해도 그걸로 감사한걸요\r\n날 봐주지 않는다 해도\r\n내가 그댈 바라볼수만 있다면 그걸로 된거니까요</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/320/15026320_1323061784716_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131052, lowkey: nil, highkey: nil},
  {album_id: 101, singer_id: nil, team_id: 35, title: "Dear My Friend (Instrumental)", genre1: "가요", genre2: "댄스", runtime: "05:24", lyrics: "\n\t\t\t\t\t\t\t<div>Dear My Friend (Instrumental) - 05:24</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가사 정보가 없습니다.</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/320/15026320_1323061784716_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131053, lowkey: nil, highkey: nil},
  {album_id: 102, singer_id: 177, team_id: nil, title: "Love Is Blue", genre1: "가요", genre2: "발라드", runtime: "04:03", lyrics: "\n\t\t\t\t\t\t\t<div>Love Is Blue - 04:03</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">그대 나에게 더 할 말이 없나요 \n인연이 아니라는 그 말에 난 아니라고 애써 우겼는데 \n행복 하란 말 대신 사랑했기에 미안하다는 말에 Love is Blue Love is Blue 가세요 \n그 언젠가 속삭이듯 날 위해 흘린 그대 눈물도 날 원하던 눈빛도 이젠 끝인가요 \n사랑한 만큼 내가 용서하게 말을 해줘요 미안하다뇨 할 말을 잃었죠 \n\nCry 이제는 울지 않아요 \nYou are the only one for me I believe so please don't be afraid \n그대가 아니고선 채울 수 없는 나의 사랑이에요 Love is Blue Love is Blue 가세요 \n\n그 언젠가 속삭이듯 날 위해 흘린 그대 눈물도 날 원하던 눈빛도 이젠 끝인가요 \n사랑한 만큼 내가 용서하게 말을 해줘요 미안하다뇨 그말 뿐인가요 \nLove is Blue 이제 다 끝인가요 \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/321/15026321_1405991330264_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 9837, song_num: 16131054, lowkey: nil, highkey: nil},
  {album_id: 102, singer_id: 177, team_id: nil, title: "마지막 너를 보내며... (이가은 Duet With 오현란)", genre1: "가요", genre2: "발라드", runtime: "04:43", lyrics: "\n\t\t\t\t\t\t\t<div>마지막 너를 보내며... (이가은 Duet With 오현란) - 04:43</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">너의 창백한 하얀 얼굴위로 흐르는 네눈물의 의미를 알기에 \n보내줘야해 생각하면서 마지막일 것 같은 널 붙잡고 있어 \n날 위해 울지마 너는 내게 잘못하지는 않았어 \n너를 사랑했어 아무것도 지켜주지 못한 날 용서해 \n얘길 해봐 왜 나의 곁을 떠나려는지 사랑했기 때문이라는 말은 하지마 \n살아있는 동안에 너를 잊을 수는 없어 내 기억 속에서 넌 언제나 부디 행복해야해 \n\n날 위해 울지마 너는 내게 잘못하지는 않았어 \n너를 사랑했어 아무것도 지켜주지 못한 날 용서해 \n이젠 너의 환한 웃음을 다신 볼 수 없겠지 행복했던 그 순간들은 쉽게 잊지는 마 \n너와 함께 할 수 없었던 우리의 슬픈 이별이 우리의 운명이라 해도 널 사랑할거야 \n\n아냐 네가 원한 그 자리에 내가 서있을게 아직 늦지 않았어 다시 내게 돌아와 \n이젠 혼자 걸어가야 할 낯익은 거리도 내겐 이겨내기 힘든 슬픔이야 \n얘길 해봐 왜 나의 곁을 떠나려는지 사랑했기 때문이라는 말은 하지마 \n살아있는 동안에 너를 잊을 수는 없어 내 기억 속에서 넌 언제나 부디 행복해야해 \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/321/15026321_1405991330264_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131055, lowkey: nil, highkey: nil},
  {album_id: 102, singer_id: 177, team_id: nil, title: "벙어리 바이올린", genre1: "가요", genre2: "발라드", runtime: "03:28", lyrics: "\n\t\t\t\t\t\t\t<div>벙어리 바이올린 - 03:28</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">my love my love is your love 어디에선가 그대와 함께 들었던 음악이 흐르죠 \n햇살이 눈부셔 그대가 생각났어요 내가 없는 오늘도 그댄 잘 지냈겠죠 \n다시 또 그대의 환상이 밀려와 이른 새벽녘까지 잠을 못 이룰 거예요 \n그댈 잊겠다고 한 적 하루도 없었죠 사랑해요 마지막 그 날까지 \nmy love 그대가 보고 싶어요 그대가 보고싶어 죽을 것만 같아요 \n\n누군가 그대를 잊었냐고 묻죠 내 맘은 벙어리가 되어 아무 말도 할 수 없어요 \n그댈 잊겠다고 한 적 하루도 없어요 사랑해요 마지막 그 날까지 \nmy love 그대가 보고 싶어요 그대가 보고싶어 죽을 것만 같아요 \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/321/15026321_1405991330264_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131056, lowkey: nil, highkey: nil},
  {album_id: 102, singer_id: 177, team_id: nil, title: "묻어둔 사랑", genre1: "가요", genre2: "발라드", runtime: "04:37", lyrics: "\n\t\t\t\t\t\t\t<div>묻어둔 사랑 - 04:37</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가끔씩 난 우리 함께 걷던 그 길을 걷곤 하지 \n많은 사람들과 부딪히며 추억 속을 거니는 거야 \n하지만 그들 사이에 내가 머무를 자린 없었지만 그 날 느낌으로 돌아가고 싶었어 \n오늘 낯익은 슬픈 음악이 발걸음을 멈추게 해 새학기가 시작될 무렵 네가 들려준 노래였지 \n그렇게 사랑했는데 시간은 가고 너 없이도 소리내며 웃을 수 있는 사람이 되었지 \n너 없이는 단 하루도 못 살 것 같던 슬픈 이 계절도 \n그 언제 그랬냐 싶게 두 번씩이나 지나가 버렸지만 \n다시 또 누군가 내게 니 소식을 전해주며 \n잊었냐고 하면 난 또 울 것 같아 널 잊은 게 아냐 묻어둔 것 뿐야 \n\n그렇게 사랑했는데 시간은 가고 너 없이도 소리내며 웃을 수 있는 사람이 되었지 \n너 없이는 단 하루도 못 살 것 같던 슬픈 이 계절도 \n그 언제 그랬냐 싶게 두 번씩이나 지나가 버렸지만 \n다시 또 누군가 내게 니 소식을 전해주며 \n잊었냐고 하면 난 또 울 것 같아 널 잊은 게 아냐 묻어둔 것 뿐야 \n\n나나나......널 잊은 것이 아니야 나나나......묻어둔 것 뿐야 나나나......널 잊을 순 없어 \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/321/15026321_1405991330264_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 5773, song_num: 16131057, lowkey: nil, highkey: nil},
  {album_id: 102, singer_id: 177, team_id: nil, title: "있잖아요", genre1: "가요", genre2: "발라드", runtime: "04:34", lyrics: "\n\t\t\t\t\t\t\t<div>있잖아요 - 04:34</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">그댄 아마 모르겠죠 그댈 사랑하다 웃는 그 웃음 뒤에 가리워진 내 슬픈 눈물을 \n그댈 사랑한다는 건 항상 내가 그랬듯이 내 눈물과의 다툼이었어요 \n할 말 있다더니 커피 잔만 만지는 그대 그 오랜 침묵에 너무 힘이 들죠 \n내게서 떠나나요 잘 지내라구요 그대의 낯선 말투가 싫어요 \n내게 그러지 말아요 한때 날 사랑했잖아요 아직도 난 그대뿐인 걸요 \n지금이라도 그대가 다시 기다리라 하면 난 너무나도 행복할 텐데 \n\n실감이 안나요 정말 우리가 헤어진 건지 사랑했다구요 참 우스워져요 \n내게서 떠나나요 잘 지내라구요 그대의 낯선 말투가 싫어요 \n내게 그러지 말아요 한때 날 사랑했잖아요 아직도 난 그대뿐인 걸요 \n\n그댄 아마 모르겠죠 그댈 사랑하다 웃는 그 웃음 뒤에 가리워진 내 슬픈 눈물을 \n정말 나 없이 그대는 행복할 자신 있냐고 </p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/321/15026321_1405991330264_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131058, lowkey: nil, highkey: nil},
  {album_id: 102, singer_id: 177, team_id: nil, title: "거짓말 같은 이별", genre1: "가요", genre2: "발라드", runtime: "04:11", lyrics: "\n\t\t\t\t\t\t\t<div>거짓말 같은 이별 - 04:11</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">그렇죠 거짓말이죠 내게서 마지막이라는 그 말 \n뭐라고 변명이라도 해봐요 거짓이라도 모두 믿을 테니 \n첨부터 아니었나요 그대에게 난 버려지는 건가요 \n눈물로는 이 텅 빈 가슴을 채울 수 없기에 난 울 수도 없죠 \n그래요 그대 없이는 살 수 없을 거란 이 말 밖에 그대한테 할 수 없는 나인데 \n그 누구도 다시 사랑할 수 없는데 왜 내게 아픔만을 주나요 \n\n오늘은 그대가 없는 하루를 잊으려고 버텨봤죠 \n도저히 난 나를 이겨낼 수 없어 아무 것도 할 수 없어요. \n알고 있었죠 그댈 많이 사랑했던 걸 그대 땜에 지금도 내가 아파하는 걸 \n그댈 잊는 게 이렇게도 어렵다는 걸 이별 후에야 난 알았어요 \n\n기억해줘요 그대 날 잃어버리면 다신 이런 사랑 또 없을 거란 걸 \n그래요 그대 없이는 살 수 없을 거란 이 말 밖에 그대한테 할 수 없는 나인데 \n그 누구도 다시 사랑할 수 없는데 왜 내게 아픔만을 주나요 \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/321/15026321_1405991330264_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131059, lowkey: nil, highkey: nil},
  {album_id: 102, singer_id: 177, team_id: nil, title: "슬픈 배려", genre1: "가요", genre2: "발라드", runtime: "04:06", lyrics: "\n\t\t\t\t\t\t\t<div>슬픈 배려 - 04:06</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">나의 사랑을 가져가 버린 그대 이제 슬퍼하지 말아요 \n다시 살아서 볼 수 없는 그대모습이 되어버렸죠 \n바라만 봐도 눈물이 나죠 우린 어쩌다 헤어져야 했지 \n이렇게 끝낼 수 없는 줄 알면서 그대를 보내야해요 \n알죠 그대 떠난 후 알게되었지 내가 더 많이 사랑했음을 \n그죠 날 사랑한 거죠 끝내 그대만을 못 잊을 거예요 \n(내 모습만큼 사랑한 사람) 꼭 나보다도 행복해야해요 \n이젠 나 혼자서 키워갈 내 안의 사랑 그건 내 몫이죠 \n\n지금 내 곁을 스치는 바람 그대 곁을 지나온 것처럼 \n예전의 그대의 향기가 나네요 또 눈물이 흐르죠 \n알죠 그대 떠난 후 알게되었지 내가 더 많이 사랑했음을 \n그죠 날 사랑한 거죠 끝내 그대만을 못 잊을 거예요 \n(내 모습만큼 사랑한 사람) 꼭 나보다도 행복해야해요 \n이젠 나 혼자서 키워갈 내 안의 사랑 그건 내 몫이죠 </p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/321/15026321_1405991330264_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131060, lowkey: nil, highkey: nil},
  {album_id: 102, singer_id: 177, team_id: nil, title: "그대 앞에서", genre1: "가요", genre2: "발라드", runtime: "04:35", lyrics: "\n\t\t\t\t\t\t\t<div>그대 앞에서 - 04:35</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">그대는 내가 느낄 수 있는 가까운 곳에 늘 서있었죠 \n이윤 뭔가요 내게 관심이 있다면 가까이 오세요 내 손이 닿을 수 있도록 \n그대 모습을 좋아하면서 즐거웠지만 언제부턴가 \n사랑을 느껴 슬퍼지기 시작했죠 이제는 혼자서 어떡해야 해요 \n쓸쓸하게 웃는 그대의 아주 작은 몸짓에도 예민할 만큼 나는 많이 울고 고민을 했었죠 \n나만 바라보는 그대의 사랑에도 부족해서 투정하듯 그대를 불러요 \n\n쓸쓸하게 웃는 그대의 아주 작은 몸짓에도 예민할 만큼 나는 많이 울고 고민을 했었죠 \n나만 바라보는 그대의 사랑에도 부족해서 투정하듯 그대를 불러요 \n\n나만 바라보는 그대의 사랑에도 부족해서 투정하듯 그대를 불러요 \n내가 여리고 모자라지요 아니라지만 그 말 맞아요 \n보고싶어 눈물 흘리면서도 내 입은 자꾸만 웃음 지으려 해요 \n왜일까요 그댈 아주 많이 사랑을 하나봐요 \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/321/15026321_1405991330264_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131061, lowkey: nil, highkey: nil},
  {album_id: 102, singer_id: 177, team_id: nil, title: "Say Goodbye... (이가은 Duet With 김조한)", genre1: "가요", genre2: "발라드", runtime: "04:25", lyrics: "\n\t\t\t\t\t\t\t<div>Say Goodbye... (이가은 Duet With 김조한) - 04:25</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">눈물이 묻어날 것만 같은 니 작은 목소리로 \r\n커피 한잔을 사이에 두고 넌 내게 이별을 얘기하네 \r\n이기적인 나를 용서해 줘 널 바라볼 수 없어 \r\n또 다른 사랑에 빠져 울고 있는 날 조금씩 잊어 줘 \r\n어느새 눈물이 입술을 적시네 좋은 사람을 만나라는 그런 말은 하지마 \r\nHow do I say Good-bye 내곁에 남아 있어 줘 \r\n나만의 사랑은 바로 너에게만 예약되 있는 거야 say goodbye \r\n\r\n내게 속삭였던 사랑의 말을 새로운 연인에게 \r\n날 사랑했듯이 같은 마음으로는 고백을 하지마 \r\n날 떠나 넌 정말 행복할 수 있니 좋은 사람을 만나라는 그런 말은 하지마 \r\nHow do I say Good-bye 영원히 나를 지켜 줘 \r\n그것이 니가 내게 해줄 수 있는 마지막 선물이야 \r\n\r\n언젠가 니가 좋아 들려준 잔잔한 피아노 멜로디에도 \r\n내가 울고 있는건 아직은 너의 작은 위로가 필요한 나의 눈물이야 \r\nHow do I say Good-bye 내곁에 남아 있어 줘 \r\n나만의 사랑은 바로 너에게만 예약되 있는 거야 \r\nHow do I say Good-bye 영원히 나를 지켜 줘 \r\n그것이 니가 내게 해줄 수 있는 마지막 선물이야 say Good-bye</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/321/15026321_1405991330264_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131062, lowkey: nil, highkey: nil},
  {album_id: 102, singer_id: 177, team_id: nil, title: "미안해요", genre1: "가요", genre2: "발라드", runtime: "04:10", lyrics: "\n\t\t\t\t\t\t\t<div>미안해요 - 04:10</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">Rap) \n어느 날부턴가 그대가 나를 잠시 소홀히 대 했을 때 \n내 마음속에 있는 그댈 비집고 들어온 사람 있었어 \n그댈 원망하며 운적 많았었지만 그때 힘들어 하는 날 \n위로해주던 그사람이 이젠 어느새 돌이킬 수 없는 사랑이 되어 버렸어 \nSay My Love Goodbye Baby \n바리톤) \n너를 잊으라 하니 너도 그럴 수 있니 \n어떻게 널 잊으라 하니 눈물이 나 \n너무나 미안해요 그대만 바라보기가 힘들 때 다가온 사랑에 내가 흔들렸어요 \n나도 여자인걸요 또 다른 사랑에 빠져버린날 용서해 달라면 보내 줄건 가요 \n잊을 수는 없을꺼예요 행복했으면 해요 모두 그대 때문에 흘린 눈물이야 \n\nRap) \n시간이 흐르면 날 가슴속에서 잊고 살겠지 이루지 못한 아픈 사랑의 상처를 달래줄 \n그 누군가를 나 아닌 다른 사람을 사랑하기를 \n너무나 미안해요 그대만 바라보기가 힘들 때 다가온 사랑에 내가 흔들렸어요 \n나도 여자인걸요 또 다른 사랑에 빠져버린날 용서해 달라면 보내 줄건 가요 \n잊을 수는 없을꺼예요 행복했으면 해요 모두 그대 때문에 흘린 눈물이야 \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/321/15026321_1405991330264_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 4748, song_num: 16131063, lowkey: nil, highkey: nil},
  {album_id: 102, singer_id: 177, team_id: nil, title: "블루 노트", genre1: "가요", genre2: "발라드", runtime: "04:10", lyrics: "\n\t\t\t\t\t\t\t<div>블루 노트 - 04:10</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">오늘 하루 보내기가 너는 외롭진 않았었니 내가 없는 하루의 끝이 낯설진 않았는지 \n가끔씩 친구를 통해 너의 소식 듣곤 했어 너도 가끔 내 얘기를 웃으며 묻는다는 걸 \n아직도 너 때문에 내가 아파한다는 걸 혹시 친구들이라도 알까봐 \n그들 앞에선 난 얼마나 웃어야만 했는지를 너는 아마 모를 거야 \n그렇게 지내다 보면 잊을 줄 알았는데 울리다가 끊어지는 전화에도 울고 있어 \n날 위해 잊어야겠지 널 위해 흘린 눈물까지 말을 해줘 너의 행복이 왜 내가 될 순 없니 \n언젠가 나를 찾겠지 후회로 우는날 있겠지 아직까지 너의 얘기를 웃으며 할 수 없어 잊지 말아줘 \n\n날 위해 잊어야겠지 널 위해 흘린 눈물까지 말을 해줘 너의 행복이 왜 내가 될 순 없니 \n언젠가 나를 찾겠지 후회로 우는날 있겠지 아직까지 너의 얘기를 웃으며 할 수 없어 잊지 말아줘 \n(아직도 날 잊지 못해) 힘들어하는 너에게 나 없이도 행복하냐고 묻고 싶었을 뿐이야 \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/321/15026321_1405991330264_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 9126, song_num: 16131064, lowkey: nil, highkey: nil},
  {album_id: 102, singer_id: 177, team_id: nil, title: "Dear", genre1: "가요", genre2: "발라드", runtime: "04:13", lyrics: "\n\t\t\t\t\t\t\t<div>Dear - 04:13</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">난 이제 커다란 우정보다도 조그만 예쁜 향기에 쌓인 그대 사랑을 원해 \n그대의 마음속에 감췄던 그 사랑이 내 이름으로부터 시작됐음 좋겠어 \n미래를 꿈꾸기엔 나 아직 부족하지만 그대가 갖게될 첫사랑이었으면 \nI know you will stay for me 그대의 아주 작은 관심이 나에게는 커다란 기쁨이란 걸 \nYou know everytime I say 그 무엇도 두렵지 않아 난 행복해 나의 손을 잡아 줘 \n\n그대의 입술에 입맞추고 싶었던 그 날의 설레임 난 잊을 수 없어 \n그댄 알고 있을까 I'm waiting for your love I'm missing you 사랑에 빠져버린 걸 \n이제 사랑을 알아 그 무엇도 두렵지 않아 난 행복해 나의 손을 잡아 줘 \n\n하지만 난 이미 사랑의 슬픔을 조금은 알고있어 그대를 사랑하는 만큼의 아픔이란 걸 \nI know you will stay for me 그대의 아주 작은 관심이 나에게는 커다란 기쁨이란 걸 \nYou know everytime I say 그 무엇도 두렵지 않아 난 행복해 나의 손을 잡아 줘 \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/321/15026321_1405991330264_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 12607, song_num: 16131065, lowkey: nil, highkey: nil},
  {album_id: 102, singer_id: 177, team_id: nil, title: "I Need You", genre1: "가요", genre2: "발라드", runtime: "03:43", lyrics: "\n\t\t\t\t\t\t\t<div>I Need You - 03:43</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">지금 슬픈 꿈에서 깨어나 어둔 방안을 서성거리고 있어 \n어떤 날 하루쯤은 그대도 나처럼 나를 생각하며 울고 있을 테지 \nI NEED YOU 너무 늦어버렸나 처음에 우리를 다시 찾기엔 \n나는 그대 사랑 앞을 향해서 달려가고 있어 그댄 항상 그 곳에 남아있어 줘야 해 \n그대 눈빛이 날 볼 수 있게 말야 처음 보았던 그 모습으로 날 잡아 줘 \n\n다시 한번 내 눈물이 흐르는 그대 꿈속에서 잠든 나를 찾아와 깨워주지 않을까 \n웃으며 모든 얘길 다 할 수 있는데 그대 얘기만은 (웃으며 할 수 없어) \n나는 그대 사랑 앞을 향해서 달려가고 있어 그댄 항상 그 곳에 남아있어 줘야 해 \n그대 눈빛이 날 볼 수 있게 말야 처음 그대로 그 사랑으로 날 잡아 줘 \n\nI NEED YOU \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/321/15026321_1405991330264_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131066, lowkey: nil, highkey: nil},
  {album_id: 102, singer_id: 177, team_id: nil, title: "말해", genre1: "가요", genre2: "발라드", runtime: "03:38", lyrics: "\n\t\t\t\t\t\t\t<div>말해 - 03:38</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">소중한 미랠 위해 넌 헤어지자고 했지 그래서 밝은 미래를 찾았니 \n모든 것을 이해 속에 자로 재려 하지마 말해 내게 말해 \n모두가 행복할 수 없다는 너의 그 말에 나의 자존심이 허락칠 않아 \n나와 도대체 진짜 헤어지는 이윤 뭐야 말해 내게 말해 \n거짓도 없이 날 배려하지도 말고 있는 그대로 너의 모든걸 보여줘 \n내가 네게 사랑한다 고백해 뭘해 떠나가는 너를 붙잡아 뭘해 \n너의 마음속에 내가 사라져 없을 텐데 내게 한도 끝도 없이 멀어져 갔어 \n그게 모두 나를 위한 사랑이었어 부탁이야 비참하게 만들지마 \n\n이별을 니가 먼저 내게 말해 놓고 눈물을 흘리는 이윤 뭐야 \n아쉬움 때문이니 동정 때문인거니 말해 내게 말해 \n거짓도 없이 날 배려하지도 말고 있는 그대로 너의 모든걸 보여줘 \n내가 네게 사랑한다 고백해 뭘해 떠나가는 너를 붙잡아 뭘해 \n너의 마음속에 내가 사라져 없을 텐데 내게 한도 끝도 없이 멀어져 갔어 \n그게 모두 나를 위한 사랑이었어 부탁이야 비참하게 만들지마 \n\n사랑한다며 그때 입맞춤을 해주던 그 입술로서 다시 이별을 말하지마 \n마지막으로 너를 믿고 싶어서 그래 제발 말해 줘 진실을 보여줘 \n내가 네게 사랑한다 고백해 뭘해 떠나가는 너를 붙잡아 뭘해 \n너의 마음속에 내가 사라져 없을 텐데 내게 한도 끝도 없이 멀어져 갔어 \n그게 모두 나를 위한 사랑이었어 부탁이야 비참하게 만들지마 \n내가 네게 사랑한다 고백해 뭘해 떠나가는 너를 붙잡아 뭘해 \n너의 마음속에 내가 사라져 없을 텐데 내게 한도 끝도 없이 멀어져 갔어 \n그게 모두 나를 위한 사랑이었어 부탁이야 비참하게 만들지마 \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/321/15026321_1405991330264_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131067, lowkey: nil, highkey: nil},
  {album_id: 103, singer_id: nil, team_id: 47, title: "행복했던 기억들은... When Did Your Heart Stop Loving Me", genre1: "가요", genre2: "댄스", runtime: "04:13", lyrics: "\n\t\t\t\t\t\t\t<div>행복했던 기억들은... When Did Your Heart Stop Loving Me - 04:13</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">우리 처음 만났던 그날이 떠올라 그 길을 또 걷지만 너는 곁에 없는걸 \r\n하얀 눈이 내리던 그날이 떠올라 오늘도 눈이 내려 내 눈에 눈물이 흘러 \r\n네가 곁을 떠나간 후 느낄 수 있는 건 너 없는 빈자리가 너무 큰 그리움이란 걸 \r\n가슴속을 파고드는 아픔이 있는 건 얼마나 많은 밤을 지새며 눈물 흘려야 하나 \r\n\r\nrap) 기억 속에 너의 모습 떠올라 나도 몰라 내가 왜 이래야만 하는지 왜 자꾸 눈물이 나는지 \r\n항상 곁에 있겠다던 네가 날 떠나지 않겠다던 네가 이제 없는 걸 더 크게 느껴지는 걸 후회만이 남아 \r\n술에 취해도 몸부림 쳐봐도 이젠 아무 소용 없는 걸 날 떠나간 후 \r\n\r\n네가 곁을 떠나간 후 느낄수 있는 건 너 없는 빈자리가 너무 큰 그리움 이란 걸 \r\n가슴속을 파고드는 아픔이 있는 건 얼마나 많은 밤을 지새며 눈물 흘려야 하나 \r\n이젠 너와 내가 되는가 하나였을 때 우린 정말 어떤 어려움도 이겨낼 수 있었는데 \r\n\r\n행복했던 기억들은 아픈 추억이 되고 너 없는 빈자리가 너무 큰 그리움이란 걸 \r\n가슴속을 파고드는 아픔이 있는 건 얼마나 많은 밤을 지새며 눈물 흘려야 하나 \r\n네가 곁을 떠나간 후 느낄 수 있는 건 가슴속을 파고드는 행복했던 기억은 아픈 추억이 되고</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/322/15026322_1346136939127_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131068, lowkey: nil, highkey: nil},
  {album_id: 103, singer_id: nil, team_id: 47, title: "Just Say Goodbye (Remix Version)", genre1: "가요", genre2: "댄스", runtime: "03:29", lyrics: "\n\t\t\t\t\t\t\t<div>Just Say Goodbye (Remix Version) - 03:29</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">떠나는 너의 모습 바라보면서 견딜 수 없어 눈물 따윈 보이고 싶지 않았는데 미안해 이런 내 모습에 \nJust say goodbye 다신 볼 순 없겠죠 널 잡고 싶지만 아무 소용 없겠죠 say goodbye \n\n주위엔 너의 흔적 남아 더 힘들고 잠들 수 없어 \n우리 기억 눈물과 함께 흘리고 행복해 널 위해 기도해 \n\nJust say goodbye 다신 볼 순 없겠죠 널 잡고 싶지만 아무 소용 없겠죠 \nJust say goodbye 다신 볼 순 없겠죠 널 잡고 싶지만 아무 소용 없겠죠 say goodbye \n\n못다한 얘기가 아직 남아 이렇게 끝낼 수가 없어 \nsay goodbye 돌아올 순 없나요 널 잡고싶지만 그럴 용기가 없죠 Just say goodbye \n\nrap] 너를 처음 보았던 날 나는 숨이 멎었었지 너무 아름다운 너의 모습 정말 눈이 부신 너 \n그런 네가 기대였을 때 나의 손을 잡았을 때 다신 놓치지 않길 영원하길 바랬는데 \n\nJust say goodbye 다신 볼 순 없겠죠 널 잡고 싶지만 아무 소용 없겠죠 \n\n너를 이렇게 보내는 것이 내겐 후회로 남겠지 사랑했던 기억들은 그저 추억이 되겠지 \n그게 더욱 슬프게 하고 추억이 너무 많아 아픔은 계속되고 또 계속되고 </p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/322/15026322_1346136939127_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131069, lowkey: nil, highkey: nil},
  {album_id: 103, singer_id: nil, team_id: 47, title: "Santa Baby", genre1: "가요", genre2: "댄스", runtime: "03:44", lyrics: "\n\t\t\t\t\t\t\t<div>Santa Baby - 03:44</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">you batter watch out, you batter not cry \nyou batter watch out, you batter not cry \nyou batter watch out, you batter not cry \n\n2002jtL 크리스마스날에 일어난 일 자! 다같이 santa baby \n엉망진창 크리스마스 날만되면 방콕인생 불쌍한 이놈에 인생아 뒤죽박죽 \n내 이름도 생각 안나 시원섭섭 잘가라 크리스마스여 자유로운 내가 되고 싶어 \n\n새하얀 구름 아래로 떨어지는 하얀 눈속에 파묻힌 사랑하는 그녀와 달콤한 사랑이야기 \n여기까지 뻔한 스토리 한번이라도 제발 한번 너와 같이 눈을 맞으며 \n너와 나의 눈을 맞추며 데이트 하는게 소원! 사람들이 들으면 so what? \n한번 만나려다가 들키는 날엔 기사꺼리 가십꺼리 인터뷰사절 방송사절 \n생각없이 던지는 돌에 난 속으로 삭히는 개구리가 되고 일년중 가장 고통스러운 날 \n12월 25일 크리스마스! 오오오오 하하~ \n\n엉망진창 크리스마스 날만 되면 방콕인생 불쌍한 이놈에 인생아 뒤죽박죽 \n내 이름도 생각 안나 시원 섭섭 잘 가라 크리스마스여 자유로운 내가 되고 싶어 \n\n요! 거리마다 오고 가는 수많은 연인 너무나 많아 \n행복한 웃음짓고 있는 저기 저 자유로운 새가 되고파 말하자면 나 사랑에 배고파 \n산타! 넌 남의 굴뚝이나 타고 다니나 넌 ganster santa 선물 안주면 \n하하 왜 그래 장난이야 장난 \n\n올해 크리스마스 날이 되면 딱 두가지 종류의 사람들이 있겠지 \n첫째는 바로 두놈의 @@들 따뜻한 장갑차속에서 지낼 @@들과 \n추운 광화문 거리에서 촛불로 시위하는 사람들 \n요! 대통령 아저씨 집에 소파(sofa)가 낡아서 우리 @@@찔리니까 확 좀 바꿔버려! 잉? \n\n엉망진창 크리스마스 날만 되면 방콕인생 불쌍한 이놈에 인생아 뒤죽박죽 내 이름도 생각 안나 \n시원섭섭 잘가라 크리스마스여 자유로운 내가 되고 싶어 \n\n이렇게 신세 한탄하는 내 인생 생각해보면 행복에 넘쳐 분에 넘쳐 너무도 배부른 소리여 \n(주위를 둘러보면) 아직도 저기 저 어두운 곳에 추위에 떨며 힘겨워 하는 수많은 사람들 \n때론 너무너무 외로워 혼자라고 느껴질때도 있었지만 \n사랑하는 fan들은 영원한 우리들의 크리스마스 연인 Tony baby! \n\n이러면 어때요 저러면 어떤가요 나로인해 더 많은 사람들이 행복하면 \n난 세상에서 가장 행복해요 난~ \n\n엉망진창 크리스마스 날만 되면 방콕인생 불쌍한 이놈에 인생아 \n뒤죽박죽 내 이름도 생각 안나 시원섭섭 잘가라 크리스마스여 난 세상에서 가장 행복해 \n\n엉망진창 크리스마스 날만 되면 방콕인생 불쌍한 이놈에 인생아 \n뒤죽박죽 내 이름도 생각 안나 시원섭섭 잘가라 크리스마스여 난 세상에서 가장 행복해 </p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/322/15026322_1346136939127_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131070, lowkey: nil, highkey: nil},
