  {album_id: 103, singer_id: nil, team_id: 47, title: "Merry Christmas", genre1: "가요", genre2: "댄스", runtime: "03:48", lyrics: "\n\t\t\t\t\t\t\t<div>Merry Christmas - 03:48</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">하얀 눈이 내리는 White Christmas \n\n온 세상이 하얗게 모두 물들고 아무도 모르게 간직해 왔던 나만의 비밀 수줍게 고백해볼래 \n아무 말 없는 눈물로 말해준 그대 누구보다도 널 더 아껴줄거야 \n세상이 모두 우릴 축복하는것만 같아 워~ \n\n이대로 너와 단 둘이서 Merry Merry Christmas Happy Happy Christmas \n너만 바라보며 살게 믿어줄래 날 영원히 Merry Merry Christmas Happy Happy Christmas \n\n이대로 너를 안고 싶어 함께 하고 싶어 짙은 어둠속에 지쳐있던 내게 한줄기 빛처럼 다가왔어 \n넌 내게 거리에 울려퍼지는 수많은 노래들 성탄의 종소리 \n모두 우릴 위한 거야 널 더 이상 혼자 버려두지 않을게 \n\n이젠 내가 그댈 지켜줄게 저 하늘이 부르는 그날까지 너만 바라볼게 널 사랑할게 오! \n시간이 지나 모두 변한대도 언제까지나 그댈 지켜줄거야 세상의 모든 축제 모두 아름다워 보여 워~ \n\n이대로 너와 단 둘이서 Merry Merry Christmas Happy Happy Christmas \n너만 바라보며 살게 믿어줄래 날 영원히 Merry Merry Christmas Happy Happy Christmas \n이대로 너를 안고 싶어 함께 하고 싶어 \n\n수많은 시간동안 널 기다려왔어 이젠 널 놓치지 않을게 (널 더 아껴줄거야) \n하얀눈이 내리고 있는 이밤 I love you forever \n영원히 너만을 지켜줄거야 Merry Merry Christmas Happy Happy Christmas \n너만 바라보며 살게 믿어줄래 날 영원히 Merry Merry Christmas Happy Happy Christmas \n이대로 너를 안고 싶어 함께 하고 싶어 Na Na Na Na Na Na \n        </p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/322/15026322_1346136939127_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 12454, song_num: 16131072, lowkey: nil, highkey: nil},
  {album_id: 103, singer_id: nil, team_id: 47, title: "From. FAN (Remix Version)", genre1: "가요", genre2: "댄스", runtime: "04:57", lyrics: "\n\t\t\t\t\t\t\t<div>From. FAN (Remix Version) - 04:57</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">Narr] 나를 바라보는 너희들의 눈을 생각했어 너무 부끄럽고 힘도 많이 들었지만 \r\n너희들 만큼은 아니였을 꺼야 눈처럼 하얀 사랑을 너희들의 눈으로 바라보며...... \r\n\r\n당신이 가장 힘들다는 거 알면서 너무 속상하죠 너를 용서 하려해도 눈물이 나죠 \r\n날 속였던 사람이 나를 아직도 믿으라고 하죠 또 난 믿고 싶죠 모든게 거짓이라도 \r\n\r\n한번에 믿음은 너를 위한 나의 맹세 영원히 기다려준단 말도 잊혀져 가겠지만 BABY \r\n매일같이 널 그리며 살고 싶어요 어디에서나 당신 편일 수 밖에 없는 것 \r\n\r\nI JUST WANNA LET A KNOW THAT I STILL LOVE YOU SO~! \r\n나의 바람은 사랑하는 너 하나 뿐야 아무리 힘들어도 널 위한 마음으로 다 이겨낼 수 있어 \r\n\r\n아름답던 생각들만 우리 함께 해 우린 언제나 함께 할 꺼란 믿음이 있어 \r\n아무리 힘들어도 널 위한 마음으로 다 이겨 낼 수 있어 \r\n\r\n영원히 하자고 했던 말 모두 거짓이 아니였단 걸 문득 너 하얀 눈물보고 깨달았지 너의 사랑이 무언지 \r\n끝이 없는지 보고 듣고 느끼고서야 다시 눈물 흘렸던 건 내가 너무 어리석어서 일꺼야 \r\n\r\n한번에 믿음은 너를 위한 나의 맹세 영원히 기다려준단 말도 잊혀져 가겠지만 BABY \r\n매일같이 널 그리며 살고 싶어요 어디에서나 당신 편일 수 밖에 없는 것 \r\n\r\n늦은 저녁 집 앞에서 너 추위에 떨며 사람들에 눈초리 마져도 널 아프게 했어 \r\n아무것도 해줄 수 가 없었던 나 인걸 용서해 줄래 바보같이 상처만 주었던 나를 \r\n\r\nI JUST WANNA LET A KNOW THAT I STILL LOVE YOU SO~! \r\n나의 바람은 사랑하는 너 하나 뿐야 아무리 힘들어도 널 위한 마음으로 다 이겨낼 수 있어 \r\n아름답던 생각들만 우리 함께 해 우린 언제나 함께 할 꺼란 믿음이 있어 \r\n아무리 힘들어도 널 위한 마음으로 다 이겨 낼 수 있어 \r\n\r\nI JUST WANNA LET A KNOW THAT I STILL LOVE YOU SO~! \r\n나의 바람은 사랑하는 너 하나 뿐야 아무리 힘들어도 널 위한 마음으로 다 이겨낼 수 있어 \r\n아름답던 생각들만 우리 함께 해 우린 언제나 함께 할 꺼란 믿음이 있어 \r\n아무리 힘들어도 널 위한 마음으로 다 이겨 낼 수 있어</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/322/15026322_1346136939127_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131073, lowkey: nil, highkey: nil},
  {album_id: 103, singer_id: nil, team_id: 47, title: "기도 Chance On Love", genre1: "가요", genre2: "댄스", runtime: "03:53", lyrics: "\n\t\t\t\t\t\t\t<div>기도 Chance On Love - 03:53</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">Take a 기도 그녀에게 아무리 기도 해봐도 돌아오지 않아 알아요 \n바보같이 두손이 모아지는 건 너와의 사랑이 식지않았단 증거 \n널 믿지 않아 그렇게 떠나면 어떻해 가끔 아프다는 건 거짓말 아냐? Come on  Come on \n\nTell me 하늘은 네게 어울리지 않아 하루에 만번이라도 기도 할 수 있어 \nTake a 기도 나 혼자 깊게 널 생각해 봤죠 진심 어린 기도는 이뤄져 \n\n난 아직도 진심이 아닌가봐요 내맘이 진심이 되길 기도할게 \n널 믿지 않아 그렇게 떠나면 어떻해 가끔 아프다는건 거짓말 아냐? Come on Come on \n\nTell me 하늘은 내게 어울리지 않아 하루에 만번이라도 기도 할 수 있어 \nTake a 기도 제발 부탁해요 하늘에 (계신아버지) 차라리 나를 데려가요 \n\n뜻이 하늘에(하늘에) 이룬것같이(이뤄져) 땅에서 이루어지길 \n그녀만 생각하면 한숨섞인 눈물 잠잘때나 생각날때마다 니가 뭔데 내눈에 밟혀 \n슬픔과 기쁨은 나에겐 소중하지만 \n너만 생각하면 나에겐 고통 그렇게 니가 내게서 떠나가버린 후 \n크리스마스 오직 나에게 남은건 너와의 추억 내가 너에게 할 수 있었던 건 오직 기도 \nTell me 하늘은 네게 어울리지 않아 하루에 만번이라도 기도 할 수 있어 \nTake a 기도 </p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/322/15026322_1346136939127_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131074, lowkey: nil, highkey: nil},
  {album_id: 103, singer_id: nil, team_id: 47, title: "Mistake (Remix Version)", genre1: "가요", genre2: "댄스", runtime: "03:53", lyrics: "\n\t\t\t\t\t\t\t<div>Mistake (Remix Version) - 03:53</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">내게 보인 미소들은 마치 완벽했던 연극같이 함께한 시간들은 이제 갔지 너를 이젠 다시 볼 수 없게 됐지 \n내게 보인 미소들은 마치 완벽했던 연극같이 함께한 시간들은 이제 갔지 너를 이젠 다시 볼 수 없게 됐지 \n\n이젠 나도 널 잊겠어 내 모습 어디서도 찾지마 그렇게 미안해 하지마 \n너의 모든 기억 지워줄게 떠난 너를 뒤로한 채 나의 길을 간다 남겨진 꿈을 위해 \n너와 함께 지낸 모든 시간 이젠 내게서 달아나 모두 지워졌어 \n\n착각하지마 오해하지마 네가 내 곁에 없어도 난 괜찮아 \n더 이상 미련 없이 모두 지워줄게 이젠 내게서 아주 멀리 떠나가줘 \n착각하지마 오해하지마 네가 내 곁에 없어도 난 괜찮아 \n나도 널 잊겠어 이젠 뒤 돌아 보지않아 내 모든 기억 다 가져가 버려 \n\n함께했던 많은 날 동안 오직 너만 생각했는데 너만 바라봤는데 몰랐어 \n너만은 변하지 않을 줄 알았던 나 바보처럼 믿어 왔었던 나 \n마음속엔 날 벌써 지워 놓고 왜 이제 와서 내게 서툰 변명을 해 \n그와 나의 사일 왔다 갔다 해왔던 연극 끝이야 이젠 사라져버려 \n\n떠난 너를 뒤로한 채 나의 길을 간다 남겨진 꿈을 위해 \n너와 함께 만든 추억마져 내게 내게서 가져가 모두 지워졌어 \n착각하지마 오해하지마 네가 내 곁에 없어도 난 괜찮아 \n더 이상 미련 없이 모두 지워줄게 이젠 내게서 아주 멀리 떠나가줘 \n착각하지마 오해하지마 네가 내 곁에 없어도 난 괜찮아 \n나도 널 잊겠어 이젠 뒤 돌아 보지않아 내 모든 기억 다 가져가 버려 \n\n날 버린 넌 이제 자유롭겠지 지난날을 뒤로한채 \n미련 따윈 필요 없어 내 남겨진 꿈을 위해 (다시 시작하겠어 이젠) \n착각하지마 오해하지마 네가 내 곁에 없어도 난 괜찮아 \n더 이상 미련 없이 모두 지워줄게 이젠 내게서 아주 멀리 떠나가줘 \n착각하지마 오해하지마 네가 내 곁에 없어도 난 괜찮아 \n나도 널 잊겠어 이제 뒤돌아 보지않아 내 모든 기억 다 가져가 버려 </p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/322/15026322_1346136939127_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131075, lowkey: nil, highkey: nil},
  {album_id: 103, singer_id: nil, team_id: 47, title: "오랫동안 Love is A Pain", genre1: "가요", genre2: "댄스", runtime: "05:27", lyrics: "\n\t\t\t\t\t\t\t<div>오랫동안 Love is A Pain - 05:27</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">한동안 말이 없어 그렇게 있었죠 어색한 인사 뒤로 스쳐 지났지만 \r\n그댄 행복해 보이네요 그대곁에 그사람 나보다 좀 더 잘 해 줄거예요 \r\n\r\n그대 떠나보낸 그 겨울 오랫동안 많이 아파하고 있지만 소용없는걸요 \r\n처음 그대에게 조심스레 다가갔던 날 해맑은 미소로 내맘 받아주었죠 \r\n\r\n너무 보고 싶어 눈물도 나지만 (I don't cry) 이제는 말할 수 없죠 (또 다시한번) \r\n사랑한다고 말하고 싶지만 이제는 내가 아닌 또 다른 그대가 \r\n\r\n가끔씩 내 안부를 묻는 네 전화에 난 또 잘 있다고 잘 지낸다고 그런 말 하지만 \r\n허나 예전 같지 않아요 조금 야위어진 내 모습에 그대도 놀랄 거예요 \r\n\r\n그댈 떠나보낸 그 겨울 오랫동안 많이 아파하고 있지만 소용없는걸요 \r\n처음 그대에게 조심스레 다가갔던 날 해맑은 미소로 내맘 받아주었죠 \r\n\r\n너무 보고 싶어 눈물도 나지만 (I don't cry) 이제는 말할 수 없죠 (또 다시 한번) \r\n사랑한다고 말하고 싶지만 이제는 내가 아닌 또 다른 그대가 \r\n\r\n언젠가 그대 내게 돌아온다면 나 다시 그대를 안아줄텐데 \r\n단 한번 내가 보고 싶다면 언제라도 그대 빈자리 남겨둘게 그땐 내게 다시 \r\n\r\n그래 어쩌면 우린 서로 그저 스쳐 지나가야할 운명이었는지도 몰라 \r\n내가 아파한 만큼 너도 너무나 많이 아파했을 거야 그땐 너도 어쩔수 없다는걸 \r\n나의 쓸데없는 자존심을 너무도 너무도 크게 후회하고 있다는 것을 \r\n너 없이 수많은 시간을 혼자 너없이 견디며 살아가야 할 내가 내가 자신이 없어 \r\n\r\n너무 보고 싶어 눈물도 나지만 (I don't cry) 이제는 말할 수 없죠 (또 다시 한번) \r\n사랑한다고 말하고 싶지만 이제는 내가 아닌 또 다른 그대가 \r\n\r\n다시 보고 싶다 말하고 싶지만 (I don't say) 이제는 끝난일인걸 (As time gose by) \r\n오랫동안 시린 추억이 언젠가 시간속에 묻혀지겠지 행복하길</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/322/15026322_1346136939127_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131076, lowkey: nil, highkey: nil},
  {album_id: 103, singer_id: nil, team_id: 47, title: "Enter The Dragon (Remix Version)", genre1: "가요", genre2: "댄스", runtime: "03:28", lyrics: "\n\t\t\t\t\t\t\t<div>Enter The Dragon (Remix Version) - 03:28</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">Come Back Dragon Come Back JTL \n\n지난 5년간(훠!) 축적해온 Energy! 난 Pow \n(Wow) 내 몸에선 불을 내뿜지 그렇게도 오늘만을 기다린 나 이제 싹~ 정리 할 때가 왔지 \n난 제껴 내 몸 안에 용솟음 치는 라임 뱉어 용의 몸짓 마치 춤추는 듯한 신들린 듯한 발광 \n\nNow in Get you to Fall in 이 음악에 미쳐 나를 바쳐 어느덧 22년이란 시간 흘러보니 \n인정사정 없고 거침없는 사회 생활 속에 찌든 그리고 병든 나약해진 내 모습이 \n어느 순간 거울 속에 비쳐 나는 미쳐 달성하지 못한 내 꿈을 위한 새로운 나를 결심 \nBest of the dragon Enter the JTL \n\n쉽게 쓰러지진 않아 지켜봐 두 눈으로 난 네가 생각했던 만큼 약하지 않아 \n여기서 주저하진않아 지켜봐 그 눈으로 난 네가 무너지는 날 까지 싸워 이겨내겠어 \n\n뭐야 네가 뭐야 겨우 고작 그것 뿐이야 더 찔러봐 힘껏 내가 쓰러질 때 까지 힘껏 뻗어보란 말이야 \n아픔의 끝을 지나 새롭게 시작하네 뜨겁게 타오르는 저 태양에 뻗어나가는 절권도와 같이 \n마치 미친 용의 몸부림이 만들어 내는 거대한 불씨 여긴 사방이 막힌 Deathrow 피할 수 없이 \n절대로 오직 살아 남기 위해 싸우겠어 그리고 또 싸우겠어 You know Lee's style? \n(브루스리의 스타일은알지?) 그리고 널 무릎 꿇게 하겠어 후회하지마 너무 늦어버렸으니까 \n내 자신 외에 그 누구도 믿지 않아 난 또 We'll take ya down \n(Yo! Nigga we'll be comin') We'll wipe ya out (Yo! Nigga we'll be comin') \nWe'll put ya down (Yo! Nigga we'll be comin') We'll strike ya out (Yo! Nigga we'll be comin') \n(We'll rock you and knock you) (Yo! Nigga we'll be comin') \n\n너에겐 마지막 시간이 온거야 이제 더는 너 갈 곳은 없어 피하려 하지마 너의 최후인거야. \n\nWe'll take ya down (Yo! Nigga we'll be comin') We'll wipe ya out (Yo! Nigga we'll be comin') \nWe'll put ya down (Yo! Nigga we'll be comin')(x2) We'll strike ya out (Yo! Nigga we'll be comin') \n(We'll rock you and knock you) (Yo! Nigga we'll be comin') We're Still alive </p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/322/15026322_1346136939127_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131077, lowkey: nil, highkey: nil},
  {album_id: 103, singer_id: nil, team_id: 47, title: "A Better Day (Remix Version)", genre1: "가요", genre2: "댄스", runtime: "04:57", lyrics: "\n\t\t\t\t\t\t\t<div>A Better Day (Remix Version) - 04:57</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">Whenever I turned around I see happy faces I still can't \nbelieve you are gone that is true I'll be always there for you \n\n이별이 이렇게 쉽게 다가올꺼라 예감할 수 없던 나 기쁨 슬픔을 \n함께 나누던 우리 stop 또 그렇게 헤어져야만 했던 우리 \n돌이킬수 없는 지난 시간 너와 함께 했던 순수했던 아름다웠던 나날들 \n모두가 우리를 부러워했던 나날들 아무것도 부러울것이 없던 시간들 \n그렇게 어두운 과거속에 내가 너를 만난 건 행운이었어 \n\nA Better Day 왜 날떠나갔어 Another Way 아무런 말없이 \n아름다웠던 우리들의 추억 이제 두번다시 돌아오지않아 \n\nYo!Yo! 그렇게 힘들고 지쳐 외로운 내 영혼에 넌 내게 다가와 너무나 차디 차가웠던 \n나의 손을 잡아 주었어 네가 없는 너의 빈자리는 내게 이제 마음속 깊은 곳의 허전함으로 변해 \n내 맘에 너무나도 행복했던 우리들만의 시간을 기억해 \n너에게 아무것도  해줄 수 없던 나를 용서해 행복해 내가 없는 다른 세상에서 \n\nA Better Day 왜 날떠나갔어 Another way 아무런 말없이 \n아름다웠던 우리들의 추억 이제 두번다시 돌아오지않아 \n\n우리 서로 사랑했던 지난 겨울로 돌아가고 싶지만 \n이제는 너무도 많은 시간이 지난 것을 깨달아 너무나도 빨리 흘러가는 시간 \n이제 내게 다가올 또 다른 이별의 세게 뜨겁게 타고 내리는 두뺨위의 눈물들 \n희미해져 가는 추억속의 사진들 다시 못 올 추억이라 해도 소중히 간직해줘 \n내게 준 우리의 아름다운 기억들을 \n\n또다른 세상속을 향해향해 (오오오) 날 다시 또 시작 하게하게 (오오오) \n더이상 너를 찾진 않아않아 (오오오) 미련없이 너를 잊어잊어 (오오오) \n\nA Better Day 왜 날떠나갔어 Another Way 아무런 말없이 \n아름다웠던 우리들의 추억 이제 두번다시 돌아오지않아 \n\n모든 역경을 헤쳐 여기까지 왔어 너에게 보여주겠어 네앞에 서있는 날 바라봐 \n네가 없이 살아갈 나만의 나의나의 모습 이겨내겠어 어떤 두려움에 부딪혀도 쓰러져도 \n내모습 그대로 보여준다 나의 랩으로 표현 안될 감동으로 \n그 느낌으로 어 우릴 지켜봐 지금 바라봐 다시 타오르는 jtL From jtL </p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/322/15026322_1346136939127_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131078, lowkey: nil, highkey: nil},
  {album_id: 29, singer_id: nil, team_id: nil, title: "", genre1: "", genre2: "", runtime: "", lyrics: "\n\t\t\t\t\t\t\t<div> - </div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\"></p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: nil, song_num: 16131079, lowkey: nil, highkey: nil},
  {album_id: 104, singer_id: 23, team_id: nil, title: "Unforgettable", genre1: "가요", genre2: "R&amp;B/소울", runtime: "04:03", lyrics: "\n\t\t\t\t\t\t\t<div>Unforgettable - 04:03</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">요즘 어때 많이 힘들다면서 오늘도 널 아는 친구가 네 얘길 전하던걸 \n그게 뭐야 잘해내기로 했으면서 니가 아플수록 내가 미안해 \n네 얼굴을 떠올려봐도 그렇게 슬프진 않아 너무 많이 사랑했었는데도 너만큼 이렇게 가슴이 무뎌지게돼 \n\n또 한사람을 잊어가나봐 널 알기전에 그랬었듯이 시간으로 어떤 아픔도 지우는걸 \n또 한사람이 찾아온다면 널 대하듯 잘해주겠지만 나도 잊혀진다는게 싫은걸 \n\n우리 그때 좀더 아껴야했어 이렇게 헤어질거라면 조금 덜 사랑할껄 \n이게 뭐야 지나간 몇해의 일들이 모두 너와의 추억들 뿐인걸 \n내 이름을 얘기할때도 전처럼 울지는 않아 아무일도 할수 없었는데도 그래도 이렇게 조금씩 나아지게돼 \n\n또 한사람을 잊어가나봐 널 알기전에 그랬었듯이 시간으로 어떤 아픔도 지우는걸 \n또 한사람이 찾아온다면 널 대하듯 잘해주겠지만 너도 날 잊는다는게 두려워 \n\n이별이란게 그런거잖아 떠밀려가듯 견뎌내다가 가끔씩은 괜한 눈물도 흐르는것 \n다 잊으라고 말은 했지만 그런 널 보면 속상했을꺼야 오래 그리워해줘서 고마워 \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/323/15026323_1323240002749_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131080, lowkey: nil, highkey: nil},
  {album_id: 104, singer_id: 23, team_id: nil, title: "To My Love", genre1: "가요", genre2: "R&amp;B/소울", runtime: "04:17", lyrics: "\n\t\t\t\t\t\t\t<div>To My Love - 04:17</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">그댈 만나던 어떤 날보다 옷을 고르기가 어려워 \r\n오늘 만나서 하잔 얘기가 왠지 자꾸맘에 걸려요 \r\n\r\n만일 그대가 나를 떠나겠다면 \r\n나는 붙잡지 못할거에요 \r\n사랑한다는 고백보다 힘든게 \r\n이별의 말인것 같아 \r\n아니길 바래 난 그대의 사진만 봐도 \r\n여전히 가슴 떨리고 설레이는데 \r\n아니길 바래 내 사랑을 그대여 제발 놓지 말아요 \r\n\r\n오늘 밖에는 할수 없는 얘기면 \r\n오늘 약속은 피하고 싶어 \r\n다신 그대를 못볼 것만 같아서 걸음이 느려만가요 \r\n아니길 바래 난 그대의 사진만 봐도 \r\n여전히 가슴 떨리고 설레이는데 \r\n아니길 바래 내 사랑을 그대여 제발 놓지 말아요 \r\n\r\n내 예감이 틀리기를 나는 바랄 뿐이죠 \r\n그대를 만나고 돌아오는 길이 나 슬프지 않도록 \r\n아니길 바래 그 아무리 시간이 가도 \r\n그대여 나의 곁에서 머물겠다고 \r\n나에게 말해 그 언제나 그대 나만을 사랑한다고 \r\n사랑한다고 떠나지 말아요</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/323/15026323_1323240002749_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131081, lowkey: nil, highkey: nil},
  {album_id: 104, singer_id: 23, team_id: nil, title: "Tuesday", genre1: "가요", genre2: "R&amp;B/소울", runtime: "04:36", lyrics: "\n\t\t\t\t\t\t\t<div>Tuesday - 04:36</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">사랑하고 싶었어 니가 너무 좋았어 니가 나의 다였어 제발 차갑게 날 보지마 \n처음부터 그랬어 그래서 무서웠어 니가 날 버릴까봐 너의 사랑이 식어버릴까봐 \n\n떠나가지마 돌아서지마 날 울리지마 헤어지지마 애원해봐도 기도해봐도 소용없는거니 안되는거니 \n사랑했었어 니가 다였어 미쳐있었어 너무 좋았어 제발 이렇게 버려두지마 니가 좋았어 그게 다였어 \n사랑받고 싶었어 니가 주길 바랬어 기도하고 있었어 니가 그 사랑을 채워 주기를 \n헤어지기 싫었어 아파하기 싫었어 미쳐가기 싫었어 혼자 영원히 울고 있기 싫어 \n\n매달려봐도 붙잡아봐도 애원해봐도 소용없겠니 안보내줘도 못 보내줘도 울고 있어도 안되는거니 \n사랑하고 싶었어 니가 너무 좋았어 니가 나의 다였어 제발 차갑게 날 보지마 \n처음부터 그랬어 그래서 무서웠어 니가 날 버릴까봐 너의 사랑이 식어버릴까봐 \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/323/15026323_1323240002749_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131082, lowkey: nil, highkey: nil},
  {album_id: 104, singer_id: 23, team_id: nil, title: "선물", genre1: "가요", genre2: "R&amp;B/소울", runtime: "03:58", lyrics: "\n\t\t\t\t\t\t\t<div>선물 - 03:58</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">Just one\r\n그냥 보내기\r\n\r\n무슨말 해도\r\n절대 안울기\r\n\r\nJust twice\r\n거짓말하기\r\n\r\n손흔들어 주며\r\n환하게 웃기\r\n\r\n온 밤을 새우며\r\n적어도 천만번쯤\r\n\r\n다시 맹세하고\r\n또 다짐하고\r\n\r\n혼자 웃고 울고\r\n함께 나눈 키스와\r\n\r\n우리 함께 나눈 약속들\r\n너무 많은데\r\n\r\n이러면 안되는데\r\n세상에 그 누구도\r\n\r\n내 맘 같을 수가 없다면\r\n너의 선물을\r\n\r\n감사히 다 받을게\r\nYou're saying goodbye@\r\n\r\nMemories\r\n참 이쁜 숨소리\r\n\r\n뭐든지 원한다면\r\n다 갖는건줄만 알았던\r\n\r\n바보라 해도\r\n정말 사랑한다면\r\n\r\n너무 힘들어도\r\n이해 못해도\r\n\r\n헤어지면 안되잖아\r\n너의 눈에 비치는\r\n\r\n내가 너무 슬퍼 보이면\r\n맘 아플까봐\r\n\r\n웃고 또 웃었는데\r\n밤새워 연습했던\r\n\r\n나의 거짓말이 어색해\r\n참았던 눈물이\r\n\r\n끝내는 눈물이\r\n숨 막히게 눈물이\r\n\r\n함께 나눈 키스와\r\n우리 함께 나눈 약속들\r\n\r\n너무 많은데\r\n이러면 안되는데\r\n\r\n세상에 그 누구도\r\n내 맘 같을 수가 없다면\r\n\r\n다시 힘을내\r\n감사히 받을게\r\n\r\n너의 선물을\r\nYou're saying goodbye\r\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/323/15026323_1323240002749_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131083, lowkey: nil, highkey: nil},
  {album_id: 104, singer_id: 23, team_id: nil, title: "To My Love (English Ver.)", genre1: "가요", genre2: "R&amp;B/소울", runtime: "04:17", lyrics: "\n\t\t\t\t\t\t\t<div>To My Love (English Ver.) - 04:17</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">Hey hey yeah I'm singing. don't go away. \n\nSome stayed by my side Some left me behind \nI think about it often cause people change (yeah) \nMany times I cried.. and God knows I did try \nand when I open my eyes it's still the same \n\nI wanna know oh why, why I feel so incomplete \nand it hurts so bad inside I feel loney \nI wanna know oh why, everybody's close to me \nalthough their love is miles away \n\nI need somebody. That's feeling up down to my feet \ncause I'll reach out my hands to you so don't you run away. \nI need somebody. someone to make my life complete If you come my way. \n\nI wanna know oh why, why I feel so incomplete \nand it hurts so bad inside I feel loney \nI wanna know oh why, everybody's close to me \nalthough their love is miles away \n\nI need somebody. That's feeling up down to my feet \ncause I'll reach out my hands to you so don't you run away. \nI need somebody. someone to make my life complete If you come my way. \n\nWe all got the same emotions \nWe all go through the aches and pains \nOh why am I the one feels that somethings got to change \nwon't this pain just go away.... \n\nI need somebody. That's feeling up down to my feet \ncause I'll reach out my hands to you so don't you run away. \nI need somebody. someone to make my life complete If you come my way. \n\nIf you come my way.If you come my way.. \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/323/15026323_1323240002749_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131084, lowkey: nil, highkey: nil},
  {album_id: 104, singer_id: 23, team_id: nil, title: "끝없는 바다 저편에", genre1: "가요", genre2: "R&amp;B/소울", runtime: "03:56", lyrics: "\n\t\t\t\t\t\t\t<div>끝없는 바다 저편에 - 03:56</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">BOBBY] 숲속을 지나 빛이 내리는 세상이 나를 반겨주네 따뜻한 미소로 다가와 \n나의 눈을 띄워 상상의 날개를 달고서 끝없이 날아 \n\nT] 하늘이 주신 기대위에 나온 새싹이 현실이란 벽에 가리워 시들어 가네 \n어디로 어디로 아름다운 꿈은 어디로 흩어져 가나 \n\n다시 돌아갈수만 있다면 than I know how good that life can be 소중한 기억들 다시 찾을수 있을까 \n펼쳐진 동산에 문을 열수 있을 때까진 가슴 깊은 곳엔 오직 슬픔 뿐이야 \n\nBOBBY] 세상은 내게 거짓을 말해주고 있네 가까웠던 장미는 가시를 감추고 있네 \nT] 어둠에 갇힌 말라버린 이 땅위에 희망은 없어 \n\n믿음과 희망 없이 자라나고 있는 우리들의 꿈들이 다시 빛을 볼 그날이 올때까지 \n조그만 진실된 행동으로 세상을 조금씩 아주 조금씩이라도 바꿔 또 가꿔 나간다면 반드시 그날은 올거라 \n난 반드시 믿고 있고 슬픔따윈 잠시 잊고 그렇게도 꿈꾸웠던 동산으로 다같이 노력해 지금현실이 끝나도록 \n\nBRIDGE] 지금 현실에 빠져가는 자신이 두려워 이제는 영원히 오지 않을 그때가 그리워 \n\n다시 돌아갈수만 있다면 than I know how good that life can be 소중한 기억들 다시 찾을수 있을까 \n펼쳐진 동산에 문을 열수 있을 때까진 가슴 깊은 곳엔 오직 슬픔 뿐이야 \n메마른 이곳에 비를 내릴수만 있다면 사라진 꿈들을 다시 찾을수 있겠지 \n모든 이들의 마음에 문을 열수 있을 때까진 가슴 깊은 곳엔 오직 슬픔 뿐이야 \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/323/15026323_1323240002749_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131085, lowkey: nil, highkey: nil},
  {album_id: 104, singer_id: 23, team_id: nil, title: "One Day", genre1: "가요", genre2: "R&amp;B/소울", runtime: "03:47", lyrics: "\n\t\t\t\t\t\t\t<div>One Day - 03:47</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">왜 후회는 언제나 빨리해도 늦는건지 또 하루가 지나가는데 \n네 생각이 날 때 너무 많아 아픔을 하도 많이 겪어선지 나에게 잘해줬던 그사람은 못 잊는가봐 \n넌 어떠니 이제는 지낼만하니 한동안 들리던 니 소식 뜸해지니 날 잊었단 생각에 괜히 서운해져 \n이제는 모든게 달라졌지만 세월 흐른뒤에 왠지 다시 한번 보고싶은 사람 너에게는 내가 되었으면 해 \n\n널 아무리 원하고 널 아무리 사랑해도 늘 똑같을 수는 없는데 \n네 생각이 날 때 너무 많아 너에게 상처를 준 댓가인지 너보다 좋은사람 아직도 만나지 못했어 \n넌 어떠니 이제는 다잊은거니 나만을 사랑할거라던 그말을 난 속으로는 은근히 믿고 싶었나봐 \n이제는 모든게 달라졌지만 세월 흐른뒤에 다시 보고싶은 그런 사람으로 너에게 난 기억되었으면 해 \n\n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/323/15026323_1323240002749_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131086, lowkey: nil, highkey: nil},
  {album_id: 104, singer_id: 23, team_id: nil, title: "Because I Love You (With Bobby Kim)", genre1: "가요", genre2: "R&amp;B/소울", runtime: "04:22", lyrics: "\n\t\t\t\t\t\t\t<div>Because I Love You (With Bobby Kim) - 04:22</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">BOBBY] It's a lovely morning 너의 달콤한 입술에 난 잠에서 깨어나 , feels alright \r\n이대로 시간이 멈추어 주기를 오예 baby 너의 곁에 영원히 잠들고 싶어 너무도 사랑스런 그대이기에 \r\n\r\nBaby one day when it's beautiful I'll take my love I'll share my soul 그대만이 나의 사랑인거죠 \r\nThrough the good times and the bad times been through it all been through it all \r\n그대만이 나의 사랑인거죠 \r\n\r\nT] 때로는 그 모든 것이다 뜻대로 되지가 않아 (That's right) \r\n허나 포기하지 않아 나만을 믿어 Because I love you yes I do \r\n인생이란 저 험한 파도를 넘어 죽도록 우리함께 사랑할래요 \r\n\r\nBaby one day when it's beautiful I'll take my love I'll share my soul 그대만이 나의 사랑인거죠 \r\nThrough the good times and the bad times been through it all been through it all \r\n그대만이 나의 사랑인거죠 너의 곁에 영원히 잠들고 싶어 너무도 사랑스런 그대이기에 \r\n\r\nBaby one day when it's beautiful I'll take my love I'll share my soul 그대만이 나의 사랑인거죠 \r\nThrough the good times and the bad times been through it all been through it all \r\n그대만이 나의 사랑인거죠</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/323/15026323_1323240002749_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131087, lowkey: nil, highkey: nil},
  {album_id: 104, singer_id: 23, team_id: nil, title: "집으로 와", genre1: "가요", genre2: "R&amp;B/소울", runtime: "04:14", lyrics: "\n\t\t\t\t\t\t\t<div>집으로 와 - 04:14</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">집으로 와 집에 아무도 없어 예전같으면 난 지금 너에게 난 전화할텐데 \n나처럼 망설이지 말고 내가 그리워질땐 넌 그냥 내게 전화해줘 \n\n지난뒤에 다시 생각해보면 왜 그렇게 모든게 아쉽게만 느껴지는지 \n조금더 잘해주지 못한 나 지난 기억때문에 널 생각하면 맘이 아파 \n\n아직도 늦은건 아니야 또 이러다 다시 볼지몰라 헤어질 것을 우리 모른 것처럼 \n아직은 끝난게 아닌걸 또 서로가 행복하기 위해 결국 다른 길 택했지만 난 잡지 못했어 \n너의 곁에서 뒤돌아가는 그 길은 아직은 내게 이른걸 이별이란 그말을 하기에는 아직은 나에게 \n\n아직도 늦은건 아니야 또 어떻게 달라질지 몰라 헤어질것을 우리 모른것처럼 \n아직은 끝난게 아닌걸 또 이러다 서로 잊지 못해 다시 만날지 모르잖아 난 잡지 못했어 \n너의 곁에서 뒤돌아가는 그 길은 아직은 내게 이른걸 이별이란 그말을 하기에는 아직은 나에게 \n\n다시 한번만 떠올려봐도 널 생각해봐도 아무렇지 않는 날 \n멀어도 그떄까지는 너와 나의 이별은 이별이라 생각하지 않아 \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/323/15026323_1323240002749_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131088, lowkey: nil, highkey: nil},
  {album_id: 104, singer_id: 23, team_id: nil, title: "나는", genre1: "가요", genre2: "R&amp;B/소울", runtime: "04:16", lyrics: "\n\t\t\t\t\t\t\t<div>나는 - 04:16</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">나는 수많은 경쟁 앞에서 단 한번도 지쳐본적 없어 마치 원더우먼 처럼 난 언제나 무대위를 달렸어 \nWhat you wanna do now? 너의 미래가 니앞에 있는데 망설일 필요는 없어 선택은 하나일텐데 \n하루하루 긴장속에서 의미없이 보내긴 싫어 준비된 밤을 시작해 나를 믿어만 준다면 \n소리쳐 한계로 막힌 벽에 더 크게 외쳐 허물 수 있게 baby~ \n\n어깰 움직여 손을 흔들어 미세한 네 존재를 세상이 알수 있게 \n잠깐이라도 모든 걸 잊고 여유롭게 흐를 수 있게 \n\n나는 수많은 선택후에도 단 한번도 후회한적 없어 이별도 마찬가지야 난 더욱더 성숙하게 변했어 \nWhat you wanna do now? 작은 상처에 아직도 슬퍼해 시간이 흐른뒤에는 아쉬워 후회할텐데 \n뒤틀어진 현실속에선 바보같이 웃을순 없어 삶의 향기가 사라져 꿈이 날아가기 전에 \n소리쳐 한계로 막힌 벽에 더 크게 외쳐 허물수 있게 baby~ \n\nWhat you wanna do now come for you What you wanna do now come for you \nRap] 별들이 쏟아지는 회색빛의 도시엔 화려한 장식의 선물들로 가득해 \n초라한 영혼들에게는 너무 야속해 언제나 거짓으로 기대속에 기회만을 약속해 \n허나 내인생의 경험을 토대로 내면의 깊이를 항상 내의지를 음에 (리듬에) 싣고 전달해 \n내말에 움직일 너희들에게 감동해 정신의 혼을 노래해 \n\n어깰 움직여 손을 흔들어 미세한 네 존재를 세상이 알수 있게 \n잠깐이라도 모든 걸 잊고 여유롭게 흐를 수 있게 \n\n어깰 움직여 손을 흔들어 미세한 네 존재를 세상이 알수 있게 \n잠깐이라도 모든 걸 잊고 여유롭게 흐를 수 있게 \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/323/15026323_1323240002749_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131089, lowkey: nil, highkey: nil},
  {album_id: 104, singer_id: 23, team_id: nil, title: "인연", genre1: "가요", genre2: "R&amp;B/소울", runtime: "04:04", lyrics: "\n\t\t\t\t\t\t\t<div>인연 - 04:04</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">그냥 스치는 인연이라 하기에는 이대로 나는 잊지 못할 것만 같애 \r\n매일 당신밖에 생각 할 수 없는걸 믿을 수 있나요 우린 정말 사랑을 했었나요 \r\n두 손잡고 같이 울던 그 날 밤도 이젠 추억으로 넘기기엔 너무도 아픈 기억 \r\n\r\nThe sound that you make it sounds so sad 나를 바라보던 그 눈빛 이제 다시 볼 수 없겠지 \r\nThe sound that you make it sounds so sad 나를 감싸 주던 그 손길 다시 느낄 수는 없겠지 \r\n\r\n잘지내 잘있어 이 말이 왜 어색할까 흐르는 눈물을 바라보던 그 눈빛은 \r\n그만큼 우리 서로 사랑하고 너무도 원했었죠 \r\n\r\nThe sound that you make it sounds so sad 나를 바라보던 그 눈빛 이제 다시 볼 수 없겠지 \r\nThe sound that you make it sounds so sad 나를 감싸 주던 그 손길 다시 느낄 수는 없겠지 \r\n\r\n혹시 혼자 있을까 걱정돼요 또 술을 너무 마시진 않을까도 \r\n그대 생각에 나 너무도 나 괴로워 잠에 들곤 하죠 \r\n\r\nThe sound that you make it sounds so sad 나를 바라보던 그 눈빛 이제 다시 볼 수 없겠지 \r\nThe sound that you make it sounds so sad 나를 감싸 주던 그 손길 다시 느낄 수는 없겠지 \r\n\r\nThe sound that you make it sounds so sad 나를 바라보던 그 눈빛 이제 다시 볼 수 없겠지 \r\nThe sound that you make it sounds so sad 나를 감싸 주던 그 손길 다시 느낄 수는 없겠지</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/323/15026323_1323240002749_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131090, lowkey: nil, highkey: nil},
  {album_id: 104, singer_id: 23, team_id: nil, title: "Why Me?", genre1: "가요", genre2: "R&amp;B/소울", runtime: "03:38", lyrics: "\n\t\t\t\t\t\t\t<div>Why Me? - 03:38</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">하필 난 널 알게 돼 나도 모르게 깊은 떨림 속에 힘들게 아무러진 상처도 아픔을 주니 \nBaby I need your love 너도 느끼니 애써 미소 짓는 초라한 나의 눈물 \n\n하필 난 널 알게 돼 널 믿고 닫아 놨던 맘을 열고 내 전부의 이상을 모두 다 네게 줬는데 \nBaby I need your love 표정 없이 끄덕대는 널 볼 때마다 너를 내게 보낸 저 하늘이 원망이 돼 \n\n비가 내리고 내 몸을 젹셨던 그날전만 했어도 난 괜찮았었는데 지금 날 울릴 널 왜 만나게 해 \n하필 나에게 너를 보내서 사랑 따윈 필요하지 않던 나였는데 영원한 이 아픔을 느끼게 해 \n\nRap] \nSome say that what goes up must come down and fall \nSo should I crawl forever wash away my pain in alcohol \nForever stay low key, Be lonely that's my life whatever \nYou're puncturing my breast and took my breath, \nmy heart's severed in two me and you together used to add up to one \nI wish I had the nerve to just pack up and run, addicted to \nthe pain even just like the last season \nRepeating the pain with heart ache with no reason \n\n하필 난 널 알게 돼 널 믿고 닫아 놨던 맘을 열고 내 전부의 이상을 모두 다 네게 줬는데 \nBaby I need your love 표정 없이 끄덕대는 널 볼 때마다 너를 내게 보낸 저 하늘이 원망이 돼 \n\n비가 내리고 내 몸을 젹셨던 그날전만 했어도 난 괜찮았었는데 지금 날 울릴 널 왜 만나게 해 \n하필 나에게 너를 보내서 사랑 따윈 필요하지 않던 나였는데 영원한 이 아픔을 느끼게 해 \n\n난 사랑을 잊고도 참 행복 했는데 왜 사랑을 되찾고 난 더 슬퍼지는지 \nYou're the one and I know that's why I can't let you go \n\n비가 내리고 내 몸을 젹셨던 그날전만 했어도 난 괜찮았었는데 지금 날 울릴 널 왜 만나게 해 \n하필 나에게 너를 보내서 사랑 따윈 필요하지 않던 나였는데 영원한 이 아픔을 느끼게 해 비가 내리고 \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/323/15026323_1323240002749_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131091, lowkey: nil, highkey: nil},
  {album_id: 104, singer_id: 23, team_id: nil, title: "Gotta Get Love", genre1: "가요", genre2: "R&amp;B/소울", runtime: "04:12", lyrics: "\n\t\t\t\t\t\t\t<div>Gotta Get Love - 04:12</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">아무 말 없이 나를 떠나가지마 우리 처음 만날 때를 기억한다면 \n기나긴 시간이 지나 생각해보면 지금 이 순간이 내게는 너무나 소중하다고 \n\nYou gotta get love (What about promises you made me baby) \nYou gotta get love (Don't wanna go on this way without you baby) \nYou gotta get love (You promised forever forever you're the one for me ) \nYou gotta get love (So don't go away I need you to stay) \n\n그렇게 생각해 날 말해줘 아니라고 언젠간 날 떠나 너 없는 빈 자리 그곳에 \n다른 누군가가 있을거야 baby baby 나 떠나도 좋아 너 원한다면 음~ \n\n언제부턴가 변한 너의 모습은 조금씩 날 당황하게 만들어 가고 \n다른 사람처럼 나를 대하는 너는 넌 정말 너무해 내 마음하나도 모르는거니 Aren't you baby \n\nYou gotta get love (What about promises you made me baby) \nYou gotta get love (Don't wanna go on this way without you baby) \nYou gotta get love (You promised forever forever you're the one for me ) \nYou gotta get love (So don't go away I need you to stay) \n\n그렇게 생각해 날 말해줘 아니라고 언젠간 날 떠나 너 없는 빈 자리 그곳에 \n다른 누군가가 있을거야 baby baby 나 떠나도 좋아 너 원한다면 음~ \n\nYou gotta get love (What about promises you made me baby) \nYou gotta get love (Don't wanna go on this way without you baby) \nYou gotta get love (You promised forever forever you're the one for me ) \nYou gotta get love (So don't go away I need you to stay) \n\n아무 말 없이 나를 떠나가지마 우리 처음 만날 때를 기억한다면 \n기나긴 시간이 지나 생각해보면 지금 이 순간이 내게는 너무나 소중하다고 \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/323/15026323_1323240002749_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131092, lowkey: nil, highkey: nil},
  {album_id: 104, singer_id: 23, team_id: nil, title: "찬바람아!", genre1: "가요", genre2: "R&amp;B/소울", runtime: "03:57", lyrics: "\n\t\t\t\t\t\t\t<div>찬바람아! - 03:57</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">찬바람은 내마음도 모르고 내 몸을 감싸 안아 떠난 그의 향기는 왜 아직도 사라지지 않나 제발 \n떠나가줘 날울리지 말아줘 이제 떠나가줘 아주 먼곳으로 제발 \n내게 오지 말아줘 날 내버려둬 영원히 그를 잊게 해줘 찬바람아 떠나가줘 \n\n찬바람은 내마음도 모르고 내 손을 꼭 붙잡아 \n따뜻했던 떠난 그의 목소리 내 귓가에 맴돌게 해 \n\n떠나가줘 날울리지 말아줘 이제 떠나가줘 아주 먼곳으로 제발 \n내게 오지 말아줘 날 내버려둬 영원히 그를 잊게 해줘 찬바람아 떠나가줘 \n\n이제 그만 날 내버려둬 나 혼자 있고 싶어 \n긴 기다림 속에 익숙해져버린 지금 너 없이도 난 널 잊고 살아 갈테니 \n\n제발 가져가줘 날 울리는 그리움 이제 가져가줘 아주 먼 곳으로 \n제발 내게 돌아오지 말아줘 사라져 버려 영원히 그를 잊게 해줘 제발 \n\n떠나가줘 날울리지 말아줘 이제 떠나가줘 아주 먼곳으로 제발 \n내게 오지 말아줘 날 내버려둬 영원히 그를 잊게 해줘 찬바람아 떠나가줘 \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/323/15026323_1323240002749_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131093, lowkey: nil, highkey: nil},
