  {album_id: 104, singer_id: 23, team_id: nil, title: "너 (Sad But True)", genre1: "가요", genre2: "R&amp;B/소울", runtime: "03:27", lyrics: "\n\t\t\t\t\t\t\t<div>너 (Sad But True) - 03:27</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">다 그렇단 인생이란 다 그렇다던데 조금만 참으면 언젠간 나도 밝게 \n가슴이 아프도록 웃을 날이 온대 그런데 왠지 모르게 내 맘속은 그 말을 믿지 않고 \n미소 짓는 그들의 얼굴이 그저 밉기만 하고 누굴 만나도 거짓된 인사들과 뜻없는 걱정들에 \n두 눈을 감아도 훤히 보여 지는 니 맘속을 난 알지 너도 아니 도수 없는 안경보다도 훤히 \n니 맘속을 보면서도 속아주는 난 또 한번 더 희망에 기대 노래를 부르네 \n\n슬픔에 물든 영혼이 흔들려도 속고 속는 내 인생이 힘들어도 \n다가올 기쁨과 행복할 그날이 힘이 되어 내게 노래 부르게 해 \n\n아무 생각없이 침대위에 눕고 싶어 슬픈 영화와 팝콘 실컷 울고 싶어 \n지쳐 잠에 들어 버릴때까지 웃고 싶어 기뻐 미친 듯 깔깔 대고 끼득끼득 \n눈물에 젖어 나의 마스카라 지워져도 화장이 땀에 젖어 끈적끈적 떡이 되도 \n있는 그대로 나 이대로 사랑해줄 그대 품안에 잠들게 해줘 깨우지 말아줘 \n어쩔 수 없는 지금이 인생이라 하지만 알 수 없는 미래도 다 운명이라지만 \n언젠간 나도 행복할 거란 너의 거짓말 한 번 더 속아 볼래 그날을 위해 난 \n\n슬픔에 물든 영혼이 흔들려도 속고 속는 내 인생이 힘들어도 \n다가올 기쁨과 행복할 그날이 힘이 되어 내게 노래 부르게 해 \n\n지칠 만큼 지친 난 또 다시 일어나 이만큼 이 아픈만큼 웃어보려 \n내 가슴속에 슬픔은 삼켜 고통도 반겨 Baby Tasha 이제 다시 Microphone을 꽉 꼭 잡고 \n리듬에 맞춰서 운율을 내뱉고 신에 들린 듯 흔들어 막힌 내 가슴을 뚫어 소리 질러 \n목청이 터지도록 노래 불러 한번 더 속아 다시 일어나 \n\n슬픔에 물든 영혼이 흔들려도 속고 속는 내 인생이 힘들어도 \n다가올 기쁨과 행복할 그날이 힘이 되어 내게 노래 부르게 해 \n\n슬픔에 물든 영혼이 흔들려도 속고 속는 내 인생이 힘들어도 \n다가올 기쁨과 행복할 그날이 힘이 되어 내게 노래 부르게 해 \n\n슬픔에 물든 영혼이 흔들려도 속고 속는 내 인생이 힘들어도 \n다가올 기쁨과 행복할 그날이 힘이 되어 내게 노래 부르게 해 \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/323/15026323_1323240002749_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131095, lowkey: nil, highkey: nil},
