  {album_id: 105, singer_id: nil, team_id: 48, title: "콩가", genre1: "가요", genre2: "댄스", runtime: "03:18", lyrics: "\n\t\t\t\t\t\t\t<div>콩가 - 03:18</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">(달나라 꿈꾸는 나의 HONEY) \r\n\r\n태양이 싫다(예) 뜨거워 싫다(우) \r\n흔한게 사랑에 타지 않는 \r\n차가워진 달 빛이 좋다(예) 차가워 좋다(와) \r\n그녀의 머릿속 정말 이해할 수가 없다 \r\n\r\n그래 Bye bye bye 가고 싶은 대로 가 \r\n하고 싶은 대로 하고 너의 사랑 찾아가 \r\nHi hi hi 과연 만족할런지 \r\n다시 돌아 오겠지 설마 설마 했었지 \r\n\r\n달빛의 사랑을 꿈꾸는 그녀 \r\n알고 보니 정말 헤어지려 하네 \r\n잡으려도 잡을수 없네 \r\n나 그녀 정말 사랑하나봐 \r\n\r\n안돼 허니 뭐하니 떠나려고 하니 \r\n뭐니 너 뭐니 정말 왜 그러니 \r\n왜 날 잊으려고 왜 날 떠나려고 \r\n달나라 꿈꾸는 나의 허니 \r\n\r\n나니 또 나니 수많은 사람 중에 \r\n나니 왜 나니 정말 어떡하니 \r\n달나라 꿈꾸는 나의 사랑아 \r\n잘가라 Good bye \r\n\r\n달빛의 그녀(예예예) \r\n꿈꾸는 그녀(예예예) \r\n바보처럼 잘 가라 말했더니 \r\n바로 그냥 차가워진 그녀(잘됐네) \r\n냉정한 그녀(웃었네) \r\n그녀의 맘 속을 정말 헤아릴 순 없잖아 \r\n\r\n그래 Bye bye bye 가고 싶은 대로 가 \r\n하고 싶은 대로 하고 너의 사랑 찾아가 \r\nhi hi hi 과연 만족할런지 \r\n다시 돌아 오겠지 설마 설마 했었지 \r\n\r\n달빛의 사랑을 꿈꾸는 그녀 \r\n또 다른 사랑 찾아 떠나가는 그녀 \r\n잊을래도 잊을 수가 없네 \r\n나는 그녀 정말 보내야 하나 안돼 \r\n\r\n허니 뭐하니 떠나려고 하니 \r\n뭐니 너 뭐니 정말 왜 그러니 \r\n왜 날 잊으려고 왜 날 떠나려고 \r\n달나라 꿈꾸는 나의 Honey \r\n\r\n나니 또 나니 수많은 사람 중에 \r\n나니 왜 나니 정말 어떡하니 \r\n달나라 꿈꾸는 나의 사랑아\r\n잘가라 Good bye -</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/325/15026325_1323140676487_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 9853, song_num: 16131111, lowkey: nil, highkey: nil},
  {album_id: 105, singer_id: nil, team_id: 48, title: "폭풍전야", genre1: "가요", genre2: "댄스", runtime: "03:32", lyrics: "\n\t\t\t\t\t\t\t<div>폭풍전야 - 03:32</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">처음 본 순간 딱 저의 스타일이네요 오늘 제가 책임지고 술 쏠께 \n\n어쩌다가 마주친 그대 어쩌나 이를 어쩌나 폭풍이 몰아 치기전 갈곳이 없네 다른 여자 만나지 마요 \n(헛소리하지 마라) 상상도 하지 말아요 (그래 넌 딱 걸렸어) 그녀 눈치 채기 전에 멈춰야 해요 \n정신 좀 차리고 한 여자 사랑해요 혹시 보이나요 불타는 그녀얼굴 \n\n누구나 좋아하는 잘빠진 여자 누구나 좋아하는 섹시한 여자 이 세상 남자들 모두 나같은 마음 아닐까요 \n하지만 누군가를 사랑한다면 하지만 누군가를 좋아했다면 그녀에게 상처를 주지 말아요 \n사랑해 이 말이 하고파 너에게난 다가 갔었지만 한사람만 만나 사랑을 하기가 왜이리 힘이 드는지 \n\n난 정말 너밖에 없어(천 번도 더 들었다) 딴 사람 만난 적 없어(만 번도 더 들었다) \n폭풍이 몰아 치는데 나는 돛단배 조금만 참아요 내게도 기횔 줘요 이젠 헤어지잔 그 말은 말아줘요 \n\n누구나 좋아하는 잘빠진 여자 누구나 좋아하는 섹시한 여자 이 세상 남자들 모두 나같은 마음 아닐까요 \n하지만 누군가를 사랑한다면 하지만 누군가를 좋아했다면 그녀에게 상처를 주지 말아요 \n\n난 이제 그녀 앞에 김빠진 콜라 어제는 좋았었지 잘빠진 여자한순간 실수로 그녀 가슴에 상처 남겼지만 \n이제는 정신차려 잘해볼께요지 나간 일은 모두 지워주세요 알잖아요 내 사랑 하나뿐인 걸   \n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/325/15026325_1323140676487_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131112, lowkey: nil, highkey: nil},
  {album_id: 105, singer_id: nil, team_id: 48, title: "명랑 운동회", genre1: "가요", genre2: "댄스", runtime: "03:41", lyrics: "\n\t\t\t\t\t\t\t<div>명랑 운동회 - 03:41</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">님 떠난 빈자리에 그리움 남겨진 사람들에 서러움 세상 끝에서라도 \n날 잡은 손 놓지 절대 놓지않는다 하더니 (형 배고파요 어디가요) \n\n국민여러분께 알려드립니다 이제 곧 컨츄리 꼬꼬가 여러분께 희망찬 내일을 알려 드릴 것입니다 \n일어나셔요 움츠린 어깰 펴고 힘을 내봐요 활짝 가슴을 펴고 그대얼굴에 새겨진 근심걱정 지워버려요 \n새롭게 시작해요 이 세상을 즐기며 살아봐여 서로 사랑하는 마음을 모두 가져요 \n\n알리발리아 리나노 리발리아 리나노 우리 모두 함께 모여 춤을 춰요 \n알리발리아 리나노 리발리아 노노 우리 모두 하나되어 즐겁게 살아요 \n\n여러분 어차피 인생은 소풍 나온 겁니다 아주 긴 소풍을 말이어요 \n늘 하고 싶은 것만 할 수는 없죠 힘이 든다고 쉽게 포기 말아요 오래간만에 모두 명랑 운동회 \n아름다운 미소를 띠며 살아요 이 세상을 즐기며 살아봐여 서로 사랑하는 마음을 모두 가져요 \n\n알리발리아 리나노 리발리아 리나노 우리 모두 함께 모여 춤을 춰요 \n알리발리아 리나노 리발리아 노노 우리 모두 하나되어 즐겁게 살아요 \n\n잃어버린 꿈을 찾아 우리 모두 떠나요 잃어버린 나를 찾아 빠빠빠밥 호우 \n날 사랑하는 사람들과 사랑하는 친구들 모두 같이 노래해요 랄랄 라라 \n알리발리아 리나노 리발리아 리나노 우리 모두 함께 모여 춤을 춰요 \n알리발리아 리나노 리발리아 노노 우리 모두 하나되어 즐겁게 살아요 \n\n다 내맘이야 리나노 내 맘이야 리나노 우리 모두 함께 모여 춤을 춰요 다 내맘이야 리나노 \n내 맘이야 노노 우리 모두 하나되어 즐겁게 살아요 \n\n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/325/15026325_1323140676487_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131113, lowkey: nil, highkey: nil},
