  {album_id: 107, singer_id: nil, team_id: 49, title: "샤베트", genre1: "가요", genre2: "전체", runtime: "04:16", lyrics: "\n\t\t\t\t\t\t\t<div>샤베트 - 04:16</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">야릇 야릇한 수줍은 너의 미소가 \n(baby to my side you and my lovers night you come into my life cuz you're my future wife) \n머뭇 머뭇 날 조심히 바라보다가 \n(저 넓은 바다위에 비춰진 노을처럼 아름다운 너의 그 환한미소) \n\n샤르르르 녹아버린 샤베트처럼 달콤한 입맞춤을~ \nEveryday 눈부신 Every night~ \n너에게 물들어 (자꾸만 닮아가) \n내 눈에 넘쳐서 흐르는 사랑이 너무나 행복해 You'll be my love~ \n\n짜릿 짜릿한 숨겨 온 너의 눈빛이 \n(일곱 빛깔 무지개같은 아름다운 너와나 우리들만의 추억) \n기웃 기웃 날 말없이 지켜보다가 \n(every night and everyday all my feelings feel same and the only one for me girl my love will naver change) \n샤르르르 녹아버린 샤베트처럼 달콤한 입맞춤을~ \nEveryday 눈부신 Everynight~ 니 품에 기대어 (조금씩 빠져가) \n시간을 멈추고 너와나 둘이서 영원히 사랑해 You'll be my love~ \n\nWoo~ 샤르르르 네게 녹아버린 걸... \nWoo~ 난 이대로 빠져드는 걸... \n너와 내가 함께 한 이 순간들을 언제나 기억해야해~~~ \nI want you everyday~ You want me everynight~ \n너에게물들어 (자꾸만 닮아가) \n내 눈에 넘쳐서 흐르는 사랑이 너무나 행복해 \nYou'll be my love~ everyday~ You want me everynight~ \n네 품에 기대어 (조금씩 빠져가) \n시간을 멈추고 너와나 둘이서 영원히 사랑해You'll be my love~ \n\n창밖에 비춰진 눈부신 햇살처럼 \n아름다운 너의 모습을 보고 있으면 난 이세상 모든 것과도 바꿀 수 없을 만큼 행복했지 \n난 하늘을 날았어 지금 이대로가 좋아 꿈이 깨어지지 않길 \n너와 함께라면 어디든지 날아가고 싶어 하늘의 새들도 우리를 축복해줄 거야 \n\n간주 \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/327/15026327_1323328693577_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131144, lowkey: nil, highkey: nil},
  {album_id: 107, singer_id: nil, team_id: 49, title: "어느날...", genre1: "가요", genre2: "전체", runtime: "03:15", lyrics: "\n\t\t\t\t\t\t\t<div>어느날... - 03:15</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">그냥 나나나 전화걸까말까 생각했었어 하지만 오늘만 한번 속아줘 개가 짖는다 생각해줘 왈왈왈 \n정말걸까말까 생각했었어 하지만 오늘만 한번 속아줘 개가 짖는다 생각해줘 \n무의미하게 돌아가는 시계추처럼 하루종일 빙빙 돌아다니다가 돌아와 \n방구석에 처박혀 이리 굴러 저리 굴러 하염없이 굴러 \n똑같은 사람들에 똑같은 일상 이젠 정말로 지겨워 지겨지겨워 날 좀 데려가 같이 놀아줘 \n\nI nigga back to the action check it out take a little time \nto crus around the block to rock checking with the function \n들어봐 멋진 자동차에 압구정을 향한 백수 아무 할일 없이 \neveryday no way rolling with F-boyz here in sk you call \nit what you want to you gotta give \nit all you got watch me hit the bling bling jigga ching ching \n\n그냥 나나나 전화걸까말까 생각했었어 하지만 오늘만 한번 속아줘 개가 짖는다 생각해줘 왈왈왈 \n정말걸까말까 생각했었어 하지만 오늘만 한번 속아줘 개가 짖는다 생각해줘 \n\n(영철) \n오늘 하루 내 기분 제로 심심함에 내 기분을 달래보려 수첩 속 친구들에 전화를 했어 \n근데 이게 뭐야 만나자며 귀찮게 하던 하필이면 지금 오늘 통화중에 꺼져있어 \n심심함은 커져가고 이 기분을 돌려보려 버튼을 누르네 장난전화 안하기로 나 결심했어 \n살아가면서 누구나 겪는일이야 어른이 되는 단지 과정일 뿐야 \nAnd the rapper boys out there booking for some we won't gettin Rinda fly cause we looking for \n#1 며칠이 지나 할 일 없이 뒹굴뒹굴 갑자기 걸려온 전화 받자마자 하는말 \n\n그냥 나나나 전화걸까말까 생각했었어 \n하지만 오늘만 한번 속아줘 개가 짖는다 생각해줘 왈왈왈 \n정말걸까말까 생각했었어 하지만 오늘만 한번 속아줘 개가 짖는다 생각해줘 \n\n(영철) \n그냥 나나나 전화걸까말까 생각했었어 \n하지만 오늘만 한번 속아줘 개가 짖는다 생각해줘 왈왈왈 \n정말걸까말까 생각했었어 하지만 오늘만 한번 속아줘 개가 짖는다 생각해줘 \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/327/15026327_1323328693577_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131145, lowkey: nil, highkey: nil},
  {album_id: 107, singer_id: nil, team_id: 49, title: "나쁜이별", genre1: "가요", genre2: "전체", runtime: "03:44", lyrics: "\n\t\t\t\t\t\t\t<div>나쁜이별 - 03:44</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">Tell me why tell me now I gotta goodbye naver lookong back with the tear \nin my eyes comin at you with a whole new beat we come \nin effect can you feel the beat A whole new era new millenium flying out of space \nto whole new world tell me how I gotta say good bye always coming back for a whole new flight \n제자리야 네 자리야 언제든 다시 불러줘 걸어 걸어 돌아 가겠어 언젠간 다시 너의 품안 속으로 \n\nGuy 이쯤에 우리 그만 헤어져 너를 만나는게 싫증났어 이젠 지겨워 믿어줘.... \n너 지금 내게 왜 그러니 내가 잘못한거니 아님 내가 질려 싫어진거니 \n혹시 다른 사람 생긴거니 그런거라면 내게 말해봐 너의 진심을 말해봐 \n하지만 난 널 떠날수가 없어 이젠 늦어 버렸어 난 이미 너의 몸이니까 \n\n니 입으로 그녈 사랑한단 말 제발 하지마 끝내도 내가 끝내 넌 아닌거야.... \n\n*이별은 부르지 않아도 오잖아 말하지 않아도 가슴이 알잖아 \n니가 날 떠나기전 내가 널 버려줄게 \n마지막 자존심이라도 지켜줘 미안할 너라면 당연한거잖아 그래야 널 보낼 수 있잖아.... \n\nBye 내가 준걸 다 돌려받을래 한낱 장식처럼 니 주위에 남아 맴돌게 두지마.... \n너 없인 난 안된다는 슬픈 말 삼켜볼 거야 어차피 돌아갈 수 없을테니까.... \n\n* repeat... \n\n이제 난 수많은 남잘 만날 거야 그만큼 사랑도 나눠서 할 거야 \n다시는 죽을 만큼 아프긴 싫으니까 \n추억도 잊혀질 만큼만 만들고 마음도 가벼울 만큼만 줄 거야 \n내 눈에 눈물은 너까지야.... \n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/327/15026327_1323328693577_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131146, lowkey: nil, highkey: nil},
