  {album_id: 108, singer_id: 185, team_id: nil, title: "한여자를 사랑했다", genre1: "가요", genre2: "발라드", runtime: "04:24", lyrics: "\n\t\t\t\t\t\t\t<div>한여자를 사랑했다 - 04:24</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">\n힘드는건 잠시 뿐이라지만 \n그대없는 세상은 싫어\n행복한건 너와 함께있는 것 \n하루를 살다 죽어도 \n\n아직도 그대를 사랑해 \n이렇게 외로운 가슴이 \n울며 돌아선 너를 기다렸었다\n너무 사랑했기에\n\n남이 혼자 사는 세상은 아니야\n세월이가면 아픈건 모두 잊겠지 \n\n아직도 그대를 사랑해 \n이렇게 외로운가슴이 \n울며 돌아선 너를 기다렸었다\n너무 사랑했기에\n\n행복한건 너와 함께 있는것 \n그대없는 세상은 싫어\n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131283, lowkey: nil, highkey: nil},
  {album_id: 108, singer_id: 185, team_id: nil, title: "순정", genre1: "가요", genre2: "발라드", runtime: "04:16", lyrics: "\n\t\t\t\t\t\t\t<div>순정 - 04:16</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">\n꿈인가 싶었지 이렇게 너를 다시 만나\n그토록 바라던 이 순간이였어 우연은 없어요\n어떠한 만남도 운명처럼 다시 만나게 될껄\n\n*어쩌면 그렇게도 편하지 않고\n많은날 그대 품이 그리웠어요\n이토록 하나부터 열까지 모두다 생각나요\n어릴때 사랑했던 당신을 \n아직까지 그리고 마지막에도\n\n널 찾아 헤매던 밤들이 가슴에 있는데\n누구를 만나던지 외로웠어요 모든걸 기억해\n너와의 추억을 운명처럼 보고싶었어\n\n걱정하지마 음~ 내가있잖아 음~\n항상 니곁에 있을 테니까\n\n*Repeat\n\n다시는 너의 손을 놓지 않을래\n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131284, lowkey: nil, highkey: nil},
  {album_id: 108, singer_id: 185, team_id: nil, title: "천년의 해후", genre1: "가요", genre2: "발라드", runtime: "04:32", lyrics: "\n\t\t\t\t\t\t\t<div>천년의 해후 - 04:32</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">너무나 보고 싶었어\n 그대 없이 사는 동안에\n 한참을 기다린 것 같아\n 힘들고 외로웠지만\n 그대 앞에서 지금 행복해\n 가슴이 벅차오네요\n 날마다 만나보고 싶었는데\n 왜 이제야 만나야 했나\n 다시 우리 헤어지지마\n 하지만 난 또 불안해\n 언제 우리가 우리 뜻대로 \n 살아간 적이 있나\n 다시 태어나 그댈 기다릴래\n 같이 있을수 만 있다면\n 하루 하루가 오직 그리운\n 우리 이제 함께 있어요\n \n 그대 앞에서 지금 행복해\n 가슴이 벅차오네요\n 날마다 만나보고 싶었는데\n 왜 이제야 만나야 했나\n 다시 우리 헤어지지마\n 하지만 난 또 불안해\n 언제 우리가 우리 뜻대로 \n 살아간 적이 있나\n 다시 태어나 그댈 기다릴래\n 같이 있을수 만 있다면\n 하루 하루가 오직 그리운\n 우리 이제 함께 있어요\n 그대 앞에서 지금 행복해\n 가슴이 벅차오네요\n 날마다 만나보고 싶었는데\n 왜 이제야 만나야 했나\n 이제야 만나야 했나~~</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 12251, song_num: 16131285, lowkey: nil, highkey: nil},
  {album_id: 108, singer_id: 185, team_id: nil, title: "동행", genre1: "가요", genre2: "발라드", runtime: "04:12", lyrics: "\n\t\t\t\t\t\t\t<div>동행 - 04:12</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">아직도 내게 슬픔이 우두커니 남아 있어요\n그날을 생각하자니 어느새 흐려진 안개\n빈 밤을 오가는 마음 어디로 가야만 하나\n어둠에 갈 곳 모르고 외로워 헤매는 미로\n누가 나와 같이 함께 울어줄 사람있나요\n누가 나와 같이 함께 따뜻한 동행이 될까\n사랑하고 싶어요 빈 가슴 채울 때까지\n사랑하고 싶어요 사랑있는 날까지\n누가 나와 같이 함께 울어줄 사람있나요\n누가 나와 같이 함께 따뜻한 동행이 될까\n사랑하고 싶어요 빈 가슴 채울 때까지\n사랑하고 싶어요 사랑있는 날까지\n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 203, song_num: 16131286, lowkey: nil, highkey: nil},
  {album_id: 108, singer_id: 185, team_id: nil, title: "Whisky On The Rock", genre1: "가요", genre2: "발라드", runtime: "04:58", lyrics: "\n\t\t\t\t\t\t\t<div>Whisky On The Rock - 04:58</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">그날은 생일이었어...지나고 보니  음~\r\n나이를 먹는 다는 건 나뿐것 만은 아니야\r\n\r\n세월의 멋은 흉내 낼수 없잖아 ~\r\n멋있게 늙는  건  더욱 더 어려워~\r\n비오는 그날 저녁 까페에 있었다 .\r\n\r\n겨울 초입에 스웨러(?) ( 사실 이부분은 잘 안들려서...)\r\n창가에 검은 도둑고양이 \r\n감당 못하는 서늘한 밤의 고독\r\n그렇게 세월은 가고 있었다.\r\n\r\n아름다운 것도 즐겁다는 것도 모두다 욕심일뿐\r\n다만  혼자서 살아가는게 두려워서 하는 얘기\r\n얼음에 채워진 꿈들이 서서히 녹아 가고 있네\r\n혀끝을 감도는 위스키 온더락!  \r\n\r\n모르는 여인의 눈길 마주친 시선에 이끌린 \r\n젖어있는 눈웃음에 흐트러진 옷사이로 눈이 &amp;#51922;아가 \r\n내맘 나도 모르게  차가운 얼음으로 식혀야 했다.\r\n\r\n아름다운것도 즐겁다는 것도  모두 다 욕심일뿐\r\n다만 혼자서  살아가는게 두려워서 하는 얘기\r\n얼음에 채워진 꿈들이 서서히 녹아가고 있네\r\n혀끝을 감도는 위스키 온더락! 예에~~\r\n\r\n아름다운것도 즐겁다는 것도 모두 다 욕심일뿐\r\n다만 혼자서 살아가는게 두려워서 하는 얘기\r\n얼음에 채워진 꿈들이  서서히 녹아가고 있네\r\n혀끝을 감도는 위스키 온더락</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 12404, song_num: 16131287, lowkey: nil, highkey: nil},
  {album_id: 108, singer_id: 185, team_id: nil, title: "사랑 사랑 사랑", genre1: "가요", genre2: "발라드", runtime: "04:29", lyrics: "\n\t\t\t\t\t\t\t<div>사랑 사랑 사랑 - 04:29</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">\n그렇게 돌아서면은 모든게 끝날줄 알았다\n살다 보면은 잊혀지겠지 했다\n가끔은 널 생각하며 눈물도 흘리곤 했다\n그러다 보면 잊을거라 했다 널\n\n*사랑 사랑 사랑 나를 위해 웃어줄순 없는지\n사랑 사랑 사랑 돌아서면 모두 남이라는데\n왜 나는 아직도 눈물이 나는지 워~\n\n어제는 길을 걸었다 그 노래가 흘러 나왔다\n노랠 들으며 너를 생각했다\n그대는 이제 행복한가 나 없이 너는 살수 있나\n눈물이 흘러 모두 나만 쳐다본다 날\n\n*Repeat\n\n\n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131288, lowkey: nil, highkey: nil},
