  {album_id: 108, singer_id: 185, team_id: nil, title: "공항에서 오는 길", genre1: "가요", genre2: "발라드", runtime: "04:23", lyrics: "\n\t\t\t\t\t\t\t<div>공항에서 오는 길 - 04:23</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">공항에서 오는 길 너무 힘들어.\n\n끝내 차를 세우고 울고 말았어.\n\n보고 싶을 꺼라는 말 한마디는 \n\n마지막 인사로 생각할께\n\n이젠 또 다시 혼자야만해\n\n아마 니가 한참은 그리울거야\n\n보고싶을꺼라는 말은마\n\n우리 헤어 지면은 그만인것을\n\n어디서든 행복해야해.\n\n가끔은 날 생각해줘\n\n이제는 지워 버릴래,,\n\n어쩌면 죽는 날 까지,,,\n\n그대가 내 사랑 됐으면 했어\n\n이제는 이 세상을 어떻게 살까\n\n공항에서 오는길 너무 힘들어\n\n아,,사랑이 가네,,,\n\n이젠 또 다시 혼자야만해,\n\n아마 니가 한참은 그리울꺼야\n\n보고 싶을꺼라는 말은마\n\n우리 헤어 지면은 그만인것을,,\n\n어디서든 행복해야해\n\n가끔은 날 생각해줘,,\n\n이제는 지워버릴래,,,,\n\n어쩌면 죽는날 까지.,.\n\n그대가 내 사랑 됐으면했어..\n\n이제는 이세상을 어떻게 살까\n\n공항에서 오는 길 너무 힘들어\n\n아 사랑이 가네....</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131290, lowkey: nil, highkey: nil},
  {album_id: 108, singer_id: 185, team_id: nil, title: "용서", genre1: "가요", genre2: "발라드", runtime: "04:19", lyrics: "\n\t\t\t\t\t\t\t<div>용서 - 04:19</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">\n어렵게 널 보내고 말았어\n그대로 멈춰주길 바랬었지만\n결국 나이지 못한 너의 마지막 사랑이 \n영원히 널 지켜주길\n\n*다시 난 어떡해야해 \n이대로 널 버릴수 없는걸 \n나의 맘 속에 맴돌고 있는 너의 기억들 \n이젠 다 그만 지워져\n말 하지 말걸 그랬어\n널 사랑하고 있었다는 걸 \n나에게 견딜수 없는 추억만 남게 되지만 \n이렇게 난 또 아파 해야해\n간절히 너를 원한 이유만으로 \n\n난 괜찮아\n널 위해 이대로 나 돌아서 줄게\n나의 사랑이 아님을 너도 잘 알고 있잖아\n하지만 이렇게 널 지울수 없는 날 용서해줘\n\n*말하지 말걸 그랬어\n널 진정으로 사랑했다면 어쩌면 여기 까지가\n너와의 인연 이었어\n너를 찾아 헤매던 밤 아직도 내 가슴에 남아있는데\n\n난 괜찮아\n하지만 이제 너는 행복해야해\n이별이 내게 아픈건 너 없이 살아가는것\n미안해\n지난날 널 아프게 했던 날 용서해줘\n\n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131291, lowkey: nil, highkey: nil},
