  {album_id: 108, singer_id: 185, team_id: nil, title: "풀잎사랑", genre1: "가요", genre2: "발라드", runtime: "03:45", lyrics: "\n\t\t\t\t\t\t\t<div>풀잎사랑 - 03:45</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">싱그러운 아침 햇살이 풀잎에 맺힌 이슬 비칠때면\n부시시 잠깨인 얼굴로 해맑은 그대 모습 보았어요\n푸르른 나래를 더욱더 사랑하는 마음 알았지만\n햇살에 눈부신 이슬은 차라리 눈을 감고 말았어요\n\n그대는 풀잎 나는 이슬 그대는 이슬 나는 햇살\n사랑해 그대만을 우리는 풀잎 사랑\n그대는 풀잎풀잎풀잎 나는 이슬이슬이슬\n그대는 이슬이슬이슬 나는 햇살햇살햇살\n사랑해 그대만을 우리는 풀잎사랑\n\n빛나던 노을빛 어둠을 홀로 밝히는\n나의 사랑 변함없어요 \n\n그대는 풀잎 나는 이슬 그대는 이슬 나는 햇살\n사랑해 그대만을 우리는 풀잎 사랑\n그대는 풀잎풀잎풀잎 나는 이슬이슬이슬\n그대는 이슬이슬이슬 나는 햇살햇살햇살\n사랑해 그대만을 우리는 풀잎사랑\n풀잎사랑 우리는 풀잎사랑 우리는 풀잎사랑\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 1215, song_num: 16131296, lowkey: nil, highkey: nil},
  {album_id: 108, singer_id: 185, team_id: nil, title: "아버지처럼 살기 싫었어", genre1: "가요", genre2: "발라드", runtime: "04:38", lyrics: "\n\t\t\t\t\t\t\t<div>아버지처럼 살기 싫었어 - 04:38</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">지금 내 눈을 믿지못하네 두눈을 비벼 다시 또 보아도\n\n꿈에도 그리던 그 사람 이렇게 내앞을 스쳐지나가네 \n\n그대를 부르려고 했지만 지나간 설움에 난 목이메어 그토록 찾\n\n아 헤메던 그사람을 나는 붙잡지도 못&amp;#54776;네 \n\n나를 못본듯 바쁜듯이 또는 그렇게 스쳐가네\n\n웃어도 못본듯이 외면하는거였나\n\n낯익은 그대의 뒷모습 저걸음걸이까지도 \n\n내가슴속에 눈부시던 그때 그대론데\n\n*나라고 소리치고 싶었어  타는 가슴을 쓸어내렸지 세상이 나\n를 비웃을 지 몰라도 다시 그대와 함께 하고싶어.\n\n행복하기를 바랬었는데 그대는 점점더 힘들어 하네 \n\n내가 그대의 누구였는지 몰라 가슴이 아프고 시렸어.\n\n그대지친듯 힘겨운듯 넌 그렇게 스쳐가내\n\n안타까웠던 마음에 소리지를뻔했어\n\n어쩌면 예전과 같은지 저모습 표정까지도\n\n내가슴속에 남아있는 그때 그대론데...\n\n*나라고 소리치고 싶었어  타는 가슴을 쓸어내렸지 세상이 나\n를 비웃을 지 몰라도 다시 그대와 함께 하고싶어.\n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131297, lowkey: nil, highkey: nil},
  {album_id: 108, singer_id: 185, team_id: nil, title: "Alone", genre1: "가요", genre2: "발라드", runtime: "04:17", lyrics: "\n\t\t\t\t\t\t\t<div>Alone - 04:17</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">\n세월이 흐러 만나자던 우리의 약속\n오늘 나처럼그녀 혼자이길 조심스레 바래\n그녀가 내게 선물했던 오래된 책을 꺼내어 \n불안한 마음 설레이는 맘으로 다시한번 펴 보내\n오늘이 오길 기다려 왔는데 하루하루 날짜 지우며\n난 두려워지네 시간이 다될수록 그녀가 내게 실망할까봐\n\n*뒤 돌아서면 모든게 끝나버리지\n참아야해\n이대로 돌아 서야해 그토록 오늘을 기다렸는데\n그녀가 다시 볼수 없어 \n\n다시 눈물이\n\n아무일 없이 잘 지내 왔는지 \n가슴 아픈일은 없겠지\n난 두려워 지네\n시간이 다 될수록 그녀가 혹시 돌아설까봐\n그녀가 혼자 이기를 바라는것이 \n가슴 깊이 숨겨둔 바램이였어\n이렇게 지금 그녀를 떠나 보내면 \n다시는 우리 만날수 없어\n\n*Repeat\n다시 눈물이 흐르네\n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131298, lowkey: nil, highkey: nil},
  {album_id: 108, singer_id: 185, team_id: nil, title: "잊지 말아요", genre1: "가요", genre2: "발라드", runtime: "03:50", lyrics: "\n\t\t\t\t\t\t\t<div>잊지 말아요 - 03:50</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">이젠 모두 지나버린 일이야 사랑했던 추억마저도\n하지만 멀리서 그대 모습 그리며 여기 서있네\n\n흘러가는 세월 속에 다가와 아픈 상처만 주고 떠나간\n그대가 나에게 남겨준 그 사랑이 너무 무거워\n\n*하지만 우리 잊지말고 살기로 해요 \n아름답던 지난 날을 잊지 말아요 \n아직도 그대를 사랑하고 있어요 잊지말아요\n\n지난 세월 속에서 우리가 아는 모든 것들을 \n다 거짓이라고 하지 말아요 \n사랑은 늘 아픈거라고 나에게 말해준 \n단 한사람 그대\n\n\n단 한사람 그대\n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 31, song_num: 16131299, lowkey: nil, highkey: nil},
  {album_id: 108, singer_id: 185, team_id: nil, title: "가인", genre1: "가요", genre2: "발라드", runtime: "05:05", lyrics: "\n\t\t\t\t\t\t\t<div>가인 - 05:05</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">\n누구인지 몰라도 사랑 할 것만 같아\n아무려면 어때 그냥 사는거지\n하지만 두려워 헤어지면 어쩌나\n마음하나 믿고서 이제 살면돼\n그토록 오랫동안 기다린 사람\n이제는 혹시나 하고 믿고 살았지\n두려울게 없다고\n나는 말하지만 아니야 아니야\n울것 까지 없어 마음 하나 믿고서 이제 살면돼\n\n아무려면 어때 그냥 살면돼\n재고 말고 할 것 없잖아\n사랑 하나면 약해지면 안되지\n이젠 다짐 하지만 아니야 아니야\n울것 까지 없어 마음 하나 믿고서 이제 살면돼\n마음 하나 믿고 이제 살면돼\n\n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131300, lowkey: nil, highkey: nil},
  {album_id: 108, singer_id: 185, team_id: nil, title: "해후", genre1: "가요", genre2: "발라드", runtime: "04:44", lyrics: "\n\t\t\t\t\t\t\t<div>해후 - 04:44</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">어느새 바람 불어와 옷깃을 여미어 봐도\n그래도 슬픈 마음은 그대로인걸\n\n그대를 사랑하고도 가슴을 비워 놓고도\n이별의 예감 때문에 노을진 우리의 만남\n\n사실은 오늘 문득 그대 손을 마주 잡고서\n창 넓은 찻집에서 다정스런 눈빛으로\n\n예전에 그랬듯이 마주보며 사랑하고파\n어쩌면 나 당신을 볼 수 없을 것 같아\n사랑해 그 순간만은 진실이었어\n\n\n\n사실은 오늘 문득 그대 손을 마주 잡고서\n창 넓은 찻집에서 다정스런 눈빛으로\n\n예전에 그랬듯이 마주보며 사랑하고파\n어쩌면 나 당신을 볼 수 없을 것 같아\n사랑해 그 순간만은 진실이었어\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 237, song_num: 16131301, lowkey: nil, highkey: nil},
  {album_id: 108, singer_id: 185, team_id: nil, title: "기쁜 우리 사랑은", genre1: "가요", genre2: "발라드", runtime: "04:10", lyrics: "\n\t\t\t\t\t\t\t<div>기쁜 우리 사랑은 - 04:10</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">사랑하고도 아무일 없듯이 모른체 한다는 그 건\n  너무나 가슴이 아픈 안타까운 일이에요\n  사랑한다고 말하세요\n\n  우리는 흔히 말하죠 다음에 다음기회에\n  자신이 없는마음에 말하고 싶을때에도\n  사는게 웃는것이라고\n\n* 다음기회라고 말하지 말아요\n  기다리면은 기회는 오질 않아\n  그대 내눈을 피하지 말아요\n  알수가 없는 우리의 내일을\n\n  소중하다고 느끼는 사랑은 \n  기다리면은 달아날것같아 \n  \n**우연히 길을 걷다가 친구를 만난것처럼\n   기쁘게 사랑한다 말하세요  \n\n\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 209, song_num: 16131302, lowkey: nil, highkey: nil},
