  {album_id: 109, singer_id: nil, team_id: 1, title: "잠시만 안녕 (Pop Ver.)", genre1: "가요", genre2: "락", runtime: "04:34", lyrics: "\n\t\t\t\t\t\t\t<div>잠시만 안녕 (Pop Ver.) - 04:34</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">행복을 줄수 없었어 \r\n그런데 사랑을 했어 \r\n니곁에 감히 머무른 \r\n내 욕심을 용서치마\r\n\r\n방황이 많이 남았어 \r\n그 끝은 나도 모르는 곳\r\n약하게 태어나서 미안해\r\n그래서 널 보내려고 해\r\n\r\n언젠가는 돌아갈께 \r\n사랑할 자격 갖춘 나 되어 \r\n너의 곁으로 돌아갈께\r\n행복을 줄 수 있을 때\r\n아파도 안녕 잠시만 안녕\r\n\r\n언제나 위태로운 나\r\n그런 내가 널 사랑을 했어\r\n외로운 고독이 두려워\r\n빨리 못 보내 미안해\r\n\r\n사는게 참 힘들었어\r\n널보며 난 견뎠어\r\n허나 네겐 보여줄 수 없는\r\n내 삶 이별로 널 지키려 해\r\n\r\n언젠가는 돌아갈께\r\n흔들리지 않는 나 되어\r\n늦지않게 돌아갈께\r\n널 많이 사랑하니까\r\n조금만 울자 잠시만 울자\r\n\r\n아파도 안녕 널 위해 안녕\r\n\r\n내가 널 더 사랑하면\r\n우리가 정말 사랑했다면</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/334/15026334_1338257936814_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131360, lowkey: nil, highkey: nil},
  {album_id: 109, singer_id: nil, team_id: 1, title: "사랑하고 싶었어", genre1: "가요", genre2: "락", runtime: "03:31", lyrics: "\n\t\t\t\t\t\t\t<div>사랑하고 싶었어 - 03:31</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">난 너의 눈빛속에서\r\n지나간 사랑을 느껴\r\n얼마나 시간이 흘러야\r\n다 잊을수 있는거니\r\n힘겨워 하는걸 난 몰랐어\r\n너의 예전 사람때문에\r\n상처받은 너의 마음을\r\n나에게 그냥 기대면 안되니\r\n보내줘야해 너의 모든걸\r\n\r\n사랑하고 싶어서\r\n\r\n그렇게 슬픈눈으로\r\n이별을 말하지는 마\r\n함께한 우리 추억들\r\n아무런 소용이 없니\r\n힘겨워하는걸 난 몰랐어\r\n너에 예전 사람때문에\r\n\r\n상처받은 너의 마음을\r\n나에게 그냥 기대면 안되니\r\n보내줘야해 너의 모든걸\r\n\r\n사랑하고 싶었어\r\n\r\n이제 나를 떠나가도돼\r\n눈물은 네게 보이지 않을께\r\n행복하길 바랄께 언제나\r\n\r\n너를 사랑하고 싶어서</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/334/15026334_1338257936814_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131361, lowkey: nil, highkey: nil},
  {album_id: 109, singer_id: nil, team_id: 1, title: "마지막 내 숨소리", genre1: "가요", genre2: "락", runtime: "04:24", lyrics: "\n\t\t\t\t\t\t\t<div>마지막 내 숨소리 - 04:24</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">그대는 듣고 있나요 \r\n마지막 내 거친 숨소리를 \r\n잠시 후 그 소리가 멈춰도 \r\n절대 후회하지 않아\r\n \r\n이렇게 눈을 감으면 \r\n내게는 그저 그만이지만 \r\n그대는 이제 어떡하나요 \r\n이제 어떡할 건가요 \r\n\r\n우리의 지난 기억들과 함께 했던 시간 \r\n모두가 사라져 가요 \r\n그대여 나 지금 이 순간 할말이 있어요 \r\n사랑한다고 \r\n그대는 듣고 있나요 \r\n마지막 내 숨소리를 \r\n\r\n그대는 모르고 있겠죠 \r\n오늘밤 나의 사고 소식을 \r\n영원히 모르는게 낫겠죠 \r\n웃는 모습 그대로요 \r\n\r\n우리의 지난 기억들과 \r\n함께 했던 시간 \r\n모두가 사라져 가요 \r\n그대여 나 지금 \r\n이 순간 할말이 있어요 \r\n사랑한다고 \r\n그대는 듣고 있나요 \r\n마지막 내 거친 숨소리를 \r\n\r\n잠시후 그 소리가 멈춰도 \r\n절대 후회하지 않아 \r\n절대 후회하지 않아</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/334/15026334_1338257936814_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131362, lowkey: nil, highkey: nil},
  {album_id: 109, singer_id: nil, team_id: 1, title: "Best Friend", genre1: "가요", genre2: "락", runtime: "03:39", lyrics: "\n\t\t\t\t\t\t\t<div>Best Friend - 03:39</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">수많은 사람들이 떠나도 항상 너는\r\n거기에 있어줬지\r\n서로에 가슴을 멍들였던\r\n험한 미련 추억이 됐어\r\n사랑은 영원하지 못했고 아픔만 남겼지만\r\n지켜내 외롭지않게 하지만 자유롭게\r\n쉽지만은 않은 거리를 지키며\r\n오랜 시간동안 내곁을 지켜준 너\r\n말할수 있어\r\nyou always my Best Friend\r\n\r\n모두들 안된다고 막아도\r\n항상 너만은 날 믿어주곤 했지\r\n아무런 얘기하지 않아도\r\n말할수 있는 사이가 됐어\r\n사랑은 영원하지 못했고 아픔만 남겼지만\r\n지켜내 외롭지않게 하지만 자유롭게\r\n쉽지만은 않은 거리를 지키며\r\n오랜 시간동안 내곁을 지켜준 너\r\n말할수 있어\r\nyou always my Best Friend\r\n\r\n아직 알수없는 세상은 \r\n눈물과 기쁨이 기다리겠지만\r\n서로 아무것도 몰랐던 그때\r\n터질듯한 꿈을 포기하지는 마\r\n몇번이고 다시 일어서 힘이 될테니까\r\n지켜내 외롭지않게 하지만 자유롭게\r\n쉽지만은 않은 거리를 지키며\r\n오랜 시간동안 내곁을 지켜준 너\r\n말할수 있어\r\nyou always my Best Friend\r\n\r\n기억해줘 you always my Best Friend ..</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/334/15026334_1338257936814_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131363, lowkey: nil, highkey: nil},
  {album_id: 109, singer_id: nil, team_id: 1, title: "변함없는 나", genre1: "가요", genre2: "락", runtime: "04:19", lyrics: "\n\t\t\t\t\t\t\t<div>변함없는 나 - 04:19</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">그래 알고 있어 변함 없는 나\r\n\r\n언제나 아니라며 고개짓하는 나를\r\n\r\n틀린것 그대로를 말하는데\r\n\r\n뭐가 어때서\r\n\r\n왜들 심각하게 눈치들만 보고 있는지\r\n\r\n타협이란 말은 뭔지 난 몰라\r\n\r\n왜 내가 원치않는 길을가야 하는지\r\n\r\n왜그리 간섭하려 하는건지\r\n\r\n이해가 안돼\r\n\r\n그저 방해받고 싶지않을 뿐이야\r\n\r\n모든게 운명이라고 내게 말해온 사람들\r\n\r\n그래 그렇게들 살아가길 진정 원할까\r\n\r\n나에 인생이란 나만의 것\r\n\r\n운명따윈 없어\r\n\r\n한번쯤 넘어진다해도\r\n\r\n멋진 조각처럼 하나둘씩 내가 만들꺼야\r\n\r\n두번쯤 실수한다해도\r\n\r\n오직 단한번뿐인 나인거야~워~\r\n\r\n완전한 나란 없어\r\n\r\n조금 서툴러도 되지\r\n\r\n그래 그게 정말 내가원한 삶이 아닐까\r\n\r\n나에 인생이란 나만의 것\r\n\r\n운명따윈 없어\r\n\r\n한번쯤 넘어진다해도\r\n\r\n멋진 조각처럼 하나둘씩 내가 만들꺼야\r\n\r\n두번쯤 실수한다해도\r\n\r\n오직 단한번뿐인 나인거야~워~\r\n\r\n오직 단한번뿐인 나인거야..음~</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/334/15026334_1338257936814_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131364, lowkey: nil, highkey: nil},
  {album_id: 109, singer_id: nil, team_id: 1, title: "天의 안부", genre1: "가요", genre2: "락", runtime: "04:23", lyrics: "\n\t\t\t\t\t\t\t<div>天의 안부 - 04:23</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">잘 있었나요 별일 없나요 \r\n내게 있을때 처럼\r\n자주 아파하지는 않나요 \r\n괜한 걱정드네요\r\n그대가 사는 저 하늘 위에 \r\n어떻게들 사나요\r\n함께 했었던 그때처럼만 \r\n행복하길 바래요\r\n\r\n내 걱정에 자주 비를 내리진 마요\r\n내가 그대 곁으로 떠날 수 있는 그 날 \r\n행복한 웃음으로 나를 반겨 \r\n주기를 바래요\r\n우리 못다한 사랑 너무 아팠던 사랑 \r\n그 곳에서 이뤄질테니까요 그대\r\n\r\n내 걱정에 자주 비를 내리진 마요\r\n그대 없단 이유로 아파하며 사는게 \r\n이것으로 내게는 그 하나로 충분한걸요\r\n우리 못다한 사랑 너무 아팠던 사랑\r\n그 곳에선 이뤄질테니까요 그대\r\n\r\n잘 있었나요 별일 없나요 \r\n내게 있을때 처럼</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/334/15026334_1338257936814_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131365, lowkey: nil, highkey: nil},
  {album_id: 109, singer_id: nil, team_id: 1, title: "12月", genre1: "가요", genre2: "락", runtime: "04:24", lyrics: "\n\t\t\t\t\t\t\t<div>12月 - 04:24</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">난 너를 떠나가\r\n세차게 내리는 비가 되어\r\n나의 마음을 아프게 했던\r\n니가 없는 세상을 난 즐겨\r\n혼자라도 살아갈 수 있어\r\n이젠 난 널 몰라 \r\n\r\n고마웠어 잔인한 니가\r\n행복했어 지난 그 겨울\r\n차라리 더 고맙다 할께\r\n거친 세상 알게 했어\r\n아픔의 계절을\r\n지나 난 강해졌어\r\n\r\n그래 나는 변했어\r\n따뜻하게 너를 감싸던\r\n그런 나 아냐 더 싸늘하게\r\n부는 바람에 다 날렸어\r\n강인한 맘 그 하나 만으로\r\n세상을 싸워 갈꺼야\r\n\r\n고마웠어 잔인한 니가\r\n행복했어 지난 그 겨울\r\n차라리 더 고맙다 할께\r\n거친 세상 알게 했어\r\n슬픔에 계절을 지나\r\n난 강해졌어\r\n\r\n사랑했어 너를\r\n행복했어 지난 그 겨울\r\n차라리 더 고맙다 할께\r\n거친 세상 알게 해준 너\r\n그렇게 내가 졌어\r\n니 앞에서 짓밟히며\r\n난 강해졌어</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/334/15026334_1338257936814_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131366, lowkey: nil, highkey: nil},
  {album_id: 109, singer_id: nil, team_id: 1, title: "사랑하는 날 (Loving Day)", genre1: "가요", genre2: "락", runtime: "04:27", lyrics: "\n\t\t\t\t\t\t\t<div>사랑하는 날 (Loving Day) - 04:27</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">아직도 기다리나요 \r\n그대를 위해 나 여기 \r\n서 있었다는 걸 \r\n아마도 알 수 없겠죠\r\n그래요 나는 아닌거겠죠 \r\n\r\n보고 싶은 마음으로 \r\n전화를 들어보지만 \r\n나 아닌 그 사람 \r\n연락이 오지 않는다 하며 \r\n눈물을 보이네요 힘이 든다며 \r\n\r\n여기 내사랑이 울고 있는데 \r\n기다리는 내가 안 보이나요 \r\n지금은 안되요 그대 혼자서 \r\n두고 떠날 수없어요 \r\n죽어도 좋아요 \r\n그대안에서 내가 함께라면\r\n \r\n바보가 되도 좋아요\r\n내가 그대를 위해서 \r\n쓰여질 수 있게\r\n내 가슴을 보여드릴께요\r\n그냥 거기 있어요 날 느껴요\r\n\r\n여기 내 사랑이 울고 있는데\r\n기다리는 내가 안 보이나요 \r\n지금은 안되요 \r\n그댈 혼자서 두고 떠날 순 없어요 \r\n죽어도 좋아요 \r\n그대 안에서 내가 함께라면 \r\n\r\n나 고백할께요 \r\n아직도 모르나요 \r\n그댈 사랑하는 날~~~\r\n\r\n이제 눈물을 보이지 말아요 \r\n내가 그대곁에 살고 있어요 \r\n가지지 못했던 그대 사랑을 \r\n내가 채워드릴께요\r\n더 이상 그대를 \r\n두고 볼 수 없는 날 용서해요\r\n그대 그림자라도 되고 픈 날</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/334/15026334_1338257936814_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131367, lowkey: nil, highkey: nil},
  {album_id: 109, singer_id: nil, team_id: 1, title: "하얀 하늘", genre1: "가요", genre2: "락", runtime: "04:36", lyrics: "\n\t\t\t\t\t\t\t<div>하얀 하늘 - 04:36</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">You do live in my heart\r\nI've always breath in your heart\r\n그렇게 너는 내안에 \r\n숨쉬고 있는걸 \r\n\r\n이젠 시간이 흘러서 \r\n나를 기억도 못하겠지 \r\n어쩌다 너를 마주치면 \r\n괜히 어색한 인사만 할까 \r\n\r\nYou do live in my heart\r\nI've always breath in your heart\r\n그렇게 나는 추억에 \r\n잠들고 있는걸 \r\n\r\n니가 나를 떠난대도 \r\n여전히 너는 내 맘속에 \r\n어쩌다 니가 보고프면 \r\n괜히 어색한 미소만이\r\n\r\n하얀 하늘위에 널 그려 \r\n잊지않도록 그 안에 담고\r\n바랜 사진속에 너를 꺼내어 \r\n다시 흔들리는 나를 보내\r\n\r\n\r\n니가 나를 떠난대도 \r\n여전히 너는 내맘속에 \r\n어쩌다 니가 보고프면 \r\n괜히 어색한 미소만이 \r\n\r\n하얀 하늘위에 널 그려 \r\n잊지않도록 그 안에 담고\r\n바랜 사진속에 너를 꺼내어\r\n다시 내 맘속에 그려\r\n\r\n그렇게 또 너를 그려\r\n또 다시 내게로 올 것 같아\r\n\r\n하얀 하늘위에 널 그려 \r\n잊지않도록 그 안에 담고 \r\n바랜 사진속에 너를 꺼내어 \r\n다시 내 맘속에 그려보네 소중한 너를\r\nYou Forever live in my heart</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/334/15026334_1338257936814_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131368, lowkey: nil, highkey: nil},
  {album_id: 109, singer_id: nil, team_id: 1, title: "파애(破愛)", genre1: "가요", genre2: "락", runtime: "04:33", lyrics: "\n\t\t\t\t\t\t\t<div>파애(破愛) - 04:33</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">니 남자야 날 기억하겠니\r\n잊은줄 알고 있었어\r\n오히려 널 피했던 내 시선을\r\n내가 더 미안하다\r\n\r\n잘 지내니 많이 좋아보여\r\n새로운 남자인가봐\r\n아마도 널 떠나주길 잘했지\r\n원하던 사람과 함께 있으니\r\n\r\n슬퍼할 눈물 마저도\r\n없다고 믿어왔는데\r\n이제 남아있는건 널위한 나 뿐야\r\n너를 잊어 낼까봐 그게 더 겁이나\r\n하루도 널 잊은적 없어\r\n\r\n아마도 너란사람\r\n조금 빨리 만나것 같아 두려웠었어\r\n사랑할땐 몰랐어\r\n지금에서야 알아낸 것 같아\r\n\r\n이렇게 스쳐 지나도 니맘은 괜찮을런지\r\n너역시도 나처럼 내 생각 하는지\r\n이제 남아있는건 널 위한 나뿐야\r\n두려워 널 잊어 낼까봐\r\n\r\n그게 더 겁이나</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/334/15026334_1338257936814_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131369, lowkey: nil, highkey: nil},
  {album_id: 109, singer_id: nil, team_id: 1, title: "서시", genre1: "가요", genre2: "락", runtime: "03:53", lyrics: "\n\t\t\t\t\t\t\t<div>서시 - 03:53</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">해가 지기 전에 가려했지\r\n너와 내가 있던 그 언덕 풍경속에\r\n아주 키작은 그 마음으로\r\n세상을 꿈꾸고 그리며 말했던 곳\r\n이제 여행을 떠나야 하는\r\n소중한 내 친구여\r\n때론 다투기도 많이 했지\r\n서로 알 수 없는 오해의 조각들로\r\n하지만 멋적은 미소만으로\r\n너는 내가 되고\r\n나도 니가 될 수 있었던\r\n수많은 기억들\r\n내가 항상 여기 서 있을게\r\n걷다가 지친 네가 나를 볼 수 있게\r\n저기 저 별 위에 그릴꺼야\r\n내가 널 사랑하는 마음 볼 수 있게\r\n너는 내가 되고\r\n나도 니가 될 수 있었던\r\n수많은 기억들\r\n내가 항상 여기 서있을게\r\n걷다가 지친 니가 나를 볼 수 있게\r\n저기 저 별 위에 그릴꺼야\r\n내가 널 사랑하는 마음 볼 수 있게\r\n내가 항상 여기 서 있을게\r\n걷다가 지친 네가 나를 볼 수 있게\r\n저기 저 별 위에 그릴꺼야\r\n내가 널 사랑하는 마음 볼 수 있게</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/334/15026334_1338257936814_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131370, lowkey: nil, highkey: nil},
  {album_id: 109, singer_id: nil, team_id: 1, title: "잠시만 안녕 (Original)", genre1: "가요", genre2: "락", runtime: "06:49", lyrics: "\n\t\t\t\t\t\t\t<div>잠시만 안녕 (Original) - 06:49</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">행복을 줄 수 없었어\r\n그런데 사랑을 했어\r\n니 곁에 감히 머무른\r\n내 욕심을 용서치마\r\n방황이 많이 남았어\r\n그 끝은 나도 모르는 곳\r\n약하게 태어나서 미안해\r\n그래서 널 보내려고해\r\n언젠가는 돌아갈게\r\n사랑할 자격 갖춘 나 되어\r\n너의 곁으로 돌아갈게\r\n행복을 줄 수 있을 때\r\n아파도 안녕 잠시만 안녕\r\n\r\n언제나 위태로운\r\n나 그런 내가 널 사랑을 했어\r\n외로운 고독이 두려워\r\n빨리 못 보내 미안해\r\n사는게 참 힘들어서\r\n널 보며 난 견뎠어\r\n허나 네겐\r\n보여줄 수 없는 내 삶\r\n이별로 널 지키려해\r\n언젠가는 돌아갈게\r\n흔들리지 않는 나 되어\r\n늦지 않게 돌아갈게\r\n널 많이 사랑하니까\r\n아파도 안녕 슬퍼도 안녕\r\n\r\n언젠가는 돌아갈게\r\n사랑할 자격 갖춘 나 되어\r\n너의 곁으로 돌아갈게\r\n행복을 줄 수 있을 때\r\n아파도 안녕 널위해 안녕\r\n\r\n너와 내가 사랑하면\r\n우리가 정말 사랑한다면\r\n언젠가는 만날거야\r\n행복을 줄 수 있을때\r\n조금만 울자 잠시만 울자\r\n아파도 안녕 널위해 안녕</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/334/15026334_1338257936814_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131371, lowkey: nil, highkey: nil},
  {album_id: 109, singer_id: nil, team_id: 1, title: "Intro", genre1: "가요", genre2: "락", runtime: "01:34", lyrics: "\n\t\t\t\t\t\t\t<div>Intro - 01:34</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가사 정보가 없습니다.</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/334/15026334_1338257936814_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131372, lowkey: nil, highkey: nil},
