  {album_id: 109, singer_id: nil, team_id: 1, title: "One Love", genre1: "가요", genre2: "락", runtime: "04:23", lyrics: "\n\t\t\t\t\t\t\t<div>One Love - 04:23</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">이젠 내가 돌아서려해\r\n다신 그 사람과\r\n네 앞에서 보이지 않게\r\n이젠 너에겐 어떤 바램도 \r\n작은 기대 조차 \r\n할 수 없는 나 잖아\r\n하지만 시간이 \r\n많이 지난 후에도 \r\n나의 숨결 나의 향기 \r\n네게 묻어 있다면\r\n언제나 힘들던 \r\n이룰 수 없던 사랑\r\n너에게도 너무 큰 \r\n아픔이 었다면\r\n다시 내게 돌아와 \r\n너를 떠나보내고 \r\n후회하고 있는 내게\r\n함께 할 수 없음이 \r\n나에겐 너무도\r\n커다란 아픔인걸 아니\r\n\r\n언제나 힘들던 \r\n이룰 수 없던 사랑 \r\n너에게도 너무 \r\n큰 아픔이었다면\r\n돌아와줘\r\n후회없는 사랑하기 위해 \r\n내가 택한 사람은 너 뿐야\r\n언젠간 내게 \r\n돌아와줄 너 잖아 \r\n힘든 시간 다 지나고 \r\n오랜 간절함에 되찾은 \r\n내 마지막 사랑인걸\r\n다시 내게 돌아와 \r\n너를 떠나보내고\r\n후회하고 있는 내게\r\n함께 할 수 없음이 \r\n나에겐 너무도\r\n커다란 아픔인걸 아니</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/334/15026334_1338257936814_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131374, lowkey: nil, highkey: nil},
