  {album_id: 110, singer_id: 186, team_id: nil, title: "Inmost", genre1: "가요", genre2: "발라드", runtime: "03:55", lyrics: "\n\t\t\t\t\t\t\t<div>Inmost - 03:55</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">살아있음 행복하니\r\n붙어있는 숨에 안도하니\r\n어딜 가던지 무얼 하던지 너는\r\n부딪혀 깨진\r\n내가 처참하게\r\n무너져가길 원해\r\n\r\n너의 삶을 살고 있니\r\n갈망이 갈증이지 않게\r\n무엇이 진정 니가 원했던 거니\r\n부딪혀 깨진\r\n내가 처참하게\r\n무너져가길 원해\r\nkeep on followin' dream\r\nmy real my real dream\r\nI will be there someday\r\nmy real world\r\n미래는 없고 현실은 지고\r\n젊음은 가고 허망한 꿈만 쫓고\r\n안위와 시기\r\n나에게 닥친 위기\r\n이제 나는 나로\r\n또 다른 내가 아닌 진짜 나로\r\n늦지 않아 이제\r\n그게 뭔데 뭐래\r\n자유 이제 내게\r\n모든 것이 내게\r\n무엇이 진정 니가 원했던 건지\r\n어딜 가던지 무얼 하던지 너는\r\nkeep on followin' dream\r\nmy real my real dream\r\nI will be there someday\r\nmy real world\r\n\r\nkeep on followin' dream\r\nmy real my real dream\r\nI will be there someday\r\nmy real world\r\nkeep on followin' dream\r\nmy real my real dream\r\nI will be there someday\r\nmy real world\r\n살아있음 행복하니</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/335/15026335_1395650239901_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 10292, song_num: 16131378, lowkey: nil, highkey: nil},
