  {album_id: 110, singer_id: 186, team_id: nil, title: "사랑일뿐이야", genre1: "가요", genre2: "발라드", runtime: "05:56", lyrics: "\n\t\t\t\t\t\t\t<div>사랑일뿐이야 - 05:56</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">어머닌 아마도\r\n제게 하나뿐인 화가 처럼\r\n온 세상 그대 손으로\r\n아름답게 물 들여요\r\n어머닌 아마도\r\n제게 하나뿐인 시인 처럼\r\n내 마음 그대 숨 결로\r\n포근하게 감싸요\r\n사랑일 뿐이야\r\n사랑일 뿐이야\r\n온 세상 다 준다해도\r\n바꿀 수 없는 건\r\n온 세상 떠난다해도\r\n변하지 않는 건\r\n사랑일 뿐이야\r\n사랑일 뿐이야\r\n\r\n어머닌 아마도\r\n제게 하나뿐인 등불 처럼\r\n밤 길을 그대 빛으로\r\n환하게 밝혀줘요\r\n어머닌 아마도\r\n제게 하나뿐인 친구 처럼\r\n내 슬픔 그대 노래로\r\n다정하게 달래줘요\r\n사랑일 뿐이야\r\n사랑일 뿐이야\r\n사랑일 뿐이야\r\n사랑일 뿐이야\r\n\r\n사랑일 뿐이야\r\n사랑일 뿐이야\r\n사랑일 뿐이야\r\n사랑일 뿐이야\r\n사랑일 뿐이야\r\n사랑일 뿐이야</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/335/15026335_1395650239901_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131382, lowkey: nil, highkey: nil},
  {album_id: 110, singer_id: 186, team_id: nil, title: "푸념", genre1: "가요", genre2: "발라드", runtime: "04:06", lyrics: "\n\t\t\t\t\t\t\t<div>푸념 - 04:06</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">너와 헤어진 뒤에 난\r\n피곤하기만 해\r\n괜한 상상에 마음만 울적하고\r\n\r\n내 슬픔 따위 아랑곳하지 않는\r\n저 거리는\r\n흐려져 가고 눈물은 자꾸 나고\r\n너와의 추억으로 사는 난\r\n숨 쉬기가 곤란해\r\n이러는 나를 자꾸 집착한다고\r\n몰아세우지마 더 이상\r\n너를 정말 사랑했어\r\n널 원망해 본 적 없어\r\n알잖아 너는 비록\r\n나를 아프게 했지만\r\n내 걱정일랑 말어\r\n그럴 리 없겠지만\r\n\r\n지금 난 숨쉬기가 곤란해\r\n이러는 나를 자꾸 집착한다고\r\n몰아 세우지마 더 이상\r\n우리 살아있는 동안\r\n혹시 마주친다면\r\n웃을게 아주 조금\r\n서로 말은 없을테니\r\n너의 두 팔 가득한\r\n행복을 축하하게\r\n너를 정말 사랑했어\r\n널 원망해 본 적 없어\r\n알잖아 너는 비록\r\n나를 아프게 했지만\r\n내 걱정일랑 말어\r\n그럴 리 없겠지만</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/335/15026335_1395650239901_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131383, lowkey: nil, highkey: nil},
