  {album_id: 110, singer_id: 186, team_id: nil, title: "아이에서 어른으로", genre1: "가요", genre2: "발라드", runtime: "04:57", lyrics: "\n\t\t\t\t\t\t\t<div>아이에서 어른으로 - 04:57</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">7살의 난 슈퍼맨인 것만 같다\r\n지구인들이 이 사실을 알까\r\n두렵다\r\n\r\n14살의 난\r\n어른이 되고 싶어 했다\r\n자유 사랑 진리와 평화\r\n이런 것이 어른들이\r\n누리는 특권이라 생각했다\r\n공부하란 얘기도 안 들을테고\r\n나나 나나나나\r\n나나 나나나나\r\n나나 나나나\r\n나나\r\n\r\n23살의 난 사랑에 빠졌고\r\n난 어른이 되었다고 믿었다\r\n그로부터 얼마 후\r\n자유 사랑 진리와 평화\r\n이런 것이 내가 누릴\r\n보장된 행복이라 생각했다\r\n훌륭한 사람도 될 수가 있고\r\nfreedom love truth &amp; peace\r\nfreedom love truth &amp; peace\r\nfreedom love truth &amp; peace\r\nfreedom love truth &amp; peace\r\nfreedom\r\n\r\n지금의 난 결국\r\n아무것도 갖지 못할까 두렵다</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/335/15026335_1395650239901_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131386, lowkey: nil, highkey: nil},
  {album_id: 110, singer_id: 186, team_id: nil, title: "안식", genre1: "가요", genre2: "발라드", runtime: "05:12", lyrics: "\n\t\t\t\t\t\t\t<div>안식 - 05:12</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">누구나 아무도 모르는 \r\n그만의 비밀\r\n해답을 구하지만\r\n어디로 내가 가야 할지\r\n언제쯤에야 멈춰서야 할런지\r\n앞으로만 가라네 \r\n늦춰서는 안된다네\r\n난 쉬고픈데 머무르고픈데\r\n날 향한 기대와 뒤섞인 원망들을\r\n삶 한구석에 저만치 미루고\r\n잠시만 누워 하늘을 보고 오게\r\n\r\n가야해 멀리로 가야해\r\n아무것에도 탐내지 않기 위해\r\n보이는 모든 걸 얻으려\r\n애쓴 마음을 다치게 해야하면\r\n\r\n난 쉬고픈데 머무르고픈데\r\n날 향한 기대와 뒤섞인 원망들을\r\n삶 한구석에 저만치 미루고\r\n잠시만 누워 하늘을\r\n날 보채지마 떠밀려 하지마\r\n그대의 희망을 \r\n내 어깨에 싣진마\r\n나 가고픈 건 날 식혀줄 바람\r\n부는 그 곳에\r\n내가 날 쉬 누이게</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/335/15026335_1395650239901_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 10321, song_num: 16131387, lowkey: nil, highkey: nil},
