  {album_id: 110, singer_id: 186, team_id: nil, title: "관 (觀)", genre1: "가요", genre2: "발라드", runtime: "03:48", lyrics: "\n\t\t\t\t\t\t\t<div>관 (觀) - 03:48</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">아무래도 아까 내 뱉은 건\r\n아까워 괴로워\r\n아 조금만 아껴야 했는데\r\n눌러야만 했어\r\n\r\n튀어나와 기어나와\r\n가소로운 알량한 알음에\r\n나서지 말아야\r\n하찮은 그 혀 세 칠 감아\r\n호흡을 정리해\r\n튀어나와 기어나와\r\n솔직해질 필요는 없지\r\n입에 발린 말임 더 좋지\r\n그대는 치장하고 가려야 좋아해\r\n진실을 가려낼 수 없지\r\n거짓이 꼭 나쁘진 않지\r\n그렇게 나뉘어 틀려지는 것\r\n\r\n아무도 몰라주는 너의 맘\r\n넌 계속 외로워\r\n살리려는 기술을 터득해\r\n승부를 봐야지\r\n\r\nyou're a winner \r\nyou're a loser\r\n솔직해질 필요는 없지\r\n입에 발린 말임 더 좋지\r\n그대는 치장하고 가려야 좋아해\r\n진실을 가려낼 수 없지\r\n거짓이 꼭 나쁘진 않지\r\n그렇게 나뉘어 틀려지는 것\r\n\r\n솔직해질 필요는 없지\r\n입에 발린 말임 더 좋지\r\n그대는 치장하고 가려야 좋아해\r\n진실을 가려낼 수 없지\r\n거짓이 꼭 나쁘진 않지\r\n그렇게 나뉘어 틀려지는 것</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/335/15026335_1395650239901_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131390, lowkey: nil, highkey: nil},
  {album_id: 110, singer_id: 186, team_id: nil, title: "새대가리", genre1: "가요", genre2: "발라드", runtime: "04:26", lyrics: "\n\t\t\t\t\t\t\t<div>새대가리 - 04:26</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">넌 넌 넌 새장 속에 갇힌 새\r\n좁은 세상에 갇힌\r\n매일 매일 매일 매일\r\n니 자신에 취하여\r\n새머리로 모든걸\r\n\r\n넌 넌 넌 탐욕스런 돼지야\r\n역겨운 우리의 삶\r\n매일 매일 매일 밥그릇만 탐하며\r\n니가 아는 세상이 다인줄알지\r\n\r\n더 이상은 자비란건 내게 없다\r\n그동안 참을 만큼 참았으니까\r\n이에는 이 코에는 코로 대하지\r\n니까짓 정도라면\r\n이제 부터 밟아주겠다\r\n\r\n넌 넌 넌 새장 속에 갇힌 새\r\n넌 넌 넌 쓰레기\r\n넌 넌 넌 탐욕스런 돼지야\r\n넌 넌 넌 현학자\r\n더 이상은 자비란 건 내게 없다\r\n그동안 참을 만큼 참았으니까\r\n이에는 이 코에는 코로 대하지\r\n니까짓 정도라면\r\n이제부터 밟아주겠다\r\n\r\n배설물로 가득 찬 니 뇌세포를\r\n이제는 질겅질겅 씹어주겠다\r\n세상 무서운 줄 모르는 철부지\r\n한심한 새대가리야</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/335/15026335_1395650239901_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131391, lowkey: nil, highkey: nil},
