  {album_id: 113, singer_id: nil, team_id: 53, title: "엉터리 학생", genre1: "OST", genre2: "전체", runtime: "04:13", lyrics: "\n\t\t\t\t\t\t\t<div>엉터리 학생 - 04:13</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">* 너 어디가니 너 학교가니 뭐 빠진거는 없니 딴데로 \r\n새는건 아니니 \r\n너 어디가니 너 학교가니 뭐 빠진거는 없니 딴데로 새는건 아니니 \r\n학교로가(가) 선생님이 기다리셔 집으로가(가) 부모님이 기다리셔 \r\n학교로가(가) 선생님이 기다리셔 집으로가(가)\r\n\r\n명호 : 이런 제기랄 오늘도 변함없이 망가졌지\r\n물론 내겐 오늘내일 일은 아니지만 이거 참 참 참 \r\n해도해도 정말 내게 너무하는거 아냐 하고 이를 갈고 있었지 \r\n그래도 내게 명색이 선생님과 부모님인데 \r\n내 장래를 위해서 그러느니 생각하면 그건 잠시 나만의 생각일 뿐 \r\n빌어먹을 신경이 또 지독히 날카로워질 때면 \r\n바지통이 어쩌느니 머리색이 어쩌느니 \r\n네가 입은 옷이라면 쌀 한가마니 돈이라니 \r\n하며 무서운 몽둥이는 나를 향해 날라오고 \r\n성공 지위 명예 권력 그 모든 것을 얻으려면 \r\n공부는 필수 노력은 의무 대학은 선택이라나\r\n말이 끝나자마자 난 또 한번 죽고 \r\n그래서 홧김에 난 한 명 찍어놓고 \r\n수업이 끝나자마자 두들겨 패면 \r\n그놈들은 며칠동아 결석하질 않나 \r\n그러다 그 얼간이가 듣는날엔 난 아마 제삿날이겠다 싶어보여 \r\n요놈들 집을 찾아가 협박을 했지 그러니까 그놈들은 가출하드만\r\n(아서라 이사람아 정신 좀 채려라.)\r\n\r\n* 반복\r\n\r\n주라 : 쨍하고 해 뜨자마자 학교에 갈까 말까 많이 생각했었지 \r\n분명 가봤자 그놈한테 돈 뺏기고 또 \r\n맞을거 뻔한 일인데 이대로 갈까말까 \r\n한참을 난 생각하던 끝에 \r\n천만다행히 나에게는 결론이 서드만 \r\n나 역시 화려한 변신이 필요하다고 말이지 하하하 변신!\r\n(날이 가면 갈수록 내 모습은 화려해지고)\r\n반짝거리는 화려한 내 모습 앞에 \r\n남녀노소를 불문하고 내 앞을 가로막는 이는 그 누구도 없고 \r\n서로가 내 눈치를 보며 너 나 할 것 없이 벌벌기는 이들에게 \r\n당하지 않으려면 강해야만 한다 맞지 않으려면 너 역시 때려야만 한다 \r\n그렇게 설명을 해줬지 \r\n그건 왜냐 옛날 옛적 최영이란 분이 계셨었지 \r\n그분 성격이 항상 그랬듯이 \r\n너 소냐 나 최영이야 그리고는 소뿔을 확 부러뜨려 버려 \r\n무대포 정신이 필요하다\r\n\r\n* 반복\r\n\r\n디기리 : 태어나면서부터 내가 들었던 말 공부해 공부해 뭐하니 \r\n항상 내게 말해 부모님 선생님 모두 \r\n모두가 다 똑같애 내겐 없어 아무 것도 없어 1등밖에 난 없어 \r\n단지 학교 학원 그리고 독서실 왔다갔다 \r\n기계처럼 난 똑같이 살아만 가지 난 \r\n하지만 이런게 내가 원했던게 아닌데 \r\n왜들 다들 날 그렇게들 몰고만 있어 \r\n내가 배운 세상과 내가 본 세상이 같지가 않아 \r\n어떤게 맞는지 몰라 \r\n난 널 봐 너처럼 되고 싶어 니 말이 전부 모두다 맞는 것 같아 \r\n이제 난 여자친구 사귀어 돈도 뺏어 약한 애 때려 막갈래 내가 하고 싶은데로 막갈래 \r\n'사'자만이 판치는 세상 됐어 내 꿈은 따로 있어 다 '사'자 하면 나머진 누가 해? \r\n말도 안돼 이제 날 내가 하고 싶은데로 냅둬 제발</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131601, lowkey: nil, highkey: nil},
  {album_id: 113, singer_id: nil, team_id: 54, title: "Survival (Feat. 에스더, Z.A.son)", genre1: "OST", genre2: "전체", runtime: "04:22", lyrics: "\n\t\t\t\t\t\t\t<div>Survival (Feat. 에스더, Z.A.son) - 04:22</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">살의 서로에게 적의를 느끼며 자신을 보호하기 위해 만든 껍질 생존의 법칙 정글에서 살아남기 위\r\n한 생존방식 죽음의 GAME 우리를 묶어 놓은 거대한 체인 1970년의 메콩델타 부비트랩과 보이지 \r\n않는 적과 살아 곳곳에 뿌려진 죽음의 SEED 서로를 파괴하는 A.T 필드\r\n\r\n(Chorus)×2\r\n또 넌 그 틀에서 받아들여\r\n또 넌 그 틀에서 움츠려들어 \r\n사회적인 가치는 성취\r\n아무도 모르게 다가오는 파괴 묵시록의 메시지\r\n\r\n지금껏 살아왔던 길 알지 못 한 사이 에 보이지 않던 사이 우릴 DEFENSE했던 껍질 (찔릴)그리고 \r\n점점 미칠 만큼에 우릴 어두운 코너로 몰아넣어버릴 샛길 하! 우리 모습을 HIDE 우리가만든 함정 \r\n속에 나오지 못한 자 의 비틀거리는 자아 그 속에 살아 날아 오르기 위한 순간 그 찰라 뛰쳐나온 \r\nDEFENSE의 가시 너무 날카로운 가시 사람들의 완전 방어로 다 똑같이 다 카피 우리의 HAPPINESS \r\n다시 되찾겠어 가식이란 껍질에 뺏긴 내 모습을 되찾겠어 C.B MASS MEDIA 너의 두 팔을 올리어 \r\n다시 두 팔을 올리어 벗어던저 더 빨리 무거운 어깨의 짐 니 몸에 들어간 힘 풀어 벗어 전부다 버\r\n리어 \r\n\r\n*CHORUS *2\r\n\r\n욕망을 깨트리기 위한 너의 기본원칙을 부셔버리기 위한 몸 속 깊숙이 베어든 습관적인 경향 올바\r\n른 방향으로 이끌어 모든걸 멍청히 체념한체 너 자신을 잃어 주위에 시선에 좀더 신경을 써대 니가 \r\n속해있는 집단에 눈을 맞추기 위해 따라가기 위해 줄줄이 소세지처럼 너에 인생 은 걸려들어 거미\r\n줄에 네 온몸을 감싸 너의 약점에 초점을 두고 더욱 더 더 너의 실체를 가리기 위해 더 많이 감싸 \r\n반복에 반복 이미 벗어날 수 없어 전환점은 없어 몸 속 깊이 뿌리박혔어 이젠 C.B.MASS 에 메쓰로 \r\n깊게 쑤셔주겠어...\r\n\r\n*CHORUS *2\r\n\r\n나를 지키기 위해 걸친 나의 껍질 그 동안 보고 배운 생존의 법칙 하나 둘씩 늘어만 갔던 껍질 위\r\n에 가시 또다시 바닥에 서로가 흘린 피 남보다 더 커 보이고 싶은 나의 욕심 그 속에 길을 잃은 나\r\n의 본심 껍질이 너무 커 방패 가 아닌 그 속에 병폐 가 되어 그 속을 부패 하게 하는 것 껍질 이제 \r\n깨버려 더러운 거짓의 껍질 이제 부셔버려 썩어 빠진 가식의 껍데기 이제 처음부터 다시 또 다시 \r\n어릴적 순수한 마음으로 다시 가식? 서로가 가진 진실 그대로 보이는 대로 느끼는 대로 서로의 진\r\n실 속으로 이제는 필요 없는 자기방어의 피로 더 이상의 피도 눈물도 NO MORE` 껍질을 벗고 있는 \r\n그대로 \r\n\r\nCHORUS *4</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131602, lowkey: nil, highkey: nil},
