  {album_id: 114, singer_id: 36, team_id: nil, title: "흔적", genre1: "OST", genre2: "드라마", runtime: "04:11", lyrics: "\n\t\t\t\t\t\t\t<div>흔적 - 04:11</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">두번 다시 사랑할 수 없어 내게 남겨놓은 흔적이 너무 크기에 \r\n잊으려고 방황했었지만 지울수가 없는 너의 깊은 그리움 \r\n왜 나만 슬퍼해야 하는 거니 나를 떠나간 너는 행복한데 \r\n더 이상 나를 사랑할 수 없다고 나도 모르게 이별을 준비한 너 \r\n\r\n날 버려 두지마 혼자선 견딜 수 없어 사랑했다면 다시 돌아와 줄 순 없는 거니 \r\n아무런 원망도 책임도 묻지 않을게 이젠 너 없이 살 수 없어 \r\n\r\n왜 나를 떠나야 했던 거야 혼자라는게 너는 행복하니 \r\n내가 얼마나 널 사랑했는데 내게 왜 이런 아픔을 주는거야 \r\n\r\n날 버려 두지마 혼자선 견딜 수 없어 사랑했다면 다시 돌아와 줄 순 없는 거니 \r\n아무런 원망도 책임도 묻지 않을게 이젠 너 없이 살 수 없어 \r\n\r\n사랑했었어 너만을 사랑한 거야 얼마나 내가 너를 그리워해야 하는 거니 \r\n아무런 원망도 책임도 묻지 않을게 다시 돌아와 내곁으로 \r\n이젠 정말 널 잊어야 하니 이 세상에 없는 내 사랑</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/350/15026350_1318580255490_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131615, lowkey: nil, highkey: nil},
