  {album_id: 114, singer_id: 36, team_id: nil, title: "삶", genre1: "OST", genre2: "드라마", runtime: "04:28", lyrics: "\n\t\t\t\t\t\t\t<div>삶 - 04:28</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">어떻게 해야 이 무거운 짐을 벗어버릴수 있을까 \r\n살아간다는 그 먼 여행속에서 나는 서있을 힘도 잃어버렸네 \r\n어떻게 해야 이 서러운 날 눈물이 마를수 있을까 \r\n살아간다는 그 긴 시간속에서 가슴아픈 사연들은 눈물되어흐르네 \r\n그러나 사랑은 한줄기 빛으로 다가와 내 오랜 생각들 지워버리고 \r\n또 추웠던 어둠의 세월 따뜻한 가슴으로 다시 살아나는데 \r\n\r\n어떻게 해야 이 서러운 날 눈물이 마를수 있을까 \r\n살아간다는 그 긴 시간속에서 가슴아픈 사연들은 눈물되어흐르네 \r\n그러나 사랑은 한줄기 빛으로 다가와 내 오랜 생각들 지워버리고 \r\n또 추웠던 어둠의 세월 따뜻한 가슴으로 다시 살아나는데</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/350/15026350_1318580255490_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131623, lowkey: nil, highkey: nil},
