  {album_id: 114, singer_id: 36, team_id: nil, title: "슬픈그림", genre1: "OST", genre2: "드라마", runtime: "04:25", lyrics: "\n\t\t\t\t\t\t\t<div>슬픈그림 - 04:25</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">끝내 사랑이란 거짓말도 어디에서 다른 꿈을 찾는지 그댈 \r\n내일이면 내게 돌아올께 하다 벌써 몇해 지나고 \r\n너무 어렸기에 할수 없었던 사랑이 떠난뒤에야 오 \r\n닫혀진 내마음을 열수 있는 사람 그대 알았죠 \r\n오늘도 난 그댈 기다리지만 그대가 원했던 사랑 이제야 알지만 \r\n우리의 추억을 슬픈 새 그림이 됐죠 \r\n\r\n잊지 않았겠지 그대 온이후 사랑이 시작된 이 곳도 \r\n떠나간 그대 쉴곳이 없을때 그때 여기 서있을께요 \r\n오늘도 난 그댈 기다리지만 그대가 원했던 사랑 이제야 알지만 \r\n우리의 추억을 슬픈 새 그림이 됐죠 \r\n\r\n시간이 지나 모든게 지워져 오 버리고 새롭게 다시 그려진대도 \r\n다음 그림엔 꼭 내곁에 그대만 \r\n오늘도 난 그댈 기다리지만 그대가 원했던 사랑 이제야 알지만 \r\n우리의 추억을 슬픈 새 그림이 됐죠 \r\n아직도 난 그댈 기억하지만 (Dont' cry) 그토록 원했던 사랑 오 \r\n그리려 했지만 오늘도 추억은 슬픈 새 그림이 됐죠 슬픈 새 그림이 됐죠</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/026/350/15026350_1318580255490_1_600x600.JPG", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131625, lowkey: nil, highkey: nil},
