  {album_id: 119, singer_id: 203, team_id: nil, title: "잘못된 기대 - 지나", genre1: "OST", genre2: "전체", runtime: "04:24", lyrics: "\n\t\t\t\t\t\t\t<div>잘못된 기대 - 지나 - 04:24</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">잠시라도 난 너를 잊지 못하고 언제까지나 긴시간 여기서 너만을 기다려 \r\n조금만 더 너의 곁에 가까이 살며시 다가가 속삭이고 싶어 \r\n\r\n내 마른 눈가에 찾아오는 그대의 모습이 나에겐 커다란 사랑으로 변해가고 있어 \r\n늘 잘못했다고 불안한 생각은 하지만 또다시 널 보면 기다리는 내자신이 싫어 \r\n잠시라도 난 너를 잊지 못하고 언제까지나 긴시간 여기서 너만을 기다려 \r\n조금만 더 너의 곁에 가까이 살며시 다가가 속삭이고 싶어 \r\n\r\n내 외로움 속에 들어오는 그대의 손길이 나에게 초라한 지난 날을 가려주고 있어 \r\n이루지 못하는 사랑이 생각은 하지만 나도 모르게 그대곁에 걸어가고 있어 \r\n잠시라도 난 너를 잊지 못하고 (waiting for you) 언제까지나 긴시간 여기서 너만을 기다려 (너만을 기다려) \r\n조금만 더 너의 곁에 가까이 (staying for you) 살며시 다가가 속삭이고 싶어 \r\n\r\n기나긴 사랑의 상처가 된다면 그뒤의 편안한 이별을 준비해 \r\nI want you 워우에이에 I need you 워우에이에 \r\n잠시도 난 너를 잊지 못하고 (waiting for you) 언제까지나 긴시간 여기서 너만을 기다려 (너만을 기다려) \r\n조금만 더 너의 곁에 가까이 (staying for you) 살며시 다가가 속삭이고 싶어</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131814, lowkey: nil, highkey: nil},
