  {album_id: 119, singer_id: 207, team_id: nil, title: "날 용서해 - Peter Lee", genre1: "OST", genre2: "전체", runtime: "05:09", lyrics: "\n\t\t\t\t\t\t\t<div>날 용서해 - Peter Lee - 05:09</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">이순간에 작은 손끝에서 밀려오는 마지막 느낌을 지우고 \r\n누구에게 순결하게 비친 내눈가에 눈물이 젖어오면 오 \r\n\r\n짧았던 시간속에 남겨진 끝을 잡고 소중했던 그 순간들을 떠올리며 나 가지만 \r\n내게서 멀어져가는 너를 바라보며 아무말없이 지켜보던 날 용서해 \r\n난 슬픈 미소를 띠며 안녕이라 말해도 그 순간보다 다시 만날 너를 기억해 \r\n\r\n눈을 뜨면 다시 찾아오는 네 빈자리가 내 마음 속에 머물고 \r\n누구에게 잃어버린 너의 떨러오는 숨결이 느껴질때 오 \r\n\r\n아직도 말 못했던 수많은 생각들은 돌아서는 너에게로 나 전해주고 싶지만 \r\n내게서 멀어져가는 너를 바라보며 아무말없이 지켜보던 날 용서해 \r\n난 슬픈 미소를 띠며 안녕이라 말해도 그 순간보다 다시 만날 너를 기억해 \r\n\r\n이제 진 긴 어둠이 눈을 감고 사라지면 널위해 돌아서며 떠나간 날 이해해줘 You know You say again \r\n내게서 멀어져가는 너를 바라보며 아무말없이 지켜보던 날 용서해 \r\n난 슬픈 미소를 띠며 안녕이라 말해도 그 순간보다 다시 만날 너를 기억해</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131819, lowkey: nil, highkey: nil},
