  {album_id: 121, singer_id: 211, team_id: nil, title: "너를 기다려", genre1: "OST", genre2: "전체", runtime: "03:52", lyrics: "\n\t\t\t\t\t\t\t<div>너를 기다려 - 03:52</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">그동안 많이 힘들었나요 정말 정말 미안해요 내눈에 비친 그대 모습도 더는 거짓일순 없겠죠 \r\nSay good bye 나 하나도 해준 게 없는데 내 사랑이 날 떠나가네요 또 이렇게 멀어져 가네요 \r\n수많았던 그 추억까지도 모두 버려두고 가네요 \r\n\r\nSay good bye 나 하나도 해준 게 없는데 내 마지막 사랑일거라고 나 그렇게 믿고 싶었는데 \r\n나 이제는 너 그리워하며 너의 뒷모습만 보네요 \r\n\r\n워우워 워우워 사랑했어요 Say good bye 내 사랑이 날 떠나가네요 또 이렇게 멀어져 가네요 \r\n수 많았던 그 추억까지도 모두 버려두고 가네요 언제까지 너를 기다려</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131926, lowkey: nil, highkey: nil},
  {album_id: 121, singer_id: 212, team_id: nil, title: "안녕", genre1: "OST", genre2: "전체", runtime: "03:42", lyrics: "\n\t\t\t\t\t\t\t<div>안녕 - 03:42</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">지금 이런 나를 기억해 너를 보내는 날 기억해\r\n그냥 떠나버린 너에게 아무런 말도 해줄 수 없었어\r\n\r\n너무 익숙해져 버려서 그게 사량인줄 몰랐어\r\n나를 떠나버린 사랑이 이젠 두눈에 눈물로 남았어\r\n\r\n하루 지나 또 하루가 가면 그땐 너를 잊을 수 있을까\r\n사랑해 사랑해 말해지 못했던 널 보내야만해 안녕\r\n\r\n아무일도 없는 것처럼 너의 행복을 빌어줄게\r\n내게 웃어주는 너에게 이런 내모습 보일 수 없잖아\r\n\r\n하루 지나 또 하루가 가면 그땐 너를 잊을 수 있을까\r\n사랑해 사랑해 말하지 못했던 널 보내야만해 \r\n\r\n사랑해 사랑해 말하지 못했던 널 보내야만해 ~~ 안녕</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131927, lowkey: nil, highkey: nil},
  {album_id: 121, singer_id: 213, team_id: nil, title: "거침없는 사랑", genre1: "OST", genre2: "전체", runtime: "04:29", lyrics: "\n\t\t\t\t\t\t\t<div>거침없는 사랑 - 04:29</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">달리는 차창밖으로 비가 내리고 낯설지 않은 음악소리 멀리서 들려 그리움은 아닌데 왠지 눈물이 나네 \r\n길고 긴 시간 흐른 뒤 마주친 그대 다시또 아픈 그날처럼 보낼 순 없어 그대 진한 향기에 돌아선다 \r\n우연히 멀리서 그대 바라볼 때면 그대곁에 서기 어렵겠지만 기약없는 그곳으로 보내긴 싫어 이젠 나를 떠나지 말아요 \r\n\r\n우연히 멀리서 그대 바라볼 때면 그대곁에 서기 어렵겠지만 기약없는 그곳으로 보내긴 싫어 이젠 나를 떠나지 말아요 \r\n조금씩 잊혀지겠지 아픈 기억들 창밖을 보면 하염없이 비는 내리고 내품으로 그대를 안고 싶어</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131928, lowkey: nil, highkey: nil},
  {album_id: 121, singer_id: 213, team_id: nil, title: "너에게", genre1: "OST", genre2: "전체", runtime: "03:59", lyrics: "\n\t\t\t\t\t\t\t<div>너에게 - 03:59</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">너에게 다가서긴 힘들다고 난 생각해왔어 하지만 나도모르게 내마음은 어느새 너에게 \r\n참으려했지만 지우려했지만 지금의 내맘은 막을수가 없어 어떤 약속도 그 어떤 얘기도 \r\n상처가 된다는 것을 알지만 내속에 커져만 가는 사랑은 언제까지 간직할께 \r\n\r\n우연히 만난 사람도 매일보는 그어떤 사람도 그렇게 사랑하기엔 오랫동안 고민을 하겠지 \r\n믿으려하지만 참으려하지만 지금의 내맘은 막을수 없어 어떤 약속도 그 어떤 얘기도 \r\n상처가 된다는 것을 알지만 내속에 커져만 가는 사랑은 언제까지 간직할께 \r\n\r\n워 언젠가는 너를 위해 모두 할수 있다는 그런 믿음만으로 살아온거야 \r\n어떤 약속 그 어떤 얘기도 상처가 된다는 것을 알지만 내속에 커져만 가는 사랑은 언제까지 간직할께</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131929, lowkey: nil, highkey: nil},
  {album_id: 121, singer_id: 212, team_id: nil, title: "내가 하는 이별", genre1: "OST", genre2: "전체", runtime: "04:37", lyrics: "\n\t\t\t\t\t\t\t<div>내가 하는 이별 - 04:37</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">잘될꺼야 내마음은 널 포기할 수 없도록 소중하니 믿고있어 흔들리는 널 잡아줄 수 있는 건 나라는걸 믿고 있어 \r\n예전부터 오랫동안 너 하나만을 지켜본 나이지만 단 하루라해도 너만의 내가 될 수 없다는 친구인걸 알고 있어 \r\n구식일꺼야 알아 답장도 없는 일기 같은 편지들을 보낸 시간이 너무 힘들어 항상 곁에 있지만 네 맘을 가질순 없잖아 \r\n처음부터 사랑했어 하지만 난 널 미워도 했어 혹시라도 내가 짐이 될까봐 아쉬운 내맘 숨기려했어 \r\n\r\n구식일꺼야 알아 뒷모습 보며 나도 몰래 웃곤 하던 지난 시간이 사랑한만큼 이밤 기대한만큼 오늘도 이별하려해 \r\n처음부터 사랑했어 하지만 난 널 미워도 했어 혹시라도 내가 짐이 될까봐 내안에 네가 있다고 말할 순 없어 \r\n떠나야만 하는걸까 아쉬움은 잠시뿐일거야 사랑해도 너를 보내야해도 언제나 행복해야돼 너는 부디</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131930, lowkey: nil, highkey: nil},
