  {album_id: 122, singer_id: 214, team_id: nil, title: "Song From The Snow (Korean)", genre1: "OST", genre2: "한국영화", runtime: "04:43", lyrics: "\n\t\t\t\t\t\t\t<div>Song From The Snow (Korean) - 04:43</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">오른손은 위로 왼손은 아래로 끝까지 뻗어봐요 춤을 춰요 Come on! Dance for me 발이 가고 싶은 대로 \r\none two step 하얀 리듬에 맞춰 춤을 춰요 감쪽 같은 몸짓의 묘한 마술처럼 내 맘 창가에 그려보던 세상이 눈 앞에 펼쳐질 것 같아 오늘 밤 설레이는 발걸음을 살짝 올려요\r\nDance for me rhythm of snow If you dance you'll be the stars of the snow 다시 태어나는 느낌이야 \r\n세상 저 하늘 끝까지 날 수 있도록 하늘 보고 웃어 봐\r\n\r\n시계방향으로 빙글 돌아봐 거꾸로 또 한 바퀴 춤을 춰요 Come on! Dance for me 가슴 탁 트이게노래 불러봐 나만이 낼 수 있는 목소리로 사랑을 키워주는 멋진 주문처럼\r\n내 맘 가득히 꿈꿔왔던 사랑이 내 곁에 찾아올 것 같아 오늘 밤 소리 없이 그대 품 속에 안겨요 (반복)\r\n오른손은 위로 오니손은 아래로 끝까지 뻗어봐요 춤을 춰요 Come on! dance for me</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16131940, lowkey: nil, highkey: nil},
