  {album_id: 125, singer_id: 220, team_id: nil, title: "그리운 얼굴", genre1: "OST", genre2: "전체", runtime: "03:35", lyrics: "\n\t\t\t\t\t\t\t<div>그리운 얼굴   - 03:35</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">눈부신 아침 햇살에 산과 들 눈뜰때\r\n그 맑은 시냇물 따라\r\n내 마음도 흐르네 가난한 이 마음을\r\n당신께 드리리\r\n황금 빛 수선화 일곱송이도\r\n\r\n긴 하루 어느덧 가고 황혼이 물들면\r\n집찾아 돌아가는 작은 새들 보며 \r\n조용한 이 노래를 당신께 드리리\r\n황금 빛 수선화 일곱송이도\r\n\r\nI may not have mansion\r\nI haven't any land\r\nnot even a paper dollar\r\nto crinkle in my hand\r\n\r\nbut I can show you morning\r\non a thousand hills\r\n*and kiss you and give you\r\nseven daffodils*\r\n\r\nI do not have a fortune\r\nto buy pretty things\r\n\r\nbut I can weave moon beams\r\nfor necklaces and rings\r\n\r\nbut I can show you moning\r\non a thousnad hills</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16132147, lowkey: nil, highkey: nil},
