  {album_id: 126, singer_id: 221, team_id: nil, title: "Two Face", genre1: "OST", genre2: "드라마", runtime: "03:46", lyrics: "\n\t\t\t\t\t\t\t<div>Two Face - 03:46</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">쉬워보였니 나는 그렇게 내가 잘못했니 설명을 해봐 \r\n우리헤어지는게 쉽지 않다는거 너도 알잖아 \r\n널 기억속에 묻어버린채 잊으려고 해봤지만 그럴수 없는 내가 미워져 \r\n이젠 믿을수 없어 나를 외면하는 너의 눈빛을 다 거짓이라는 \r\n행복했다는 위로만으로 날 떠나버린 너 기다리며 \r\n\r\n내생각 모두 지워갈래도 가끔은 눈물이 날지도 몰라 \r\n그리 쉽진 않지만 잊혀지기만을 바랬었잖아 \r\n널 기억속에 묻어버린채 잊으려고 해봤지만 그럴수 없는 내가 미워져 \r\n이젠 믿을수 없어 나를 외면하는 너의 눈빛을 다 거짓이라는 \r\n행복했다는 위로만으로 날 떠나버린 너 기다리며 \r\n\r\nRAP] 너 이렇게 나 깨닫줄은 몰랐어 \r\n너 언제까지 함께 할 줄 알았어 \r\n다시 불꽃같은 너의 대한 환상속에 만든 우상 \r\n그리고 나를 슬프게 하는 나만의 사상 \r\n이제 모두다 필요없어 떠나가 \r\n이제 모두다 남김없이 가져가 다시 볼 수 없어도 \r\n나는 후회없어 하지만 가식적인 너의모습 TOW FACE \r\n\r\n다 거짓이였니 나를 위해 흘린 너의 눈물도 모두 잊어줄게 \r\n실수였다고 후회한대도 더이상 내겐 넌 없을 테니깐 \r\n이젠 믿을수 없어 나를 외면하는 너의 눈빛을 다 거짓이라는 \r\n행복했다는 위로만으로 날 떠나버린 너 기다리며</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16132180, lowkey: nil, highkey: nil},
  {album_id: 126, singer_id: 221, team_id: nil, title: "멀기만 한 사랑", genre1: "OST", genre2: "드라마", runtime: "04:21", lyrics: "\n\t\t\t\t\t\t\t<div>멀기만 한 사랑 - 04:21</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">두번다시 볼수없을거 같은 그대모습 나 참아 볼수없어서 \r\n감쳐두기만 했던 아픈 내사랑을 이대로 남아 나를 힘들게해 \r\n\r\n안녕이란 위선만을 남긴채 그렇게 넌 내곁을 떠나가지만 \r\n여전히 남아있는 우리의 기억들 닿을 수 없는 먼 하늘만 보네 \r\n너무 늦어버린 거라고 마음에 남겨진 말들이 \r\n내게 약속해줘 나 모르게 울지않기를 이젠 준비할께 \r\n난 괜찮을꺼야 남은 숨이 다해도 \r\n영원히 너만을 위한사랑 그것만으로도 행복했었다고 말할꺼야 \r\n\r\n안녕이란 위선만을 남긴채 그렇게 넌 내곁을 떠나가지만 \r\n여전히 남아있는 우리의 기억들 닿을 수 없는 먼 하늘만 보네 \r\n너무 늦어버린 거라고 마음에 남겨진 말들이 \r\n내게 약속해줘 나 모르게 울지않기를 이젠 준비할께 \r\n난 괜찮을꺼야 남은 숨이 다해도 \r\n영원히 너만을 위한사랑 그것만으로도 행복했었다고 한순간이라도 \r\n남은 숨이 다해도 영원히 너만을 위한사랑 \r\n그것만으로도 행복했었다고 말할꺼야</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16132181, lowkey: nil, highkey: nil},
  {album_id: 126, singer_id: nil, team_id: 65, title: "멜로 드라마 (Original Ver.)", genre1: "OST", genre2: "드라마", runtime: "04:26", lyrics: "\n\t\t\t\t\t\t\t<div>멜로 드라마 (Original Ver.) - 04:26</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">노랗게 물든 머리 \r\n내일이 없는 날들 \r\n반복된 시간 속에 \r\n우연히 너를 알게 되고 사랑을 알게 됐지 \r\n너를 만나기 위해 내 모든 것을 버렸어 \r\n하지만 사람들은 소중한 너와 나의 친구를 다 데려가버렸지 \r\n너와 함께 한 시간 한 순간에 꿈처럼 \r\n너무도 쉽게 끝나버렸지만 \r\n네가 있는 곳으로 나도 가야하는 건 \r\n네가 내 모든 것을 다 가져갔기 때문에 \r\n\r\n방황했던 나의 어제 \r\n떳떳치 못한 생활 \r\n힘겹던 내 삶에서 내일을 포기한 나에게 넌 희망을 주었지 \r\n너를 위해서라면 무엇이든 해야 했어 하지만 \r\n사람들은 나의 작은 꿈 하나까지도 가만히 두질 않아 \r\n너와 함께 한 시간 한 순간에 꿈처럼 \r\n너무도 쉽게 끝나버렸지만 \r\n네가 있는 곳으로 나도 가야 하는 건 \r\n네가 내 모든 것을 다 가져갔기 때문에 \r\n\r\n워 너와 함께 한 시간 한 순간에 꿈처럼 \r\n너무도 쉽게 끝나버렸지만 \r\n네가 있는 곳으로 나도 가야 하는 건 \r\n네가 내 모든 것을 다 가져갔기 때문에</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16132182, lowkey: nil, highkey: nil},
