  {album_id: 126, singer_id: 222, team_id: nil, title: "슬픔 속에 그댈 지워야만 해", genre1: "OST", genre2: "드라마", runtime: "04:23", lyrics: "\n\t\t\t\t\t\t\t<div>슬픔 속에 그댈 지워야만 해 - 04:23</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">창가에 불어오는 가을 바람은 텅빈 마음을 스쳐가는데 \r\n차가워진 벽에 기대어 멀리 밝아오는 새벽하늘 바라보곤해 \r\n보고 싶지만 가까이 갈 수 없어 이제 그대곁을 떠나가야 해 \r\n외로웠었던 나의 메마른 그 두눈에 크고 따뜻한 사랑을 주었던 \r\n*그대곁을 이제 떠나는 것을 후회 할 지도 모르지만 \r\n그대 사랑하기 때문이야 그대만을 사랑하는 걸 \r\n잊을 수는 없지만 슬픔속에 그댈 지워야만 해 \r\n\r\n눈부신 햇살아래 많은 사람들은 웃음지며 걷고 있지만 \r\n차갑게만 느껴지는 가을하늘처럼 온 세상이 낯설게 보여 \r\n사랑하지만 떠날 수 밖에 없어 지금 이 순간이 너무 힘들어 \r\n어두웠지만 나는 알 수 있었어 그대 눈가에 흐르는 눈물을 \r\n난 그대에게 상처만을 주지만 \r\n언젠간 내마음을 이해할 수 있겠지. \r\n\r\n*그대곁을 이제 떠나는 것을 후회 할 지도 모르지만 \r\n그대 사랑하기 때문이야 그대만을 사랑하는 걸 \r\n잊을 수는 없지만 사랑하는 그대여 안녕</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16132184, lowkey: nil, highkey: nil},
  {album_id: 126, singer_id: 221, team_id: nil, title: "마지막 부탁", genre1: "OST", genre2: "드라마", runtime: "03:41", lyrics: "\n\t\t\t\t\t\t\t<div>마지막 부탁 - 03:41</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">웃어줘 날위해 마지막 내부탁을 들어줘 \r\n슬픔을 느낄 시간이 없는걸 너는 아직 모르고있니 \r\n잊어줘 괜찮아 우리했던 모든 약속들 \r\n함께 했었던 짧은 그 순간은 모두 내가 가져갈께 \r\n\r\n한번도 생각해본 적 없어 \r\n사랑한다는 건 어두운 골목을 떠돌며 살아온나니깐 \r\n하루하루 의미없는 날이였지만 \r\n너는 내게 살아가야할 이유를 준거야 \r\n웃어줘 날위해 마지막 내부탁을 들어줘 \r\n슬픔을 느낄 시간이 없는걸 너는 아직 모르고있니 \r\n잊어줘 괜찮아 우리했던 모든 약속들\r\n함께 했었던 짧은 그 순간은 모두 내가 가져갈께 \r\n\r\n얼마나 오래 함께해야만 사랑이라는가 \r\n너무 짧은 시간이였지만 내겐 영원한걸 \r\n너는 아무 슬픔 없이 살아가야해 \r\n이제 그만 돌아서 갈께 울음이 터지려해 \r\n웃어줘 날위해 마지막 내부탁을 들어줘 \r\n슬픔을 느낄 시간이 없는걸 너는 아직 모르고있니 \r\n잊어줘 괜찮아 우리했던 모든 약속들 \r\n함께 했었던 짧은 그 순간은 모두 내가 가져갈께 \r\n\r\n웃어줘 날위해 마지막 내부탁을 들어줘 \r\n슬픔을 느낄 시간이 없는걸 너는 아직 모르고있니 \r\n잊어줘 괜찮아 우리했던 모든 약속들 \r\n함께 했었던 짧은 그 순간은 모두 내가 가져갈께 \r\n웃어줘 날위해 마지막 내부탁을 들어줘 \r\n슬픔을 느낄 시간이 없는걸 너는 아직 모르고있니 \r\n잊어줘 괜찮아 우리했던 모든 약속들 \r\n함께 했었던 짧은 그 순간은 모두 내가 가져갈께</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16132185, lowkey: nil, highkey: nil},
  {album_id: 126, singer_id: 221, team_id: nil, title: "Memory (Rock Ver.)", genre1: "OST", genre2: "드라마", runtime: "04:04", lyrics: "\n\t\t\t\t\t\t\t<div>Memory (Rock Ver.) - 04:04</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">기다려줘 너에게 갈수 있게 \r\n이런 모습을 사랑하는 건 어렵겠지만 \r\n나는 달라질꺼야 \r\n너를 위해 무슨 일이든 \r\n이겨낼수가 있어 너를 위해 모든걸 \r\n난 언제나 우리가 함께 하길 바랬어 \r\n그 힘든 시간에도 너와 나 헤어지지 않도록 \r\n난 네게 부족한걸 알아 순수한 너를 바라보면서 \r\n자신 없는 사랑을 보였던 날 용서해 \r\n힘들게 한번 나라는건 무너진 믿음뿐이란걸 \r\n놓아줄께 너를 위한거야 \r\n너무나도 사랑해 \r\n\r\n기억해죠 내게는 전부였던 너의 그 미소 \r\n해맑게 웃던 착한 그 눈은 \r\n세상 끝날이와도 변하지 않을거란 믿어 \r\n그건 내 기억속에 너의 모습일꺼야 \r\n\r\n부탁할께 이런 말 네게 하기 싫었어 \r\n너무 미안하지만 이제는 나를 잊어주겠니 \r\n난 네게 부족한걸 알아 순수한 너를 바라보면서 \r\n자신 없는 사랑을 보였던 날 용서해 \r\n힘들게 한번 나라는건 무너진 믿음뿐이란걸 \r\n놓아줄께 너를 위한거야 \r\n너무나도 사랑해 \r\n\r\n그렇게 난 너 하나뿐야 \r\n너 없는 내일 두렵긴 해도 \r\n믿어줄래 변함없이 너만을 사랑해 \r\n약속해 언제까지라도 \r\n나에 마지막 그 날이 와도 \r\n간직할께 가슴 깊은 곳에 \r\n너와 나의 사랑을</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16132186, lowkey: nil, highkey: nil},
