  {album_id: 127, singer_id: 223, team_id: nil, title: "혁의 Theme", genre1: "OST", genre2: "전체", runtime: "02:54", lyrics: "\n\t\t\t\t\t\t\t<div>혁의 Theme - 02:54</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">진다래 다래야! \r\n니이름 처음 불러보는것 같다. \r\n\r\n감귤 쟁반 덜렁이그게 니 이름이었으니까 \r\n언제부턴가 니 잔소리가 익숙해지기시작했어 \r\n엄마돌아가시고 참 오랜만이었지 고맙다. \r\n내앞에 나타나줘서.. \r\n\r\n만약에 내가 널 힘들게 하거나 실망시키더라도 \r\n그때도 너 내곁에 있어줄수 있겠니?</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16132204, lowkey: nil, highkey: nil},
  {album_id: 127, singer_id: nil, team_id: 68, title: "Dream", genre1: "OST", genre2: "전체", runtime: "04:26", lyrics: "\n\t\t\t\t\t\t\t<div>Dream  - 04:26</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">It's all right \r\n뭐라고 말해도 이 순간만은 이렇게 있고 싶어 너의 곁에 \r\none like fire two like a dreamming \r\n\r\n아직도 모르니 이렇게 너만을 오늘 하루도 하루같이 지켰는데 \r\n마주쳐가는 순간도 싸늘하게 날 스쳐만 갔어 \r\n\r\n어쩌다 불러도 차갑게 화내지 뭐라고 말을 해도 같았지 \r\n어떻게 된 일일까 오늘밤은 웃음을 보이는데 \r\n\r\nfall in love, tonight... \r\n기다렸던 사랑을 꿈을 꾸던 그대로 마주보며 \r\n이제는 괜찮아 아무래도 소용없어 다시 날 미워해도 \r\n\r\nIt's all right \r\n뭐라고 말해도 이 순간만은 이렇게 있고 싶어 너의 곁에 \r\n\r\nIt's all right \r\n다 할 순 없겠지만 이렇게 바라 볼 수 있다면 좋아 \r\none like fire two like a dreamming \r\n\r\nIt's all right \r\n어려운 모습에 다가설 수 없어 그저 난 꿈으로만 느꼈지 \r\n하지만 이렇게 널 마주했어 믿을 수 없을거야 \r\n\r\nfall in love, tonight... \r\n기다렸던 사랑을 꿈을 꾸던 그대로 마주보며 \r\n이제는 괜찮아 아무래도 소용없어 다시 날 미워해도 \r\n\r\nIt's all right \r\n어쩌면 지금이 가슴 가득히 새겨진 나의 착각이라해도 \r\n\r\nIt's all right \r\n이대로 머물러줘 이렇게 바라볼 수 있다면 좋아 \r\n\r\nIt's all right \r\n어쩌면 지금이 가슴 가득히 새겨진 나의 착각이라해도 \r\n\r\nIt's all right \r\n이대로 머물러줘 이렇게 바라볼 수 있다면 좋아</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16132205, lowkey: nil, highkey: nil},
