  {album_id: 127, singer_id: 227, team_id: nil, title: "Island", genre1: "OST", genre2: "전체", runtime: "03:26", lyrics: "\n\t\t\t\t\t\t\t<div>Island - 03:26</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">그곳은 저 먼 나라 \r\n눈부신 빛의 나라 \r\n하늘빛 바다와 그 푸른날의 꿈 \r\n천사의 낮은 속삭임 \r\n\r\nYOU DON'T BELEVE THIS WOULD \r\nSO YOU CAN GO THERE \r\nYOU DON'T BELEVE THIS WOULD \r\nYOU LIFE \r\n\r\n오래전 얘기지 \r\n그 오래전 저바다 그 어딘가에 있는나라 \r\n마음의 준을 뜨면 찾을수 있는 나라 \r\n황금빛 모래와 그 노을속의 꿈 \r\n마음의 눈을 뜬 후에야 \r\n\r\nYOU DON'T BELEVE THIS WOULD SO \r\nYOU CAN SEE \r\nYOU DON'T BELEVE THIS WOULD SO \r\nYOU CAN BELEVE \r\n\r\n하늘과 가까운 그 어디에 \r\n어딘가에 있는 꿈 어딘가에 \r\n그곳은 저 먼나라 \r\n눈부신 빛의나라 하늘빛 바다와 \r\n그 푸른 날의 꿈 \r\n천사가 전해준 속삭임 \r\n천사가 전해준 속삭임</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16132207, lowkey: nil, highkey: nil},
