  {album_id: 127, singer_id: nil, team_id: 68, title: "내안의 너 (Drama Ver.)", genre1: "OST", genre2: "전체", runtime: "03:34", lyrics: "\n\t\t\t\t\t\t\t<div>내안의 너 (Drama Ver.) - 03:34</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">소리없이 다가와 미소짓는 모습 \r\n어느샌가 내곁에서 머물고 있어 \r\n얼마나 놀랐었는지 니 모습 내 안에 가득차 \r\n\r\n어둠속에 지나온 수많은 날들 \r\n너로인해 잠시라도 있을수 있어 \r\n고마워, 너무 감사해 \r\n지금 이순간 영원하길 바래 \r\n\r\n사랑해 힘겨운 만큼 널 원한다면 \r\n받아주겠니 어떤 미래보다 더 \r\n난 니가 필요해 \r\n\r\n부드럽게 감싸는 따스한 손길 \r\n혼자있는 내게 남은 소중한 기억 \r\n끝 처럼 희미하지만 알수가 있어 \r\n그때 너란 것을 \r\n\r\n사랑해 힘겨운 만큼 널 원한다면 \r\n받아주겠니 어떤 미래보다 더 \r\n난 니가 필요해 \r\n\r\n사랑해 힘겨운 만큼 널 원한다면 \r\n받아주겠니 어떤 미래보다 더 \r\n난 니가 필요해 \r\n\r\n울지마 마음 깊은곳 널 새겨둔채 \r\n언제까지나 너의 모습 영원히 \r\n날 지킬테니</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16132210, lowkey: nil, highkey: nil},
  {album_id: 127, singer_id: nil, team_id: 66, title: "Loving You (Inst.)", genre1: "OST", genre2: "전체", runtime: "01:52", lyrics: "\n\t\t\t\t\t\t\t<div>Loving You (Inst.) - 01:52</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">너만을 사랑할게 내모든걸 다 바쳐 네게 \r\n다시 날 보여줄게 숨겨왔던 마이 러빙유 \r\n아무 의미 없었던 나의 삶에 달콤한 너의 눈빛은 \r\n나를 깨웠어 그런 네게 빠졌어 \r\n하얀 파도처럼 부서져 내맘속에 들어온거야 \r\n\r\n바다와 같은 마음으로 너를 안을게 \r\n너만을 사랑할게 내모든걸 다 바쳐네게 \r\n다시 날 보여줄게 숨겨왔던 마이 러빙유 \r\n\r\n잠시 너무 지쳐서 세상속에 슬프도록 너를 혼자뒀어 나 \r\n미안해 이젠 너를 지킬게 \r\n아무것도 두렵지않아 다신 널 놓지 않을꺼야 \r\n내게 허락된 사랑이란 오직 너니까 \r\n\r\n너만을 사랑할게 내모든걸 다 바쳐네게 \r\n다시 날 보여줄게 숨겨왔던 \r\n\r\n너만을 사랑할게 내모든걸 다 바쳐네게 \r\n다시 날 보여줄게 숨겨왔던 마이 러빙유 \r\n러빙유~ 러빙유~</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16132211, lowkey: nil, highkey: nil},
