  {album_id: 128, singer_id: 232, team_id: nil, title: "몇년이 흘러", genre1: "OST", genre2: "전체", runtime: "05:08", lyrics: "\n\t\t\t\t\t\t\t<div>몇년이 흘러 - 05:08</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">너의 눈속에 살아 숨쉬고 있는 내모습 \r\n시간속에서 점점더 변해가네 \r\n헤어진지도 벌써 몇년이 흘러 \r\n이제는 너의 웃음도 부서져만 가네 \r\n우리사인 언제나 기울어진 사랑 \r\n아무일 없듯 서로 멀어졌지만 \r\n수많었던 날 속에 단한번도 없었어 \r\n내맘속에 가득히 남은 널 지워줄 사람 \r\n지난날의 널 찾아 꿈속으로 들어가 \r\n다시만날 그날까지 날 잊지 말아줘 \r\n\r\n웃음짓던 날들도 어긋났던 사랑 \r\n서로 숨겨온 안타까온 시간들 \r\n수많었던 날 속에 단한번도 없었어 \r\n내맘속에 가득히 남은 널 지워줄 사람 \r\n지난날의 널 찾아 꿈속으로 들어가 \r\n다시 만날 그날까지 날 잊지 말아줘 그대</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16132241, lowkey: nil, highkey: nil},
  {album_id: 128, singer_id: 233, team_id: nil, title: "사랑하면서도", genre1: "OST", genre2: "전체", runtime: "04:17", lyrics: "\n\t\t\t\t\t\t\t<div>사랑하면서도 - 04:17</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">사랑한다는 그 말을 못하고 \r\n내가 먼저 헤어지잔 말을 했지만 \r\n흐르는 눈물만은 참을 수가 없어서 \r\n결국 니 앞에서 고개숙였지 \r\n가지말라는 그 말도 못하고 \r\n끝내 이렇게 나 돌아서야 했지만 \r\n너를 향한 마음은 지울 수 없어서 \r\n나 혼자 술을 마셨어 \r\n\r\n언젠가 나보다 더 좋은 사람 만나야 한다고 \r\n늘 생각했었어 \r\n사랑한단 이유로 널 붙잡고 있는 \r\n이기적인 나의 마음이 너무 싫었던거야 \r\n나를 만나고 나서부터 많이 힘들어 했단걸 알아 \r\n이젠 보내야 한다고 생각한거야 \r\n\r\n눈물이 나고 마음이 여려서 \r\n작은 일에도 자주 울었던 너였지 \r\n환하게 웃는 모습 너무나 사랑스러 \r\n넌 좋은사람 만나서 행복해야해 \r\n\r\n후회할지도 몰라 사랑하면서도 \r\n이렇게 널 보내야하는 나의 마음을 \r\n죽을만큼 힘드냐고 마지막으로 \r\n내가 널위해 해줄 수 있는 일은 널 잊는 것뿐야 \r\n후회할지도 몰라 사랑하면서도 \r\n어쩔수 없이 널 잊어야하는 나의 마음을 \r\n언젠가 돌아올꺼라 그렇게 믿고 살아가는 나 \r\n잘못된 그 믿음을 지키고 있어</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16132242, lowkey: nil, highkey: nil},
