  {album_id: 134, singer_id: 241, team_id: nil, title: "비망", genre1: "OST", genre2: "전체", runtime: "03:43", lyrics: "\n\t\t\t\t\t\t\t<div>비망 - 03:43</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">『비망』- 강우진\r\n\r\n항상 같은 눈빛으로 그대가 나를 보나요 \r\n참을수록 깊어지는 \r\n슬픔을 감추려 하나요 \r\n처음 봤던 그대의 미소를 다시 볼수 있다면 \r\n이순간이 영원할 것 처럼 내맘을 달랠수 있는데..... \r\n\r\n아무 걱정도 하지 말아요 \r\n그대 잘못은 없으니 \r\n다음세상에 만나게 되면 \r\n그땐 그대가 먼저 날 찾겠죠 \r\n이렇게 날 보내지 말아요 \r\n그댈 위해 살수 있도록 \r\n\r\n(반주) \r\n\r\n아무 걱정도 하지 말아요 \r\n그대 잘못은 없으니 \r\n다음세상에 만나게 되면 \r\n그땐 그대가 먼저 날 찾겠죠 \r\n이렇게 날 보내지 말아요 \r\n그댈 위해 살수 있도록~ \r\n</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 10385, song_num: 16132411, lowkey: nil, highkey: nil},
