  {album_id: 134, singer_id: 241, team_id: nil, title: "세상 끝까지", genre1: "OST", genre2: "전체", runtime: "04:07", lyrics: "\n\t\t\t\t\t\t\t<div>세상 끝까지 - 04:07</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">세상이 나를 이렇게 외면한대도 하늘은 나에게 슬픔을 안겨도 \r\n나에겐 한가지 네가 있다는 이유로 난 행복할 수 있으니 \r\n\r\n난 이제 가고 있잖아 네게 저 험한 세상을 건너 \r\n나 이제까지 단 한번도 그 누굴 위해서 눈물 흘린 적 없었지만 \r\n\r\n이제 세상 끝에 서있는 너를 위해서 내 모든 걸 던져 \r\n나 오직 한 사람을 향한 내 마음 나 그것 하나로 모든 걸 \r\n이겨낼 수 있으니 나 언젠가 그대 앞에 서는 그 날을 꿈꾸며~ \r\n오늘도 이렇게 난 웃음질 수 있는 거야 \r\n\r\n난 이제 가고 있잖아 네게 저 험한 세상을 건너 \r\n나 이제까지 단 한번도 이 내마음속에 간직해본 적 없었지만 \r\n\r\n이제 세상 끝에 서있는 너의 곁으로 내 모든 걸 던져 \r\n나 언젠가 네 품에 눈 감는 그 날을 꿈꾸며 오늘도 이렇게 난 살아갈 수 있는 거야</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16132413, lowkey: nil, highkey: nil},
  {album_id: 134, singer_id: 241, team_id: nil, title: "내안의 사랑", genre1: "OST", genre2: "전체", runtime: "02:39", lyrics: "\n\t\t\t\t\t\t\t<div>내안의 사랑 - 02:39</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가사 정보가 없습니다.</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16132414, lowkey: nil, highkey: nil},
  {album_id: 134, singer_id: 241, team_id: nil, title: "화신", genre1: "OST", genre2: "전체", runtime: "03:38", lyrics: "\n\t\t\t\t\t\t\t<div>화신 - 03:38</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">알수 없는 곳으로 달려 가고 있었지 그대 슬픈 눈으로 나를 지우려하니 \r\n다시 돌아갈수 없어도 후회하지 않으리 이런 나를 보며 슬퍼마요 날 믿어요 내 사랑을 \r\n약속해요 지금 이순간에 숨이 멈춰도 나 그대 곁에서 떠나지 않아요 \r\n그 모습속에 헤매인다 해도 난 그댈 지켜요 영원히 \r\n\r\n기억하지 않아도 잊혀지지 않으리 얼음처럼 차가운 아픔으로 나가리 \r\n다시 돌아갈수 없어도 후회하지 않으리 이런 나를 보며 슬퍼마요 날 믿어요 내 사랑을 \r\n약속해요 지금 이순간에 숨이 멈춰도 나 그대 곁에서 떠나지 않아요 \r\n그 모습속에 헤매인다 해도 난 그댈 지켜요 영원히</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16132415, lowkey: nil, highkey: nil},
  {album_id: 134, singer_id: 241, team_id: nil, title: "또 다른 날을 위해", genre1: "OST", genre2: "전체", runtime: "05:03", lyrics: "\n\t\t\t\t\t\t\t<div>또 다른 날을 위해 - 05:03</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가사 정보가 없습니다.</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16132416, lowkey: nil, highkey: nil},
  {album_id: 134, singer_id: 241, team_id: nil, title: "푸른 문신", genre1: "OST", genre2: "전체", runtime: "04:36", lyrics: "\n\t\t\t\t\t\t\t<div>푸른 문신 - 04:36</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">나를 부르는 바람 소리에 난 어둠 속을 달리네 \r\n멀어져 가는 그대 향기처럼 내 슬픔만이 남아 있었지 \r\n\r\n이제는 그대를 돌려 보내요 머물 수도 없는 바람 속으로 흩어지는 사랑을 \r\n다시 그대 곁에 갈 수 없는 나의 마음을 가슴 속에 묻어둬요 \r\n아주 멀리서만 그댈 바라볼 수 있는 날 용서해요 내 사랑을 \r\n\r\n지울 수 없는 푸른 빛으로 그댈 새겨 두었죠 \r\n살아있는 한 아픔이라 해도 나 그댈 간직할 수 있으니 \r\n\r\n이제는 그대를 돌려 보내요 머물 수도 없는 바람속으로 흩어지는 사랑을 \r\n다시 그대 곁에 갈수 없는 나의 마음을 가슴 속에 묻어둬요 \r\n아주 멀리서만 그댈 바라볼 수 있는 날 용서해요 내 사랑을 \r\n\r\n이 세상에는 이뤄질수 없어도 언제나 꿈을 꾸어요 \r\n푸른 상처가 남겨지지 않도록 내 곁으로 돌아와요요</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16132417, lowkey: nil, highkey: nil},
