  {album_id: 134, singer_id: 241, team_id: nil, title: "지금은", genre1: "OST", genre2: "전체", runtime: "04:05", lyrics: "\n\t\t\t\t\t\t\t<div>지금은 - 04:05</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">아마도 내 사랑은 그리움이 전부이었나 단한번도 마음껏 그대를 사랑할수 없네 \r\n그댈위해서 떠나야겠죠 그것만이 내가 해줄수 있는 운명의 선물이라면 \r\n슬퍼말아요 내가 있는한 저 하늘이 그대 어디 있는지 가르쳐 줄테니까 지금은 날 잊어요 \r\n\r\n그리움이 다하고 눈물마저 사라진뒤에 마음속에 날 찾아보아요 내 모습 보일테니 \r\n잊지 않아요 그대 있는 한 이세상을 내가 살아있는 한 난 그대 전부라는걸 \r\n슬퍼말아요 내가 있는한 저 하늘이 그대 어디 있는지 가르쳐 줄테니까 지금은 날 잊어요</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16132420, lowkey: nil, highkey: nil},
  {album_id: 134, singer_id: 241, team_id: nil, title: "바라볼수 있다면", genre1: "OST", genre2: "전체", runtime: "04:49", lyrics: "\n\t\t\t\t\t\t\t<div>바라볼수 있다면 - 04:49</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가사 정보가 없습니다.</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16132421, lowkey: nil, highkey: nil},
  {album_id: 134, singer_id: 241, team_id: nil, title: "하나이기에 내겐...슬픔", genre1: "OST", genre2: "전체", runtime: "04:17", lyrics: "\n\t\t\t\t\t\t\t<div>하나이기에 내겐...슬픔 - 04:17</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">가사 정보가 없습니다.</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16132422, lowkey: nil, highkey: nil},
  {album_id: 134, singer_id: 241, team_id: nil, title: "열정", genre1: "OST", genre2: "전체", runtime: "04:39", lyrics: "\n\t\t\t\t\t\t\t<div>열정 - 04:39</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">언제나 너의 뒤에서 널 지키는 그림자로 남는데도 내 삶의 마지막까지 널 사랑해 \r\n이 모진 나의 운명은 언제나 날 시험하지만 기다려 이제 난 너의 곁으로 내 뜨거운 가슴을 안고 \r\n\r\n난 이렇게 세상을 거칠게 살아가지만 늘 내가 꿈꾸는 그곳에 네가 있어 \r\n하늘아 내가가는 이길에 비라도 내려주렴 메마른 나의 가슴이 한껏 적셔지게 \r\n지금은 잠시 멀리 네게서 멀어져 있는 나이지만 너를 언젠가 다시 만날 날을 기다려 \r\n\r\n언제나 너를 위해서 우리의 내일을 위해서 내 삶의 모든걸 바쳐 널 사랑해 \r\n뜨거운 나의 눈물이 깊은 네 가슴에 흘러 언젠가 네가 날 느낄 때까지 네 슬픔 머무는 그곳에 \r\n\r\n하늘아 내가 가는 이길에 비라도 내려주렴 메마른 나의 가슴이 \r\n한껏 적셔지게 지금은 잠시 멀리 네게서 멀어져 있는 나이지만 너를 언젠가 다시 만날 날을 기다려 \r\n언제나 너의 뒤에서 널 지키는 그림자로 남는대도 내 삶의 마지막까지 널 사랑해 \r\n\r\n이 모진 나의 운명은 언제나 날 시험하지만 기다려 이제 난 너의 곁으로 \r\n언제나 너를 위해서 우리의 내일을 위해서 내삶의 모든걸 다 바쳐 널 사랑해 \r\n마지막 나의 그날에도 내안에 널 간직 할게 언젠가 우리 함께 할때까지 내 뜨거운 가슴을 안고</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, youtube: nil, jacket: "http:#", jacket_middle: nil, jacket_small: nil, song_tjnum: 0, song_num: 16132423, lowkey: nil, highkey: nil},
